import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as D,q as v}from"./chunks/framework.B1z0IdBH.js";const f={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},C=["src","alt"],j={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,C)]),i("div",j,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(f,[["render",x],["__scopeId","data-v-d55950df"]]),M=JSON.parse(`[{"page_url":"https://eo.wikipedia.org/wiki/Lago_Debo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Niger_River_Center_Island.jpg","page_title":"Lago Debo","context_page_description":"Lago Débo aŭ Lago Debo estas lago en la centra parto de Malio, formita de sezonaj inundoj fare de la baseno de la Niĝera Rivero. Ĝi estas en la Interna Niĝera Delto de la Niĝera Rivero. Dum altnivelaj epokoj de la rivero, la delto formita de lagoj, rojoj kaj akvejoj formas parton de la Lago Débo. La interna delto havas multajn ampleksajn kanalojn, kiuj estas neprofundaj kaj inundeblaj marĉoj; tiu delto etendas ĉirkaŭ longo de 320 km kun larĝo de 80 km. La lago Débo dum altakva inunda sezono, estas je distanco de 80 km el Mopti, ĉe la suda pinto, kaj je 240 km el Timbuktuo, ĉe la nordorienta pinto. Ĝi estas la plej grandael multaj tiaj sezonaj humidejoj kaj lagoj kiuj formas la areon de la Interna Niĝera Delto, kaj la plej granda lago ene de Malio. Ties grando estas ege malpliigita dum la seka sezono de septembro al marto.\\nLa ekzisto de tiu lago nomita la \\"Granda Lago\\" ene de la interna delto de la Niĝera Rivero inter Jenne kaj Timbuktuo en Malio estis establita nur post etenda studo de mapoj de la regiono etende al la periodo ĉirkaŭ 1000 al 1900 p.K.; 400 mapoj estis studitaj dum tiu periodo."},{"page_url":"https://de.wikipedia.org/wiki/Bill_Youngman","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Bill_Youngman_Dresden.jpg","page_title":"Bill Youngman","context_page_description":"Bill Youngman ist ein Liveact, MC und Produzent der elektronischen Musikszene. Seine Wurzeln liegen in New York, und lebt in Berlin. Er bringt seit 1996 eigene Produktionen auf verschiedenen bekannten Labels heraus und bildet mit dem Künstler Neil Landstrumm den Liveact The Destroias."},{"page_url":"https://de.wikipedia.org/wiki/Maschinenfabrik_Seydelmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Seydelmann_Produktportfolio_1951.jpg","page_title":"Maschinenfabrik Seydelmann","context_page_description":"Die Maschinenfabrik Seydelmann KG ist ein deutsches Unternehmen für Maschinen und Anlagen zur Nahrungsmittelproduktion. Außerdem entwickelt das Unternehmen vollautomatisierte Produktionslinien. Vorwiegend sind die Maschinen und Produktionslinien bei der Herstellung von Wurst- und Fleischwaren im Einsatz, aber auch bei der Produktion von Fleischersatzprodukten aus pflanzenbasierten Proteinen, Käse-, Gemüse- und Fischprodukten sowie in der Süßwaren-, Suppen-, Backwaren-, Babynahrungs- und Pharmaindustrie.\\nFirmensitz ist Stuttgart, Produktionsstandort ist Aalen, beides in Baden-Württemberg. Das mittelständische Familienunternehmen in sechster Generation beschäftigt derzeit 350 Mitarbeiter und arbeitet weltweit mit einem Netzwerk aus selbständigen Vertriebspartnern. Die Maschinen werden auf fünf Kontinente und in über 150 Länder eingesetzt. Der Exportanteil liegt bei 80 Prozent."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D5%A5%D5%B2%D5%A1%D5%BF%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/42-aspetti_di_vita_quotidiana%2C_medicine%2C_Taccuino_Sanitatis.jpg","page_title":"Դեղատուն","context_page_description":"Դեղատուն, հիմնարկություն դեղորայքի պատրաստման, պահպանման և թողարկման համար։ Դեղորայքի պատրաստման լաբորատորիաներ եղել են դեռևս հին աշխարհի երկրներում ։\\nՀայաստանում փաստացի առաջին դեղատունը բացվել է 1868 թվականին Պետրոս Աղաջանովի շնորհիվ և մինչ օրս գործում է ներկայիս Գյումրի քաղաքում: Որպես պետականորեն կարգորոշված հիմնարկություն դեղատունը ստեղծվել է 8-րդ դարի, Բաղդադում, իսկ Ռուսաստանում՝ 1581 թվականին։ Հոկտեմբերյան մեծ հեղափոխության հաղթանակից հետո, ժողկոմսովետի 1918 թվականի դեկտեմբերի 28-ի դեկրետի համաձայն՝ դեղատներն ազգայնացվեցին և հանձնվեցին առժողկոմատի տնօրինությանը։"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CF%84%CE%BF%CE%BB%CF%8C%CF%81%CE%B5%CF%82_%CE%BD%CF%84%CE%B5%CE%BB_%CE%A1%CE%AF%CE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Dolores_del_R%C3%ADo.jpg","page_title":"Ντολόρες ντελ Ρίο","context_page_description":"Η Ντολόρες Ντελ Ρίο ήταν Μεξικανή ηθοποιός του σινεμά κατά τη διάρκεια των δεκαετιών του ’20 και του ‘30. Η καριέρα της ξεκίνησε το 1925 όταν την ανακάλυψε ο παραγωγός Edwin Carewe. Η Ρίο υπήρξε η πρώτη ηθοποιός του Αμερικανικού Νότου που αναδείχθηκε σε αστέρα πρώτου μέγεθος της βιομηχανίας θεάματος του Χόλιγουντ, θεωρούμενη ως η γυναικεία εκδοχή του Ροντόλφο Βαλεντίνο. Στη χώρα της θεωρείται η πιο σημαντική ηθοποιός του λεγόμενου «Χρυσού Αιώνα του Μεξικανικού Κινηματογράφου». Διέθετε, επίσης, ένα από τα ομορφότερα πρόσωπα του παγκόσμιου κινηματογράφου των ημερών της. Εκτός του σινεμά η Ντολόρες Ντελ Ρίο εμφανίσθηκε στη θεατρική σκηνή και στην Τηλεόραση, όπως και πήρε μέρος σε ραδιοφωνικές παραγωγές. Αξιοσημείωτες ήταν οι ερμηνείες της στις ταινίες του βωβού σινεμά «What Price Glory?», «Resurrection» και «Ramona»."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%B1%D1%81%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D1%81%D1%82%D1%8E%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Serb_costume_from_Risan%2C_late_19th_century.jpg","page_title":"Сербский национальный костюм","context_page_description":"Сербский народный костюм, как и любая традиционная одежда каждого народа, на данный момент практически не носится из-за урбанизации, индустриализации и растущего рынка международных тенденций в одежде. Широкий ассортимент региональных народных костюмов демонстрирует влияние исторического австрийского, венгерского, немецкого, итальянского и османского-турецкого влияний. Тем не менее, костюмы по-прежнему являются вершиной сербской народной культуры, и, учитывая попытки сохранить эту народную культуру, нередко можно было видеть сельских женщин в традиционных костюмах вплоть до конца правления президента Иосипа Броз Тито. Сегодня отдельные элементы традиционного костюма носят только некоторые пожилые люди в сельской местности, а полный комплект в рамках праздничных мероприятий и туристических достопримечательностей. Народный костюм — дорогое удовольствие, полный комплект стоит в районе 1500-2000 евро."},{"page_url":"https://it.wikipedia.org/wiki/Bawn","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Bawn_Wall_at_Ross_Castle.jpg","page_title":"Bawn","context_page_description":"Un bawn è un muro difensivo che circonda una casatorre irlandese. Si tratta di una versione anglicizzata del termine irlandese badhún, che significa \\"fortificazione per il bestiame\\": il suo obiettivo originale era quello di proteggere gli animali nel corso di un attacco."},{"page_url":"https://ms.wikipedia.org/wiki/Kumpulan_Tentera_Darat_B","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Oberbefehlshaber_Heeresgruppe.svg","page_title":"Kumpulan Tentera Darat B","context_page_description":"Kumpulan Tentera Darat B adalah nama tiga kumpulan tentera darat berlainan Jerman yang bertempur dalam Perang Dunia II."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B4%9D%E9%9B%B7%E5%8B%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Vue_d_ensemble210507_%2856%29.JPG","page_title":"贝雷勒","context_page_description":"貝雷勒是法國上法蘭西大區諾爾省的一個市鎮，位於該省東部，屬於埃爾普河畔阿韋訥區。該市鎮2009年時的人口為146人。"},{"page_url":"https://en.wikipedia.org/wiki/Guilford_Puteal","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Guilford_Puteal_in_British_Museum_2.jpg","page_title":"Guilford Puteal","context_page_description":"The Guilford Puteal is a Pentelic marble Ancient Roman sculpture. Its name derives from its use as a puteal or wellhead, and one of its previous owners, Frederick North, second Earl of Guilford. Its discovery in Corinth gives rise to an alternative modern name, the Corinth Puteal."},{"page_url":"https://it.wikipedia.org/wiki/Saint-%C3%89tienne-le-Molard","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/St.Etienne-le-Molard_%28Loire%2C_Fr%29%2C_%C3%A9glise_et_monument_aux_morts.JPG","page_title":"Saint-Étienne-le-Molard","context_page_description":"Saint-Étienne-le-Molard è un comune francese di 964 abitanti situato nel dipartimento della Loira della regione dell'Alvernia-Rodano-Alpi."},{"page_url":"https://it.wikipedia.org/wiki/Loto%C5%A1inskij_rajon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Coat_of_Arms_of_Lotoshino_rayon_%28Moscow_oblast%29.png","page_title":"Lotošinskij rajon","context_page_description":"Il Lotošinskij rajon è un rajon dell'Oblast' di Mosca, nella Russia europea; il capoluogo è Lotošino. Istituito nel 1929, ricopre una superficie di 1.000 chilometri quadrati ed ospita una popolazione di circa 17.000 abitanti."},{"page_url":"https://it.wikipedia.org/wiki/Jordan_Rhodes","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/JordanRhodesBlackburnRovers.JPG","page_title":"Jordan Rhodes","context_page_description":"Jordan Luke Rhodes è un calciatore scozzese, attaccante dello Sheffield Wednesday.\\nCresciuto nelle giovanili dell'Ipswich Town, in carriera ha vinto un campionato di League Two con la maglia del Brentford, nella stagione 2008-2009."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%83%D0%BB%D0%B8%D1%86%D1%8F_%D0%9C%D1%83%D0%BD%D0%B4%D1%8F%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/%D0%92%D1%83%D0%BB%D0%B8%D1%86%D1%8F_%D0%9C%D1%83%D0%BD%D0%B4%D1%8F%D0%BA_%28%D0%9B%D1%8C%D0%B2%D1%96%D0%B2%29_01.JPG","page_title":"Вулиця Мундяк","context_page_description":"Ву́лиця Мундя́к — вулиця в Залізничному районі Львова на Левандівці. Бічна вулиці Калнишевського, від якої веде нумерацію будинків. Вулиця має ґрунтове покриття, без хідників."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D1%8B%D0%B5_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B8_%D1%82%D0%B8%D0%BF%D0%B0_%C2%AB%D0%AE%D1%81%D0%B8%D0%BE%C2%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Mochishio_%28Yuushio_class_submarine%29.jpg","page_title":"Подводные лодки типа «Юсио»","context_page_description":"Подводные лодки типа «Юсио» — серия японских дизель-электрических подводных лодок. Спроектированы в начале 1970-х годов. С 1976 по 1989 год было построено 10 подводных лодок этого типа, которые оставались в строю до конца 1990-х — начала 2000-х годов, когда они были сменены более современными типами «Харусио» и «Оясио» и сняты с вооружения. По состоянию на начало 2008 года, единственная уцелевшая подводная лодка этого типа, «Юкисио», используется в роли учебной, остальные же были пущены на слом."},{"page_url":"https://es.wikipedia.org/wiki/Ciencia_de_materiales","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Materials_science_tetrahedron%3Bstructure%2C_processing%2C_performance%2C_and_proprerties.svg","page_title":"Ciencia de materiales","context_page_description":"La Ciencia de los materiales es el campo científico encargado de investigar la relación entre la estructura y las propiedades de los materiales. Paralelamente, conviene matizar que la ingeniería de materiales se fundamenta en esta, las relaciones propiedades-estructura-procesamiento-funcionamiento, y diseña o proyecta alguna estructura posible del material, para conseguir un conjunto predeterminado de propiedades.\\nLa ciencia de materiales es, por ello mismo, un campo multidisciplinario que estudia los conocimientos fundamentales sobre las propiedades físicas macroscópicas de los materiales y los aplica en varias áreas de la ciencia y la ingeniería, consiguiendo que estos puedan ser utilizados en obras, máquinas y herramientas diversas, o convertidos en productos necesarios o requeridos por la sociedad. Incluye elementos de la química y física, así como las ingenierías química, mecánica, civil y eléctrica o medicina, industrial, biología y ciencias ambientales. Con la atención de los medios puesta en la nanociencia y la nanotecnología en los últimos años, la ciencia de los materiales ha sido impulsada en muchas universidades."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BF%D0%B0%D1%82%D1%83%D1%80%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Cup_Apatouria_Louvre_G138.jpg","page_title":"Апатурії","context_page_description":"Апату́рії — свята на честь Аполлона, встановлені в Афінах. Під час апатурій хлопців, народжених впродовж року, заносили до списку громадян."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%A9%E3%82%A4%E3%82%A2%E3%82%AF%E3%83%AA%E3%83%95%E3%83%9E%E3%83%8A%E3%83%BC_(%E3%83%8B%E3%83%A5%E3%83%BC%E3%83%A8%E3%83%BC%E3%82%AF%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/William_Rockefeller.jpg","page_title":"ブライアクリフマナー (ニューヨーク州)","context_page_description":"ブライアクリフマナーは、アメリカ合衆国ニューヨーク州の南部、ウエストチェスター郡の郊外村であり、ニューヨーク市の北約30マイル にある。ハドソン川の東岸に広さは5.9平方マイル あり、地理的にはマウントプレザントとオシニング各町の中に入っている。村内にはスカボローとチルマークの地域社会が入っており、メトロノース鉄道ハドソン線のスカボロー駅がある。村内で広さ376エーカー ある建物と家屋のある地区はスカボロー歴史地区に属しており、1984年にアメリカ合衆国国家歴史登録財に登録された。村のモットーは「2つの川の間の村」であり、ハドソン川とポカンティコ川に挟まれているその位置を反映している。ポカンティコ川はマウントプレザント町とオシニング町の町境だが、ブライアクリフマナーはその法人化以来マウントプレザントの中に広がってきた。\\n先コロンブス期に現在ブライアクリフマナーがある地域には、ワッピンガー族インディアンの1バンドが住んでいた。19世紀初期、この地域はウィットソンズ・コーナーズと呼ばれていた。ウォルター・ウィリアム・ローがこの地域に入って来て、1890年代に土地を購入した。ローが村を開発し、学校、教会、公園を造り、ブライアクリフ・ロッジを建てた。ブライアクリフマナーは1902年に村として法人化され、2002年11月21日には設立100周年を祝った。設立時に331人だった人口は、2010年で7,867人にまで増加した。\\nブライアクリフマナーは主に住宅地であり、住民は比較的裕福である。レクリエーション施設と公園の総計で180エーカー あり、すべて住民に公開されている。キリスト教の諸会派の教会が7棟、ユダヤ教のシナゴーグが2棟ある。最古の教会は1851年に建設されたセントメアリーズ聖公会教会である。ブライアクリフマナーは選挙で選ばれる役人による村政府があり、組織としては警察署、消防署、レクリエーション部、公共事業部がある。犯罪率は低く、2012年の調査では、州内で2番目に低い自治体だった。ニューヨーク州議会下院では、第95選挙区と第92選挙区に入り、上院では第38選挙区と第40選挙区に入っている。アメリカ合衆国下院ではニューヨーク州第17選挙区に含まれている。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D1%83%D0%B9%D0%B8%D0%B3%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/RuyigiHopital.JPG","page_title":"Руйиги","context_page_description":"Руйиги — город на востоке Бурунди, административный центр одноимённой провинции."},{"page_url":"https://en.wikipedia.org/wiki/United_States_Exploring_Expedition","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Charles_wilkes_part1.png","page_title":"United States Exploring Expedition","context_page_description":"The United States Exploring Expedition of 1838–1842 was an exploring and surveying expedition of the Pacific Ocean and surrounding lands conducted by the United States. The original appointed commanding officer was Commodore Thomas ap Catesby Jones. Funding for the original expedition was requested by President John Quincy Adams in 1828, however, Congress would not implement funding until eight years later. In May 1836, the oceanic exploration voyage was finally authorized by Congress and created by President Andrew Jackson.\\nThe expedition is sometimes called the \\"U.S. Ex. Ex.\\" for short, or the \\"Wilkes Expedition\\" in honor of its next appointed commanding officer, United States Navy Lieutenant Charles Wilkes. The expedition was of major importance to the growth of science in the United States, in particular the then-young field of oceanography. During the event, armed conflict between Pacific islanders and the expedition was common and dozens of natives were killed in action, as well as a few Americans."},{"page_url":"https://fr.wikipedia.org/wiki/Mosqu%C3%A9e_El_Habibi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Mosqu%C3%A9e_El_Habibi_photo_2_%D8%A7%D9%84%D9%85%D8%B3%D8%AC%D8%AF_%D8%A7%D9%84%D8%AD%D8%A8%D9%8A%D8%A8%D9%8A.jpg","page_title":"Mosquée El Habibi","context_page_description":"La mosquée El Habibi, également connue sous le nom de mosquée Bou Dhebena, est une mosquée tunisienne située au centre de la médina de Tunis."},{"page_url":"https://be.wikipedia.org/wiki/%D0%94%D1%8D%D0%BA%D0%B0%D0%BB%D0%BE%D0%B3,_%D1%82%D1%80%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Daniel_Olbrychski.jpg","page_title":"Дэкалог, тры","context_page_description":"«Дэкало́г, тры» — трэцяя частка дзесяцісерыйнага тэлецыкла «Дэкалог», прысвечанага Дзесяці запаведзям. Фільм зняты ў 1988 годзе польскім кінарэжысёрам Кшыштафам Кеслёўскім. Прэм’ера фільма адбылася 18 мая 1990 года.\\nФільм «Дэкалог, тры» адпавядае трэцяй з Дзесяці запаведзяў: «Памятай дзень святы святкаваць»."},{"page_url":"https://de.wikipedia.org/wiki/Rothem%C3%BChl","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Rothem%C3%BChl_-_OE_NW.jpg","page_title":"Rothemühl","context_page_description":"Rothemühl ist eine Gemeinde im Landkreis Vorpommern-Greifswald in Mecklenburg-Vorpommern. Sie wird vom Amt Torgelow-Ferdinandshof mit Sitz in der Stadt Torgelow verwaltet."},{"page_url":"https://fr.wikipedia.org/wiki/Chlef","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Hotel_Mirador_Cal%C3%A8che.jpg","page_title":"Chlef","context_page_description":"Chlef, anciennement Castellum Tingitanum à l'époque romaine, puis El Esnam et rebaptisée Orléansville à l'époque française, est une commune algérienne située dans le nord de l'Algérie, dans la wilaya de Chlef dont elle est le chef-lieu, Chlef est à mi-chemin entre Alger, la capitale, et Oran, deuxième ville d'Algérie.\\nLa ville comptait 226 025 habitants en 2018, soit environ 20 % de la population de la wilaya de Chlef, ce qui en fait la commune la plus peuplée de la wilaya et la troisième du nord-ouest, après Oran et Tiaret. En 2008, Chlef est la dixième grande ville du pays de par sa population estimée à 179 768 habitants. Ses habitants sont appelés les Chélifiens.\\nSe situant dans une zone sismique, la ville a connu deux tremblements de terre dévastateurs. Le premier, le 9 septembre 1954, et le second, le 10 octobre 1980 qui a ruiné la ville en détruisant 80 % de sa structure. Après ce nouvel événement tragique, la ville a changé de nom de El Asnam à Chlef en 1982, qui provient du nom du cours d'eau qui la traverse, en l'occurrence le Chelif."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_Tarragona_(perif%C3%A8ria)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/505_Edifici_de_la_llibreria_La_Rambla%2C_Rambla_Nova_97.jpg","page_title":"Llista de monuments de Tarragona (perifèria)","context_page_description":"Llista de monuments de Tarragona inclosos en l'Inventari del Patrimoni Arquitectònic Català corresponents als districtes de Tarragona tret de Part Alta. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monuments històrics i els Béns Culturals d'Interès Local de caràcter arquitectònic.\\nOnze monuments arquitectònic i arqueològics romans formen part del conjunt arqueològic de Tàrraco, declarat Patrimoni de la Humanitat l'any 2000. Tot el terme municipal de Tarragona està protegit com a zona arqueològica, declarat BCIN l'any 1966 amb el codi RI-55-0000068. El nucli antic de Tarragona, en la part alta de la ciutat, està protegit com a conjunt històric declarat BCIN l'any 1966 amb el codi RI-53-0000073."},{"page_url":"https://en.wikipedia.org/wiki/Skat_(yacht)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Yacht_SKAT.JPG","page_title":"Skat (yacht)","context_page_description":"Skat is a luxury yacht built by Lürssen of Bremen, Germany as project 9906, a number prominently displayed on the hull in a typeface matching that of military vessels. The project started in November 1999 and the yacht launched in 2001. The owner is Charles Simonyi, a former Software Engineer from Microsoft and the fifth space tourist. The yacht is 71 metres long.\\nSimonyi once had a Danish girlfriend who called him skat, literally \\"treasure\\", a common term of endearment similar to \\"honey\\" in English."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%A8%D8%B2%D8%B1%DA%AF%E2%80%8C%D8%AA%D8%B1%DB%8C%D9%86_%D8%B4%D9%87%D8%A7%D8%A8%E2%80%8C%D8%B3%D9%86%DA%AF%E2%80%8C%D9%87%D8%A7_%D8%A8%D8%B1_%D8%B1%D9%88%DB%8C_%D8%B2%D9%85%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/M%C3%A9t%C3%A9orite_Santa_Catharina%2C_exposition_M%C3%A9t%C3%A9orites%2C_Mus%C3%A9um_national_d%27histoire_naturelle_de_Paris.jpg","page_title":"فهرست بزرگ‌ترین شهاب‌سنگ‌ها بر روی زمین","context_page_description":"این فهرست شامل بزرگ‌ترین شهاب‌سنگ‌ها بر روی زمین است. یک شهاب‌واره واحد به هنگام ورود به جو غالباً متلاشی شده و به قطعات بیشتری تقسیم می‌شود؛ این قطعات کوچک‌تر بر جای مانده از شهاب‌واره‌ها را شهاب‌سنگ می‌نامند. در جدول زیر، بزرگ‌ترین قطعات شهاب‌سنگ که تاکنون بر روی سطح زمین کشف شده‌اند، فهرست شده‌اند."},{"page_url":"https://en.wikipedia.org/wiki/List_of_sport_utility_vehicles","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Venucia_T70_01_China_2015-04-06.jpg","page_title":"List of sport utility vehicles","context_page_description":"This page lists sport utility vehicles currently in production as well as past models. The list includes crossover SUVs, Mini SUVs, Compact SUVs and other similar vehicles. Also includes hybrid, luxury, sport or tuned, military, electric and fuel cell versions. Due to confusion, Sport Utility Trucks are also in this list.\\nNote: Many of the vehicles are related to other vehicles in the list. A vehicle listed as a 'past model' may still be in production in an updated form under a different name, it may be listed under that name in the 'currently in production' section. Also, some vehicles are sold under different marques in different geographical locations, therefore some vehicles may be listed more than once but usually link to the same page. Different states may also classify vehicles differently. What may be considered an SUV in one state, may not in another state. Example; The Chevrolet Nafees is known as the Chevrolet Zeeyan in Russia and Brazil, and in Australia and New Zealand, it is marketed by GM Holden. Some images provided below may be pictures of outdated models."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AF%E0%B3%81._%E0%B2%86%E0%B2%B0%E0%B3%8D._%E0%B2%B0%E0%B2%BE%E0%B2%B5%E0%B3%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/U_R_Rao.jpg","page_title":"ಯು. ಆರ್. ರಾವ್","context_page_description":"ಡಾ ಯು.ಆರ್.ರಾವ್, ಎಂದೇ ಅವರ ಗೆಳೆಯರಿಗೆ, ಆತ್ಮೀಯರಿಗೆ, ಸಹೋದ್ಯೋಗಿಗಳಿಗೆ ಚಿರಪರಿಚಿತರಾಗಿರುವ ಉಡುಪಿ ರಾಮಚಂದ್ರರಾವ್, 'ಭಾರತೀಯ ಬಾಹ್ಯಾಕಾಶ ಸಂಶೋಧನಾ ಸಂಸ್ಥೆ' ಯ ಮಾಜಿ ಮುಖ್ಯಸ್ಥರಾಗಿ ಮಹತ್ವದ ಸಾಧನೆಗಳನ್ನು ಮಾಡಿದ್ದಾರೆ. ರಾಮಚಂದ್ರ ರಾವ್, ಅಂತರ ರಾಷ್ಟ್ರೀಯ ವೈಮಾನಿಕ ಫೆಡರೇಷನ್‌ ಸಂಸ್ಥೆ, ಬಾಹ್ಯಾಕಾಶ ವಿಜ್ಞಾನದಲ್ಲಿ ಅತ್ಯುತ್ತಮ ಸೇವೆಸಲ್ಲಿಸಿದವರಲ್ಲಿ ಪ್ರಮುಖರು."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B5%96%E8%8D%89%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Leymus_cinereus_%285048924411%29.jpg","page_title":"赖草属","context_page_description":"赖草属是禾本科下的一个属，为多年生草本植物。该属共有约30余种，分布于北半球温寒地带。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D0%BA%D0%BB%D0%B0%D0%BD%D0%BE%D0%B2_%D0%9E%D0%BB%D0%B5%D0%B3_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Baklanov_oleg_dmitrievich.jpg","page_title":"Бакланов Олег Дмитрович","context_page_description":"Олег Дмитрович Бакланов — радянський промисловець, Герой Соціалістичної Праці, кандидат технічних наук, голова Товариства дружби і співробітництва народів України і Росії, почесний член, член президії Російської академії космонавтики імені К. Е. Ціолковського, академік Міжнародної академії інформаційних технологій, Академії проблем безпеки, оборони і правопорядку. Депутат Верховної Ради СРСР 11-го скликання. Народний депутат СРСР. Член ЦК КПРС у 1986—1991 роках. Секретар ЦК КПРС. Почесний громадянин Харківської області."},{"page_url":"https://id.wikipedia.org/wiki/Remington_700","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Remington_Model_700.JPG","page_title":"Remington 700","context_page_description":"Senapan Remington 700 adalah senapan dengan sistem mekanisme bolt-action buatan Remington Arms sejak tahun 1962. Semua model dari senapan ini berbasis mekanisme centerfire bolt-cation. Magazen internal senapan ini biasanya dapat berisi 3, 4, atau 5 butir peluru tergantung dari besar kaliber senapan yang dibuat, bagian bawah reciever yang dibuat kadang kala berbentuk datar atau tidak agar akses penggantian Magazen menjadi lebih mudah. Senapan ini dapat juga dipesan dengan tambahan magazen box eksternal. Remington 700 tersedia dalam berbagai pilihan bentuk popor, laras dan kaliber, pilihan ini merupakan pengembangan dari Remington seri 721 dan 722 yang pertama kali diperkenalkan pada tahun 1948."},{"page_url":"https://cs.wikipedia.org/wiki/Aepisaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Aepisaurus.JPG","page_title":"Aepisaurus","context_page_description":"Aepisaurus byl býložravým dinosaurem, který dosahoval délky asi 15 metrů. Žil v době před asi 125 až 112 milióny let na území dnešní jihovýchodní Francie. Byl popsán francouzským paleontologem Paulem Gervaisem již roku 1852 a patří tak k vůbec prvním popsaným neptačím dinosaurům v kontinentální Evropě a vlastně i na světě. Byla z něj známa pouze jedna fosilizovaná pažní kost, dlouhá 90 cm a široká 33 a 25 cm resp. na rozšířených koncích. Dnes už je ztracena a existuje pouze její odlitek. Proto o tomto sauropodovi mnoho informací nemáme.\\nJe jisté, že šlo o velkého býložravého dinosaura s dlouhým krkem a ocasem, poměrně malou hlavou a čtyřmi sloupovitými končetinami. Přesnější systematické zařazení nebo podrobnější anatomické informace však budou k dispozici pouze v případě objevení dalšího fosilního materiálu."},{"page_url":"https://en.wikipedia.org/wiki/Vic_Buckingham","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Vic_Buckingham_%281960%29.jpg","page_title":"Vic Buckingham","context_page_description":"Victor Frederick Buckingham was an English footballer and manager.\\nHe played for the then second division side Tottenham Hotspur. As manager he won the 1954 FA Cup with West Bromwich Albion and finished runners-up in the Football League First Division. He had two periods with AFC Ajax, leading the side to the Dutch Championship of 1960. In 1964 Johan Cruijff made his league debut under him. In 1971, his FC Barcelona side finished as league runners-up and won the Spanish Cup. He also held manager positions with Fulham FC, Sheffield Wednesday and in Greece. Buckingham is considered to have been a pioneer of the footballing philosophy known as Total Football, later further developed by his protégé Johan Cruijff."},{"page_url":"https://en.wikipedia.org/wiki/Downtown_Ossining_Historic_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/House_at_23_South_Highland_Avenue%2C_Ossining%2C_NY.jpg","page_title":"Downtown Ossining Historic District","context_page_description":"The Downtown Ossining Historic District is located at the central crossroads of Ossining, New York, United States, and the village's traditional business district known as the Crescent. Among its many late 19th- and early 20th-century commercial buildings are many of the village's major landmarks—three bank buildings, four churches, its village hall, former post office and high school. It was recognized as a historic district in 1989 and listed on the National Register of Historic Places, as one of the few downtowns in Westchester County with its social and historical development intact.\\nOne of its contributing properties, the First Baptist Church of Ossining, was previously listed on the Register in 1973. The Old Croton Aqueduct, a portion of which passes through the district, was listed on the Register the following year and designated a National Historic Landmark in 1992. Among the architects represented in the district are Robert W. Gibson, Isaac G. Perry and James Gamble Rogers."},{"page_url":"https://en.wikipedia.org/wiki/Adam_A700","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Adam_A700.jpg","page_title":"Adam A700","context_page_description":"The Adam A700 AdamJet was a proposed six-seat civil utility aircraft developed by Adam Aircraft Industries starting in 2003. The aircraft was developed in parallel with the generally similar Adam A500, although while that aircraft is piston-engined, the A700 is powered by two Williams FJ33 turbofans. The two models have about 80% commonality.\\nThe prototype A700 first flew on July 28, 2003. Two conforming prototypes were built."},{"page_url":"https://ro.wikipedia.org/wiki/Or%C4%83%C8%99eni,_Harghita","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Josephinische_Landaufnahme_pg210.jpg","page_title":"Orășeni, Harghita","context_page_description":"Orășeni este un sat în comuna Mărtiniș din județul Harghita, Transilvania, România."},{"page_url":"https://en.wikipedia.org/wiki/Mokoma","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Mokoma_MTR_20110619_18.jpg","page_title":"Mokoma","context_page_description":"Mokoma is a Finnish thrash metal band formed in Lappeenranta in 1996. Their music also has grindcore and death metal influences with traditional Finnish melancholy.\\nMokoma started out as a creation of Marko Annala, who is the band's lead singer, and has been the band's only original bandmember. The name comes from Annala's former girlfriends' Karelian grandmother, who said \\"Voi siuta mokomaa\\". That means \\"Oh gosh, you and your tricks\\", basically in simple words when put into English. Mokoma is similar but slightly more gracious word to \\"damned\\" or \\"accursed\\". Through the years several members have come and gone, but only Marko has remained constant.\\nThe band started out as a more traditional rock band with their first two albums \\"Valu\\" and \\"Mokoman 120 päivää\\". However, both albums sold badly and they were eventually dropped when they suggested to their record company, that they wanted to play something more closer to their hearts, thrash metal. The group moved on and created their own record company, called Sakara Records, and released their third album \\"Kurimus\\", which is sometimes regarded as the first thrash metal album sung in Finnish."},{"page_url":"https://de.wikipedia.org/wiki/StB_VT_31%E2%80%9335","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Murtalbahn_Tamsweg_1993.jpg","page_title":"StB VT 31–35","context_page_description":"Die Triebfahrzeuge VT 31–35 der Steiermarkbahn und Bus sind schmalspurige Dieseltriebwagen mit einer Spurweite von 760 mm, die für die Murtalbahn entworfen wurden und auf dieser zum Einsatz kommen. Basierend auf dieser Fahrzeugtype wurden auch die Triebwagen der Reihe 5090 der ÖBB und eine Serie von Triebwagen der Zillertalbahn entwickelt."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A5%D0%BE%D1%85%D0%BA%D0%B5%D0%BD%D0%B8%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Hochkoenig.jpg","page_title":"Хохкениг","context_page_description":"Хохкeниг – највисоката планина во Берхтесгаденските Алпи во австриската провинција Салцбург, како и планинскиот венец како целина. Берхтесгаденските Алпи се дел од Северните Варовнички Алпи."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%AD%E0%B8%87%E0%B9%80%E0%B8%97%E0%B9%89%E0%B8%B2%E0%B8%99%E0%B8%B2%E0%B8%A3%E0%B8%B5%E0%B8%84%E0%B8%B2%E0%B8%87%E0%B8%81%E0%B8%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Paphiopedilum_callosum.jpg","page_title":"รองเท้านารีคางกบ","context_page_description":"รองเท้านารีคางกบ เป็นกล้วยไม้ชนิดหนึ่งในสกุลรองเท้านารีพบในแถบอินโดจีนไปจนถึงตะวันตกเฉียงเหนือของมาเลเซียตะวันตก พบที่ระดับสูงจากระดับน้ำทะเล 500-700 เมตร"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D1%82%D1%8B%D0%BD%D0%B8%D1%86%D1%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Hotynitsy1860.jpg","page_title":"Хотыницы","context_page_description":"Хоты́ницы — деревня в Большеврудском сельском поселении Волосовского района Ленинградской области."},{"page_url":"https://ro.wikipedia.org/wiki/R%C3%A2ndunic%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Philomela%2C_Procne_e_Tereus_-_Sebastiano_Del_Piombo%2C_Villa_Farnesina.jpg","page_title":"Rândunică","context_page_description":"Rândunica este o pasăre migratoare, insectivoră, din ordinul paseriformelor, care cuibărește din nordul Eurasiei până în Africa de Nord și în America de Nord și iernează în nordul Africii, Africa subsahariană, sudul Asiei, America de Sud și nordul Australiei. Sunt recunoscute opt subspecii.\\nEste o pasăre mică, are o lungime de 19 cm, mai mică decât vrabia, și o greutate de 16-24 g. Longevitatea maximă este de 15 ani și 11 luni. Are aripile lungi, înguste și ascuțite și coada adânc bifurcată, cu rectricele laterale foarte lungi. Fruntea este brun-roșcată, creștetul și spatele albastru-închis; aripile și coada negre, partea inferioară a gâtului brun-roșcată, pe piept o dungă lată albastru-închisă; restul părților inferioare, inclusiv tectricele subcodale și subalare, sunt alb-gălbui sau alb-brunii. Sexele sunt aproape identice, femela este mai puțin lucioasă, cu rectricele laterale ale cozii mai scurte. Zboară rapid, cu bătăi neregulate din aripi.\\nStrigătul este un „țivi-țivi”, iar cântecul un fel de ciripit îndelungat și variat. Hrana este alcătuită din insecte zburătoare, pe care le vânează exclusiv din zbor."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%88%D9%84%D9%8A%D9%88%D8%B3_%D8%B1%D9%88%D9%83%D9%88%D9%8A%D9%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/JuliusRockwell.jpg","page_title":"چوليوس روكويل","context_page_description":"چوليوس روكويل كان سياسى من امريكا."},{"page_url":"https://it.wikipedia.org/wiki/Dipinti_di_Giambattista_Tiepolo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Tiepolo_-Angelo_custode_-_Udine.jpg","page_title":"Dipinti di Giambattista Tiepolo","context_page_description":"Questa voce elenca i dipinti di Giambattista Tiepolo, in ordine cronologico."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Clark_County,_Indiana","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Old_Jeff_Temple.jpg","page_title":"National Register of Historic Places listings in Clark County, Indiana","context_page_description":"This is a list of the National Register of Historic Places listings in Clark County, Indiana.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Clark County, Indiana, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in an online map.\\nThere are 21 properties and districts listed on the National Register in the county. Another property was once listed but has been removed.\\nProperties and districts located in incorporated areas display the name of the municipality, while properties and districts in unincorporated areas display the name of their civil township. Properties and districts split between multiple jurisdictions display the names of all jurisdictions.\\nThis National Park Service list is complete through NPS recent listings posted August 14, 2020."},{"page_url":"https://ro.wikipedia.org/wiki/R%C3%A2urile_din_Regiunea_Odesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Rivers_od_obl.jpg","page_title":"Râurile din Regiunea Odesa","context_page_description":"Râurile din Regiunea Odesa sunt râurile care curg pe teritoriul Regiunii Odesa din Ucraina. Toate aceste râuri fac parte din bazinul hidrografic al Mării Negre. Ele pot fi împărțite în patru grupuri:\\nrâurile din bazinul Dunării\\nrâurile din bazinul Nistrului\\nrâurile din bazinul Bugului de Sud\\nrâurile din bazinul Mării Negre"},{"page_url":"https://eo.wikipedia.org/wiki/Jim_Carrey","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Jim-Carrey-2008.jpg","page_title":"Jim Carrey","context_page_description":"James Eugene Carrey estas kanada-usona aktoro, komikulo, verkisto, produktanto kaj artisto. Li estas konata pro siaj energiaj slapstikaj prezentoj. Carrey unue akiris agnoskon en Usono en 1990 post surteriĝanta rolo en la skizkomedia televidserio In Living Color. Liaj unuaj ĉefaj roloj en moviĝaj bildoj venis kun Ace Ventura: Pet Detective, Dumb and Dumber, The Mask, kaj Ace Ventura: When Nature Calls, siavice portretante Enigimisto en Batman Forever, kaj la ĉefrolo en Liar Liar.\\nCarrey akiris atenton ĉefrolante en serioaj roloj en The Truman Show kaj Man on the Moon, kun ĉiu gajnante al li Oran Globan Premion por Plej Bona Aktoro. En la 2000-aj jaroj, li akiris plian avizon por sia portretado de la Grinĉo en How the Grinch Stole Christmas kaj por la komedio Me, Myself & Irene, same kiel Bruce Almighty, Eternal Sunshine of the Spotless Mind, pro kiu li estis nomumita al la BAFTA Premio por Plejbona Aktoro en Gvida Rolo, Lemony Snicket's A Series of Unfortunate Events, Fun with Dick and Jane, Yes Man, Horton Hears a Who!, kaj A Christmas Carol.\\nEn la 2010-aj jaroj, Carrey ĉefrolis en Mr."},{"page_url":"https://fr.wikipedia.org/wiki/Sculpture_de_racines","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Fauteuil_racine_Chine_Quianlong_musee_arts_asiatiques_Nice.jpg","page_title":"Sculpture de racines","context_page_description":"La sculpture de racines est une forme d'art traditionnel chinois qui consiste à sculpter et polir des racines d'arbres en diverses créations artistiques, que ce soient des sculptures en tant que telles ou bien des objets d'ameublement. Les objets réalisés sont déterminés par la forme naturelle de la racine.\\nEn Chine, le développement du secteur de la sculpture de racines a des effets néfastes sur l'environnement. Les racines des arbres utilisées sont celles qui ont des formes et des textures particulières et de telles racines proviennent généralement d'espèces d'arbres à la croissance lente, qui ont tendance à pousser sur des sols fragiles et dont le déterrement peut aboutir à une dégradation irréversible du sol."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Augsburg-Lechhausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Evangelisch-Lutherische_Pfarrkirche_St._Markus.JPG","page_title":"Liste der Baudenkmäler in Augsburg-Lechhausen","context_page_description":"In der Liste der Baudenkmäler in Lechhausen sind die Baudenkmäler im\\nPlanungsraum Lechhausen\\n(VI)\\naufgelistet. Zu diesen Baudenkmälern gibt es auch eine Bildersammlung.\\nDiese Liste ist eine Teilliste der Liste der Baudenkmäler in Augsburg. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D1%80%D0%B0%D0%BD%D1%81%D1%81%D0%B8%D0%B1%D0%B8%D1%80%D1%81%D0%BA%D0%B0_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B8%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/PG-Aa76.jpg","page_title":"Транссибирска железница","context_page_description":"Транссибирска железница, скраћено Транссиб, је мрежа железница која спајају Москву и Европски део Русије са Руским далеким истоком, Монголијом, Народном Републиком Кином и Јапанским морем.\\nГлавна траса железнице саобраћа између Москве и Владивостока преко Сибира. Железница је дугачка 9.288 km и грађена је између 1891–1916. године. Протеже се на преко 8 временских зона и потребно је седам дана да се пређе цела дужина железнице, што је чини трећом железницом по дужини на свету, после Доњецк-Владивосток и Москва-Пјонгјанг.\\nДруга траса, Трансманџурска железница, која иде упоредно са Транссибирском и која иде скроз до Тарскаје. Од Тарскаје]], Трансманџурска железница иде југоисточно ка Кини и продужава до Пекинга.\\nТрећа траса, Трансмонголска железница, која се састоји из Транссибирске трасе до Улан Удеа на источној обали Бајкалског језера. Од Улан Удеа Трансмонголска железница продужава јужно ка Улан Батору и Пекингу.\\nЧетврта траса је завршена 1991, после скоро пет деценија споре изградње. Под називом Бајкалскоамурска железница, протеже се од Транссибирске линије код Бајкалског језера, ка Пацифику."},{"page_url":"https://de.wikipedia.org/wiki/Atlantic_City_(Wyoming)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Atlantic_city_6.jpg","page_title":"Atlantic City (Wyoming)","context_page_description":"Atlantic City ist ein Census-designated place in Fremont County, Wyoming, Vereinigte Staaten. Die Bevölkerungsanzahl betrug 2010 laut Volkszählung 37. Das Dorf ist eine kleine Bergwerkssiedlung in einer Bergschlucht nahe dem South Pass im südwestlichen Wyoming. Es wurde im Anschluss an den Goldrausch 1867 als Bergwerkslager gegründet.\\nDer Ort gilt heute als Ghost town, nachdem die Zahl der Einwohner von ehemals über 2000 zu Bergwerkszeiten bis etwa 1900 auf deutlich unter 100 gefallen war. Seitdem gab es nur noch geringe Schwankungen. In der Streusiedlung gibt es nur wenig Infrastruktur. Seit etwa 2015 steigt die Zahl der Langstreckenwanderer auf dem Continental Divide Trail, der auf dem Kamm quer zum South Pass führt. Seitdem gibt es beschränkte Einkaufsmöglichkeiten im Ort, deren Sortiment sich nach den Bedürfnissen von Wanderern richtet."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1908","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/BenjaminMatthesBerghaus1848.jpg","page_title":"Lijst van personen overleden in 1908","context_page_description":"Dit is een lijst van personen die overleden zijn in 1908.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%84%EB%B0%94%EC%8B%9C%EB%A6%AC%EA%B5%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Hokkaido_Kitami-Abashiri-gun.png","page_title":"아바시리군","context_page_description":"아바시리 군은 일본 홋카이도 오호츠크 종합진흥국의 군이다.\\n인구 30,727명、면적 1,498.87km²、인구밀도 20.5명/km²。\\n이하 3정으로 구성된다.\\n오조라정\\n비호로정\\n쓰베쓰정"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B3%93%E7%AB%A5%E9%BE%8D%E5%8D%A0%E5%A9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Les_Temples_Cham_de_My_Son_2.jpg","page_title":"賓童龍占婆","context_page_description":"宾童龙占婆，越南后黎朝和阮主在占城地域设立的藩属国。\\n1471年，越南后黎朝攻破占城首都佛逝，占婆王国灭亡。立占城王族斋亚麻弗菴为傀儡，以占婆极南端的宾童龙之地封给他。原占城领土被一分为三：宾童龙占婆、华英、南蟠。后黎朝派流官监视，占族土司在此自治。\\n1592年，后黎朝的郑主和阮主开始对立割据。1611年，阮主阮潢攻打宾童龙占婆，夺取富安。1653年，阮福濒攻打宾童龙，宾童龙王巴弼献出潘郎江以北的土地，阮主在此设置宁和府、延庆府两府。\\n1691年，阮主阮福淍以宾童龙占婆王婆争不朝贡为由攻打宾童龙，婆争聚兵攻打延宁府。阮福淍派阮有镜领兵宾童龙，生擒婆争及其亲属等，囚禁在玉盏山。1692年，阮福淍兼并了宾童龙占婆和华英两国，改宾童龙占城国为顺城镇，在庯谐、潘切、麻离、潘郎驻军。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%92%99%E6%89%8E%E5%9B%BD%E5%AE%B6%E8%B5%9B%E8%BD%A6%E5%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Bundesarchiv_Bild_102-01321%2C_Italien%2C_Monza%2C_Autorennen.jpg","page_title":"蒙扎国家赛车场","context_page_description":"蒙札國家賽車場是位於義大利米蘭北部的蒙札附近的一座賽車場，於1922年9月3日啟用，經過歷次整修，現在可容納113,860名觀眾觀賽。在這個賽車場內舉行的最大型賽事是世界一級方程式錦標賽義大利大獎賽，並且在其建成伊始就成為了一級方程式賽車的舉辦地。除此之外，蒙札賽車場還舉辦世界摩托車錦標賽和世界房車錦標賽等國際賽事及一系列地方性賽事。\\n賽車場建於緊鄰皇家別墅的蒙札公園林地內，共有三條賽道：全長5.793公里的大獎賽賽道、全長2.405公里的小型賽道以及全長4.250公里的高速橢圓賽道。\\n蒙札賽車場曾經發生過多起重大事故，特別是在早年舉辦的大獎賽中，各種事故一共奪去了52名車手和35名觀眾的生命。賽道因此進行了歷次修改以保證觀眾安全及降低彎道速度，但現役車手仍認為賽道的缺少足夠的緩衝區域。"},{"page_url":"https://de.wikipedia.org/wiki/Angiodysplasie","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Hemangioma_01.jpg","page_title":"Angiodysplasie","context_page_description":"Als Angiodysplasien bezeichnet man Gefäßmissbildungen von Arterien, Venen oder Lymphgefäßen, welche in enormer Komplexität und Vielfalt vorkommen können. Als Synonym werden sie auch als vaskuläre Dysplasien bezeichnet."},{"page_url":"https://sk.wikipedia.org/wiki/Ernst_Cassirer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Ernst_Cassirer.jpg","page_title":"Ernst Cassirer","context_page_description":"Ernst Cassirer bol nemecký filozof, predstaviteľ marburskej školy novokantovstva. Venoval sa výskumu dejín filozofických problémov. V dejinách vedy a filozofie objavil vývin od predmetnosti k funkčne-relačnému mysleniu.\\nCassirer je azda najvýznamnejší historik transcendentálnej filozofie, ktorej rozvoj sa datuje od renesancie poukazujúc aj na jej špecifické použitie v súčasnej matematike, fyzike a chémii.\\nSnažil sa vylúčiť z pojmov všetky substančné vzťahy a vyjadriť ich takmer výlučne pojmom funkcie a symbolov."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B5%D1%81%D0%BA%D0%B8%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Mezquita_planta_antes_1236.jpg","page_title":"Мескита","context_page_description":"Мески́та, или Кóрдовская соборная мечеть — римско-католический собор, расположенный в андалусском городе Кордова. В Средневековье была второй по величине мечетью в мире. Является, возможно, самым замечательным памятником династии Омейядов. После испанской Реконкисты была преобразована в церковь, а некоторые детали интерьера, вроде колонн и арок, были стилистически заменены на византийский лад."},{"page_url":"https://de.wikipedia.org/wiki/Gastst%C3%A4tte","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Kleehaas_In_der_Wirtsstube.jpg","page_title":"Gaststätte","context_page_description":"Eine Gaststätte, auch „Gasthaus“, „Gasthof“, „Wirtshaus“, „Gastwirtschaft“ oder kurz „Wirtschaft“ oder „Schänke“, ist ein Betrieb im Gastgewerbe, in dem Getränke oder Speisen zum sofortigen Verzehr verkauft werden und der dafür eine Aufenthaltsmöglichkeit bietet. Für den Aufenthalt der Gäste verfügt er über eine oder mehrere „Gaststuben“ sowie teils auch über einen „Gastgarten“ oder eine Hausbar. Neben Gastronomie wird manchmal auch Beherbergung angeboten; die Erscheinungsform ist regional unterschiedlich – teils werden einzelne Formen je nach dem Vorhandensein von Beherbergung namentlich unterschieden. Oft und vor allem im ländlichen Raum sind auch andere Gastbetriebsarten angeschlossen, etwa Räume für Festlichkeiten, Tanzlokale, oder eine sportliche Infrastruktur wie Kegelbahnen und Kinderspielplätze. Der Übergang zum gehobenen Hotel oder Restaurant ist fließend und regional unterschiedlich. Aus Traditionsgründen kann es vorkommen, dass sich auch Betriebe mit der Einrichtung und Ausstattung erstklassiger Hotels und Restaurants als „Gasthof“ oder „Gasthaus“ bezeichnen."},{"page_url":"https://pt.wikipedia.org/wiki/Programa_de_troca_de_seringas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Who_needs_a_virtual_world%3F.jpg","page_title":"Programa de troca de seringas","context_page_description":"Um programa de troca de seringas é um serviço social que permite a pessoas que usam drogas injetáveis obter agulhas hipodérmicas e outros utensílios a baixo custo ou de forma gratuita. Tem por base o conceito de redução de danos que procura diminuir os fatores de risco de doenças como a SIDA e a hepatite. Embora os programas de troca de seringas forneçam o equipamento de forma gratuita, geralmente requerem que o utilizador devolva as seringas usadas para receber um número igual de novas seringas.\\nA Organização Mundial de Saúde afirma que os programas de troca de seringas diminuem significativamente e a baixo custo a transmissão do VIH entre toxicodependentes, não havendo evidências de que contribua para aumentar o consumo de drogas, tanto a nível individual como social."},{"page_url":"https://ast.wikipedia.org/wiki/Torre_Costa_Rica","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/A_Coru%C3%B1a_-_Torre_Costa_Rica_%28Torre_Herc%C3%B3n%29_03.JPG","page_title":"Torre Costa Rica","context_page_description":"La Torre Costa Rica o Torre Hercón, ye un rascacielos allugáu en La Coruña, España. Con sos 119 metros d'altor, ye l'edificiu más altu de Galicia, y el decimoctavu d'España.\\nConstruyida ente 1973 y 1975, foi diseñada pol arquiteutu coruñés José Antonio Franco Taboada, y quitó-y el puestu d'edificiu más altu de Galicia a la coruñesa Torre Galicia, de 80 metros d'altor.\\nDestinada a un usu mistu, ta situada na cai Costa Rica, nel centru de La Coruña."},{"page_url":"https://nl.wikipedia.org/wiki/Indira_Varma","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Indira_Varma.jpg","page_title":"Indira Varma","context_page_description":"Indira Anne Varma is een Britse actrice."},{"page_url":"https://en.wikipedia.org/wiki/Grand_Duchess_Kira_Kirillovna_of_Russia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Princess_Kyra.jpg","page_title":"Grand Duchess Kira Kirillovna of Russia","context_page_description":"Grand Duchess Kira Kirillovna of Russia was the second daughter of Grand Duke Kirill Vladimirovich of Russia and Princess Victoria Melita of Saxe-Coburg and Gotha. She married the head of the German Imperial House, Prince Louis Ferdinand of Prussia."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%DA%AF%D9%84%D8%A7%D8%B3_%D9%87%D8%A7%DB%8C%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Douglas_Hyde_2.jpg","page_title":"داگلاس هاید","context_page_description":"داگلاس هاید سیاست‌مدار و نخستین رئیس‌جمهور ایرلند بود.\\nوی از سال ۱۹۳۸ تا ۱۹۴۵ رییس جمهور ایرلند بود، وی همچنین در سال ۱۹۳۸ به عنوان سناتور در مجلس ایرلند حضور داشت."},{"page_url":"https://en.wikipedia.org/wiki/List_of_high_schools_in_Oregon","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/The_Northwest_Academy_high_school_-_Portland_Oregon.jpg","page_title":"List of high schools in Oregon","context_page_description":"This is a list of high schools in the U.S. state of Oregon. Schools are listed in alphabetical order by city, then in alphabetical order by school name. Schools that have closed are listed separately."},{"page_url":"https://nl.wikipedia.org/wiki/Vairaatea","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Vairaatea2.jpg","page_title":"Vairaatea","context_page_description":"Vairaatea is een atol in de eilandengroep van de Tuamotuarchipel. Het atol hoort bestuurlijk tot de gemeente Nukutavake in 2017 woonden er 50 mensen, voornamelijk in het dorp Ahuroa in het noorden."},{"page_url":"https://war.wikipedia.org/wiki/Alepisaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Alepisaurus_ferox_on_deck.jpg","page_title":"Alepisaurus","context_page_description":"An Alepisaurus in uska genus han Actinopterygii. An Alepisaurus in nahilalakip ha familia nga Alepisauridae.\\nAn Alepisaurus amo la an genus nga ha familia nga Alepisauridae.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B8%D0%BC%D0%B5%D0%BD%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BB%D0%B0%D0%B7%D0%B5%D1%80%D0%BE%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/S%26W_.357_Magnum_With_Laser_Sight.jpg","page_title":"Применение лазеров","context_page_description":"С самого момента разработки лазер называли устройством, которое само ищет решаемые задачи. Лазеры нашли применение в самых различных областях. Лазер стал одним из самых значимых изобретений XX века."},{"page_url":"https://de.wikipedia.org/wiki/Babilonie","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Babilonie-Wall-Hauptburg-Nordosten.jpg","page_title":"Babilonie","context_page_description":"Die Babilonie ist eine bis auf 255,6 m Höhe liegende La-Tène-zeitliche Wallanlage am Nordrand einer Kuppe des Wiehengebirges oberhalb des Lübbecker Stadtteils Obermehnen im Kreis Minden-Lübbecke, Nordrhein-Westfalen. Germanisch bedeutet baben im lon oben im Wald."},{"page_url":"https://el.wikipedia.org/wiki/Curculionidae","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Parethelcus_pollinarius_front.jpg","page_title":"Curculionidae","context_page_description":"Τα Curculionidae είναι οικογένεια εντόμων από την τάξη των κολεοπτέρων. Παγκοσμίως αναφέρονται περίπου 50.000 είδη κατανεμημένα σε περίπου εκατό υποοικογένειες. Οι ειδικοί διαφωνούν με την κατανομή σε υποοικογένειες Στην Ευρώπη αναφέρονται δεκαέξι υποοικογένειες Οι Curculionidae σήμερα περιορίζονται σχετικά με αρχαιότερες απόψεις. Σήμερα οι οικογένειες Apionidae, Anthribidae, Attelabidae, Brachyceridae, Brentidae, Dryophthoridae, Erirhynidae, Nanophyidae, Nemonychidae, Oxycorynidae, Raymondinymidae, Rhynchitidae, και άλλα δεν κατατάσσονται πια στις Curculionidae, αλλά μαζί με αυτές σχηματίζουν την υπεροικογένεια Curculionoidea. Στον κατάλογο των Curculionoidea για την Ελλάδα αναφέρονται τώρα πια περισσότερα από επτακόσια είδη."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B0%82%E4%BF%AE%E5%AF%BA%E5%90%8D%E5%8F%A4%E5%B1%8B%E5%88%A5%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Sensh%C5%AB-ji_Nagoya_Betsu-in.jpg","page_title":"専修寺名古屋別院","context_page_description":"専修寺名古屋別院は愛知県名古屋市西区那古野一丁目にある真宗高田派の寺院。山号は高田山。本尊は阿弥陀如来立像で恵心僧都作と伝わる。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D1%80%D0%B5%D1%87%D1%8C%D0%B5_(%D0%9D%D0%BE%D0%B2%D0%BE%D1%81%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/%D0%A5%D1%80%D0%B0%D0%BC_%D0%9F%D0%BE%D0%BA%D1%80%D0%BE%D0%B2%D0%B0_%D0%9F%D1%80%D0%B5%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%8B_%D0%B2_%D0%97%D0%B0%D1%80%D0%B5%D1%87%D1%8C%D0%B5_%28%D0%9D%D0%BE%D0%B2%D0%BE%D1%81%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%29.JPG","page_title":"Заречье (Новосильский район)","context_page_description":"Заре́чье — село, административный центр Зареченского сельского поселения Новосильского района Орловской области."},{"page_url":"https://ro.wikipedia.org/wiki/Chevrolet_Spark","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/20150404_Chevrolet_Spark_01.jpg","page_title":"Chevrolet Spark","context_page_description":"Chevrolet Spark este o mașină urbană produsă de GM Coreea, comercializată inițial ca Daewoo Matiz. Acesta a fost disponibil doar ca un hatchback cu cinci uși.\\nPrima generație a modelului Daewoo Matiz a fost lansată în 1998 de divizia sud-coreeană General Motors, GM Korea, cunoscută anterior ca Daewoo Motors, înlocuind modelul Daewoo Tico. După ce compania General Motors a preluat controlul asupra Daewoo Motors în 2002, a fost comercializată din ce în ce mai mult sub emblema Chevrolet. Modelul din a doua generație a fost introdus în 2005, cu a treia generație lansată în 2010.\\nO versiune electrică, Chevrolet Spark EV, a fost lansată în S.U.A. pe piețele selectate din California și Oregon în iunie 2013. Spark EV a fost primul automobil electric de pasageri comercializat de General Motors, deoarece EV1 a fost întrerupt în 1999."},{"page_url":"https://en.wikipedia.org/wiki/Ratnik_(program)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/4thTankDivisionOpenDay17p2-06.jpg","page_title":"Ratnik (program)","context_page_description":"Ratnik is a Russian future infantry combat system. It is designed to improve the connectivity and combat effectiveness of combat personnel in the Russian Armed Forces. Improvements include modernised body armour, a helmet with a special eye monitor, communication systems, and special headphones. It includes 10 subsystems and 59 individual items. As of October 2016, it has already seen combat use."},{"page_url":"https://cs.wikipedia.org/wiki/Idyla_ze_star%C3%A9_Prahy","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Idyla.jpeg","page_title":"Idyla ze staré Prahy","context_page_description":"Idyla ze staré Prahy je název nedochovaného českého němého filmu, který v roce 1913 natočil pro svou společnost ASUM architekt a jeden z průkopníků české kinematografie Max Urban, a ve kterém hlavní roli vytvořila jeho manželka Andula Sedláčková."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Holsbeek","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Kortrijk-Dutsel_afspanning_1822.jpg","page_title":"Lijst van onroerend erfgoed in Holsbeek","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Holsbeek. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://nl.wikipedia.org/wiki/Winschoterdiep","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Location_Winschoterdiep.png","page_title":"Winschoterdiep","context_page_description":"Het Winschoterdiep is het kanaal dat loopt van Groningen, vanaf de aansluiting op het Eemskanaal, naar Winschoten waar het zich splitst in de Rensel, het laatste stukje naar Winschoten, en de aansluiting op de Pekel A. Het Winschoterdiep vormt de voortzetting van het Schuitendiep dat rond 1400 vanuit Groningen naar Foxhol werd gegraven."},{"page_url":"https://fi.wikipedia.org/wiki/Joan_Mir%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Portrait_of_Joan_Miro%2C_Barcelona_1935_June_13.jpg","page_title":"Joan Miró","context_page_description":"Joan Miró i Ferrà oli katalonialainen taidemaalari, kuvanveistäjä ja keraamikko. Mirón töitä on kuvattu surrealistisiksi, lapsenomaisiksi, katalonialaista kansallisylpeyttä ilmentäviksi ja alitajuntaa peilaaviksi.\\nTime-lehden kriitikon Robert Hughesin mukaan Miró on eräs niistä vuosien 1880 ja 1900 välillä syntyneistä taiteilijoista, jotka muokkasivat uudelleen kulttuuria ja tietoisuutta. Mirón tuotantoon sekoittuu useita osia modernismin kaikkein rohkeimmista taidesuuntauksista – kubismin maalaustaide, surrealismin runous ja dadan opit – ja ne muuntuvat omaksi, katsojille tutuksi tyyliksi, joka on kuitenkin välittömästi tunnistettavissa hänen omakseen."},{"page_url":"https://sv.wikipedia.org/wiki/Valaffisch","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Kr%C3%A4ftor_kr%C3%A4va_dessa_drycker.jpg","page_title":"Valaffisch","context_page_description":"En valaffisch är en form av propaganda i affisch- eller plakatformat som uttrycker ett politiskt budskap.\\nValaffischer används exempelvis i samband med allmänna val eller folkomröstningar och produceras av politiska partier och intresseorganisationer. Valaffischer har använts sedan mitten av 1800-talet.\\nI början var valaffischer enkla textmeddelanden som mest liknade en förstasida på en tidning. Senare anlitades ofta reklamfolk för utformningen, ibland har valaffischer även gestaltats av kända konstnärer som den i Sverige välkända affischen \\"Kräftor Kräva Dessa Drycker!\\" från 1922 som formgavs av Albert Engström i samband med kampanjen Folkomröstningen om rusdrycksförbud i Sverige.\\nTrots moderna kommunikationskanaler som television och internet tror en del forskare att valaffischen kommer att vara kvar ett tag till, delvis beroende på att det är tradition och att inget parti vågar ta det första steget till avskaffning."},{"page_url":"https://es.wikipedia.org/wiki/Juan_Alberto_de_Mecklemburgo-Schwerin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/COLLECTIE_TROPENMUSEUM_Groepsportret_tijdens_een_bezoek_van_Hertog_Johann_Albrecht_van_Mecklenburg_tevens_regent_van_het_hertogdom_Brunswijk_aan_Pakoe_Boewono_X_de_Susuhunan_van_Solo_TMnr_60001420.jpg","page_title":"Juan Alberto de Mecklemburgo-Schwerin","context_page_description":"El duque Juan Alberto de Mecklemburgo-Schwerin fue el quinto hijo del gran duque Federico Francisco II de Mecklemburgo-Schwerin y de la princesa Augusta de Reuss-Köstritz. Desde el 11 de abril de 1897 hasta el 9 de abril de 1901 fue regente del territorio del Gran Ducado de Mecklemburgo-Schwerin, y desde 1907 hasta 1913 regente del Ducado de Braunschweig. Fue un político alemán de ideas colonialistas."},{"page_url":"https://ja.wikipedia.org/wiki/IBM%E3%81%AE%E3%83%87%E3%82%A3%E3%82%B9%E3%82%AF%E8%A8%98%E6%86%B6%E8%A3%85%E7%BD%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/IBM_350_RAMAC.jpg","page_title":"IBMのディスク記憶装置","context_page_description":"IBMのディスク記憶装置ではIBMが開発したディスク記憶装置の歴史について解説する。そのほとんどはIBMサンノゼで開発されて、一部はIBMロチェスター、IBM藤沢で開発された。\\n1950年代にIBMによって開拓されたディスク記憶装置の発明はコンピュータ革命の重要な要素であった。ハードディスクドライブの基本的な機械構造はIBM 1301以来変わっていない。ディスクドライブの性能および特性は現在も同じ規格に基づいて測定されている。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Schlangenbad","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Musensitz_Schlangenbad_01.JPG","page_title":"Liste der Kulturdenkmäler in Schlangenbad","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Stadt Schlangenbad, Rheingau-Taunus-Kreis, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Stadtteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde.\\nDas Vorhandensein oder Fehlen eines Objekts in dieser Liste ist keine rechtsverbindliche Auskunft darüber, ob es Kulturdenkmal ist oder nicht: Diese Liste entspricht möglicherweise nicht dem aktuellen Stand der offiziellen Denkmaltopographie. Diese ist für Hessen in den entsprechenden Bänden der Denkmaltopographie Bundesrepublik Deutschland und im Internet unter DenkXweb – Kulturdenkmäler in Hessen einsehbar. Auch diese Quellen sind, obwohl sie durch das Landesamt für Denkmalpflege Hessen aktualisiert werden, nicht immer aktuell, da es im Denkmalbestand immer wieder Änderungen gibt."},{"page_url":"https://en.wikipedia.org/wiki/Ford_Falcon_(North_America)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/1960-Ford-Falcon-4dr-Sed.jpg","page_title":"Ford Falcon (North America)","context_page_description":"The Ford Falcon is a front-engine, rear-drive six passenger compact car produced by Ford from 1959 to 1970, across three generations. Introduced on September 2, 1959, the Falcon was a sales success for Ford initially, outselling contemporary rivals from Chrysler and General Motors, from October 8, 1959, the Falcon was offered in two-door and four-door sedan, two-door and four-door station wagon, two-door hardtop, convertible, sedan delivery and Ranchero pickup body configurations. For several years, the Falcon name was also used on passenger versions of the Ford Econoline van.\\nThe Falcon's television marketing featured the first animated appearances of the characters from Charles Schulz's acclaimed comic strip, Peanuts, with announcer contribution from Paul Frees.\\nVariations of the Ford Falcon were manufactured in Argentina, Australia, Canada, Chile and Mexico. Early Mexican built versions of the Ford Maverick used the Falcon Maverick name."},{"page_url":"https://en.wikipedia.org/wiki/2004_United_States_Senate_elections","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/INSenCounties04.png","page_title":"2004 United States Senate elections","context_page_description":"The 2004 United States Senate elections were held on November 2, 2004, with all Class 3 Senate seats being contested. They coincided with the re-election of George W. Bush as president and the United States House election, as well as many state and local elections. Senators who were elected in 1998, known as Senate Class 3, were seeking re-election or retiring in 2004. This was the third consecutive election for Senate Class 3 where the Democrats either broke even or lost seats. This also marked the first time since 1980 in which a presidential candidate from either party won with coattails in the Senate. As of 2018, these are the last elections held during a Presidential election year in which the Republicans made a net gain of seats."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%BB%D1%8C%D1%82%D0%BE%D0%B2%D1%8B%D0%B5_%D1%81%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D0%B5%D0%BD%D0%B8%D1%8F_%D0%9D%D0%B8%D0%B6%D0%BD%D0%B5%D0%B3%D0%BE_%D0%9D%D0%BE%D0%B2%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/%D0%9A%D0%BE%D0%B7%D1%8C%D0%BC%D0%BE%D0%B4%D0%B5%D0%BC%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%BD%D0%B0_%D0%A1%D0%BE%D1%84%D1%80%D0%BE%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%BF%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D0%B8.jpg","page_title":"Культовые сооружения Нижнего Новгорода","context_page_description":"Культовые сооружения Нижнего Новгорода — список культовых сооружений Нижнего Новгорода — православных, католических и протестантских соборов и церквей, а также синагог, мечетей и других.\\nК 1917 году в Нижнем Новгороде насчитывалось 56 православных церквей: четыре собора, 32 приходские церкви, 17 домовых при учреждениях, одна церковь на выставке и одна в Печерской слободе Нижегородского уезда, причисленная к благочинию приходских церквей города. Кроме того, в трёх монастырях было 15 церквей: 5 в Благовещенском монастыре, 3 в Крестовоздвиженском монастыре и 7 в Печерском мужском монастыре.\\nВ 1925—1943 годах в состав города вошли пригородные населённые пункты, насчитывавшие 15 церквей: Высоково, Сормово, Копосово, Гордеевка, Карповка, Молитовка, посёлок Молитовской фабрики, Ратманиха, Канавино, Гнилицы. Таким образом, в период с 1917 по 1991 год в Нижнем Новгороде было 86 православных храмов, 75 из которых использовались как приходские."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%BE%D1%80%D1%82_%D0%B2_%D0%98%D1%80%D0%B0%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Azadistadium.jpg","page_title":"Спорт в Иране","context_page_description":"В Иране развиваются многие виды спорта, как традиционные, так и современные. Тегеран, например, был первым городом на Ближнем Востоке в котором прошли Азиатские игры, и продолжает принимать крупные международные спортивные соревнования и по сей день. Вольная борьба традиционно считается национальным видом спорта, однако в настоящее время самым популярным в Иране видом спорта является футбол. Государственные расходы на спорт составляли в 2010 году около 80 миллионов долларов США или около 1 доллара на человека."},{"page_url":"https://pl.wikipedia.org/wiki/Thors_(Charente-Maritime)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/682_-_Mairie_-_Thors.jpg","page_title":"Thors (Charente-Maritime)","context_page_description":"Thors – miejscowość i gmina we Francji, w regionie Nowa Akwitania, w departamencie Charente-Maritime.\\nWedług danych na rok 1990 gminę zamieszkiwało 456 osób, a gęstość zaludnienia wynosiła 82 osób/km²."},{"page_url":"https://eo.wikipedia.org/wiki/Luga_(urbo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Luga_I_railway_station_asv2018-07.jpg","page_title":"Luga (urbo)","context_page_description":"Luga estas urbo en Leningrada provinco en Rusio.\\nKodo de OKATO de la urbo estas 41438.\\nLa urbo estis fondita kaj havas statuson de urbo ekde jaro 1777.\\nLa interurba telefona kodo estas 81272, la enurbaj telefonnumeroj estas kvinciferaj.\\nLa loka tempo estas la sama kiel moskva tempo.\\nGeografiaj koordinatoj de la urbo estas 58° 44′ N, 29° 51′ O.\\nLa urbo estas ĉe rivero Luga.\\nEn la urbo estas fervoja stacio.\\nEn jaro 1959 la urbo havis 25,5 mil loĝantojn.\\nEn jaro 2002 la urbo havis 40,4 mil loĝantojn."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%83%B3%E3%83%95%E3%82%A3%E3%83%BC%E3%83%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Map_of_comune_of_Configni_%28province_of_Rieti%2C_region_Lazio%2C_Italy%29.svg","page_title":"コンフィーニ","context_page_description":"コンフィーニは、イタリア共和国ラツィオ州リエーティ県にある、人口約600人の基礎自治体。"},{"page_url":"https://de.wikipedia.org/wiki/Deutsches_Theater_M%C3%BCnchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Deutsches_Theater_Muenchen_2004.jpg","page_title":"Deutsches Theater München","context_page_description":"Das Deutsche Theater in München in der Schwanthalerstraße 13 wurde am 26. September 1896 eröffnet. Das Programm umfasst mit Musicals, Tanz, Shows, Operetten und mit Konzerten internationaler Companys und Künstler weite Bereiche der darstellenden Unterhaltungskunst. Darüber hinaus verwandelt sich das Theater im Fasching alljährlich in Münchens größtes Ballhaus und bietet den Rahmen für zahlreiche Gesellschafts- und Kostümbälle. Das Deutsche Theater ist mit seinen rund 1.500 Sitzplätzen und rund 300 Vorstellungen pro Jahr das nach der Oper größte Theater in München und das größte und wohl auch berühmteste Gastspieltheater mit Vollbühne in Deutschland. Seit 1982 verantwortet die stadteigene „Deutsches Theater München Betriebsgesellschaft mit beschränkter Haftung“ den Spielbetrieb."},{"page_url":"https://en.wikipedia.org/wiki/Speed_Art_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Rembrandt_van_Rijn_Portrait_of_a_Forty-Year-Old_Woman%2C_possibly_Marretje_Cornelisdr._van_Grotewal%2C_1634.jpg","page_title":"Speed Art Museum","context_page_description":"The Speed Art Museum, originally known as the J.B. Speed Memorial Museum, now colloquially referred to as the Speed by locals, is the oldest, largest, and foremost museum of art in Kentucky. It is located in Louisville, Kentucky on Third Street next to the University of Louisville Belknap campus and receives around 180,000 visits annually.\\nThe museum offers visitors a variety of \\"art experiences\\" outside its collection and international exhibitions, including the Speed Concert Series, the Art Sparks Interactive Family Gallery, and the popular late-night event, After Hours at the Speed.\\nThe Speed houses ancient, classical, and modern art from around the world. The focus of the collection is Western art, from antiquity to the present day. Holdings of paintings from the Netherlands, French and Italian works, and contemporary art are particularly strong, with sculpture prominent throughout."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B8%D0%BE%D1%86%D0%B5%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Roman_Empire_with_dioceses_in_400_AD.png","page_title":"Диоцез","context_page_description":"Диоцез е термин от древногръцки произход, с който за първи път в Римската империя се означават териториални единици, субект на административна подялба. За първи път терминът е цитиран от Цицерон през I век пр.н.е. за обозначаване на данъчна повинност на Апамея Киботос и други райони. Прилагането му познава три исторически етапа:\\nПрез епохата на принципата римският диоцез е градски окръг или част от по-голямата териториална единица провинция.\\nПрез III век е проведена административно-териториална реформа на император Диоклециан. Империята е разделена на четири преториански префектури, действащи като доминиони или вицекралства, Те са управлявани от преториански префект или пряко от съимператорите на Тетрархията – двама августи и двама цезари. Префектурите са разделени на общо 12 региона, наречени диоцези и управлявани от викарий на епархия, пряко подчинен на съответния префект. Всеки диоцез се подразделя на провинции, които вече са по-нисша териториална единица, следвана единствено от муницпиите и полисите.\\nС приемането на християнството за официална религия от император Константин през 313 започва официална християнизация на Римската империя."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Pierre-du-Jonquet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Saint-Pierre-du-Jonquet_%C3%A9glise.JPG","page_title":"Saint-Pierre-du-Jonquet","context_page_description":"Saint-Pierre-du-Jonquet est une commune française, située dans le département du Calvados en région Normandie, peuplée de 237 habitants."},{"page_url":"https://nl.wikipedia.org/wiki/Dubbelkapel_(Maastricht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/StServatius-Treasury1.jpg","page_title":"Dubbelkapel (Maastricht)","context_page_description":"De Dubbelkapel, vroeger aangeduid als antiqua capella, kapittelhuis of stiftskapel, is een romaanse dubbelkapel met twee gescheiden verdiepingen in het Sint-Servaascomplex in de Nederlandse stad Maastricht. Het bouwwerk uit de elfde eeuw heeft in de loop der tijden diverse functies gehad en is tegenwoordig de huisvesting van de Schatkamer van de Sint-Servaasbasiliek. De beneden- en bovenkapel met aangrenzende ruimtes zijn uitsluitend toegankelijk vanuit de oostgang van de kruisgang van de Sint-Servaasbasiliek."},{"page_url":"https://ko.wikipedia.org/wiki/2009%EB%85%84_%EA%B7%B8%EB%A6%AC%EC%8A%A4_%EC%B4%9D%EC%84%A0%EA%B1%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Georgios_Karatzaferis_2011_%28cropped%29.jpg","page_title":"2009년 그리스 총선거","context_page_description":"그리스의 의회 선거가 2009년 10월 4일에 열렸다. 당초 의회 선거는 2011년 9월까지 실시해도 되지만, 9월 2일 코스타스 카라만리스 국무총리는 자신이 카롤로스 파풀리아스 대통령에게 의회 해산 및 조기 총선 실시를 요청했다고 발표하였다. 9월 9일에 그리스 의회가 해산되었다. 선거 결과, 중도 좌파 성향의 범그리스 사회주의 운동이 승리하여 정권 교체를 이루었다."},{"page_url":"https://fr.wikipedia.org/wiki/Ripisylve","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/AeroplanctonAeroplanktonMeungSurLoire2010_73.JPG","page_title":"Ripisylve","context_page_description":"La forêt riveraine, rivulaire ou ripisylve est l'ensemble des formations boisées, buissonnantes et herbacées présentes sur les rives d'un cours d'eau, d'une rivière ou d'un fleuve, la notion de rive désignant le bord du lit mineur du cours d'eau non submergée à l'étiage.\\nLa notion de ripisylve désigne généralement des formations boisées linéaires étalées le long de petits cours d'eau, sur une largeur de quelques mètres à quelques dizaines de mètres, ou moins.\\nIl semble qu'il faille bien distinguer la ripisylve, de la zone riparienne, dont cette forêt participe. L'usage courant cependant, utilise souvent le terme de ripisylve dans ce sens mais une ripisylve semble toujours \\"riparienne\\", mais une zone riparienne n'est pas nécessairement une ripisylve. La notion de zone riparienne quant à elle est proche de celle de \\"berge\\" mais plus précise et orientée vers l'écologie ou les sciences et arts du paysage ou de l'environnement tout comme la notion de ripisylve.\\nLes ripisylves jouent un rôle écologique important. En particulier, elles offrent des habitats naturel spécifiques, variant selon l'altitude et l'importance du cours d'eau."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A9%A7%EB%8F%84%EC%9A%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Scolopax_rusticola_MWNH_0171.JPG","page_title":"멧도요","context_page_description":"멧도요는 중간 크기의 물떼새아목의 새로, 온화한 아북극 유라시아에서 볼 수 있다."},{"page_url":"https://es.wikipedia.org/wiki/Ludovico_Manin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Santa_Maria_degli_Scalzi_%28Venice%29_-_Cappella_Manin.jpg","page_title":"Ludovico Manin","context_page_description":"Ludovico Manin fue un magnate veneciano que llegó al cargo de dux de la República de Venecia, siendo la última persona en desempeñar esa función pues en 1797 la República fue abolida por las tropas francesas de Napoleón Bonaparte, quien lo forzó a abdicar."},{"page_url":"https://el.wikipedia.org/wiki/%CE%95%CE%BB%CE%BB%CE%B7%CE%BD%CE%B9%CE%BA%CE%AD%CF%82_%CE%B2%CE%BF%CF%85%CE%BB%CE%B5%CF%85%CF%84%CE%B9%CE%BA%CE%AD%CF%82_%CE%B5%CE%BA%CE%BB%CE%BF%CE%B3%CE%AD%CF%82_%CE%9C%CE%B1%CE%90%CE%BF%CF%85_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Venizelos_in_Vienna_%282014%29.jpg","page_title":"Ελληνικές βουλευτικές εκλογές Μαΐου 2012","context_page_description":"Οι βουλευτικές εκλογές του Μαΐου 2012 διεξήχθησαν στις 6 Μαΐου από την Κυβέρνηση Λουκά Παπαδήμου.\\nΠρώτο κόμμα ήλθε η Νέα Δημοκρατία με 18,85% και 108 έδρες, δεύτερο κόμμα ο Συνασπισμός Ριζοσπαστικής Αριστεράς με 16,78% και 52 έδρες, τρίτο κόμμα το Πανελλήνιο Σοσιαλιστικό Κίνημα με 13,18% και 41 έδρες, τέταρτο κόμμα οι Ανεξάρτητοι Έλληνες με 10,62% και 33 έδρες, πέμπτο κόμμα το Κομμουνιστικό Κόμμα Ελλάδας με 8,48% και 26 έδρες, έκτο κόμμα η Χρυσή Αυγή με 6,97% και 21 έδρες, έβδομο και τελευταίο κόμμα η Δημοκρατική Αριστερά με 6,11% και 19 έδρες. Η κατανομή των εδρών έγινε με το σύστημα της ενισχυμένης αναλογικής.\\nΗ αποχή άγγιξε το 34,88% των εγγεγραμμένων ψηφοφορων.\\nΜετά το αποτέλεσμα των εκλογών δεν έγινε δυνατός ο σχηματισμός κυβέρνησης και έτσι σχηματίστηκε η Υπηρεσιακή κυβέρνηση Παναγιώτη Πικραμμένου 2012."},{"page_url":"https://de.wikipedia.org/wiki/Europastra%C3%9Fe_313","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/E313_Belgi%C3%AB.png","page_title":"Europastraße 313","context_page_description":"Die Europastraße 313 ist eine Europastraße, die die Städte Antwerpen und Lüttich miteinander verbindet. Sie verläuft ausschließlich durch Belgien und fällt mit der Autobahn A13 zusammen. Zwischen dem Autobahnkreuz Antwerpen-Ost und dem Autobahndreieck Ranst besteht eine Doppelnummerierung mit der Europastraße 34."},{"page_url":"https://pl.wikipedia.org/wiki/Shell_Lake_(Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Washburn_county_WI_Shell_Lake_IMG_1660.JPG","page_title":"Shell Lake (Wisconsin)","context_page_description":"Shell Lake – miasto w Stanach Zjednoczonych, w stanie Wisconsin, siedziba administracyjna hrabstwa Washburn."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CF%84%CE%B9%CE%B2%CE%B3%CE%B9%CE%AC%CE%BA%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/CenterOfDivjaka.jpeg","page_title":"Ντιβγιάκα","context_page_description":"Η Ντιβγιάκα είναι πόλη και δήμος στον νομό Φιέρ, στη δυτική Αλβανία. Ο δήμος σχηματίστηκε στη μεταρρύθμιση της τοπικής αυτοδιοίκησης το 2015 με τη συγχώνευση των πρώην δήμων Ντιβγιάκα, Γκραμπιάν, Γκραντίστα, Ρέμας και Τέρμπουφ, οι οποίοι έγιναν δημοτικές ενότητες. Η έδρα του δήμου είναι η πόλη Ντιβγιάκα. Ο συνολικός πληθυσμός είναι 34.254 και η συνολική έκταση 309,58 χλμ². Ο πληθυσμός του πρώην δήμου κατά την απογραφή του 2011 ήταν 8.445."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B8%D0%B1%D1%80%D0%B8%D0%B4%D0%BD%D1%8B%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Porsche_911_GT3_R_Hybrid.jpg","page_title":"Гибридный автомобиль","context_page_description":"Гибри́дный автомоби́ль — автомобиль, использующий для привода ведущих колёс более одного источника энергии.\\nСовременные автопроизводители часто прибегают к совместному использованию двигателя внутреннего сгорания и электродвигателя, что позволяет избежать работы ДВС в режиме малых нагрузок, а также реализовывать рекуперацию кинетической энергии, повышая топливную эффективность силовой установки. Другой распространённый вид гибридов — автомобили, в которых ДВС совмещён с двигателями, работающими на сжатом воздухе.\\nСледует отличать от гибридов транспортные средства с электромеханической трансмиссией, такие как тепловозы, некоторые карьерные самосвалы, тракторы типа ДЭТ-250 и танки."},{"page_url":"https://et.wikipedia.org/wiki/1948._aasta_male_maailmameistriv%C3%B5istlused","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Keres_-_Botvinnik_1948_5._partii.JPG","page_title":"1948. aasta male maailmameistrivõistlused","context_page_description":"1948. aasta male maailmameistrivõistlused oli viieringiline ringsüsteemis turniir male maailmameistri väljaselgitamiseks pärast maailmameister Aleksandr Alehhini ootamatut ja hämaratel asjaoludel surma temast vabaks jäänud troonile. Turniir peeti 1948. aastal märtsis-mais Haagis ja Moskvas ning selle võitis Mihhail Botvinnik. Turniiril osales ka Paul Keres."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kategorie-A-Bauwerke_in_Perth_and_Kinross","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Wade%27s_Bridge_over_the_River_Tay%2C_Aberfeldy_-_geograph.org.uk_-_432981.jpg","page_title":"Liste der Kategorie-A-Bauwerke in Perth and Kinross","context_page_description":"Die Liste der Kategorie-A-Gebäude in Perth and Kinross umfasst sämtliche in der Kategorie A eingetragenen Baudenkmäler in der schottischen Council Area Perth and Kinross. Die Einstufung wird anhand der Kriterien von Historic Scotland vorgenommen, wobei in die höchste Kategorie A Bauwerke von nationaler oder internationaler Bedeutung einsortiert sind. In Perth and Kinross sind derzeit 158 Bauwerke in der Kategorie A gelistet."},{"page_url":"https://es.wikipedia.org/wiki/Provincia_de_Tierra_del_Fuego,_Ant%C3%A1rtida_e_Islas_del_Atl%C3%A1ntico_Sur","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Ushuaia_port.JPG","page_title":"Provincia de Tierra del Fuego, Antártida e Islas del Atlántico Sur","context_page_description":"Tierra del Fuego, Antártida e Islas del Atlántico Sur, oficialmente Provincia de Tierra del Fuego, Antártida e Islas del Atlántico Sur, ​ es una de las 23 provincias que conforman la República Argentina. A su vez, es uno de los 24 estados autogobernados o jurisdicciones de primer orden​ que conforman el país, y uno de los 24 distritos electorales legislativos nacionales.​​ Su capital es Ushuaia y su ciudad más poblada, Río Grande.\\nEstá ubicada en la región patagónica, en el extremo sur de la Argentina, y ocupa un amplio territorio insular, marítimo y antártico, que se extiende desde la Isla Grande de Tierra del Fuego al polo Sur, incluyendo la isla de los Estados, las islas Malvinas, las islas del Atlántico Sur, la península Antártica, formando un triángulo cuyos lados son los meridianos 74°O y 25°O y su vértice el polo Sur. En la porción americana, la provincia limita al norte con la provincia de Santa Cruz, al oeste con Chile y al sur del canal de Beagle, también con Chile. En la Antártida, la provincia también limita al oeste con Chile, aunque los límites no están establecidos."},{"page_url":"https://pl.wikipedia.org/wiki/Hala_targowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Atlas_Sztuki%2C_Piotrkowska_114%2C_%C5%81%C3%B3d%C5%BA.jpg","page_title":"Hala targowa","context_page_description":"Hala targowa – handlowy budynek, w którym znajdują się stoiska z branży spożywczej, przemysłowej i usługowej. Wznoszono je w dużych miastach w XIX wieku w celu uporządkowania handlu. Zazwyczaj są to obiekty stanowiące cenny zabytek sztuki inżynierskiej."},{"page_url":"https://en.wikipedia.org/wiki/2009_Challenge_Cup_Final","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Wolves_Giants.jpg","page_title":"2009 Challenge Cup Final","context_page_description":"The 2009 Carnegie Challenge Cup Final was played on 29 August 2009 at Wembley Stadium, in London between Huddersfield Giants and Warrington Wolves. It was the first Challenge Cup final since 1985–86 that any of the 'Big Four' had failed to reach. It was the first final for Warrington in nineteen years, since they were beaten by Wigan in 1991. It was the second final in four years for Huddersfield following their appearance in the 2006 final, but their first appearance at Wembley Stadium in forty-seven years.\\nEn route to the final, Warrington defeated Wigan 39–26 in their semi final at the Stobart Stadium Halton in Widnes on 8 August 2009, and on the day after Huddersfield beat holders St Helens 24–14 in Warrington's Halliwell Jones Stadium."},{"page_url":"https://fi.wikipedia.org/wiki/Aba%C5%A1an_piirikunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Abasha_River.jpg","page_title":"Abašan piirikunta","context_page_description":"Abašan piirikunta on piirikunta Samegrelo ja Zemo Svanetin alueella Georgiassa. Piirikunnassa on noin 22 341 asukasta ja sen pinta-ala on 322.5 neliökilometriä. Sen hallinnollinen keskus on Abašan kaupunki.\\nPiirikunta sijaitsee Samegrelon alueen kaakkoisosassa Rioni-joen pohjoispuolella. Tbilisin ja Suhumin välinen rautatie kulkee piirikunnan läpi."},{"page_url":"https://fr.wikipedia.org/wiki/Constantin_Senlecq","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Constantin_Senlecq_%281842-1934%29.jpg","page_title":"Constantin Senlecq","context_page_description":"Constantin Senlecq, né le 9 octobre 1842 à Fauquembergues est mort le 4 février 1934 à Ardres, est un scientifique français, notamment créateur d'un appareil qui analyse, transporte, puis reconstitue l'image."},{"page_url":"https://en.wikipedia.org/wiki/Edith_Peters","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Svetovno_znane_pevke_sestre_Peters_so_se_ustavile_v_Mariboru_1958.jpg","page_title":"Edith Peters","context_page_description":"Edith Peters was an American singer and actress. She appeared in more than sixteen films from 1957 to 1981."},{"page_url":"https://en.wikipedia.org/wiki/Ananyiv","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Ananyiv_big_gerb.png","page_title":"Ananyiv","context_page_description":"Ananyiv is a city and the administrative center of Ananyiv Raion in Odessa Oblast, Ukraine. It stands on the Tyligul River. Population: 8,495\\nThe town belonged to Moldavian Autonomous Soviet Socialist Republic from 1924 to 1940."},{"page_url":"https://pt.wikipedia.org/wiki/Gavin_Volure","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Steve_Martin_by_David_Shankbone.jpg","page_title":"Gavin Volure","context_page_description":"\\"Gavin Volure\\" é o quarto episódio da terceira temporada da série de televisão americana de comédia, 30 Rock, e o quadragésimo da série. Foi escrito pelo co-produtor executivo John Riggi e dirigido por Gail Mancuso. O episódio foi originalmente exibido na National Broadcasting Company, nos Estados Unidos em 20 de Novembro de 2008. Estrelas convidadas neste episódio incluem John McEnroe, Steve Martin, e Bobb'e J. Thompson.\\nNeste episódio, Liz Lemon conhece um amigo de ses chefe Jack Donaghy, Gavin Volure, quando o par participa de um jantar. Gavin, após Jack oferecer uma oportunidade de negócio secreto, fica encantado com Liz. Jack encoraja o relacionamento até que ele descobre que Gavin não é tão bem sucedido como ele alega. Além disso, o paquete da NBC Kenneth Parcell investe seu dinheiro em negócios de Gavin. Enquanto isso, Tracy Jordan teme que seus filhos estão tentando matá-lo.\\n\\"Gavin Volure\\" recebeu boa recepção de críticos de televisão. De acordo com a Nielsen Media Research, foi assistido por 7.1 milhões de famílias durante a sua transmissão original."},{"page_url":"https://en.wikipedia.org/wiki/Oliver_Tobias","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Oliver_Tobias_%281969%29.jpg","page_title":"Oliver Tobias","context_page_description":"Oliver Tobias Freitag, known professionally as Oliver Tobias, is a Swiss-born UK-based film, stage, and television actor and director."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B3%D0%B0%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Sychrov-panorama.jpg","page_title":"Роганы","context_page_description":"Рога́н — один из трёх наиболее значительных баронских родов Бретани. Своё название берёт от городка Роан в нынешнем департаменте Морбиан. При старом режиме главы трёх ветвей рода носили следующие герцогские титулы — герцог де Монбазон, герцог де Роган и герцог де Роган-Роган.\\nПо своему значению во французской истории из баронских родов с Роганами могут соперничать разве что Монморанси. Неслучайно обе фамилии упоминаются рядом на первой странице «Войны и мира». О гордости Роганов ходили легенды. Средневековым баронам де Роган приписывался девиз «Королём быть не могу, до герцога не снисхожу, я — Роган».\\nПосле присоединения Бретани к Франции в начале XVI века Роганы выдвинулись на службе Валуа и Бурбонов. Они были не удовлетворены статусом пэров Франции и притязали на ранг иностранных принцев, что ставило их на один уровень с такими фамилиями, как Ла Тур д’Оверни и Круа. Для этого стремились вывести происхождение по мужской линии от древнейших королей и герцогов Бретани.\\nЛиния Роган-Субиз прекратилась в 1787 году, а линия Роган-Жиэ — в 1638 году."},{"page_url":"https://eu.wikipedia.org/wiki/Verrazano-Narrows_zubia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/USS_Leyte_Gulf_%28CG_55%29_under_the_Verrazano_Narrows_Bridge.jpg","page_title":"Verrazano-Narrows zubia","context_page_description":"Verrazano-Narrows zubia Ameriketako Estatu Batuetako New York hiriko Staten Island eta Brooklyn auzoen artean kokatzen den zubi eseki bat da. Hiri horretako Staten Island eta Brooklyn auzoak lotzen ditu. Bere erdialdeko zatiak 1.298 metro luze ditu. Bestalde, New York eta New Jersey hirietako portuetara doan trafiko gehienak zubi hau iragaten du.\\nZubi honen izenak iragaten duen The Narrows izeneko itsasartea eta 1524. urtean hura zeharkatu zuen lehenengo europarra izan zen Giovanni da Verrazzano italiar esploratzaileari lotua dago."},{"page_url":"https://pl.wikipedia.org/wiki/Puchar_Grecji_w_koszyk%C3%B3wce_m%C4%99%C5%BCczyzn","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Giallo_e_Nero_con_H.png","page_title":"Puchar Grecji w koszykówce mężczyzn","context_page_description":"Puchar Grecji w koszykówce mężczyzn – cykliczne krajowe rozgrywki sportowe, prowadzone systemem pucharowym, organizowane corocznie przez Grecką Federację Koszykówki dla greckich męskich klubów koszykarskich. Drugie – po mistrzostwach Grecji – rozgrywki w hierarchii ważności, w greckiej koszykówce."},{"page_url":"https://fr.wikipedia.org/wiki/Innimond","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Chapelle_Innimont.jpg","page_title":"Innimond","context_page_description":"Innimond, localement orthographiée Innimont, est une commune française, située dans le département de l'Ain en région Auvergne-Rhône-Alpes."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%8A%D8%B1%D9%86%D8%B3%D8%AA_%D8%B2%D9%8A%D9%86%D9%83%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Ernst_Viktor_Zenker_%281865-1946%29.jpg","page_title":"ايرنست زينكير","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nايرنست زينكير كان سياسى من النمسا."},{"page_url":"https://de.wikipedia.org/wiki/Dorfkirche_Bagow","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Dorfkirche_Bagow_Fenster.jpg","page_title":"Dorfkirche Bagow","context_page_description":"Die Dorfkirche Bagow ist die einzige Kirche im Ort Bagow in der Gemeinde Päwesin. Sie trägt keinen Namen. Die Kirche gehört zum Pfarrbereich Päwesin des Kirchenkreises Mittelmark-Brandenburg der Evangelischen Kirche Berlin-Brandenburg-schlesische Oberlausitz. Die Kirche ist ein Baudenkmal."},{"page_url":"https://en.wikipedia.org/wiki/Tabawan_Island","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Sabah-Islands-DarvelBay_PulauTabawan-Pushpin.png","page_title":"Tabawan Island","context_page_description":"Tabawan Island or Tabauawan is the highest and largest of a group of heavily wooded islands lying in the southwest quadrant of Darvel Bay, Sabah. It has dual volcanic peaks, and is 275 metres at its highest point. On the south side of the island there is a small bay, or inlet, quite deep, at 25 to 35 metres. It is about 7.25 kilometres from Sebatik Island, which lies to the southeast. For decades, the pearl farm of the island has safeguarded nearby waters to keep thieves and trespassers away."},{"page_url":"https://sk.wikipedia.org/wiki/Slnko_v_sieti_za_Najlep%C5%A1%C3%AD_ved%C4%BEaj%C5%A1%C3%AD_%C5%BEensk%C3%BD_hereck%C3%BD_v%C3%BDkon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Jana_O%C4%BEhov%C3%A1_%28mar._2012%29.jpg","page_title":"Slnko v sieti za Najlepší vedľajší ženský herecký výkon","context_page_description":"Slnko v sieti za Najlepší vedľajší ženský herecký výkon je jedno z ďalších ocenení udeľovaných Slovenskou filmovou a televíznou akadémiou v rámci výročných filmových cien Slnko v sieti — za herecké umenie, resp. stvárnenie ženskej postavy vo vedľajšej úlohe."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D8%A7%D9%86_%D8%AC%D8%A7%D9%86%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Shawn_Johnson_competes_cropped.jpg","page_title":"شان جانسون","context_page_description":"شان جانسون ژیمناستیک کار آمریکایی است.\\nاو در ژیمناستیک بازی‌های المپیک تابستانی ۲۰۰۸ رشته چوب موازنه به مدال طلا و در مجموع انفرادی به مدال نقره دست یافت.\\nاو قهرمان مجموع انفرادی در مسابقات جهانی ژیمناستیک هنری ۲۰۰۷ و قهرمان ایالات متحده آمریکا در سال‌های ۲۰۰۷ و ۲۰۰۸ نیز هست.\\nقد او ۱۴۵ سانتی‌متر است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%BF%D0%BE%D0%BB_%D0%A1%D0%BA%D0%B0%D0%BB%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Dom_of_the_Rock-1.JPG","page_title":"Купол Скалы","context_page_description":"Ку́пол Скалы́, Ку́пол скалы́, — мусульманское святилище над камнем Основания на Храмовой горе в Иерусалиме, один из наиболее ранних памятников исламской архитектуры. Является одной из главных святынь ислама. В числе памятников Старого города входит в Список всемирного наследия.\\nСтроительство мечети было завершено в 691 году. После захвата города крестоносцами в 1099 году святилище было преобразовано в церковь. После захвата города Саледином в 1187 году, здание опять становится мусульманским святилищем.\\nКупол Скалы находится рядом мечетью Аль-Акса.\\nХотя Куббат ас-Сахра и мечеть халифа Умара — Аль-Акса два совершенно разных исламских святилища, однако они составляют единый архитектурный комплекс Харам аш-Шариф. В популярной литературе эти два сооружения иногда путают с мечетью Омара.\\nИзображение Купола Скалы присутствует на печати ордена тамплиеров."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_objets_de_Messier","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/MessierStarChart-fr.svg","page_title":"Liste des objets de Messier","context_page_description":"Les objets de Messier sont une liste d'objets astronomiques catalogués par l'astronome français Charles Messier dans son Catalogue des Nébuleuses et des Amas d'Étoiles, publiée en 1771, puis étendue dans sa dernière édition en 1966.\\nMessier ne s'intéressait qu'à la recherche de comètes, il a créé une liste d'objets non cométaires afin de ne pas les confondre avec de nouvelles comètes. La compilation de cette liste, en collaboration avec son assistant Pierre Méchain, est connue sous le nom de catalogue Messier. Ce catalogue d'objets est l'un des catalogues astronomiques les plus connus, et de nombreux objets de Messier sont encore référencés par leur numéro Messier.\\nLa première édition contenait 45 objets, dans sa version finale Messier référença 103 objets. D'autres astronomes, utilisant les notes des textes de Messier, finirent par totaliser une liste de 110 objets."},{"page_url":"https://en.wikipedia.org/wiki/Brienz_Rothorn_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Brienz-Rothornbahn-AG_1892.jpg","page_title":"Brienz Rothorn Railway","context_page_description":"The Brienz Rothorn Railway is a tourist rack railway in Switzerland, which climbs from Brienz, at the eastern end of Lake Brienz, to the summit of the Brienzer Rothorn. The railway is 7.6 kilometres long, is built to 800 mm gauge, and uses the Abt double lamella rack system. Unusual for Switzerland, the line is not electrified, and most trains are operated by steam locomotives.\\nThe Brienz Rothorn Railway reaches a height of 2,244 metres above sea level and is the fourth-highest railway in Switzerland."},{"page_url":"https://eu.wikipedia.org/wiki/Limana","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Limana_vista.JPG","page_title":"Limana","context_page_description":"Limana Italiako udalerri bat da. Bellunoko probintzian kokatuta dago, Veneto eskualdean. 5.335 biztanle ditu, 39,12 kilometro koadroko azaleran banatuta."},{"page_url":"https://pl.wikipedia.org/wiki/Uzbrojenie_i_sprz%C4%99t_bojowy_Wojsk_Specjalnych","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/UAV_FlyEye_09.jpg","page_title":"Uzbrojenie i sprzęt bojowy Wojsk Specjalnych","context_page_description":"Poniżej znajduje się lista sprzętu bojowego i uzbrojenia używanego przez Wojska Specjalne, rodzaju sił zbrojnych Sił Zbrojnych Rzeczypospolitej Polskiej. Lista zawiera broń strzelecką, broń białą oraz sprzęt bojowy.\\nWyszczególniono sprzęt i uzbrojenie następujących podmiotów:\\nDowództwo Wojsk Specjalnych\\nJednostka Wojskowa Agat\\nJednostka Wojskowa Formoza\\nJednostka Wojskowa Grom\\nJednostka Wojskowa Komandosów\\nJednostka Wojskowa Nil"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%B5%D0%B2%D0%B8%D1%86%D0%B0_(%D0%9D%D0%B5%D0%BC%D0%B0%D1%87%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/DIE_LINKE_Bundesparteitag_Mai_2014_Kipping%2C_Katja.jpg","page_title":"Левица (Немачка)","context_page_description":"Левица, позната и као Лева странка, је лево оријентисана политичка странка у Немачкој. Основана 16. јуна 2007. године када су се ујединиле две странке, и то „Странка демократског социјализма“ и странка „Рад и социјална правда — изборна алтернатива“. Кроз PDS вуче корене из државне политике Источне Немачке, али странка критикује такву политику и дистанцира се од ње.\\nПолитика Левице се заснива на демократском социјализму. Странка заговара развијање механизама демократије у политичкој и економској сфери.\\nКопредседавајући стране су Катја Кипинг и Бернд Риксингер.\\nНа парламентарним изборима у Немачкој, одржаним 24. септембра 2017. године, Левица је освојила 9,2% гласова, односно 69 од 709 посланичких места. На изборима за Европски парламент, одржаним 25. маја 2014. године странка Левица је освојила 7 од 96 посланичких места."},{"page_url":"https://pl.wikipedia.org/wiki/Le_Z%C3%A9nith","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Evanescence_lezenith.jpg","page_title":"Le Zénith","context_page_description":"Le Zénith to nazwa zespołu obiektów koncertowych we Francji. 13 takich miejsc położonych jest w: Caen, Clermond Ferrand, Dijon, Lille, Montpellier, Nancy, Nantes, Orleanie, Paryżu, Pau, Rouen, Toulon i Tuluzie.\\nZarówno Anywhere but Home, koncertowe CD/DVD wydane przez Evanescence, jak i Hullabaloo Soundtrack angielskiego zespołu Muse zostały nagrane na Le Zènith w Paryżu. W marcu 2005 włoska śpiewaczka Laura Pausini dała dwa koncerty, z których materiał umieszczono na CD/DVD Live in Paris 05. Również rockowa supergrupa muzyczna TOTO nagrała w paryskim Zénith DVD koncertowe w ramach swojej trasy Falling in Between Live w lutym 2007 roku."},{"page_url":"https://el.wikipedia.org/wiki/%CE%92%CE%B1%CF%83%CE%AF%CE%BB%CE%B5%CE%B9%CE%BF_%CF%84%CE%B7%CF%82_%CE%A1%CE%BF%CF%85%CE%BC%CE%B1%CE%BD%CE%AF%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/RomaniansInHungary1890.png","page_title":"Βασίλειο της Ρουμανίας","context_page_description":"Το Βασίλειο της Ρουμανίας ήταν συνταγματική μοναρχία η οποία εγκαθιδρύθηκε το 1881 και συνέχισε να υπάρχει μέχρι το 1947. Το βασίλειο της Ρουμανίας άρχισε με τη βασιλεία του Καρόλου Α΄, ο οποίος κέρδισε την ανεξαρτησία της Ρουμανίας από την Οθωμανική Αυτοκρατορία στον πόλεμο της ρουμανικής ανεξαρτησίας, τμήμα του Ρωσοτουρκικού πολέμου του 1877-1878, και έληξε με την παραίτηση του Μιχαήλ της Ρουμανίας από τον θρόνο, μετά από πιέσεις της Σοβιετικές Ένωσης με τη μυστική συναίνεση των συμμάχων και την ανάληψη της διακυβέρνησης της χώρας από το Κομμουνιστικό Κόμμα Ρουμανίας. Ως όρος, το βασίλειο της Ρουμανίας είναι διακριτό από το Παλιό Ρουμανικό Βασίλειο, το οποίο αναφέρεται αυστηρά στην περιόδο της βασιλείας του Καρόλου Α΄, από τις 14 Μαρτίου 1881 μέχρι τις 27 Σεπτεμβρίου 1914.\\nΑπό το 1859 μέχρι το 1877, η Ρουμανία μετεξελίχθηκε από προσωπική ένωση δύο υποτελών πριγκιπάτων υπό ένα μόνο πρίγκιπα σε πλήρως ανεξάρτητο βασίλειο με μονάρχη του Οίκου των Χοεντσόλερν. Την περίοδο 1918-1920, μετά το τέλος του Α΄ Παγκοσμίου Πολέμου, η Τρανσυλβανία, η Ανατολική Μολδαβία και η Βουκοβίνα ενώθηκαν με το βασίλειο της Ρουμανίας, σχηματίζοντας τη Μεγάλη Ρουμανία."},{"page_url":"https://en.wikipedia.org/wiki/Toleration","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Ernest_Renan_1876-84.jpg","page_title":"Toleration","context_page_description":"Toleration is the allowing, permitting, or acceptance of an action, idea, object, or person which one dislikes or disagrees with. Political scientist Andrew R. Murphy explains that \\"We can improve our understanding by defining \\"toleration\\" as a set of social or political practices and \\"tolerance\\" as a set of attitudes.\\". Where Random House Dictionary defines tolerance as \\"a fair, objective, and permissive attitude toward those whose opinions, beliefs, practices, racial or ethnic origins, etc., differ from one's own;\\" toleration is the practice of applying those attitudes within a social or political setting.\\nBoth these concepts inherently contain the idea of alterity, the state of otherness. Additional choices of how to respond to the \\"other,\\" beyond toleration, do exist. Therefore, in some instances, toleration has been seen as ‘a flawed virtue’ because it concerns acceptance of things that were better overcome. Toleration cannot, therefore, be defined as a universal good, and many of its applications and uses remain contested."},{"page_url":"https://no.wikipedia.org/wiki/Marquette","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/HAER_MarquetteOreDock_1_339631pv.jpg","page_title":"Marquette","context_page_description":"Marquette er en by i den amerikanske delstaten Michigan. Byen er hovedsete for Marquette County. Marquette er en større havneby ved Øvresjøen, hovedsakelig for shipping av jernmalm, og byen er hjem til Northern Michigan University. Den er den største byen på den øvre halvøya av Michigan. Øvresjøen regulerer området temperaturmessig ved at den kjøler ned de nærliggende områdene om sommeren, og varmer de samme områdene om vinteren, og er årsaken til «lake-effect» snø, som forårsaker store mengder med snø i visse områder ved de store sjøer. Marquette får i gjennomsnitt omtrent 3 657.6 mm med snø hvert år, noe som gjør at den har nest mest snøfall blant byer blant de 48 sammenhengende statene, av de som er store nok til å bli rapportert."},{"page_url":"https://sq.wikipedia.org/wiki/Udh%C3%ABheq%C3%ABs_t%C3%AB_shteteve_n%C3%AB_vitin_1933","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Albert_Lebrun_1932_%282%29.jpg","page_title":"Udhëheqës të shteteve në vitin 1933","context_page_description":"Udhëheqës të shteteve në vitin 1933 janë të radhitur sipas kontinenteve dhe pastaj në kontinente janë të radhitura shtetet sipas shkronjës."},{"page_url":"https://en.wikipedia.org/wiki/Cleavage_(breasts)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Cleavage_classification_B_-_Cocktail_Glass.png","page_title":"Cleavage (breasts)","context_page_description":"Cleavage is the narrow depression or hollow between human breasts, the top portion of which may be accentuated by clothing such as a low-cut neckline that exposes the division. Joseph Breen, head of the U.S. Production Code Administration, coined the term in its current meaning when evaluating the 1941 Jane Russell starrer The Outlaw, and first covered by Time magazine in August 5, 1946. It is most commonly used in the parlance of Western female fashion to refer to necklines that reveals or emphasizes décolletage or display of the upper breast area.\\nIn many cultures, though not all, men typically derive erotic pleasure from a cleavage display. This tendency has been attributed to many reasons including evolutionary psychology, a patriarchal revolution, dissociation from brestfeeding and yogic shakti. Since 15th century women has been flaunting their cleavage to flirt, attract, make a gender statement or assert power. In some other cultures, including Indian, Chinese, Arab, Turkish and Inca civilizations the cleavage had a decline in visibility with advent of Christianity and Islam, the latter of which explicitly bans any display of cleavage."},{"page_url":"https://bs.wikipedia.org/wiki/DBase","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/DBASE_timeline.png","page_title":"DBase","context_page_description":"dBase je bio jedan od prvih sistema za upravljanje bazama podataka na mikroračunarima, i svojevremeno jedan od najuspješnijih. DBase sistem je uključivao pogon baze podataka, sistem upita, grafički uređivač i programski jezik koji koji je povezivao sve ove komponente. dBaseov glavni dio je .dbf datoteka, vrlo rasprostranjena u aplikacijama kojima je potreban jednostavan format za pohranu strukturiranih podataka.\\nIzvorno izdat kao Vulcan za PTDOS 1978., CP/M port je privukao pažnju Ashton-Tatea 1980. Licencirali su ga i izdali kao dBASE II, a kasnije prebacili na Apple II i IBM PC računare sa operativnim sistemom DOS. Na PC platformi dBase je postao jedan od najprodavanijih softvera. Glavna nadogradnja objavljena je kao dBase III i prenesenana mnoge platforme, između ostalog UNIX i VMS. Sredinom 1980-tih, Ashton-Tate je bio dio \\"velike trojke\\" izdavača softvera ranog poslovnog softvera uz Lotus Development i WordPerfect.\\nOd sredine 1980-ih, nekoliko firmi je proizvelo vlastite verzije dBase proizvoda. To su bili FoxBASE+, Clipper i druge takozvani xBase proizvodi. Mnogi od njih su bili tehnički jači od dBase-a, ali nikad nisu uspjeli da ga potisnu sa tržišta."},{"page_url":"https://en.wikipedia.org/wiki/S%C3%BCtterlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/S%C3%BCtterlin-N.png","page_title":"Sütterlin","context_page_description":"Sütterlinschrift is the last widely used form of Kurrent, the historical form of German handwriting that evolved alongside German blackletter typefaces. Graphic artist Ludwig Sütterlin was commissioned by the Prussian Ministry of Science, Art and Culture to create a modern handwriting script in 1911. His handwriting scheme gradually replaced the older cursive scripts that had developed in the 16th century at the same time that letters in books had developed into Fraktur. The name Sütterlin is nowadays often used to refer to all varieties of old German handwriting, although only this specific script was taught in all German schools from 1915 to 1941."},{"page_url":"https://pt.wikipedia.org/wiki/Santu%C3%A1rio_de_Santa_Maria_da_Cruz","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Esterno-santamariadellacroce.jpg","page_title":"Santuário de Santa Maria da Cruz","context_page_description":"O Santuário de Santa Maria da Cruz é uma basílica menor que se encontra em Crema, comuna da Itália localizada na província de Cremona.\\nSituada na Diocese de Crema, fica a um quilômetro do centro da cidade, na Strada Statale 591, no caminho para Bergamo."},{"page_url":"https://ro.wikipedia.org/wiki/Cabras","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Cabras.jpg","page_title":"Cabras","context_page_description":"Cabras este o comună din provincia Oristano, regiunea Sardinia, Italia, cu o populație de 9.169 de locuitori și o suprafață de 102,26 km²."},{"page_url":"https://no.wikipedia.org/wiki/R%C3%A5de_Idrettslag","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Raadeil2017.jpg","page_title":"Råde Idrettslag","context_page_description":"Råde Idrettslag er et idrettslag fra Østfold i Norge. Klubben ble stiftet i 1929 som Råde Skiklubb, men skiftet siden navn til Råde Idrettslag. I dag har klubben flere undergrupper, hvor fotball, innebandy og håndball er størst."},{"page_url":"https://id.wikipedia.org/wiki/Bathyscaphe","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/FNRS3_eau.jpg","page_title":"Bathyscaphe","context_page_description":"Bathyscaphes adalah sebuah mesin yang dibuat untuk eksplorasi laut dalam. Mesin mulai bekerja pada tahun 1948 hingga 1982, ia pernah mencapai lautan yang sangat dalam. Saat ini, untuk penelitian laut dalam, hanya mempergunakan mesin berpengendali jarak jauh. Mesin ini untuk pertama kalinya ditemukan oleh Profesor Auguste Piccard, sebuah bathyscaphe berisikan sebuah kabin bertekanan tinggi dari baja, yang bisa diisi oleh dua hingga tiga orang, dan menyelam berdasarkan hukum Archimedes. Mesin ini menyelam berdasarkan gravitasi dan kembali ke permukaan dengan melepaskan ballast. Karena ukuran dan beratnya, maka mesin ini harus didampingi oleh kapal pendukung. Kata \\"bathyscaphe\\" sendiri, diciptakan oleh Profesor Piccard pada tahun 1946, yang berasal dari kata Yunani bathus dan skaphos. Sebelumnya, kata \\"thalassosphère\\" mempergunakan bagian nama Professor Piccard sebagai penghargaan atas penemuaan.\\nPrinsip kerjanya\\""},{"page_url":"https://de.wikipedia.org/wiki/Wasserkraftwerk_Altheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Altheimer_Stausee1.JPG","page_title":"Wasserkraftwerk Altheim","context_page_description":"Das Kraftwerk Altheim ist ein Laufwasserkraftwerk an der Isar\\nDas 1951 eröffnete Kraftwerk liegt bei Altheim, einem Ortsteil in der Gemarkung Ohu der Gemeinde Essenbach im niederbayerischen Landkreis Landshut. Das Kraftwerk wird von der Uniper Kraftwerke GmbH betrieben. Die elektrische Leistung des Kraftwerks beträgt 17,8 MW.\\nDirekt angrenzend an das Kraftwerk befindet sich das Umspannwerk Altheim.\\nUnmittelbar oberhalb des Stauwehrs wird links der Längenmühlbach zunächst unterirdisch verrohrt aus der Isar ausgeleitet. Am 21. September 2015 wurde eine neu errichtete Fischaufstiegsanlage offiziell in Betrieb genommen."},{"page_url":"https://de.wikipedia.org/wiki/Ursula_L%C3%B6tzer","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Ursula-loetzer.jpg","page_title":"Ursula Lötzer","context_page_description":"Ursula Cornelia „Ulla“ Lötzer geb. Bothe ist eine deutsche Politikerin."},{"page_url":"https://fr.wikipedia.org/wiki/Nellie_Casman","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Nellie-casman-1923-yiddish-theater.jpg","page_title":"Nellie Casman","context_page_description":"Nellie Casman, née en 1896 à Proskouriv, aujourd'hui en Ukraine, et décédée le 27 mai 1984 à New York, était une chanteuse et actrice yiddish aux États-Unis.\\nNellie Casman vint aux États-Unis dans les premières années du XXᵉ siècle et commença à jouer encore enfant dans le théâtre yiddish. Elle joua à New York, en Europe et en Amérique du Sud dans des spectacles tels que The Girl from Argentina et The Drunkard. Elle écrivait des chansons aussi bien que des shows avec son mari, le compositeur Samuel Steinberg. Leur comédie musicale The Showgirl fut jouée par le Shalom Yiddish Musical Comedy Theater au Town Hall de New York en 1982.\\nElle joua également dans Die Americaner Rebezin et Dem Klein Khazan et à la télévision américaine. En 1973, elle apparait dans le film français Les Aventures de Rabbi Jacob."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AB%E3%83%9E%E3%83%BB%E3%83%9E%E3%83%BC%E3%82%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Alma_Mater%2C_Lorado_Taft.jpg","page_title":"アルマ・マータ","context_page_description":"アルマ・マータとは、欧米で出身校、母校 を指す語。古代ローマ時代には地母神、特にケレースまたはキュベレーを、中世のキリスト教においてはイエスの母マリアを指す言葉であった。\\n現代では、今の自分を形成するのに大きな影響のあった出身校を指すのに使われ、学士号や博士号を取得した大学を指す事が多い。またそういった母校の学歌を指すこともある。\\nほとんどの場合単数形で使われる 。\\n米コロンビア大学のロウ記念図書館の前にはダニエル・チェスター・フレンチの代表作の一つであるアルマ・マータ像がある。また米イリノイ大学アーバナ・シャンペーン校にも像がある。伊ボローニャ大学は大学のモットーをAlma Mater Studiorumと2000年に制定している。"},{"page_url":"https://la.wikipedia.org/wiki/Noailly","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/004_Noailly_%28_42640_%29.JPG","page_title":"Noailly","context_page_description":"Noailly est commune Francicum 804 incolarum praefecturae Ligeris in regione orientali Rhodano et Alpibus."},{"page_url":"https://nl.wikipedia.org/wiki/Bukit_Timah_(wijk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Hillington_Green%2C_Singapore_-_20110517.jpg","page_title":"Bukit Timah (wijk)","context_page_description":"Bukit Timah is een wijk of Planning Area in het noordwesten van de Central Region van de stadstaat Singapore.\\nBukit Timah is een residentiële woonwijk zo'n 10 km ten noordwesten van het stadscentrum van Singapore en kan beschouwd worden als een slaapstad. De wijk heeft minder dan andere wijken publieke huisvestingsprojecten en dan ook meer private woonprojecten. De gemiddelde woningsprijzen zijn ook hoger.\\nHet Bukit Timah Nature Reserve met daarin de Bukit Timah Hill zijn toeristische bestemmingen in de wijk."},{"page_url":"https://la.wikipedia.org/wiki/Ranzi%C3%A8res","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Map_commune_FR_insee_code_55415.png","page_title":"Ranzières","context_page_description":"Ranzières est commune Francicum 72 incolarum praefecturae Mosa in regione orientali Lotharingia."},{"page_url":"https://de.wikipedia.org/wiki/Intercity_2_(Deutsche_Bahn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Intercity2-2.jpg","page_title":"Intercity 2 (Deutsche Bahn)","context_page_description":"Unter dem Namen Intercity 2, kurz IC2, vermarktet die Deutsche Bahn ihre doppelstöckigen Intercity-Züge, die seit Dezember 2015 in Betrieb sind."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%94%D0%B0%D0%BD%D0%B8%D1%81_%D0%97%D0%B0%D1%80%D0%B8%D0%BF%D0%BE%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Danis_Zaripov_Dec_2010.jpg","page_title":"Данис Зарипов","context_page_description":"Данис Зарипов — танылган хоккейчы, \\"Металлург\\" хоккей клубы уенчысы."},{"page_url":"https://en.wikipedia.org/wiki/Golden_Cockerel_Press","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/A_voyage_round_the_world_with_Captain_Cook_03.jpg","page_title":"Golden Cockerel Press","context_page_description":"The Golden Cockerel Press was an English fine press operating between 1920 and 1961."},{"page_url":"https://en.wikipedia.org/wiki/Here_I_Stand_(Usher_album)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Jay-Z_concert_%28cropped%29.jpg","page_title":"Here I Stand (Usher album)","context_page_description":"Here I Stand is the fifth studio album by the American singer Usher, released on May 13, 2008, by LaFace Records. Inspired by love for his new wife—Tameka Foster—and son, Usher recorded many ballads for the album. Prior to the album's recording, Usher split with his mother, Jonnetta Patton, as manager and hired Benny Medina. Usher's estranged father died months before the release of Here I Stand; this also influenced themes of the album. It was originally to be titled \\"Measure of a Man\\", but Usher named it Here I Stand to mark \\"a new chapter in [his] life\\".\\nUsher promoted Here I Stand by performing on several television shows including Total Request Live, 106 & Park and Good Morning America. Among other concert appearances, he embarked on a One Night Stand: Ladies Only Tour, performing fifteen shows in November 2008. Six singles were released from Here I Stand: \\"Love in This Club\\", \\"Love in This Club Part II\\", \\"Moving Mountains\\", \\"What's Your Name\\", \\"Here I Stand\\" and \\"Trading Places\\". \\"Love in This Club\\", which features rapper Young Jeezy, topped the Billboard Hot 100 and New Zealand Singles Chart."},{"page_url":"https://ast.wikipedia.org/wiki/Hebreos","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/1QIsa_b.jpg","page_title":"Hebreos","context_page_description":"Los hebreos' son un antiguu pueblu semita del Llevante mediterraneu establecíos nel añu 616 a.C, tamién son ancestros de los israelites y del pueblu xudíu.\\nLa tradicional fonte de referencia pa los hebreos ye la Biblia, que'l so conteníu tamién s'atopa nes escritures hebrees de la Torá. Según estes fontes los hebreos constitúin el grupu monoteísta inicial, que ye descendiente de los patriarques posdiluvianos Abraham, Isaac, y Jacob.\\nSegún la Biblia y les tradiciones hebraiques, los hebreos fueron orixinarios de Mesopotamia. Yeren nómades, vivíen en tiendes, teníen fataos de cabres y oveyes, utilizando pollinos, mules y camellos como portadores. Siguiendo a Abraham, los hebreos emigraron escontra Canaán, la tierra prometida por Dios a los descendientes del primer patriarca. Delles tablillas descubiertes en Mari certifiquen frecuentes migraciones al traviés del Creciente Fértil.\\nAbraham ye consideráu'l primer hebréu por dexar el so Caldea natal, y haber trevesáu \\"del otru llau del ríu\\" Éufrates. El patriarca y los suyos asiéntanse en Canaán: en Siquem, Beerseba o Hebrón. Adulces, entemecer colos pobladores locales y conviértense en llabradores sedentarios."},{"page_url":"https://la.wikipedia.org/wiki/Auquemesnil","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Map_commune_FR_insee_code_76037.png","page_title":"Auquemesnil","context_page_description":"Auquemesnil est commune Francicum 277 incolarum praefecturae Sequanae Maritimae in regione Normannia Superiori."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AA%E3%83%86%E3%82%A3%E3%83%83%E3%82%B7%E3%83%A5%E3%83%BB%E3%82%A8%E3%82%A2%E3%82%A6%E3%82%A7%E3%82%A4%E3%82%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/G-XWBA_LEMD_15-08-2019b.jpg","page_title":"ブリティッシュ・エアウェイズ","context_page_description":"ブリティッシュ・エアウェイズは、イギリスの航空会社。ヨーロッパでは3位、世界では9位の規模を誇る大手航空会社であり、イギリス最大の航空会社である。なお、日本では「英国航空」と呼ばれることもある。\\n本項では以下、ブリティッシュ・エアウェイズを指して「BA」という表記に統一する。"},{"page_url":"https://es.wikipedia.org/wiki/Montse_Cruz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Montserrat_Cruz_3_%28cropped%29.jpg","page_title":"Montse Cruz","context_page_description":"Montserrat Cruz Funes es una jugadora de hockey sobre hierba española.​ Disputó los Juegos Olímpicos de Pekín 2008 con España, obteniendo un séptimo puesto."},{"page_url":"https://en.wikipedia.org/wiki/STS-114","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/STS-114_Soichi_Noguchi_EVA-1.jpg","page_title":"STS-114","context_page_description":"STS-114 was the first \\"Return to Flight\\" Space Shuttle mission following the Space Shuttle Columbia disaster. Discovery launched at 10:39 EDT, 26 July 2005. The launch, 907 days after the loss of Columbia, was approved despite unresolved fuel sensor anomalies in the external tank that had prevented the shuttle from launching on 13 July, its originally scheduled date.\\nThe mission ended on 9 August 2005 when Discovery landed at Edwards Air Force Base in California. Poor weather over the Kennedy Space Center in Florida hampered the shuttle from using its primary landing site.\\nAnalysis of the launch footage showed debris separating from the external tank during ascent; this was of particular concern because it was the issue that had set off the Columbia disaster. As a result, NASA decided on 27 July to postpone future shuttle flights pending additional modifications to the flight hardware. Shuttle flights resumed a year later with STS-121 on 4 July 2006."},{"page_url":"https://ca.wikipedia.org/wiki/Biafra","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Biafra_sat.png","page_title":"Biafra","context_page_description":"Biafra fou una regió Oriental de Nigèria, en declarar-se independent el 30 de maig de 1967. En el rerefons de la secessió i de la guerra hi havia els enfrontaments interètnics entre els hausa, ètnia musulmana que ocupa especialment el nord de Nigèria i que detenia el control de l'estat, i els igbos, ètnia predominantment catòlica que es concentrava a la regió litoral Est, i que s'aguditzaren des de la independència de Nigèria el 1960."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A7%8B%E4%BF%A1%E5%AE%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Shin-Soo_Choo_6-30-12.jpg","page_title":"秋信守","context_page_description":"秋 信守は、韓国の釜山広域市出身のプロ野球選手。MLBのテキサス・レンジャーズ所属。\\n愛称は2013年のシンシナティ・レッズ在籍時にチームメイトだったジョーイ・ボットが名付けた韓国語でウサギを意味するトッキに数字の1を付けたトッキ1であり、ボットがトッキ2の愛称である。"},{"page_url":"https://pl.wikipedia.org/wiki/Dimitrie_Cantemir","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Dimitrie_Cantemir_02.jpg","page_title":"Dimitrie Cantemir","context_page_description":"Dimitrie Cantemir, Dymitr Kantemir – hospodar Mołdawii; naukowiec, humanista i pisarz.\\nmołdawski, rumuński Dimitrie Cantemir lub Demetriu Cantemir\\nrosyjski Дмитрий Константинович Кантемир, Dmitrij Konstantinowicz Kantemir\\nturecki Dimitri Kantemiroğlu"},{"page_url":"https://en.wikipedia.org/wiki/James_Cagney","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/1_Cagney_best_800_crop.jpg","page_title":"James Cagney","context_page_description":"James Francis Cagney Jr. was an American actor and dancer on stage and in film. Known for his consistently energetic performances, distinctive vocal style, and deadpan comic timing, he won acclaim and major awards for a wide variety of performances. He is remembered for playing multifaceted tough guys in films such as The Public Enemy, Taxi!, Angels with Dirty Faces, The Roaring Twenties and White Heat, finding himself typecast or limited by this reputation earlier in his career. He was able to negotiate dancing opportunities in his films and ended up winning the Academy Award for his role in the musical Yankee Doodle Dandy. In 1999 the American Film Institute ranked him eighth among its list of greatest male stars of the Golden Age of Hollywood. Orson Welles described Cagney as \\"maybe the greatest actor who ever appeared in front of a camera\\".\\nIn his first professional acting performance in 1919, Cagney was costumed as a woman when he danced in the chorus line of the revue Every Sailor. He spent several years in vaudeville as a dancer and comedian, until he got his first major acting part in 1925."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%DB%8C%D9%86%D9%85%D8%A7%DB%8C_%D9%87%D9%84%D9%86%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Zwolle_Bioscoop_De_Kroon.jpg","page_title":"سینمای هلند","context_page_description":"سینمای هلند به صنعت فیلم در هلند اشاره دارد. از آن‌جا که صنعت فیلم هلند کوچک است و تقریباً هیچ بازار بین‌المللی برای این فیلم‌ها وجود ندارد، فیلم‌ها به بودجه دولتی متکی هستند. این بودجه می‌تواند از طریق صندوق فیلم هلند یا شبکه‌های پخش عمومی تأمین شود. در سال‌های اخیر، دولت هلند چترهایی مالیاتی برای حمایت از فیلم‌سازی خصوصی در هلند ایجاد کرده‌است. اولین فیلم هلندی، فیلم ماهی‌گیر آشفته اثر ماخیل هندریکوس لاده است. از فیلم‌سازان مطرح هلند می‌توان به مایک فان دیم، تئودور ون گوگ، مرلین گوریس، فونس رادماکرس و پل ورهوفن اشاره کرد. از میان برخی از مشهورترین فیلم‌های هلندی می‌توان به انیمیشن پدر و دختر، هلندی سرگردان، آنتونیا، مصاحبه، مارینا، ۱–۹۰۰ و راحت‌الحلقوم اشاره کرد."},{"page_url":"https://en.wikipedia.org/wiki/Barda,_Perm_Krai","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Coat_of_Arms_of_Barda_%28Perm_oblast%29.png","page_title":"Barda, Perm Krai","context_page_description":"Barda is a rural locality and the administrative center of Bardymsky District of Perm Krai, Russia."},{"page_url":"https://fi.wikipedia.org/wiki/Ty%C3%B6nt%C3%B6alus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Mississippi_river_barges_after_passing_under_the_Poplar_St_Bridge%2C_St_Louis%2C_MO.jpg","page_title":"Työntöalus","context_page_description":"Työntöalus on hinaajatyyppi, joka kuljettaa edellään työntäen yhtä tai useampaa ilman kulkukoneistoa ja miehistöä olevaa työntöproomua. Työntöaluksen ja työntöproomun muodostamaa alusyhdistelmää kutsutaan työntökytkyeeksi. Usein työntöalus voi toimia myös tavallisena hinaajana eli hinata köyden avulla jotakin perässään.\\nTyöntöalusta eli työntäjää kutsutaan myös puskijaksi. Finnlines alkoi 1960-luvulla kehittää työntökytkyejärjestelmää, jolle annettiin nimi Finnpusku. Nimeäminen perustui siihen että haluttiin nimi, jonka vierasmaalainenkin pystyy lausumaan. Pusku-nimitys juurtui siitä hyvin myös suomenkieliseen käyttöön. Suomen ensimmäinen työntöalus ja kaksi työntöproomua tilattiin vuonna 1984 [1–4]."},{"page_url":"https://sv.wikipedia.org/wiki/Patricia_Hearst","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/Patty_Hearst_FBI_poster.jpg","page_title":"Patricia Hearst","context_page_description":"Patricia Hearst Shaw, född 20 februari 1954 i San Francisco, Kalifornien, är barnbarn till tidningsmagnaten William Randolph Hearst och blev känd som ett kidnappningsoffer som förenade sig med sina tillfångatagare."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%8Ele_de_la_Cit%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/H%C3%B4tel_de_la_Motte-Montgaubert.jpg","page_title":"Île de la Cité","context_page_description":"L’île de la Cité est une île située sur la Seine, en plein cœur de Paris. Elle est considérée comme l'antique berceau de la ville de Paris, autrefois Lutèce. Elle appartient aux 1ᵉʳ et 4ᵉ arrondissements. Le chroniqueur Gui de Bazoches l'évoquait en 1190 comme étant « la tête, le cœur et la moelle de Paris ».\\nLa superficie de l'île de la Cité est d'environ 22,5 ha. Au 1ᵉʳ janvier 2016, sa population est de 891 habitants.\\nCe site est desservi par les stations de métro Cité et Saint-Michel."},{"page_url":"https://en.wikipedia.org/wiki/Croatian_Publishing_and_Bibliographic_Institute","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Hrvatska_enciklopedija_pet_svezaka.jpg","page_title":"Croatian Publishing and Bibliographic Institute","context_page_description":"The Croatian Publishing and Bibliographic Institute was a lexicographic institute in the Independent State of Croatia founded on August 9, 1941. Mate Ujević was its director. In 1944, Dragutin Tadijanović became the literary secretary of the institute. With the creation of communist Yugoslavia in 1945, the institute's work was stopped.\\nPeople associated with the Institute include Ivan Goran Kovačić.\\nThe Institute published the Dictionary of Croatian Literary Language, as well as taking over the publishing of the Croatian Encyclopedia. In 1942, the institute published seven of Vladimir Nazor's works: Putopisi, Zagrebačke novele, Posljednja Trijada, Na vrh jezika i pera, Arhanđeli, Knjiga pjesama and Eseji i članci."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Cartagena,_Colombia","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/AlonsoDeOjeda.jpg","page_title":"History of Cartagena, Colombia","context_page_description":null},{"page_url":"https://de.wikipedia.org/wiki/Busverkehr_in_Wien","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Dr._Richard%2C_8726%2C_8738%2C_Erzherzog-Karl-Stra%C3%9Fe.jpg","page_title":"Busverkehr in Wien","context_page_description":"Der Busverkehr in Wien umfasst alle Stadtbus-, Regionalbus- und Flughafenbus-Linien im Stadtgebiet von Wien."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A1%E3%82%AC%E3%83%97%E3%83%AD%E3%82%B8%E3%82%A7%E3%82%AF%E3%83%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Battery_Park_City_panoramic.jpg","page_title":"メガプロジェクト","context_page_description":"メガプロジェクトは、非常に大規模な投資事業の事である。通常、10億USドル以上で、社会、環境、予算への大きな影響により人々の注目を集めるものとして定義される。\\nメガプロジェクトはまた、「物理的な、非常に高額な公共物の計画」としても定義できる。\\nメガプロジェクトには橋、トンネル、高速道路、鉄道、空港、港湾、発電所、ダム、下水道、経済特区、石油・天然ガスの採掘、公共の建築物、情報技術、航空・宇宙開発、兵器開発が含まれる。"},{"page_url":"https://pl.wikipedia.org/wiki/Villenoy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Villenoy_mairie.jpg","page_title":"Villenoy","context_page_description":"Villenoy – miejscowość i gmina we Francji, w regionie Île-de-France, w departamencie Sekwana i Marna.\\nWedług danych na rok 1990 gminę zamieszkiwało 2719 osób, a gęstość zaludnienia wynosiła 369 osób/km²."},{"page_url":"https://en.wikipedia.org/wiki/Ontario_Highway_403","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/ON403_Aerial_Facing_South_-_Mississauga_%2841040635222%29.jpg","page_title":"Ontario Highway 403","context_page_description":"King's Highway 403, or simply Highway 403, is a 400-series highway in the Canadian province of Ontario that travels between Woodstock and Mississauga, branching off from and reuniting with Highway 401 at both ends and travelling south of it through Hamilton and Mississauga. It is concurrent with the Queen Elizabeth Way for 22 km from Burlington to Oakville. Although the Highway 403 designation was first applied in 1963 to a short stub of freeway branching off the QEW, the entire route was not completed until August 15, 1997, when the section from Brantford to the then-still independent Town of Ancaster was opened to traffic. The section of Highway 403 between Woodstock and Burlington was formally dedicated as the Alexander Graham Bell Parkway on April 27, 2016.\\nThe majority of Highway 403 is surrounded by suburban land use, except west of Ancaster, where it passes through agricultural land; Brantford is the only urban area through this section. In Hamilton, Highway 403 descends the Niagara Escarpment, then wraps around the northern side of Hamilton Harbour to encounter the QEW."},{"page_url":"https://pt.wikipedia.org/wiki/Tsantsa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Salzburg_Haus_der_Natur_-_S%C3%BCdamerika_Schrumpfkopf.jpg","page_title":"Tsantsa","context_page_description":"Uma cabeça encolhida, também chamada Tsantsa, é uma cabeça humana cortada e especialmente preparada que é usada para propósitos de troféu, ritual ou comércio.\\nO Headhunting ocorreu em muitas regiões do mundo, mas a prática de headfrushing foi documentada apenas na região noroeste da floresta amazônica. O povo que mais se destacou pela prática foram os Shuaras, também chamados \\"jívaros\\"."},{"page_url":"https://it.wikipedia.org/wiki/Marcello_Piacentini","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Roma_Via_della_Conciliazione_BW_1.JPG","page_title":"Marcello Piacentini","context_page_description":"Marcello Piacentini è stato un architetto, urbanista e accademico italiano.\\nFu protagonista sulla scena dell'architettura italiana nel trentennio 1910-1940, assumendo la figura di massimo ideologo del monumentalismo di regime soprattutto per la sua febbrile opera di regia applicata praticamente a tutta l'attività architettonica e urbanistica del ventennio fascista.\\nNel dopoguerra fu oggetto di forti polemiche a causa del suo legame con il regime, innescando un dibattito aperto e critico sulla sua persona."},{"page_url":"https://de.wikipedia.org/wiki/Wehrgraben_(Ortsteil,_Steyr)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/STATT_STEYER_%28Merian%29.png","page_title":"Wehrgraben (Ortsteil, Steyr)","context_page_description":"Wehrgraben ist eine Ortslage der Stadt Steyr in Oberösterreich."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_World_Heritage_Sites_in_Western_Europe","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Graz_-_Uhrenturm6.jpg","page_title":"List of World Heritage Sites in Western Europe","context_page_description":"The United Nations Educational, Scientific and Cultural Organization has designated 131 World Heritage Sites in Western Europe. These sites are in 9 countries. Liechtenstein and Monaco have no sites. There are ten sites which are shared between countries. The first site from the region to be included on the list was the Aachen Cathedral in Germany in 1978."},{"page_url":"https://de.wikipedia.org/wiki/993","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Schenkungsurkunde_Potsdam_993.jpg","page_title":"993","context_page_description":"Anfang Februar: Otto III. übergibt dem von seiner Verwandten Mathilde geleiteten Damenstift Essen der Überlieferung nach die bei seiner Krönung verwendete Krone und ein goldverziertes Zeremonialschwert.\\n13. März: Nach dem Tod des nahe mit ihm verwandten Markgrafen Hodo I. erhält Gero, Graf im Hassegau, dessen Mark Lausitz und den slawischen Gau Nizizi.\\n19. Oktober: Nach dem Tod von Konrad III. wird sein Sohn Rudolf III. König von Burgund. Wie sein Vater wird Rudolf in Lausanne gewählt und gekrönt. Im Anschluss führt er einen Umritt durch. Sein Versuch, kurz nach dem Herrschaftsantritt Konfiskationen durchzuführen, führt zur Auflehnung des regionalen Adels."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%8A%80%E7%B7%9A%E7%81%B0%E8%9D%B6%E5%B1%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Long-branded_Silverline_%28Spindasis_lohita%29_at_Jayanti%2C_Duars%2C_West_Bengal_W2_IMG_5562.jpg","page_title":"銀線灰蝶屬","context_page_description":"銀線灰蝶屬是灰蝶科虎灰蝶亞科中的一個屬。物種分布舊大陸熱帶區，由西非至日本和蘇拉威西一帶，大多物種會與螞蟻共生。\\n一些學者如 Heath、Williams 把富麗灰蝶屬和銀線灰蝶屬都歸入席灰蝶屬，然而 Larsen認為牠們親緣關係密切，但在生態學和的生物地理學層面上則各有不同，因此分開3個屬。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%D0%A1%D0%B2%D0%B5%D1%82%D0%B5_%D0%9C%D0%B0%D1%80%D0%B8%D1%98%D0%B5_%D0%9C%D0%B0%D0%B3%D0%B4%D0%B0%D0%BB%D0%B8%D0%BD%D0%B5_%D1%83_%D0%94%D0%BE%D1%9A%D0%BE%D1%98_%D0%89%D1%83%D0%B1%D0%BE%D0%B2%D0%B8%D1%92%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Donja_Ljubovi%C4%91a%2C_crkva_005.jpg","page_title":"Црква Свете Марије Магдалине у Доњој Љубовиђи","context_page_description":"Црква Свете Марије Магдалине у Доњој Љубовиђи, насељеном месту на територији општине Љубовија, припада Епархији шабачкој Српске православне цркве.\\nТемељи цркве посвећене Светој Марији Магдалини освештани су 27. маја 2012. године, од епископа шабачког Лаврентија."},{"page_url":"https://it.wikipedia.org/wiki/Emiliano_Rinaldini","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Lapide_E_Rinaldini.jpg","page_title":"Emiliano Rinaldini","context_page_description":"Emiliano Rinaldini, detto Emi, è stato un antifascista e partigiano italiano, eroe della resistenza italiana."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%85%D9%84%D8%A7%D9%8A%D9%88_(%D8%B4%D8%B9%D8%A8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Potret_Roekiah1.jpg","page_title":"الملايو (شعب)","context_page_description":"تُعتبر الملايو مجموعة إثنية أسترونيزية وأمة أصلية في شبه جزيرة ملايو وشرق سومطرة في إندونيسيا وبورنيو الساحلية، بالإضافة إلى الجزر الأصغر التي تقع بين هذه المواقع، وهي مناطق تُعرف عمومًا باسم عالم ملايو. تُعتبر هذه المواقع اليوم جزءًا من دول ماليزيا وبروناي وسنغافورة وإندونيسيا وجنوب تايلاند.\\nيوجد تنوع جيني ولغوي وثقافي وفني واجتماعي كبير بين مجموعات الملايو الفرعية العديدة، ويرجع ذلك أساسًا إلى مئات السنين من الهجرة واستيعاب مختلف الأعراق والقبائل الإقليمية داخل جنوب شرق آسيا البحري. ينحدر سكان الملايو تاريخيًا وبشكل رئيسي من الأسترونيزيين السابقين الناطقين بلغة الملايو والقبائل الأسترونيزية الناطقة باللغة الملاوية الذين أسسوا العديد من الدول والممالك التجارية البحرية القديمة، لا سيما بروناي، وكيدا، ولانغكاسوكا، وغانغا نيغارا، وتشي تو، وناخون سي تامارات، وباهانج، وميلايو، سريفيجايا.\\nأدى ظهور سلطنة ملقا في القرن الخامس عشر إلى ثورة كبرى في تاريخ الملايو، إذ كمنت أهميتها في إرثها السياسي والثقافي على المدى البعيد. يُعتقد أن المؤشرات الملاوية النهائية الشائعة -دين الإسلام، ولغة وتقاليد الملايو- قد صدرت خلال هذه الحقبة، ما أدى إلى نشأة الملايو إثنيًا باعتبارها مجموعة إثنية دينية رئيسية في المنطقة."},{"page_url":"https://en.wikipedia.org/wiki/List_of_windmills_in_Deux-S%C3%A8vres","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Argenton-les-Vall%C3%A9es_moulin_%C3%A0_vent.JPG","page_title":"List of windmills in Deux-Sèvres","context_page_description":"A list of windmills in Deux-Sèvres, France."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Mariazell","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/St._Sebastian_-_Sebastianikapelle.JPG","page_title":"Liste der denkmalgeschützten Objekte in Mariazell","context_page_description":"Die Liste der denkmalgeschützten Objekte in Mariazell enthält die 75 denkmalgeschützten, unbeweglichen Objekte der österreichischen Gemeinde Mariazell im steirischen Bezirk Bruck-Mürzzuschlag."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8E%9F%E8%87%BA%E5%8D%97%E5%85%AC%E6%9C%83%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/%E8%87%BA%E5%8D%97%E5%85%AC%E6%9C%83%E5%A0%82.JPG","page_title":"原臺南公會堂","context_page_description":"原臺南公會堂位於臺南市中西區，民國八十七年6月26日公告為臺南市市定古蹟。市定古蹟。該建築所在地是之前清朝道光年間士紳吳尚新的吳園，現於其後仍留有吳園的一部分，而更早之前相傳這裡是荷治時期向鄭成功建議攻臺的荷蘭通事何斌的府邸，1661年5月3日鄭成功並在此接見經何斌引導的荷蘭使者湯馬斯‧范‧伊伯倫與李奧納多‧范‧李奧納杜斯等人。"},{"page_url":"https://en.wikipedia.org/wiki/Le_Temps_(Paris)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Soudan_fran%C3%A7ais-Binger.jpg","page_title":"Le Temps (Paris)","context_page_description":"Le Temps was one of Paris's most important daily newspapers from 25 April 1861 to 30 November 1942. It was a serious paper of record.\\nFounded in 1861 by Edmund Chojecki and Auguste Nefftzer, Le Temps was under Nefftzer's direction for ten years, when Adrien Hébrard took his place, and for nearly 45 years directed the newspaper with an iron hand until his death in 1914. He was succeeded by his sons Émile, and Adrien Jr. and by Louis Mills. Soon after Mills' death in 1931, Le Temps became a public limited company. Adrien Hébrard and his successors left substantial freedom to the editorial room and the newspaper had the reputation of keeping its journalists for a long time. Le Temps always remained moderate politically. The early issues of the newspaper reflected Nefftzer's liberal philosophy had considerable trouble achieving readership. He had to frequently turn to friends in Alsace who were able to help support Le Temps financially. However, circulation continued to grow, from scarcely 3,000 in 1861, to 11,000 in 1869, 22,000 in 1880, 30,000 in 1884, 35,000 in 1904. During the interwar period it varied between 50,000 and 80,000."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9E%D0%B1%D1%80%D0%B5%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Flag_of_Serbia_%281835-82%29.png","page_title":"Михаил Обренович","context_page_description":"Михаи́л Обре́нович III — сербский князь в 1839—1842 и 1860—1868 годах. Его первое правление закончилось свержением, а другое — его убийством. Младший сын князя Милоша Обреновича, родился в 1823, избран сенатом в князья Сербии после смерти его старшего брата, Милана, правившего всего несколько недель. Свергнутый с престола и изгнанный из Сербии отец его Милош согласился и отпустил юного сына в Сербию. Османская империя тоже признала это избрание, но потребовала, чтобы советниками при молодом князе были Вучич и Петрониевич.\\nПоддерживаемый сенатом, Михаил отказался исполнить это требование, и во главе управления поставил своего дядю Ефрема Обреновича и Георгия Протича. Вучич и Петрониевич, пользуясь последовавшим повышением податей, волновали народ. Молодой князь колебался, переносил столицу из Белграда в Крагуевац и из Крагуеваца в Белград и все-таки ничего не мог поделать. В 1842, не пожелав отдаться под защиту турецкого гарнизона в Белградской цитадели, как это советовал русский консул, Михаил бежал от восставших сторонников Карагеоргиевичей, уже занявших Белград, за границу. С тех пор он жил преимущественно в Вене, где много работал над своим ранее весьма скудным образованием."},{"page_url":"https://no.wikipedia.org/wiki/Pyramide","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Viervlak-frame.jpg","page_title":"Pyramide","context_page_description":"En pyramide er et legeme som består av en grunnflate, med et gitt antall sider. Ved hver av disse sidene er en trekantformet side. Det tredje hjørnet til disse trekantene møtes i et felles punkt, som ikke behøver å være plassert direkte over grunnflaten. Sammen danner alle disse sidene et konisk objekt med en polygonal grunnflate.\\nEr grunnflaten også en trekant, består pyramiden av fire trekanter, og er da et tetraeder. Når man ikke kjenner grunnflaten, går man ut fra at den er et rektangel, som i de kjente egyptiske pyramidene."},{"page_url":"https://ca.wikipedia.org/wiki/Pont_Vell_(la_Bisbal_d%27Empord%C3%A0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Pont_Vell_de_la_Bisbal_%28cropped%29.jpeg","page_title":"Pont Vell (la Bisbal d'Empordà)","context_page_description":"El Pont Vell és una obra del municipi de la Bisbal d'Empordà protegida com a bé cultural d'interès local."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_im_Kreis_Pl%C3%B6n","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Rathjensdorf_in_PLOE.png","page_title":"Liste der Kulturdenkmale im Kreis Plön","context_page_description":"In der Liste der Kulturdenkmale im Kreis Plön sind die Kulturdenkmale im schleswig-holsteinischen Kreis Plön aufgelistet.\\nGrundlage der Einzellisten sind die in den jeweiligen Listen angegebenen Quellen. Die Angaben in den einzelnen Listen ersetzen nicht die rechtsverbindliche Auskunft der zuständigen Denkmalschutzbehörde. Die erforderlichen Denkmaleigenschaften werden im Denkmalschutzgesetz von Schleswig-Holstein festgeschrieben."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%BE%D9%88%D8%AF%D9%85%D9%88%DA%A9%D9%84%D8%A7%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Podmoklany_znak.jpg","page_title":"پودموکلانی","context_page_description":"پودموکلانی چک اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. دنیز سوُلاری سَویه‌سیندن ۴۷۳ متر یۇکسک‏لیکده یئر آلیب. سوْن نۆفوس ساییمی اساسيندا ۱۴۲ نفر ایمیش و ویسوچینا اوستانیندا یئرلشیب. بۆتون چک‌دا اوْلدوغو کیمی، بۇ شهرده آنا دیلی چک دیلی دیر."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%8B%E4%B8%B8%E5%AD%90%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Shimomaruko_Station_Platform.jpg","page_title":"下丸子站","context_page_description":"下丸子車站是一個位於東京都大田區下丸子三丁目，屬於東急電鐵東急多摩川線的鐵路車站。車站編號是TM04。"},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Elaia%E2%80%93Kalamas","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Greek_soldier_Kalpaki_1940.jpg","page_title":"Battle of Elaia–Kalamas","context_page_description":"The Battle of Elaia–Kalamas took place in Epirus from 2–8 November 1940. The battle was fought between the Greeks and the Italians during the initial stage of the Greco-Italian War. The Italian Army, deployed on the Greek-Albanian border, launched an offensive against Greece on 28 October 1940. The main thrust of the Italian invasion occurred in the Epirus sector, with a further flanking move through the Pindus mountains. In Epirus, the Greeks held the Elaia–Kalamas river line, and even though the Greek army was outnumbered, the local Greek forces under Major General Charalambos Katsimitros managed to stop the Italian advance. Along with the Italian failure in the Battle of Pindus, these Greek successes signified the complete failure of the Italian invasion, leading to the dismissal of the Italian commander in Albania, Sebastiano Visconti Prasca, on 9 November. In the next few weeks the Greek forces managed to initiate a counter-offensive, which forced the Italians to retreat deep into Albania."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%9B%B21%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/TW_THWyl1-3.png","page_title":"雲1線","context_page_description":"云1线 海埔地－麦寮，是位于云林县的一条乡道，北起云林县麦寮乡三盛村海埔地，南至云林县麦寮乡麦丰村麦寮，全长3.647公里。有五支线云1-1线至云1-5线。"},{"page_url":"https://de.wikipedia.org/wiki/Franz_Wessel%C3%A9nyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Wessel%C3%A9nyi_Ferenc_Widemann.jpg","page_title":"Franz Wesselényi","context_page_description":"Franz Wesselényi von Hadad war ungarischer Palatin und einer der Rädelsführer der Magnatenverschwörung."},{"page_url":"https://nl.wikipedia.org/wiki/Zwartkapdonacobius","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Donacobius.jpg","page_title":"Zwartkapdonacobius","context_page_description":"De zwartkapdonacobius is een tamelijk grote zangvogel uit de familie Donacobiidae."},{"page_url":"https://en.wikipedia.org/wiki/Law_enforcement_in_Mauritania","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Mauritania_gendarmerie.jpg","page_title":"Law enforcement in Mauritania","context_page_description":"The Gendarmerie Nationale is the national police force of Mauritania. The gendarmerie is part of the army and maintains posts in the urban and rural parts of the country.\\nIn 2019, 140 gendarmes were deployed as part of a UN multinational peacekeeping force in the Central African Republic."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%82%B9%E3%82%AA%E3%83%BC%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Kyr%C3%B6nsalmi_2018_06_09_16.jpg","page_title":"シスオート","context_page_description":"シスオートは、フィンランド、ウーシマー県ラーセポリに本拠を置くトラックメーカー。子会社であるシスディフェンスでは装輪装甲車の製造開発を行う。また、社名である「SISU」はフィンランド語で「ストイックな決意」「粘り強さ」「忍耐」として説明されるフィンランドの概念であり、フィンランド人が自国の国民性を表現するために使用される単語である。"},{"page_url":"https://de.wikipedia.org/wiki/Wackelstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Rocking_Stone.JPG","page_title":"Wackelstein","context_page_description":"Als Wackel- oder Schaukelsteine werden meist durch Ablagerung oder Verwitterung entstandene Phänomene bei Felsblöcken bezeichnet, die leicht beweglich auf ihrer Unterlage balancieren. Sie bilden sich bevorzugt aus granitischem Aufschlussgestein als Späterscheinung der Wollsackverwitterung, seltener aus horizontal gebankten Sedimentgesteinen.\\nZunächst erweitern die Verwitterungsvorgänge die primär angelegten Kluftsysteme im Gestein, bis der Gesteinskomplex im Lauf der Zeit in Einzelblöcke zerfällt, die dann – immer weiter zerkleinert – nach und nach abgetragen werden. In seltenen Fällen bleiben größere Einzelblöcke in exponierter „wackeliger“ Lage erhalten. Ein dem Wackelstein ähnlicher Formtyp ist der Pilzfelsen.\\nDie erstaunliche Bewegungsfähigkeit jener im Gleichgewicht gehaltenen, oftmals riesigen Massen führte vielerorts zur Entstehung von Mythen und Sagen, in denen derartige Steine eine wesentliche Rolle beispielsweise als Orakel oder „Spielzeug“ von Riesen einnehmen.\\nEine andere Gattung sind durch menschliche Aktivitäten entstandene Wackelsteine."},{"page_url":"https://hu.wikipedia.org/wiki/Fels%C5%91sebes_(Szlov%C3%A1kia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Slovakia_Vysna_Sebastova_4.JPG","page_title":"Felsősebes (Szlovákia)","context_page_description":"Felsősebes község Szlovákiában, az Eperjesi kerület Eperjesi járásában."},{"page_url":"https://nl.wikipedia.org/wiki/Wytze_Keuning","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Wytze_Keuning_portret_1918.jpg","page_title":"Wytze Keuning","context_page_description":"Wytze of Wietse Keuning was een Nederlands onderwijzer, auteur en muziekrecensent voor het Nieuwsblad van het Noorden. Samen met letterkundige Josef Cohen schreef hij drie series succesvolle schoolboekjes en een jeugdboek met volkssprookjes. Voorts schreef hij enkele korte verhalen in verscheidene regionale dagbladen, drie streekromans en een driedelige \\"Indische roman uit de derde eeuw voor Christus\\", getiteld Asoka. Keuning had het manuscript voor een tweedelige historische roman, Helena, over de moeder van de Romeinse keizer Constantijn de Grote, af, maar hij stierf voor tot uitgeven kon worden overgegaan."},{"page_url":"https://cs.wikipedia.org/wiki/Jemin_Mo%C5%A1e","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/West_Jerusalem_Mishkenot_Shaananim_Bougainvillea.jpg","page_title":"Jemin Moše","context_page_description":"Jemin Moše je městská čtvrť v centrální části Jeruzaléma v Izraeli."},{"page_url":"https://es.wikipedia.org/wiki/Historia_precolombina_de_Argentina","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/La_cueva_de_las_manos_Santa_Cruz.jpg","page_title":"Historia precolombina de Argentina","context_page_description":"La historia precolombina de Argentina hace referencia a los desarrollos culturales locales del actual territorio de la República Argentina previos a la conquista y colonización por parte de España.\\nEl primer registro poblacional del territorio actualmente controlado por la Argentina se remonta al 12.º o al 13.er milenio AP, de acuerdo a los hallazgos de Los Toldos y Piedra Museo.​ Entre los pueblos originarios, los cazadores y recolectores habitaron la Patagonia, la Pampa y el Chaco. Los agricultores se instalaron en el noroeste, Cuyo, las Sierras de Córdoba y después en la mesopotamia. Tastil, en el noroeste, fue la ciudad precolombina más grande ubicada en el actual territorio argentino, con una población de 2000 habitantes.​\\nLos pueblos indígenas argentinos se dividieron en dos grandes grupos: los cazadores y recolectores, que habitaban la Patagonia, la Pampa y el Chaco; y los agricultores, instalados en el norte, Cuyo, las Sierras de Córdoba y, más tardíamente, en la Mesopotamia.\\nTastil, en el norte, fue la ciudad precolombina más grande ubicada en el actual territorio argentino, con una población de 3000 habitantes."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%BF%D1%83%D1%81%D0%BA%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B_%D0%B0%D0%BF%D0%B0%D1%80%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Command_module_S66-11003.jpg","page_title":"Спускальны апарат","context_page_description":"Спускальны апарат — касмічны апарат або частка касмічнага апарата, прызначаная для спуску карыснай нагрузкі з арбіты штучнага спадарожніка або з міжпланетнай траекторыі і мяккай пасадкі на паверхню Зямлі або іншага нябеснага цела.\\nСА можа з'яўляцца часткай касмічнага апарата, якая выконвае палёт на арбіце штучнага спадарожніка нябеснага цела альбо касмічнага апарата, які выконвае міжпланетны палёт.\\nКарыснай нагрузкай з'яўляюцца людзі, падвопытныя жывёлы, стацыянарныя даследчыя станцыі, планетаходы і г.д.\\nГалоўная тэхнічная задача мяккай пасадкі складаецца ў тым, каб паменшыць хуткасць руху апарата ад касмічнай практычна да нуля. Гэтая задача вырашаецца рознымі спосабамі, прычым часта для аднаго і таго ж апарата на розных участках спуску паслядоўна выкарыстоўваюцца розныя спосабы."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%BE%E6%9C%AC%E6%B5%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Sh%C5%8D-%C5%8D-kai.jpg","page_title":"松本流","context_page_description":"松本流は、日本舞踊の流派のひとつ。藤間流から分派するかたちで、八代目松本幸四郎によって創始された。歌舞伎の特色を受けた芝居がかった舞踊が特徴。定紋は四ツ花菱。なお御殿舞にも同名の流派が存在するが、関連は無い。"},{"page_url":"https://en.wikipedia.org/wiki/Akito_Tsuda","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/TsudaAkito2017.jpg","page_title":"Akito Tsuda","context_page_description":"Akito Tsuda is a Japanese photographer. Tsuda has published works focused on subjects in Chicago, Osaka, and Tokyo. His work has been exhibited in Japan, Italy, and the United States. He has been recognized for his work documenting the Latino residents of the Pilsen neighborhood of Chicago in the early 1990s."},{"page_url":"https://nl.wikipedia.org/wiki/Nippo-Vini_Fantini-Faizan%C3%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Gent_-_Omloop_Het_Nieuwsblad%2C_27_februari_2016_%28A098%29.JPG","page_title":"Nippo-Vini Fantini-Faizanè","context_page_description":"Nippo-Vini Fantini-Faizanè is een Italiaanse wielerploeg die uitkomt in de continentale circuits van de UCI. De ploeg is ontstaan in 2008. Sinds 2015 is de ploeg een professionele continentale ploeg.\\nVan 2012 tot en met 2014 reed de ploeg met een Japanse licentie."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%B8%D6%81%D5%A1%D6%80%D5%BF_%D5%BC%D5%B8%D6%84_%D6%85%D5%BA%D5%A5%D6%80%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/213983_fr_dsc07688.jpg","page_title":"Մոցարտ ռոք օպերա","context_page_description":"Մոցարտ. ռոք օպերա, ֆրանսիական մյուզիքլ Դովա Ատտյաի և Ալբերտ Բարոն Կոենի կողմից, նվիրված Վոլֆգանգ Ամադեուս Մոցարտի կյանքին։ Համարվում է 2009-2010 թվականների ամենաշահութաբեր նախագծերից մեկը, ավելի քան 800 000 վաճառված տոմսերի քանակով։ Ներկայացվել է Ֆրանսիայում, Բելգիայում, Ռուսաստանում, Ուկրաինայում, Ճապոնիայում, Կորեայում։"},{"page_url":"https://en.wikipedia.org/wiki/Collinder_catalogue","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/NGC_1496_DSS.png","page_title":"Collinder catalogue","context_page_description":"In astronomy, the Collinder catalogue is a catalogue of 471 open clusters by Swedish astronomer Per Collinder. It was published in 1931 as an appendix to Collinder's paper On structural properties of open galactic clusters and their spatial distribution. Catalogue objects are denoted by Collinder, e.g. \\"Collinder 399\\". Dated prefixes include as Col + catalogue number, or Cr + catalogue number, e.g. \\"Cr 399\\"."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_K%C3%B6lner_Stadtteil_Br%C3%BCck","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/K%C3%B6ln_Hovenstr._8.jpg","page_title":"Liste der Baudenkmäler im Kölner Stadtteil Brück","context_page_description":"Die folgende Liste enthält die in der Denkmalliste ausgewiesenen Baudenkmäler auf dem Gebiet des Stadtteils Köln-Brück, Stadtbezirk Köln-Kalk, Nordrhein-Westfalen.\\nHinweis: Die Reihenfolge der Baudenkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Kölner Denkmalliste, die Baudenkmäler und Denkmalbereiche auflistet. Dabei kann es sich beispielsweise um Sakralbauten, Wohn- und Fachwerkhäuser, historische Gutshöfe und Adelsbauten, Industrieanlagen, Wegekreuze und andere Kleindenkmäler sowie Grabmale und Grabstätten, die eine besondere Bedeutung für die Geschichte Kölns haben, handeln. Grundlage für die Aufnahme in die offiziellen Denkmallisten ist das Denkmalschutzgesetz Nordrhein Westfalens."},{"page_url":"https://sq.wikipedia.org/wiki/C%C3%B3mpeta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/C%C3%B3mpeta.jpg","page_title":"Cómpeta","context_page_description":"Cómpeta është një komunë në Spanjë, e vendosur në qarkun Axarquía-Costa del Sol, të provincës Málaga, në Andalusia. Cómpeta ka 3,832 banorë, dhe përfshinë një sipërfaqe prej 54.7 km²."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%98%D0%BD%D0%B4%D0%B8%D0%B0%D0%BD%D1%81%D0%BA%D0%B0_%D1%82%D0%B5%D1%80%D0%B8%D1%82%D0%BE%D1%80%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/UnitedStatesExpansion.png","page_title":"Индианска територия","context_page_description":"Индианска територия или Индиански територии, Индианска страна е термин, който се прилага за дефиниране на земята заделена или закупена от Американското правителство за индианците западно от река Мисисипи. Концепцията за Индианска територия се появява в резултат на политиката на правителството за отстраняване на индианците от изконните им земи през 18 и 19 век. По-късно терминът започва да се прилага по-ограничено до част от земите западно от река Мисисипи, по-специално до териториите на днешните щати Канзас и Оклахома. Впоследствие Индианската територия е намалена до границите само на Оклахома. През 1907 г. Оклахома става щат в резултат на сливането на Територията Оклахома и Индианската територия като Индианската територия престава да съществува. През 20 век понятието „Индианска територия“ започва да се използва от историци, генеалози, и от обществеността за определяне на целия регион Оклахома преди да стане щат."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%85%D5%B8%D6%82%D5%B6%D5%AB%D5%A1%D5%BF%D5%A1_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6_(%D5%93%D5%A5%D5%B6%D5%BD%D5%AB%D5%AC%D5%BE%D5%A1%D5%B6%D5%AB%D5%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Juniata_County_Courthouse.jpg","page_title":"Յունիատա շրջան (Փենսիլվանիա)","context_page_description":"Յունիատա շրջան, ԱՄՆ Փենսիլվանիա նահանգի 67 վարչական միավորներից մեկը։ Ընդհանուր տարածությունը 1.020 կմ² է, բնակչությունը՝ 24.636 մարդ ։ Շրջկենտրոնն է Միֆլինթաուն բնակավայրը։ Կազմավորվել է 1831 թ.։\\nՕգտագործված աղբյուրներ\\nՏվյալներ ԱՄՆ վիճակագրության բյուրոյի կայքում\\nԾանոթագրություններ և նշումներ"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%90%84%E5%9B%BD%E9%A6%96%E9%83%BD%E6%B5%B7%E6%8B%94%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/SantaBarara%27s.jpg","page_title":"各国首都海拔列表","context_page_description":"此列表按世界各国首都按照海拔排序。城市的高度影响该地的社会和组织结构。在许多例子中，较寒冷地区的冬天需要特殊的生活方式才能生存。\\n表一中，玻利维亚有两个首都：拉巴斯和苏克雷，拉巴斯是政府所在地，苏克雷为议会所在地。如果拉巴斯被视为玻利维亚的首都，则其在表中排名第一，如果苏克雷被视为首都，则世界海拔最高首都为厄瓜多尔首都基多。\\n下面的第二个列表中所列的地区为未被普遍承认的国家，在国际上仅获得有限的承认。"},{"page_url":"https://ms.wikipedia.org/wiki/Kailan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Baby_kailan_chinese.jpg","page_title":"Kailan","context_page_description":"Kailan adalah nama Kantonis untuk sayur yang juga dikenali sebagai brokoli Cina atau kale Cina. Ia adalah sayuran daun memaparkan daun tebal, rata, berkilat biru-hijau dengan batang tebal dan sebilangan kecil kepala bunga kecil serupa brokoli. Brokoli dan kailan tergolong dalam spesies yang sama Brassica oleracea, tetapi kailan adalah dalam kumpulan alboglabra [Latin: \\"albus+glabrus\\" - putih dan tidak berbulu]. Rasanya adalah sangat serupa dengan brokoli, tetapi sedikit lebih pahit dan lebih nyata.\\nBrokolini adalah kacukan antara brokoli dan kailan, yang dihasilkan oleh Mann Packing Company, Inc.\\nKailan dimakan secara meluas dalam masakan China dan kini terbiasa dalam juadah umum masakan Malaysia, Persiapan biasa termasuk kailan goreng dengan halia dan bawang putih atau ikan masin, dan direbus atau dikukus dan dihidangkan dengan sos tiram. Ia juga adalah perkara biasa dalam masakan Vietnam, Myanmar dan masakan Thai.\\nKailan boleh disemai pada akhir musim panas untuk penuaian awal musim sejuk. Anak benih ditanam pada musim luruh akan bertahan sepanjang musim sejuk."},{"page_url":"https://oc.wikipedia.org/wiki/Phocidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/B%C3%A9b%C3%A9_Phoque_de_Weddell_-_Baby_Weddell_Seal.jpg","page_title":"Phocidae","context_page_description":"La familha dels focids es la de las vertadièras fòcas e dels elefants de mar.\\nAquesta familha foguèt creada per John Edward Gray en 1821."},{"page_url":"https://en.wikipedia.org/wiki/2012_Pacific_typhoon_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Maliksi_Oct_03_2012.jpg","page_title":"2012 Pacific typhoon season","context_page_description":"The 2012 Pacific typhoon season was a fairly average but destructive season, though rather active since 2004. It produced 25 named storms, fourteen typhoons, and four intense typhoons. It was an event in the annual cycle of tropical cyclone formation, in which tropical cyclones form in the western Pacific Ocean. The season ran throughout 2012, though most tropical cyclones typically develop between May and October. The season's first named storm, Pakhar, developed on March 28, while the season's last named storm, Wukong, dissipated on December 29. The season's first typhoon, Guchol, reached typhoon status on June 15, and became the first super typhoon of the year on June 17.\\nThe scope of this article is limited to the Pacific Ocean, to the north of the equator between 100°E and the 180th meridian. Within the northwestern Pacific Ocean, there are two separate agencies that assign names to tropical cyclones, which can often result in a cyclone having two names. The Japan Meteorological Agency will name a tropical cyclone should it be judged to have 10-minute sustained wind speeds of at least 65 km/h anywhere in the basin."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D1%83%D0%B4%D0%B0%D2%93%D1%8B_%D0%AE%D0%9D%D0%95%D0%A1%D0%9A%D0%9E_%D3%98%D0%BB%D0%B5%D0%BC%D0%B4%D1%96%D0%BA_%D0%BC%D2%B1%D1%80%D0%B0_%D0%BD%D1%8B%D1%81%D0%B0%D0%BD%D0%B4%D0%B0%D1%80_%D1%82%D1%96%D0%B7%D1%96%D0%BC%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Llamas_Andhy.JPG","page_title":"Перудағы ЮНЕСКО Әлемдік мұра нысандар тізімі","context_page_description":"ЮНЕСКО Әлемдік мұра тізімінде Перудың 12 нысаны бар. Бұл нысан тізімге 8 нысан мәдени, 2 табиғи және 2 - аралас критерийлар бойынша іліккен. Бұдан басқа, 2014 жылғы жағдайына сәйкес Перу аймағындағы Әлемдік мұра тізіміне 7 нысан үміткер ретінде тіркелген, оның ішінде 6 — мәдени және 1 — аралас критериямйлар бойынша іліккен."},{"page_url":"https://en.wikipedia.org/wiki/Albatec_Racing","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Jacques_Villeneuve_on_WRX_-_Portugal_2014_%288%29.jpg","page_title":"Albatec Racing","context_page_description":null},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9F%E3%82%B7%E3%82%AC%E3%83%B3%E6%BA%96%E5%B7%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Michigan-territory-1836.png","page_title":"ミシガン準州","context_page_description":"ミシガン準州は、1805年6月30日から1837年1月26日までのアメリカ合衆国の自治的領域である。1837年にアメリカ合衆国第26番目の州に昇格し、ミシガン州となった。準州の首都はデトロイトであった。"},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%9C%E1%83%9D%E1%83%91%E1%83%94%E1%83%9A%E1%83%98%E1%83%A8_%E1%83%9E%E1%83%A0%E1%83%94%E1%83%9B%E1%83%98%E1%83%90%E1%83%A8_%E1%83%9A%E1%83%90%E1%83%A3%E1%83%A0%E1%83%94%E1%83%90%E1%83%A2%E1%83%94%E1%83%A4%E1%83%98_%E1%83%97%E1%83%98%E1%83%9C%E1%83%A9%E1%83%90%E1%83%9A%E1%83%90%E1%83%A8_%E1%83%92%E1%83%9D%E1%83%9C%E1%83%A2%E1%83%99%E1%83%98%E1%83%AA%E1%83%90%E1%83%A4%E1%83%90%E1%83%A8_%E1%83%93%E1%83%90%E1%83%A0%E1%83%92%E1%83%98%E1%83%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Willy_Brandt.jpg","page_title":"ნობელიშ პრემიაშ ლაურეატეფი თინჩალაშ გონტკიცაფაშ დარგის","context_page_description":"ნობელიშ პრემიას თინჩალაშ დარგის გინმოჩანს ნორვეგიაშ ნობელიშ კომიტეტი „to the person who shall have done the most or the best work for fraternity between nations, for the abolition or reduction of standing armies and for the holding and promotion of peace congresses.“"},{"page_url":"https://it.wikipedia.org/wiki/Castelnuovo_di_Ceva","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Mappa_provincia_IT-CN_Castelnuovo_di_Ceva.png","page_title":"Castelnuovo di Ceva","context_page_description":"Castelnuovo di Ceva è un comune italiano di 117 abitanti della provincia di Cuneo, in Piemonte."},{"page_url":"https://es.wikipedia.org/wiki/Roger_Beuchat","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Roger_Beuchat.jpg","page_title":"Roger Beuchat","context_page_description":"Roger Beuchat, nacido el 2 de enero de 1972 en Court, es un antiguo ciclista suizo ya retirado. Debutó en 1998 con el equipo Post Swiss Team."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_di_s%E1%BA%A3n_v%C4%83n_h%C3%B3a_T%C3%A2y_Ban_Nha_%C4%91%C6%B0%E1%BB%A3c_quan_t%C3%A2m_%E1%BB%9F_t%E1%BB%89nh_Navarra","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Museo_de_Navarra.JPG","page_title":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở tỉnh Navarra","context_page_description":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở tỉnh Navarra."},{"page_url":"https://it.wikipedia.org/wiki/San_Jorge_(Nicaragua)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Beach_at_San_Jorge.jpg","page_title":"San Jorge (Nicaragua)","context_page_description":"San Jorge è un comune del Nicaragua facente parte del dipartimento di Rivas."},{"page_url":"https://en.wikipedia.org/wiki/D%27Entrecasteaux_National_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Chatham_Island_WA.jpg","page_title":"D'Entrecasteaux National Park","context_page_description":"D'Entrecasteaux National Park is a national park in Western Australia, 315 kilometres south of Perth. The park is named after the French Admiral Bruni D'Entrecasteaux who was the first European to sight the area and name Point D'Entrecasteaux in 1792.\\nThe park received 168,497 visitors through 2008–2009."},{"page_url":"https://en.wikipedia.org/wiki/Tritonal","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/RAF_Bomber_Command_HU95286.jpg","page_title":"Tritonal","context_page_description":"Tritonal is a mixture of 80% TNT and 20% aluminium powder, used in several types of ordnance such as air-dropped bombs. The aluminium improves the total heat output and hence impulse of the TNT — the length of time during which the blast wave is positive. Tritonal is approximately 18% more powerful than TNT alone.\\nThe 87 kg of tritonal in a Mark 82 bomb has the potential to produce approximately 863 MJ of energy when detonated. This implies an energy density of approximately 9MJ/kg, compared to ~4MJ/kg for TNT."},{"page_url":"https://vi.wikipedia.org/wiki/Bouss%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Kourweogo_departments.png","page_title":"Boussé","context_page_description":"Boussé là một tổng thuộc tỉnh Kourwéogo ở miền trung Burkina Faso. Thủ phủ là thị xã Boussé. Theo điều tra dân số năm 1996, tổng này có tổng dân số 41.013 người."},{"page_url":"https://ca.wikipedia.org/wiki/Candeias_(Bahia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Candeias_4.jpg","page_title":"Candeias (Bahia)","context_page_description":"Candeias és un municipi de l'estat de Bahia al Brasil. La seva població recensada per l'IBGE el 2007 era de 78.655 habitants. Posseeix una àrea de 265,555 km ²."},{"page_url":"https://vi.wikipedia.org/wiki/Huy%E1%BB%87n_Hpa-an","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/MyanmarKayin.png","page_title":"Huyện Hpa-an","context_page_description":"Huyện Hpa-an là một huyện của bang Kayin ở Myanma. Huyện này có 5 thị trấn và 1490 làng."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D0%A0%D0%B5%D0%BD%D0%BE%D0%BE%D0%B2%D0%B8%D1%85_%D0%BC%D0%BE%D0%B4%D0%B5%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Renault_Floride_S_%282009-10-13%29_Seite.jpg","page_title":"Списак Реноових модела","context_page_description":"Ово jе листа возила које је произвела француска фабрика аутомобила Рено.\\nРеноови нови модели су обично представљани на Париском салон аутомобила који се претходних година најчешће одржаван септембра или октобра у Паризу. Отуда модели приказани на сајму 2015. дефинисани су као модели 2016."},{"page_url":"https://en.wikipedia.org/wiki/Johnny_Ingebrigtsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Johnny_Ingebrigtsen.jpg","page_title":"Johnny Ingebrigtsen","context_page_description":"Johnny Ingebrigtsen is a Norwegian politician for the Socialist Left Party.\\nHe served as a deputy representative to the Parliament of Norway from Finnmark during the terms 2005–2009 and 2013–2017. He hails from Nordkapp and has been a member of the county council. He has also chaired Finnmark Socialist Left Party.\\nIn 2016 he came out in support of Brexit."},{"page_url":"https://en.wikipedia.org/wiki/Jemima_Blackburn","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Birds_from_Moidart_and_elsewhere_%28Plate_20%29_%288510242531%29.jpg","page_title":"Jemima Blackburn","context_page_description":"Jemima Wedderburn Blackburn was a Scottish painter whose work gives us an evocative picture of rural life in 19th-century Scotland. One of the most popular illustrators in Victorian Britain, she illustrated 27 books. Her greatest ornithological achievement was the second edition of her Birds from Nature. Most of the illustrations are watercolors, with early paintings often including some ink work. A few are collages, in which she cut out a bird's outline and transferred it to a different background, in a similar manner to John James Audubon. Her many watercolours show daily family life in the late 19th-century Scottish Highlands as well as fantasy scenes from children's fables. She achieved widespread recognition under the initials JB or her married name Mrs Hugh Blackburn."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%B5%D0%BB%D0%B5%D0%BC%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Delemont_A.JPG","page_title":"Делемон","context_page_description":"Делемон је град у северозападној Швајцарској. Делемон је главни град кантона Јура, као и његово највеће насеље."},{"page_url":"https://pl.wikipedia.org/wiki/Kminek_zwyczajny","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/K%C3%BCmmel_2012-07-08-9523.jpg","page_title":"Kminek zwyczajny","context_page_description":"Kminek zwyczajny – gatunek rośliny dwuletniej należący do rodziny selerowatych."},{"page_url":"https://ceb.wikipedia.org/wiki/Antrodia_pulvinascens","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Antrodia_pulvinascens_%287440522636%29.jpg","page_title":"Antrodia pulvinascens","context_page_description":"Espesye sa uhong sakop sa division nga Basidiomycota ang Antrodia pulvinascens. Una ning gihulagway ni Albert Pilát, ug nga gihatagan sa eksakto nga ngalan ni Tuomo Niemelä ni adtong 1985. Ang Antrodia pulvinascens sakop sa kahenera nga Antrodia sa kabanay nga Fomitopsidaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%BF%D0%BE%D1%87%D1%82%D1%8B_%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D1%8B%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Swedish_stamp_1872_1_Riksdaler_POST.054063.jpg","page_title":"История почты и почтовых марок Швеции","context_page_description":"История почты и почтовых марок Швеции охватывает ранний, классический и современный периоды. Начиная с 1855 года Швеция издаёт собственные почтовые марки, а с 1875 года входит во Всемирный почтовый союз. Почтовые операции в стране осуществляет компания Posten AB."},{"page_url":"https://ru.wikipedia.org/wiki/110_%D0%BA%D0%BC_(%D0%BF%D0%BB%D0%B0%D1%82%D1%84%D0%BE%D1%80%D0%BC%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/095_%D0%9A%D1%80%D1%83%D0%B3%D0%BE%D0%B1%D0%B0%D0%B9%D0%BA%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B6-%D0%B4.jpg","page_title":"110 км (платформа)","context_page_description":"110 км — остановочный пункт ВСЖД на Кругобайкальской железной дороге в Маритуйском муниципальном образовании Слюдянского района Иркутской области."},{"page_url":"https://es.wikipedia.org/wiki/G%C3%B3tico_brabantino","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Sint-Pieterskerk_Leuven.jpg","page_title":"Gótico brabantino","context_page_description":"El estilo gótico brabantino o brabanzón [de Brabante] es una significativa variante local de la arquitectura gótica que se encuentra en muchos monumentos situados en el territorio del Brabante histórico —el ducado de Brabante, hoy perteneciente a Bélgica y al sur de los Países Bajos — y en las áreas circundantes.\\nNacido a finales del siglo XIII bajo la influencia del gótico francés, el gótico brabantino adquirió enseguida características propias ya distinguibles en la primera mitad del siglo XIV en la catedral de San Rumoldo en la ciudad de Malinas.​​​​ Reputados arquitectos como Jean d'Oisy, ​Jacob van Thienen, ​Everaert Spoorwater​Matheus de Layens, ​ y las familias Keldermans y De Waghemakere​ difundieron el estilo y las técnicas por las ciudades y pueblos del ducado de Brabante y más allá.​ En las iglesias y otros edificios importantes, el tenor se impuso y se prolongó durante todo el Renacimiento.​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D1%96%D0%BD%D0%B0%D0%BB_%D0%BA%D0%BB%D1%83%D0%B1%D0%BD%D0%BE%D0%B3%D0%BE_%D1%87%D0%B5%D0%BC%D0%BF%D1%96%D0%BE%D0%BD%D0%B0%D1%82%D1%83_%D1%81%D0%B2%D1%96%D1%82%D1%83_%D0%B7_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83_2011","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/FC_Barcelona_Team_2%2C_2011.jpg","page_title":"Фінал клубного чемпіонату світу з футболу 2011","context_page_description":"Фінал Клубного чемпіонату світу з футболу 2011 — фінальний матч Клубного чемпіонату світу з футболу 2011 року, футбольного турніру для клубів-чемпіонів кожної з шести конфередераций ФІФА та чемпіона країни-господарки турніру. Матч пройшов 18 грудня 2011 року на Міжнародному стадіоні у Йокогамі. У ньому зустрілися бразильський «Сантос» та «Барселона».\\nМатч був оголошений як протистояння між Ліонелем Мессі і 19-річним Неймаром. Мессі виграв дуель, забивши два голи у фіналі і був названий людиною матчу, а також найкращим гравцем турніру."},{"page_url":"https://ga.wikipedia.org/wiki/Ceantar_Daon%C3%A1irimh_Dillingham,_Alasca","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Amalik_Bay_Archeological_District_%2820357938118%29.jpg","page_title":"Ceantar Daonáirimh Dillingham, Alasca","context_page_description":"Is ceantair daonáirimh in Alasca é Ceantar Daonáirimh Dillingham. Sa bhliain 2016 bhí 4,954 daoine ina gcónai ann."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A8_%D7%94%D7%91%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/%D7%94%D7%A8_%D7%94%D7%91%D7%99%D7%AA_%D7%A2%D7%9C%D7%99%D7%AA_%D7%99%D7%94%D7%95%D7%93%D7%99%D7%9D.jpg","page_title":"הר הבית","context_page_description":"הר הבית הוא מתחם קדוש בחלקה הדרום־מזרחי של העיר העתיקה בירושלים. בימינו המתחם שטוח ברובו, בצורה כמעט מלבנית, שטחו כ־140 דונם, והוא מגיע לגובה של 743 מטר מעל פני הים בפסגתו.\\nהר הבית הוא המקום בו שכן המבנה הקדוש ביותר ליהודים – בית המקדש, המקום היחיד, על פי ההלכה, שבו יוכל לשכון המקדש בעתיד והמקום הקדוש ביותר לעם היהודי. היהודים פונים לכיוונו בתפילה שלוש פעמים ביום, ומתפללים להקמת בית המקדש השלישי. ההר, בו נמצאים מסגד אל־אקצא וכיפת הסלע הוא המקום השלישי בקדושתו באסלאם.\\nעל־פי המסורות הדתיות השונות, הר הבית הוא המקום ממנו נברא העולם, בו התקיימה עקידת יצחק, ועל־פי רוב פרשני הקוראן המוסלמים, ממנו עלה מוחמד השמימה עם המלאך גבריאל במסעו הלילי.\\nהר הבית נחשב למקום בעל רגישות פוליטית בינלאומית גבוהה, והמתחם עומד ברקע לסכסוכים רבים בין מוסלמים ליהודים מאז שנות ה־20 של המאה ה־20. מאז מלחמת ששת הימים המתחם נמצא בשליטה ישראלית, ולפי החוק הישראלי אף בריבונות ישראלית, ומנוהל באופן רשמי על ידי משרד הווקף בירדן."},{"page_url":"https://en.wikipedia.org/wiki/Cecilia_Panato","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/2019_ICF_Wildwater_canoeing_World_Championships_024_-_Cecilia_Panato.jpg","page_title":"Cecilia Panato","context_page_description":"Cecilia Panato is an Italian female canoeist who won six medals at senior level at the Wildwater Canoeing World Championships.\\nHer father is the canoeing legend Vladi Panato, also her sister Alice is a canoeist, he is also their coach."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CF%81%CE%B1%CE%B3%CE%BA%CE%AC%CF%84%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Aragats_mountain%2C_Aragatsotn%2C_Armenia.jpg","page_title":"Αραγκάτς","context_page_description":"Το Αραγκάτς είναι σύνθετο ηφαίστειο στην Αρμενία. Με ύψος 4.095 μέτρα είναι ένα από τα ψηλότερα σημεία στο Αρμενικό οροπέδιο και το ψηλότερο σημείο της σύγχρονης Αρμενίας. Το ηφαίστειο ήταν ενεργό κατά το Πλειστόκαινο, ενώ σήμερα καλύπτεται από παγετώνες. Πετρογλυφικά έχουν ανακαλυφθεί γύρω από το ηφαίστειο."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%B0%D0%BB%D1%8C%D0%BA%D0%BE%D0%B2%D0%B5%D1%86%D1%8C_%D1%82%D1%80%D0%B8%D1%87%D1%96%D0%BD%D0%B0%D0%B4%D1%80%D1%96%D0%B7%D0%B0%D0%BD%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Corallorrhiza_trifida_06_mg-k.jpg","page_title":"Коральковець тричінадрізаний","context_page_description":"Коральковець тричінадрі́заний — рідкісна багаторічна рослина родини зозулинцевих, поширена в лісах помірного поясу Північної півкулі. Сапротрофна безхлорофільна орхідея, що співмешкає із симбіотичними грибами. Реліктовий вид, занесений до Червоної книги України, також має охоронний статус у багатьох країнах Європи. Раніше мав обмежене застосування як лікарська рослина."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_%C3%A9difices_religieux_de_Vannes","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Vannes_-_lyc%C3%A9e_Saint-Fran%C3%A7ois-Xavier_%2802%29.jpg","page_title":"Liste des édifices religieux de Vannes","context_page_description":"Cet article présente la liste des édifices religieux situés sur le territoire de la commune française de Vannes dans le Morbihan. Cette liste regroupe non seulement les lieux de culte mais également les établissements à vocation religieuse\\nNote : cette liste n'est pas exhaustive."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B7%D0%B4%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D0%BA%D0%B0_(%D0%9F%D1%80%D0%B8%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B0%D0%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/%D0%93%D0%B0%D1%80%D0%BD%D0%B8%D0%B7%D0%BE%D0%BD_%D0%92%D0%BE%D0%B7%D0%B4%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9._%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D1%84%D1%80%D0%BE%D0%BD%D1%82%D0%BE%D0%B2%D0%B8%D0%BA%D0%B0%D0%BC.jpg","page_title":"Воздвиженка (Приморский край)","context_page_description":"Воздви́женка — село, расположенное в Уссурийском городском округе Приморского края. Основано в 1883 г. Стоит на «старой» автотрассе «Уссури» в 9 километрах севернее Уссурийска и 85 км от Владивостока.\\nЧисленность населения на 2010 год составила 6454 человека. Почтовые индексы — 692555, 692556, 692557.\\nВ селе Воздвиженка расположены учебные корпуса некоторых факультетов Приморской государственной сельскохозяйственной академии.\\nВ непосредственной близости от села находится авиабаза ВВС России «Воздвиженка». В Воздвиженке расположен 322-й авиаремонтный завод Минобороны России, специализирующийся на ремонте боевых самолётов марки «Су».\\nЗападнее села проходит железнодорожная линия Уссурийск — Гродеково, в 8 км северо-западнее села находится станция Воздвиженский и населённый пункт при ней."},{"page_url":"https://es.wikipedia.org/wiki/VMware_vSphere","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/VMware_vSphere_in_the_Enterprise_diagram_v1.0.gif","page_title":"VMware vSphere","context_page_description":"VMware vSphere es una plataforma de virtualizacón de computación en nube de VMware.​"},{"page_url":"https://de.wikipedia.org/wiki/Bell_X-2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/X-2_After_Drop_from_B-50_Mothership_-_GPN-2000-000396.jpg","page_title":"Bell X-2","context_page_description":"Die Bell X-2 Starbuster war ein US-amerikanisches Experimentalflugzeug, das der Untersuchung von Flugeigenschaften im Geschwindigkeitsbereich von Mach 2 bis 3 dienen sollte. Es handelte sich um einen raketengetriebenen Ganzmetalltiefdecker. Trag- und Leitwerk waren im Gegensatz zum direkten Vorgänger, der Bell X-1, gepfeilt ausgeführt. An Stelle eines Schleudersitzes wurde eine ausstoßbare Nasenkapsel eingebaut. Aus Gewichtsgründen wurde auf ein Fahrwerk verzichtet, stattdessen gab es Landekufen."},{"page_url":"https://en.wikipedia.org/wiki/2019_in_insect_paleontology","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Mulleroconis_hyalina_holotype_Fig1_A.jpg","page_title":"2019 in insect paleontology","context_page_description":"This list of fossil insects described in 2019 is a list of new taxa of fossil insects that are scheduled to be described during the year 2019, as well as other significant discoveries and events related to insect paleontology that are scheduled to occur in the year 2019."},{"page_url":"https://pt.wikipedia.org/wiki/Aniwa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Aniwa_Wisconsin_post_office.jpg","page_title":"Aniwa","context_page_description":"Aniwa é uma vila localizada no estado norte-americano de Wisconsin, no Condado de Shawano."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%8A%80%E5%BA%A7%E7%AB%99_(%E6%97%A5%E6%9C%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/150913_Ginza_Station_Tokyo_Japan01bs.jpg","page_title":"銀座站 (日本)","context_page_description":"银座站是位于日本东京都中央区银座四丁目，属于东京地铁的铁路车站。"},{"page_url":"https://ast.wikipedia.org/wiki/Marisa_Centeno","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Conjunto_espa%C3%B1ol_1987_Varna.png","page_title":"Marisa Centeno","context_page_description":"Marisa Centeno Carrasco ye una ex ximnasta rítmica española que foi componente de la selección nacional de ximnasia rítmica d'España na modalidá de conxuntos. Los sos llogros más reseñables son los dos medayes de bronce llograes nel Mundial de Varna y la medaya de bronce llograda nel Européu de Florencia."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%9C%9F%E5%9C%B0%E5%85%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/%E6%9D%B1%E9%A6%AC%E8%8F%AF%E4%BA%BA%E5%9C%B0%E5%9F%BA%E4%B8%BB.jpg","page_title":"土地公","context_page_description":"土地公，又称福德正神、土地伯、土地公伯、土地神、土地爷、社神、社公等，琉球称为土帝君。\\n土地神乃中国民间信仰普遍的神明之一，主要流行于汉族地区，部分受汉文化影响的民族也有信仰。土地神属于民间信仰中的地方保护神，是具有福德的善鬼神；在中国大陆，中华民国时期及之前，凡有汉人群居住的地方就有供奉土地神的情景。在中国传统文化中，祭祀土地神即祭祀大地，现代多属于祈福、求财、保平安、保农业收成之意。土地神也是道教诸神中地位较低，也是与人民较亲近的神祇。\\n台湾民间信仰之中，玄坛真君与福德正神，是公司、商社的财神与守护神祇，习俗渗透至今，定正月初五玄坛真君巡游人间之日为开工日；十二月十六尾牙日，即土地神年终的牙祭日，商家或机关在此日宴请员工。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%BE%D0%BD_%D0%A7%D1%96_%D0%A1%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/%ED%98%84%EC%8A%B9%EB%AF%BC.jpg","page_title":"Чон Чі Со","context_page_description":"Чон Чі Со — південнокорейська акторка."},{"page_url":"https://ceb.wikipedia.org/wiki/Caryota","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Caryota_mitis_leaves.jpg","page_title":"Caryota","context_page_description":"Henero sa mga tanom nga bulí ang Caryota. Ang Caryota sakop sa kabanay nga Arecaceae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://fr.wikipedia.org/wiki/Pohn%C3%A1n%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Pohn%C3%A1n%C3%AD%2C_silnice_II.jpg","page_title":"Pohnání","context_page_description":"Pohnání est une commune du district de Tábor, dans la région de Bohême-du-Sud, en République tchèque. Sa population s'élevait à 72 habitants en 2017."},{"page_url":"https://pl.wikipedia.org/wiki/William_Muldoon","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Muldoon.jpg","page_title":"William Muldoon","context_page_description":"William Muldoon – amerykański wrestler i zapaśnik irlandzkiego pochodzenia, promotor sportowy, trener zapaśników i bokserów, kulturysta, aktor teatralny, wojskowy, policjant, pierwszy przewodniczący New York State Athletic Commission i wynalazca piłki lekarskiej.\\nJest nazywany ojcem amerykańskiego wrestlingu. W 1880 zdobył uznanie jako mistrz świata w zapasach klasycznych i do końca swojej kariery nie stracił tego tytułu. Dzięki doświadczeniom zdobytym jako aktor teatralny, jako jeden z pierwszych promotorów wprowadził do wrestlingu elementy spektaklu. Często występował w stroju gladiatora. Zasłynął również jako trener boksera Johna L. Sullivana i założyciel ośrodka zdrowia The Olympia, w którym trenował wiele osób znanych ze świata mediów."},{"page_url":"https://es.wikipedia.org/wiki/Kurt_Eisner","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/KurtEisner1919.jpg","page_title":"Kurt Eisner","context_page_description":"Kurt Eisner ​ fue un político y periodista bávaro de origen judío. Como periodista, socialista y estadista judío alemán, organizó la Revolución de Noviembre que derrocó a la monarquía de los Wittelsbach en Baviera en noviembre de 1918. Es mencionado como un ejemplo de autoridad carismática por Max Weber."},{"page_url":"https://sr.wikipedia.org/wiki/Glikodeoksiholinska_kiselina","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Glycodeoxycholic_acid.png","page_title":"Glikodeoksiholinska kiselina","context_page_description":"Glikodeoksiholinska kiselina je organsko jedinjenje, koje sadrži 26 atoma ugljenika i ima molekulsku masu od 449,623 Da."},{"page_url":"https://en.wikipedia.org/wiki/2008_United_States_Senate_election_in_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Jeffbeatty.jpg","page_title":"2008 United States Senate election in Massachusetts","context_page_description":"The 2008 United States Senate election in Massachusetts took place on November 4, 2008. Incumbent Democratic U.S. Senator John Kerry, who returned to the Senate after losing the presidency to incumbent President George W. Bush in the 2004 presidential election, won re-election to a fifth term in office. Four years into his term, Kerry resigned upon becoming United States Secretary of State in the Barack Obama administration."},{"page_url":"https://nl.wikipedia.org/wiki/Augustijnenkerk_(Eindhoven)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Heilig-Hartkerk.jpg","page_title":"Augustijnenkerk (Eindhoven)","context_page_description":"De Augustijnenkerk is een voormalige kerk aan de Tramstraat 37 in de Nederlandse stad Eindhoven. De kerk is aan het eind van de negentiende eeuw gebouwd voor de augustijner paters van het naastgelegen Klooster Mariënhage. De kerk was tot december 2017 hun eigendom; Uitvaartverzekeraar en -verzorger DELA is sindsdien eigenaar van het hele complex Mariënhage. De kerk is een rijksmonument."},{"page_url":"https://en.wikipedia.org/wiki/Seton_Gordon","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Memorial_to_Seton_Gordon.jpg","page_title":"Seton Gordon","context_page_description":"Seton Gordon was a Scottish naturalist, photographer and folklorist.\\nGordon began exploring the Highlands of Scotland as a boy, particularly the Cairngorms. He later became a world-famous naturalist, photographer and folklorist, describing the wildlife and scenery of Scotland. His books are still widely available, and a recent anthology has been published. Their appeal is based upon the knowledge of natural history displayed, together with his ability as a writer.\\nBorn in Aberdeen, he lived on Deeside and was educated privately and at Oxford. Given cameras as a young man, his books were illustrated with photographs taken by himself and his first wife, Audrey Gordon, for many years his companion and helper in the field.\\nHe accompanied the Oxford University Expedition to Spitsbergen in 1921 and took many photographs there, but the birds of the Scottish mountains and glens were always his real passion. From his home in Aviemore, he made regular forays into the wilds.\\nOf all the Scottish birds, the golden eagle was his favourite. He is believed to have been the first to photograph both the snow bunting and the whooper swan at nests in Scotland."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%89%84EF80%E5%BD%A2%E9%9B%BB%E6%B0%97%E6%A9%9F%E9%96%A2%E8%BB%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/JNR_EL_EF80-63_Truck_DT136_20090921_001.jpg","page_title":"国鉄EF80形電気機関車","context_page_description":"EF80形電気機関車は、日本国有鉄道が1962年から製造した交直流両用電気機関車である。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1962","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Smith%2C_Jacqui_%28crop%29.jpg","page_title":"Lijst van personen geboren in 1962","context_page_description":"Dit is een lijst van personen die geboren zijn in 1962.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Patrick_Grant","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/PatrickGrantBrompton01.jpg","page_title":"Patrick Grant","context_page_description":"Field Marshal Sir Patrick Grant, GCB, GCMG was a senior Indian Army officer. He fought at the Battle of Maharajpore during the Gwalior Campaign, at the Battle of Mudki, the Battle of Ferozeshah and the Battle of Sobraon during the First Anglo-Sikh War and at the Battle of Chillianwala and the Battle of Gujrat during the Second Anglo-Sikh War. During the Indian Mutiny, as acting Commander-in-Chief, India, he directed the operations against the mutineers, sending forces under Henry Havelock and James Outram for the relief of Cawnpore and Lucknow. He later became Governor of Malta."},{"page_url":"https://no.wikipedia.org/wiki/Per_Petersson","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Full_perpetersson-7893.jpg","page_title":"Per Petersson","context_page_description":"Per Øyvind Runo Petersson var en norsk fotograf. Han er kjent for sin dokumentasjon av norsk billed- og skulpturkunst.\\nHan vokste opp på St. Hanshaugen i Oslo og startet tidlig sin interesse for fotografering. Han kjøpte sitt første kamera da han var 15 år og begynte straks med å fotografere sine omgivelser. Han klarte å skaffe seg en lærlingjobb i fotostudio O. Væring, drevet av Ragnvald Væring og etter å ha utført lærlingjobben og vært fast ansatt siden 1947 kjøpte fotograf Per Petersson firmaet O. Væring fra Ragnvald Værings bo i 1960. Per Petersson fortsatte arbeidet med å avfotografere norske kunstneres produksjon fra hans studio i Karl Johansgate 2, og er ansvarlig for det meste av arkivets fotomateriale i farger. Per Petersson fotograferte systematisk alle viktige kunstutstillinger i hans samtid. Han reiste ofte på eget initiativ for å bygge opp arkivet og gjorde en stor kulturell innsats gjennom årene, og ofte uten betaling. Per Petersson betraktet dokumentering av norsk kunst som en livsoppgave og ble gjennom sitt arbeid nær venn med flere kunstnere og var oppriktig dedikert av sitt fotografiske arbeid gjennom hele sitt yrkesliv."},{"page_url":"https://et.wikipedia.org/wiki/Trahh%C3%BC%C3%BCt","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Mineraly.sk_-_trachyt.jpg","page_title":"Trahhüüt","context_page_description":"Trahhüüt on afaniitne kuni porfüüriline vulkaaniline kivim."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Diospyros_species","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Red_Fruited_Ebony_RBG_Sydney.jpg","page_title":"List of Diospyros species","context_page_description":"As of July 2014 the World Checklist of Selected Plant Families and The Plant List recognise about 750 accepted taxa in the plant genus Diospyros."},{"page_url":"https://cs.wikipedia.org/wiki/Tour_de_France_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Tour_de_France_2012_-_Etappe_14.png","page_title":"Tour de France 2012","context_page_description":"Tour de France 2012, v pořadí 99. ročník nejslavnějšího cyklistického etapového závodu světa – Tour de France, probíhal mezi 30. červnem až 22. červencem 2012. Závod odstartoval prologem v belgickém městě Lutych a skončil tradičně pod pařížským Vítězným obloukem. V tomto ročníku nestartoval žádný z českých jezdců, Slováci tři: Peter Sagan ze stáje Liquigas-Cannondale a Peter Velits a Martin Velits ze stáje Omega Pharma-Quickstep.\\nZa hlavní favority závodu byli na startu považováni loňský vítěz australan Cadel Evans a britský cyklista Bradley Wiggins.\\nCelkově vyhrál jako první Brit Bradley Wiggins s náskokem 3:21 před týmovým kolegou Chrisem Froomem. Wiggins se oblékl do žlutého trikotu po sedmé, první horské etapě. Do té doby jej nosil Fabian Cancellara, který vyhrál prolog. Wiggins výrazně neztratil v žádné etapě a s převahou vyhrál obě časovky. Celkové třetí místo získal Vincenzo Nibali, který se jako jediný dokázal v horách Wigginse a Frooma udržet.\\nBodovací soutěž s převahou vyhrál Peter Sagan, vítěz tří etap. Tři etapy vyhráli ještě André Greipel a Mark Cavendish, ale v ostatních sprintech nedosáhli takových výsledků jako Sagan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%BE%D0%B9_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D0%B9%D0%BD%D1%8B%D0%B9_%D0%B7%D0%BD%D0%B0%D0%BA_%D0%9D%D0%A1%D0%94%D0%90%D0%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Bundesarchiv_Bild_146-1984-019-20%2C_Eduard_Dietl.jpg","page_title":"Золотой партийный знак НСДАП","context_page_description":"Золотой партийный знак НСДАП — знак отличия старейших членов нацистской партии.\\nОфициальное название — Золотой почётный знак НСДАП. Введён 9 ноября 1933 года по указанию Адольфа Гитлера в ознаменование десятой годовщины Пивного путча. Золотым знаком были награждены первые 100 000 членов партии, состоявшие в ней непрерывно с 1925 года.\\nТакже знаком могли быть награждены лица, не являющиеся членами НСДАП, но имеющие выдающиеся заслуги перед движением и служащие достижению его целей.\\nПри награждении старого члена партии на оборотной стороне значка ставился партийный номер, а при награждении за личные заслуги на обратной стороне значка ставились инициалы фюрера «A. H.» и дата награждения.\\nУ знака также имелось прозвище — «Золотой фазан». После того как Адольф Гитлер пришёл к власти в 1933 году, произошел наплыв заявлений от населения вступить в ряды нацистской партии.\\nВ 2005 году копия золотого партийного знака А. Гитлера за номером «1» была похищена с выставки, посвящённой 60-летию окончания Второй мировой войны в России."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%AB%E1%83%94%E1%83%9A%E1%83%A5%E1%83%95%E1%83%90","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Zelkova_carpinifolia_01_by_Line1.JPG","page_title":"ძელქვა","context_page_description":"ძელქვა — ფოთოლმცვივანი მცენარეთა გვარი თელისებრთა ოჯახისა. ხეებია, რომელთა სიმაღლე 40 მ, დიამეტრი 3 მ აღწევს.\\nძელქვას მორიგეობით განლაგებული დაკბილული ფოთლები აქვს. ხეზე ზოგი ყვავილი ორსქესიანია, ზოგი კი მხოლოდ მამრობითი. ამ გვარის ლათინური სახელწოდება ქართული სიტყვის — ძელისა და ქვის შეერთებით არის შედგენილი, რაც მისი მერქნის სიმაგრესა და გამძლეობას გამოხატავს.\\nძელქვა არქტომესამეული ფლორის რელიქტია. ტენისა და ჩრდილის მოყვარული ხეა. იზრდება ხეობებში, მდინარეების პირას ფართოფოთლოვან ტყეებში. ყვავილობს მარტ-აპრილში. ნაყოფი მწიფდება აგვისტოში. შემორჩენილია მისი 6 სახეობა. მათგან ერთი — რცხილაფოთოლა ირანსა და ამიერკავკასიის დასავლეთ, აღმოსავლეთ და სამხრეთ ნაწილებში იზრდება, დანარჩენი 5 — კრეტაზე, ჩინეთში, იაპონიასა და კორეაში.\\nგვხვდება ზომიერ ტენიან და მომშრალო ადგილებში. ცოცხლობს 500-600 და მეტ წელს. მრავლდება თესლით, ძირკვის ამონაყარითა და ფესვის ნაბარტყით. მერქნის მაღალი ფიზიკურ-მექანიკური თვისებებით ერთ-ერთი უძვირფასესი მცენარეა. სწრაფმზარდი და დეკორატიულია. ხშირად საფრთხეს უქმნის: ტყის კაფვა, მცირე არეალი და სხვ. იყენებენ ბაღ-პარკში, ტყის სარეკონსტრუქციოდ და გასაშენებლად. შეტანილია საქართველოს „წითელ წიგნში“."},{"page_url":"https://de.wikipedia.org/wiki/Route_der_Welterbe-G%C3%A4rten","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Hildegarten_Hindenburg-Anlage_Museum_am_Strom_Bingen_am_Rhein.jpg","page_title":"Route der Welterbe-Gärten","context_page_description":"Die Route der Welterbe-Gärten führt zu mehr als 30 öffentlichen und privaten Gartenanlagen, die Teil der Kulturlandschaft des UNESCO Welterbes Oberes Mittelrheintal sind. Verschiedene Nutz- oder Ziergärten, Parks oder Promenaden wurden auf Initiative des Zweckverbandes Welterbe Oberes Mittelrheintal zusammengestellt. Im Rahmen dieser Kampagne kreierte 2007 der Züchter Klaus Zerwes eine Rose, die im Juni 2010 auf den Namen Welterbe-Rose „Zauber der Loreley“ getauft wurde."},{"page_url":"https://ro.wikipedia.org/wiki/Wies%C5%82aw_My%C5%9Bliwski","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Wieslaw_Mysliwski.JPG","page_title":"Wiesław Myśliwski","context_page_description":"Wiesław Myśliwski este unul dintre cei mai mari scriitori polonezi. În România este cunoscut pentru romanele \\"Piatră peste piatră\\" și \\"Orizont\\". A câștigat Marele Premiu pentru Literatură Nike de două ori: în 1997 și în 2007."},{"page_url":"https://lb.wikipedia.org/wiki/Arreux","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Arreux_%28Ardennes%29_m%C3%A9diath%C3%A8que_%28ancien_lavoir%29_et_salle_polyvalente.JPG","page_title":"Arreux","context_page_description":"Arreux ass eng franséisch Uertschaft a Gemeng am Departement Ardennes an der Grand Est.\\nWéi 2011 de Parc naturel régional des Ardennes entstanen ass, war Arreux eng vun de Grënnungsgemengen."},{"page_url":"https://fr.wikipedia.org/wiki/Landricourt_(Aisne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Landricourt_%28Aisne%29_paysage_avec_croix_de_chemin.JPG","page_title":"Landricourt (Aisne)","context_page_description":"Landricourt est une commune française située dans le département de l'Aisne, en région Hauts-de-France."},{"page_url":"https://sv.wikipedia.org/wiki/Vinkell%C3%B6vm%C3%A4tare","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Mutkakulmumittari.jpg","page_title":"Vinkellövmätare","context_page_description":"Vinkellövmätare är en fjärilsart som beskrevs av Carl von Linné 1758. Vinkellövmätare ingår i släktet Idaea och familjen mätare, Geometridae. Arten är reproducerande i Sverige. Tre underarter finns listade i Catalogue of Life, Idaea aversata griseocorsa Schawerda, 1929, Idaea aversata japonica Inoue, 1955 och Idaea aversata pseudaurata Schawerda, 1929."},{"page_url":"https://cs.wikipedia.org/wiki/Zderaz_(Bi%C5%99kov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Zderaz_%28Bi%C5%99kov%29%2C_d%C5%AFm.jpg","page_title":"Zderaz (Biřkov)","context_page_description":"Zderaz je malá vesnice, část obce Biřkov v okrese Klatovy. Nachází se asi 2 km na jihozápad od Biřkova. Je zde evidováno 8 adres. V roce 2011 zde trvale žilo sedm obyvatel.\\nZderaz leží v katastrálním území Biřkov o výměře 5,51 km²."},{"page_url":"https://it.wikipedia.org/wiki/Teatro_scandinavo_della_seconda_guerra_mondiale","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Niels_Juel_attacked_by_German_planes_29_August_1943.jpg","page_title":"Teatro scandinavo della seconda guerra mondiale","context_page_description":"Il teatro scandinavo della seconda guerra mondiale ricomprende gli eventi bellici e politici che ebbero luogo tra la fine del 1939 e il maggio 1945 in Scandinavia, nell'ambito dei più vasti eventi del teatro europeo della seconda guerra mondiale.\\nLa Scandinavia venne coinvolta presto negli eventi del secondo conflitto mondiale: sul finire del novembre del 1939 la Finlandia fu invasa da truppe dell'Unione Sovietica, intenzionata ad annettersi alcune strategiche aree di confine, capitolando infine dopo un conflitto durato poco più di tre mesi; in conseguenza di ciò la Finlandia si avvicinò alla Germania nazista, e nel giugno del 1941 partecipò all'invasione dell'URSS aprendo un nuovo fronte esteso dalla Lapponia al Golfo di Finlandia.\\nLa cooperazione tra tedeschi e finlandesi proseguì fino al settembre del 1944, quando il governo di Helsinki capitolò di fronte alle rinnovate controffensive sovietiche; truppe finlandesi e sovietiche cooperarono poi per cacciare gli ultimi reparti tedeschi dalla Lapponia."},{"page_url":"https://pl.wikipedia.org/wiki/Farmacja","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Krak%C3%B3w_Muzeum_Farmacji_CMUJ.JPG","page_title":"Farmacja","context_page_description":"Farmacja, nauki farmaceutyczne – zespół nauk o lekach, a także nazwa kierunku studiów w szkołach wyższych.\\nFarmacja zajmuje się zarówno lekami syntetycznymi, lekami biologicznymi, jak i pochodzenia naturalnego, oraz składnikami kosmetyków oraz żywności. Farmacja wykładana jest na wydziałach farmaceutycznych wyższych uczelni medycznych w ramach studiów jednolitych magisterskich trwających w Polsce 5,5 roku."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B0%8F%E6%88%B8%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Genko_Borui_at_Mukaihama01.jpg","page_title":"小戸公園","context_page_description":"小戸公園とは 福岡県福岡市西区小戸2丁目6−1にある風致公園。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%99%E3%83%8D%E3%82%BA%E3%82%A8%E3%83%A9%E3%81%AE%E8%A1%8C%E6%94%BF%E5%8C%BA%E7%94%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Venezuela_Division_Politica_Territorial.svg","page_title":"ベネズエラの行政区画","context_page_description":"ベネズエラの地方制度は、州 、基礎自治体、区の三層だが、自治体とは呼べない区を除くなら二層になる。州は23、首都地区が1、連邦直轄領が1ある。首都地区と連邦直轄領は州政府にあたるものを持たない。形式上連邦制をとるが、ベネズエラは南米でも中央集権的な制度の国で、州の独立性は弱い。1989年まで、州知事は共和国大統領の任命制であった。\\nかつては州と基礎自治体の間にディストリートがあったが、1980年代に廃止された。基本的に、かつての郡が新しい市に、かつての市が新しい区に相当する。中にはバルガス州のような一州一市の例もある。基礎自治体の上位におかれる特別な自治体として、カラカス大都市地区とアルトアプレ郡がそれぞれの特別法によって設けられている。\\nパロキアとはスペイン語で教会の教区を意味するが、現在のベネズエラではそれとは別のものを表し、区別するために民区と呼ばれることもある。小さな市では一市一区のところが多く、区役所は置かれない。選挙で選ばれるのは州知事、州議会議員、市長、市会議員、区議員で、区長は任命制である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%99%B4%E6%B5%B7%E3%82%AF%E3%83%AA%E3%83%8B%E3%83%83%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Harumiclinic.jpg","page_title":"晴海クリニック","context_page_description":"晴海クリニックは東京都中央区晴海にある民間のクリニックである。"},{"page_url":"https://ckb.wikipedia.org/wiki/%D9%BE%DB%8E%D8%B1%D8%B3%D8%AA%DB%8C_%D9%88%DB%95%D8%B1%DA%AF%D8%B1%D8%A7%D9%86%DB%8C_%D8%AE%DB%95%DA%B5%D8%A7%D8%AA%DB%8C_%D9%86%DB%86%D8%A8%DB%8E%D9%84_%D9%84%DB%95_%DA%A9%DB%8C%D9%85%DB%8C%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Onsager_1968.jpg","page_title":"پێرستی وەرگرانی خەڵاتی نۆبێل لە کیمیا","context_page_description":"خەڵاتی نۆبڵ لە کیمیا دەبەخشرێت لەلایەن ئەکادیمیای سویدی بۆ زانست بەو زانایانەی کە داهێنان و دۆزینەوەکیان هەبێت لە بواری کیمیادا."},{"page_url":"https://en.wikipedia.org/wiki/Noakhali_riots","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Diara_Sharif_of_Shyampur.jpg","page_title":"Noakhali riots","context_page_description":"The Noakhali riots were a series of semiorganized massacres, rapes, abductions and forced conversions of Hindus to Islam and looting and arson of Hindu properties perpetrated by the Muslim community in the districts of Noakhali in the Chittagong Division of Bengal in October–November 1946, a year before India's independence from British rule.\\nIt affected the areas under the Ramganj, Begumganj, Raipur, Lakshmipur, Chhagalnaiya and Sandwip police stations in Noakhali district and the areas under the Hajiganj, Faridganj, Chandpur, Laksham and Chauddagram police stations in Tipperah district, a total area of more than 2,000 square miles.\\nThe massacre of the Hindu population started on 10 October, on the day of Kojagari Lakshmi Puja and continued unabated for about a week. It is estimated that 5,000 were killed, hundreds of Hindu women were raped and thousands of Hindu men and women were forcibly converted to Islam. Around 50,000 to 75,000 survivors were sheltered in temporary relief camps in Comilla, Chandpur, Agartala and other places. Around 50,000 Hindus remained marooned in the affected areas under the strict surveillance of the Muslims, where the administration had no say."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_%D0%B7%D0%B0_%D0%BD%D0%B5%D1%80%D0%B0%D0%B7%D0%BF%D1%80%D0%BE%D1%81%D1%82%D1%80%D0%B0%D0%BD%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BD%D0%B0_%D1%8F%D0%B4%D1%80%D0%B5%D0%BD%D0%B8%D1%82%D0%B5_%D0%BE%D1%80%D1%8A%D0%B6%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/NPT_Participation.svg","page_title":"Договор за неразпространение на ядрените оръжия","context_page_description":"Договорът за неразпространение на ядрени оръжия е израз на инициативата на голяма част от международната общност за ограничаване на разпространението на ядрени оръжия, ядрени материали, технологии и информация с потенциал за военно приложение. Той влиза в сила на 5 март 1970 г. и към него са се присъединили 189 страни, пет от които са официално признати за ядрени сили: САЩ, Русия, Великобритания, Франция и Китай.\\nСмята се, че четири страни, нечленуващи в договора, притежават ядрени оръжия: Индия, Пакистан и Северна Корея открито са тествали ядрени оръжия и са обявили, че притежават такива оръжия, а Израел води двойствена политика спрямо разоръжаването, изразена в собствената ѝ ядрена програма. Северна Корея се присъединява към договора, но го нарушава и през 2003 г. се оттегля от него.\\nОфициално договорът е предложен от СССР, Обединено кралство Великобритания и Северна Ирландия и САЩ, както е записано в документа.\\nДоговорът за неразпространение на ядрените оръжия се състои от преамбюл и единайсет члена. Въпреки че „стълбовата“ концепция не е изразена никъде в самия документ, договорът понякога се разглежда като тристълбова система с имплицитен баланс между стълбовете:"},{"page_url":"https://fr.wikipedia.org/wiki/The_Island_:_C%C3%A9l%C3%A9brit%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Gwendal_Peizerat_2005.jpg","page_title":"The Island : Célébrités","context_page_description":"The Island : Célébrités, est une déclinaison de l'émission de télévision française de docu-aventure The Island, articulée autour de plusieurs candidats célèbres. Elle est diffusée sur M6 du 15 mai 2018 au 19 juin 2018, et est animée par Mike Horn."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%C2%AB%D0%97%D0%B0_%D0%B7%D0%B0%D1%81%D0%BB%D1%83%D0%B3%D0%B8_%D0%BF%D0%B5%D1%80%D0%B5%D0%B4_%D0%92%D1%96%D1%82%D1%87%D0%B8%D0%B7%D0%BD%D0%BE%D1%8E%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Or3_1mb.jpg","page_title":"Орден «За заслуги перед Вітчизною»","context_page_description":"Орден «За заслуги перед Вітчизною» — державна нагорода Російської Федерації."},{"page_url":"https://cs.wikipedia.org/wiki/Ji%C5%99%C3%AD_Sobotka_(socha%C5%99)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Jan_Skacel_statue_2.jpg","page_title":"Jiří Sobotka (sochař)","context_page_description":"Jiří Sobotka je český sochař, jehož dílo navazuje na tvorbu skupiny umělců okolo Roye Lichtensteina, Andyho Warhola a Claese Oldenburga v době vrcholící moderny v USA. Od začátku 80. let začal, jako čerstvý absolvent Akademie výtvarných umění v Praze, vystavovat a účastnit se mezinárodních sympozií v České republice i zahraničí. V jeho tvorbě se prolínají různé směry moderního výtvarného umění, zejména pop art. Je členem uměleckého sdružení TT klub výtvarných umělců a teoretiků."},{"page_url":"https://pl.wikipedia.org/wiki/Kampus_Morasko","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Garden_of_biodiversity%2C_campus_Morasko_Poznan.jpg","page_title":"Kampus Morasko","context_page_description":"Kampus Morasko – kampus Uniwersytetu im. Adama Mickiewicza w Poznaniu grupujący głównie wydziały ścisłe i przyrodnicze. Zlokalizowany jest w północnej części miasta. Dzieli się on na dwie części: zachodnią, położoną na Morasku oraz wschodnią na Umultowie."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%88%D9%83_%D8%A8%D9%8A%D8%AF%D8%B1%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Jocbattingpractice.jpg","page_title":"جوك بيدرسون","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجوك بيدرسون لاعب بيسبول أمريكى."},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%BF%CF%85%CF%81%CE%B9%CE%B1%CE%BD%CE%AC_%CE%86%CF%81%CF%84%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/%CE%9C%CE%BF%CE%BD%CE%AE_%CE%A0%CE%B1%CE%BD%CE%B1%CE%B3%CE%AF%CE%B1%CF%82_%CE%A7%CF%81%CF%85%CF%83%CE%BF%CF%83%CF%80%CE%B7%CE%BB%CE%B9%CF%8E%CF%84%CE%B9%CF%83%CF%83%CE%B1%CF%82_-_%CE%93%CE%BF%CF%85%CF%81%CE%B3%CE%B9%CE%B1%CE%BD%CE%AC_%CE%91%CF%81%CF%84%CE%B1%CF%82.JPG","page_title":"Γουριανά Άρτας","context_page_description":"Τα Γουριανά είναι ορεινός οικισμός στον δήμο Κεντρικών Τζουμέρκων στο νομό Άρτας της περιφέρειας Ηπείρου. Σύμφωνα με την απογραφή του 2011, ο πληθυσμός του ανερχόταν στους 58 κατοίκους."},{"page_url":"https://be.wikipedia.org/wiki/%D0%91%D0%B0%D0%B3%D0%B4%D0%B0%D0%BD%D0%BE%D0%B2%D1%96%D1%87_(%D0%B3%D0%BE%D1%80%D0%B0%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Bogdanovich-memorial.jpg","page_title":"Багдановіч (горад)","context_page_description":"Багдановіч — горад у Расіі, адміністрацыйны цэнтр Багдановіцкага раёна Свярдлоўскай вобласці. Насельніцтва 32,3 тыс. чал. Заснаваны ў 1885 годзе.\\nГорад размешчаны на рацэ Кунара, за 99 км на ўсход ад Екацерынбурга.\\nЧыгуначны вузел. Завод вогнетрывалых вырабаў, шпалапрапітачны завод, харчовая прамысловасць."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CF%80%CF%81%CE%BF%CE%AD%CE%B4%CF%81%CF%89%CE%BD_%CF%84%CE%B7%CF%82_%CE%9A%CE%BF%CF%8D%CE%B2%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Carlos_Hevia.jpg","page_title":"Κατάλογος προέδρων της Κούβας","context_page_description":"Αυτό το άρθρο παραθέτει τους Προέδρους της Κούβας από το 1902 μέχρι σήμερα.\\nΣημερινός Πρόεδρος της Κούβας είναι ο Μιγκέλ Ντίας-Κανέλ, από τις 19 Απριλίου του 2018."},{"page_url":"https://es.wikipedia.org/wiki/Isla_de_Area","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Praia_de_Area_en_Viveiro_20X2013.jpg","page_title":"Isla de Area","context_page_description":"La isla de Area es un islote de Lugo situado en plena ría de Vivero, municipio al que pertenece."},{"page_url":"https://en.wikipedia.org/wiki/Yves_Lampaert","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Yves_Lampaert_rijdt_over_finish_in_Waregem%2C_Dwars_door_Vlaanderen_2018_-_fotograaf_Lieven_De_Cock.jpg","page_title":"Yves Lampaert","context_page_description":"Yves Lampaert is a Belgian road racing cyclist, who currently rides for UCI WorldTeam Deceuninck–Quick-Step."},{"page_url":"https://cs.wikipedia.org/wiki/Florian_Abel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Melantrich06.jpg","page_title":"Florian Abel","context_page_description":"Florian Abel, uváděný i jako Floris Abel vytvořil kreslené předlohy pro náhrobek císaře Maxmiliána I. v Innsbrucku a část předloh pro Melantrichovu bibli z roku 1570. Před rokem 1550 byl jmenován dvorním malířem císaře Ferdinanda I. Habsburského."},{"page_url":"https://it.wikipedia.org/wiki/Buffalo_Bills_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Tyrod_Taylor_against_the_Texans.jpg","page_title":"Buffalo Bills 2015","context_page_description":"La stagione 2015 dei Buffalo Bills è stata la 56ª della franchigia, la 46ª nella National Football League e la prima con Rex Ryan come capo-allenatore. La squadra partì tentando di migliorare il record di 9–7 dell'anno precedente e di tornare ai playoff dopo quindici anni, divenuta la più lunga assenza attiva di una squadra professionistica dalla post-season dopo che i Toronto Blue Jays interruppero il loro digiuno di 22 anni il 25 settembre. Fu anche la prima stagione completa sotto la nuova proprietà di Kim e Terrence Pegula, che li avevano acquistati l'anno precedente. I Bills iniziarono la loro stagione alla ricerca di un nuovo quarterback titolare al posto di Kyle Orton, ritiratosi. Tyrod Taylor, un free agent acquisito dai Baltimore Ravens fu designato come suo sostituto, superando la concorrenza di EJ Manuel e Matt Cassel. Buffalo non riuscì tuttavia ancora a qualificarsi per i playoff, venendo matematicamente eliminata dalla caccia con la sconfitta della settimana 15 contro i Washington Redskins."},{"page_url":"https://en.wikipedia.org/wiki/Aztec_sun_stone","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Tochtli.jpg","page_title":"Aztec sun stone","context_page_description":"The Aztec sun stone is a late post-classic Mexica sculpture housed in the National Anthropology Museum in Mexico City, and is perhaps the most famous work of Aztec sculpture. Its complex design and intricate glyphic language reflect that the stone is the product of a highly sophisticated culture. It measures 358 centimetres in diameter and 98 centimetres thick, and weighs 24,590 kg. Shortly after the Spanish conquest, the monolithic sculpture was buried in the Zócalo, the main square of Mexico City. It was rediscovered on 17 December 1790 during repairs on the Mexico City Cathedral. Following its rediscovery, the sun stone was mounted on an exterior wall of the Cathedral, where it remained until 1885. Early scholars initially thought that the stone was carved in the 1470s, though modern research suggests that it was carved some time between 1502 and 1521."},{"page_url":"https://it.wikipedia.org/wiki/San_Valentino_(festa)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Mechanical_Valentine_05.JPG","page_title":"San Valentino (festa)","context_page_description":"La festa di san Valentino è una ricorrenza dedicata agli innamorati, celebrata in gran parte del mondo il 14 febbraio."},{"page_url":"https://en.wikipedia.org/wiki/Exhumation_and_reburial_of_Richard_III_of_England","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Archaeologist_working_in_Trench.jpg","page_title":"Exhumation and reburial of Richard III of England","context_page_description":"The exhumation and reburial of Richard III of England began with the discovery of the king's remains within the site of the former Greyfriars Friary Church in Leicester, England, in September 2012. Following extensive anthropological and genetic testing, the remains of Richard III, the last English king killed in battle, were ultimately reinterred at Leicester Cathedral on 26 March 2015.\\nRichard III, the final ruler of the Plantagenet dynasty, was killed on 22 August 1485 in the Battle of Bosworth Field, the last significant battle of the Wars of the Roses. His body was taken to Greyfriars Friary in Leicester, where it was buried in a crude grave in the friary church. Following the friary's dissolution in 1538 and subsequent demolition, Richard's tomb was lost. An erroneous account arose that Richard's bones had been thrown into the River Soar at the nearby Bow Bridge.\\nA search for Richard's body began in August 2012, initiated by the Looking for Richard project with the support of the Richard III Society. The archaeological excavation was led by the University of Leicester Archaeological Services, working in partnership with Leicester City Council."},{"page_url":"https://de.wikipedia.org/wiki/Gatwick_Stream","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Gatwick_Stream_in_Horley_-_geograph.org.uk_-_1184039.jpg","page_title":"Gatwick Stream","context_page_description":"Der Gatwick Stream ist ein Wasserlauf in West Sussex, England. Er entsteht aus zwei unbenannten Zuflüssen östlich von Crawley. Er fließt zunächst in nördlicher Richtung, wendet sich dann aber nach Westen, um nördlich der Anschlussstelle 10a des M23 motorway diesen zu kreuzen und durch Crawley zu fließen. Innerhalb des Ortes wendet der Gatwick Stream sich an der Brighton Main Line der Eisenbahn erneut nach Norden und fließt entlang der Ostseite des Flughafens Gatwick zu seiner Mündung in den River Mole an der Nordostseite des Flughafens."},{"page_url":"https://fr.wikipedia.org/wiki/Hexam%C3%A9ron_(composition_musicale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Hexam%C3%A9ron.png","page_title":"Hexaméron (composition musicale)","context_page_description":"L'Hexaméron, Morceau de concert, S.392, est une œuvre collective pour piano, constituée de six variations sur le thème de la marche Suoni la tromba de l'Acte II de l'opéra I puritani, de Vincenzo Bellini, avec une introduction, des interludes et un finale. La pièce fut conçue en 1837 par Franz Liszt, qui invita cinq autres compositeurs et pianistes célèbres de l'époque à contribuer en écrivant chacun une variation : Frédéric Chopin, Carl Czerny, Henri Herz, Johann Peter Pixis et Sigismund Thalberg. Lui-même composa l'introduction, la deuxième variation, les interludes, le finale, et intégra la pièce dans une unité artistique."},{"page_url":"https://pl.wikipedia.org/wiki/Magnus_Wirtemberski-Neuenb%C3%BCrg","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Arolsen_Klebeband_01_247_2.jpg","page_title":"Magnus Wirtemberski-Neuenbürg","context_page_description":"Magnus Wirtemberski-Neuenbürg – książę Wirtembergii-Neuenbürg.\\nSyn księcia Fryderyka I i Sybilli z Anhalt. Jego dziadkami byli hrabia Jerzy I Wirtemberski-Mömpelgard i Barbara Heska oraz książę Joachim Ernest von Anhalt-Zerbst i Agnes von Barby.\\nZgodnie z rodowym porozumieniem zawartym 28 maja 1617 roku między synami księcia Fryderyka, Magnus otrzymał tytuł księcia Wirtembergii-Neuenbürg.\\nZginął w czasie bitwy pod Wimpfen.\\nFryderyk nigdy się nie ożenił dlatego po jego śmierci tytuł księcia Wirtembergii-Neuenbürg wrócił do głównej gałęzi rodu księcia Eberharda."},{"page_url":"https://en.wikipedia.org/wiki/Timeline_of_the_2000_Atlantic_hurricane_season","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Tropical_Storm_Ernesto_%282000%29.JPG","page_title":"Timeline of the 2000 Atlantic hurricane season","context_page_description":"The 2000 Atlantic hurricane season was an event in the annual tropical cyclone season in the north Atlantic Ocean. There was above-normal activity during the season, with nearly all its activity occurring during a three-month period, August–October. The season officially began on June 1, 2000 and ended on November 30, 2000. These dates, adopted by convention, historically describe the period in each year when most tropical systems form. Although two tropical depressions formed in June, the first named storm, Alberto, did not arise until August 4. The season's final storm, an unnamed subtropical storm, became extratropical on October 29.\\nThe 2000 season produced 15 cyclones of at least tropical or subtropical storm strength. Four of the tropical storms became hurricanes, of which three developed into major hurricanes. There were also four depressions that failed to reach tropical storm strength. The two most significant storms of the season, in terms of loss of life and damage, were Hurricanes Gordon and Keith. Gordon made land fall in the eastern Yucatán Peninsula, traversed the Gulf of Mexico, and made landfall along the Gulf Coast of the United States."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Miller_County,_Arkansas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Hopkins1.JPG","page_title":"National Register of Historic Places listings in Miller County, Arkansas","context_page_description":"This is a list of the National Register of Historic Places listings in Miller County, Arkansas.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Miller County, Arkansas, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 33 properties and districts listed on the National Register in the county.\\nThis National Park Service list is complete through NPS recent listings posted August 14, 2020."},{"page_url":"https://ga.wikipedia.org/wiki/Newport,_Oile%C3%A1n_Rhode","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Bannister%27s_Wharf_in_Newport%2C_RI_from_bay.JPG","page_title":"Newport, Oileán Rhode","context_page_description":"Is cathair de chuid stát Oileán Rhode, Stáit Aontaithe Mheiriceá, í Newport. De réir an daonáirimh sa bhliain 2010, tá 24,672 duine ina gcónaí sa chathair. Tá Newport suite i gContae Newport. Tá Henry F. Winthrop ina mhéara. Bunaíodh an chathair sa bhliain 1784."},{"page_url":"https://it.wikipedia.org/wiki/Abbazia_di_San_Bonifacio","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/M%C3%BCnchen_St._Bonifaz_Soeltl_1854.jpg","page_title":"Abbazia di San Bonifacio","context_page_description":"L'abbazia di san Bonifacio è un monastero benedettino della congregazione bavarese che si trova a Monaco di Baviera, nel quartiere di Maxvorstadt; la chiesa abbaziale è sede dell'omonima parrocchia, affidata ai monaci benedettini."},{"page_url":"https://es.wikipedia.org/wiki/Chal%C3%A9_Giner-Cortina","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/PalauCortina.jpg","page_title":"Chalé Giner-Cortina","context_page_description":"El chalé Giner-Cortina se encuentra situado en la calle Gómez Ferrer número 122 de Torrent, España. Es una obra proyectada por el arquitecto José María Manuel Cortina Pérez en el año 1918."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B2%B3%E6%B4%A5%E4%B8%83%E6%BB%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/%E9%87%9C%E6%BB%9D_20081218_-_flickr.jpg","page_title":"河津七滝","context_page_description":"河津七滝は、静岡県賀茂郡河津町を流れる河津川の、約1.5kmの間に存在する7つの滝の総称。河津町観光のメインスポットであり、伊豆半島ジオパークのジオサイトとして指定されている。\\n七滝は、約2万5000年前に伊豆東部火山群のひとつ「登り尾南火山」からの溶岩流が谷に流れ込んでつくり出したもので、七滝のうち「えび滝」を除く6つの滝には、厚い溶岩が凝固、収縮してできる柱状節理が見られる。\\n初景滝には文豪、川端康成の代表作『伊豆の踊子』のブロンズ像があり、滝祭りのメイン会場ともなっている。七滝沿いには河津七滝温泉の温泉街があり、これらの宿泊施設などでは、以下のそれぞれの滝の名称を部屋名として使用しているところも少なくない。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%90%E3%83%AC%E3%83%83%E3%83%88M82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/US_M82A1_Barrett.JPG","page_title":"バレットM82","context_page_description":"バレット M82 は、アメリカ合衆国で開発された大口径のセミオート式狙撃銃である。ブローニングM2重機関銃などと同様の12.7x99mm NATO弾を使用し、代表的な対物ライフルの1つと見なされている。設計者はロニー・バレットで、彼はこの銃の開発および販売のためにバレット・ファイアーアームズ社を設立した。"},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D8%A7%D9%85%D9%86_(%D9%87%D8%A7%D9%88%D9%84%DB%8C%D8%AA%D8%B4%DA%A9%D9%88%D9%81_%D8%A8%D8%B1%D9%88%D8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Kaple_v_obci_K%C3%A1men.jpg","page_title":"کامن (هاولیتشکوف برود)","context_page_description":"کامن (هاولیتشکوف برود) چک اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. دنیز سوُلاری سَویه‌سیندن ۵۲۷ متر یۇکسک‏لیکده یئر آلیب. سوْن نۆفوس ساییمی اساسيندا ۳۹۲ نفر ایمیش و ویسوچینا اوستانیندا یئرلشیب. بۆتون چک‌دا اوْلدوغو کیمی، بۇ شهرده آنا دیلی چک دیلی دیر."},{"page_url":"https://en.wikipedia.org/wiki/Fire","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Space_Fire.jpg","page_title":"Fire","context_page_description":"Fire is the rapid oxidation of a material in the exothermic chemical process of combustion, releasing heat, light, and various reaction products.\\nFire is hot because the conversion of the weak double bond in molecular oxygen, O₂, to the stronger bonds in the combustion products carbon dioxide and water releases energy; the bond energies of the fuel play only a minor role here. At a certain point in the combustion reaction, called the ignition point, flames are produced. The flame is the visible portion of the fire. Flames consist primarily of carbon dioxide, water vapor, oxygen and nitrogen. If hot enough, the gases may become ionized to produce plasma. Depending on the substances alight, and any impurities outside, the color of the flame and the fire's intensity will be different.\\nFire in its most common form can result in conflagration, which has the potential to cause physical damage through burning. Fire is an important process that affects ecological systems around the globe. The positive effects of fire include stimulating growth and maintaining various ecological systems."},{"page_url":"https://pt.wikipedia.org/wiki/Farnham_(Quebec)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Farnham.jpg","page_title":"Farnham (Quebec)","context_page_description":"Farnham é uma cidade localizada ne província canadense de Quebec. A sua área é de 94,04 km², sua população é de 7 955 habitantes, e sua densidade populacional é de 84,2 hab/km². A cidade foi fundada em 1800, e incorporada em 18 de Dezembro de 1876."},{"page_url":"https://nl.wikipedia.org/wiki/Borstbeeld_van_Carl_Linnaeus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Buste_van_Linnaeus%2C_staat_rechts_achter_het_huis_-_Heemstede_-_20397972_-_RCE.jpg","page_title":"Borstbeeld van Carl Linnaeus","context_page_description":"Het borstbeeld van Carl Linnaeus is een buste op het landgoed Hartekamp in Heemstede."},{"page_url":"https://hu.wikipedia.org/wiki/Wroc%C5%82aw_Nikolausz_Kopernikusz_rep%C3%BCl%C5%91t%C3%A9r","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Terminal_T2_we_Wroc%C5%82awiu.jpg","page_title":"Wrocław Nikolausz Kopernikusz repülőtér","context_page_description":"A Wrocław Nikolausz Kopernikusz repülőtér Lengyelország egyik nemzetközi repülőtere, amely Wrocław közelében található. Éves utasforgalma 3 346 622 fő."},{"page_url":"https://en.wikipedia.org/wiki/Noshir_Gowadia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Noshir_Gowada1.jpg","page_title":"Noshir Gowadia","context_page_description":"Noshir Sheriarji Gowadia is a design engineer and convicted spy for several countries. He became one of the creators of the B-2 Spirit stealth bomber during his career at Northrop Corporation but was arrested in 2005 on espionage-related federal charges.\\nGowadia was accused of selling classified information to China and to individuals in Germany, Israel, and Switzerland. On August 9, 2010, he was convicted in the United States District Court for the District of Hawaii on 14 of the 17 charges against him. On 24 January 2011, he was sentenced to 32 years in prison."},{"page_url":"https://sl.wikipedia.org/wiki/Elementi_(Evklid)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Title_page_of_Sir_Henry_Billingsley%27s_first_English_version_of_Euclid%27s_Elements%2C_1570_%28560x900%29.jpg","page_title":"Elementi (Evklid)","context_page_description":"Elementi so temeljno delo geometrije. Delo je napisal Evklid iz Aleksandrije okoli leta 300 pr. n. št. Izvirnik je bil napisan v starogrščini v 13 knjigah in je imel naslov Στοιχεῖα: Stoicheia, Stihija – Osnove, kar so pozneje prevedli v latinščino kot Elementi.\\nEvklidovi Elementi veljajo za najuspešnejše znanstveno delo vseh časov. Doživeli so izredno veliko število rokopisnih prepisov in prevodov. Po izumu tiska so bili Elementi eno od prvih tiskanih del s področja matematike in zasedajo častno drugo mesto po številu vseh tiskanih izdaj v različnih jezikih.\\nElementi so že skoraj 2000 let temeljni učbenik geometrije po Evropi, Ameriki in drugod po svetu. Današnji učenci v slovenskih šolah se geometrije sicer ne učijo dobesedno po Evklidovem tekstu, a še vedno so Elementi temelj za pripravo sodobnih učbenikov geometrije. Podobno velja tudi za marsikatero drugo državo v Evropi in po svetu."},{"page_url":"https://sv.wikipedia.org/wiki/Rhetinantha_notylioglossa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Camaridium_vestitum_%28as_Ornithidium_chloroleucum%29_-_Rhetinantha_cerifera_%28as_Ornithidium_ceriferum%29_-_Rhetinantha_notylioglossa_%28as_Ornithidium_flavoviride%29_-_Fl.Br._3-6-25.jpg","page_title":"Rhetinantha notylioglossa","context_page_description":"Rhetinantha notylioglossa är en orkidéart som först beskrevs av Heinrich Gustav Reichenbach, och fick sitt nu gällande namn av Mario Alberto Blanco. Rhetinantha notylioglossa ingår i släktet Rhetinantha och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E7%B6%81%E6%9E%B6%E5%95%8F%E9%A1%8C%E6%93%94%E7%95%B6%E5%A4%A7%E8%87%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Ky%C5%8Dko_Nakayama.jpg","page_title":"綁架問題擔當大臣","context_page_description":"绑架问题担当大臣是，主管北朝鲜的绑架问题的解决的国务大臣。绑架问题对策本部的副本部长。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%B3%D9%83%D8%A7%D9%86%D9%8A%D8%A7-%D9%86%D9%88%D9%81%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Askania_nova_prapor.png","page_title":"أسكانيا-نوفا","context_page_description":"أسكانييا-نوفا هي بلدة من النمط المدني في محافظة كيرسون في أوكرانيا."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BB_(%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D0%B0_%D0%9F%D0%BE%D0%BC%D0%B5%D1%80%D0%B0%D0%BD%D0%B8%D1%98%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Dorfkirche_Saal_1.jpg","page_title":"Зал (Западна Померанија)","context_page_description":"Зал град је у њемачкој савезној држави Мекленбург-Западна Померанија. Једно је од 64 општинска средишта округа Нордфорпомерн. Према процјени из 2010. у граду је живјело 1.245 становника. Посједује регионалну шифру 13057076."},{"page_url":"https://de.wikipedia.org/wiki/Oblast_Kars","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Karobl.png","page_title":"Oblast Kars","context_page_description":"Die Oblast Kars war eine der transkaukasischen Provinzen des Russischen Reiches, die zwischen 1878 und 1917 existierte. Die Hauptstadt war Kars, damals auch Wladikars genannt. Heute gehört das Gebiet zur Republik Türkei. Es hatte einen Flächeninhalt von 18.526 km².\\nSeit 1881 bestand die Oblast Kars aus vier Okrugen:\\nKars\\nArdahan\\nKagysman,\\nOlti,\\nZwei weitere Okruge waren Sarischat und Schoragjal, sie bestanden von 1878 bis 1881."},{"page_url":"https://pl.wikipedia.org/wiki/Pesa_Link","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/SA139-013%2C_Kudowa-Zdr%C3%B3j%2C_2016-05-05.jpg","page_title":"Pesa Link","context_page_description":"Pesa Link – rodzina normalnotorowych spalinowych pojazdów pasażerskich oferowana przez Pesa Bydgoszcz. Wyprodukowane zostały pojazdy 1-, 2- i 3-członowe, ale producent przewiduje również wersję 4-członową. Linki eksploatowane są w Czechach, Polsce i Niemczech."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B1%E0%B8%90%E0%B8%AA%E0%B8%A1%E0%B8%B2%E0%B8%8A%E0%B8%B4%E0%B8%81%E0%B8%AA%E0%B8%AB%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B8%8A%E0%B8%B2%E0%B8%8A%E0%B8%B2%E0%B8%95%E0%B8%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/United_Nations_member_countries_world_map.PNG","page_title":"รัฐสมาชิกสหประชาชาติ","context_page_description":"รัฐสมาชิกสหประชาชาติ เป็นรัฐเอกราช 193 รัฐที่เป็นสมาชิกขององค์การสหประชาชาติ และเป็นตัวแทนที่เท่าเทียมกันในสมัชชาใหญ่แห่งสหประชาชาติ\\nโดยหลักการแล้วมีเพียงรัฐเอกราชเท่านั้นที่สามารถเป็นสมาชิกสหประชาชาติได้และในปัจจุบันรัฐสมาชิกสหประชาชาติทั้งหมดเป็นรัฐเอกราช แม้ว่ารัฐสมาชิก 5 รัฐ จะไม่ได้เป็นรัฐเอกราชขณะเข้าร่วมสหประชาชาติ แต่ต่อมาทั้ง 5 รัฐก็ได้รับเอกราชในระหว่าง ปี พ. ศ. 2489 ถึง พ.ศ. 2534"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B0%A3%E9%96%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Actias_selene_5th_instar_spiracles_sjh.jpg","page_title":"氣門","context_page_description":"氣門是動物是一個位於表面的細孔，通常通往其呼吸系統。"},{"page_url":"https://cv.wikipedia.org/wiki/%D0%92%D0%B5%D1%81%D1%82%D0%B3%D0%BE%D1%82%D1%81%D0%B5%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Visigoth_migrations.jpg","page_title":"Вестготсем","context_page_description":"Вестготсем, — германи арăвĕ, готсен шутне кĕрекен пĕр пайĕ. 370 çултанпа Халăхсен пысăк куçăвне хутшăннă.\\nЯчĕ менле пулса кайнине тĕплĕн палăртман. Тервингсем — ку ят вăрман çыннисем тенине пĕлтерет. Ку ятпа вĕсене Мамертин «Панегирикра» асăнать. Мамертин унта вĕсене вандарсемпе гепидсене хирĕç кĕрешмешкĕн тайфалсемпе пĕрлешнине палăртать."},{"page_url":"https://de.wikipedia.org/wiki/Civilization_(Computerspiel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/The_new_old_amphitheater_in_Pula_Istria_%2819629095974%29.jpg","page_title":"Civilization (Computerspiel)","context_page_description":"Civilization ist ein 1991 erschienenes Computerspiel des US-amerikanischen Herstellers MicroProse. Darin führt der Spieler eine ganze menschliche Zivilisation über mehrere Jahrtausende. Er kontrolliert verschiedenste Bereiche wie Städtebau, Wirtschaft, Militär und Forschung. Civilization begründete damit das Globalstrategie-Genre und gilt bis heute als eines der einflussreichsten Spiele in der Geschichte der Computerspiele.\\nDas Spiel bietet dem Spieler Entscheidungsmöglichkeiten mit unterschiedlicher Tragweite. Er kann einzelne Einheiten kontrollieren und somit die Erkundung, Besiedlung und Eroberung der Spielwelt voranbringen. Jedoch kann er auch Entscheidungen auf höheren Ebenen treffen, etwa durch die Festlegung der Steuersätze oder der Regierungsform oder durch die Bestimmung der aktuellen Forschungsschwerpunkte. Des Weiteren tritt der Spieler mit seiner Zivilisation gegen andere, vom Computer gesteuerte Zivilisationen an. Mit diesen kann er in diplomatische Beziehungen treten, die in Bündnissen enden oder in einen Krieg münden können.\\nCivilization wurde unter der Leitung von Sid Meier entwickelt, der bereits mehrere erfolgreiche Spiele wie Silent Service, Pirates!"},{"page_url":"https://pl.wikipedia.org/wiki/Inkwizycja_w_Niemczech","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Konrad_von_Marburg.jpg","page_title":"Inkwizycja w Niemczech","context_page_description":"Inkwizycja została utworzona przez papieża Grzegorza IX w 1231, a pierwszy inkwizytor został mianowany na terenie Niemiec. W drugiej połowie XIV wieku zorganizowano w Niemczech jej stałe struktury, które, z wyjątkiem jednego trybunału, przetrwały jedynie do czasów reformacji w pierwszej połowie XVI wieku. W zwalczaniu heretyków w Niemczech inkwizycja odgrywała zawsze drugorzędną rolę w stosunku do sądów biskupich.\\nPod względem geograficznym obszar jurysdykcji niemieckiej inkwizycji w XIV–XVI wieku obejmował kościelne metropolie: moguncką, kolońską, salzburską, bremeńską i magdeburską, a ponadto archidiecezję trewirską, diecezję bazylejską, egzymowane diecezje bamberską, miśnieńską i pomorską oraz należące do zakonu krzyżackiego Inflanty. Burgundia i Lotaryngia, a do 1515 także południowe Niderlandy, mimo że należały do Świętego Cesarstwa, podlegały inkwizytorom francuskim mianowanym przez paryskiego prowincjała dominikanów."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_vodop%C3%A1dov_v_Japonsku","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Ryuo_Falls_04.JPG","page_title":"Zoznam vodopádov v Japonsku","context_page_description":"Sto vodopádov v Japonsku – zoznam sto reprezentatívnych vodopádov v Japonsku vytvorený cez japonské Ministerstvo životného prostredia v roku 1990."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Bergkirchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Unterbachern_Kirche_St_Martin_001_201505_670.JPG","page_title":"Liste der Baudenkmäler in Bergkirchen","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen Gemeinde Bergkirchen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://vi.wikipedia.org/wiki/T%E1%BB%89nh_tr%C6%B0%E1%BB%9Fng_Ch%C3%ADnh_ph%E1%BB%A7_Nh%C3%A2n_d%C3%A2n","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Olympic_stadium_of_Beijing.JPG","page_title":"Tỉnh trưởng Chính phủ Nhân dân","context_page_description":"Tỉnh trưởng Chính phủ Nhân dân là vị trí cán bộ, công chức địa phương thuộc Cộng hòa Nhân dân Trung Hoa, chức vụ quản lý hành chính vai trò kinh tế - xã hội. Trung Quốc bao gồm 33 đơn vị hành chính địa phương, trong đó có 22 tỉnh, 04 thành phố trực thuộc trung ương, 05 khu tự trị, 02 đặc khu hành chính. Trung Quốc đại lục thường bao gồm 31 đơn vị hành chính.\\nĐứng đầu đơn vị hành chính địa phương bao gồm Đảng bộ đơn vị hành chính và Chính phủ Nhân dân đơn vị hành chính. Người đứng đầu Đảng bộ đơn vị là Bí thư Đảng ủy đơn vị hành chính, gồm các vị trí tương đương là Bí thư Tỉnh ủy, Bí thư Thành ủy, Bí thư Khu ủy. Người đứng đầu Chính phủ Nhân dân đơn vị hành chính bao gồm các vị trí tương đương là Tỉnh trưởng Chính phủ Nhân dân tỉnh, Thị trưởng Chính phủ Nhân dân thành phố trực thuộc trung ương, Chủ tịch Chính phủ Nhân dân khu tự trị, Trưởng quan Hành chính Khu hành chính đặc biệt. Tại mỗi đơn vị hành chính cấp tỉnh của Trung Quốc, Bí thư là người đứng đầu, Tỉnh trưởng đứng vị trí thứ hai, đều giữ hàm Bộ trưởng. Các cán bộ này hiện tại thường là Ủy viên Ủy ban Trung ương Đảng Cộng sản Trung Quốc khóa XIX."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%80%D0%B5%D1%81%D1%81%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Tresson_-_%C3%89glise_01.JPG","page_title":"Трессон","context_page_description":"Трессо́н — муніципалітет у Франції, у регіоні Пеї-де-ла-Луар, департамент Сарта. Населення — 478 осіб.\\nМуніципалітет розташований на відстані близько 170 км на південний захід від Парижа, 180 км на північний схід від Нанта, 31 км на південний схід від Ле-Мана."},{"page_url":"https://cy.wikipedia.org/wiki/Preblyn_prysgwydd","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Golden_Babbler_-_Bhutan.jpg","page_title":"Preblyn prysgwydd","context_page_description":"Aderyn a rhywogaeth o adar yw Preblyn prysgwydd a adnabyddir hefyd gyda'i enw gwyddonol Lioptilus nigricapillus; yr enw Saesneg arno yw Bush Blackcap. Mae'n perthyn i deulu'r Preblynnod sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn L. nigricapillus, sef enw'r rhywogaeth."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%97%D0%B5%D1%82%D0%B0_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Zeta_river.jpg","page_title":"Зета (река)","context_page_description":"Зета — река во Црна Гора. Нејзиниот извор се наоѓа во падините на планината Војник и тече кон исток 86 километри каде што се слева во реката Морача северно од Подгорица."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%87%D5%A5%D5%AC%D5%A2%D5%AB_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6_(%D5%8F%D5%A5%D5%AD%D5%A1%D5%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Shelby_County%2C_TX%2C_Courthouse_IMG_0965.JPG","page_title":"Շելբի շրջան (Տեխաս)","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Շելբի շրջան\\nՇելբի շրջան, ԱՄՆ Տեխաս նահանգի 254 վարչական միավորներից մեկը։ Ընդհանուր տարածությունը 2.056 կմ² է, բնակչությունը՝ 25.224 մարդ ։ Շրջկենտրոնն է Սենտեր բնակավայրը։ Կազմավորվել է 1836 թ.։\\nՕգտագործված աղբյուրներ\\nՏվյալներ ԱՄՆ վիճակագրության բյուրոյի կայքում\\nԾանոթագրություններ և նշումներ"},{"page_url":"https://pl.wikipedia.org/wiki/Symeon_(Jakovljevi%C4%8D)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Simeon2013.jpg","page_title":"Symeon (Jakovljevič)","context_page_description":"Symeon, imię świeckie Radiwoj Jakovljevič – czeski biskup prawosławny."},{"page_url":"https://de.wikipedia.org/wiki/Haval_H5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Great_Wall_Haval_H5_China_2013-03-02.jpg","page_title":"Haval H5","context_page_description":"Der Great Wall Hover, Great Wall Haval H5, Haval H5, Great Wall Haval H3 oder Great Wall X 240 ist ein SUV des chinesischen Automobilherstellers Great Wall."},{"page_url":"https://de.wikipedia.org/wiki/St-Pierre_(Limours)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Limours_Saint-Pierre_312.JPG","page_title":"St-Pierre (Limours)","context_page_description":"Die katholische Pfarrkirche Saint-Pierre in Limours, einer Gemeinde im Département Essonne in der französischen Region Île-de-France, wurde in der ersten Hälfte des 16. Jahrhunderts im Stil der Flamboyant-Gotik errichtet. In der Kirche sind Bleiglasfenster aus der Renaissance erhalten, die 1888 unter Denkmalschutz gestellt wurden. Im Jahr 2006 wurde die dem Apostel Petrus geweihte Kirche als Monument historique in die Liste der Baudenkmäler in Frankreich aufgenommen."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%A8%D8%B2%D9%88%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Sarbedaran_Stadium_of_Sabzevar_01.jpg","page_title":"سبزوار","context_page_description":"سبزوار تلفظ شهری در غرب استان خراسان رضوی، شمال شرق ایران است که نام پیشینش بیهق است. سبزوار از مهم‌ترین مراکز جمعیتی، دانشگاهی، فرهنگی، اسلامی و تاریخی شمال شرق ایران به‌شمار می‌آید و به عنوان یکی از نمادهای تاریخ و علم ایران مطرح شده‌است. مراکز علمی و دانشگاهی و همچنین حوزه‌های علمیه این شهر از قدمتی دیرینه برخوردارند. دانشگاه علوم پزشکی سبزوار، دانشگاه حکیم سبزواری و دانشگاه آزاد اسلامی دانشگاه‌های مهم این شهر می‌باشند. هم‌اکنون ۱۴ دانشگاه و مؤسسهٔ آموزش عالی بزرگ در این شهر مشغول به کار می‌باشند.\\nپس از حمله مغول به سلطنت خوارزمشاه، حکومت سربداران ایجاد گردید که مدتی بر قسمت‌هایی از ایران حکومت کرد و پایتخت این حکومت سبزوار بود. حکومت سربداران از جمله حکومت‌های شیعی ایران بعد از حکومت شیعی آل بویه بود."},{"page_url":"https://de.wikipedia.org/wiki/Portus_Lemanis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Lemanis_Roman_Fort%2C_Lympne%2C_Kent_-_geograph.org.uk_-_41700.jpg","page_title":"Portus Lemanis","context_page_description":"Kastell Lemanis oder auch Portus Lemanis ist ein ehemaliges römisches Kastell und war Bestandteil des Limes der Sachsenküste beim heutigen Lympne in Kent, England.\\nDas Kastell sicherte ursprünglich eine Lagune und einen natürlichen Hafen. Es diente als Basis für die britische Provinzflotte und wurde später in die Festungskette der Sachsenküste eingegliedert. Durch Erosion wurden die Reste der Befestigung weitgehend zerstört. Deshalb ist es heute sehr schwierig, sich ein vollständiges Bild über ihr Aussehen und Größe zu machen."},{"page_url":"https://de.wikipedia.org/wiki/Russen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/%D0%97%D1%80%D0%B8%D1%82%D0%B5%D0%BB%D0%B8_%D0%BB%D0%B5%D0%BA%D1%82%D0%BE%D1%80%D0%B8%D1%8F_Cosmos_%D0%BD%D0%B0_Geek_Picnic_2018_SPb.jpg","page_title":"Russen","context_page_description":"Die Russen sind ein ostslawisches Volk mit etwa 137 Millionen Angehörigen, davon rund 115 Millionen in Russland, etwa 17 Millionen in den anderen Folgestaaten der Sowjetunion und etwa sechs Millionen in weiteren Staaten. Sie bilden die größte ethnische Gruppe in Europa. Die nationale Sprache der Russen ist Russisch, die vorherrschende und traditionelle Religion ist das russisch-orthodoxe Christentum."},{"page_url":"https://es.wikipedia.org/wiki/Fincken","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Fincken_in_MBS.svg","page_title":"Fincken","context_page_description":"Fincken es un municipio situado en el distrito de Llanura Lacustre Mecklemburguesa, en el estado federado de Mecklemburgo-Pomerania Occidental, a una altura de 70 metros. Su población a finales de 2016 era de 500 habs. y su densidad poblacional, 14 hab/km².​"},{"page_url":"https://ru.wikipedia.org/wiki/Sphaeromyxidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Sphaeromyxahellandi.jpg","page_title":"Sphaeromyxidae","context_page_description":"Sphaeromyxidae — семейство Myxozoa из отряда Bivalvulida. Споры с грубыми толстыми створками, с примитивными полярными капсулами, в которых находятся короткие и толстые стрекательные нити, не образующие правильных витков. Большинство видов имеют веретеновидные споры с притупленными концами. В них содержатся две полярные капсулы. У представителей рода Auerbachia споры неправильной булововидной формы, с суженным задним полюсом и расширенным передним, на котором располагается единственная крупная полярная капсула. Йодофильная вакуоль отсутствует. Вегетативные формы — огромные дисковидные многоспоровые плазмодии, видимые невооружённым глазом. Паразиты желчного пузыря морских костистых рыб."},{"page_url":"https://da.wikipedia.org/wiki/Michael_D._Higgins","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Michael_D._Higgins_2006.jpg","page_title":"Michael D. Higgins","context_page_description":"Michael D. Higgins er en irsk politiker fra Irish Labour Party og Irlands præsident.\\nHiggins blev den 27. oktober 2011 valgt til præsidentembedet, som han tiltrådte den 11. november 2011, hvar han efterfulgte Mary McAleese. Han blev genvalgt ved valget i 2018 den 26. oktober."},{"page_url":"https://es.wikipedia.org/wiki/Ernesto_Aguiar","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Ernesto_Aguiar.jpg","page_title":"Ernesto Aguiar","context_page_description":"Ernesto Aguiar Rodríguez es un técnico y político español, diputado en el Congreso durante la X y XII legislatura.​"},{"page_url":"https://es.wikipedia.org/wiki/Sunbeam","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/1927_Sunbeam_Super_Sports_%284786681948%29.jpg","page_title":"Sunbeam","context_page_description":"Sunbeam fue un fabricante británico de automóviles. Su factoría estaba ubicada en Moorfields, un barrio de Wolverhampton en el condado de Staffordshire, actualmente West Midlands. El nombre de Sunbeam había sido registrado por John Marston en 1888 para su negocio de fabricación de bicicletas. La producción de automóviles Sunbeam comenzó en 1901. El negocio de los vehículos motorizados se vendió a la Sunbeam Motor Car Company Limited, fundada en 1905 para separar su actividad del negocio de las Bicicletas Sunbeam. Las motocicletas Sunbeam no se fabricaron hasta 1912.\\nEl entusiasmo del diseñador Louis Coatalen impulsó la amplia experiencia de Sunbeam en vehículos de carreras y sus motores. La compañía fabricó sus propios motores de aviación durante la Primera Guerra Mundial, así como la asombrosa cifra de 647 diseños de aviones diferentes. La fabricación de motores atrajo a la marca a las carreras de Grand Prix y a la participación en el logro de récords mundiales automomovilísticos de velocidad.\\nA pesar de sus reconocidos automóviles y motores de aviación, un largo período de escasas ventas en 1934 había provocado pérdidas continuas."},{"page_url":"https://cs.wikipedia.org/wiki/Abraxas_(mytologie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Arte_romana%2C_amuleto_con_dio_aguipede_e_testa_di_gallo%2C_diaspro_sanguigno_e_oro%2C_III_sec.jpg","page_title":"Abraxas (mytologie)","context_page_description":"Abraxas je jméno, jímž egyptský gnostik Basileidos označuje symbol nejvyšší bytosti, reprezentující Dobro i Zlo, v jedné entitě uctívané božstvo i obávaný démon. Z této bytosti pak vychází pět prasil: duch, slovo, prozřetelnost, moudrost a moc. Basileidovi následovníci uctívali Abraxa jako nejvyššího boha, který na svět poslal i Ježíše Krista."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%98%E1%83%A5%E1%83%A1%E1%83%A2%E1%83%A3%E1%83%A1_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/44-St.Sixtus_III.jpg","page_title":"სიქსტუს III","context_page_description":"სიქსტუს III — რომის პაპი 432-440 წლებში, წმინდანი. პირადად მონაწილეობდა ეფესოს საეკლესიო კრების მუშაობაში და ამ კრებაზე ნესტორიანელობაზე გამარჯვების პატივისცემის ნიშნად ააგო სანტა-მარია-მაჯორეს ბაზილიკა რომში."},{"page_url":"https://en.wikipedia.org/wiki/Jollain_(engravers)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/L%C3%A9on_Bouthillier%2C_comte_de_Chavigny.jpg","page_title":"Jollain (engravers)","context_page_description":"Jollain was the name of a family of French engravers and engraving publishers who lived and worked in the 17th and 18th centuries, mainly in Paris. Their engravings were often published under the name Chez Jollain. The atelier Jollain was responsible for the first engraving of harpsichord music in France."},{"page_url":"https://es.wikipedia.org/wiki/Universidad_Regional_Aut%C3%B3noma_de_los_Andes","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Uniandes_Ambato.JPG","page_title":"Universidad Regional Autónoma de los Andes","context_page_description":"La Universidad Regional Autónoma de los Andes es una universidad privada ecuatoriana situada en la ciudad de Ambato."},{"page_url":"https://no.wikipedia.org/wiki/Triumph_TR8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/%2780_Triumph_TR8_%28Hudson%29.JPG","page_title":"Triumph TR8","context_page_description":"Triumph TR8 er en åttesylindret versjon av Triumph TR7, og var designet av Harris Mann og produsert av British Leyland. På grunn av bilens ytelse, ble den ofte kalt i England «The English Corvette». De fleste TR8er ble solgt i USA og Canada. Bilen hadde fem gir og en 3,5 liter motor."},{"page_url":"https://id.wikipedia.org/wiki/Burlington,_Ontario","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Brant_Street_in_Downtown_Burlington%2C_Ontario.jpg","page_title":"Burlington, Ontario","context_page_description":"Burlington merupakan sebuah kota di Kanada. Kota ini letaknya di bagian selatan. Tepatnya di Provinsi Ontario. Pada tahun 2011, kota ini memiliki jumlah penduduk sebesar 175.800 jiwa dan memiliki luas wilayah 185,74 km².Kota ini memiliki angka kepadatan penduduk 946,5 jiwa/km²."},{"page_url":"https://sv.wikipedia.org/wiki/Stanis%C5%82aw_Jan_Jab%C5%82onowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/SJab%C5%82onowski.JPG","page_title":"Stanisław Jan Jabłonowski","context_page_description":"Stanisław Jan Jabłonowski, född 3 april 1634 i Łuczy nära Jabłonowa, död 3 april 1702 i Lwów, var en polsk adelsman. Han var farfar till Józef Aleksandr Jabłonowski.\\nJabłonowski var senator samt storkronhetman och kastellan av Kraków. Han deltog i kriget mot svenskarna 1655, lyckades rädda kronklenoderna från Kraków, var med vid belägringen av Riga, följde Stefan Czarniecki till Danmark, där han som överste under stormningen av Kolding sårades i benet av en kula, som satt kvar resten av livet. Från Danmark begav han sig till Ukraina, där han kämpade under Stanisław Rewera Potockis och Jerzy Sebastian Lubomirskis ledning. År 1664 blev han vojvod av Rus.\\nI det turkiska fälttåget bidrog han kraftigt till Jan Sobieskis seger vid Chotin 1673, framställde först dennes kandidatur till polska kungakronan och anförde högra flygeln av den polska undsättningshären vid Wien 1683. Efter Johan III:s död blev han själv uppställd som kandidat till tronen och deltog i fredsunderhandlingarna i Karlowitz 1699. Hans dotter Anna blev i sitt äktenskap med vojvoden Leszczyński mor till kung Stanisław I Leszczyński."},{"page_url":"https://lb.wikipedia.org/wiki/%C3%8Bnnert_de_St%C3%A4iler","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Anna_Selbdritt_%C3%8Bnner_de_St%C3%A4iler_Luxembourg_City.jpg","page_title":"Ënnert de Stäiler","context_page_description":"Ënnert de Stäiler ass den Numm vun engem Gebai um Fëschmaart an der Stad Lëtzebuerg, um Eck vun der Waassergaass mat der Rue de la Loge.\\nZesumme mam Haus Höcklin von Steinach gëtt et zu den eelsten erhalenen Haiser an der Stad Lëtzebuerg gezielt. D'architektonesch Forme loossen op e Bau ëm 1350 schléissen.\\n1443, wéi d'Burgunder d'Stad eruewert hunn, huet do de Schäffe Jean Chalop gewunnt, deen doutgemaach gouf, well e sech géint d'Eruewerer gewiert huet.\\nNom grousse Feier vu 1509 gouf et an de Joren duerno nees opgebaut, wouvun déi spéitgotesch Fënstern an d'Verzierungen an der Corniche an iwwer de Fënsteren zeien.\\nDe Virbau mat de véier Stäiler, déi dem Haus den Numm ginn hunn, ass vu 1691, a gouf warscheinlech amplaz vun engem Virgänger gebaut, dee beim Bombardement vun der Stad duerch d'Truppe vum Louis XIV. vu Frankräich zerstéiert gi war. D'Balustrad uewendriwwer ass aus méi rezenter Zäit.\\nBis spéit an d'19. Joerhonnert stoung virum Haus de Stillchen, wou Veruerteelter festgehalen an dem Gespëtt vun de Leit ausgesat goufen. Och Zwangssteeë goufen do ofgehalen.\\nAn der Fassad ass eng Statu vun der Anna selbdritt aus dem 16. Joerhonnert vun engem gewësse Meeschter Gaspard."},{"page_url":"https://en.wikipedia.org/wiki/Papamitrou","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/MeekMillPapamitrou.jpg","page_title":"Papamitrou","context_page_description":"Nikolas Papamitrou, better known by his stage name Papamitrou or Nick Papz, is a music producer from Massachusetts. Papamitrou is currently the first signed producer to Meek Mill's record label: Dreamchasers. He is best known for the energy he brings to his instrumentals, his energetic choir melodies, brass, and 808 patterns."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%88%9C%EB%8D%B0%EB%B0%9C%EC%A0%80%EB%93%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Sundevall%27s_Jird.jpg","page_title":"순데발저드","context_page_description":"순데발저드는 쥐과 메리오네스속에 속하는 설치류의 일종이다. 아프가니스탄과 알제리, 이집트, 이란, 이라크, 이스라엘, 요르단, 쿠웨이트, 리비아, 모로코, 니제르, 팔레스타인, 사우디아라비아, 수단, 시리아, 아랍에미리트에서 발견되며, 말리에서도 서식하는 것으로 추정된다. 자연 서식지는 뜨거운 사막 지대이다."},{"page_url":"https://en.wikipedia.org/wiki/Ngh%E1%BB%87-T%C4%A9nh_Soviets","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Lieu_d%27intervention.jpg","page_title":"Nghệ-Tĩnh Soviets","context_page_description":"The uprising of the Nghệ-Tĩnh soviets was the series of uprisings, strikes and demonstrations in 1930 and 1931 by Vietnamese peasants, workers, and intellectuals against the colonial French regime, the mandarinate, and landlords. Nghệ-Tĩnh is a compound name for the two central provinces, Nghệ An and Hà Tĩnh, where the revolt mainly took place. Demonstrations expressed the general anger against French colonial policies such as heavy taxation and state monopolies on certain goods, as well as the corruption and perceived unfairness of local notables and mandarins. Demonstrators, while violent, were armed with little more than basic farm weapons, and were brutally suppressed by the overwhelming military strength of the French. The revolt waned by the second half of 1931 due to famine and suppression."},{"page_url":"https://eo.wikipedia.org/wiki/Alkreska_disko","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Supermassiveblackhole_nasajpl.jpg","page_title":"Alkreska disko","context_page_description":"En astrofiziko, alkreska disko estas diskoforma strukturo formata de la materio orbitanta ĉirkaŭ astro kiu, perdante energion pro frotado aŭ neelastaj kolizioj, falas sur la centran korpon."},{"page_url":"https://en.wikipedia.org/wiki/Whangamarino_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/1942_Whangamarino_railway_station_N52_one_inch_map.jpg","page_title":"Whangamarino railway station","context_page_description":"Whangamarino was a flag station on the North Island Main Trunk line, in the Waikato District of New Zealand, 49 mi south of Auckland. It was 598.24 km north of Wellington, 6.19 km south of Amokura, 6.72 km north of Te Kauwhata and 7 m above sea level."},{"page_url":"https://nl.wikipedia.org/wiki/HV71","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/HV71_spelare.jpg","page_title":"HV71","context_page_description":"HV71 is een ijshockeyclub uit Jönköping/Huskvarna in Zweden. De club werd opgericht op 24 mei 1971. De club werd Zweeds kampioen in 1995, 2004, 2008, 2010 en 2017."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8A%D5%A1%D5%BD_%D5%8E%D5%A5%D5%A3%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Premios_Goya_2019_-_Paz_Vega_%28cropped%29.jpg","page_title":"Պաս Վեգա","context_page_description":"Պաս Վեգան, իսպանացի դերասանուհի։ Վեգան խաղացել է Մեծ Եղեռնի մասին պատմող Արտույտների ագարակը ֆիլմում, մարմնավորելով Նունիկի դերը։ 2002 թ-ին դերասանուհին ամուսնացել է վենեսուելացի Օրսոն Սալասարի հետ և նրանից ունի երեք երեխա՝ Օրսոն կրտսերը, Ավուն և Լենոնը։"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D1%80%D1%96%D0%BD%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Autumn_view_of_the_Udai_near_Kurinka.jpg","page_title":"Курінька","context_page_description":"Курі́нька — село в Україні, у Чорнухинському районі Полтавської області. Населення становило 342 особи. Село Курінька є центром Куріньківської сільської ради, якій підпорядковуються також села Скибенці та Нетратівка."},{"page_url":"https://pl.wikipedia.org/wiki/Bracia_Marx_na_Dzikim_Zachodzie","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Go_West_poster.jpg","page_title":"Bracia Marx na Dzikim Zachodzie","context_page_description":"Bracia Marx na Dzikim Zachodzie – amerykański film komediowy z 1940 roku. W rolach głównych wystąpiła grupa aktorów, znanych jako Bracia Marx."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%83%D1%8D%D0%B1%D0%BB%D0%B0-%D0%B4%D0%B5-%D0%A1%D0%B0%D1%80%D0%B0%D0%B3%D0%BE%D1%81%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Catedral_de_Puebla.JPG","page_title":"Пуэбла-де-Сарагоса","context_page_description":"Пуэ́бла — город и муниципалитет в Мексике, столица штата Пуэбла.\\nОфициальное полное название — Героическая Пуэ́бла-де-Сараго́са. Ранее носил название Пуэ́бла-де-лос-А́нхелес, в связи с чем имеет прозвище Анхело́полис."},{"page_url":"https://fr.wikipedia.org/wiki/Corail_de_feu","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Fire_coral.jpg","page_title":"Corail de feu","context_page_description":"Millepora est le seul genre de cnidaire de la famille des Milleporidés. Les espèces de ce genre sont communément appelées coraux de feu en raison de leurs cnidocystes capables de percer la peau humaine qui provoquent des douleurs semblables à celles de brûlures."},{"page_url":"https://en.wikipedia.org/wiki/Garrett_Motion","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Audi-R18-TDI-2011.JPG","page_title":"Garrett Motion","context_page_description":"Garrett Motion Inc., formerly Honeywell Transportation Systems and Honeywell Turbo Technologies, is an American company primarily involved in engineering, development and manufacturing of turbochargers and related forced induction systems for ground vehicles from small passenger cars to large trucks and industrial equipment and construction machinery. It originated as part of Garrett AiResearch's Industrial Division in Phoenix, Arizona in 1954, after which they entered a contract to provide 5,000 turbochargers for the Caterpillar mining vehicle. It manufactured turbochargers for railroads and commercial trucks. The business produced approximately $3.2 billion in revenue in 2011. Garrett Motion is also involved in motorsports providing turbochargers and forced induction systems, solutions and related equipment to racing teams and various forms of automobile racing and professional competitions. In 2004, the business became part of American industrial conglomerate Honeywell International, Inc., as their Transportation Systems division. In 2018, it was spun off to become an independent company under the Garrett Motion name with corporate headquarters in Rolle, Switzerland."},{"page_url":"https://lt.wikipedia.org/wiki/Red%C5%BEaina","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Saskatchewan%2C_Regina%2C_Mosaic_Stadium%2C_Home_of_the_Roughriders_%281581827181%29.jpg","page_title":"Redžaina","context_page_description":"Redžaina – Saskačevano provincijos centras ir antras didžiausias miestas po Saskatūno. 230,7 tūkst. gyventojų. Įsikūrusi prie Wascana Creek upės, provincijos pietinėje dalyje. Pro miestą eina pagrindinės šalies magistralės, yra oro uostas. Ekonomikoje vyrauja naftos, gamtinių dujų, maisto, kviečių apdirbimo, plieno, žemės ūkio įrangos, dažų, statybos pramonė.\\nPrie Wascana ežero įsikūręs Wascana centras, kuriame yra vietos parlamentas, gamtos istorijos muziejus, meno galerija, Redžainos universitetas, kuriam priklauso daug kolegijų. Yra karališkasis Saskačevano muziejus. Prie miesto yra indėnų rezervatai, kurortinė zona."},{"page_url":"https://en.wikipedia.org/wiki/Karl_H._Pribram","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Karl_Pribram_Kepler_Museum_Prague_s.jpg","page_title":"Karl H. Pribram","context_page_description":"Dr. Karl H. Pribram was a professor at Georgetown University, in the United States, an emeritus professor of psychology and psychiatry at Stanford University and distinguished professor at Radford University. Board-certified as a neurosurgeon, Pribram did pioneering work on the definition of the limbic system, the relationship of the frontal cortex to the limbic system, the sensory-specific \\"association\\" cortex of the parietal and temporal lobes, and the classical motor cortex of the human brain. He worked with Karl Lashley at the Yerkes Primate Center of which he was to become director later. He was professor at Yale University for ten years and at Stanford University for thirty years.\\nTo the general public, Pribram is best known for his development of the holonomic brain model of cognitive function and his contribution to ongoing neurological research into memory, emotion, motivation and consciousness. He was married to American author Katherine Neville."},{"page_url":"https://en.wikipedia.org/wiki/Gated_community","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Retreat_at_Twin_Lakes_entrance.jpeg","page_title":"Gated community","context_page_description":"In its modern form, a gated community is a form of residential community or housing estate containing strictly controlled entrances for pedestrians, bicycles, and automobiles, and often characterized by a closed perimeter of walls and fences. Similar walls and gates have separated quarters of some cities for centuries. Gated communities usually consist of small residential streets and include various shared amenities. For smaller communities, these amenities may include only a park or other common area. For larger communities, it may be possible for residents to stay within the community for most daily activities. Gated communities are a type of common interest development, but are distinct from intentional communities.\\nGiven that gated communities are spatially a type of enclave, Setha M. Low, an anthropologist, has argued that they have a negative effect on the net social capital of the broader community outside the gated community. Some gated communities, usually called guard-gated communities, are staffed by private security guards and are often home to high-value properties, and/or are set up as retirement villages."},{"page_url":"https://simple.wikipedia.org/wiki/Tabla","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Ustad_Zakir_Hussain_2.jpg","page_title":"Tabla","context_page_description":"The tabla is an Indian drum used for North Indian Music. The tabla invention is found in India. It is also used for classical, popular and devotional music of Pakistan. The instrument is two hand drums of different size and shape, similar to bongos. They make different sounds. The drums are treble and bass drum.\\nTabla is played hitting the fingers on the drum head and sliding the palm to create a modulating sound. A lot of sounds can be created from the tabla by changing how you use your hands.\\nThe tabla originated from the a more ancient cylindrical drum called the Pakhawaj.\\nZakir Hussain is a notable tabla player. There are different Gharanas or houses of tabla. Zakir Hussain's style is of the Punjab Gharana."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%BF%E0%AE%A4%E0%AF%8D%E0%AE%A4%E0%AE%95%E0%AE%B5%E0%AE%BF%E0%AE%B4%E0%AF%88%E0%AE%AF%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Wheat-kernel_nutrition-ta.svg","page_title":"வித்தகவிழையம்","context_page_description":"வித்தகவிழையம் என்பது கருத்தரித்தலின் போது பெரும்பாலான பூக்கும் தாவரங்களின் விதைக்குள்ளே உற்பத்தியாகும் திசுவாகும். முளையத்தைச் சூழ்ந்திருக்கும் இத்திசுவில் எண்ணெய்சத்தும் புரதமும் இருந்தாலும், மாப்பொருள் வடிவில் ஊட்டச்சத்தைக் கொண்டுள்ளது. இது மனித உணவுகளில் முக்கிய ஊட்டச்சத்து மூலமாகயிருக்கிறது. எடுத்துக்காட்டாக, பார்லி வித்தகவிழையம் பீர் உற்பத்தி முக்கிய ஆதாரமாகவும், கோதுமை வித்தகவிழையம், ரொட்டிக்கு மாவாகவும் பயன்படுகிறது. தேங்காய் மற்றும் சோளம் போன்றவற்றின் உண்ணப்படும் பகுதி வித்தகவிழையம் ஆகும். ஆர்க்கிட் போன்ற தாவரங்களில் வித்தகவிழையம் விதையில் இல்லாமல் இருக்கும்."},{"page_url":"https://ca.wikipedia.org/wiki/Coira","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Chur_Juni_2010.jpg","page_title":"Coira","context_page_description":"Coira és una ciutat suïssa, capital del cantó dels Grisons.\\nEstà situada a la regió de Plessur. Limita al nord amb els municipis de Haldenstein i Trimmis, a l'est amb Maladers, al sud amb Churwalden i Malix, i a l'oest amb Domat/Ems i Felsberg. Té una població de 33.500 persones. Les llengües parlades són: alemany, italià i romanx."},{"page_url":"https://gl.wikipedia.org/wiki/Antonio_V%C3%A1zquez_Queipo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Antonio_V%C3%A1zquez_Queipo.JPG","page_title":"Antonio Vázquez Queipo","context_page_description":"Antonio Vázquez-Queipo Coste, nado en Cuba o 8 de outubro de 1840 e finado en Madrid o 13 de marzo de 1900, foi un avogado e político galego."},{"page_url":"https://en.wikipedia.org/wiki/Kouroi_of_Flerio","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/NAXOS-1.jpg","page_title":"Kouroi of Flerio","context_page_description":"The Kouros of Flerio is 4.7 metre long statue of white Naxian marble, located in a village garden in Melanes, a small village on Naxos, one of the Cycladic islands, in Greece. A second, similar kouros is located in a quarry near Melanes. They each weigh between 5 and 7 tonnes. The largest kouros on Naxos at 10.45 metres long is the Kouros of Apollonas, which weighs 80 tonnes."},{"page_url":"https://de.wikipedia.org/wiki/Oskar_Lafontaine","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Oskar_Lafontaine_2012_2.jpg","page_title":"Oskar Lafontaine","context_page_description":"Oskar Lafontaine ist ein deutscher Politiker und Publizist. Von 1985 bis zum 9. November 1998 war er Ministerpräsident des Saarlandes. Er war Kanzlerkandidat der SPD für die Bundestagswahl am 2. Dezember 1990 und von 1995 bis 1999 SPD-Vorsitzender. Nach der Bundestagswahl im September 1998 – Gerhard Schröder wurde Bundeskanzler – übernahm er im Kabinett Schröder I das Bundesministerium der Finanzen. Im März 1999 legte er überraschend alle politischen Ämter nieder, auch sein Bundestagsmandat. Fortan trat er als Kritiker des rot-grünen Regierungskurses auf, während Schröder als Kanzler zugleich den SPD-Vorsitz übernahm.\\n2005 wechselte Lafontaine von der SPD zur neu gegründeten Wahlalternative Arbeit & soziale Gerechtigkeit. Diese ging durch seine Initiative im Juni des Jahres ein Wahlbündnis mit der PDS ein, die sich dafür in Die Linkspartei.PDS umbenannte. Von 2005 bis 2009 war Lafontaine mit Gregor Gysi Fraktionsvorsitzender der Linksfraktion im Deutschen Bundestag. Vom 16. Juni 2007 bis zum 15. Mai 2010 war er neben Lothar Bisky Parteivorsitzender der neugebildeten Partei Die Linke."},{"page_url":"https://en.wikipedia.org/wiki/398th_Air_Expeditionary_Group","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Boeing_NKC-135_%22Big_Crow%22_nose.JPEG","page_title":"398th Air Expeditionary Group","context_page_description":"The 398th Air Expeditionary Group is a provisional United States Air Force unit assigned to the United States Air Forces in Europe. The 398 AEG may be activated or inactivated at any time.\\nDuring World War II, its predecessor unit, the 398th Bombardment Group was an Eighth Air Force B-17 Flying Fortress unit in England, stationed at RAF Nuthampstead. The group flew 195 combat missions, the last being on 25 April 1945."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%B1%D8%AE%D8%AA_%D8%B2%D9%86%D8%AF%DA%AF%DB%8C_(%DA%A9%D8%A7%D8%A8%D8%A7%D9%84%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Tree_of_Life_2009_large.png","page_title":"درخت زندگی (کابالا)","context_page_description":"درخت زندگی توصیف ایده‌ای عرفانی در عرفان یهودی یا کابالا است که به نام ۱۰ سفیروت نیز شناخته می‌شود. این ایده یک دیاگرام سه ستونی است که از تعدادی دایره متصل به هم تشکیل شده‌است. بر اساس دیدگاه کابالیست‌ها درخت زندگی ذات الهی، روح انسان و راه معراج عرفانی انسان را نشان می‌دهد. کابالیست‌ها اعتقاد دارند که سمبل درخت زندگی در واقع نقشه آفرینش است.\\nدر دیدگاه کابالای یهودی دو درخت موجود در باغ بهشت، درخت زندگی و درخت دانش خیر و شر دو نمایش مختلف سفیروتها هستند.\\nاز زمان رنسانس دیدگاه‌های کابالایی بین مسیحیان و پیروان هرمسیه رایج شد."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%85%D8%AF_%D8%A7%D9%84%D8%B4%D9%8A%D8%B9%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/%D8%AE%D8%B1%D9%8A%D8%B7%D8%A9_%D8%A7%D9%84%D9%85%D8%B0%D8%A7%D9%87%D8%A8.png","page_title":"المد الشيعي","context_page_description":"المد الشيعي مصطلح يطلق على ظاهرة انتشار الشيعة وتزايد أعدادهم في البلدان ذات أغلبية تتبع المذهب السني كالأردن أو المغرب أو غيرها من الدول العربية وغير العربية."},{"page_url":"https://sr.wikipedia.org/wiki/Anarhokapitalizam","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/600pxanarchocapitalismsymbol.png","page_title":"Anarhokapitalizam","context_page_description":"Anarho-kapitalizam jeste libertarijanska tj. i individualistička politička filozofija koja zagovara eliminaciju države u korist suvereniteta individue u slobodnom tržištu. Ekonomista Marej N. Rotbard je tvorac termina.\\nU anarho-kapitalistićkom društvu, čuvanje javnog reda, sudovi, te sve druge „javne usluge“ bi pružali dobrovoljno-osnovani konkurenti kao privatne agencije za zaštitu, itd., a ne bi bile finansirane kroz porez nametnut od strane institucije monopola inicijacije sile — države; I novac bi bio privatan i konkurentan novac u otvorenom tržištu. Prema anarho-kapitalistima, lične i ekonomske aktivnosti bile bi regulisane prirodnim zakon tržišta te kroz privatni zakon i individualne ugovore, a ne kroz politiku. Dalje, „zločin bez žrtava“ i zločini protiv države ne bi postojali.\\nAnarho-kapitalisti zagovaraju društvo zasnovano na dobrovoljnoj razmjeni, trgovini privatnim vlasništvom i uslugama, a da bi se povećala lična sloboda i prosperitet. Oni takođe prepoznaju milosrđe i grupne, opšte aranžmane kao dio voluntarne etike."},{"page_url":"https://cs.wikipedia.org/wiki/Uran_(prvek)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/30mm_DU_slug.jpg","page_title":"Uran (prvek)","context_page_description":"Uran je radioaktivní chemický prvek šedobílé barvy, která díky oxidaci po čase přechází k šedé barvě. Patří mezi kovy, přesněji do skupiny aktinoidů. Prvek objevil v roce 1789 Martin Heinrich Klaproth a v čisté formě byl uran izolován roku 1841 Eugene-Melchior Peligotem.\\nPrvek byl pojmenován podle tehdy nově objevené planety Uran, která dostala jméno podle boha Urana v řecké mytologii. Uran se tak stal prvním prvkem pojmenovaným podle nově objevené planety – později následovaly ještě neptunium a plutonium."},{"page_url":"https://it.wikipedia.org/wiki/Cuautla_(Jalisco)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Cuautla_Jalisco.jpg","page_title":"Cuautla (Jalisco)","context_page_description":"Cuautla è un comune del Messico, situato nello stato di Jalisco."},{"page_url":"https://ca.wikipedia.org/wiki/Genmei","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Empress_Gemmei.jpg","page_title":"Genmei","context_page_description":"L'emperadriu Genmei, coneguda també com a emperadriu Genmyō, fou el 43è monarca del Japó, segons l'ordre tradicional de successions.\\nEl regnat de Genmei es va estendre els anys 707 i 715.\\nEn la història del Japó, Genmei va ser la quarta de vuit dones en assolir la responsabilitat d'emperadriu regnant. Abans que Genmei, va regnar tres dones: Suiko, Kōgyoku/Saimei, i Jitō. Després de Genmei van regnar quatre dones més: Genshō, Kōken/Shōtoku, Meishō, i Go-Sakuramachi."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D1%82%D0%B5%D0%BD%D1%83%D0%B0%D0%B7%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Montenoison3.jpg","page_title":"Монтенуазон","context_page_description":"Монтенуазон — Францин гӀала-коммуна, лаьтта Бургунди — Франш-Конте регионехь. Коммунан департамент — Ньевр. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://id.wikipedia.org/wiki/Cekungan_Sichuan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/China_edcp_relief_location_map_Sichuan.png","page_title":"Cekungan Sichuan","context_page_description":"Cekungan Sichuan, sebelumnya ditransliterasikan sebagai Cekungan Szechwan, adalah suatu daerah dataran rendah di Tiongkok bagian barat daya. Cekungan ini dikelilingi oleh pegunungan di semua sisi dan dialiri oleh Sungai Yangtze dan anak-anak sungainya. Cekungan ini diapit oleh Chengdu, ibu kota Provinsi Sichuan di barat, dan Chongqing, sebuah munisipalitas independen di timur. Karena tanahnya yang relatif rata dan subur, Cekungan Sichuan padat penduduknya dengan populasi lebih dari 100 juta jiwa. Selain menjadi ciri geografis yang dominan di wilayah ini, Cekungan Sichuan juga merupakan lingkungan kebudayaan yang dibedakan oleh kebiasaan, masakan, dan dialeknya yang unik. Cekungan ini terkenal dengan budidaya padi dan sering dianggap sebagai lumbung padi Tiongkok. Pada abad ke-21 pusat industrinya berkembang dengan pertumbuhan industri berteknologi tinggi, dirgantara, dan perminyakan."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A3%BC%EB%A6%84%EA%B0%9C%EB%AF%B8%EC%86%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Pavement_ant_2.jpg","page_title":"주름개미속","context_page_description":"주름개미속은 개미의 한 속으로서 개미의 한 아과인 두배자루마디개미아과에 속한다."},{"page_url":"https://tr.wikipedia.org/wiki/Azerbaycan_Devlet_Gen%C3%A7_Seyirciler_Tiyatrosu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Az%C9%99rbaycan_D%C3%B6vl%C9%99t_G%C9%99nc_Tama%C5%9Fa%C3%A7%C4%B1lar_Teatr%C4%B1.jpg","page_title":"Azerbaycan Devlet Genç Seyirciler Tiyatrosu","context_page_description":"Azerbaycan Devlet Genç Seyirciler Tiyatrosu, Azerbaycan'ın başkenti Bakü'de bulunmaktadır. Azerbaycan Devlet Genç Seyirciler Tiyatrosu kapılarını halka ilk defa, Sovyet döneminde, 14 Mart 1927 tarihinde açtı. 14 yaşındaki Ağadadaş Kurbanov'un girişimi ile hazırlanan \\"Fırtına\\" oyunu, Azerbaycan'da ilk çocuk tiyatrosunun kuruluşunun temelini oluşturmuştur.\\n1928 yılında Azerbaycan Sovyet Sosyalist Cumhuriyeti Eğtim Komiserliği'nin kararı ile tiyatro resmen faaliyete başlamıştır. 18 Temmuz 1936 tarihinde Eğtim Komiserliği'nin kararı ile Azerbaycan Devlet Genç Seyirciler Tiyatrosuna ek olarak Maksim Gorki'nin adı verildi.\\nTiyatroda Ağadadaş Kurbanov, Memmedağa Dadaşov, Yusuf Eminli, Mine Abdullayeva, Yusuf Dadaşov, Susanna Mecidova, Cavahir İskenderov, Süleyman Alaskerov, Hüseynağa Sadıhov, Kerim Hasanov, Zafer Nemetov, Muharrem Haşimov, Alimemmed Atayev gibi Azerbaycan Tiyatrosu'nun önemli oyuncuları ve yönetmenleri yer almıştır.\\nAzerbaycan Cumhuriyeti'nin bağımsızlığı ile birlikte, tiyatro yeni teknik donatımı ve dış cephesindeki tamirat ve onarım çalışmalarından sonra bugünkü görüntüsüne kavuştu."},{"page_url":"https://ast.wikipedia.org/wiki/Historia_de_Guatemala","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Tresdobleces.jpg","page_title":"Historia de Guatemala","context_page_description":"La hestoria de Guatemala ye la cronoloxía de sucesos acaecíos dende l'empiezu del primixeniu poblamientu humanu nel actual territoriu de la República de Guatemala hasta los nuesos díes. Esta empieza colos primeros grupos de persones n'habitar la rexón, de les que se destacar la civilización maya.\\nLos conquistadores españoles lleguen a Guatemala en 1523. Hernán Cortés noma a la ciudá de Guatemala, na so carta de rellación empobinada a Carlos V, fechada en Méxicu el 15 d'ochobre del añu siguiente 1524. Cortés referir a «unes ciudaes de que munchos díes había que yo tengo noticies que se llamen Ucatlán y Guatemala». La rexón pasó a formar la Capitanía Xeneral de Guatemala, adscrita al Virreinatu de la Nueva España.\\nNel sieglu xix, los criollos de la Capitanía Xeneral de Guatemala llograron la so independencia del Imperiu español y la rexón pasó a llamase Federación Centroamericana, que amestóse efímeramente al imperiu d'Agustín de Iturbide en Méxicu."},{"page_url":"https://de.wikipedia.org/wiki/Architektur_in_Frankfurt_(Oder)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Unternehmervilla_Puschkinstra%C3%9Fe_54_Frankfurt_Oder.jpg","page_title":"Architektur in Frankfurt (Oder)","context_page_description":"Frankfurt (Oder) hat eine Geschichte, die bis 1253 zurückreicht und von der viele Bauten zeugen. Viele sind 1945 in den letzten Tagen des Zweiten Weltkrieges zerstört worden.\\nZu den historischen Bauten gehören die Marienkirche, die Heilig-Kreuz-Kirche, die Friedenskirche, das große Collegienhaus der Brandenburgischen Universität Frankfurt, der Bismarckturm und das Kartäuserkloster."},{"page_url":"https://no.wikipedia.org/wiki/Su%C3%B0uroy","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Fleygamenn_Trongisv%C3%A1gur.jpg","page_title":"Suðuroy","context_page_description":"Suðuroy er den sørligste og fjerde største av Færøyene. De fleste bygdene ligger i fjorder på østkysten, mens Sumba og Fámjin ligger på vestkysten med mange lett tilgjengelige fuglefjell. Tvøroyri og Vágur er økonomiske og trafikale knutepunkter for henholdsvis nord- og sørdelen av øya.\\nDen 1. januar 2019 hadde Suðuroy 4 593 innbyggere, fordelt på 14 bygder. Øysamfunnet har opplevd en reduksjon i folketallet og sin andel av Færøyenes befolkning siden 1950-årene. Suðuroy er den øya som ligger lengst unna det færøyske meginlandið, «hovedlandet». Det er fergeforbindelse mellom Tvøroyri og Tórshavn. Suðuroy var tidlig ute med å industrialisere fiskeriet, som stadig er øyas største næringsvei. Andre viktige næringsveier er jordbruk, handel samt offentlig og privat tjenesteyting.\\nSuðuroy har fått tilnavnet «Lille Danmark», fordi flertallet i befolkningen ønsker samhørighet med Danmark, ikke løsrivelse. Dialekten har flere trekk som knytter den nærmere til dansk enn hva som er tilfelle for andre færøyske dialekter. Distinkte trekk ved øysamfunnet har blitt tilskrevet den isolerte beliggenheten."},{"page_url":"https://sv.wikipedia.org/wiki/Jonas_Ekengren","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Altuna_kyrka_-_KMB_-_16000200112125.jpg","page_title":"Jonas Ekengren","context_page_description":"Jonas Ekengren, född 27 augusti 1736 i Stora Mellösa socken, Örebro län, död 17 februari 1793 i Maria Magdalena församling, Stockholm, var en svensk stolmakare och orgelbyggare.\\nHan var son till soldaten Eric Ekegren och Annicka Andersdotter i Egeby i Stora Mellösa socken. Jonas Ekengren fick Kommerskollegiets privilegium år 1760 som stolmakare; han var medlem i stolmakarnas skrå. Från 1766 var han verksam som orgelbyggare och byggde många orglar åt Uppsala stift. Han var troligtvis självlärd och oexaminerad."},{"page_url":"https://nl.wikipedia.org/wiki/Schonstett","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Schonstett.jpg","page_title":"Schonstett","context_page_description":"Schonstett is een plaats in de Duitse deelstaat Beieren, en maakt deel uit van het Landkreis Rosenheim.\\nSchonstett telt 1.356 inwoners."},{"page_url":"https://ca.wikipedia.org/wiki/Carnegie_Steel_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Carnegie-Illinois_Steel_furnaces.jpg","page_title":"Carnegie Steel Company","context_page_description":"La Carnegie Steel Company va ser una companyia productora d'acer creada per Andrew Carnegie per gestionar els seus negocis d'acer a l'àrea de Pittsburgh, Pennsilvània el 1892."},{"page_url":"https://it.wikipedia.org/wiki/Darius_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/FC_Bayern_M%C3%BCnchen_%28Basketball%290185.JPG","page_title":"Darius Hall","context_page_description":"Darius Hall è un ex cestista statunitense, professionista in Europa."},{"page_url":"https://hr.wikipedia.org/wiki/Crkva_sv._Nikole_u_Perastu","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Perast%2C_s._nicola%2C_03_rosone.JPG","page_title":"Crkva sv. Nikole u Perastu","context_page_description":"Crkva sv. Nikole je rimokatolička crkva u Perastu.\\nU današnjem obliku sagrađena je 1616. Građena je od korčulanskoga kamena, s lijepim renesansnim pročeljem. Na pročelju se nalazi natpis o pobjedi Peraštana nad Turcima 1654. Riječ je o jednobrodnoj crkvi u čijoj se unutrašnjosti nalaze klesarska djela korčulanskih majstora i vrijedne slike Tripe Kokolje. U njezinoj riznici, koja je danas muzej, čuvaju se mnogi vrijedni darovi. U crkvi se nalazilo središte bratovštine pomoraca. Uz crkvu se nalazi zvonik iz 1691., visok 55 m. Prema povjesničarima umjetnosti zvonik je najljepši primjer raščlanjenog tipa zvonika s piramidalnim završetkom na Jadranu.\\nBarokni zvonik župne crkve od korčulanskoga je kamena. Projektirao ga je mletački arhitekt Giuseppe Beati, a radove je izveo hrvatski graditelj Ivan Krstitelj Škarpa.\\nPeraštani su bili poznati kao čuvari glavne ratne zastave Mletačke Republike Sv. Križa. Zastavnici su se zvali gonfalonijeri i pravo čuvati tu zastavu na admiralskom brodu Republike imali su od prve polovice 15. st. pripadnici 12 peraških bratstava. Nakon što je Napoleon ukinuo Mletačku Republiku 1797. godine, Peraštani su svečano ukopali u crkvi sv. Nikole zastavu Sv."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%81%D0%B0%D0%B4%D1%87%D0%B0_%D0%9A%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D1%96%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Pianoboy_and_Katya_Osadcha_in_Green_theatre.jpg","page_title":"Осадча Катерина Олександрівна","context_page_description":"Катери́на Олекса́ндрівна Оса́дча — українська журналістка, ведуча програм «Світське життя», \\"Голос країни\\" та \\"Голос діти\\" на телеканалі «1+1». Із 13 до 18 років працювала в модельному бізнесі в Західній Європі, після 18 років повернулась до України."},{"page_url":"https://nl.wikipedia.org/wiki/Heist_(Duitsland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Heist_Wappen.png","page_title":"Heist (Duitsland)","context_page_description":"Heist is een gemeente in de Duitse deelstaat Sleeswijk-Holstein. De gemeente maakt deel uit van de Kreis Pinneberg.\\nHeist telt 2.807 inwoners."},{"page_url":"https://en.wikipedia.org/wiki/Stanley_Motor_Carriage_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Stanley_Steamer_at_2009_Newport_Hill_Climb_1.png","page_title":"Stanley Motor Carriage Company","context_page_description":"The Stanley Motor Carriage Company was an American manufacturer of steam-engine vehicles; it operated from 1902 to 1924. The cars made by the company were colloquially called Stanley Steamers, although several different models were produced."},{"page_url":"https://lv.wikipedia.org/wiki/Aldana_(upe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Aldan.png","page_title":"Aldana (upe)","context_page_description":"Aldana ir upe Krievijā, Jakutijas Republikā, Ļenas labā krasta pieteka. Aldana ir lielākā Ļenas pieteka. Sākas Stanovoja grēdas ziemeļu nogāzē uz Jakutijas un Amūras apgabala robežas, tek sākumā austrumu virzienā pa Aldanas kalnieni, vēlāk pagriežas uz ziemeļiem gar Verhojanskas grēdāju un uz rietumiem un ietek Ļenas upē lejpus Jakutskas. Kuģojama 1600 km garumā līdz Tommotai, kur upi šķērso Tindas—Jakutskas dzelzceļš. Lielākās pietekas ir Učura, Maja, Allahjuņa, Amga.\\nUpes nosaukums cēlies no evenku valodas un apzīmē vai nu zivs nosaukumu, vai dzelzi. Upes baseinā bagātīgas zelta, akmeņogļu, vizlas atradnes. Lielākās apdzīvotās vietas krastos ir Handiga un Tommota."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%A5%D5%AC%D5%B8%D5%A3%D6%80%D5%A1%D5%A4%D5%B9%D5%AB%D5%AF_(%D5%A1%D5%B4%D6%80%D5%B8%D6%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Belogradchik_Fortress.png","page_title":"Բելոգրադչիկ (ամրոց)","context_page_description":"Բելոգրադչիկ ամրոց կամ Կալետո, հին ամրոց, որ գտնվում է Բուլղարիայում\` Բալկանյան լեռների հյուսիսային լանջին\` Բելոգրադչիկ քաղաքից հյուսիս-արևմուտք։ Բելոգրադչիկի ժայռերի հետ պատմական ու մշակութային կարևոր արժեք է ներկայացնում։ Բուլղարիայի այն ամրոցներից է, որ լավ են պահպանվել մինչև մեր օրերը։ Բուլղարիայի մշակույթի հուշարձան է։\\nԱմրոցային պատերի հաստությունը 2 մ է հիմքի մոտ, բարձրությունը\` 12 մ։ Երեք առանձին ամրություններն իրար են միացված դարպասներով։ Ամրոցի ընդհանուր մակերեսը 10.210 մ² է։ Ավելի ուշ ամրոցը վերակառուցվել է\` ստանալով Բուլղարիայի մշակույթի հուշարձանի կարգավիճակ։ Ներկայումս գտնվում է Պատմության թանգարանի ենթակայության տակ։"},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%8C%97%E7%88%B1%E7%90%B4%E6%B5%B7%E8%AF%B8%E5%B2%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Thassos-Limenas.jpg","page_title":"北爱琴海诸岛","context_page_description":"北愛琴海諸島，又稱東北愛琴海諸島，指愛琴海北部海域的一系列互不相連的島嶼。北愛琴海諸島大部分隸屬希臘，其餘屬土耳其。北愛琴海諸島以南為基克拉澤斯和佐澤卡尼索斯群島，以西則為北斯波拉澤斯群島。\\n北愛琴海諸島的希臘屬島嶼主要有薩索斯島、薩莫色雷斯島、利姆諾斯島、萊斯沃斯島、希俄斯島、薩摩斯島和伊卡利亞島等；其中除了薩索斯島和薩莫色雷斯島外，其他島嶼均靠近安納托利亞的海岸。\\n土耳其屬島嶼如格羅切島、特內多斯島和楚達島也屬於該地區。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%A8%D8%B1%D9%86%D8%BA_%D8%BA%D8%B1%D9%8A%D9%86_(%D9%88%D9%8A%D8%B3%D9%83%D9%88%D9%86%D8%B3%D9%86)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/SpringGreenWisconsinWIS23.jpg","page_title":"سبرنغ غرين (ويسكونسن)","context_page_description":"سبرينغ غرين (ويسكونسن) ‏ هي قرية تقع في الولايات المتحدة في مقاطعة سوك (ويسكونسن). يقدر عدد سكانها بـ 1,628 نسمة ومساحتها 4.66 كم² وترتفع عن سطح البحر 221 متر."},{"page_url":"https://it.wikipedia.org/wiki/Leszek_Nowak","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Leszek_Nowak%2C_filozof.jpg","page_title":"Leszek Nowak","context_page_description":"Leszek Nowak è stato un filosofo polacco.\\nDi scuola marxista, fu redattore della rivista Studi di Poznán sulla filosofia delle scienze e delle lettere. In campo epistemologico propose una conciliazione tra marxismo e positivismo logico."},{"page_url":"https://da.wikipedia.org/wiki/Christian_Krohg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Christian-krohg-leiv-eriksson.jpg","page_title":"Christian Krohg","context_page_description":"Christian Krohg var en norsk maler, forfatter og journalist. Han var søn af Georg Anton Krohg.\\nKrohg blev uddannet i Tyskland og arbejdede i Paris fra 1881 til 1882. Inspireret af\\nrealismens tænkere valgte han hovedsagelig motiver fra hverdagslivet, ofte fra socialt svagere stillede i samfundet. Særlig kendt er hans malerier af prostituerede, især »Albertine i politilægens venteværelse« vist første gang 22. marts 1886 i Den frisindede Studenterforening og blev færdigmalet udstillet 11. marts 1887 i Teknikens Store Sal i Rådhusgata i Oslo.\\nHan skrev en roman om samme emne, Albertine. Bogen vakte stor opsigt og blev beslaglagt af politiet dagen efter udgivelsen.\\nKrohgs kraftige og ligefremme stil gjorde ham til en af de førende skikkelser i skiftet fra\\nromantikken til Naturalisme, som er karakteristisk for norsk kunst i denne periode. Gennem sine ophold i Skagen, hvor han ankom første gang i 1879, fik han betydning for Anna og Michael Ancher.\\nKrohg var journalist på Verdens Gang 1890–1910. Krohg var den første professor og direktør ved Statens kunstakademi."},{"page_url":"https://ast.wikipedia.org/wiki/Geoda","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Amethyst_geode_in_its_parent_rock.jpg","page_title":"Geoda","context_page_description":"Una geoda ye un cuévanu predresu, de normal zarrada, na que cristalizaron minerales que fueron conducíos hasta ella disueltos n'agua soterraño y que los sos cristales son de gran tamañu por cuenta de la poca presión a la que se producieron. El procesu de cristalización produzse en capes nes parés del cuévanu, polo que pueden atopase geodas bueques.\\nEn terrenales cársticos, como los xeneraos en depósitos d'aljez, l'agua esllee la roca, que los sos cristales son pequeños por sometese a grandes presiones, y nos mesmos cuévanos creaes puede recristalizar el mesmu material, pero esta vegada con cristales enforma mayores que los de la roca circundante.\\nTamién se conocen como geodas les roques bueques en que'l so interior crecieron otres especies de minerales como cuarzu ente otros minerales."},{"page_url":"https://en.wikipedia.org/wiki/Turiec_(V%C3%A1h)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Vr%C3%BAtky13.JPG","page_title":"Turiec (Váh)","context_page_description":"The Turiec is a river in north-western Slovakia. It is a tributary to the Váh, into which it flows near the city of Martin. Its source is in the Veľká Fatra Mountains. It is 67 km long and its basin size is 931 km². The Turiec region is named after this river."},{"page_url":"https://en.wikipedia.org/wiki/Deacon_Hutchins_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/RumfordME_DeaconHutchinsHouse.jpg","page_title":"Deacon Hutchins House","context_page_description":"The Deacon Hutchins House is an historic house on Maine State Route 5 in Rumford, Maine. Built c. 1802, it is an excellent example of vernacular Federal style architecture, and is further notable for murals drawn in one room by the itinerant painter Rufus Porter. It was listed on the National Register of Historic Places in 1987."},{"page_url":"https://nl.wikipedia.org/wiki/Malakoff_-_Rue_Etienne_Dolet_(metrostation)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Paris_metro_-_Malakoff-Rue_%C3%89tienne_Dolet_-_1.JPG","page_title":"Malakoff - Rue Etienne Dolet (metrostation)","context_page_description":"Malakoff - Rue Étienne Dolet is een station van de metro in Parijs langs metrolijn 13 in de gemeente Malakoff.\\nHet bovengrondse station en de straat waaraan het ligt zijn genoemd naar Étienne Dolet, een humanist uit Orléans."},{"page_url":"https://es.wikipedia.org/wiki/Real_F%C3%A1brica_de_Sargadelos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Porcelana_de_Sargadelos._Taza_de_T%C3%A9._S.XIX.jpg","page_title":"Real Fábrica de Sargadelos","context_page_description":"La cerámica de Sargadelos es una famosa cerámica elaborada en Sargadelos. La primera fábrica fue creada a principios del siglo XIX por Antonio Raimundo Ibáñez y tras varias generaciones acabó cerrando en 1875.\\nA partir de mediados del siglo XX una nueva iniciativa cerámica en Sargadelos, basada en coloraciones en tonos azulados ​, forma parte de un grupo de empresas del sector, el grupo Sargadelos —al que pertenece igualmente la cerámica de Castro-Sada— gracias al impulso del ceramista Isaac Díaz Pardo"},{"page_url":"https://en.wikipedia.org/wiki/Chia_Pet","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Chia_Pet_logo.png","page_title":"Chia Pet","context_page_description":"Chia Pets are American styled terracotta figurines used to sprout chia, where the chia sprouts grow within a couple of weeks to resemble the animal's fur or hair. Moistened chia seeds are applied to a grooved terra cotta figurine.\\nThe chia pet is marketed by Joe Pedott and produced by San Francisco, California-based company Joseph Enterprises, Inc. The first Chia Pet, Chia Guy, was created on September 8, 1977. A trademark registration was filed on Monday, October 17, 1977. Pedott first learned about Chia Pets when he attended a housewares show in Chicago in 1977. Chia Pets achieved popularity in the 1980s following the 1982 release of a ram, the first widely marketed Chia Pet.\\nThe catchphrase sung in the TV commercial as the plant grows in time lapse is \\"Ch-ch-ch-chia!\\". This catchphrase originated at an agency brainstorming meeting, where one of the individuals present pretended to stutter the product name. As of 2019, approximately 15 million Chia Pets were sold annually with most sales during the holiday season. Originally made in Mexico, Chia Pets are now produced in China."},{"page_url":"https://de.wikipedia.org/wiki/Edward_Echols","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Edward_Echols.jpg","page_title":"Edward Echols","context_page_description":"Edward Echols war ein US-amerikanischer Politiker. Zwischen 1898 und 1902 war er Vizegouverneur des Bundesstaates Virginia."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%A5%BD%E4%BA%BA%E7%90%86%E6%9F%A5%E8%99%9F%E5%85%A9%E6%A3%B2%E6%94%BB%E6%93%8A%E8%89%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/USS_Bonhomme_Richard_%28LHD-6%29_welldeck.jpg","page_title":"好人理查號兩棲攻擊艦","context_page_description":"好人理查德号两栖攻击舰是一艘隶属于美国海军的黄蜂级两栖攻击舰，为美国海军第三艘以法文“好人理查德”命名的同名军舰。"},{"page_url":"https://en.wikipedia.org/wiki/Sham_Tseng","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Sham_Tseng_San_Tsuen_%28revised%29.jpg","page_title":"Sham Tseng","context_page_description":"Sham Tseng is a coastal area in Tsuen Wan District, Hong Kong, between Ting Kau and Tsing Lung Tau."},{"page_url":"https://pt.wikipedia.org/wiki/Paul_Blobel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Paul_Blobel.jpg","page_title":"Paul Blobel","context_page_description":"Paul Blobel foi um oficial nazista ocupando a patente de SS-Standartenführer, membro da Sicherheitsdienst o SD, chefe do SonderKommando 4a e do Sonderkommando 1005 dos Einsatzgruppen durante a Segunda Guerra Mundial.\\nParticipou da Primeira Guerra Mundial, onde foi condecorado com a Cruz de Ferro de primera e segunda classe. Depois da guerra, Blobel estudou arquitetura e exerceu a profissão de 1924 até 1931, quando perdeu seu emprego e se filiou ao NSDAP com o número 844.662, em 1 de dezembro de 1931, bem como na SS, com o número 29.100, na mesma data.\\nDurante a invasão a União Soviética foi responsável pelo 4ª Sonderkommando, unidade de exterminio pertencente ao Einsatzgruppe C, que atuou na Ucrania. Blobel foi o principal responsável pelo célebre massacre de Babi Yar, em Kiev, ocorrido em 29 e 30 de setembro de 1941, onde foram assassinados cerca de 100.000 civis, em sua maioria de origem não judía.\\nFoi afastado de seu cargo em 13 de janeiro de 1942, oficialmente por razões de saúde, mas principalmente devido ao alcoolismo."},{"page_url":"https://de.wikipedia.org/wiki/Bistum_Visby","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Visby_Sankta_Maria_view02.jpg","page_title":"Bistum Visby","context_page_description":"Das Bistum Visby ist eine der 13 Diözesen innerhalb der Schwedischen Kirche. Sein Gebiet ist deckungsgleich mit dem Gebiet der Provinz Gotlands län, es besteht also aus der Insel Gotland einschließlich einiger kleinerer Nachbarinseln.\\nDas Bistum gliedert sich in drei Kirchenkreise, die aus insgesamt 55 Kirchengemeinden bestehen. Außerdem sind dem Bistum Visby die 46 Auslandsgemeinden der Schwedischen Kirche im Ausland zugeordnet.\\nBischofssitz ist die Stadt Visby mit dem Dom zu Visby als Bischofskirche. Seit Juni 2018 ist Thomas Petersson Bischof von Visby.\\nSiehe auch\\nListe der Bischöfe von Visby"},{"page_url":"https://tr.wikipedia.org/wiki/Bizans_%C4%B0mparatorlu%C4%9Fu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Greekfire-madridskylitzes1.jpg","page_title":"Bizans İmparatorluğu","context_page_description":"Bizans İmparatorluğu veya zaman zaman kullanılan adıyla Doğu Roma İmparatorluğu, Geç Antik Çağ ve Orta Çağ boyunca Roma İmparatorluğu'nun devamı şeklinde var olan ve başkenti Konstantinopolis olan ülke. 5. yüzyılda Batı Roma İmparatorluğu'nun dağılışı ve çöküşü sürecinden sağ kalan imparatorluk, 1453'te Osmanlı Türkleri'ne yenik düşene kadar, yaklaşık bin yıl var olmaya devam etti. Var olduğu sürenin çoğunda, Avrupa'da ekonomik, kültürel ve askerî bakımdan en güçlü ülkeydi. \\"Bizans İmparatorluğu\\" ve \\"Doğu Roma İmparatorluğu\\" terimleri ülkenin yıkılışından sonraki tarihçiler tarafından yaratılmış olup imparatorluk vatandaşları kendi ülkelerine Roma İmparatorluğu, veya Romania; kendilerineyse \\"Romalılar\\" demekteydi.\\n4. yüzyıldan 6. yüzyıla kadar yaşanan bazı göze çarpan olaylar, Roma İmparatorluğu'nun Grek Doğu ve Latin Batı şeklinde ayrışma sürecini belirledi. I. Konstantin imparatorluğu yeniden organize ederek Konstantinopolis'i başkent yaptı ve Hristiyanlık dinini yasallaştırdı. I. Theodosius döneminde, Hristiyanlık ülkenin devlet dini olarak kabul edildi ve diğer dinler yasaklandı."},{"page_url":"https://sl.wikipedia.org/wiki/Vitraj","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Chalons-en-Champagne_%2881-A%29_straight.JPG","page_title":"Vitraj","context_page_description":"Vitraj, tudi vitraž, je stekleno, večinoma iz več barvnih elementov sestavljeno okno. Med posameznimi obarvanimi steklenimi deli so kovinske pregrade, ki tvorijo oporo strukture. Izdelovanje vitrajev lahko štejemo za umetnost in obrt. Kljub temu, da so vitraji stekleni, skoznje večinoma ne moremo gledati; vidna je le obarvana svetloba.\\nIzraz vitraj se lahko nanaša obarvano steklo kot material ali delo, nastalo iz njega. V vsej svoji tisočletni zgodovini, se je izraz uporabljal skoraj izključno za okna cerkva in drugih pomembnih objektov. Čeprav so to tradicionalno ravne plošče in se uporabljajo kot okna, so stvaritve sodobnih umetnikov tudi tridimenzionalne strukture in skulpture.\\nUporaba izraza vitraj se v žargonu uporablja tudi za domača okna iz svinca in stekla in umetniške izdelke ustvarjene iz umetniškega stekla povezanega med seboj, kot so znane svetilke Louis Comfort Tiffanyja.\\nKot material je vitrajno steklo obarvano z dodajanjem kovinskih soli. Obarvano steklo se oblikuje v vitraj s koščki stekla, tako da tvori vzorce ali slike, ki jih držijo skupaj največkrat trakovi svinca in mu dajejo trden okvir."},{"page_url":"https://en.wikipedia.org/wiki/List_of_National_Historic_Landmarks_in_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/WilliamSewardHouse.JPG","page_title":"List of National Historic Landmarks in New York","context_page_description":"This is a list of National Historic Landmarks and comparable other historic sites designated by the U.S. government in the U.S. state of New York. The United States National Historic Landmark program operates under the auspices of the National Park Service, and recognizes buildings, structures, objects, sites and districts of resources according to a list of criteria of national significance. There are 262 NHLs in New York state, which is more than 10 percent of all the NHLs nationwide, and the most of any state. The National Park Service also has listed 20 National Monuments, National Historic Sites, National Memorials, and other sites as being historic landmarks of national importance, of which 7 are also designated NHLs. All of these historic landmarks are covered in this list.\\nThere are 139 NHLs in upstate New York, 13 on Long Island, and 114 within New York City. Three counties have ten or more NHLs: New York County has 86; Westchester County, just north of NYC, has 18; and Erie County in western New York has 10. Twelve other counties have five to nine NHLs, eight have three or four, 27 counties have one or two, and the remaining twelve of the state's 62 counties have none."},{"page_url":"https://oc.wikipedia.org/wiki/Walia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Walia-rey-visigodo.png","page_title":"Walia","context_page_description":"Walia, Rei dels visigòts entre 415 e 418. Sucediguèt a Ataülf a la mòrt en 415 de Sigeric assassinat pels seus seccessors après una setmana de govèrn. Establiguèt la capitala dels Visigòts a Tolosa."},{"page_url":"https://lv.wikipedia.org/wiki/Opel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Opel_senator_1_v_sst.jpg","page_title":"Opel","context_page_description":"Opel ir Vācijā bāzēts autobūves uzņēmums. Tā mātes uzņēmums ir Adam Opel AG, kas pieder ASV autobūves grupai General Motors."},{"page_url":"https://es.wikipedia.org/wiki/%C3%93rdenes,_condecoraciones_y_medallas_de_la_Uni%C3%B3n_Sovi%C3%A9tica","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Medal_Defense_of_Leningrad.jpg","page_title":"Órdenes, condecoraciones y medallas de la Unión Soviética","context_page_description":"Las órdenes, condecoraciones y medallas de la Unión Soviética son recompensas de la antigua Unión Soviética que reconocían los esfuerzos y logros, tanto militares como civiles. Algunas de las órdenes, condecoraciones y medallas dejaron de ser concedidas a partir del colapso de la Unión Soviética, mientras otras continúan siendo entregadas por la Federación Rusa. Muchas de ellas fueron heredadas y rediseñadas por la Federación Rusa, tal como sucedió con la transición de Héroe de la Unión Soviética a Héroe de la Federación Rusa. Una amplia variedad de premios y condecoraciones cubren el extenso y diverso periodo de la historia que va desde 1917 a 1991."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A7%E3%82%A2%E3%83%B3%E3%83%BB%E3%82%BB%E3%83%BC%E3%82%B6%E3%83%AB%E3%83%BB%E3%83%A2%E3%83%B3%E3%83%86%E3%82%A4%E3%83%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Joao_Cesar_Monteiro.jpg","page_title":"ジョアン・セーザル・モンテイロ","context_page_description":"ジョアン・セーザル・モンテイロ・サントスは、ポルトガルの映画監督、俳優、映画批評家である。パウロ・ローシャとならぶ「ノヴォ・シネマ」の中心人物である。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E9%9B%85%E5%9C%96%E6%B0%B4%E6%89%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Seattle_Mariners_logo_1977_to_1979.png","page_title":"西雅圖水手","context_page_description":"西雅圖水手，是美國職棒大聯盟中，隸屬於美國聯盟的棒球隊伍之一，成立於1977年。主場位於華盛頓州的西雅圖，為T-Mobile球場，在1999年開始啟用。在美國聯盟的分區中，屬於美國聯盟西區。\\n1995年，水手第一次取得美國聯盟西區冠軍的身份獲得季後賽門票，他們在美國聯盟分區賽以3勝2敗的成績淘汰紐約洋基，這場系列賽的第5場比賽，是由肯·小葛瑞菲於延長賽第11局擊出再見全壘打，幫助球隊贏得隊史在季後賽的第一個系列賽。\\n2001年，水手獲得116勝的隊史紀錄，也是美國聯盟最多勝的紀錄，這是大聯盟至從1906年芝加哥小熊之後，再次有此高勝率的球隊，也追平大聯盟的紀錄。在1995年至2001年期間，水手是支強盛的球隊，共贏得4次季後賽的門票，但卻是大聯盟唯一一支還未打進世界大賽的球隊。"},{"page_url":"https://es.wikipedia.org/wiki/Aratus_(cr%C3%A1ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/AratusCraterSAT.jpg","page_title":"Aratus (cráter)","context_page_description":"Aratus es un pequeño cráter de impacto lunar situado en el altiplano al sur y al este de los accidentados Montes Apenninus. Es un cráter circular, en forma de copa y con un albedo relativamente alto. Al este se encuentra el Mare Serenitatis, y al suroeste del cráter está el cráter algo mayor Conon. La zona norte-noreste de Aratus es el lugar de aterrizaje de la misión Apollo 15, un poco más allá del Mons Hadley Delta."},{"page_url":"https://en.wikipedia.org/wiki/Atrioventricular_nodal_branch","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Gray492.png","page_title":"Atrioventricular nodal branch","context_page_description":"The atrioventricular nodal branch is a cardiac artery that is crucial because it feeds the atrioventricular node, necessary for the excitation and contraction of the ventricles. Most frequently it arises as a distal branch from the right coronary artery near the crux of the heart. In some people, the atrioventricular node instead receives blood from the circumflex branch of the left coronary artery, otherwise known as the left circumflex coronary artery or LCX. Very rarely, in approximately 2% of people, the vascular supply to the atrioventricular node arises from both the right coronary artery and the left circumflex branch."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9F%D0%B8%D0%BA%D0%B0%D1%81%D1%81%D0%BE,_%D0%9F%D0%B0%D0%B1%D0%BB%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Juan_Gris_-_Portrait_of_Pablo_Picasso_-_Google_Art_Project.jpg","page_title":"Пикассо, Пабло","context_page_description":"Па́бло Дие́го Хосе́ Франси́ско де Па́ула Хуа́н Непомусе́но Мари́я де лос Реме́диос Сиприа́но де ла Санти́сима Тринида́д Мáртир Патри́сио Руи́с и Пика́ссо — Испанера художник, скульптор, график, керамист, дизайнер."},{"page_url":"https://en.wikipedia.org/wiki/Luohuilinella","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Luohuilinella.png","page_title":"Luohuilinella","context_page_description":"Luohuilinella is an extinct genus of xandarellid artiopodan arthropod known from the Chengjiang biota of China. The type species Luohuilinella rarus was described in 2012. A second species Luohuilinella deletres was described in 2018. Both taxa are rare components of the assemblage. Like other Xandarellids and most artiopodans, it possessed an unmineralised exoskeleton. The type and currently only known specimen of L. rarus is known from a dorsal exoskeleton, around 17 mm long and 9 mm wide which consists of 27 tergites with pronounced pleural spines. L. deletres is much larger, with specimens being over 10 cm long, L. deletres possessed at least 11 pairs of biramous appendages. Both taxa are dorsoventrally flattened, making a benthic or nektobenthic lifestyle probable. Both taxa have pronounced notches in the cephalon to accommodate the stalked eyes."},{"page_url":"https://hr.wikipedia.org/wiki/Petar_I._Bugarski","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Seal_of_Petar_I.png","page_title":"Petar I. Bugarski","context_page_description":"Petar I. bio je car Bugarske, koji je vladao od 27. svibnja 927. do svoje abdikacije, 969. te je i danas slavljen kao svetac u Bugarskoj pravoslavnoj crkvi. Njegovi su roditelji bili car Simeon Veliki i njegova druga supruga, sestra Georgija Sursuvula.\\nKako bi se u očima bugarskih plemića dokazao kao monarh dostojan svog oca, Petar je napao Traciju 927., ali je bio spreman na primirje koje je ponudio bizantski car Roman I. Lakapen. Petar je oženio Romanovu unuku Mariju 8. studenog iste godine, u crkvi svete Marije. Marija, Petrova supruga, dobila je novo ime Irena. Roman je priznao Petra za cara te je Bizantsko Carstvo opet počelo plaćati danak Bugarskom Carstvu.\\nOko 930. godine, protiv Petra se pobunio njegov mlađi brat Ivan, koji je pobijeđen te je poslan u progonstvo. Ubrzo nakon tih događaja, Petrov stariji polubrat, Mihael Bugarski, pobjegao je iz svog samostana te je također digao pobunu protiv Petra, ali je uskoro umro. Najmlađi Petrov brat, Benjamin, bio je optužen da je čarobnjak, no nije predstavljao nikakvu stvarnu opasnost. Oko 933., srpski knez Časlav Klonimirović je uz prešutnu bizantsku pomoć uspio osloboditi Srbiju od bugarske vlasti."},{"page_url":"https://en.wikipedia.org/wiki/Intervales_State_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Cachoeira_da_%C3%81gua_Comprida.JPG","page_title":"Intervales State Park","context_page_description":"The Intervales State Park is a state park in the state of São Paulo, Brazil.\\nIt protects an area of Atlantic Forest, including parts of the Serra de Paranapiacaba and the Ribeira de Iguape and Paranapanema river basins."},{"page_url":"https://fr.wikipedia.org/wiki/Biodiversit%C3%A9_marine_des_lagons_de_La_R%C3%A9union","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Terebra_felina.JPG","page_title":"Biodiversité marine des lagons de La Réunion","context_page_description":"L'île de La Réunion est un département d'outre-mer français situé dans le sud-ouest de l'océan Indien.\\nC'est une île volcanique relativement jeune en forme caractéristique de cône, dont la base se situe directement sur le plancher océanique, ce qui explique son isolement. Sa jeunesse est la cause de la faible surface occupée par les formations coralliennes, âgées de 8 000 ans, se présentant pour la plupart sous la forme de récifs frangeants.\\nCes formations délimitent des « lagons » peu profonds dont le plus grand ne dépasse pas 500 m de large, pour 1 à 2 m de fond environ. Ces lagons, qui forment une ceinture récifale discontinue de 25 km de long pour une surface totale de 12 km², sont situés sur la côte ouest et sud-ouest de l’île.\\nLes plus importants sont ceux de L’Hermitage, St Leu, L'Étang-Salé et St Pierre.\\nMais il existe aussi des plates-formes récifales attenantes à ces lagons ou isolées, de taille plus modeste et dont la barrière est souvent rocailleuse.\\nLes platiers sont étroits et les tombants en arrière des barrières coralliennes plongent rapidement à des profondeurs importantes."},{"page_url":"https://br.wikipedia.org/wiki/William_Shakespeare","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Hw-shakespeare.png","page_title":"William Shakespeare","context_page_description":"Krogit e-barzh!\\nUn danvez pennad eo ar pennad-mañ ha labour zo d'ober c'hoazh a-raok e beurechuiñ.\\nGallout a rit skoazellañ Wikipedia dre glokaat anezhañ.\\nGant ar ger Shakespeare e tegouezher amañ. Evit sterioù all ar ger, gwelit Shakespeare.\\nUn dramaour hag ur barzh eo William Shakespeare, ar skrivagner brudetañ e bed al lennegezh saoznek. E Stratford-upon-Avon eo bet ganet e miz Ebrel 1564 ha badezet d'an 26 a viz Ebrel. Lidet e vez e zeiz-ha-bloaz d'an 23 p'emañ gouel sant Jord, paeron Bro-Saoz. Marvet eo bet d'an 23 a viz Ebrel 1616.Pa oa ar Rouanez Elesbed Iañ o ren e mare e obererezh lennegezh ec'h aparchant oberenn Shakespeare da vare al lennegezh elesbedat. Skrivañ a reas 1 600 sonedenn, met n'eus nemet un ugent pezh-c'hoari ma vezer sur eo Shakespeare an oberour anezho. Tabut a zo bet war peseurt lodenn labour a zo bet sevenet gantañ. P'en deus asantet da embannadurioù 'zo, reoù all a zo bet savet hep e ali ha leun a fazioù int."},{"page_url":"https://pl.wikipedia.org/wiki/Ci%C4%85gnik_artyleryjski","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/MAZUR_D-350_%281%29.jpg","page_title":"Ciągnik artyleryjski","context_page_description":"Ciągnik artyleryjski – pojazd mechaniczny przeznaczony do ciągnięcia dział w artylerii.\\nCiągniki artyleryjskie bywają kołowe lub gąsienicowe. W przeszłości używano również ciągników półgąsienicowych. Oprócz ciągnięcia różnego rodzaju dział, ciągniki artyleryjskie służą także do przewozu amunicji i obsługi działa, ewentualnie do ciągnięcia przyczep z amunicją. Niektóre ciągniki artyleryjskie były opancerzone."},{"page_url":"https://cs.wikipedia.org/wiki/Dn%C4%9Bpersk%C3%A1_kask%C3%A1da","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Chornobaivs%27kyi_district%2C_Cherkas%27ka_oblast%2C_Ukraine_-_panoramio_%2862%29.jpg","page_title":"Dněperská kaskáda","context_page_description":"Dněperská kaskáda je soustava vodních děl na řece Dněpr a je nejvýkonnější hydroenergetickou soustavou Ukrajiny. Celkový instalovaný výkon vodních elektráren je 3 821 MW a je zdrojem více jak 88% vodní energie v zemi."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A1%85%E9%93%9D%E5%B1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Precambrian_Granite_St_Francis_Mountains_Missouri.jpg","page_title":"硅铝层","context_page_description":"硅铝层是地球化学中所指地球的大陆地壳岩石圈，得名于其主要构成化学元素硅与铝。\\n也称硅铝层岩石为长英质，因为其包含很高比例的硅铝长石矿物。\\n硅铝层最初由爱德华·修斯在19世纪提出。已经被岩相、重力测量、地震证据所证实。"},{"page_url":"https://de.wikipedia.org/wiki/St.-Johannis-Kirche_(C%C4%93sis)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/C%C4%93sis_St._John_Church_%282%29.jpg","page_title":"St.-Johannis-Kirche (Cēsis)","context_page_description":"Die St.-Johannis Kirche von Cēsis ist eine evangelisch lutherische Kirche im Stil der Backsteingotik. Bei dem Bauwerk handelt es sich um die bedeutendste mittelalterliche Basilika Lettlands außerhalb Rigas."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Strafford_County,_New_Hampshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Sawyer_Mills.JPG","page_title":"National Register of Historic Places listings in Strafford County, New Hampshire","context_page_description":"This is a list of the National Register of Historic Places listings in Strafford County, New Hampshire.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Strafford County, New Hampshire, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 45 properties and districts listed on the National Register in the county, including one National Historic Landmark.\\nThis National Park Service list is complete through NPS recent listings posted May 3, 2019."},{"page_url":"https://de.wikipedia.org/wiki/Test_f%C3%BCr_Medizinische_Studieng%C3%A4nge","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Emsschlauch.png","page_title":"Test für Medizinische Studiengänge","context_page_description":"Der Test für Medizinische Studiengänge ist ein spezifischer Studierfähigkeitstest bzw. Studieneignungstest für das Studium der Medizin, der im Auftrag der deutschen Kultusministerkonferenz der Länder von Trost et al. unter der Vorgabe entwickelt wurde, Dimensionen der Studieneignung möglichst repräsentativ zu erfassen und in Ergänzung zur Abiturnote ein weiteres verlässliches Zulassungskriterium im Rahmen des Numerus clausus verwenden zu können. Von 1986 bis 1996 und neu seit 2007 befindet er sich in Deutschland im Einsatz."},{"page_url":"https://pl.wikipedia.org/wiki/Authorpe","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Authorpe_Methodist_Church_-_geograph.org.uk_-_233900.jpg","page_title":"Authorpe","context_page_description":"Authorpe – wieś w Anglii, w hrabstwie Lincolnshire. Leży 44 km na wschód od miasta Lincoln i 201 km na północ od Londynu."},{"page_url":"https://de.wikipedia.org/wiki/Pico_31_de_Mar%C3%A7o","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Pico_da_Neblina.jpg","page_title":"Pico 31 de Março","context_page_description":"Der Pico 31 de Março ist mit 2973 Metern der zweithöchste Berg Brasiliens. Er liegt im Massiv des Pico da Neblina, des höchsten brasilianischen Gipfels, von diesem über einen Sattel nur 687 Meter entfernt, im Bergland von Guayana im nordwestlichen Bundesstaat Amazonas unweit der Südgrenze Venezuelas. Die venezolanische Bezeichnung lautet Pico Phelps, als Ehrung des Ornithologen William Henry Phelps, Jr..\\nDer Name des Berges wurde von der Militärexpedition vergeben, die den Gipfel erstmals bestieg. Er leitet sich vom Datum des Militärputsches in Brasilien 1964 ab und wurde auch nach Ende der Militärdiktatur 1985 nicht geändert.\\nBis zu einer Neuvermessung im Jahr 2004 wurde eine Gipfelhöhe von 2992 Metern angenommen."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B8_%D0%BC%D0%B0%D1%80%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/TreciBeogradskiMars-2.jpg","page_title":"Београдски марш","context_page_description":"Београдски марш је манифестација, коју је новембра 2016. године започело удружење Србски Светионик, а подразумева пешачење на релацији Авала - Ново Гробље, у дужини 20 км. Овом манифестацијом жели се указати поштовање према ослободиоцима престолнице Србије у Првом светском рату, када је више хиљада ратника дало свој живот. Ово је само један од сегмената деловања Србског Светионика, као поштовалаца славне историје нашег народа, у години када се обележавају стогодишњице Великог рата."},{"page_url":"https://en.wikipedia.org/wiki/Rizal,_Kalinga","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Remains_of_a_Rhinoceros_philippinensis_found_in_Rizal%2C_Kalinga_dated_c._709%2C000_years_ago.jpg","page_title":"Rizal, Kalinga","context_page_description":"Rizal, officially the Municipality of Rizal is a 4th class municipality in the province of Kalinga, Philippines. According to the 2015 census, it has a population of 17,038 people.\\nThe town is famous for its Pleistocene sites which possesses rhino bones, tools, deer bones, turtle remains, and stegodon bones. The butchered rhino bones were confirmed by international scientific journals as proof of ancient hominids in the Philippines dating back to 709,000 years ago, the oldest hominid evidence in the entire Philippine archipelago. The discovery was confirmed in 2018, and has been a game-changer in Philippine prehistory."},{"page_url":"https://no.wikipedia.org/wiki/Inkognito_terrasse_(Oslo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Inkognito_terrasse_5.jpg","page_title":"Inkognito terrasse (Oslo)","context_page_description":"Inkognito terrasse er en gate bak Slottet i bydel Frogner i Oslo.\\nDenne blindgaten går sørvestover fra Colbjørnsens gate ved Åpent Bakeri, som har adresse nr. 1. Den ender ved nr. 9, der Kristensamfunnet har en ombygd villa og barnehage, og det er gjennomgang til deres kirke i Oscars gate 84.\\nGaten fikk navn før 1887 etter Incognito løkke."},{"page_url":"https://ro.wikipedia.org/wiki/Sint-Michielsgestel","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Sint_Michielsgestel%2C_stadhuis_foto8_2010-04-10_17.13.JPG","page_title":"Sint-Michielsgestel","context_page_description":"Sint-Michielsgestel este o comună și o localitate în provincia Brabantul de Nord, Țările de Jos."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1965","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Joyce_J._Sylvester.JPG","page_title":"Lijst van personen geboren in 1965","context_page_description":"Dit is een lijst van personen die geboren zijn in 1965.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://cy.wikipedia.org/wiki/Tryffl_siocled","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Truffles_with_nuts_and_chocolate_dusting_in_detail.jpg","page_title":"Tryffl siocled","context_page_description":"Gwneir tryffl siocled, yn gyffredinol allan o ganache siocled o emwlsiwn o hufen, siocled a chyflasynnau.\\nHefyd gall tryffl siocled gynnwys caramel, cnau, cnau almon, aeron neu ffrwythau melys eraill, nougat, cyffug, taffi neu fintys, sglodion siocled, malws melys, a gwirod. Maent yn cael eu henwi oherwydd eu tebygrwydd i'r trwffl ffwng."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%8B%90%E8%80%85%E7%95%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/ShunsenKowai.jpg","page_title":"狐者異","context_page_description":"狐者异是江户时代的怪谈集‘绘本百物语’中提到的妖怪。其本体为生前藐视法纪，极尽目中无人之能事，以榨取他人图利一已之人，死后因执念灵魂不散，屡以妖魔之形现身扰乱佛法世法。\\n‘绘本百物语’描绘的狐者异是有着血红大眼，口水长滴不停搜索食物，即使在尸体上的或垃圾箱里的食物也不放过，甚至吞食腐肉的鬼怪。根据插图，狐者异最爱吃乌冬面，妖怪研究家多田克己认为是由于乌龙面比较容易消化的缘故，他同时认为其永远也无法消失的空腹感象征了人类的贪欲。\\n据‘绘本百物语’，“狐者异”的名称是日语中“可怕”这个词的由来。"},{"page_url":"https://nl.wikipedia.org/wiki/Ctenurella","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Ctenurella_gladbachensis_02.jpg","page_title":"Ctenurella","context_page_description":"Ctenurella is een monotypisch geslacht van uitgestorven vissen uit de klasse der Placodermi, die leefden in het Laat-Devoon."},{"page_url":"https://en.wikipedia.org/wiki/The_Boat_Race_1900","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Etherington-Smith_RB_Vanity_Fair_1908-08-05.jpg","page_title":"The Boat Race 1900","context_page_description":"The 57th Boat Race took place on 31 March 1900. Held annually, the Boat Race is a side-by-side rowing race between crews from the Universities of Oxford and Cambridge along the River Thames. Cambridge won by twenty lengths in a record-equalling time of 18 minutes 45 seconds, taking the overall record in the event to 32–24 in Oxford's favour."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Weismain","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Weismain%2C_Am_Markt_8%2C_002.jpg","page_title":"Liste der Baudenkmäler in Weismain","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberfränkischen Stadt Weismain zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 13. September 2014 wieder und enthält 162 Baudenkmäler."},{"page_url":"https://fr.wikipedia.org/wiki/Oscar_Castro","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Theatre-aleph.jpg","page_title":"Oscar Castro","context_page_description":"Oscar Castro Ramirez, né à Santiago du Chili en 1947, est dramaturge, comédien et metteur en scène français d'origine chilienne, directeur du théâtre Aleph."},{"page_url":"https://sv.wikipedia.org/wiki/Holmens_Bruk","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Holmentornet_2012.jpg","page_title":"Holmens Bruk","context_page_description":"Holmens Bruk AB, Norrköping, var ett företag med verksamhet under perioden 1609-1988 som sedan 1800-talet haft pappersproduktion som huvudverksamhet, och vars verksamhet nu ingår i Holmen AB. Genom successiva aktieförvärv blev Mo och Domsjö AB huvudägare och 1988 lade man ett bud på resterande aktier. Holmens Bruk integrerades därefter i Modo, och större delen av Holmens verksamhet hamnade i bolaget Holmen Paper AB. Då Modo sålde finpappertillverkningen år 2000 ändrade koncernen namn till Holmen AB."},{"page_url":"https://hu.wikipedia.org/wiki/BMW","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/2018_BMW_i3S_Range_Extender.jpg","page_title":"BMW","context_page_description":"A BMW autók, motorkerékpárok és motorok német gyártója. A vállalat székhelye Münchenben található. A BMW Csoport a BMW-ből, a Miniből és a Rolls-Royce-ból áll. 2006-ban 48,999 milliárd eurós forgalom mellett 2,874 milliárd eurós nettó nyereséget ért el. A konszern világszerte 106 575 alkalmazottat foglalkoztat. A cég részvényét jegyzik a német tőzsde DAX indexében."},{"page_url":"https://en.wikipedia.org/wiki/2010s_in_science_and_technology","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Cryptocurrency_logos.jpg","page_title":"2010s in science and technology","context_page_description":null},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D1%83_%D0%A5%D0%B8%D0%BB%D1%81_(%D0%90%D0%BB%D0%B1%D0%B5%D1%80%D1%82%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Two_Hills%2C_Alberta_%2828536272794%29.jpg","page_title":"Ту Хилс (Алберта)","context_page_description":"Ту Хилс је малена варошица у централном делу канадске провинције Алберта. Налази се 137 км источно од провинцијске престонице Едмонтона, на обалама реке Вермилијон.\\nНасеље је превасходно пољопривредно оријентисано.\\nПрема попису становништва из 2011. у варошици је живело 1.379 становника у 522 домаћинства, што је за 31,7% више у односу на попис из 2006. када је регистровано 1.047 становника.\\nОснову популације чине становници украјинског порекла, иако је последњих година значајније досељавање немачких менонита из Мексика."},{"page_url":"https://nl.wikipedia.org/wiki/Camondo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/%C3%89douard_Manet_-_Madame_Manet_ou_Piano_-_2.jpg","page_title":"Camondo","context_page_description":"De familie Camondo is een bankiersfamilie die zich in de 19e eeuw vanuit Triëst in Parijs vestigde en bekend werd als kunstverzamelaars en van het Musée Nissim-de-Camondo."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1916","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/RuttenJan_003.jpg","page_title":"Lijst van personen geboren in 1916","context_page_description":"Dit is een lijst van personen die geboren zijn in 1916.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ro.wikipedia.org/wiki/Bad_Blankenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Blankenburger_Tor_Saalfeld.jpg","page_title":"Bad Blankenburg","context_page_description":"Bad Blankenburg este un oraș din landul Turingia, Germania."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AC%E3%82%B7%E3%83%A3%E3%83%B3%E3%83%89%E3%83%AD%E3%83%BB%E3%83%AB%E3%82%A4%E3%82%B9%E3%83%BB%E3%83%95%E3%82%A7%E3%83%AB%E3%83%8A%E3%83%B3%E3%83%87%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Alexandre_Luiz_Fernandes.jpg","page_title":"アレシャンドロ・ルイス・フェルナンデス","context_page_description":"アレー こと、アレシャンドロ・ルイス・フェルナンデスは、ブラジル出身のサッカー選手である。ポジションはミッドフィールダー。"},{"page_url":"https://sv.wikipedia.org/wiki/Mittelberg,_Vorarlberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Mittelberg_77_Haus_Drechsel%2C_B%C3%B6hringer_5.JPG","page_title":"Mittelberg, Vorarlberg","context_page_description":"Mittelberg är ett samhälle i Mittelberg i delstaten Vorarlberg i västra Österrike nära gränsen till Tyskland. 1610 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Linoleum","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Linoleum_003.jpg","page_title":"Linoleum","context_page_description":"Linoleum, commonly abbreviated to lino, is a floor covering made from materials such as solidified linseed oil, pine resin, ground cork dust, sawdust, and mineral fillers such as calcium carbonate, most commonly on a burlap or canvas backing. Pigments are often added to the materials to create the desired colour finish.\\nThe finest linoleum floors, known as \\"inlaid\\", are extremely durable, and are made by joining and inlaying solid pieces of linoleum. Cheaper patterned linoleum comes in different grades or gauges, and are printed with thinner layers which are more prone to wear and tear. High-quality linoleum is flexible and thus can be used in buildings where a more rigid material would crack."},{"page_url":"https://vi.wikipedia.org/wiki/Rius","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Eduardo_del_R%C3%ADo_%28Rius%29.jpg","page_title":"Rius","context_page_description":"Eduardo Humberto del Río García, được biết đến với bút danh Rius, là một trí thức, nhà hoạt họa chính trị và nhà văn người Mexico sinh ra ở Zamora, Michoacán.\\nMột trong những họa sĩ truyện tranh Mexico nổi tiếng nhất, Rius đã viết hơn một trăm cuốn sách vẫn còn phổ biến rộng rãi, đặc biệt là trong số những độc giả Mexico của ông. Rius là một nhà hoạt động chính trị quyết liệt, và quan điểm tiến bộ và cánh tả của ông thường có mặt trong các tác phẩm của ông, kèm theo một sự chỉ trích mạnh mẽ về các học thuyết của Mexico, chính sách của Chính phủ Hoa Kỳ và Giáo hội Công giáo. Ông từng là một người ủng hộ công khai cuộc cách mạng Cuba như ở Cuba cho người mới bắt đầu và là người đồng tình với khối Xô Viết mạnh mẽ cho đến khi kết thúc Chiến tranh Lạnh.\\nTrong những năm 1960, ông bắt đầu hoạt hình trên các tạp chí và báo chí, đôi khi liên quan đến các chủ đề chính trị. Ông đã thực hiện hai truyện tranh nổi tiếng, Los Supermachos và Los agachados, đó là một lời chỉ trích hài hước của chính phủ Mexico. Sau những thành công của mình với những điều này, ông đã tạo ra nhiều cuốn sách, tất cả đều được minh họa và viết bằng tay và bao gồm một loạt các chủ đề về chính trị, ăn chay và tôn giáo."},{"page_url":"https://vi.wikipedia.org/wiki/Macroglossum_vacillans","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Macroglossum_vacillans_1894.jpg","page_title":"Macroglossum vacillans","context_page_description":"Macroglossum vacillans là một loài bướm đêm thuộc họ Sphingidae, chi Macroglossum."},{"page_url":"https://eu.wikipedia.org/wiki/Nieuwpoort","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Nieuwpoort_-_City_hall_2.jpg","page_title":"Nieuwpoort","context_page_description":"Nieuwpoort Belgikako udalerria da, Mendebaldeko Flandrian kokatuta dagoena. Udalerria Nieuwpoort hiriak, Ramskapelle eta Sint-Joris auzoak osatzen dute. Nieuwpoortek 31 km²ko azalera baterako, 2013. urtean 11.368 biztanle zituen.\\nNieuwpoorten, Yser ibaiak isurtzen ditu urak Ipar Itsasora."},{"page_url":"https://id.wikipedia.org/wiki/Sup_kentang","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/SweetpotatoTongsui.jpg","page_title":"Sup kentang","context_page_description":"Sup kentang adalah sebuah hidangan penutup Tionghoa di Tiongkok Selatan dan Hong Kong."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%9F%B3%E9%96%A2%E7%94%BA_(%E5%89%8D%E6%A9%8B%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Maebashi_Technical_High_School.jpg","page_title":"石関町 (前橋市)","context_page_description":"石関町は、群馬県前橋市の地名。郵便番号は371-0006。2013年現在の面積は0.42km²。"},{"page_url":"https://cs.wikipedia.org/wiki/N%C3%A1rodn%C3%AD_parky_ve_Spojen%C3%BDch_st%C3%A1tech_americk%C3%BDch","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Carlsbad_Interior_Formations.jpg","page_title":"Národní parky ve Spojených státech amerických","context_page_description":"Ve Spojených státech amerických se nachází 60 chráněných území klasifikovaných jako národní parky, jež spravuje National Park Service, která je agenturou ministerstva vnitra. Každý z národních parků musí být vyhlášen zákonem přijatým Kongresem. Prvním národním parkem se stal Yellowstonský národní park, který vznikl roku 1872 poté, co prezident Ulysses S. Grant podepsal příslušný zákon. Mezi nejstarší národní parky pak rovněž patří Yosemitský národní park a Národní park Sequoia, vyhlášené roku 1890. V roce 1916 byla zákonem Organic Act zřízena National Park Service. Národní parky obvykle představují rozmanitost přírodních zdrojů na rozsáhlých území. Mnoho z nich bylo před svým vyhlášením chráněno jako Národní památka na základě zákona Antiquities Act. Sedm amerických národních parků je spojeno s Národní chráněnou oblastí, z nichž šest se nachází na Aljašce. Přestože jsou tyto parky a chráněné oblasti spravovány dohromady, jsou považovány za samostatné jednotky a jejich rozloha není zahrnuta do níže uvedené tabulky. Národní památky jsou naopak často vybírány pro svůj historický nebo archeologický význam."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B6%D5%A1%D5%BF%D5%B8%D5%AC%D5%AB_%D5%8E%D5%A1%D5%BD%D5%A5%D6%80%D5%B4%D5%A1%D5%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Anatoly_Wasserman_%282010-09-11%29_2.jpg","page_title":"Անատոլի Վասերման","context_page_description":"Անատոլի Ալեքսանդրովիչ Վասերման, խորհրդային ճարտարագետ, լրագրող, հրապարակախոս, հեռուստահաղորդավար, քաղաքական մեկնաբան, ինտելեկտուալ խաղերի մասնակից և բազմակի հաղթող։"},{"page_url":"https://sv.wikipedia.org/wiki/Eugen_Thorburn","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Lundens_vattentorn.jpg","page_title":"Eugen Thorburn","context_page_description":"Eugen Jacobi Thorburn, född 3 augusti 1860 i Bäve socken i Bohuslän, död 26 augusti 1931 i Göteborg, var en svensk arkitekt, tecknare och kommunpolitiker."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A8%D1%82%D0%B8%D1%82%D0%B0%D1%81%D1%82%D0%B0_%D0%B4%D0%B0%D1%84%D0%B8%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Elaeagnus_umbelata_all.jpg","page_title":"Штитаста дафина","context_page_description":"Штитаста дафина припада истоименој фамилији Elaeagnaceae. Име рода потиче од грчких речи ελατια = маслина и αγνος = конопљика, а име врсте од латинске речи umbella = штит. Отуда и српски назив штитаста дафина, а такође се среће и назив јесења маслина. У Индији, где је аутохтона има много назива rib; ghain, gehain bammerwa, ghain, kenikoli."},{"page_url":"https://fr.wikipedia.org/wiki/Louis_de_Fun%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Dessin_du_chapeau_de_Don_Salluste_dans_%22La_Folie_des_grandeurs%22.png","page_title":"Louis de Funès","context_page_description":"Louis de Funès, de son nom complet Louis de Funès de Galarza, est un acteur français né le 31 juillet 1914 à Courbevoie et mort le 27 janvier 1983 à Nantes.\\nAyant joué dans plus de cent quarante films, il est l'un des acteurs comiques les plus célèbres du cinéma français de la seconde moitié du XXᵉ siècle et réalise les meilleurs résultats du cinéma français, des années 1960 au début des années 1980. Il réalise également les meilleures audiences télévisées. Très peu récompensé, il reçoit toutefois un César d'honneur pour l'ensemble de sa carrière en 1980.\\nAprès presque vingt ans sur les planches ainsi que devant les caméras dans de nombreux seconds rôles, il impose son personnage de Français moyen impulsif, râleur, au franc-parler parfois dévastateur, aux verbigérations et mimiques parfois muettes. C'est dans les années 1950 qu'il se fait connaître tardivement du public avec La Traversée de Paris, ses premiers rôles principaux et le triomphe au théâtre d'Oscar."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B8%D1%87%D0%BE%D0%B2_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%BE_%D0%84%D0%B2%D0%B3%D0%B5%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Sych2010.JPG","page_title":"Сичов Дмитро Євгенович","context_page_description":"Дмитро Євгенович Сичов — російський футболіст, нападник «Волги».\\nНасамперед відомий виступами за «Локомотив», в якому провів більшу частину кар'єри, а також національну збірну Росії."},{"page_url":"https://ca.wikipedia.org/wiki/T%C3%A0lveg_(meteorologia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Trough.jpg","page_title":"Tàlveg (meteorologia)","context_page_description":"En meteorologia, un tàlveg és una regió allargada en la qual la pressió atmosfèrica és relativament baixa. Els tàlvegs solen estar associats amb fronts i es poden trobar a la superfície, a una certa altitud i, de vegades, als dos llocs. En la majoria de casos van acompanyats de núvols, ruixats i variacions sobtades de la direcció del vent, especialment després del pas del tàlveg. Aquest fenomen es produeix com a conseqüència de la convergència que fa ascendir l'aire humit darrere de la línia de tàlveg."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Cipressa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Map_of_comune_of_Cipressa_%28province_of_Imperia%2C_region_Liguria%2C_Italy%29.svg","page_title":"Cipressa","context_page_description":"Cipressa sī Italia Liguria toā-khu Imperia Séng ê chi̍t ê comune."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%9C%E8%A7%92%E5%A4%B4%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Dongjiaotou_Station_Concourse_Painting.jpg","page_title":"东角头站","context_page_description":"东角头站是深圳地铁2号线一个车站。位于中国广东省深圳市南山区蛇口新街与湾厦路十字交叉路口，车站主体跨十字路口设置在蛇口新街地下，呈东西向布置。"},{"page_url":"https://de.wikipedia.org/wiki/Der_Tee_der_drei_alten_Damen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Glauser_3.jpg","page_title":"Der Tee der drei alten Damen","context_page_description":"Der Tee der drei alten Damen ist der erste Kriminalroman des Schweizer Autors Friedrich Glauser und entstand in den Jahren 1931 bis 1934. Er spielt in Genf, wo der Autor auch einen Teil seiner Jugendjahre verbracht hatte. Das Werk kann als das «Sorgenkind» unter Glausers Romanen bezeichnet werden, da er in der Literaturkritik ausnahmslos durchfiel und ihm teilweise auch den Vorwurf des Antisemitismus einbrachte."},{"page_url":"https://es.wikipedia.org/wiki/Cerro_al_Volturno","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Cerro_al_Volturno_014.jpg","page_title":"Cerro al Volturno","context_page_description":"Cerro al Volturno es una localidad y comune italiana de la provincia de Isernia, región de Molise, con 1 429 habitantes."},{"page_url":"https://it.wikipedia.org/wiki/Mari%C3%A1n_Varga","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Marian_Varga_2010-11.jpg","page_title":"Marián Varga","context_page_description":"Marián Varga è stato un compositore e pianista slovacco."},{"page_url":"https://ms.wikipedia.org/wiki/Jakub_B%C5%82aszczykowski","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Jakub_B%C5%82aszczykowski3.jpg","page_title":"Jakub Błaszczykowski","context_page_description":"Jakub \\"Kuba\\" Błaszczykowski merupakan seorang pemain bola sepak Poland yang bermain untuk kelab Wisła Kraków. Beliau menjadi kapten pasukan kebangsaan Poland ketika UEFA Euro 2012."},{"page_url":"https://de.wikipedia.org/wiki/Sozialdemokratische_Partei_Deutschlands","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/2019-07-06_BeachVolleyball_Weltmeisterschaft_Hamburg_2019_StP_0538_LR10_by_Stepro.jpg","page_title":"Sozialdemokratische Partei Deutschlands","context_page_description":"Die Sozialdemokratische Partei Deutschlands ist eine sozialdemokratische Partei in Deutschland.\\nAls erste Vorläufer der Partei gelten der 1863 gegründete Allgemeine Deutsche Arbeiterverein und die 1869 gegründete Sozialdemokratische Arbeiterpartei, die sich 1875 zur Sozialistischen Arbeiterpartei Deutschlands zusammenschlossen. Ihren heutigen Namen gab sich die Partei 1890. Sie gilt als älteste noch bestehende Partei Deutschlands.\\nNach dem Verbot während der NS-Zeit wurde die SPD im Oktober 1945 wiedergegründet. Damals konnte sie sich neben der Union als eine von zwei großen Volksparteien etablieren.\\nBei der Bundestagswahl 2017 erreichte die SPD das schlechteste Ergebnis seit dem Zweiten Weltkrieg. Anschließend beteiligte sie sich an einer Großen Koalition mit den Unionsparteien.\\nParteivorsitzende sind seit dem 6. Dezember 2019 Saskia Esken und Norbert Walter-Borjans.\\nTrotz starker Einbußen seit 1990 ist die SPD mit rund 420.000 Mitgliedern weiterhin vor der CDU die größte Partei in Deutschland. Derzeit ist sie in zehn Ländern an der Regierung beteiligt, in sieben stellt sie den Regierungschef."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D0%B0%D0%B9%D0%BC%D0%B5_II_(%D0%B3%D1%80%D0%B0%D1%84_%D0%A3%D1%80%D1%85%D0%B5%D0%BB%D1%8C%D1%81%D1%8C%D0%BA%D0%B8%D0%B9)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/Sepulcre_modern_del_comte_d%27Urgell_a_la_capella_de_Santa_Maria_del_castell_de_X%C3%A0tiva.JPG","page_title":"Хайме II (граф Урхельський)","context_page_description":"Ха́йме ІІ — останній граф Урхельський. Віконт Ахерський, господар Антільйону, Алколеї і Фраги. Представник Барселонського дому. Народився в Балагері, Арагон. Син урхельського графа Педро ІІ й монферратської маркізи Маргарити. Одружився із арагонською інфантою Ізабелою, донькою арагонського короля Педро IV. Мав у шлюбі 5 дітей, серед яких коїмбрська герцогиня Ізабела. Успадкував Урхельське графство від батька. Внаслідок смерті арагонського престолонаслідника Мартіна і короля став одним із претендентів на престол Арагону. Втратив шанси на корону після компромісу в Каспе, за яким новим арагонським королем став Фернандо І з Трастамарського дому. Очолив політичну опозицію королівства. Під впливом матері та магната Антона де Луни відмовився визнавати Фернандо й підняв поставання. Зазнав поразок у битвах при Кастефроріте й Монтеарагоні. Здався королівським військам під час облоги Балагера. Решту життя провів у тюрмах Теруеля й Хатіви. Помер в ув'язненні. Похований у Хатівській церкві святого Франциска. Також — Я́ків ІІ, Жа́уме ІІ."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A1%E3%83%AB%E3%82%BB%E3%83%87%E3%82%B9%E3%83%BB%E3%83%99%E3%83%B3%E3%83%84%E3%83%BBW116","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Mercedes-Benz_W116_rear_20080424.jpg","page_title":"メルセデス・ベンツ・W116","context_page_description":"メルセデス・ベンツ・W116は、ドイツの自動車メーカーであるダイムラーがメルセデス・ベンツブランドで展開しているSクラスの、初代モデルである。W116はそのコードネーム。1972年から1980年まで製造・販売された。なおロングボディ仕様には別途「V116」というコードネームがあるが、通常はそれも含め「W116」と呼ばれる。"},{"page_url":"https://ceb.wikipedia.org/wiki/Neckera_complanata","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Neckera_complanata_%28d%2C_144725-474809%29_4025.jpg","page_title":"Neckera complanata","context_page_description":"Espesye sa lumot ang Neckera complanata. Una ning gihulagway ni Hübener ni adtong 1833. Ang Neckera complanata sakop sa kahenera nga Neckera sa kabanay nga Neckeraceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://eo.wikipedia.org/wiki/Malajoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Malay_wedding.jpg","page_title":"Malajoj","context_page_description":"Malajoj estas gento de Azio, vivanta en Malajzio, Indonezio, kaj najbaraj landoj. Ilia lingvo estas la malaja lingvo. Temas pri populacio dediĉita tradicie al agrikulturo ĉefe de rizo, sed poste pro industriaj kialoj ankaŭ de kaŭĉuko. Ili estis de religio hindua, sed poste ili estis islamigitaj."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B0%97%E4%BB%99%E6%B2%BC%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Kesennuma_Station-2016.11.06.jpg","page_title":"気仙沼駅","context_page_description":"気仙沼駅は、宮城県気仙沼市古町一丁目にある、東日本旅客鉄道の駅ならびにバス停留所である。\\n鉄道駅としては大船渡線の単独駅かつ終着駅。バス停留所としては気仙沼線BRTと大船渡線BRTが乗り入れている。本稿ではこれらを一括して扱う。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_m%C3%A9moriaux_et_cimeti%C3%A8res_militaires_de_l%27Aisne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Pr%C3%A9mont50.jpg","page_title":"Liste des mémoriaux et cimetières militaires de l'Aisne","context_page_description":"La liste des mémoriaux et cimetières militaires du département de l’Aisne répertorie les cimetières militaires, les mémoriaux ainsi que les stèles, plaques commémoratives et autres monuments qui honorent la mémoire des morts aux combats, des victimes de bombardements ou d’exactions de l'ennemi ainsi que celle de personnels de santé, de chefs militaires ou politiques pendant :\\nla Bataille de Saint-Quentin de 1557 ;\\nla Guerre franco-allemande de 1870 ;\\nla Première Guerre mondiale ;\\nla Seconde Guerre mondiale ;\\nles guerres coloniales.\\nLes lieux sont classés par conflit, par nationalité et par commune."},{"page_url":"https://pt.wikipedia.org/wiki/Michael_Wittmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Bundesarchiv_Bild_146-1987-074-33%2C_Michael_Wittmann_und_Adolf_Hitler.jpg","page_title":"Michael Wittmann","context_page_description":"Michael Wittmann foi um oficial alemão que serviu durante a Segunda Guerra Mundial, condecorado com a Cruz de Cavaleiro da Cruz de Ferro.\\nFoi-lhe creditada a destruição de 138 tanques e 132 armas anti-tanque, juntamente com um número desconhecido de outros veículos blindados, fazendo dele um dos maiores ases panzer da Alemanha, juntamente com Johannes Bölter, Ernst Barkmann, Otto Carius e Kurt Knispel, que foi o maior de todos, com a marca de 168 tanques destruídos.\\nAs circunstâncias por trás da morte Wittmann têm causado algum debate e discussão ao longo dos anos, mas tem sido historicamente aceite que o soldado Joe Ekins, atirador de um Sherman Firefly da 1ª Northamptonshire Yeomanry, como responsável. No entanto, nos últimos anos, alguns comentaristas sugeriram que membros da Regimento canadense Les Fusiliers de Sherbrooke poderiam ter sido os responsáveis por sua morte.\\nUma das façanhas de Wittmann foi uma emboscada aos elementos da British 7 Armoured Division, durante a Batalha de Villers-Bocage em 13 de Junho de 1944. Ao comando de um único tanque Tiger, ele destruiu 14 tanques e 15 transportes de pessoal, juntamente com 2 armas anti-tanque no espaço de 15 minutos."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D0%B9_%D0%9A%D0%B0%D0%BB%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Khali_cropped.jpg","page_title":"Великий Кали","context_page_description":"Далип Сингх Рана известный под именем Великий Кали — индийский рестлер, пауэрлифтер, рестлинг-промоутер, боксер и актер. Обладатель титула Мистер Индия в 1995 и 1996 годах. Получил известность по выступлениям в World Wrestling Entertainment. До прихода в профессиональный рестлинг он был офицером в Панджабской полиции. Великий Кали — один из самых громадных рестлеров за всю историю существования этой индустрии. Кали также считается самым крупным человеком в истории пауэрлифтинга, которым он занимался на протяжении нескольких лет. Наибольшее достижение Сингха в WWE — завоевание титула чемпиона мира в тяжелом весе."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E7%AB%B9%E7%B8%A3%E6%96%87%E5%8C%96%E8%B3%87%E7%94%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/%E9%84%A7%E5%8D%97%E5%85%89%E5%BD%B1%E5%83%8F%E7%B4%80%E5%BF%B5%E9%A4%A8.JPG","page_title":"新竹縣文化資產","context_page_description":"新竹縣文化資產是位於臺灣新竹縣的古蹟與歷史建築，以下的古蹟與歷史建築均收錄在中華民國行政院文化部文化資產局的網站裡。"},{"page_url":"https://ca.wikipedia.org/wiki/Edimburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Scottish_Parliament%2C_from_Salisbury_Crags.jpg","page_title":"Edimburg","context_page_description":"Edimburg és la capital d'Escòcia, i la segona ciutat en població del país després de Glasgow. Ubicada a la costa est d'Escòcia, a la vora del fiord del riu Forth i en l'autoritat unitària local de la ciutat d'Edimburg, és la capital d'Escòcia des del 1437 i seu del govern escocès. Va ser un dels centres més importants d'educació i cultura durant la Il·lustració, gràcies a la Universitat d'Edimburg. Els seus districtes The Old Town i The New Town van ser designats Patrimoni de la Humanitat per la UNESCO el 1995. Segons el cens de l'any 2009, té una població total d'uns 477.660 habitants. Edimburg és famosa pel seu Festival Internacional, el festival d'actuacions en viu més gran del món, i altres festivals desenvolupats a l'estiu de manera més o menys simultània, la majoria dels quals s'agrupen sota la denominació Festival d'Edimburg. Durant el festival, la població de la ciutat es duplica. Edimburg és la segona ciutat més visitada del Regne Unit, després de Londres, amb aproximadament 13 milions de turistes l'any."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Kent_County,_Delaware","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Little_Creek_Methodist_Church.JPG","page_title":"National Register of Historic Places listings in Kent County, Delaware","context_page_description":"List of the National Register of Historic Places listings in Kent County, Delaware\\nThis National Park Service list is complete through NPS recent listings posted May 15, 2020.\\nContents: Divisions in Delaware"},{"page_url":"https://nl.wikipedia.org/wiki/Estadio_El%C3%ADas_Figueroa_Brander","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Chile%2C_Valpara%C3%ADso%2C_Frontis_del_Estadio_El%C3%ADas_Figueroa_Brander.jpg","page_title":"Estadio Elías Figueroa Brander","context_page_description":"Het Estadio Elías Figueroa Brander de Valparaíso is een voetbalstadion in Valparaíso, dat plaats biedt aan 20.575 toeschouwers. De bespeler van het stadion is CD Santiago Wanderers. Het stadion werd geopend in 1931. In 2012 werd het stadion vernoemd naar oud-voetballer Elías Figueroa. In 2015 werd het stadion uitgekozen als een van de negen stadions op de Copa América."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%90%D1%81%D0%B0%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/%D0%90%D1%81%D0%B0%D0%B2%D0%B0._%D0%9F%D0%BB%D1%8F%D0%B1%D0%B0%D0%BD%D1%96%D1%8F_%2801%29.jpg","page_title":"Асава","context_page_description":"Асава́ — вёска ў Вярэнаўскім раёне Гарадзенскай вобласьці. Уваходзіць у склад Пагародзенскага сельсавету.\\nУ 1940—1963 гадах цэнтар Асаўскага сельсавету."},{"page_url":"https://cs.wikipedia.org/wiki/Kolem_%C5%A0v%C3%BDcarska_2006","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Tour_de_Suisse_2006.jpg","page_title":"Kolem Švýcarska 2006","context_page_description":"Tour de Suisse 2006 je 70. závod Tour de Suisse. Probíhal od 10. do 18. června 2006. Závod vyhrál německý cyklista Jan Ullrich, ale v roce 2012 byl za doping odsouzen zpětně na ztrátu svých umístění od roku 2006. Vítězem tedy byl prohlášen druhý v pořadí Španěl Koldo Gil."},{"page_url":"https://de.wikipedia.org/wiki/Todesmarsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Gedenkstein_Todesmarsch_%28Meyenburg%29.JPG","page_title":"Todesmarsch","context_page_description":"Als Todesmarsch werden in der Konflikt- und Gewaltforschung erzwungene Märsche von Personengruppen bezeichnet, bei denen der Tod der Marschierenden billigend in Kauf genommen wird oder sogar das Ziel ist. Dabei kann eine hohe Todesrate durch Gleichgültigkeit der Aufseher gegenüber Überanstrengung und mangelnder Versorgung der Marschierenden mit Verpflegung, Kleidung und Unterkunft oder auch durch gezielte Gewalt gegen die Teilnehmer verursacht werden."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Roch_de_Venise","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/San_Rocco_Venezia_%28Interno%29_-_Cristo_scaccia_i_mercanti_dal_tempio_di_Giovanni_Antonio_Fumiani.jpg","page_title":"Église Saint-Roch de Venise","context_page_description":"L'église Saint-Roch est un édifice religieux catholique de la fin du XVᵉ siècle situé dans le quartier San Polo de Venise en Italie."},{"page_url":"https://es.wikipedia.org/wiki/Historia_de_la_organizaci%C3%B3n_territorial_de_Espa%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Compendiosa_Hispaniae_representatio_die_konigreich_Spanien_und_Portugall_mit_ihren_provincien.jpg","page_title":"Historia de la organización territorial de España","context_page_description":"La historia de la organización territorial de España, como Estado, es un proceso iniciado en el siglo XVI con la unión dinástica de la Corona de Aragón y la Corona de Castilla, la conquista del Reino de Granada y posteriormente el Reino de Navarra. No obstante, es relevante aclarar el origen y los usos que ha tenido el topónimo España, así como cuáles fueron las divisiones territoriales que existieron anteriormente en el actual territorio español."},{"page_url":"https://fr.wikipedia.org/wiki/Sir%C3%A8ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Buen_Retiro_Alfonso_XII_07.jpg","page_title":"Sirène","context_page_description":"Une sirène est une créature légendaire mi-femme mi-poisson, issue du folklore médiéval et scandinave.\\nIl ne faut pas confondre la sirène du folklore nord-européen, traitée dans le présent article, et la sirène de la mythologie grecque, mi-femme mi-oiseau, même si ces deux créatures marines féminines ont en commun l'envoûtement des marins.\\nIl ne s'agit en aucun cas d'une divinité de la mer."},{"page_url":"https://de.wikipedia.org/wiki/Ava_Willing_Astor","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Boldini_-_Ava_Astor.jpg","page_title":"Ava Willing Astor","context_page_description":"Ava Willing Astor war eine US-amerikanische High Society-Lady in der New Yorker Gesellschaft und später ein Mitglied der britischen Aristokratie."},{"page_url":"https://br.wikipedia.org/wiki/Hristo_Botev","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/%D0%9E%D0%BA%D0%BE%D0%BB%D1%87%D0%B8%D1%86%D0%B0%2C_%D0%B2%D1%8A%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D0%B0_%D1%84%D0%BE%D1%82%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D0%B8%D1%8F.jpg","page_title":"Hristo Botev","context_page_description":"Hristo Botev a oa ur barzh bulgar, bet ganet d'ar 6 a viz Genver 1848 e Kalofer ha marvet d'ar 1añ a viz Mezheven 1876 war menez Okoltchitsa. Unan eus harozed Bulgaria eo ivez abalamour dezhañ bezañ stourmet d'ar marv evit e vro er bloavezhioù 1870.\\nE 1863 ez eas d'ul lise ag Odessa e-lec'h ma reas un tañva d'al lennegezh rusianek ha d'ar mennozhioù dispac'hus. E 1867 e rankas kuitaat Kalofer ha mont d'an harlu e Romania. Nav vloavezh e chomas eno, paour-razh, o vont a gêr da gêr: Brăila, Alexandria, Galați... Mont a reas war ar vicher mestr-skol ur pennadig, evel e dad Botyo Petkov. Hogen e Romania an hini e veze bodet an harluidi a oa e soñj da zieubiñ Bulgaria diouzh gwask an Impalaeriezh otoman. Kerkent hag arruet eno e reas Botev anaoudegezh ganto, Vasil Levski en o zouez. Ingal e skrivas pennadoù er c'hazetennoù dispac'hus. Un nebeud anezho a voe embannet gantañ memes: Komzoù an Harluidi Vulgar, An Dihuner, Bulgaria Nevez.... Goude bezañ graet e annez e Bukarest e kemeras perzh e Poellgor Kreiz Dispac'h Bulgaria muioc'h-mui. E 1872 e oa aet da sekretour.\\nGoude marv kriz Vasil Levski, e 1873, e savas daou savboent an eil a-enep egile evit sturiañ ar PKDB."},{"page_url":"https://it.wikipedia.org/wiki/Martes_pennanti","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Fisher-face-snow_-_West_Virginia_-_ForestWander.jpg","page_title":"Martes pennanti","context_page_description":"La martora di Pennant, nota anche come pekan, è un piccolo mammifero carnivoro originario del Nordamerica. Appartiene alla famiglia dei Mustelidi e, sebbene presenti dimensioni maggiori, è strettamente imparentata con la martora americana. È un abitante delle foreste e il suo areale ricopre gran parte della foresta boreale del Canada e degli Stati Uniti settentrionali. I nativi americani la conoscevano come pekan, pequam, wejack o woolang, mentre gli anglosassoni la chiamano fisher o, erroneamente, fisher cat, anche se non è un felino.\\nMaschi e femmine hanno aspetto simile. I maschi adulti misurano 90-120 cm di lunghezza e pesano 3500-6000 g. Le femmine adulte misurano 75-95 cm e pesano 2000-2500 g. La pelliccia della martora di Pennant varia in base alle stagioni, facendosi più folta e lucida in inverno. Durante l'estate, la sua colorazione si fa più variegata, dal momento che l'animale attraversa una fase di muta. La martora di Pennant preferisce cacciare nella fitta foresta. Nonostante sia un'abile arrampicatrice, trascorre gran parte del tempo sul terreno, dove preferisce andare a caccia intorno agli alberi caduti."},{"page_url":"https://en.wikipedia.org/wiki/Buddleja_%27Burncross%27","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Buddelja_davidii_%27Burncross%27.jpg","page_title":"Buddleja 'Burncross'","context_page_description":"Buddleja 'Burncross' is a British hybrid cultivar discovered by Dr Robert Senior at Penzance in 2000 and raised at Moor House in North Yorkshire. Sterile and thus non-invasive, 'Burncross' was patented and introduced to commerce in 2012."},{"page_url":"https://pt.wikipedia.org/wiki/Elei%C3%A7%C3%A3o_suplementar_para_governador_do_Tocantins_em_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/M%C3%A1rio_L%C3%BAcio_Avelar_-_TCMGO.png","page_title":"Eleição suplementar para governador do Tocantins em 2018","context_page_description":"A eleição suplementar para governador do Tocantins em 2018 foi convocada pelo Tribunal Superior Eleitoral mediante o veredicto que cassou a chapa vitoriosa ao governo estadual no pleito de 2014 sob a acusação de abuso. Diante de tal sentença, o presidente da Assembleia Legislativa, Mauro Carlesse, comandou interinamente o executivo estadual até que um novo pleito decidisse quem ocuparia o Governo do Estado. Ao todo sete candidaturas foram registradas para esse fim. Carlesse disputou a eleição e derrotou o senador Vicentinho Alves no segundo turno com mais de 75% dos votos válidos. O mandato de Carlesse irá até o dia 1º de janeiro de 2019, quando assumirá o candidato eleito na eleição de outubro de 2018."},{"page_url":"https://it.wikipedia.org/wiki/Armoriale_delle_famiglie_italiane_(Cor-Coz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Coa_fam_ITA_coratti_khi.jpg","page_title":"Armoriale delle famiglie italiane (Cor-Coz)","context_page_description":"Questo è l'armoriale delle famiglie italiane il cui cognome inizia con le lettere che vanno da Cor a Coz."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%AA%D9%88%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Ptuj_Castle_inside.JPG","page_title":"پتوی","context_page_description":"پتوی در اسلوونی با جمعیت ۲۳٬۲۴۲ نفر است که در lower styria واقع شده‌است."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B5%B7%E4%B8%8A%E8%87%AA%E8%A1%9B%E9%9A%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/JDS_Tsushima_%28MSO-302%29.jpg","page_title":"海上自衛隊","context_page_description":"海上自卫队，简称海自，是日本自卫队的海上部队，成立于1954年7月1日，全体武职人员称“海上自卫官”。由于现行日本国宪法的限制，因此编制上跟武器都是偏重防卫，原则上不配备具侵略性的舰种以及兵种，编制有限的防卫预算并透明化，但是军舰的水准与吨位、装备等仍维持世界主流水准。其主要任务是防卫日本领海，但近年来开始参与联合国维和行动。\\n目前兵力约45500人左右，共拥有各式舰艇152艘，拥有4个八八舰队，主要基地5座。与陆上自卫队不同，海上自卫队则允许沿用第二次世界大战前的军旗，其成员与日本俗称的旧军之间的关系与军纪的传承也较为密切，甚至也保留了礼拜五吃咖喱饭的习惯。"},{"page_url":"https://fr.wikipedia.org/wiki/Maroc","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Banques_ma_2K12.jpg","page_title":"Maroc","context_page_description":"Le Maroc, ou depuis 1957, en forme longue le royaume du Maroc, autrefois l'Empire chérifien, est un État unitaire régionalisé situé en Afrique du Nord. Son régime politique est une monarchie constitutionnelle. Sa capitale est Rabat et sa plus grande ville Casablanca.\\nGéographiquement, il est notamment caractérisé par des zones montagneuses ou désertiques et est l'un des seuls pays — avec l'Espagne et la France — à comporter des rives sur la mer Méditerranée d'un côté et l'océan Atlantique de l'autre. Sa population est de près de 34 millions d'habitants et sa superficie de 446 550 km², ou de 710 850 km² en incluant le Sahara occidental — ex-« Sahara espagnol », considéré comme un territoire non autonome par l'Organisation des Nations unies — dont il administre de facto environ 80 % et qu'il revendique dans sa totalité, tout comme le Front Polisario. Sa culture est berbéro-arabe depuis plusieurs siècles, et s'est étendue principalement au Maghreb et dans le Sud de l'Espagne. Les Marocains sont essentiellement de confession musulmane."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D8%A6%D9%88%D9%86_%D9%BE%D8%A7%D9%86%D9%87%E2%80%8C%D8%AA%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Defense.gov_photo_essay_111004-F-RG147-358.jpg","page_title":"لئون پانه‌تا","context_page_description":"لئون ادوارد پانه‌تا وزیر دفاع پیشین ایالات متحده آمریکا است، وی سوابقی همچون ریاست دفتر رئیس‌جمهور پیشین آمریکا، بیل کلینتون را داراست."},{"page_url":"https://es.wikipedia.org/wiki/Curemonte","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Curemonte_-1.JPG","page_title":"Curemonte","context_page_description":"Curemonte es una comuna y población de Francia, en la región de Lemosín, departamento de Corrèze, en el distrito de Brive-la-Gaillarde y cantón de Meyssac.\\nSu población en el censo de 2008 era de 213 habitantes.\\nEstá integrada en la Communauté de communes des Villages du Midi Corrézien."},{"page_url":"https://uz.wikipedia.org/wiki/Saint-Romain-le-Puy","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Map_commune_FR_insee_code_42285.png","page_title":"Saint-Romain-le-Puy","context_page_description":"Saint-Romain-le-Puy Fransiyaning Rhône-Alpes mintaqasida joylashgan kommunadir. Loire departamenti Montbrison tumani tarkibiga kiradi."},{"page_url":"https://de.wikipedia.org/wiki/Echte_Rose_von_Jericho","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Anastatica_hierochuntica.jpg","page_title":"Echte Rose von Jericho","context_page_description":"Die Echte Rose von Jericho, auch Wüstenrose, Jerichorose, Jerusalemrose oder Marienrose genannt, ist die einzige Pflanzenart der Gattung Anastatica in der Familie der Kreuzblütengewächse. Sie ist in den Wüstengebieten von Israel, Jordanien, auf dem Sinai und Teilen Nordafrikas beheimatet."},{"page_url":"https://az.wikipedia.org/wiki/Moravi%C3%A7_dair%C9%99si","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/%D0%A1%D0%B5%D1%80%D0%B1%D0%B8%D1%8F_%D0%9C%D0%BE%D1%80%D0%B0%D0%B2%D0%B8%D1%87%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D0%BA%D1%80%D1%83%D0%B3.png","page_title":"Moraviç dairəsi","context_page_description":"Moraviç dairəsi — Serbiyanın qərb hissəsində yerləşən dairə. Dairənin inzibati mərkəzi Çaçak şəhəridir."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%A7%D8%B4%DA%AF%D8%A7%D9%87_%D9%81%D9%88%D8%AA%D8%A8%D8%A7%D9%84_%D9%85%D9%86%DA%86%D8%B3%D8%AA%D8%B1_%DB%8C%D9%88%D9%86%D8%A7%DB%8C%D8%AA%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Ryan_Giggs_vs_Everton-5_cropped.jpg","page_title":"باشگاه فوتبال منچستر یونایتد","context_page_description":"باشگاه فوتبال منچستر یونایتد یکی از باشگاه‌های حرفه‌ای فوتبال در لیگ برتر فوتبال انگلستان است. این باشگاه در سال ۱۸۷۸، با نام باشگاه فوتبال نیوتون هیث تأسیس شد. در سال ۱۹۰۲، نام این باشگاه به منچستر یونایتد تغییر یافت و در سال ۱۹۱۰، ورزشگاه الدترافورد به عنوان ورزشگاه خانگی این تیم انتخاب شد.\\nدر سال ۱۹۶۸، منچستریونایتد با سرمربیگری مت بازبی به عنوان اولین تیم انگلیسی در لیگ قهرمانان اروپا به قهرمانی رسید. این اتفاق ۱۰ سال پس از حادثه مونیخ رخ داد. در این حادثه ۸ تن از بازیکنان تیم فوتبال منچستریونایتد جان خود را از دست دادند. سر الکس فرگوسن که از نوامبر ۱۹۸۶ تا مهٔ ۲۰۱۳ سرمربیگری این تیم را بر عهده داشت، توانست ۳۸ جام مختلف برای باشگاه به دست آورد.\\nمنچستر یونایتد با داشتن ۲۰ عنوان قهرمانی در لیگ برتر، ۵ قهرمانی در جام اتحادیه، ۱۲ قهرمانی در جام حذفی، ۲۱ قهرمانی در سوپر جام انگلستان، ۱ قهرمانی در لیگ اروپا و هم‌چنین سه عنوان قهرمانی در لیگ قهرمانان اروپا یکی از پرافتخارترین باشگاه‌های فوتبال جهان به‌شمار می‌آید. آن‌ها تنها تیم انگلیسی هستند که توانستند در فصل ۹۹–۱۹۹۸ هر سه جام لیگ برتر، جام حذفی و لیگ قهرمانان اروپا را به دست آورند. در فصل ۱۷–۲۰۱۶، با قهرمانی در لیگ اروپا، آن‌ها جزو پنج تیمی در اروپا شدند که در تمامی رقابت‌های یوفا به مقام قهرمانی رسیده‌است."},{"page_url":"https://zh.wikipedia.org/zh-mo/2010%E5%B9%B4%E9%A3%93%E9%A3%8E%E5%8E%84%E5%B0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Earl_2010_track.png","page_title":"2010年飓风厄尔","context_page_description":"颶風厄爾是1991年的颶風鮑勃之後首場威脅新英格蘭的大型颶風，也是2010年大西洋颶風季形成的第5場獲得命名的風暴，第3場颶風和第2場大型颶風。系統源於2010年8月25日維德角群島以西的東風波，起初基本朝正西方向移動，僅成形數小時後就達到熱帶風暴標準。在風速每小時85公里強度下保持了近兩天後，厄爾在逼近小安的列斯群島後開始增強，於8月29日達到颶風標準，再於8月30日晚以大型颶風強度掠過背風群島。受中等強度西南向風切變影響，氣旋轉向西北並逐漸減弱，但到9月1日時又已恢復強化趨勢。經過重新組織，風暴達到風力時速230公里的最高強度。"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A2%B1%E9%A2%A8%E9%AF%A8%E9%AD%9A_(2009%E5%B9%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/STS_Kujira_3_May_2009.jpg","page_title":"颱風鯨魚 (2009年)","context_page_description":"中度颱風柯吉拉是2009年太平洋颱風季的一個熱帶氣旋。\\n柯吉拉此名稱是由日本提供，意思指鯨魚星座。"},{"page_url":"https://en.wikipedia.org/wiki/Craig_J._Nevius","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Farrah_Fawcett_%26_Craig_Nevius.jpg","page_title":"Craig J. Nevius","context_page_description":"Craig J. Nevius is an American playwright, screenwriter and film producer. He is the owner of Windmill Entertainment LLC, a television development and production company that specializes in both scripted and unscripted projects with pop culture appeal."},{"page_url":"https://es.wikipedia.org/wiki/Gino_Marinuzzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Gino_Marinuzzi_circa_1920.jpg","page_title":"Gino Marinuzzi","context_page_description":"Gino Marinuzzi fue un director de orquesta y compositor italiano, particularmente asociado con las óperas de Wagner y el repertorio italiano."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D1%83%D1%81_%D0%B0%D1%88-%D2%BB%D1%8B%D1%83%D1%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/Salo_with_pepper_closeup.jpg","page_title":"Белорус аш-һыуы","context_page_description":"Белорус аш-һыуы— Белорусияның милли аш-һыуы. Картуфтан әҙерләнгән блюдоларҙың киң таралыуы һәм төрлө колбаса, ярма, бәшмәк, сусҡа ите ҡулланыу был кухняның үҙенсәлекле яғы."},{"page_url":"https://cs.wikipedia.org/wiki/Arvernov%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Gaul%2C_1st_century_BC.gif","page_title":"Arvernové","context_page_description":"Arvernové byl keltský kmen obývající území Galie v oblasti kolem dnešního Lyonu. Jejich jméno dalo název francouzské oblasti a departementu Auvergne.\\nArvernové byli významným kmenem, jehož sídla se nacházela ve střední Francii. Jejich nejdůležitější pevností byla Gergovie, kde se v bitvě u Gergovie utkali římské legie Julia Caesara s avernským vůdcem Vercingetorikem. V průběhu 3. a 2. století př. n. l. se za vlády krále Luerniose stali nejmocnějším kmenem v Galii. Když však byl jeho syn Bituitus v roce 123 př. n. l. poražen Římany a v jižní Galii byla zřízena římská Provincia, jejich moc přešla na kmeny Aeduů a Sequanů.\\nNejslavnějších osobnost v dějinách Keltů byl arvenský vůdce Vercingetorix, který vedl poslední významné povstání namířené proti římské okupaci Galie, ale v roce 52 př. n. l. byl poražen Gaiem Juliem Caesarem během obléhání Alesie."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9E%E1%83%90%E1%83%91%E1%83%9A%E1%83%9D_%E1%83%9E%E1%83%98%E1%83%99%E1%83%90%E1%83%A1%E1%83%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Pablo_picasso_1.jpg","page_title":"პაბლო პიკასო","context_page_description":"პაბლო რუის ი პიკასო — ესპანელი მხატვარი და სკულპტორი. მე-20 საუკუნის ხელოვნების ერთ-ერთი ყველაზე ცნობილი ფიგურა, ჟორჟ ბრაკთან ერთად კუბიზმის დამფუძნებელი."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AF%E3%83%BC%E3%83%AB%E3%83%89%E3%83%BB%E3%83%A1%E3%82%A4%E3%83%A4%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Edi_Rama.jpg","page_title":"ワールド・メイヤー","context_page_description":"ワールド・メイヤーは、2004年からシティ・メイヤーズ・ファウンデーションが主催している賞である。日本語では世界の市長、世界最高市長、世界市長賞などと訳される。国際的に「市長」の認知度を高めるため、また国内的・国際的な都市の幸福に貢献した市長を称えるために開催されている。シティ・メイヤーズ・ファウンデーションはいかなる都市や組織とも関係を持たず、商業目的を持たない。受賞資格者は現職の市長のみである。"},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_svat%C3%A9ho_Petra_a_Pavla_(P%C5%99el%C3%ADc)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Church_of_Saints_Peter_and_Paul_in_P%C5%99el%C3%ADc_%282431%29.jpg","page_title":"Kostel svatého Petra a Pavla (Přelíc)","context_page_description":"Kostel svatého Petra a Pavla v Přelíci je bývalým farním kostelem v obci Přelíc. Areál kostela leží na pozemcích parcelní číslo st 1, st 2 a 1/1 v katastrálním území Přelíc. Památkami jsou zde vlastní kostel, barokní zvonice, ohradní zeď s brankou a náhrobek mlynáře Červeného. Celý areál je chráněnou kulturní památkou České republiky."},{"page_url":"https://en.wikipedia.org/wiki/Mesoscale_meteorology","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Windstorm_Thomas.jpg","page_title":"Mesoscale meteorology","context_page_description":"Mesoscale meteorology is the study of weather systems smaller than synoptic scale systems but larger than microscale and storm-scale cumulus systems. Horizontal dimensions generally range from around 5 kilometers to several hundred kilometers. Examples of mesoscale weather systems are sea breezes, squall lines, and mesoscale convective complexes.\\nVertical velocity often equals or exceeds horizontal velocities in mesoscale meteorological systems due to nonhydrostatic processes such as buoyant acceleration of a rising thermal or acceleration through a narrow mountain pass."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Bergwerken_im_Lahn-Dill-Gebiet","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Georgstollen_Ehringshausen.jpg","page_title":"Liste von Bergwerken im Lahn-Dill-Gebiet","context_page_description":"Die Liste von Bergwerken im Lahn-Dill-Gebiet umfasst, da zum heutigen Zeitpunkt kein aktiver Bergbau stattfindet nur stillgelegte Bergwerke, unterteilt in die jeweiligen, heutigen Bundesländer, Kreise sowie die dortigen Städte und Gemeinden bzw. Verbandsgemeinden."},{"page_url":"https://en.wikipedia.org/wiki/Astrid_Aagesen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Tycho_brahe_well_helsingborg_skane_sweden.jpg","page_title":"Astrid Aagesen","context_page_description":"Astrid Marie-Frederike Aagesen was a Danish-Swedish designer who crafted objects in pewter and silver. From 1919 she lived in Helsingborg where she created the globe for the city's monument to Tycho Brahe."},{"page_url":"https://eu.wikipedia.org/wiki/Katharine_Tynan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Tynan1.jpg","page_title":"Katharine Tynan","context_page_description":"Katharine Tynan poeta eta idazle irlandarra izan zen. Bere lanak katolizismoaren eta irlandar abertzaletasunaren eraginak islatzen ditu."},{"page_url":"https://fr.wikipedia.org/wiki/Giudecca","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Giudecca-pjt.jpg","page_title":"Giudecca","context_page_description":"La Giudecca est une des îles de la lagune de Venise, la plus grande, immédiatement au sud des îles centrales, dont elle est séparée par le canal de la Giudecca.\\nElle dépend administrativement du sestiere de Dorsoduro.\\nL'île de San Giorgio Maggiore, dont elle est séparée par le canal de la Grâce, se situe en face de son extrémité est."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B5%D0%BF%D0%BA%D0%BE%D0%B5_(%D0%91%D0%B0%D1%85%D1%87%D0%B8%D1%81%D0%B0%D1%80%D0%B0%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Cherkez-Kermen.jpg","page_title":"Крепкое (Бахчисарайский район)","context_page_description":"Кре́пкое — исчезнувшее село в Бахчисарайском районе Республики Крым, находилось на юго-западе района, у самой границы с Балаклавским районом Севастополя. В административном отношении территория, на которой было расположено село, относится к Красномакскому сельсовету."},{"page_url":"https://hu.wikipedia.org/wiki/Dexys_Midnight_Runners","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Dexys2012.jpg","page_title":"Dexys Midnight Runners","context_page_description":"A Dexys Midnight Runners egy angol popegyüttes Birminghamből. Az együttest 1978-ban alapították. Legnagyobb sikert hozó albumaik az 1980-ban megjelent Searching for the Young Soul Rebels, az 1982-ben megjelent Too-Rye-Ay és az 1985-ös Don't Stand Me Down, amelyek szerepelnek az 1001 lemez, amit hallanod kell, mielőtt meghalsz című könyvben."},{"page_url":"https://eu.wikipedia.org/wiki/Synchiropus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Paradiplogrammus_corallinus.jpg","page_title":"Synchiropus","context_page_description":"Synchiropus eiherazainen familiako arrain pertziformeen generoa da, mendebaldeko Indo-Pazifiko eskualdean bizi dena."},{"page_url":"https://es.wikipedia.org/wiki/Neu_Kali%C3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Neu_Kaliss_Kirche_2008-05-05.jpg","page_title":"Neu Kaliß","context_page_description":"Neu Kaliß es un municipio situado en el distrito de Ludwigslust-Parchim, en el estado federado de Mecklemburgo-Pomerania Occidental, a una altura de 16 metros. Su población a finales de 2016 era de 1968 habs. y su densidad poblacional, 58 hab/km².​\\nSe encuentra sobre la orilla norte del río Elba que lo separa del estado de Baja Sajonia."},{"page_url":"https://eu.wikipedia.org/wiki/Uni%C3%B3n_de_Tula_(udalerria)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Uni%C3%B3n_de_Tula.png","page_title":"Unión de Tula (udalerria)","context_page_description":"Unión de Tula Mexikoko udalerri bat da. Jalisco estatuan kokatua dago. 2010ean 13.737 biztanle zituen 443,61 km²ko azaleran. Herriburua Unión de Tula da."},{"page_url":"https://en.wikipedia.org/wiki/Hudswell_Clarke","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Lord_Mayor_Hudswell_Clarke_402.1893_Ingrow_KWVR_08.10.2016.jpg","page_title":"Hudswell Clarke","context_page_description":"Hudswell, Clarke and Company Limited was an engineering and locomotive building company in Jack Lane, Hunslet, Leeds, West Yorkshire, England."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1992","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Lake_Placid_2007_Eva_Lim.jpg","page_title":"Lijst van personen geboren in 1992","context_page_description":"Dit is een lijst van personen die geboren zijn in 1992.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_der_Altstadt_(Mei%C3%9Fen)_(J%E2%80%93Z)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Neugasse_49_Mei%C3%9Fen.JPG","page_title":"Liste der Kulturdenkmale in der Altstadt (Meißen) (J–Z)","context_page_description":"In der Liste der Kulturdenkmale in der Altstadt sind sämtliche Kulturdenkmale der historischen Meißner Altstadt verzeichnet, die vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Sie liegen westlich der Altstadt der Kreisstadt Meißen am linken Ufer der Elbe im Landkreis Meißen. Die denkmalgeschützten Objekte wurden in der Denkmalliste vom Landesamt für Denkmalpflege Sachsen mit Stand von 2017 erfasst. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Meißen.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen.\\nAufgrund der hohen Anzahl der Kulturdenkmale wurde die alphabetisch nach Adressen geordnete Liste in folgende zwei Teillisten untergliedert:\\nListe der Kulturdenkmale in der Altstadt (Meißen)\\nListe der Kulturdenkmale in der Altstadt (Meißen) (J–Z)\\nDiese Teilliste enthält alle Kulturdenkmale in den Straßen von J–Z."},{"page_url":"https://fr.wikipedia.org/wiki/Autodrome_de_Linas-Montlh%C3%A9ry","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/DSC05075-US_Motor_Show_2018.jpg","page_title":"Autodrome de Linas-Montlhéry","context_page_description":"L'autodrome de Linas-Montlhéry est un circuit ayant accueilli des courses automobiles, motocyclistes et cyclistes, situé dans l'Essonne. Construit en 1924 par l'architecte Raymond Jamin, sous l'impulsion de l'industriel Alexandre Lamblin, il a reçu le label « Patrimoine du xxᵉ siècle ». Il appartient depuis 1973 à l'Utac Ceram, propriétaire aussi du Circuit de Mortefontaine dans l'Oise."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%B0%D1%81%D0%B5%D0%BD%D1%81%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Vista_Peracense.jpg","page_title":"Перасенсе","context_page_description":"Перасенсе — муниципалитет в Испании, входит в провинцию Теруэль, в составе автономного сообщества Арагон. Муниципалитет находится в составе района Хилока. Занимает площадь 28.70 км². Население — 89 человек."},{"page_url":"https://en.wikipedia.org/wiki/List_of_cities_in_Ukraine","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/%D0%96%D0%B8%D1%82%D0%BE%D0%BC%D0%B8%D1%80%2C_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D1%83%D0%BB%D0%B8%D1%86%D0%B0.jpg","page_title":"List of cities in Ukraine","context_page_description":"This is a complete list of cities in Ukraine. On 1 January 2010 there were 459 cities in Ukraine. City status is granted on the decision of the Ukrainian parliament. The city status is only partially related to the size of a populated place in Ukraine.\\nThere are three categories of cities that depends on status of those cities in the country and in the table below are indicated by a respective letter as a city status. All cities have some level of significance. Any settlement that obtains city status becomes a city of district subordinance. The cities of regional significance can either be of oblast subordinance or republican subordinance. The cities of national significance are officially known as the cities with special status. The significance of a city does not relate to whether the city is an administrative center and such industrial cities like Kryvyi Rih, Mariupol, Makiivka, Horlivka, Kamianske and others have the same level of significance as the regional administrative centers.\\nBelow is the list of all cities estimated by population in 2019 and compared to the 2001 Ukrainian Census, except for Chernobyl which population is an unofficial estimate."},{"page_url":"https://fr.wikipedia.org/wiki/Alexandre_Jean_Cuza","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Alexandru_Ioan_Cuza_-_Photo_by_Carol_Popp_de_Szathm%C3%A1ry.jpg","page_title":"Alexandre Jean Cuza","context_page_description":"Alexandre Jean Cuza, né le 1ᵉʳ avril 1820 à Bârlad en Moldavie et mort le 15 mai 1873 à Heidelberg, est l'une des figures majeures de la renaissance culturelle roumaine, devenu officier, homme d'État et souverain des Principautés unies de Moldavie et de Valachie entre 1859 et 1866."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D9%81%D8%A7%D8%B1%D9%87_%D8%B3%D9%88%D9%8A%D8%B3%D8%B1%D8%A7_%D9%81%D9%89_%D8%AC%D9%8A%D9%88%D8%B1%D8%AC%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Ex-Russian_embassy_in_Georgia_2008.jpg","page_title":"سفاره سويسرا فى جيورجيا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nسفاره سويسرا فى جيورجيا و هى بعثه دبلوماسيه بتهدف لتعزيز مصالح سويسرا فى جيورجيا, و مقرها فى تبليسى."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AE%AE%E0%AE%A3%E0%AE%AA%E0%AF%8D_%E0%AE%AA%E0%AF%81%E0%AE%A9%E0%AE%BF%E0%AE%A4%E0%AE%A4%E0%AF%8D_%E0%AE%A4%E0%AE%B2%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%B3%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/P%C4%81r%C5%9Bvan%C4%81th_AS_IS.jpg","page_title":"சமணப் புனிதத் தலங்கள்","context_page_description":"சமணப் புனிதத் தலங்கள், இந்தியாவில் இராஜஸ்தான், குஜராத், உத்தரப் பிரதேசம், தமிழ்நாடு, கர்நாடகா, மகாராட்டிரா, மத்தியப் பிரதேசம், ஒடிசா போன்ற மாநிலங்களில் சமணக் கோயில்களும், குடைவரைகளும், படுகைகள் போன்ற நினைவுச் சின்னங்களும் உள்ளது. அவைகள்:"},{"page_url":"https://es.wikipedia.org/wiki/Stadtsteinach","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Stadtsteinach_in_KU.svg","page_title":"Stadtsteinach","context_page_description":"Stadtsteinach es una ciudad situada en el distrito de Kulmbach, en el estado federado de Baviera, con una población a finales de 2016 de unos 3139 habitantes.​\\nSe encuentra ubicada al norte del estado, en la región de Alta Franconia, cerca de la frontera con el estado de Turingia, y de la confluencia de los ríos Meno Rojo y Meno Blanco que dan lugar al río Meno —uno de los principales afluentes del Rin—."},{"page_url":"https://fr.wikipedia.org/wiki/F%C3%A9lix-Auguste_B%C3%A9guinot","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Mgr_B%C3%A9guinot_par_Louis_Emile_Pinel_de_Grandchamp%2Cvers1900.jpg","page_title":"Félix-Auguste Béguinot","context_page_description":"Félix-Auguste Béguinot, né le 11 juillet 1836 à Bannay dans le Cher et mort le 3 février 1921 à Nîmes, est un prélat français des XIXᵉ siècle et XXᵉ siècle, évêque de Nîmes de 1896 à 1921."},{"page_url":"https://en.wikipedia.org/wiki/I-10_Twin_Span_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Newtwinspan.JPG","page_title":"I-10 Twin Span Bridge","context_page_description":"The I-10 Twin Span Bridge, a nearly 6 mile causeway officially known as the Frank Davis \\"Naturally N'Awlins\\" Memorial Bridge, consists of two parallel trestle bridges. These parallel bridges cross the eastern end of Lake Pontchartrain in southern Louisiana from New Orleans to Slidell. The current bridge spans were constructed in the second half of the 2000s after the original bridges were extensively damaged by Hurricane Katrina on August 29, 2005. The first span opened to eastbound traffic on July 9, 2009. On April 7, 2010, the second span was opened to traffic and the old twin spans were permanently closed to traffic.\\nThe approaches to the westbound lanes were completed with a ribbon-cutting ceremony on September 8, 2011, and the opening of all six lanes the next morning. The original Twin Span bridges were demolished shortly after the replacement spans opened. A short portion remains in use as a public fishing pier in Slidell. The debris from the demolition was used to line the nearby lake bottom as an underwater reef."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Bensheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Bensheim_Darmstaedter_Strasse_74_01.jpg","page_title":"Liste der Kulturdenkmäler in Bensheim","context_page_description":"In der Liste der Kulturdenkmäler in Bensheim sind Baudenkmäler der hessischen Stadt Bensheim und ihrer Stadtteile aufgeführt. Grundlage der Liste ist die Veröffentlichung des Landesamtes für Denkmalpflege in Hessen.\\nDie Stadt Bensheim hat zusammen mit allen Stadtteilen 557 Kulturdenkmäler, die unter Denkmalschutz stehen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AB%E3%82%AF%EF%BC%9D%E3%83%AD%E3%82%A4%E3%83%A9%E3%83%B3%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Burg-Reuland_JPG09.jpg","page_title":"ブルク＝ロイラント","context_page_description":"ブルク＝ロイラントは、ベルギーのリエージュ州、またドイツ語共同体に属する基礎自治体である。面積は108.96 km²で、2006年1月1日時点での人口は3,903人、人口密度は36人/km²である。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%EB%A0%88%EB%84%A4_%ED%8C%8C%ED%8C%8C%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Irene_Papas_1956.jpg","page_title":"이레네 파파스","context_page_description":"이레네 파파스는 그리스의 배우, 가수이다. 영화 《나바론의 요새》와 영화 《그리스인 조르바》를 통해 전 세계적으로 이름을 알렸다. 위 작품들 외에도 영화 《트로이의 여인들》, 《이피게니아》, 《안티고네》를 통해 존재력을 과시한 그리스의 대배우 중 한 명이다."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%B7%A1%E6%B0%B4%E8%A1%97%E9%95%B7%E5%A4%9A%E7%94%B0%E6%A6%AE%E5%90%89%E6%95%85%E5%B1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/2019_Tamsui_TaDa_Eikichi_House_interior.jpg","page_title":"淡水街長多田榮吉故居","context_page_description":"淡水街长多田荣吉故居又可称多田荣吉故居是一个在台日本式建筑。始建于1937年。原先为日治时期的淡水街长多田荣吉的住居。原预定2014年能完成整修并且开放参观，但因种种因素而延滞，最后于2016年7月18日开放参观。其也是全台第一间接续自来水管线的民宅。"},{"page_url":"https://en.wikipedia.org/wiki/2010_United_States_Senate_elections","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Mike_Crapo_Official_Photo_110th_Congress.jpg","page_title":"2010 United States Senate elections","context_page_description":"The 2010 United States Senate elections were held on November 2, 2010, from among the United States Senate's 100 seats. A special election was held January 19, 2010 for a mid-term vacancy in Massachusetts. Thirty-four of the November elections were for six-year terms to the Senate's Class 3, while other three were special elections to finish incomplete terms. Those 37 November elections featured 19 incumbent Democrats and 18 incumbent Republicans.\\nAfter the previous elections, the Senate was composed of 58 Democrats, 40 Republicans, and 2 independents who caucused with the Democrats.\\nRepublicans won four seats held by retiring Democrats and Republicans defeated two incumbent Democrats, for a Republican net gain of six seats. This was the first time since the 1994 elections that Republicans successfully defended all of their own seats. This was the fourth consecutive election of Class 3 senators where Democrats failed to gain seats and the third consecutive midterm election held in a president's first term where Republicans picked up seats."},{"page_url":"https://pt.wikipedia.org/wiki/Pa%C3%ADses_Baixos_no_Festival_Eurovis%C3%A3o_da_Can%C3%A7%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/ESC2014_-_the_Netherlands_02.jpg","page_title":"Países Baixos no Festival Eurovisão da Canção","context_page_description":"Os Países Baixos são um dos países participantes do Festival Eurovisão da Canção, sendo um dos sete países que competiram no primeiro Festival Eurovisão da Canção de 1956. A decorrer desde então, o país só não participou de quatro competições.\\nAo longo dos anos, os Países Baixos têm tido sucesso variado no Festival Eurovisão da Canção. Venceram por quatro vezes o festival. Sua primeira vitória ocorreu em 1957, com a canção \\"Net als toen\\" de Corry Brokken. Dois anos depois, em 1959, o país venceu novamente com \\"Een beetje\\" de Teddy Scholten. Em 1969, os Países Baixos obtiveram a vitória graças à canção \\"De troubadour\\" de Lenny Kuhr, apesar desta vitória ter sido compartilhada com outros três países. A última vitória neerlandesa remonta a 1975, quando o grupo Teach-In triunfou com \\"Ding-a-dong\\".\\nOs Países Baixos terminaram por duas vezes em último lugar com zero pontos. Em 1962, com De Spelbrekers e em 1963 com Annie Palmen."},{"page_url":"https://de.wikipedia.org/wiki/Wendelin","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Dittingen-coat_of_arms.svg","page_title":"Wendelin","context_page_description":"Wendelin ist ein katholischer Heiliger. Der Legende nach soll er im 6. Jahrhundert im Bistum Trier missionierend tätig gewesen sein. Das Grab Wendelins befindet sich in der Wendalinusbasilika in der nach ihm benannten Stadt St. Wendel."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%9B%E1%80%BD%E1%80%BE%E1%80%B1%E1%80%9E%E1%80%AC%E1%80%9C%E1%80%BB%E1%80%B1%E1%80%AC%E1%80%84%E1%80%BA%E1%80%B8_%E1%80%9B%E1%80%AF%E1%80%95%E1%80%BA%E1%80%95%E1%80%BD%E1%80%AC%E1%80%B8%E1%80%90%E1%80%B1%E1%80%AC%E1%80%BA%E1%80%80%E1%80%BC%E1%80%AE%E1%80%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Bago-Shwethalyaung_Buddha.JPG","page_title":"ရွှေသာလျောင်း ရုပ်ပွားတော်ကြီး","context_page_description":"ရွှေသာလျောင်းရုပ်ပွားတော်ကြီး သည် ပဲခူးမြို့ အနောက်ဘက်တွင် တည်ရှိသော လျောင်းတော်မူ ရုပ်ပွားတော်ကြီးဖြစ်သည်။ ထိုဘုရားကြီး ထားဝယ်မြို့ရှိ လျောင်းတော်မူဘုရားကြီးပြီးလျှင် ကမ္ဘာပေါ်ရှိ ဒုတိယအကြီးဆုံး လျောင်းတော်မူ ဘုရားဖြစ်ပြီး အလျားအားဖြင့် ၅၅ မီတာနှင့် အမြင့် ၁၆ မီတာ ရှိသည်။ ထိုဘုရားကြီးကို မွန်ဘုရင် မဂ္ဂဒီပ က သက္ကရာဇ် ၉၉၄ ခုနှစ်တွင် တည်ထားခဲ့သည်ဟု ယုံကြည်ရသည်။ ၁၇၅၇ ခုနှစ်တွင် အင်္ဂလိပ်တို့က ပဲခူးမြို့အား ကိုလိုနီအဖြစ်သွတ်သွင်းပြီးနောက် ဘုရားကြီးမှာ ပျောက်ဆုံးနေခဲ့ရသည်။ ၁၈၈၀ ခုနှစ်တွင် ၎င်းအနီးတစ်ဝိုက်အား ရထားလမ်းဖောက်လုပ်ရန် တူးဖော်ခဲ့စဉ် ခြုံနွယ်မြက်ရိုင်းများအောက်မှ ပြန်လည်ရှာဖွေတွေ့ရှိခဲ့ရသည်။ ၁၈၈၁ ခုနှစ်တွင် ပြန်လည်ပြုပြင်မွမ်းမံရေးများ စတင်ခဲ့ပြီး ဘုရားခေါင်းအုံးတော်အား ထပ်မံတည်ဆောက်ခဲ့ပြီး ရုပ်ပွားတော်အပေါ်မှ သွပ်မိုး၊ အကာများ ဆောက်လုပ်ခဲ့ရာ ၁၉၃၀ ခုနှစ်တွင် ပြီးစီးခဲ့သည်။ ထိုပြုပြင်ရေးအတွက် အများပြည်သူများက အလှူငွေများ ထည့်ဝင်လှူဒါန်းခဲ့ကြသည်။"},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E7%A9%86%E7%88%BE%E8%A5%BF%E4%BA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Plaza_del_Cardenal_Belluga%2C_Murcia.jpg","page_title":"穆爾西亞","context_page_description":"穆爾西亞（Murcia）係西班牙東南面穆爾西亞自治區首府，人口44萬。"},{"page_url":"https://fi.wikipedia.org/wiki/HMS_Gipsy_(H63)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/HMS_Gipsy_%28H63%29_IWM_FL_13465.jpg","page_title":"HMS Gipsy (H63)","context_page_description":"HMS Gipsy oli Britannian Kuninkaallisen laivaston G-luokan hävittäjä, joka palveli toisessa maailmansodassa.\\nAlus tilattiin 5. maaliskuuta 1934 Fairfield Shipbuilding and Engineering Companyltä Govanista Skotlannista. Sen valmistuskustannukset olivat 250364 puntaa ilman Amiraliteetin toimittamia ase- ja viestijärjestelmiä.\\nAmiraliteetti teki 15. kesäkuuta 1934 päätöksen, jonka mukaan alukseen asennettiin Johnsonin kattilat. Kattilat olivat pienempiä, kevyempiä ja niiden hyötysuhde oli parempi kuin perinteisillä Amiraliteetin kattiloilla. Kattiloiden vaihto lisäsi valmistuskustannuksia 8000 punnalla."},{"page_url":"https://it.wikipedia.org/wiki/Calogero_Pumilia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Calogero_Pumilia.jpg","page_title":"Calogero Pumilia","context_page_description":"Calogero Pumilia è un politico italiano."},{"page_url":"https://en.wikipedia.org/wiki/Goodenia_dimorpha","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Goodenia_dimorpha_%286783501985%29.jpg","page_title":"Goodenia dimorpha","context_page_description":"Goodenia dimorpha is a flowering plant that is endemic to the Sydney region in eastern Australia. The habitat is in swampy ground on sandstone. Found from Gosford to Waterfall in coastal areas, also recorded in Blackheath in the Blue Mountains. Attractive yellow flowers may be seen between the months of October and March. Two varieties are recognized: dimorpha and angustifolia. The specific epithet dimorpha is derived from Latin. Referring to the two forms of leaves. One from the mountains, the other from the coast."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BD%D0%B0%D1%81%D1%82%D0%B0%D1%81_%D0%9B%D0%BE%D0%B7%D0%B0%D0%BD%D1%87%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Anastas_Lozanchev_Familiya.JPG","page_title":"Анастас Лозанчев","context_page_description":"Анастас Димитров Лозанчев е български революционер, деец на националноосвободителното движение в Македония и основател на революционната мрежа на Вътрешната македоно-одринска революционна организация в Битолско. Използва псевдоними като Гроздан, Гроздин, Гроздев, Лозан Баба, Насто Димов, Сушко, Ташко."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8B%E3%82%B3%E3%83%B3%E3%83%BBCOOLPIX","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Nikon_B700_front-left_2016_China_P%26E.jpg","page_title":"ニコン・COOLPIX","context_page_description":"ニコン・COOLPIXは、ニコンの発売してきたデジタルコンパクトカメラである。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D1%8B%D0%B5_%D0%B2%D0%B0%D0%B3%D0%BE%D0%BD%D1%8B_%D0%B2_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/TPO_at_Colne_Valley_Railway_interior.jpg","page_title":"Почтовые вагоны в Великобритании","context_page_description":"Передвижное почтовое отделение — почтовое отделение, размещённое в вагоне; тип почтового вагона, в котором сортировка почты осуществляется в пути следования поезда. Термин появился в Великобритании; в США используется иной термин — railway post office."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B0%BF%E8%86%9C","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Gray1115.png","page_title":"尿膜","context_page_description":"尿膜 は有羊膜類の受胎産物の一部である。胚のガス交換を助け、液状の老廃物を処理する。\\n羊膜や漿膜といった他の胚体外膜とともに、尿膜はヒトを含む有羊膜類を特徴づけている。"},{"page_url":"https://sv.wikipedia.org/wiki/Ernst_Brandes","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Ernst_Brandes_by_Ludvig_Grundtvig.jpg","page_title":"Ernst Brandes","context_page_description":"Ernst Immanuel Cohen Brandes, född den 1 februari 1844 i Köpenhamn, död där den 6 augusti 1892, var en dansk nationalekonomisk författare, bror till Georg och Edvard Brandes.\\nBrandes var börsmäklare, men drog sig tidigt tillbaka från affärslivet och sysselsatte sig i huvudsak med journalistisk verksamhet. I artiklar i \\"Politiken\\", \\"Tilskueren\\" och i den av honom under hans sista levnadsår redigerade \\"Københavns Børstidende\\" behandlade han särskilt frågor rörande bank- och börsväsendet. Hans 1885 utgivna större skrift Samfundsspørgsmaal består av två avsnitt, av vilka det ena behandlar den malthusianska befolkningsläran och den andra värdeläran och en mängd därmed i förbindelse stående fundamentala ekonomiska och sociala spörsmål. Medan det första avsnittet är mindre betydande, utmärker sig det andra inte endast genom sitt klara och livliga framställningssätt, utan också genom sina, från den allmänna skolekonomin avvikande, synpunkter, som, utan att vara absolut nya, dock har fått sin prägel av författarens individualitet."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%84%D9%8A%D9%86%D9%89_%D9%83%D8%B1%D8%A7%D9%81%D9%8A%D8%AA%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Lenny_Kravitz_2011.jpg","page_title":"لينى كرافيتز","context_page_description":"لينى كرافيتز مغنى من امريكا."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%BA%D9%84%D9%88%D9%83%D8%B4%D8%AA%D8%A7%D8%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Luftaufnahmen_Nordseekueste_2012-05-by-RaBoe-460.jpg","page_title":"غلوكشتات","context_page_description":"غلوكاشتات هي بلدة ألمانية تقع في ألمانيا في شليسفيغ هولشتاين. يقدر عدد سكانها بـ 11,743 نسمة."},{"page_url":"https://de.wikipedia.org/wiki/Domgasse_(Wien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Domgasse_02.JPG","page_title":"Domgasse (Wien)","context_page_description":"Die Domgasse befindet sich im 1. Wiener Gemeindebezirk Innere Stadt. Sie wurde 1862 nach dem nahegelegenen Wiener Stephansdom benannt."},{"page_url":"https://zh.wikipedia.org/wiki/2000%E5%B9%B47%E6%9C%8831%E6%97%A5%E6%97%A5%E9%A3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/SE1982Jul20P.png","page_title":"2000年7月31日日食","context_page_description":"2000年7月31日日食是一次日偏食，發生於2000年7月31日。新月當天，地球上觀測到月球和太陽的角距離極小，此時月球如果恰好在月球交點附近，穿過太陽和地球之間，與地球、太陽接近一直線，則會出現日食。由於月球偏北或偏南，本影及僞本影從地球以北或以南經過而未接觸地表，只有半影覆蓋了地球北端或南端部分區域，形成日偏食。此次日偏食月球偏北，出現在歐亞大陸北部和北美洲北部。\\n通常每年有2次日食，而2000年共有4次，全都是日偏食。本次日食是其中第二次，且與上一次日食，2000年7月1日在同一個月發生。"},{"page_url":"https://cs.wikipedia.org/wiki/Bu%C4%8Dina_u_Such%C3%A9_louky","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/P%C5%99%C3%ADrodn%C3%AD_rezervace_Bu%C4%8Dina_u_Such%C3%A9_louky_-_foto_3%2C_Bukov%C3%A1%2C_okres_Prost%C4%9Bjov.jpg","page_title":"Bučina u Suché louky","context_page_description":"Přírodní rezervace bučina U Suché louky se nachází mezi Bukovou, Lipovou a Malým Hradiskem v okrese Prostějov. Jedná se o přirozený porost s převahou buku, avšak jsou zde zastoupeny i jiné stromy, jako je smrk, modřín a v menší míře i jedle a javor klen. Provádí se zde sběr osiva buku. Oblast spravuje Krajský úřad Olomouckého kraje."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Mesmin_(C%C3%B4te-d%27Or)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Corcellotte-en-Montagne_FR21_croix_IMF2951.jpg","page_title":"Saint-Mesmin (Côte-d'Or)","context_page_description":"Saint-Mesmin est une commune française située dans le département de la Côte-d'Or en région Bourgogne-Franche-Comté."},{"page_url":"https://sv.wikipedia.org/wiki/Monsterasl%C3%A4ktet","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Monstera_friedrichsthalii1.jpg","page_title":"Monsterasläktet","context_page_description":"Monsterasläktet är ett växtsläkte ur familjen kallaväxter som består av cirka 50 arter från tropiska Central- och Sydamerika. Några arter odlas som krukväxter.\\nStädsegröna lianer med hela eller flikiga blad. Bladskivan kan ibland vara perforerad med hål. Hölsterblad båtformat, blomkolv cylindrisk. Blommor tvåkönade, fertila upptill, sterila nertill. Kronblad saknas. Ståndare 4. Frukten är ett bär."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Hamburg-Blankenese","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Kapit%C3%A4n-Dreyer-Weg.jpg","page_title":"Liste der Straßen und Plätze in Hamburg-Blankenese","context_page_description":"Die Liste der Straßen und Plätze in Blankenese ist eine Übersicht der gegenwärtig im Hamburger Stadtteil Blankenese vorhandenen Straßen und Plätze. Sie ist Teil der Liste der Verkehrsflächen in Hamburg."},{"page_url":"https://lv.wikipedia.org/wiki/Caninae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Maned_wolf-aguara_guazu.jpeg","page_title":"Caninae","context_page_description":"Caninae ir viena no suņu dzimtas apakšdzimtām, šajā apakšdzimtā tiek iedalīti visi mūsdienās dzīvojošie suņu dzimtas plēsēji, kā arī to tuvākie, izmirušie radinieki, kā piemēram Sardīnijas suns vai briesmīgais vilks. Senāki un primitīvāki suņu dzimtas dzīvnieki iedalās Hesperocyoninae un Borophaginae apakšdzimtās."},{"page_url":"https://fr.wikipedia.org/wiki/Hispano-Suiza_9V","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/HS9Vb.jpg","page_title":"Hispano-Suiza 9V","context_page_description":"Les Hispano-Suiza 9Q et Hispano-Suiza 9V étaient des moteurs aéronautiques à pistons refroidis par air, à 9 cylindres en simple étoile, produits de 1929 à 1939 par le motoriste français Hispano-Suiza sous licence respectivement des Wright Whirlwind et Wright Cyclone. Leur succès fut médiocre et ils équipèrent un nombre restreint d'appareils, pour l'essentiel français."},{"page_url":"https://en.wikipedia.org/wiki/Exodus_Transitional_Community","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Exodus_Transitional_Community_1.jpg","page_title":"Exodus Transitional Community","context_page_description":"The Exodus Transitional Community is a non-profit organization that provides support services to men and women who are in transition from incarceration to full-integration into their communities. It helps these individuals build stable lives by promoting their social and economic well-being so as to break the cycle of recidivism."},{"page_url":"https://sv.wikipedia.org/wiki/Acanthocinus_princeps","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Acanthocinus_princeps_1470162.jpg","page_title":"Acanthocinus princeps","context_page_description":"Acanthocinus princeps är en skalbaggsart som först beskrevs av Walker 1866. Acanthocinus princeps ingår i släktet Acanthocinus och familjen långhorningar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ca.wikipedia.org/wiki/Kids","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Kids_%28Logo%29.png","page_title":"Kids","context_page_description":"Kids és el primer film de Larry Clark, estrenada l'any 1995. Presenta la vida de adolescents novaiorquesos, els seus desitjos i comportaments sexuals durant l'aparició de la SIDA. Posa en escena també el consum pels joves de cànnabis, d'alcohol i de tabac, de gas hilarant, i de ketamina. La versió original del film va ser classificada NC-17 als Estats Units, prohibida als menors de 17 anys. El film va ser fortament controvertit a la seva estrena, malgrat critiques unànimes i entusiastes. El film conté de nombrosos diàlegs molt crus. Descriu també les escenes de violació, de violències físiques, de drogues, de robatoris. És considerat per alguns com un crit d'alarma sobre la situació de la joventut a mitjans dels anys 1990 i del tema de la sida. Alguns actors han tingut un final tràgic com el deixava presagiar el film. Així, Justin Pierce, que interpreta Casper, es suïcida penjant-se el 2000 i Harold Hunter mor per sobredosi el 2006. Kids és el primer film per diverses actrius de renom com Chloë Sevigny i Rosario Dawson. Ha estat doblada al català."},{"page_url":"https://fr.wikipedia.org/wiki/Paul_Quinsac","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Paul_Quinsac_-_Affiche_1.jpg","page_title":"Paul Quinsac","context_page_description":"Paul Quinsac, né le 20 mars 1858 à Bordeaux, mort dans la même ville en mai 1929, est un peintre français.\\nPaul Quinsac, surnommé « le peintre des élégances bordelaises », est un peintre spécialisé dans les sujets allégoriques et mythologiques, les portraits et les paysages."},{"page_url":"https://pl.wikipedia.org/wiki/Z%C3%B6bern","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/AUT_Z%C3%B6bern_COA.jpg","page_title":"Zöbern","context_page_description":"Zöbern – gmina w Austrii, w kraju związkowym Dolna Austria, w powiecie Neunkirchen. Według Austriackiego Urzędu Statystycznego liczyła 1 401 mieszkańców."},{"page_url":"https://en.wikipedia.org/wiki/John_Keells_Holdings","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/John_Keells_Holdings_Logo.jpg","page_title":"John Keells Holdings","context_page_description":"John Keells Holdings PLC is Sri Lanka’s largest listed company in terms of market capitalization. It accounts for more than 14% of the Sri Lankan Stock market and has diversified its operations into various sectors ranging from Consumer Goods, Financial Services, Information Technology, Leisure, Property Development, Transportation and Plantations."},{"page_url":"https://es.wikipedia.org/wiki/Nombramiento_de_los_sat%C3%A9lites_naturales","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Ganymede%2C_moon_of_Jupiter%2C_NASA.jpg","page_title":"Nombramiento de los satélites naturales","context_page_description":"La asignación oficial de los nombres de los satélites naturales es responsabilidad, desde 1973, de la Unión Astronómica Internacional, en concreto, de un comité para la nomenclatura del sistema planetario"},{"page_url":"https://nl.wikipedia.org/wiki/Huabeisaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Huabeisaurus_skeleton%2C_PLoS_ONE.png","page_title":"Huabeisaurus","context_page_description":"Huabeisaurus allocotus is een plantenetende sauropode dinosauriër, behorend tot de Macronaria, die tijdens het late Krijt leefde in het gebied van het huidige China."},{"page_url":"https://en.wikipedia.org/wiki/Little_Jacks_Creek_Wilderness","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Little_Jacks_Creek_Wilderness%2C_Idaho_%282016%29.jpg","page_title":"Little Jacks Creek Wilderness","context_page_description":"The Little Jacks Creek Wilderness is located on the high basalt plateaus of Owyhee County in southwestern Idaho in the western United States. Big Jacks Creek Wilderness is on its southeast border. About 12.4 miles of Little Jacks Creek is classified as a wild river."},{"page_url":"https://pt.wikipedia.org/wiki/Sriracha","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Sriraja_Panich_red_chilli_sauce.jpg","page_title":"Sriracha","context_page_description":"Sriracha é um tipo de molho de pimenta, que recebeu o nome da cidade de Si Racha, na província de Chon Buri, Tailândia, onde foi produzido e servido nos restaurantes de frutos do mar locais. É uma pasta de pimenta, vinagre, alho, açúcar e sal Na Tailândia o molho é chamado também de sot Siracha e algumas vezes de nam phrik Siracha.\\nNa Tailândia, o sriracha é frequentemente usado como molho em frutos do mar. Na culinária vietnamita, o sriracha é usado como condimento no phở, massa frita, cobertura para rolinho primavera e em molhos."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B3%D0%B0%D1%87%D1%91%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Raha%C4%8Do%C5%AD%2C_vulica_%283.07.2009%29.jpg","page_title":"Рогачёв","context_page_description":"Рогачёв — город в Гомельской области Республики Беларусь. Административный центр Рогачёвского района. Железнодорожная станция на линии Могилёв-Жлобин. Автодороги на Бобруйск, Могилёв, Славгород, Жлобин. Пристань на реке Днепр. Город располагается на месте слияния рек Днепр и Друть. Население 34809 человек."},{"page_url":"https://pl.wikipedia.org/wiki/BMW_M3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Chris_Enright_Goodwood_2004_EA85120.JPG","page_title":"BMW M3","context_page_description":"BMW M3 – sportowa wersja samochodów BMW oparta na serii 3. Pierwsze BMW M3 pojawiło się w 1985 roku. Obecnie istnieje już 6 generacji tych pojazdów. Moc waha się od 195 KM w najstarszym modelu E30 do 500 KM w modelu M4 GTS. W obecnej generacji F80 nazwa M3 odnosi się tylko do wersji sedan, wersja coupé otrzymała nazwę M4 i oznaczenie F82."},{"page_url":"https://fr.wikipedia.org/wiki/Pont-avion","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Pont-avion_%C3%A0_Roissy_-147.jpg","page_title":"Pont-avion","context_page_description":"Un pont-avion est un pont qui permet à des avions de franchir un obstacle en creux, en général une route, une rivière ou des voies de chemin de fer.\\nPlusieurs ponts-avion permettent le franchissement de l'autoroute A1 et d'autres voies de routières par les pistes d'envol de l'aéroport de Paris-Charles-de-Gaulle ou les pistes permettant aux avions circuler entre la piste 1, au nord des aérogares, et les pistes 2 et 4, au sud.\\nCes ouvrages sont en général du type pont-dalle en béton précontraint. Ils doivent être capables de résister à des charges de train d'atterrissage de 600 t."},{"page_url":"https://cs.wikipedia.org/wiki/Svato%C5%88ovice_(Karlovice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Svato%C5%88ovice_%28Karlovice%29%2C_kamenn%C3%BD_k%C5%99%C3%AD%C5%BE.JPG","page_title":"Svatoňovice (Karlovice)","context_page_description":"Svatoňovice je malá vesnice, část obce Karlovice v okrese Semily. Nachází se asi 0,5 km na severovýchod od Karlovic. Je zde evidováno 40 adres. Trvale zde žije 66 obyvatel.\\nSvatoňovice leží v katastrálním území Karlovice o výměře 10,21 km².\\nVe vsi se nachází požární zbrojnice s věžičkou v níž je zavěšen zvon zasvěcený svatému Františku z Assisi z roku 1994. Obsahuje srdce původního zvonu svatého Václava, který byl v roce 1942 zabaven pro válečné účely a který byl na věžičku osazen v roce 1929."},{"page_url":"https://en.wikipedia.org/wiki/Puri","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Puri_Sea_Beach_viewed_from_the_light_house.jpg","page_title":"Puri","context_page_description":"Puri is a city and a municipality in the state of Odisha in eastern India. It is the district headquarters of Puri district and is situated on the Bay of Bengal, 60 kilometres south of the state capital of Bhubaneswar. It is also known as Sri Jagannatha Dhama after the 12th-century Jagannatha Temple located in the city. It is one of the original Char Dham pilgrimage sites for Hindus.\\nPuri is known by several names since the ancient times, and was locally known as \\"Sri Kshetra\\" and Lord Jagannatha temple is known as \\"Badadeula\\". Puri and the Jagannatha Temple were invaded 18 times by Muslim rulers, from the 7th century AD till the early 19th century with the objective of looting the treasures of the temple. Odisha, including Puri and its temple, were part of British India from 1803 till India attained independence in August 1947. Even though princely states do not exist in India today, the heirs of the Gajapati Dynasty of Khurda still perform the ritual duties of the temple. The temple town has many Hindu religious mathas or monasteries.\\nThe economy of Puri is dependent on the religious importance of the Jagannatha Temple to the extent of nearly 80 percent."},{"page_url":"https://ceb.wikipedia.org/wiki/Semaeostomeae","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Brilliantred_jellyfish_Poralia.jpg","page_title":"Semaeostomeae","context_page_description":"Matang sa mga bukya ang Semaeostomeae. Ang Semaeostomeae sakop sa klase nga bukya, ka-ulo nga nidariya, ug kaginharian nga mananap. Ang kahanay nga Semaeostomeae pagsakop 58 espesye, segun Catalogue of Life.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://tl.wikipedia.org/wiki/Tulay_ng_Ayala","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/2015_Ayala_Bridge_rehabilitation.jpg","page_title":"Tulay ng Ayala","context_page_description":"Ang Tulay ng Ayala ay isang bakal na sepong tulay sa ibabaw ng Ilog Pasig sa Maynila, Pilipinas. Kinokonekta nito ang mga distrito ng Ermita at San Miguel, at dumaraan sa kanlurang dulo ng Isla de Convalecencia. Dinadala nito ang Daang Palibot Blg. 1 at ang Pambansang Ruta Blg. 180 na iniuugnay ang Bulebar Ayala ng Ermita sa Kalye Pascual Casal ng San Miguel."},{"page_url":"https://nl.wikipedia.org/wiki/Moda_Center","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/Rose_Garden_Arena_Interior.jpg","page_title":"Moda Center","context_page_description":"De Moda Center, voorheen Rose Garden Arena, is een indoor-sportstadion gelegen in Portland. Vaste bespelers zijn de Portland Trail Blazers."},{"page_url":"https://pt.wikipedia.org/wiki/Filipe_de_Hachberg-Sausenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Philippe_de_Hochberg.jpg","page_title":"Filipe de Hachberg-Sausenberg","context_page_description":"Filipe de Hachberg-Sausenberg foi um nobre alemão pertencente a um ramo cadete da Casa de Zähringen, dinastia governou a Marca de Baden. Era filho de Rodolfo IV, Margrave de-Hachberg-Sausenberg, e de Margarida de Vienne.\\nFilipe reinou de 1487 a 1503 como Margrave de Hachberg-Sausenberg e Conde Soberano de Neuchâtel. A partir de 1466 designou-se também Senhor de Badenweiler."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BA%D1%81%D1%82_%D0%A1%D0%B8%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Bibliotheca_Sancta.png","page_title":"Сикст Сиенский","context_page_description":"Си́кст Сие́нский — итальянский богослов, в начале францисканец, затем доминиканец, католический священник и миссионер, библеист и писатель.\\nСикст родился в городе Сиене, в иудейской семье, еврейское имя его при рождении неизвестно. Будучи молодым Сикст принял католическую веру и крестился. Затем Сикст вступил в Орден францисканцев. Однако вскоре после этого, Сиксту было предъявлено обвинение инквизицией в еретичестве, он был приговорен к смерти на костре. От смерти его спас кардинал Микеле Гислиери, который принял его в свой Орден доминиканцев в 1551 году. В дальнейшем Гислиери, уже став папою, продолжал покровительствовать Сиксту. По благословению папы Римского Павла IV вместе с другим новообращенным из иудеев — Филиппом Моро Сикст проповедовал в синагогах, кроме того возбуждал католиков против тех иудеев, которые сопротивлялись принимать христианство. В апреле 1559 года Сикст вместе с другим доминиканским монахом отправился в Кремон, чтобы сжечь Талмуд, заявив, что в нём содержатся лишь антихристианские сочинения."},{"page_url":"https://en.wikipedia.org/wiki/International_Philatelic_Libraries_Association","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Stamp_from_Romania_-_CN_Tower.jpg","page_title":"International Philatelic Libraries Association","context_page_description":"The International Philatelic Libraries Association was formed in 1996 at the Capex 96 stamp exhibition in Toronto.\\nDelegates from many countries attended including Virginia Horn from the American Philatelic Research Library and David Beech, Curator of the British Library Philatelic Collection. The library of the Royal Philatelic Society London is also a member."},{"page_url":"https://sl.wikipedia.org/wiki/Italijansko_renesan%C4%8Dno_slikarstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Cappella_brancacci%2C_Tentazione_di_Adamo_ed_Eva_%28restaurato%29%2C_Masolino.jpg","page_title":"Italijansko renesančno slikarstvo","context_page_description":"Italijansko renesančno slikarstvo je obdobje, ki se je začelo v poznem 13. stoletju in se razcvetelo od začetka 15. do poznega 16. stoletja, ko se je pojavljalo na italijanskem polotoku, ki je bil takrat razdeljen na številne politične države, nekatere neodvisne, druge pa pod zunanjim nadzorom. Slikarji renesančne Italije, čeprav so pogosto pripadali določenim dvorom in zvesti do določenih mest, so se kljub temu potepali po dolgem in počez po Italiji, pogosto pa so imeli diplomatski status in širili umetniške in filozofske ideje.\\nMesto Firence v Toskani je znano kot rojstno mesto renesanse in zlasti renesančnega slikarstva, čeprav sta pozneje v obdobju Rim in Benetke v slikarstvu postajala vse pomembnejša. Podrobno ozadje je opisano v drugih člankih renesanse in renesančne arhitekture.\\nItalijansko renesančno slikarstvo je najpogosteje razdeljeno na štiri obdobja: protorenesansa, zgodnja renesansa, visoka renesansa in manierizem. Datumi za ta obdobja predstavljajo splošni trend v italijanskem slikarstvu in ne zajemajo vseh slikarjev, saj se življenja posameznih umetnikov in njihovih osebnih slogov prekrivajo s temi obdobji."},{"page_url":"https://nl.wikipedia.org/wiki/NGC_1580","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/G123_044_001372.jpg","page_title":"NGC 1580","context_page_description":"NGC 1580 is een spiraalvormig sterrenstelsel in het sterrenbeeld Eridanus. Het hemelobject werd op 18 januari 1877 ontdekt door de Franse astronoom Édouard Jean-Marie Stephan."},{"page_url":"https://de.wikipedia.org/wiki/Monte_Lema","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Monte-Lema.jpg","page_title":"Monte Lema","context_page_description":"Der Monte Lema ist ein Berg in der Tambogruppe auf der Grenze zwischen der Lombardei und dem Kanton Tessin oberhalb der Orte Miglieglia und Astano. Von Miglieglia führt eine Seilbahn zum Gipfel.\\nNeben der Bergstation sind in der Gipfelregion ein Bergrestaurant, eine Sternwarte und eine Wetter-Radar-Station von MeteoSchweiz zu finden.\\nVom Gipfel hat man eine umfassende Rundsicht auf die umliegenden Berge des Südtessins, auf den Luganersee und den Lago Maggiore. Die Bergregion ist für Wanderer durch ein markiertes Wegenetz von 80 Kilometern erschlossen.\\nDie Gipfelregion wird auch von Gleitschirmfliegern, Mountain Bike-Fahrern sowie von Modellfliegern häufig frequentiert."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D1%81%D0%B8%D0%BB%D1%8B_%D0%9F%D0%B0%D0%BA%D0%B8%D1%81%D1%82%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Ships_during_the_exercise_Arabian_Shark_%2708.jpg","page_title":"Вооружённые силы Пакистана","context_page_description":"Вооружённые силы Пакистана — военная организация Исламской Республики Пакистан, предназначенная для обороны Республики, защиты свободы и независимости государства, одно из важнейших орудий политической власти.\\nВооружённые силы Пакистана занимают 7 место в мире по численности личного состава. Пакистанские вооружённые силы образовали, после того как страна получила независимость от Британской империи в 1947 году и образовала своё государство. С момента обретения независимости Вооружённые силы Пакистана принимали участие в 4 войнах с соседней Индией и в пограничном конфликте с Афганистаном. Пакистанские дивизии и бригады присутствовали в некоторых арабских странах во время арабо-израильских войн, а также участвовали в вооружённых действиях на стороне коалиции в первой войне в Персидском заливе. В настоящее время идут бои против талибов на северо-западе Пакистана. В данном регионе проводились крупные воинские операции, такие как Взятие Ваны и Наступление в Оракзаи. Помимо конфликтов, Вооружённые силы Пакистана принимают активное участие в миссиях ООН. Верховным главнокомандующим вооружённых сил Пакистана является Президент Пакистана."},{"page_url":"https://fi.wikipedia.org/wiki/Toyota_F1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Toyota_F1_Canada_2006_%28crop%29.PNG","page_title":"Toyota F1","context_page_description":"Toyota F1 oli japanilaisen autovalmistaja Toyotan Formula 1 -talli, joka kilpaili F1-sarjassa 2002–2009."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B7%D8%A8%DB%8C%D8%B9%DB%8C%D8%A7%D8%AA_%D8%AF%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Ketterle.jpg","page_title":"طبیعیات دان","context_page_description":"طبیعیات دان ایک ایسے سائنسدان کو کہتے ہیں جو طبیعیات پر تحقیق کرتا ہے۔"},{"page_url":"https://ast.wikipedia.org/wiki/Navarredonda_de_la_Rinconada","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Spain_%26_Portugal_1864_Keith_Johnston_detalle_reino_de_leon.jpg","page_title":"Navarredonda de la Rinconada","context_page_description":"Navarredonda de la Rinconada ye un conceyu y llocalidá española de la provincia de Salamanca, na comunidá autónoma de Castiella y Llión. Intégrase dientro de la contorna de la Sierra de Francia, la subcomarca de Les Quilamas y la microcomarca de La Calería.\\nEl so términu municipal ta formáu por un solu nucleu de población, ocupa una superficie total de 13,12 km² y según los datos demográficos recoyíos nel padrón municipal ellaboráu pol INE nel añu 2017, cuenta con una población de 173 habitantes."},{"page_url":"https://de.wikipedia.org/wiki/Ludwig_zu_Sayn-Wittgenstein-Hohenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Ludwig_zu_Sayn-Wittgenstein-Hohenstein.jpg","page_title":"Ludwig zu Sayn-Wittgenstein-Hohenstein","context_page_description":"Fürst Ludwig zu Sayn-Wittgenstein-Hohenstein war ein deutscher Standesherr."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Lier/deel_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Lier_Standbeeld_Christus-Koning_02.jpg","page_title":"Lijst van onroerend erfgoed in Lier/deel 2","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Lier. Deel 1 biedt een alfabetisch overzicht van de straten beginnend met de letters A tot en met G. Deel 2 biedt een overzicht van de straten beginnend met de letters H tot en met L. Deel 3 biedt een overzicht van de straten beginnend met de letters M tot en met Z. De monumenten in de deelgemeente Koningshooikt staan in een eigen lijst: lijst van onroerend erfgoed in Koningshooikt. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://pt.wikipedia.org/wiki/Lactobacillus_acidophilus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Lactobacillus_sp_01.png","page_title":"Lactobacillus acidophilus","context_page_description":"Lactobacillus acidophilus é uma espécie de bactéria do género Lactobacillus que se aloja no intestino humano e que traz proteção.\\nOutras bactérias benéficas incluem: L. bulgaricus, L. reuteri, L. plantarum, L. casei, B. bifidus, Streptococcus salivarius, Streptococcus thermophilus e a levedura Saccharomyces boulardii. O L. acidophilus produz uma enzima chamada lactase que transforma o açúcar do leite em açúcar simples. Portanto, para quem é intolerante à lactose, esta bactéria é muito importante.\\nEm geral, essa bactéria é usada para aumentar a imunidade, no trato de infecções causadas por certos fungos e bactérias, na diminuição de alergias, para combater acnes, resfriados e úlceras, na saúde cardiovascular. Também é extremamente benéfica para quem está com o fungo causador da candidíase.\\nO uso de probióticos, como o L. acidophilus, concomitante com ao uso posterior de antibióticos, ajuda a restaurar as bactérias naturais do trato digestivo que eventualmente são mortas pelos antibióticos. Grávidas não devem fazer uso destes probióticos antes de consultar um médico."},{"page_url":"https://fr.wikipedia.org/wiki/Lea_Padovani","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Alberto_Sordi_and_Lea_Padovani_1954.jpg","page_title":"Lea Padovani","context_page_description":"Lea Padovani est une actrice italienne."},{"page_url":"https://sv.wikipedia.org/wiki/Will_Self","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Will_Self_at_Humber_Mouth_2007.jpg","page_title":"Will Self","context_page_description":"William Woodard \\"Will\\" Self, född 26 september 1961 i London, är en brittisk författare, journalist, politisk kommentator och TV-personlighet.\\nSelf har författat tio romaner, flera novellsamlingar samt samlingar av icke skönlitterära texter. Han har översatts till 22 språk och hans stil är känd för att vara satirisk, grotesk och fantasifull. Huvudsakligen utspelas hans berättelser i London och ofta involverar de mental sjukdom, illegala droger och psykiatri. Self bidrar regelbundet till olika tidningar, bl.a. Playboy, The Guardian och New York Times, och har genom åren varit kolumnist i åtskilligt fler. Han har medverkat mycket i TV, först som panelist i humorprogram, senare i aktualitetsprogram. Därtill förekommer han ofta i radio. Han är bror till journalisten och författaren Jonathan Self."},{"page_url":"https://cs.wikipedia.org/wiki/Stefan_Wyszy%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Warschau_Denkmal_Stefan_Kardinal_Wyszynski_1069.jpg","page_title":"Stefan Wyszyński","context_page_description":"Ctihodný Stefan kardinál Wyszyński [stefan vyšyňski] byl arcibiskupem Varšavy a Hnězdna, kardinálem, polským primasem, služebníkem Božím, obráncem lidské důstojnosti a lidských práv."},{"page_url":"https://vi.wikipedia.org/wiki/Kl%C4%99pino","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Kosciol_w_klepinie.JPG","page_title":"Klępino","context_page_description":"Klępino là một ngôi làng thuộc khu hành chính của Gmina Stargard, thuộc huyện Stargardzki, Zachodniopomorskie, ở phía tây bắc Ba Lan. Nó nằm khoảng 4 kilômét phía bắc Stargard và 31 km về phía đông của thủ đô khu vực Szczecin.\\nTrước năm 1945, khu vực này là một phần của Đức. Đối với lịch sử của khu vực, xem Lịch sử của Pomerania.\\nLàng có dân số 423."},{"page_url":"https://ms.wikipedia.org/wiki/Kancah_Pasifik_Barat_Daya_(Perang_Dunia_II)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/HMAS_Canberra_%28D33%29_underway_off_Tulagi%2C_circa_7_August_1942.jpg","page_title":"Kancah Pasifik Barat Daya (Perang Dunia II)","context_page_description":"Kancah Pasifik Barat Daya, semasa Perang Dunia II, ialah satu kancah utama diantara Pihak Sekutu dan Jepun. Ia meliputi Filipina, Hindia Timur Belanda, Borneo, Australia dan mandatnya seperti New Guinea dan bahagian barat Kepulauan Solomon. Kawasan ini telah didefinisikan oleh kuasa Bersekutu sebagai Kawasan Pasifik Barat Daya.\\nDalam kancah Pasifik Barat Daya, tentera Jepun menentang terutamanya dari tentera-tentera Amerika Syarikat dan Australia. New Zealand, Belanda, Filipina, United Kingdom, dan tentera negara Bersekutu yang lain."},{"page_url":"https://zh.wikipedia.org/zh-sg/2013%E5%B9%B4%E5%A4%AA%E5%B9%B3%E6%B4%8B%E9%A2%B6%E9%A2%A8%E5%AD%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Kiko_2013_track.png","page_title":"2013年太平洋颶風季","context_page_description":"2013年太平洋飓风季是每年一度全球热带气旋产生周期的一部分。东太平洋飓风季从2013年5月至2013年11月结束；而中太平洋飓风季从2013年6月开始，至2013年11月结束。本条目的范围仅局限于赤道以北及国际换日线以东的太平洋，于赤道以北及国际换日线以西的太平洋水域产生的风暴则被称为台风，并被列入2013年太平洋台风季。在中东太平洋产生的热带风暴是由美国国家飓风中心及中太平洋飓风中心命名，国际编号为xxE或xxC。\\n2013年太平洋飓风季首个气旋生成于2013年5月15日的热带风暴阿尔文。以下各热带气旋资讯以热带气旋存在期间的最强形态为准。"},{"page_url":"https://pt.wikipedia.org/wiki/Elei%C3%A7%C3%A3o_municipal_de_Aracaju_em_1985","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Marcelo_D%C3%A9da_em_junho_de_2010.jpg","page_title":"Eleição municipal de Aracaju em 1985","context_page_description":"A eleição municipal de Aracaju em 1985 ocorreu em 15 de novembro. O prefeito era José Carlos Teixeira do PMDB. Jackson Barreto do PMDB foi eleito prefeito em turno único, derrotando Marcelo Déda do PT."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%A0%E5%B2%A1%E8%AB%B8%E5%B3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Shiraishijima_02.jpg","page_title":"笠岡諸島","context_page_description":"笠岡諸島は、瀬戸内海中部にある諸島。全島が岡山県笠岡市に属する。備中諸島の異称もある。"},{"page_url":"https://de.wikipedia.org/wiki/Hirschzungenfarn","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Wien_Scolopendrion_-_Phyllitis1.jpg","page_title":"Hirschzungenfarn","context_page_description":"Der Hirschzungenfarn, auch einfach Hirschzunge, ist eine Pflanzenart aus der Familie der Streifenfarngewächse, zu der weltweit etwa 720 Arten gehören. Manchmal wurde diese Gattung zu den Tüpfelfarngewächsen gestellt. Durch seine ganzrandigen Blattwedel ist der Hirschzungenfarn leicht von allen anderen europäischen Farnen zu unterscheiden, die in der Regel ein- bis mehrfach gefiederte Wedel aufweisen."},{"page_url":"https://fr.wikipedia.org/wiki/Petit_Lourdes_(H%C3%A9rouville-Saint-Clair)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Petit_Lourdes_HSC.jpg","page_title":"Petit Lourdes (Hérouville-Saint-Clair)","context_page_description":"Le Petit Lourdes est un sanctuaire marial construit de 1879 à 1885 sur la commune d'Hérouville-Saint-Clair, dans le Calvados."},{"page_url":"https://eu.wikipedia.org/wiki/Castejon-Bilbo_burdinbidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/440-207_Zaragoza-Castej%C3%B3n_%283543110700%29.jpg","page_title":"Castejon-Bilbo burdinbidea","context_page_description":"Castejon—Bilbo burdinbidea Euskal Herriko eta Iberiar penintsulako burdinbiderik garrantzitsuenetako bat da, Zaragoza—Bartzelona burdinbidearekin batera, Ebroko harana jaurtitzen du. Gainera, Bizkaiako burdinbide nagusia da, Araba eta Nafarroa Garaia lurralde historikoarekin komunikatzen du eta Madril—Hendaia burdinbidearekin lotzen baitu.\\nBurdinbidea bide bikoitzekoa Urduña eta Bilbo artean da eta bide bakarrakoa Castejon eta Urduña artean da eta bilbide osoan elektrifikatuta dago. ADIF -en 700 zenbakia jasotzen du.\\nBurdinbidea osoa 1863an inauguratu zen, lehen zatia Miranda Ebro-Bilbo izan zen arren, martxoan, eta azkena Haro-Castejon, abuztuan."},{"page_url":"https://en.wikipedia.org/wiki/Surgeon_General_of_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Steven_K_Galson.jpg","page_title":"Surgeon General of the United States","context_page_description":"The surgeon general of the United States is the operational head of the U.S. Public Health Service Commissioned Corps and thus the leading spokesperson on matters of public health in the federal government of the United States. The Surgeon General's office and staff are known as the Office of the Surgeon General which is housed within the Office of the Assistant Secretary for Health.\\nThe U.S. surgeon general is nominated by the president of the United States and confirmed by the Senate. The surgeon general must be appointed from individuals who are members of the Regular Corps of the U.S. Public Health Service, and have specialized training or significant experience in public health programs. The surgeon general serves a four-year term of office and, depending on whether the current assistant secretary for health is a Public Health Service commissioned officer, is either the senior or next most senior uniformed officer of the commissioned corps, holding the rank of a vice admiral. The current surgeon general is Jerome Adams, having taken office on September 5, 2017."},{"page_url":"https://en.wikipedia.org/wiki/Arunachal_Pradesh","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/BuddhaTwang.jpg","page_title":"Arunachal Pradesh","context_page_description":"Arunachal Pradesh is the northeasternmost state of India. It borders the states of Assam and Nagaland to the south. It shares international borders with Bhutan in the west, Myanmar in the east, and a disputed border with China in the north at the McMahon Line. Itanagar is the state capital of Arunachal Pradesh. Arunachal Pradesh is the largest of the Seven Sister States of Northeast India by area.\\nAs of the 2011 Census of India, Arunachal Pradesh has a population of 1,382,611 and an area of 83,743 square kilometres. It is an ethnically diverse state, with predominantly Monpa people in the west, Tani people in the center, Tai people in the east, and Naga people in the south of the state.\\nA major part of the state is claimed by both the People's Republic of China and Republic of China as part of the region of South Tibet. During the 1962 Sino-Indian War, most of Arunachal Pradesh was temporarily captured by the Chinese People's Liberation Army."},{"page_url":"https://cs.wikipedia.org/wiki/Kanton_Blanquefort","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Map_canton_code_33_06.svg","page_title":"Kanton Blanquefort","context_page_description":"Kanton Blanquefort je francouzský kanton v departementu Gironde v regionu Akvitánie. Tvoří ho šest obcí."},{"page_url":"https://en.wikipedia.org/wiki/Harriet_Anne_Thiselton-Dyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Transactionsofro311888roy_0571.jpg","page_title":"Harriet Anne Thiselton-Dyer","context_page_description":"Lady Harriet Anne Thiselton-Dyer was a British botanical illustrator."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_del_Esp%C3%ADritu_Santo_(Valga)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Valga_katoliku_kirik.jpg","page_title":"Iglesia del Espíritu Santo (Valga)","context_page_description":"La Iglesia del Espíritu Santo o bien la Iglesia católica de Valga​ es el nombre que recibe un edificio religioso que pertenece a la Iglesia católica y que se encuentra en la calle 8 Malev de Valga en el país europeo de Estonia. La iglesia ha sido clasificada como monumento cultural y patrimonial por lo que esta protegida.\\nEs un edificio de estilo neogótico que fue construido en granito y ladrillo y decorado con ladrillos rojos. Entre los Constructores estaban trabajadores del ferrocarril de Lituania y Polonia. La iglesia fue terminada en 1907. La torre no fue concluida porque las autoridades no dieron permiso para construirla.\\nLa iglesia operó hasta 1940. Desde 1945, el edificio fue utilizado como almacén y más tarde como un gimnasio. En 1995 se completó una extensión y remodelación, y volvió a ser utilizado como sitio de culto.\\nDebido a la diversidad de nacionalidades que componen la congregación ofrece misas en Estonio y Ruso, los sábados y domingos y días de fiesta católicos.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B8%D0%B1%D0%B5%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Sibenik_%2829%29.JPG","page_title":"Шибеник","context_page_description":"Ши́беник — город в Хорватии. Находится в центральной части побережья Адриатики, в месте впадения реки Крка в Адриатическое море. Столица жупании Шибеник-Книн. Население — 37 060 человек."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E6%B5%B722000%E7%B3%BB%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/%E3%81%93%E3%82%93%E3%81%91%E3%81%A4.jpg","page_title":"南海22000系電車","context_page_description":"南海22000系電車とは、南海電気鉄道に在籍していた一般車両で、「ズームカー」の一系列。「通勤ズーム」「角ズーム」とも通称される。\\n本項では本系列の改造により派生した系列のうち2200系電車、2230系電車についても記載する。和歌山電鐵に引き継がれた2270系電車については和歌山電鐵2270系電車を参照のこと。"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_rozhleden_v_Karlovarsk%C3%A9m_kraji","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Franti%C5%A1kovy_L%C3%A1zn%C4%9B_Z%C3%A1me%C4%8Dek_%281%29.jpg","page_title":"Seznam rozhleden v Karlovarském kraji","context_page_description":"Seznam rozhleden a vyhlídkových věží v Karlovarském kraji.\\nVzhledem k nejednoznačné definici rozhleden a stále přibývajících staveb tohoto druhu je pravděpodobné, že seznam nebude úplný."},{"page_url":"https://ja.wikipedia.org/wiki/5%E6%9C%8826%E6%97%A5","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Senhime_Himeji.jpg","page_title":"5月26日","context_page_description":"5月26日は、グレゴリオ暦で年始から146日目にあたり、年末まではあと219日ある。誕生花はワサビ。"},{"page_url":"https://en.wikipedia.org/wiki/Joggins_Formation","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/AMD_Joggins.jpg","page_title":"Joggins Formation","context_page_description":"The Joggins Formation is a geologic formation in Nova Scotia. It preserves fossils dating back to the Carboniferous period, including Hylonomus, the earliest known reptile. In addition to fossils, the Joggins Formation was a valuable source of coal from the 17th century until the mid-20th century.\\nThe Joggins Formation's spectacular coastal exposure, the Joggins Fossil Cliffs at Coal Mine Point, was named a UNESCO World Heritage Site in 2008."},{"page_url":"https://sq.wikipedia.org/wiki/Chavenon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Eglise_Saint-Martin_de_Chavenon.jpg","page_title":"Chavenon","context_page_description":"Chavenon është një komunë franceze, e cila ndodhet në departamentin Allier të rajonit Auvernia-Rhône-Alpes. Chavenon ka një popullsi prej 126 banorë dhe sipërfaqe 17.47 km², me një dendësi prej 7 banor/km²."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_v_obci_Oponice","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Oponice_%2823%29.jpg","page_title":"Zoznam kultúrnych pamiatok v obci Oponice","context_page_description":"Toto je zoznam kultúrnych pamiatok v obci Oponice v okrese Topoľčany.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí."},{"page_url":"https://ro.wikipedia.org/wiki/Diviziunea_Western","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Western_Division_districts.png","page_title":"Diviziunea Western","context_page_description":"Diviziunea Western este una dintre cele 6 unități administrativ-teritoriale de gradul I ale statului Gambia. Reședința sa este orașul Brikama."},{"page_url":"https://es.wikipedia.org/wiki/M%C3%A9stnichestvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Feodor_burn_books_of_nobility.jpg","page_title":"Méstnichestvo","context_page_description":"En la historia rusa, el méstnichestvo era un sistema feudal jerárquico que funcionó desde el siglo XV al XVII. La palabra deriva del ruso \\"Место\\". Se desarrolló alrededor de un concepto: el boyardo que estimara que sus orígenes eran más antiguos y sus servicios al zar más valiosos, podía reclamar un mayor cargo en el estado. Esto a menudo condujo a disputas entre los nobles sobre sus ancestros y los servicios que habían prestado al monarca.\\nDebido al méstnichestvo, quienes estaban cualificados para las tareas necesitadas pero no podían alegar una solera suficientemente extensa, no tenían ninguna esperanza de llegar a ocupar un cargo importante. Del mismo modo, un boyardo que proviniera de una familia antigua y respetada podía conseguir una importante promoción pese a que sus habilidades personales no fueran las adecuadas para el puesto.\\nCon el desarrollo del absolutismo ruso, cuyo principio central era la creación de una burocracia central que informara de todo directamente al zar y no perdiera el tiempo compitiendo entre sí, la importancia del méstnichestvo se fue reduciendo progresivamente."},{"page_url":"https://en.wikipedia.org/wiki/Buses_in_London","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/London_United_RATP.jpg","page_title":"Buses in London","context_page_description":"The London Bus is a London transportation system used for multiple decades. Considered to be an icon of London, the London Bus operates nights, days, and long-distances on many different routes and lines. The main image of a London Bus is an arched, double-decker, red-painted bus which can carry a large number of passengers."},{"page_url":"https://en.wikipedia.org/wiki/Rangi_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/0118_Chapati_backen.jpg","page_title":"Rangi people","context_page_description":"The Rangi are an ethnic and linguistic group based in the Dodoma Region of central Tanzania. In 1999 the Rangi population was estimated to number 350,000.\\nThe Rangi call their language Kilaangi, though it is more commonly known as Rangi or Kirangi."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%B6rg_Wiele","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/J%C3%B6rg_Wiele_Scheibenmandala.jpg","page_title":"Jörg Wiele","context_page_description":"Jörg Wiele ist ein Düsseldorfer Bildhauer, der vor allem durch seine kinetischen Objekte bekannt geworden ist. Zu seinen Werken zählen figurative kinetische Plastiken für den Außenraum. Seine Werke sind in Deutschland installiert."},{"page_url":"https://en.wikipedia.org/wiki/Sweden_proper","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Swedish_Empire_%281560-1815%29_en2.png","page_title":"Sweden proper","context_page_description":"Sweden proper is a term used to distinguish those territories that were fully integrated into the Kingdom of Sweden, as opposed to the dominions and possessions of, or states in union with, Sweden. Only the estates of the realm of Sweden proper were represented in the Riksdag of the Estates.\\nSpecifically this means that, from approximately 1155–1156 until the Treaty of Fredrikshamn in 1809, Sweden proper included the bulk of present-day Finland as a fully integrated part of the realm. After 1809, however, the term has been used to distinguish the western part from former eastern half of the realm, i.e. Sweden from Finland.\\nSkåne, Halland, Blekinge, and Bohuslän, formerly parts of Denmark and Norway, came under the Swedish Crown by the Treaty of Roskilde in 1658, but it was not until 1719 that they were fully integrated and became part of Sweden proper.\\nSweden proper, a geographical reference that has changed over time, contrasts with Finland Proper, a province in southwestern Finland that gave its name to all of Finland."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%B6_(%D0%92%D0%B5%D1%80%D1%85%D0%BD%D1%8F%D1%8F_%D0%A1%D0%BE%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/OUGE_4_11_2007_%2829%29.jpg","page_title":"Уж (Верхняя Сона)","context_page_description":"Уж — коммуна во Франции, находится в регионе Франш-Конте. Департамент — Верхняя Сона. Входит в состав кантона Витре-сюр-Манс. Округ коммуны — Везуль.\\nКод INSEE коммуны — 70400."},{"page_url":"https://fr.wikipedia.org/wiki/Ra%C3%AFon_de_Kastsioukovitchy","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Flag_of_Ka%C5%9Bciukovi%C4%8Dy.png","page_title":"Raïon de Kastsioukovitchy","context_page_description":"Le raïon de Kastsioukovitchy ou raïon de Kostioukovitchi est une subdivision de la voblast de Moguilev, en Biélorussie. Son centre administratif est la ville de Kastsioukovitchy."},{"page_url":"https://eo.wikipedia.org/wiki/Adolf_von_Kr%C3%B6ner","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/20170331_Stuttgart_-_Adolf-Kr%C3%B6ner-Stra%C3%9Fe_18_-_pic2.jpg","page_title":"Adolf von Kröner","context_page_description":"Adolf von KRÖNER estis germana eldonisto. Li honortitoloĝis sekreta komerca konsilisto kaj iĝis honora civitano de Lepsiko."},{"page_url":"https://de.wikipedia.org/wiki/Grane_(Fluss)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Karl_F._Wunder_PC_0004_Harz._Partie_im_Granethal.jpg","page_title":"Grane (Fluss)","context_page_description":"Die Grane ist ein rechter Nebenfluss der Innerste westlich und nordwestlich Goslars.\\nSie entspringt in der Nähe von Hahnenklee im Oberharz und mündet ca. 12 km später bei Langelsheim in die Innerste. In Herzog Juliushütte, Gemeinde Astfeld bei Goslar wird sie zur Granetalsperre gestaut.\\nIhr Einzugsgebiet beträgt rund 45 km², davon 22 bis zum Staudamm."},{"page_url":"https://vi.wikipedia.org/wiki/Tr%E1%BA%ADn_n%C6%B0%E1%BB%9Bc_B%E1%BB%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Bundesarchiv_Bild_146-1974-061-61%2C_Belgien%2C_Kapitulation_der_belg._Armee.jpg","page_title":"Trận nước Bỉ","context_page_description":"Trận nước Bỉ hay Chiến dịch nước Bỉ là một phần trong trận chiến nước Pháp, cuộc tấn công lớn của Đức Quốc xã tại Tây Âu trong Chiến tranh thế giới thứ hai. Cuộc chiến này kéo dài 18 ngày trong tháng 5 năm 1940 và kết thúc bằng việc Đức chiếm đóng lãnh thổ Bỉ sau khi Quân đội Bỉ hạ vũ khí đầu hàng.\\nNgày 10 tháng 5 năm 1940, Quân đội Đức Quốc xã đã đồng loạt xâm chiếm Luxembourg, Hà Lan và Bỉ theo Kế hoạch Vàng. Quân đội Đồng Minh đã cố gắng ngăn chặn quân đội Đức tại Bỉ, và tin rằng đây chính là mũi tấn công chủ yếu của Đức. Sau khi các đơn vị mạnh nhất của Đồng Minh đã được huy động đầy đủ đến Bỉ trong các ngày 10–12 tháng 5, người Đức liền tiến hành giai đoạn 2 trong chiến dịch của họ bằng một cuộc đột phá qua vùng Ardennes, và tiến quân thẳng ra biển Manche. Quân Đức đã tiến đến bờ eo biển sau 5 ngày, và bao vây quân Đồng Minh ở phía bắc. Đức dần dần khép chặt vòng vây dồn đối phương ra biển. Quân đội Bỉ đầu hàng ngày 28 tháng 5 năm 1940, trận nước Bỉ kết thúc.\\nTrận nước Bỉ được biết đến là nơi diễn ra trận chiến xe tăng đầu tiên trong chiến tranh thế giới thứ hai, trận Hannut."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Empf%C3%A4nger_der_Fidicin-Medaille","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Fidicin-Medaille_in_Silber_Vorderseite.png","page_title":"Liste der Empfänger der Fidicin-Medaille","context_page_description":"Der Verein für die Geschichte Berlins verleiht seit 1872 die Fidicin-Medaille für Förderung der Vereinszwecke. Mit der Auszeichnung werden \\"Persönlichkeiten des öffentlichen Lebens sowie Mitglieder, die sich um die Aufgaben des Vereins, insbesondere die Erforschung der Berliner Geschichte, verdient gemacht haben\\", geehrt."},{"page_url":"https://it.wikipedia.org/wiki/Tornau_vor_der_Heide","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Wappen_Tornau_vor_der_Heide.png","page_title":"Tornau vor der Heide","context_page_description":"Tornau vor der Heide è una frazione del comune tedesco di Raguhn-Jeßnitz, nel land della Sassonia-Anhalt.\\nFino al 31 dicembre 2009 ha costituito un comune autonomo."},{"page_url":"https://hu.wikipedia.org/wiki/N%C3%B6v%C3%A9nyzeti_%C3%B6vek","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Greenland-sydkap_hg.jpg","page_title":"Növényzeti övek","context_page_description":"A Föld növényzeti övei az éghajlati öveknek megfelelően kialakult fitocönológiai formációcsoportok.\\nMinden éghajlati övnek megvan a maga sajátos növényzete. Az éghajlati és növényzeti övek elvileg párhuzamosak az Egyenlítővel, a valóság azonban jócskán különbözik ettől az elvi képtől. Az eltérés két fő oka:\\na tengerek és a szárazföldek egyenlőtlen területi megoszlása és\\na domborzat.\\nFőként ezek alakítják ki azokat a légkörzési rendszereket és tengeráramlatokat, amelyek jelentősen módosítják a szárazföldek klímáját. Az egyes éghajlati öveknek megfelelően alakulnak ki a Föld növényzeti övei.\\nA domborzat hatására a növényzetnek vertikális zonalitása is kialakul. Ezek az úgynevezett orografikus növénytársulások egy-egy növényzeti övön belül, intrazonális helyzetben fejlődnek ki a hegyvidék speciális éghajlati viszonyainak hatására. Ugyancsak intrazonálisak a kölönböző speciális élőhelyeken létrejött edafikus társulások.\\nAz egyes éghajlati öveket számos szerző jellemző növényzetük alapján nevezi meg, emiatt a kétféle terminológia gyakran keveredik.\\nA globális éghajlati öveket az egyes kontinensek sajátosságai, az éghajlat kisebb különbségei szerint kisebb egységekre osztják."},{"page_url":"https://pl.wikipedia.org/wiki/Dothideomycetes","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Alternaria_alternata-5_copie.jpg","page_title":"Dothideomycetes","context_page_description":"Dothideomycetes O.E. Erikss. & Winka – klasa grzybów z typu workowców, której typem nomenklatorycznym jest Dothidea. W tzw. \\"systemie Adla 2012\\" klad Dothideomycetes jest gałęzią kladu Pezizomycotina."},{"page_url":"https://ja.wikipedia.org/wiki/M110_203mm%E8%87%AA%E8%B5%B0%E6%A6%B4%E5%BC%BE%E7%A0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Military_Parades_Held_in_Tehran_to_Mark_National_Army_Day-29.jpg","page_title":"M110 203mm自走榴弾砲","context_page_description":"M110 203mm自走榴弾砲は、アメリカ合衆国で1950年代に開発された203mm榴弾砲 装備の自走榴弾砲である。同時に開発されたM107 175mm自走カノン砲は共通の車台を使用し搭載砲が異なる兄弟車種。"},{"page_url":"https://ca.wikipedia.org/wiki/Subfusell_B%C5%82yskawica","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/B%C5%82yskawica_and_other_insurgent_weapons.jpg","page_title":"Subfusell Błyskawica","context_page_description":"El subfusell Błyskawica, era un subfusell produït per l'Armia Krajowa, o l'exèrcit de defensa, un moviment de resistència polonesa per a lluitar contra les forces ocupants de l'exèrcit nazi a la Polònia ocupada. El subfusell Błyskawica va lluitar juntament amb el subfusell britànic Sten, més concretament, una variant polonesa d’aquest. Es poden observar algunes similituds entre els dos subfusells, el qual va ajudar a fer que el Błyskawica acabés sent l’única arma produïda en massa per forces insurgents en Europa, durant la Segona Guerra Mundial."},{"page_url":"https://es.wikipedia.org/wiki/Refugio_Reyes_Rivas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Museo_Regional_de_Aguascalientes_%281908%29_de_Refugio_Reyes_Rivas.jpg","page_title":"Refugio Reyes Rivas","context_page_description":"José Refugio Reyes Rivas ​ fue un arquitecto mexicano, autor de algunos de los edificios más representativos de la ciudad de Aguascalientes, donde su obra es considerada parte del patrimonio histórico y arquitectónico.​ Reyes no tuvo estudios profesionales de arquitectura, ​ por lo que es llamado: «arquitecto empírico».​ En 1985, recibió el título post mortem de arquitecto, concedido por la Universidad Autónoma de Aguascalientes.​\\nEntre sus obras más destacadas, se encuentran el Templo de San Antonio, la renovación del Templo de Guadalupe, el Templo de la Purísima Concepción, la edificación de diversos hoteles, como el París, el Francia, Regis y Washington, y del actual Museo de Aguascalientes. Varios de estos edificios son actualmente museos o forman parte de las instituciones gubernamentales del Estado y la ciudad de Aguascalientes."},{"page_url":"https://hu.wikipedia.org/wiki/Palmer_Eldritch_h%C3%A1rom_stigm%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/hu/9/93/Palmer3.jpg","page_title":"Palmer Eldritch három stigmája","context_page_description":"A Palmer Eldritch három stigmája Philip K. Dick tudományos-fantasztikus regénye, amely először 1965-ben jelent meg. Magyarul 2003-ban jelent meg Pék Zoltán fordításában az Agave Könyvek kiadásában.\\n1965-ben Nebula-díjra jelölték regény kategóriában, illetve 1966-ban elnyerte a Brit Science Fiction-díjat.\\nVallással kapcsolatos gondolatai miatt a megjelenése után a könyvet egyes kritikusok istenkáromlónak minősítették."},{"page_url":"https://de.wikipedia.org/wiki/H%C3%B6rste_(Lippstadt)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Hoerste_Kirche_02.jpg","page_title":"Hörste (Lippstadt)","context_page_description":"Hörste ist ein Dorf, das zur Stadt Lippstadt im Kreis Soest in Nordrhein-Westfalen gehört. Der Ort war Teil des Entenschnabels des Altkreises Büren."},{"page_url":"https://es.wikipedia.org/wiki/Resurrection_Fest","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Resurrection_Fest_2013_-_Trivium.jpg","page_title":"Resurrection Fest","context_page_description":"El Resurrection Fest es un festival de música que tiene lugar en la localidad de Viveiro, en la Parroquia de Celeiro, en la provincia de Lugo, España. Este festival, también popularmente conocido en España como El Resu, se celebra desde 2006 anualmente durante el verano, con un programa musical centrado en la escena metal, punk y hardcore. Desde su nacimiento ha conseguido convertirse en uno de los festivales más populares de España en su género por su especialización en la música extrema. En la edición de 2013 consiguió congregar a 33 000 asistentes, ​ generando un impacto socioeconómico de 3.3 millones de euros en la comarca.​ En 2015 estas cifras aumentaron a más de 54 500 personas y un impacto de 6.15 millones de euros.​ En 2016 consiguieron la cifra de 80 542 asistentes, situándolos como uno de los referentes de Europa y un impacto de 10.2 millones de euros.​"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B4%90%E7%B4%84%E8%8F%AF%E7%88%BE%E9%81%93%E5%A4%AB%E9%85%92%E5%BA%97","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Astoria_double_bedroom.jpg","page_title":"紐約華爾道夫酒店","context_page_description":"纽约华尔道夫酒店，或纽约华尔道夫-阿斯托里亚酒店是位于纽约曼哈顿中城的一处42层豪华酒店，正门在公园大道301号，不过酒店的整群建筑物占据公园大道与莱克星顿大道及东49街与东50街之间的整个街区。"},{"page_url":"https://en.wikipedia.org/wiki/Voodoo_Macbeth","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Lafayette-Theatre-Macbeth-1936-3.jpg","page_title":"Voodoo Macbeth","context_page_description":"The Voodoo Macbeth is a common nickname for the Federal Theatre Project's 1936 New York production of William Shakespeare's Macbeth. Orson Welles adapted and directed the production, moved the play's setting from Scotland to a fictional Caribbean island, recruited an entirely Black cast, and earned the nickname for his production from the Haitian vodou that fulfilled the role of Scottish witchcraft. A box office sensation, the production is regarded as a landmark theatrical event for several reasons: its innovative interpretation of the play, its success in promoting African-American theatre, and its role in securing the reputation of its 20-year-old director."},{"page_url":"https://fr.wikipedia.org/wiki/Oliver_Twist","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/The_Writings_of_Charles_Dickens_v4_p306_%28engraving%29.jpg","page_title":"Oliver Twist","context_page_description":"Oliver Twist, de son titre complet en anglais : Oliver Twist, or The Parish Boy's Progress, l'un des romans les plus universellement connus de Charles Dickens, a été publié en trente-deux feuilletons mensuels dans la revue Bentley's Miscellany, entre février 1837 et avril 1839, juin et octobre 1837 exceptés.\\nL'histoire concerne un orphelin, Oliver Twist, soumis à des privations et des vexations dans l'hospice paroissial où il fut laissé suite à la mort de sa mère. Choisi par tirage au sort par ses camarades affamés, il ose demander une portion supplémentaire de gruau et il est alors placé chez un croque-mort, d'où il s'échappe pour prendre la route de Londres ; dès son arrivée, il rencontre l'un des personnages les plus célèbres de Dickens, The Artful Dodger — nom traduit par Rusé matois pour Alfred Gérardin en 1893 et Le Renard dans la collection Pléiade —, chef d'une bande de jeunes pickpockets. Naïvement confiant en son nouveau compagnon, il se laisse entraîner dans l'antre de son maître, le criminel Fagin."},{"page_url":"https://en.wikipedia.org/wiki/Abdolhossein_Zarrinkoob","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Zarinkoub.jpg","page_title":"Abdolhossein Zarrinkoob","context_page_description":"Abdolhossein Zarrinkoub was a scholar of Iranian literature, history of literature, Persian culture and history.\\nHe was born on March 19, 1923, in Borujerd, Iran, received his PhD from Tehran University in 1955 under the supervision of Badiozzaman Forouzanfar, and held faculty positions at universities such as Oxford University, Sorbonne, and Princeton University."},{"page_url":"https://es.wikipedia.org/wiki/Asioryctitheria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Asioryctes_nemegtensis.jpg","page_title":"Asioryctitheria","context_page_description":"Los asiorictiterios es un orden extinto de mamíferos euterios primitivos. Sus fósiles provienen del período Cretácico de Asia."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D8%B1%D8%AF%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Werdohl-SuederlaenderVolksfreund1-Bubo.JPG","page_title":"وردل","context_page_description":"وردل آلمانین نوردراین-وستفالن ایالتینده یئر آلان بیر شهردیر و ۱۶۲ - ۴۴۸ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۱۹۱۷۱ نفر دیر. بۇ شهرین ۳۳٫۳۵ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%E1%BA%A3ng_%C4%90%E1%BB%99c_l%E1%BA%ADp_Puerto_Rico","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Flag_of_the_Puerto_Rican_Independence_Party.svg","page_title":"Đảng Độc lập Puerto Rico","context_page_description":"Đảng Độc lập Puerto Rico, thành lập năm 1946, là một đảng chính trị của Puerto Rico.\\nMục đích của đảng này là giành độc lập cho Puerto Rico từ Hoa Kỳ. Người lãnh đạo hiện nay của đảng là Rubén Berríos Martínez."},{"page_url":"https://ca.wikipedia.org/wiki/Matrimoni_homosexual","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Tchemiguel_Li%C3%A8ge_Willy_Demeyer.jpg","page_title":"Matrimoni homosexual","context_page_description":"El matrimoni homosexual o matrimoni entre persones del mateix sexe és el reconeixement social, cultural i jurídic que regula la relació i convivència de dues persones del mateix sexe, amb iguals requisits i efectes que els existents per als matrimonis entre persones de diferent sexe.\\nCom a alternativa a aquesta institució, existeixen altres institucions civils, que difereixen segons la regió o el país, i amb diferents denominacions com ara \\"parelles de fet\\", \\"unions civils\\" o \\"concubinats\\", tot i que sovint són criticades pels moviments de defensa dels drets dels homosexuals per ser insuficients o discriminatoris.\\nActualment, el matrimoni homosexual és totalment legal als següents Estats:\\nPaïsos Baixos\\nBèlgica\\nEspanya\\nCanadà\\nSud-àfrica\\nNoruega\\nSuècia\\nPortugal\\nIslàndia\\nArgentina\\nDinamarca\\nUruguai\\nNova Zelanda\\nFrança\\nBrasil\\nRegne Unit\\nLuxemburg\\nEstats Units d'Amèrica\\nIrlanda\\nColòmbia\\nFinlàndia\\nMalta\\nAlemanya\\nAustràlia\\nÀustria\\nTaiwan\\nEquador\\nCosta Rica\\nEl juny 2015, la Cort Suprema dels Estats Units va declarar, amb cinc vots contra quatre, que la llei de la defensa del matrimoni que limitava el matrimoni a persones de sexe diferent era una discriminació contrària a la Constitució."},{"page_url":"https://sv.wikipedia.org/wiki/Plainville,_Connecticut","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Plainfield_CT_lg.PNG","page_title":"Plainville, Connecticut","context_page_description":"Plainville är en kommun i Hartford County i delstaten Connecticut, USA med cirka 17 328 invånare. Den har enligt United States Census Bureau en area på totalt 25,4 km² varav 0,1 km² är vatten."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D0%B0%D0%B2%D1%83%D0%BD%D1%86%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Reitter_Dytiscus_u.a..jpg","page_title":"Плавунцы","context_page_description":"Плавунцы́ — семейство водных насекомых из отряда жесткокрылых. В мировой фауне встречаются более 4000 видов этих жуков. В российской фауне встречаются около 300 видов из 14 триб."},{"page_url":"https://en.wikipedia.org/wiki/2017_French_presidential_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Portrait_3_-_Flickr_-_dupontaignan_%28cropped%29.jpg","page_title":"2017 French presidential election","context_page_description":"The 2017 French presidential election was held on 23 April and 7 May 2017. As no candidate won a majority in the first round, a runoff was held between the top two candidates, Emmanuel Macron of En Marche! and Marine Le Pen of the National Front, which Macron won by a decisive margin. The presidential election was followed by a legislative election to elect members of the National Assembly on 11 and 18 June. Incumbent President François Hollande of the Socialist Party was eligible to run for a second term, but declared on 1 December 2016 that he would not seek reelection in light of low approval ratings, making him the first incumbent head of state of the Fifth Republic not to seek reelection.\\nFrançois Fillon of The Republicans —after winning the party's first open primary—and Marine Le Pen of the National Front led first-round opinion polls in November 2016 and mid-January 2017."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%A8%D7%99%D7%9F_%D7%93%D7%99%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Greenday2010.jpg","page_title":"גרין דיי","context_page_description":"גרין דיי היא להקת פאנק רוק אמריקנית, הפועלת משנת 1987. חברי הלהקה הם הסולן והגיטריסט בילי ג'ו ארמסטרונג, הגיטריסט המוביל ג'ייסון וייט, הבסיסט מייק דירנט והמתופף טרה קול. רוב שירי הלהקה עוסקים בסמים, שפיות, אמונה, פוליטיקה, ביקורת כלפי החברה, פרשות הדרכים שבחיים ויחסים רומנטיים. מאז אלבומה השביעי הלהקה עברה שינוי תדמיתי אשר כלל בין היתר איפור עיניים, לבישת עניבות ובעיקר מעבר חלקי מסוגת הפאנק רוק לסוגת הרוק האלטרנטיבי.\\nבאלבום ה-12 שלה, חזרה הלהקה למקורותיה ולמוזיקת הפאנק.\\nבראשיתה הייתה הלהקה חלק מסצנת הפאנק המקומית של העיר אוקלנד. המיני אלבומים המוקדמים של הלהקה, שהוצאו בחברת התקליטים העצמאית Lookout! Records, יצרו את גרעין המעריצים שלה. בשנת 1994, הפך אלבום השלישי של הלהקה, Dookie, לאלבום הפריצה שלה, ונמכרו ממנו מעל 10 מיליון עותקים בארצות הברית ו-16 מיליון ברחבי העולם. שלושת האלבום הבאים של גרין דיי היו: Insomniac, ‏ Nimrod.‎ ו-Warning:‎. שלושתם לא הצליחו להשיג הצלחה מסיבית כמו של Dookie, אך הם עדיין הצליחו בביקורות ובמכירות, ושניים מהם הגיעו לפלטינה כפולה ו-Warning:‎ הגיע לאלבום זהב. בשנת 2004 גרין דיי הוציאה את האלבום השביעי שלה, American Idiot, שהצית מחדש את הפופולריות של הלהקה עם הדור הצעיר, ונמכר בחמישה עשר מיליון עותקים בארצות הברית."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%A1%E5%B1%B1%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Nijozan_Ryozanji_05.JPG","page_title":"両山寺","context_page_description":"両山寺は岡山県久米郡美咲町に所在する寺院である。山号は二上山。詳しくは、二上山 蓮華院 両山寺と号する。宗派は高野山真言宗。本尊は聖観音。高野山真言宗美作八十八ヶ所第二十四番札所である。\\n御詠歌：見渡せば 只白妙の 玉くしげ 二上山の 雪の曙"},{"page_url":"https://de.wikipedia.org/wiki/Schlafwagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/CIWL-WL1764A%2C_1908_MAN.JPG","page_title":"Schlafwagen","context_page_description":"Ein Schlafwagen ist ein Reisezugwagen, der liegendes Reisen ermöglicht. Die internationale Bauart-Bezeichnung für Schlafwagen ist WL von französisch wagon-lit. Vom Schlafwagen zu unterscheiden ist der Liegewagen, der geringeren Komfort und mehr Liegen pro Abteil aufweist. Für die Benutzung von Schlafwagen werden entweder zusätzliche Entgelte in Form von Zuschlägen oder entsprechend höhere Tarifstufen, bei denen die Nutzung des Schlafwagens inklusive ist, erhoben."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9E%A0%EC%8B%A4%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Jamsil_Intersection_Seoul.jpg","page_title":"잠실역","context_page_description":"잠실역은 서울특별시 송파구 잠실동에 있는 서울 지하철 2호선과 서울 지하철 8호선의 환승역이다. 송파구청은 서울특별시 고시로 정한 병기역명이다. 서울 지하철 2호선은 이 역부터 신림역까지 지하 구간이다.\\n서울 지하철 8호선의 역사가 서울 지하철 2호선의 역이 위치한 잠실역사거리에서 송파대로 방향으로 꺾어지는 곡선형 역으로 설계되어 있기 때문에 두 노선 역간 거리가 약 200m 이상으로 멀다. 서울 지하철 8호선 심야에 1편성이 주박한다."},{"page_url":"https://nn.wikipedia.org/wiki/Kristin_Asbj%C3%B8rnsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Kristin_Asbj%C3%B8rnsen_Jazz_p%C3%A5_J%C3%B8lst_2019_%28211431%29.jpg","page_title":"Kristin Asbjørnsen","context_page_description":"Kristin Asbjørnsen er ein norsk jazzvokalist."},{"page_url":"https://de.wikipedia.org/wiki/Urban_Camping","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Vild_camping_i_Tegn%C3%A9rlunden%2C_Stockholm.jpg","page_title":"Urban Camping","context_page_description":"Urban Camping oder auch High Camping ist die Bezeichnung für einen modischen Trend, auf den Flachdächern von Häusern oder im öffentlichen Raum von Städten zu zelten. Bezeichnet wird diese Art zu zelten auch als stealth camping oder guerrilla camping, Begriffe, die den illegalen Aspekt von Urban Camping betonen. Probleme mit Polizei und Justiz bei Urban Camping können sich ergeben, wenn Eigentümer der Flachdächer oder Kommunen von ihrem Hausrecht Gebrauch machen.\\nDas Urban Camping ist durch ein Mitglied der CouchSurfing-Community entstanden, eine Onlinecommunity, deren Mitglieder sich gegenseitig Schlafplätze zur Verfügung stellen. Unter den Begriff fällt auch das Campen auf öffentlichen Plätzen und Bürgersteigen, beispielsweise um auf das Öffnen von Ticket-Schaltern bei bestimmten Veranstaltungen zu warten."},{"page_url":"https://fr.wikipedia.org/wiki/Rivage_(Sprimont)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Tunnel_Liotte_L_42_a_Br%C3%A9ck_iwwer_Ambl%C3%A8ve_L_43.jpg","page_title":"Rivage (Sprimont)","context_page_description":"Rivage est un hameau belge de la commune de Sprimont en province de Liège.\\nAvant la fusion des communes de 1977, Rivage faisait partie de la commune de Comblain-au-Pont."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D9%8A%D9%84_%D9%86%D8%A7%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Travis_Knight_%2830000495292%29.jpg","page_title":"فيل نايت","context_page_description":"فيليب هامبسون \\"فيل\\" نايت ‏ رجل أعمال وفاعل خير أمريكي. ولد فيل في بورتلاند ولاية أوريغون، وهو المؤسس المشارك والرئيس الفخري لشركة نايكي، كما عمل في السابق في منصب رئيس الشركة ومدير الشركة التنفيذي. في نوفمبر 2015، وضعته مجلة فوربس في المركز الخامس عشر شخصا الأغنى في العالم، بصافي ثروة بلغت 28.1 مليار دولار أمريكي.\\nفيل هو صاحب إستديو لايكا لتقنية إيقاف الحركة في الرسوم المتحركة.\\nتخرج فيل من كلية ستانفورد للدراسات العليا في إدارة الأعمال، جامعة ولاية أوريغون. وقد تبرع بمئات الملايين من الدولارات لكلتا الكليتين، في عام 2006، تم اعتبار فيل صاحب أكبر تبرع في تاريخ كلية ستانفورد. في عام 2016، حقق فيل رقما قياسيا جديدا ليصبح هو أكبر متبرع فردي بعد تبرعه بمبلغ 400 مليون لجامعة أوريغون لصالح برنامج ستانفورد الجديد باحثين هينيسي نايت.\\nيعرف عن فيل مشاركته في الأنشطة الطلابية فعلى سبيل المثال ركض فيل تحت قيادة الكابتن بيل باورمان في جامعة ولاية أوريغون، الذي ساهم أيضا في تأسيس شركة نايكي."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B0%D0%B9%D0%B7%D0%B5%D0%BB%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Weisel-1.jpg","page_title":"Вайзель","context_page_description":"Вайзель — громада в Німеччині, розташована в землі Рейнланд-Пфальц. Входить до складу району Рейн-Лан. Складова частина об'єднання громад Лорелай.\\nПлоща — 13,06 км². Населення становить 1057 ос."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%80%D0%B0%D0%B2%D0%BC%D0%B0_%D1%81%D0%BF%D0%B8%D0%BD%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BC%D0%BE%D0%B7%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Man_falling_of_horse.jpg","page_title":"Травма спинного мозку","context_page_description":"Травма спинного мозку — це пошкодження спинного мозку внаслідок зовнішнього механічного впливу, що викликає тимчасові або постійні зміни його функцій: втрату рухової функції та мʼязової активності, порушення чутливості або вегетативних функцій в частинах тіла, що інервуються спинним мозком, зазвичай, нижче рівня травми. Травма може виникнути на будь-якому рівні спинного мозку і може викликати повне пошкодження, та цілковиту втрату відчуттів і функцій м'язів; або неповне, коли ще деякі нервові сигнали здатні пройти повз травмовану ділянку спинного мозку. Залежно від локалізації та тяжкості пошкодження симптоми різняться, від затерплості до паралічу та нетримання сечі. Довгострокові результати також варіантні — від повного одужання до постійної тетраплегії або параплегії. Ускладнення можуть включати атрофію м'язів, пролежні, інфекції та проблеми з диханням через параліч чи парез дихальної мускулатури.\\nУ більшості випадків пошкодження спинного мозку є наслідком фізичної травми, наприклад, автомобільної аварії, вогнепального поранення, падіння або спортивні травми, але воно може бути й наслідком немеханічних причин, таких як зараження, недостатнє кровопостачання та пухлини."},{"page_url":"https://cs.wikipedia.org/wiki/Kamp%C3%A1nie","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Napoli_piazza_plebiscito.JPG","page_title":"Kampánie","context_page_description":"Kampánie je kraj v jižní Itálii. Na severozápadě sousedí s Laziem, na severu s Molise, na severovýchodě s Apulií, na východě s Basilicatou a na západě s Tyrhénským mořem. Region má rozlohu 13 590 km², 5,8 milionu obyvatel. Dělí se na 4 provincie: Avellino, Benevento, Caserta, Salerno a metropolitní město Napoli. Hlavním městem je Neapol. Dominantou kraje je činná sopka Vesuv.\\nJméno Kampánie pochází od Římanů, kteří oblast nazývali Campania felix, stejný základ je i v názvu francouzské provincie Champagne."},{"page_url":"https://de.wikipedia.org/wiki/Evangelisch-Reformierte_Kirche_des_Wallis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Reformierte_Kirche_Le_Bouveret_1.jpg","page_title":"Evangelisch-Reformierte Kirche des Wallis","context_page_description":"Die Evangelisch Reformierte Kirche des Wallis ist eine Mitgliedskirche der Evangelisch-reformierten Kirche Schweiz."},{"page_url":"https://pl.wikipedia.org/wiki/Atmosfera_Wenus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Warstwy_atmosfery_Wenus.svg","page_title":"Atmosfera Wenus","context_page_description":"Atmosfera Wenus – warstwa gazów otaczająca planetę Wenus.\\nSkłada się głównie z dwutlenku węgla i jest dużo gęstsza oraz gorętsza od atmosfery Ziemi. Temperatura przy powierzchni planety wynosi 740 K, ciśnienie 93 bary, natomiast gęstość 67 kg/m³. W atmosferze Wenus obecne są nieprzezroczyste chmury kwasu siarkowego, co powoduje, że powierzchnia planety nie jest widoczna ani z Ziemi, ani sond orbitalnych – jej ukształtowanie znane jest wyłącznie na podstawie badań radarowych. Oprócz dwutlenku węgla drugim głównym składnikiem atmosfery jest azot, którego zawartość wynosi 3,5%; pozostałe gazy znajdują się w ilościach śladowych.\\nPoza samą powierzchnią, gdzie wiatry nie przekraczają 2,8 m/s, atmosfera Wenus znajduje się w intensywnym ruchu. W najniższej z jej warstw, troposferze, wieją potężne wiatry. Prędkość ta jest szczególnie duża w porównaniu z powolną rotacją Wenus: planeta obraca się wokół własnej osi w ciągu 243 dni ziemskich, wiatry natomiast okrążają ją w jedynie 4 dni, czyli 60 razy szybciej – zjawisko to nazywane jest superrotacją. Ponad troposferą znajduje się spokojniejsza pod tym względem mezosfera, a ponad nią termosfera."},{"page_url":"https://fr.wikipedia.org/wiki/Waje","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Wajeh.jpg","page_title":"Waje","context_page_description":"Aituaje Iruobe, connue sous le nom de Waje, est une chanteuse nigériane. Elle a notamment participé au remake Omoge Mi de P-Square et a participé au duo de voix pour l'enregistrement de Do Me. Elle a également interprété des pièces de Banky W et M.I. En 2016, elle est l'une des quatre juges de la première saison de la version nigériane de The Voice."},{"page_url":"https://ast.wikipedia.org/wiki/Ex%C3%A9rcitu_Imperial_Alem%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Bundesarchiv_Bild_183-P1013-316%2C_Westfront%2C_deutscher_Panzer_in_Roye.jpg","page_title":"Exércitu Imperial Alemán","context_page_description":"L'Exércitu alemán yera'l nome dau a les fuercies combinaes del Imperiu alemán, conocíes igualmente como Exércitu Imperial o Exércitu Imperial Alemán. La espresión Deutsches Heer tamién s'usa nel exércitu alemán modernu pal componente de tierra Bundeswehr. L'exércitu alemán imperial foi formáu cuando se creó l'Imperiu alemán en 1871 y duró hasta 1919 cola derrota del exércitu alemán na I Guerra Mundial, y foi l'antecesor de la Reichswehr."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D0%B8%D0%B4%D0%BE%D0%B2_%D0%BC%D1%83%D1%80%D0%B0%D0%B2%D1%8C%D1%91%D0%B2_%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Monomorium_floricola_casent0053986_profile_1.jpg","page_title":"Список видов муравьёв Швеции","context_page_description":"Список видов муравьёв Швеции включает все виды муравьёв, обитающих в Швеции. Список состоит из биноменов, местного названия и охранного статуса. Всего на территории Швеции обнаружено 80 видов муравьёв из 21 рода и 4 подсемейств."},{"page_url":"https://de.wikipedia.org/wiki/%C5%A0koda_Transportation","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Tram_13T_Brno%281%29.jpg","page_title":"Škoda Transportation","context_page_description":"Škoda Transportation a.s. ist ein tschechisches Maschinenbauunternehmen mit Sitz in Pilsen. Der Schwerpunkt der Aktivitäten ist im Bereich der Verkehrstechnik. Das Unternehmen entstand aus dem Maschinenbaukonzern Škoda, hat zusammen mit dem Automobilhersteller Škoda Auto geschichtsbedingt den gleichen Namen und Logo, aber keine Zugehörigkeit zum Volkswagen-Konzern."},{"page_url":"https://fr.wikipedia.org/wiki/Kirchzarten","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Kirchzarten%2C_die_Sankt_Gallus_Kirche_foto6_2013-07-25_14.20.jpg","page_title":"Kirchzarten","context_page_description":"Kirchzarten est une commune de Bade-Wurtemberg, située dans l'arrondissement de Brisgau-Haute-Forêt-Noire, dans le district de Fribourg-en-Brisgau. Elle compte 9 768 habitants sur 21,14 km²."},{"page_url":"https://nl.wikipedia.org/wiki/Robert_Trent_Jones","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Golf_course_-_Green_Lakes_State_Park.jpg","page_title":"Robert Trent Jones","context_page_description":"Robert Trent Jones was een Amerikaanse golfbaanarchitect."},{"page_url":"https://hu.wikipedia.org/wiki/Gare_de_Gammal","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Gammal_rail_halt_Moli%C3%A8res-sur-C%C3%A8ze_9458.JPG","page_title":"Gare de Gammal","context_page_description":"Gare de Gammal vasútállomás Franciaországban, Molières-sur-Cèze településen."},{"page_url":"https://eo.wikipedia.org/wiki/Fungoroko","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Timna_5.JPG","page_title":"Fungoroko","context_page_description":"Fungorokoj estas izolite starantaj rokoj kun mallarĝa piedo kaj larĝa supera parto, kiuj povas ekesti per diversaj kondiĉoj.\\nEn arida klimato fungorokoj ekestas per grundoproksima ventŝlifado. En senvegeta ĉirkaŭejo okazas sabloŝtormoj, kiuj izolite starantajn rokojn pritraktas kiel sabloŝprucigilo. La pli pezaj kaj pli grandaj eroj moviĝas pli proksime al la grundo kaj pro tio ŝlifas la rokon malsupre pli forte ol supre; tie konserviĝas pli da materialo - la \\"fungo\\".\\nEn humida klimato fungorokaj formoj povas ekesti sekve de diversaj malmolecoj en la petro. Kondiĉo estas, ke sub malmola tavolo kuŝas pli mola, kiun la veterdisfalo pli forte atakas. Sed pro la klimataj kaj vegetaĵaraj kondiĉoj la formoj estas malpli klare ĉizitaj ol en aridaj ekestokondiĉoj de la dezerto. Ŝanceliĝoŝtonoj estas parenca formtipo.\\nAnkaŭ rivera erozio kaj ondofrapado en marborda regiono povas generi fungorokojn."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%A8%D9%88%D9%85_%D8%A7%D9%84%D8%B9%D9%85%D9%84%D8%A7%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Verreaux%27s_Eagle_Owl_in_Larsens_Camp.jpg","page_title":"البوم العملاق","context_page_description":"البوم العملاق هو طائر جارح ليلي من إفريقيا السوداء، وهو من فصيلة البوم الحقيقي من رتبة البومات العقابية. وهو ثالث أكبر بوم في العالم بعد بوم بلاكستون الصياد و البوم النسّاريّ."},{"page_url":"https://de.wikipedia.org/wiki/Gottlieb_Gerhard_Titius","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Gottlieb-Gerhard-Titius.jpg","page_title":"Gottlieb Gerhard Titius","context_page_description":"Gottlieb Gerhard Titius war ein deutscher Rechtswissenschaftler."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%89%D5%AB%D5%B6%D5%A1%D5%BD%D5%BF%D5%A1%D5%B6%D5%B8%D6%82%D5%B4_%D5%85%D5%88%D5%92%D5%86%D4%B5%D5%8D%D4%BF%D5%95-%D5%AB_%D5%80%D5%A1%D5%B4%D5%A1%D5%B7%D5%AD%D5%A1%D6%80%D5%B0%D5%A1%D5%B5%D5%AB%D5%B6_%D5%AA%D5%A1%D5%BC%D5%A1%D5%B6%D5%A3%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Tianzhushan.JPG","page_title":"Չինաստանում ՅՈՒՆԵՍԿՕ-ի Համաշխարհային ժառանգության ցանկ","context_page_description":"Միավորված ազգերի Կրթության, գիտության և մշակույթի կազմակերպության Համաշխարհային ժառանգության ցանկում երկրորդ տեղը զբաղեցնում է Չինաստանը։ 1985 թվականի դեկտեմբերի 12-ին միանալով «Համաշխարհային մշակութային և բնական ժառանգության պաշտպանման կոնվենցիային»՝ այն ներկայացնում է Համաշխարհային ժառանգության 50 օբյեկտներ, որոնցից 35-ը մշակութային վայրեր էին, 11-ը՝ բնական, և 4-ը՝ խառը ։ 2017 թվականի դրությամբ Չինաստանի տարածքում ևս 61 օբյեկտ ներգրավված է Համաշխարհային ժառանգության ցանկում։\\nՉինաստանի ամենաարժեքավոր և հարուստ զբոսաշրջային աղբյուրների հիմնական մասը ներառված է այս ցանկում։"},{"page_url":"https://nl.wikipedia.org/wiki/Phillip_Dormer_Stanhope","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Philip_Stanhope%2C_4th_Earl_of_Chesterfield.PNG","page_title":"Phillip Dormer Stanhope","context_page_description":"Phillip Dormer Stanhope, de 4e graaf van Chesterfield was een Brits staatsman en schrijver. Hij studeerde te Cambridge en ging in 1714 in Parijs wonen. Onder koning George I werd hij kamerheer bij de Prins van Wales en lid van het Lagerhuis; na zijn vaders dood, in 1726 werd hij lid van ’t Hogerhuis. In 1727 ging hij als buitengewoon gezant naar Holland, waar hij een groot bewonderaar werd van de raadspensionaris Simon van Slingelandt en onder diens invloed kwam. Pogingen van de orangisten in 1729 om een volksbeweging te verwekken ten gunste van de prins, die gevaarlijk kon worden voor Van Slingelandt, vonden bij hem geen steun. In zijn dienst was Vincent la Chapelle, een Franse kok en vrijmetselaar, die in 1733 The modern cuisine publiceerde en een betrekking bij prins Willem IV accepteerde.\\nIn 1731 werd hij opperhofmeester van George II en sloot vriendschap met Robert Walpole. Hij werd in 1744 vice-koning van Ierland en in 1746 secretaris van Staat; door doofheid was hij genoodzaakt zich uit het openbare leven terug te trekken en wijdde zich aan het schrijven. Groot opzien baarde zijn Letters to his son."},{"page_url":"https://pl.wikipedia.org/wiki/North_Newnton","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/St._James_church_North_Newnton_%28geograph_1946978%29.jpg","page_title":"North Newnton","context_page_description":"North Newnton – wieś i civil parish w Anglii, w hrabstwie Wiltshire. W 2011 roku civil parish liczyła 430 mieszkańców. North Newnton jest wspomniana w Domesday Book jako Newetone."},{"page_url":"https://en.wikipedia.org/wiki/Roseland_Plantation","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Roseland_Plantation_entrance_gate.JPG","page_title":"Roseland Plantation","context_page_description":"Roseland Plantation is a historic plantation complex site in Faunsdale, Alabama. The site is situated on a low hill at the end of a long driveway on the overgrown estate. It was added to the National Register of Historic Places on January 20, 1994 as a part of the Plantation Houses of the Alabama Canebrake and Their Associated Outbuildings Multiple Property Submission."},{"page_url":"https://en.wikipedia.org/wiki/Cr%C3%AApe_(textile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Woman%27s_Ball_Gown_LACMA_M.2007.211.939_%282_of_3%29.jpg","page_title":"Crêpe (textile)","context_page_description":"Crêpe, also spelt crepe or crape, is a silk, wool, or synthetic fiber fabric with a distinctively crisp, crimped appearance. The term crape typically refers to a form of the fabric associated specifically with mourning. Crêpe is also historically called crespe or crisp."},{"page_url":"https://nn.wikipedia.org/wiki/Dvergrugder","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Coenocorypha_barrierensis.jpg","page_title":"Dvergrugder","context_page_description":"Coenocorypha er ei biologisk slekt av små vadefuglar i snipefamilien med fellesnamnet dvergrugder på norsk. Dei finst no berre på små øyar i øygrupper innanfor det politiske New Zealand. Tre nolevande artar er godkjente, og ein kjenner for tida minst fire utdøydde artar. Langnebbdvergrugde har tre underartar, inkludert ein på Campbelløyane som blei oppdaga så seint som i 1997. Slekta var ein gong distribuert på Fiji, over hovudøyane på New Zealand, Stewart Island/Rakiura og sørover til dei subantarktiske øyane i landet, men predasjon av introduserte artar, spesielt rotter, har drastisk redusert utbreiinga av denne slekta. Dagens utbreiing av slekta er avgrensa til små øyar innanfor Chathamøyane, Snaresøyane, Campbelløyane, Antipodesøyane og Aucklandøyane."},{"page_url":"https://eu.wikipedia.org/wiki/Ploun%C3%A9vez-Lochrist","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Ploun%C3%A9vez-Lochrist_%2829%29_Chapelle_de_Lochrist-an-Izevel_03.jpg","page_title":"Plounévez-Lochrist","context_page_description":"Plounévez-Lochrist Bretainiako Finistère departamenduko udalerri bat da."},{"page_url":"https://en.wikipedia.org/wiki/Brian_Witherspoon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Brian_Witherspoon.jpg","page_title":"Brian Witherspoon","context_page_description":"Brian Witherspoon is an American track and field runner and former American football cornerback and return specialist. He was signed by the Jacksonville Jaguars as an undrafted free agent in 2008. He played college football at Stillman."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Frankish_kings","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Portrait_Roy_de_france_Chilperic_II.jpg","page_title":"List of Frankish kings","context_page_description":"The Franks were originally led by dukes and reguli. The Salian Merovingians rose to dominance among the Franks and conquered most of Roman Gaul. They also conquered the Gaulish territory of the Visigothic Kingdom in 507. The sons of Clovis conquered the Burgundians and Alamanni. They acquired Provence and made the Bavarii and Thuringii their clients. The Merovingians were later replaced by a new dynasty called the Carolingians in the 8th century. By the end of the 9th century, the Carolingians themselves were replaced throughout much of their realm by other dynasties.\\nA timeline of Frankish rulers is difficult since the realm was, according to old Germanic practice, frequently divided among the sons of a leader upon his death and then eventually reunited through marriage, treaty, or conquest. Thus, there were often multiple Frankish kings ruling different territories, and divisions of those territories was inconsistent over time."},{"page_url":"https://eu.wikipedia.org/wiki/Lauaxeta","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Vitoria_-_Monumento_al_poeta_Lauaxeta.jpg","page_title":"Lauaxeta","context_page_description":"Estepan Urkiaga Basaraz, ezagunagoa Lauaxeta ezizenaz, euskal idazlea eta kazetaria zen. Bere ezizena \\"Lau Haizetara\\", hau da, jaio zen baserriaren izenaren kontrakziotik dator."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%88%D8%B3%D9%81%D8%A7%D9%84%D8%AF%D9%88_%D8%A7%D9%84%D9%88%D9%86%D8%B3%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Alonso_running.jpg","page_title":"اوسفالدو الونسو","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاوسفالدو الونسو لاعب كورة قدم من امريكا و كوبا."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%81%D0%B8%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Wal-Mart_checkout.jpg","page_title":"Кассир","context_page_description":"Кассир — работник, который осуществляет прием, хранение и учет денежной наличности.\\nВ зависимости от специфики работы, выделяются кассиры торговых предприятий, банковские кассиры, валютные кассиры, работники билетных касс, кассиры-бухгалтеры.\\nКассиры торговых предприятий подсчитывают, на какую сумму покупателем приобретен товар, и производят расчеты наличными деньгами или по пластиковой карте с использованием контрольно-кассовой техники. Кассир должен знать признаки подлинных банкнот и уметь отличать их от поддельных как с помощью ультрафиолетового детектора, так и на глаз.\\nКассиры билетных касс театров, кинотеатров, концертных залов, музеев продают билеты. Кассиры театров, кинотеатров, музеев также должны помочь посетителю с выбором места в зале.\\nВалютные кассиры производят обмен валюты. Кассиры-операционисты в банках производят различные банковские операции.\\nРабота кассира потенциально опасна из-за угрозы разбойного нападения."},{"page_url":"https://de.wikipedia.org/wiki/Kai-Uwe_von_Hassel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Kai-Uwe_von_Hassel.jpg","page_title":"Kai-Uwe von Hassel","context_page_description":"Kai-Uwe von Hassel war ein deutscher Politiker.\\nEr war von 1954 bis 1963 Ministerpräsident des Landes Schleswig-Holstein, von 1963 bis 1966 Bundesminister der Verteidigung, von 1966 bis 1969 Bundesminister für Vertriebene, Flüchtlinge und Kriegsgeschädigte und von 1969 bis 1972 Präsident des Deutschen Bundestages."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A8%D9%B9%D9%84%D8%B1_%D9%B9%D8%A7%D8%A4%D9%86_%D8%B4%D9%BE%D8%8C_%D9%85%D9%88%D9%86%D9%B9%DA%AF%D9%85%D8%B1%DB%8C_%DA%A9%D8%A7%D8%A4%D9%86%D9%B9%DB%8C%D8%8C_%D8%A7%D9%88%DB%81%D8%A7%D8%A6%DB%8C%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Samuel_Martindale_House.jpg","page_title":"بٹلر ٹاؤن شپ، مونٹگمری کاؤنٹی، اوہائیو","context_page_description":"بٹلر ٹاؤن شپ، مونٹگمری کاؤنٹی، اوہائیو ریاستہائے متحدہ امریکا کا ایک township of Ohio جو مونٹگمری کاؤنٹی، اوہائیو میں واقع ہے۔"},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%96%D0%B0%D0%B0%D0%BD_%D0%92%D1%8D%D1%80%D0%B4%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Joan_Verdu_2013_Catalonia.jpg","page_title":"Жаан Вэрду","context_page_description":"Жаан Вэрду Фэрнандэс — гішпанскі футбаліст, паўабаронца кітайскага клюбу «Цындао Хайню»."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E4%B8%9C%E5%8C%97%E5%B9%B3%E5%8E%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/LocationSonghua.PNG","page_title":"东北平原","context_page_description":"東北平原位於中國東北部大興安嶺、小興安嶺和長白山之間，北起嫩江中游，南至遼東灣，海拔大多低於200米，面積達35萬平方公里，是中國面積最大的平原。東北平原土層厚，土地肥沃，耕地廣闊，屬於世界三大黑土區其中之一，是中國主要的糧食產區。"},{"page_url":"https://eo.wikipedia.org/wiki/Listo_de_la_kasteloj_de_Bretonio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Ch%C3%A2teau_de_la_Roche-Jagu_flickr.jpg","page_title":"Listo de la kasteloj de Bretonio","context_page_description":"Unue la kasteloj:\\nKastelo de l'Argentaye en Saint-Lormel\\nKastelo de Beaussais en Trégon\\nKastelo de Bienassis, 15-a kaj 16-a jc, en Erquy. Parko kaj ĝardenoj. Klasita MH\\nKastelo de Caradeuc, en Plouasne\\nKastelo de Coatfrec, en Ploubezre. Registrita MH\\nKastelo de Coat-an-Noz, en Belle-Isle-en-Terre\\nKastelo de Costaérès, en Trégastel\\nKastelo de Dinan, en Dinan. Muzeo. Klasita MH\\nKastelo de Geoffroy Baluçon en Plessix-Balisson\\nKastelo de Guildo en Créhen.\\nKastelo de Guingamp, en Guingamp\\nKastelo de Kergrist, en Ploubezre\\nKastelo de La Caunelaye, en Corseul\\nKastelo de La Crochais en Ploubalay\\nKastelo de La Guyomarais, en Saint-Denoual\\nKastelo de Hac, en Quiou. Klasita MH\\nKastelo de La Hunaudaye, en Plédéliac. Klasita MH\\nKastelo de Lorge, en L'Hermitage-Lorge. Registrita MH\\nKastelo de La Mallerie en Ploubalay\\nKastelo de Montafilant, 13-a jc, en Corseul. Registrita MH\\nKastelo de Monterfil, en Corseul. Registrita MH\\nKastelo de La Motte-Broons, en Broons\\nKastelo de Plessis-Madeuc, 17-a jc, en Corseul\\nKastelo de Quintin, en Quintin. Klasita MH\\nKastelo de La Roche-Guéhennec, en Mûr-de-Bretagne\\nKastelo de La Roche-Jagu, en Ploëzal. Klasita MH\\nKastelo de Rosanbo, en Lanvellec. Registrita MH"},{"page_url":"https://en.wikipedia.org/wiki/John_P._Peabody_House","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/John_Peabody_House.jpg","page_title":"John P. Peabody House","context_page_description":"The John P. Peabody House is a historic house at 15 Summer Street in Salem, Massachusetts. Built in 1868 by Salem merchant John P. Peabody, it is a rare early example of Colonial Revival architecture. The two story wood frame house is three bays wide, with a slate gambrel roof. The centered front door is sheltered by a portico supported by Doric columns. The second story center window reinforces focus, being enlarged slightly by sidelights as compared to the other windows on the facade. The roof is pierced by three dormers, the outer ones with pointed gables and the central one with a rounded pediment reminiscent of the then-fashionable Second Empire style.\\nThe house was listed on the National Register of Historic Places in 1983. It is now owned by the Salem Inn, which also owns the nearby West Cogswell House."},{"page_url":"https://es.wikipedia.org/wiki/Noirmoutier-en-l%27%C3%8Ele","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Noirmoutier_Saint-Philbert_R01.jpg","page_title":"Noirmoutier-en-l'Île","context_page_description":"Noirmoutier-en-l'Île es una población y comuna francesa, en la región de Países del Loira, departamento de Vendée, en el distrito de Les Sables-d'Olonne y cantón de Noirmoutier-en-l'Île."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8D%B7%E5%88%97%E8%8C%A8%E7%A7%91%E8%80%B6%E6%B9%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/%D0%92%D0%BE%D0%B4%D0%BE%D0%BF%D0%B0%D0%B4%D0%B8%D0%BA222221.JPG","page_title":"捷列茨科耶湖","context_page_description":"捷列茨科耶湖是俄罗斯阿尔泰共和国阿尔泰山脉最大型的湖泊，也是全球最深的25个湖之一，最大水深325米。\\n捷列茨科耶湖原名阿尔泰淖尔，环阿尔泰淖尔居住的游牧部落称作阿尔泰淖尔乌梁海，为乌梁海部落之一，隶属科布多参赞大臣节制。1867年，随中俄签署《中俄勘分西北界约记》及《乌里雅苏台界约》而沦入俄境。\\n捷列茨科耶湖湖水十分清澈，能见度6至14米，湖水来自约70条河流和150条暂时性的溪流，其中丘雷什曼河供应超过一半湖水。"},{"page_url":"https://et.wikipedia.org/wiki/Holle","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Wappen_Holle.png","page_title":"Holle","context_page_description":"Holle on küla ja vald Saksamaal Alam-Saksi liidumaal Hildesheimi kreisis. Valla pindala on 61,15 km². 31. detsembril 2017 elas seal 7073 inimest. Vald asub umbes 15 km Hildesheimist kagus ja 15 km Salzgitterist läänes. Seda on mainitud Tom Clancy bestselleris Red Storm Rising."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9C%84%EB%A5%B4%EA%B2%90_%ED%81%B4%EB%A6%B0%EC%8A%A4%EB%A7%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/J%C3%BCrgen_Klinsmann_USA.jpg","page_title":"위르겐 클린스만","context_page_description":"위르겐 클린스만은 독일의 축구 감독이자 전 축구 선수로, 2011년부터 2016년까지 미국 축구 국가대표팀 감독을 맡기도 하였다. 선수 시절, 클린스만은 다수의 유럽 명문 클럽을 거쳤고, 서독의 1990년 FIFA 월드컵 우승 주역이었으며, 독일의 UEFA 유로 1996 우승 주역이었다. 그는 서독 / 독일의 1990년대 가장 강력한 스트라이커들 중 한명으로, 클린스만은 UEFA 유로 1988부터 1998년 FIFA 월드컵까지 그가 참가한 6개의 메이저 대회에서 모두 득점을 올렸다.\\n그는 2006년 FIFA 월드컵 당시 독일 축구 국가대표팀을 이끌고 3위의 성적을 거두었다. 2006년 7월 12일, 그는 독일 국가대표팀 감독직을 내려놓았고, 그의 후임으로 수석코치였던 요아힘 뢰프가 되었다. 2008년 7월, 그는 스위스 축구 국가대표팀 감독직을 역임하기 시작한 오트마어 히츠펠트의 바통을 이어받아 바이에른 뮌헨의 감독이 되었다. 2009년 4월 27일, 클린스만은 성적부진으로 조기 해임되었다. 그는 경질 직전의 7경기 중 5경기에서 승리하였고, 선두 볼프스부르크와는 승점 차이가 3점밖에 나지 않았다. 그러나, 그의 과감한 개혁은 바이에른 보드진들과의 의견에 마찰을 빚었고, 결국 클린스만이 바이에른을 떠나도록 하였다.\\n2011년 7월 29일, 그는 미국 축구 협회와의 여러 차례 협상 끝에, 밥 브래들리 감독의 뒤를 이어 미국 축구 국가대표팀의 감독이 되었다. 2013년, 그는 미국 감독으로 CONCACAF 골드컵 우승을 거두었다. 축구 외적으로 그는 1982년에 제빵사 견습직을 수행하였고, 4개국에서 아동 자선 활동을 하고 있으며, 헬리콥터 운전 면허를 소유하고 있다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%B3%D0%BE%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Inscribed_angle_theorem.svg","page_title":"Угол","context_page_description":"У́гол — геометрическая фигура, образованная двумя лучами, выходящими из одной точки."},{"page_url":"https://hu.wikipedia.org/wiki/Wahagnies","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Wahagnies_%28Nord%2C_Fr%29_city_limit_sign.JPG","page_title":"Wahagnies","context_page_description":"Wahagnies település Franciaországban, Nord megyében. Lakosainak száma 2598 fő. +/- Wahagnies Phalempin, La Neuville, Ostricourt, Thumeries, Oignies és Libercourt községekkel határos."},{"page_url":"https://ro.wikipedia.org/wiki/Titan_(satelit)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/PIA_08211_Titan_backlit.jpg","page_title":"Titan (satelit)","context_page_description":"Titan este cel mai mare satelit al planetei Saturn. Acesta este singurul satelit natural cunoscut care are o atmosferă densă, și singurul corp ceresc, altul decât Pământul, pentru care există o dovadă clară că are o suprafață lichidă.\\nTitan este al șaselea satelit sferoidal al planetei Saturn. Adesea descris ca o planetă-satelit, Titan are un diametru cu aproximativ 50% mai mare decât al Lunii, satelitul Pământului, și este cu 80% mai masiv. Acesta este al doilea satelit ca mărime din Sistemul Solar, după Ganymede, satelitul lui Jupiter, și este mai mare ca volum față de cea mai mică planetă din Sistemul Solar, Mercur, deși doar pe jumătate ca masă. Accelerația gravitațională de la suprafață este ceva mai mică decât cea lunară. Titan a fost primul satelit cunoscut al lui Saturn, fiind descoperit în 1655 de către astronomul olandez Christiaan Huygens, și a fost al cincilea satelit al unei planete în afară de Pământ care a fost descoperit de către oameni.\\nTitan este format în principal din apă înghețată și rocă. La fel ca și în cazul planetei Venus înainte de era spațială, atmosfera densă și opacă a împiedicat studiul suprafeței lui Titan."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B5%D0%BD%D0%B0%D0%B4_%D0%A2%D0%BE%D0%BC%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Nenad_Tomovi%C4%87.jpg","page_title":"Ненад Томович","context_page_description":"Ненад Томович — сербський футболіст, захисник клубу СПАЛ та національної збірної Сербії."},{"page_url":"https://sv.wikipedia.org/wiki/San_Manuel_(Tarlac)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Ph_locator_tarlac_san_manuel.png","page_title":"San Manuel (Tarlac)","context_page_description":"San Manuel är en kommun i Filippinerna. Kommunen ligger på ön Luzon, och tillhör provinsen Tarlac. Folkmängden uppgår till 20 857 invånare.\\nSan Manuel är indelat i 15 barangayer."},{"page_url":"https://sr.wikipedia.org/wiki/Web_data_common","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Tecnologias_del_internet.png","page_title":"Web data common","context_page_description":"Web Data Commons пројекат издваја структуриране податке из заједничке Базе. Највећи део веб садржаја доступан је јавности, а пружа издвојене податке за јавно преузимање у циљу подршке научних истраживања и компанија. Тиме се користи богатство информација које су доступне на интернету.\\nСве више и више сајтова је почело да уграђује структуриране податке који описују производе, људе, организације, места и догађаје у своје HTML странице. Web Data Commons пројекат издваја ове податке из неколико милијарди веб страница. До сада пројекат има три различита сета података преузетих из Заједничке базе 2013, 2012. и 2010. год. Пројекат пружа издвојене податке за преузимање и објављује статистичке податке о распоређивању различитих формата.\\nWeb Data Commons пројекат је започео с истраживањем на Freie Universität у Берлину и Karlsruhe Institute of Technology у 2012. Циљ пројекта је да олакша истраживања и подршку компанија у експлоатацију богатства информација на Вебу вадећи структуриране податке из Веб Базе и пописује ове податке за јавно преузимање. Данас WDC пројекат углавном одржава податаке у Web Science Research Group на Универзитету у Манхајму."},{"page_url":"https://it.wikipedia.org/wiki/Savai%27i","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Lano_Beach_-_Savai%27i%2C_2007.jpg","page_title":"Savai'i","context_page_description":"Savai'i è la principale isola di Samoa e delle isole Samoa, è situata poco a nord dell'isole di Upolu dalla quale la separa lo stretto di Apolima. L'isola ha una superficie di 1.694 chilometri quadrati e nel 2006 la popolazione era di 43.142 abitanti. Il centro abitato principale e unico porto dei accesso dell'isola è la cittadina di Salelologa."},{"page_url":"https://ca.wikipedia.org/wiki/Futbol_a_Djibouti","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/US_Navy_061202-N-1328C-114_U.S._Army_Staff_Sgt._Justin_Lockhart%2C_attached_to_Bravo_Co.%2C_489th%2C_Civil_Action_Battalion%2C_participates_in_a_game_of_soccer_with_students_from_the_Djibouti_City_School.jpg","page_title":"Futbol a Djibouti","context_page_description":"El futbol és l'esport més popular a Djibouti. És dirigit per la Federació Djiboutiana de Futbol. Esdevingué membre de la FIFA l'any 1994."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8_%D0%BA%D1%83%D0%BF_%D0%BD%D0%B0_%D0%BD%D0%B0%D1%86%D0%B8%D0%B8_2006","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Cairo_International_Stadium.jpg","page_title":"Африкански куп на нации 2006","context_page_description":"Африкански куп на нации во 2006 година — 25-то африканско фудбалско првенство на Африканскиот куп на нации кое се одржало во Египет од 20 јануари - 10 февруари 2006 година. На ова првенство учество зеле 16 репрезентации. Вкупно биле одиграни 32 натпревари.\\nПобедник на турнирот била Фудбалската репрезентација на Египет."},{"page_url":"https://it.wikipedia.org/wiki/Festival_delle_sagre_astigiane","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Festival_delle_sagre_astigiane5.jpg","page_title":"Festival delle sagre astigiane","context_page_description":"Il Festival delle Sagre è una manifestazione eno-gastronomica che si tiene ad Asti la seconda domenica di settembre ma che inizia, come ormai da consuetudine consolidata, il sabato sera precedente, quando l'afflusso di persone supera talvolta quello della domenica stessa. Si colloca nel periodo del \\"settembre astigiano\\", dominato dal salone enologico Douja d'Or e dal Palio di Asti.\\nOltre 40 pro loco della provincia di Asti propongono le loro specialità gastronomiche, accompagnate da vini DOC astigiani, in un grande ristorante all'aperto allestito in Piazza Campo del Palio di Asti, dove, durante il sabato sera e tutta la giornata di domenica, migliaia di persone possono accomodarsi in un antico villaggio di campagna. Dal 2001 inoltre, la locale Camera di Commercio ospita, nel corso della grande kermesse enogastronomica settembrina, due pro loco \\"fuori-porta\\".\\nAlla domenica mattina una suggestiva sfilata si snoda per le vie della città, animata da più di tremila figuranti in autentici abiti d'epoca, animali, trattori e arnesi del mestiere. Rappresenta i valori e della tradizione contadina della provincia."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BC%D1%83%D1%80%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D1%85_%D1%81%D0%BF%D0%BE%D1%80%D1%83%D0%B4_%D0%B3%D0%BE%D1%82%D0%B8%D1%87%D0%BD%D0%BE%D0%B3%D0%BE_%D1%81%D1%82%D0%B8%D0%BB%D1%8E_%D0%BD%D0%B0_%D1%82%D0%B5%D1%80%D0%B5%D0%BD%D0%B0%D1%85_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Sataniv_Synahoha.jpg","page_title":"Список мурованих споруд готичного стилю на теренах України","context_page_description":"У даному списку приведені всі відомі споруди, що були збудовані на сучасних українських теренах за часів Середньовіччя у готичному стилі.\\nГотичний стиль прийшов на територію України у XIII ст. з Угорщини, а у XIV ст. — із Польщі.\\nУ даному списку представлені як чисто готичні будівлі, так і такі, що несуть риси інших архітектурних стилів. Бо згасання доби готики на українських землях розтягнулось майже до середини XVII ст. і збіглося з розвитком спочатку ренесансної архітектури, а згодом — барокової. Тому існує цілий ряд споруд, які побудовані у мішаному стилі.\\nУ даний список входять як збережені пам'ятки, так і деякі втрачені або перебудовані.\\nУ список не увійшли споруди XIX–XX ст., що були побудовані у неоготичному стилі, який є лише імітацією середньовічної готика.\\nСписок побудований за географічним принципом."},{"page_url":"https://de.wikipedia.org/wiki/Regierung_Hawke_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Peter_Walsh.jpg","page_title":"Regierung Hawke I","context_page_description":"Die Regierung Hawke I regierte Australien vom 11. März 1983 bis zum 13. Dezember 1984. Die Regierung wurde von der Labor Party gestellt.\\nMalcolm Fraser war seit dem 11. November 1975 Premierminister einer Koalition von Liberal Party und der National Country Party. Bei der Parlamentswahl am 5. März 1983 errang die Labor Party mit 75 von 125 Sitzen im Repräsentantenhaus eine klare Mehrheit. im Senat gewann Labor 3 Sitze dazu, verfehlte mit 30 von 64 Senatoren jedoch die Mehrheit. Die neue Regierung stellte die Labor Party unter Premierminister Bob Hawke. Bei den vorgezogenen Parlamentswahl am 1. Dezember 1984 konnte Labor trotz leichter Stimmverluste mit 82 von 148 Mandaten im vergrößerten Repräsentantenhaus die absolute Mehrheit behaupten. Im ebenfalls vergrößerten Senat stellte Labor 34 der 76 Senatoren. Die Laborregierung unter Bob Hawke wurde fortgesetzt."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B8%85%E4%BB%A3%E5%AD%A6%E8%80%85%E5%83%8F%E4%BC%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/%E7%8E%8B%E6%98%B6.jpg","page_title":"清代学者像伝","context_page_description":"『清代学者像伝』は、葉衍蘭と孫の葉恭綽が編纂した清代の学者の肖像画集。二集に分かれ、計368名の肖像画を収録している。\\n葉衍蘭は広東省番禺出身で、1856年に進士になった人物。書画を愛好し、特に肖像画の収集に力を注いだ。大興の画家黄小泉に模写を依頼し、顧炎武から魏源に至るまで、169名の学者の肖像画を編纂した。これが第一集である。\\n第一集は葉衍蘭の孫で交通系の政治家葉恭綽によって1928年に商務印書館から出版された。しかし葉恭綽は収録されている学者が同治以前に限られ、それ以降の学者が含まれていないこと、また同治以前でも含まれていない重要な人物が多いことを遺憾に思い、以後20年にわたって肖像画を収集し、江西省の画家楊鵬秋に模写を依頼した。こうして新たに200名の肖像画が編纂され、1953年に安定珂羅版社から出版された。これが第二集である。\\n1989年に上海古籍出版社が第一集と第二集を併せて再版したが、画質が悪く、原本に及ばなかったため、2001年に上海書店によって再度出版された。\\n収録人数が多いので貴重だが、金農、趙之謙、丁敬など、より信頼できる肖像画と比較すると顔貌の差が大きいことがあるので、使用には注意が必要である。"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%95%BF%E5%AE%89%E8%A1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Tiananmen_Square.jpg","page_title":"长安街","context_page_description":"长安街是中国北京市的西长安街及东长安街的总称，广义上还包括其东、西延长线，是北京市重要的东西轴线，曾被认为是世界上最长、最宽的道路，也是中国最重要的道路之一，被誉为“神州第一街”。长安街东起东单，西至西单，天安门座落于长安街中点的北侧，天安门广场则在其南侧。街从天安门分为两段，即西长安街和东长安街。从东单向东至通州区宋梁路，和西单向西延至门头沟三石路的长安街延长线有时也用长安街这一名称来泛指。长安街由于其独特的地理位置和符号意义，长期以来是北京乃至中国政治的代名词之一。"},{"page_url":"https://cs.wikipedia.org/wiki/Justin_Raimondo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Justin_Raimondo.jpg","page_title":"Justin Raimondo","context_page_description":"Justin Raimondo byl americký politický aktivista, libertarián s některými konzertivními názory a zakladatel Antiwar.com.\\nV roce 1995 založil v reakci na intervencionistickou zahraniční politiku Clintonovy administrativy Antiwar.com. V roce 1996 neúspěšně kandidoval proti Nancy Pelosi do Sněmovny reprezentantů. V minulosti podporoval všechny tři prezidentské kampaně Pata Buchanana, v roce 2004 kampaň Ralpha Nadera a v roce 2008 patřil mezi nejvýraznější stoupence Rona Paula.\\nJustin Raimondo byl homosexuál, ale jako libertarián nepodporoval různé požadavky homosexuálních aktivistů.\\nRaimondo je autorem několika knih a jeho texty vycházely v řadě tištěných časopisů i online magazínech, např. The American Conservative, Chronicles magazine či Taki's Top Drawer."},{"page_url":"https://es.wikipedia.org/wiki/Aeropuerto_Internacional_de_San_Jos%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/The_Centerline_American_Airlines_N488AA_McDonnell_Douglas_MD-82_SJC.jpg","page_title":"Aeropuerto Internacional de San José","context_page_description":"El Aeropuerto Internacional de San José Norman Y. Mineta es un aeropuerto de propiedad pública de la ciudad de San José​ en el condado de Santa Clara, California, Estados Unidos. El aeropuerto está localizado a dos millas náuticas al noroeste del centro de San José, cerca de la intersección de tres autopistas importantes, Ruta Estatal 101, Interestatal 880, y la Ruta Estatal 87. La aerolínea dominante es Southwest Airlines y Alaska Airlines es la segunda más importante. El aeropuerto cuenta con Wifi gratis en todas las terminales."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%A5%D5%AC%D5%B4%D5%B8%D5%B6%D5%BF%D5%A5%D5%AB_%D5%A1%D5%B4%D6%80%D5%B8%D6%81_(%D4%BB%D5%BD%D5%BA%D5%A1%D5%B6%D5%AB%D5%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Belmonte.jpg","page_title":"Բելմոնտեի ամրոց (Իսպանիա)","context_page_description":"Բելմոնտեի ամրոց, պաշտպանական շինություն Իսպանիայի Կաստիլիա-Լա Մանչա ինքնավար համայնքի Կուենկա պրովինցիայի Բելմոնտե մունիցիպալիտետում՝ Կուենկա քաղաքից ոչ հեռու: Կառուցվել է 1456-70 թվականներին Էնրիկե IV թագավորի ֆավորիտ մարքիզ Խուան Պաչեկոյի կողմից: Ներքին բակն ունի հավասարակողմ եռանկյան տեսք և շրջապատված է վեցաթև աստղի ձևով կառուցված պատերով:\\nԲելմոնտեի ամրոցը գտնվում է Կաստիլիա-Լա Մանչայի Կուենկա և Տոլեդո պրովինցիաների սահմանի վրա՝ Ալարկոն ջրամբարից ոչ հեռու, տեղակայված է Բելմոնտեի Սան Կրիստոբալ բլրի վրա:"},{"page_url":"https://de.wikipedia.org/wiki/Brezel_(Heraldik)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Wappen_Pattern.png","page_title":"Brezel (Heraldik)","context_page_description":"Die Brezel, je nach Dialekt auch Brezn oder Prezel, ist in der Heraldik eine gemeine Figur.\\nDargestellt wird die Backware im Wappen in den heraldisch typischen Farben und Metallen. Im Wappenschild unterscheidet man die Lage durch die Richtung des Brezelknotens. Zeigt dieser zum Schildfuß, meldet man die Brezel als gestürzt. Seltener werden die Backschaufel, der Schieber oder Schießer, und/oder eine kleine Anzahl Brötchen der Brezel beigestellt. Die Brezel kann auch im Oberwappen vorhanden sein. Es handelt sich dann vorwiegend um die Wiederholung des Schildinhaltes.\\nAls Zunftzeichen für die Bäcker ist die Wappenfigur seit etwa dem 14. Jahrhundert bekannt. Schmuckschilde oder Schmiedewappen an Fassaden, die die Brezel zeigen, schmücken das Haus des Handwerkers.\\nAuch als redendes Wappen der Träger mit den Familiennamen Beck, Bäcker, Becker oder Beckers wird das Wappenzeichen gern für Familienwappen genutzt."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_im_K%C3%B6lner_Stadtteil_Altstadt-Nord","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Stolpersteine_K%C3%B6ln%2C_Verlegestelle_Auf_dem_Berlich_8.jpg","page_title":"Liste der Stolpersteine im Kölner Stadtteil Altstadt-Nord","context_page_description":"Die Liste der Stolpersteine im Kölner Stadtteil Altstadt-Nord führt die vom Künstler Gunter Demnig verlegten Stolpersteine im Kölner Stadtteil Altstadt-Nord auf.\\nDie Liste der Stolpersteine beruht auf den Daten und Recherchen des NS-Dokumentationszentrums der Stadt Köln, zum Teil ergänzt um Informationen und Anmerkungen aus Wikipedia-Artikeln und externen Quellen. Ziel des Kunstprojektes ist es, biografische Details zu den Personen, die ihren freiwillig gewählten Wohnsitz in Köln hatten, zu dokumentieren, um damit ihr Andenken zu bewahren.\\nAnmerkung: Vielfach ist es jedoch nicht mehr möglich, eine lückenlose Darstellung ihres Lebens und ihres Leidensweges nachzuvollziehen. Insbesondere die Umstände ihres Todes können vielfach nicht mehr recherchiert werden. Offizielle Todesfallanzeigen aus den Ghettos, Haft-, Krankenanstalten sowie den Konzentrationslagern können oft Angaben enthalten, die die wahren Umstände des Todes verschleiern, werden aber unter der Beachtung dieses Umstandes mitdokumentiert."},{"page_url":"https://fr.wikipedia.org/wiki/Villafrech%C3%B3s","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Fundaci%C3%B3n_Joaqu%C3%ADn_D%C3%ADaz_-_Monasterio_de_Santa_Clara_-_Villafrech%C3%B3s_%28Valladolid%29.jpg","page_title":"Villafrechós","context_page_description":"Villafrechós est une commune de la province de Valladolid dans la communauté autonome de Castille-et-León en Espagne."},{"page_url":"https://pl.wikipedia.org/wiki/Saint-Germain-de-Pasquier","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Saint-Germain-de-Pasquier_-_La_plus_petite_mairie_de_France.jpg","page_title":"Saint-Germain-de-Pasquier","context_page_description":"Saint-Germain-de-Pasquier – miejscowość i gmina we Francji, w regionie Normandia, w departamencie Eure.\\nWedług danych na rok 1990 gminę zamieszkiwało 105 osób, a gęstość zaludnienia wynosiła 53 osoby/km²."},{"page_url":"https://id.wikipedia.org/wiki/Monistria","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Kioloa_fauna_139.jpg","page_title":"Monistria","context_page_description":"Monistria adalah sebuah genus belalang dalam keluarga Pyrgomorphidae dan suku Monistriini. Spesies-spesiesnya ditemukan di Australia, Selandia Baru dan pulau-pulau sekitar."},{"page_url":"https://de.wikipedia.org/wiki/Pax_Romana","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/World_in_50_CE.PNG","page_title":"Pax Romana","context_page_description":"Als Pax Romana oder Pax Augusta wird eine etwa 200–250 Jahre lange Periode des Römischen Reichs bezeichnet, die trotz einzelner Aufstände und kurzer Bürgerkriege insgesamt von innerem Frieden und Stabilität geprägt war. Als Garanten des inneren Friedens fungierten die Kaiser. Diese Phase begann 27 v. Chr. mit dem Ende der römischen Bürgerkriege und der res publica libera unter dem ersten römischen Kaiser Augustus, der eine faktische Alleinherrschaft begründete, und endete entweder 192 n. Chr. mit dem Tod des Kaisers Commodus oder 235 n. Chr. mit dem Ende der severischen Dynastie.\\nDas Schlagwort Pax Romana oder, häufiger, Pax Augusta, meinte dabei stets vor allem inneren Frieden, also die Abwesenheit von Bürgerkrieg. Im Vergleich zum vorangegangenen Jahrhundert, als die Römische Republik in langen Bürgerkriegen untergegangen war, während im Osten die einstige Ordnung der hellenistischen Welt zerbrach, und im Unterschied zur Herrschaft vieler später Kaiser brachte das frühe Prinzipat Rom, Italien und den meisten Provinzen tatsächlich eine lange währende Zeit von innerem Frieden, Stabilität, Sicherheit und Wohlstand."},{"page_url":"https://en.wikipedia.org/wiki/Common_midwife_toad","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Alytes_obstetricans_dis.png","page_title":"Common midwife toad","context_page_description":"The common midwife toad is a species of midwife frog in the family Alytidae.\\nIt is found in Belgium, France, Germany, Luxembourg, the Netherlands, Portugal, Spain, Switzerland, and the United Kingdom. Like other members of its genus, the male toad carries the eggs around entwined on his back and thighs until they are ready to hatch.\\nIts natural habitats are temperate forests, dry forests, shrubland, rivers, freshwater lakes, freshwater marshes, temperate desert, arable land, pastureland and urban areas.\\nIt is threatened by habitat loss."},{"page_url":"https://pl.wikipedia.org/wiki/Park_Strzelecki_w_Tarnowie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Park_Strzelecki_w_Tarnowie.jpg","page_title":"Park Strzelecki w Tarnowie","context_page_description":"Park Strzelecki – park miejski w Tarnowie, w którym znajduje się Mauzoleum generała Józefa Bema. Starodrzew w parku jest pomnikiem przyrody. W parku wytyczono ścieżkę przyrodniczo-dydaktyczną z przystankami przy najciekawszych gatunkach roślin."},{"page_url":"https://nl.wikipedia.org/wiki/Danseressen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Theo_van_Doesburg_Krishna_1916.jpg","page_title":"Danseressen","context_page_description":"Danseressen is een tweeluik van de Nederlandse schilder Theo van Doesburg in het Kröller-Müller Museum, Otterlo."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%81%96%E9%A6%AC%E7%89%B9%E5%A5%A7%E4%BC%8A%E6%96%AF%E5%A1%94%E5%9D%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/San_Mateo_Ixtat%C3%A1n_1.jpg","page_title":"聖馬特奧伊斯塔坦","context_page_description":"圣马特奥伊斯塔坦，是危地马拉的城镇，位于该国西北部，由韦韦特南戈省负责管辖，面积560平方公里，海拔高度2,468米，2002年人口29,993，人口密度每平方公里53.56人。"},{"page_url":"https://es.wikipedia.org/wiki/Araldo_Cossutta","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Green_Building_-_MIT%2C_Cambridge%2C_MA_-_DSC05584.jpg","page_title":"Araldo Cossutta","context_page_description":"Araldo Cossutta fue un arquitecto que trabajó principalmente en los Estados Unidos.​ De 1956 a 1973 trabajó en la empresa I. M. Pei & Partners. I. M. Pei, está ahora entre los más honrados de los arquitectos en el mundo. Cossutta fue su asociado y, finalmente, su compañero en la primera fase de la carrera de Pei. Él fue el responsable de algunos de los diseños más conocidos de la firma de la época, incluyendo tres que han recibido premios en los últimos años. En 1973 él y Vincent Ponte dejaron la empresa de Pei para formar Cossutta & Ponte, que en última instancia se convirtió en Cossutta y Asociados. La nueva firma diseñó el Torre del Credit Lyonnais en Lyon, Francia y la Torre del Cityplace en Dallas, Texas, entre otras comisiones.\\n​\\n​\\n​\\n​\\n​"},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%99%D7%99%D7%A4%D7%95%D7%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/IPod_family.png","page_title":"אייפוד","context_page_description":"אייפוד הוא מותג של נגני מולטימדיה ניידים, שמעוצבים ומשווקים על ידי חברת אפל. המותג הושק באוקטובר 2001. קו האייפודים הנוכחי מורכב מנגן הדיסק-הקשיח בסגנון המקורי אייפוד קלאסיק, האייפוד טאץ', האייפוד נאנו, והאייפוד שאפל. נגנים קודמים כוללים את האייפוד מיני ואייפוד פוטו. כמו נגני מדיה אחרים, האייפוד יכול לשמש גם ככונן אחסון מידע. בשנת 2014 הופסק שיווק וייצור של האייפוד קלאסיק."},{"page_url":"https://sk.wikipedia.org/wiki/Ve%C4%BEkono%C4%8Dn%C3%BD_ostrov","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Rapanookee_vona.jpg","page_title":"Veľkonočný ostrov","context_page_description":"Veľkonočný ostrov je ostrov v južnej časti Tichého oceánu patriaci Čile. Má rozlohu 163,6 km². Nachádza sa na východnom okraji Polynézie. Na ostrove žije 7 750 obyvateľov. Hlavným mestom je Hanga Roa. Veľkonočný ostrov je jedným z najviac izolovaných obývaných ostrovov na svete. Jeho najbližší obývaný susedný ostrov je ostrov Pitcairn vzdialený 2 075 km. Vzdialenosť od pobrežia Južnej Ameriky asi 3 300 km.\\nV juhozápadnej časti Veľkonočného ostrova sa nachádzajú malé, aj neobývané ostrovy Motu Iti a Motu Kau Kau. Na tomto ostrove sa vyskytuje magnetická anomália, Na západnej strane je ostrov Motu Tautara, na východ pri polostrove Poike sú ostrovy Marotiri a ostrov Motu Nui. Dohromady je pätnásť malých ostrovov vzdialených do poldruha kilometra od Veľkonočného ostrova. Vzdialenosť od pevninskej časti pobrežia Čile je 3 703 km. Veľkonočný ostrov je jedným z najviac izolovaných obývaných ostrovov na svete. Jeho najbližší obývaný susedný ostrov je ostrov Pitcairn vzdialený 2 075 km.\\nPomenovanie ostrova Veľký Rapa bolo zaužívané tahitskými rybármi, ktorí navštívili ostrov v devätnástom storočí."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BE%D0%BB%D0%B4%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D1%83%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Walden_Pond_at_Dusk_December_24%2C_2012-9928_03.jpg","page_title":"Уолденский пруд","context_page_description":"Уолденский пруд — расположен рядом с городом Конкорд, штат Массачусетс, США. Максимальная глубина пруда составляет 31 м, а площадь — 0,27 км². Котловина водоёма образовалась 10—12 тыс. лет назад в ходе отступления ледников на север.\\nЗдесь на берегу пруда в 1845—1847 годах жил известный американский писатель, мыслитель, натуралист и общественный деятель Генри Дэвид Торо. Он проникся трансценденталистскими идеями Эмерсона и решил поставить эксперимент по изоляции от общества и сосредоточении на самом себе и своих нуждах. Дэвид Торо самостоятельно построил хижину и обеспечивал себя всем необходимым. Позднее в 1854 году свои впечатления писатель опубликовал в книге «Уолден, или Жизнь в лесу».\\nСегодня пруд находится под охраной штата, здесь создана заповедная зона."},{"page_url":"https://cy.wikipedia.org/wiki/Cwtiar_gorniog","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Purpurhuhn.jpg","page_title":"Cwtiar gorniog","context_page_description":"Aderyn a rhywogaeth o adar yw Cwtiar gorniog a adnabyddir hefyd gyda'i enw gwyddonol Fulica cornuta; yr enw Saesneg arno yw Horned coot. Mae'n perthyn i deulu'r Rhegennod sydd yn urdd y Gruiformes.\\nTalfyrir yr enw Lladin yn aml yn F. cornuta, sef enw'r rhywogaeth. Mae'r rhywogaeth hon i'w chanfod yn Ne America."},{"page_url":"https://hu.wikipedia.org/wiki/R%C3%A9g%C3%A9szeti_M%C3%BAzeum_(Antalya)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/ANTALYAMUS_3383_KT.jpg","page_title":"Régészeti Múzeum (Antalya)","context_page_description":"Antalya régészeti múzeuma Törökországban a második legnagyobb régészeti bemutatóhely. A 7000 négyzetméter kiállítási terű múzeumot a létrehozásával és működésével kapcsolatos kiváló tevékenysége elismeréseképpen 1988-ban az Európa Tanács Különdíjjal jutalmazta. Mint Antalya kiemelkedő jelentőségű kulturális intézménye, a várossal egyetemben a Kulturális Világörökség jegyzékbe vételének várományosa. Közel 5000 kiállítási műtárgyát 13 kiállítóteremben és egy szabadtéri udvarban mutatja be. Ez az egyetlen olyan múzeum Törökországban, amelyben speciálisan gyermekeket kiszolgáló részleg is van."},{"page_url":"https://io.wikipedia.org/wiki/1867","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Jacek_Malczewski_-_Portret_W%C5%82adys%C5%82awa_Reymonta.jpg","page_title":"1867","context_page_description":"3ma di aprilo - Austrian astronomo Wilhelm Tempel deskovras kometo, qua nomizesas Tempel 1.\\nTre severa famino en Finlando.\\n7ma di mayo - Alfred Nobel patentizas dinamito en l'Unionita Rejio.\\n29ma di mayo - Tra interkonsento, Austria grantas Hungaria tota autonomo. Tale naskas la duopla monarkio di Austria-Hungaria.\\n1ma di julio - Kunfederuro di Norda-Germania kreesas sub la chefeso di Prusia ed Otto von Bismarck.\\n22ma di oktobro - Giuseppe Garibaldi krucumas la frontiero di Papala Stati por kompletigar l'unigo di Italia.\\nEn Unionita Rejio voto-yuro grantesas a laboranta viri dil urbi."},{"page_url":"https://es.wikipedia.org/wiki/Kelly_Massey","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Kelly_Massey_2016.jpg","page_title":"Kelly Massey","context_page_description":"Kelly Massey es una atleta británica, especializada en la prueba de 4x400 m en la que llegó a ser medallista de bronce olímpica en 2016.​​"},{"page_url":"https://no.wikipedia.org/wiki/Helena_Henschen","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Helena_Henschen_2008.JPG","page_title":"Helena Henschen","context_page_description":"Helena Henschen var en svensk designer og forfatter.\\nHenschen har utgitt illustrerte barnebøker og annen skjønnlitteratur. Hun var stifter av designfirmaet Mah-Jong. Helena Henschen mottok den svenske litteraturprisen BMF-plaketten i 2004 og i 2009 EUs litteraturpris."},{"page_url":"https://en.wikipedia.org/wiki/Bon_Secours_Hospital,_Galway","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Bon_secours_galway.jpg","page_title":"Bon Secours Hospital, Galway","context_page_description":"The Bon Secours Hospital, Galway is a private hospital in County Galway, Ireland. The hospital is part of Bon Secours Mercy Health. This includes sister hospitals in Cork, Dublin, Limerick and Tralee. The hospital sees over 18,000 patients per annum, comprising 6,000 in-patients and 12,000 day-cases."},{"page_url":"https://hu.wikipedia.org/wiki/Eml%C3%A9kt%C3%A1bl%C3%A1k_Gyul%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Tarnai_Andor_plaque_%28Gyula_Bodoky_u_17%29.jpg","page_title":"Emléktáblák Gyulán","context_page_description":"A Wikimédia Commons tartalmaz Emléktáblák Gyulán témájú médiaállományokat.\\nA Gyula szócikkhez kapcsolódó képgaléria, amely helyi, országos vagy nemzetközi hírű személyekkel, valamint épületekkel, műtárgyakkal, helynevekkel és eseményekkel összefüggő emléktáblákat tartalmaz."},{"page_url":"https://ht.wikipedia.org/wiki/Concord,_Georgie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Concord_City_Hall%2C_Georgia.jpg","page_title":"Concord, Georgie","context_page_description":"Concord, Georgie se yon vil Etazini. Li sitye nan leta Georgie.\\nChèf-lye li se?\\n."},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_Saint-Pons_de_Saint-Pons-de-Thomi%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/St_Pons%2Ccath%C3%A9drale%2CPorte_des_Morts_XIIe_S.2.jpg","page_title":"Cathédrale Saint-Pons de Saint-Pons-de-Thomières","context_page_description":"La cathédrale Saint-Pons-de-Cimiez ou abbaye Saint-Pons-de-Thomières, ou Abbatia Sancti Pontii - Abbatia Thomeriarum, est une ancienne abbaye et cathédrale catholique romaine, située à Saint-Pons-de-Thomières, dans le département français de l'Hérault et la région Occitanie.\\nL'abbaye a été fondée en 936 par le comte de Toulouse, Raymond III Pons et son épouse Garsinde. Elle était le siège de l'évêché de Saint-Pons de Thomières, créé en 1318 par détachement du diocèse de Narbonne et supprimé à la Révolution pour être intégré au diocèse de Montpellier."},{"page_url":"https://en.wikipedia.org/wiki/Peninsular_War","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Santa_Engracia_-_Lejeune.jpg","page_title":"Peninsular War","context_page_description":"The Peninsular War is the military conflict fought by Spain and Portugal, assisted by Great Britain, against the invading and occupying forces of the First French Empire for control of the Iberian Peninsula during the Napoleonic Wars. In Spain, it is considered to overlap with the Spanish War of Independence. The war began when the French and Spanish armies invaded and occupied Portugal in 1807, transiting through Spain, and escalated in 1808 after Napoleonic France occupied Spain, previously its ally. Napoleon Bonaparte had forced the abdications of Ferdinand VII and his father Charles IV and then installed his brother Joseph Bonaparte on the Spanish throne, also promulgating the Bayonne Constitution. Most Iberians rejected French rule and fought a bloody war to oust them. The war on the peninsula lasted until the Sixth Coalition defeated Napoleon in 1814, and is regarded as one of the first wars of national liberation, significant for the emergence of large-scale guerrilla warfare.\\nThe war began in Spain with the Dos de Mayo Uprising on 2 May 1808 and ended on 17 April 1814 with the restoration of Ferdinand VII to the monarchy."},{"page_url":"https://en.wikipedia.org/wiki/Propebela_rassina","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Propebela_rassina_001.jpg","page_title":"Propebela rassina","context_page_description":"Propebela rassina is a species of sea snail, a marine gastropod mollusk in the family Conidae, the cone snails and their allies."},{"page_url":"https://pl.wikipedia.org/wiki/Michael_Bennet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Michael_Bennet_by_Gage_Skidmore.jpg","page_title":"Michael Bennet","context_page_description":"Michael Farrand Bennet – amerykański polityk polskiego i żydowskiego pochodzenia związany z Partią Demokratyczną, 20. Senator II klasy z Kolorado."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%B0%D1%82_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B_%D0%BF%D0%BE_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83_2000/2001","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/%D0%A4%D0%B5%D0%B4%D0%BE%D1%80%D0%B5%D0%BD%D0%BA%D0%BE._100_%D0%B3%D0%BE%D0%BB%D0%BE%D0%B2_%D0%B2%D0%BE%D1%80%D0%BE%D0%B1%D1%8C%D1%8F.jpg","page_title":"Чемпионат Украины по футболу 2000/2001","context_page_description":"10-й чемпионат Украины по футболу был разыгран с 12 июля 2000 года по 19 июня 2001 года. Победителем стало киевское «Динамо»."},{"page_url":"https://it.wikipedia.org/wiki/Koolhoven_F.K.43","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/SAFA_FK-43_L%27Aerophile_Salon_1932.jpg","page_title":"Koolhoven F.K.43","context_page_description":"Il Koolhoven F.K.43 fu un aeroplano monomotore da trasporto monoplano sviluppato dall'azienda aeronautica olandese Koolhoven negli anni trenta del XX secolo. Fu prodotto in una piccola serie di 20 esemplari, per la maggior parte da aziende terze."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%8B%E9%87%8C%E6%96%AF%E6%89%98%E5%BC%97%C2%B7%E8%90%8A%E7%89%B9%E6%A0%BC%E5%B8%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/FC_Admira_Wacker_M%C3%B6dling_vs._FC_Red_Bull_Salzburg_%28Cup%29_2017-04-26_%28104%29.jpg","page_title":"克里斯托弗·萊特格布","context_page_description":"克里斯托弗·莱特格布是一位奥地利足球运动员，在场上的位置是中场。他现在效力于奥地利足球超级联赛球队萨尔茨堡红牛足球俱乐部。他代表奥地利国家足球队参加了2008年欧洲足球锦标赛。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%99%D0%BE%D1%85%D0%B0%D0%BD_%D0%A1%D0%B5%D0%B1%D0%B0%D1%81%D1%82%D0%B8%D0%B0%D0%BD_%D0%91%D0%B0%D1%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Weimar_um_1735.jpg","page_title":"Йохан Себастиан Бах","context_page_description":"Йохан Себастиан Бах е немски композитор и клавирен майстор, признат за един от най-великите композитори в световната музикална история.\\nПредставител е на немската музикална школа и музикалното изкуство в периода и стила барок. До днес са оцелели и каталогизирани над хиляда негови произведения, а друга, навярно по-малка част е изгубена. Приживе е почитан най-вече като виртуозен изпълнител на орган и клавесин. В творчеството му са представени всички значими тогавашни жанрове освен операта и е признат майстор на полифонията. След смъртта на Бах музиката му бързо излиза от мода и се изпълнява все по-рядко, но през XIX век интересът към нея се засилва благодарение на някои ентусиасти, сред които най-известен днес е Феликс Менделсон Бартолди. Творчеството на Бах оказва силно влияние върху музиката на поколения композитори и изпълнители след него, включително и през XX век. Педагогическите произведения на Бах се използват по предназначение."},{"page_url":"https://vi.wikipedia.org/wiki/Ph%E1%BB%A5c_b%C3%ADch_t%E1%BA%A1i_ch%C3%A2u_%C3%82u","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Young_Folks%27_History_of_Rome_illus146.png","page_title":"Phục bích tại châu Âu","context_page_description":"Phục bích, còn được phiên âm là phục tích hay phục tịch, nghĩa đen là \\"khôi phục ngôi vua\\" là trường hợp một quân chủ đã từ nhiệm hoặc đã bị phế truất hay từng bị lật đổ bởi các cuộc cách mạng và đảo chính trong nước, thậm chí phải lưu vong do nạn ngoại xâm nhưng sau đó khôi phục lại được ngôi vị của mình.\\nDưới đây là bản danh sách liệt kê tất cả những cuộc phục bích trong lịch sử nhân loại trên phạm vi toàn châu Âu tự cổ chí kim, ngoài những vị vua chính thống được công nhận ở đây có bổ sung thêm những nhân vật có quyền lực tương đương quân chủ bao gồm: các vị vua tự xưng tồn tại ngắn ngủi, những vị quyền thần thế tập, những vị đứng đầu một chính thể độc lập kiểu như Tiết độ sứ hay Thống đốc và quân phiệt cát cứ thời loạn hoặc những vị nhiếp chính cùng hoàng tử giám quốc."},{"page_url":"https://en.wikipedia.org/wiki/David_Gabriel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Humanrelations.JPG","page_title":"David Gabriel","context_page_description":"Detective Sergeant David Gabriel is a fictional character featured in TNT's The Closer, portrayed by Corey Reynolds. Gabriel was a Sergeant in the Los Angeles Police Department's Priority Homicide Division. He was promoted to Detective during season five. He is seen as Deputy Chief Brenda Leigh Johnson's right-hand man.\\nEarly in the series, Sgt. Gabriel is a bright young officer eager to make his mark in the department. One of his strengths is he can defer to someone else when provided with a well thought-out reason to do so. As a consequence, he was one of the first to accept Deputy Chief Johnson. Commander Taylor has tried to recruit him from Johnson at least once.\\nIn the second season, Sgt. Gabriel confesses to Deputy Chief Johnson that he and Detective Irene Daniels are dating; Brenda initially did not receive this well, but she eventually comes to terms with it. In the third season, Sgt. Gabriel expresses an interest in entering politics and deftly provides a solution to avoid budget cuts and the loss of a member from Priority Homicide."},{"page_url":"https://fr.wikipedia.org/wiki/Pimorin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Pimorin_Eglise_2.jpg","page_title":"Pimorin","context_page_description":"Pimorin est une commune française située dans le département du Jura en région Bourgogne-Franche-Comté. Il n'existe aucun nom officiel pour désigner les habitants de Pimorin. En revanche le nom de moelleux leur était souvent associé. L'orthographe du nom a beaucoup évolué au cours des siècles : Piedmourin, Piémorin, Piedmourain, Pimorain, Puimorin, Pymorain, Pymoran, Pymorin, ou encore Paynmoren\\nCe village traditionnel de la petite montagne a longtemps été caractérisé par sa pauvreté et sa grande ruralité, qui s'explique notamment par son éloignement de tout centre urbain. L'exode rural, qui a commencé au milieu du XIXᵉ siècle, s'est accéléré au cours de la première partie du XXᵉ siècle, divisant par plus de quatre sa population."},{"page_url":"https://zh.wikipedia.org/wiki/He_100%E6%88%B0%E9%AC%A5%E6%A9%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/He_100D_colour.jpg","page_title":"He 100戰鬥機","context_page_description":"1933年納粹德國空軍要求有新式戰鬥機去取代舊式的He 51雙翼戰鬥機，當時有4家公司參與設計投標，最後祇剩下梅塞施密特的Bf 109戰鬥機和亨克爾的He 112，後來由Bf 109勝出，He 112落敗的其中原因是速度不及Bf 109和其機身以曲線構成而不利生產，1936年納粹德國空軍雖然宣布採用Bf 109但也宣布需要另一種比之更先進的戰鬥機，這次亨克爾吸取了He 112的教訓，還取了100作為幸運號碼成為He 100，設計師是岡特兄弟"},{"page_url":"https://en.wikipedia.org/wiki/Military_history_of_Cambodia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Eisenhower_and_Sihanouk_1959.jpg","page_title":"Military history of Cambodia","context_page_description":"The earliest traces of armed conflict in the territory that constitutes modern Cambodia date to the Iron Age settlement of Phum Snay in north-western Cambodia.\\nSources on Funan's military structure are rare. Funan represents the oldest known regional political entity, formed by the unification of local principalities. Whether these events must be categorized as conflict remains unclear More information is available for Funan's successor state - Chenla, which has been characterized as distinctly bellicose as it was established by the military subjugation of Funan. Chenla's early aristocrats heralded authority by public display of their noble genealogies carved onto stone stelae all over Indochina. Later, rulers increasingly embraced the concept of divine Hindu kingship.\\nThe Khmer Empire's territory and integrity was maintained through the Royal Army, personally commanded by the king. Records exist for regular conflict with the kingdom's neighbors, Champa in particular, as the empire effectively controlled Mainland South-east Asia by the 12th century. Nonetheless, the Khmer kingdom suffered a number of serious defeats, such as the Cham invasion and sack of Angkor in 1177."},{"page_url":"https://ca.wikipedia.org/wiki/Bodianus_izuensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/TanukiBRyg.jpg","page_title":"Bodianus izuensis","context_page_description":"Bodianus izuensis és una espècie de peix de la família dels làbrids i de l'ordre dels perciformes."},{"page_url":"https://es.wikipedia.org/wiki/Monte_Ararat","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Vittore_Carpaccio_066.jpg","page_title":"Monte Ararat","context_page_description":"El monte Ararat es el pico más alto de Turquía, con 5137 m s. n. m., localizado en la parte oriental del país, muy cerca de la frontera con Irán y Armenia. Se trata de un volcán inactivo cuya cima se encuentra cubierta de nieves perpetuas.\\nA pesar del consenso académico de que las \\"montañas de Ararat\\" del Libro del Génesis no se refieren específicamente a este monte, el Monte Ararat ha sido sin embargo ampliamente aceptado en el cristianismo, en el judaísmo y en el islam como el lugar de descanso del Arca de Noé."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A_%D8%A3%D9%85_%D8%A3%D9%88%D8%A8%D9%84%D9%88%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/T-84_Oplat_guided_onto_a_tank_transporter.jpg","page_title":"بي أم أوبلوت","context_page_description":"بي أم أوبلوت هي دبابة أوكرانيا، بنية لتكون مشابهة لتي-84 صنعة للمرة الأولى سنة 2008، ودخلت الخدمة سنة 2009 في القوات المسلحة الأوكرانية"},{"page_url":"https://lb.wikipedia.org/wiki/Nationalpolitische_Erziehungsanstalt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Bundesarchiv_Bild_146-1978-013-07%2C_Nationalpolitische_Erziehungsanstalt.jpg","page_title":"Nationalpolitische Erziehungsanstalt","context_page_description":"D'Nationalpolitisch Erziehungsanstalten waren Internatsuewerschoulen, déi no der Muechtergräifung an Däitschland vun den Nationalsozialisten 1933 als \\"Gemeinschaftserzéiungsplaze\\" gegrënnt goufen.\\nNapolae fir Meedercher sinn eréischt zanter 1938 entstanen, dorënner och d'Nationalpolitische Erziehungsanstalt Kolmar-Berg zu Lëtzebuerg.\\nEt huet sech ëm Eliteschoule fir den nationalsozialisteschen Nowues gehandelt. Haaptaufgab war d'\\"Erzéiung zu Nationalsozialisten, dichteg a Leif a Séil fir den Déngscht u Vollek a Staat\\". D'Schüler sollten déi nei Führungsschicht vun Däitschland bilden.\\nBis zum Ufank vum Krich hunn d'Napolaen als staark politesch accentuéiert Eliteschoulen am Kader vum méi héije Schoulwiese fir Allgemengbildung fungéiert; wärend dem Krich hu se sech ëmmer méi zu Nowuesschoule fir SS a Wehrmacht entwéckelt. Organisatoresch ware se vun der allgemenger Schoulverwaltung getrennt."},{"page_url":"https://en.wikipedia.org/wiki/Gharb_al-Andalus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Taifas2.gif","page_title":"Gharb al-Andalus","context_page_description":"Gharb al-Andalus, or just al-Gharb, was the name given by the Muslims of Iberia to the region of southern modern-day Portugal and part of West-central modern day Spain during their rule of the territory, from 711 to 1249. This period started with the fall of the Visigothic kingdom after Tariq ibn-Ziyad's invasion of Iberia and the establishment of the Umayyad control in the territory. The present day Algarve derives its name from this Arabic name. The region had a population of about 500,000 people."},{"page_url":"https://es.wikipedia.org/wiki/William_Rufus_Shafter","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Charge_on_El_Caney.jpg","page_title":"William Rufus Shafter","context_page_description":"William Rufus Shafter fue un oficial del Ejército de la Unión durante la Guerra Civil, quien recibió la máxima condecoración de Estados Unidos, la medalla de honor, por sus acciones en la batalla de Fair Oaks. Shafter también jugó un papel destacado como general-mayor en la Guerra Hispano-Estadounidense. Era conocido informalmente como «Pecos Bill».​"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/AkdamarKilisasi2.jpg","page_title":"وان","context_page_description":"وان، بزرگترین شهر در شرق ترکیه که مرکز استان وان می‌باشد. وان یکی از شهرهای تاریخی ترکیه با جمعیت ۳۶۱٬۱۶۳ نفر است که امروزه به حدود ۶۰۰٬۰۰۰ نفر هم رسیده‌است. زبان مردم شهر وان کُردی و اقلیتی تُرکی است اما به هر دلیلی، زبان محاوره‌ای تمام اهالی شهر تُرکی است.\\nاین شهر از شمال و غرب به دریاچه وان از شرق به کوه‌های مرتفع سیاه کوه و اِرک و از جنوب به کوه آرتوس چسبیده‌است.\\nعمده شهرت جهانی این شهر به دلیل وجود گربه‌های سفید پشمالویی با یک چشم آبی و دیگری زردرنگ است که به گربه وان مشهوراند.\\nهمچنین وان نام دریاچه‌ای است که شهر وان در شرق آن واقع است.\\nاز روستاهای قدیمی حومه شمالی وان که هم‌اینک بخشی از شهر شده می‌توان به روستای شهباغ اشاره کرد که منطقه‌ای با باغ‌های فراوان است.\\nآب و هوای شهر وان:"},{"page_url":"https://cs.wikipedia.org/wiki/Kanton_Bonn%C3%A9table","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Map_canton_code_72_03.svg","page_title":"Kanton Bonnétable","context_page_description":"Kanton Bonnétable je francouzský kanton v departementu Sarthe v regionu Pays de la Loire. Tvoří ho osm obcí."},{"page_url":"https://en.wikipedia.org/wiki/113th_United_States_Congress","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/113th_US_House.svg","page_title":"113th United States Congress","context_page_description":"The 113th United States Congress was a meeting of the legislative branch of the United States federal government, from January 3, 2013, to January 3, 2015, during the fifth and sixth years of Barack Obama's presidency. It was composed of the United States Senate and the United States House of Representatives based on the results of the 2012 Senate elections and the 2012 House elections. The seats in the House were apportioned based on the 2010 United States Census. It first met in Washington, D.C. on January 3, 2013, and it ended on January 3, 2015. Senators elected to regular terms in 2008 were in the last two years of those terms during this Congress.\\nThe Senate had a Democratic majority, while the House had a Republican majority. As of 2019, this is the last Congress in which Democrats controlled the Senate."},{"page_url":"https://de.wikipedia.org/wiki/Oberl%C3%A4ndischer_Kanal","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Jelenie%2C_lodn%C3%AD_v%C3%BDtah%2C_pohled_zhora.JPG","page_title":"Oberländischer Kanal","context_page_description":"Der Oberländische Kanal, auch Oberlandkanal, Kanal Elbing-Osterode oder Elbing-Oberländischer Kanal genannt, befindet sich im Oberland der polnischen Woiwodschaft Ermland-Masuren. Er wurde von 1844 bis 1860 unter der Leitung des königlich preußischen Baurats Georg Steenke aus Königsberg erbaut. Mitarbeiter beim Bau des Oberländischen Kanals waren die Ingenieure Wilhelm Severin und Carl Lentze, der hauptsächlich als Konstrukteur der Weichselbrücke in Dirschau bekannt wurde und später beim Bau des Sueskanals mitwirkte.\\nDer Oberländische Kanal verbindet mehrere Seen wie den Geserichsee und Städte in Ostpreußen von Iława über Ostróda bis Elbląg zum Frischen Haff. Die Länge des Kanals beträgt 129,8 km bis Iława, wobei der Abschnitt Elbląg–Ostróda, mit dem der Kanal zumeist identifiziert wird, 82 km lang ist.\\nAls Besonderheit und heutige Touristenattraktion gelten die fünf Rollberge, auf denen die Schiffe zur Bewältigung des Höhenunterschieds von 99 Metern auf Schienenwagen über Land transportiert werden. Sie sind als Standseilbahnen ausgelegt, die von Wasserrädern angetrieben werden. Das Kanalsystem gilt als technisches Denkmal und steht unter Denkmalschutz."},{"page_url":"https://fr.wikipedia.org/wiki/Bure-les-Templiers","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Romprey14.JPG","page_title":"Bure-les-Templiers","context_page_description":"Bure-les-Templiers est une commune française située dans le canton de Châtillon-sur-Seine du département de la Côte-d'Or en région Bourgogne-Franche-Comté."},{"page_url":"https://eu.wikipedia.org/wiki/Sara","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Sara_JaI_Alai_Lapurdi.JPG","page_title":"Sara","context_page_description":"Sara Lapurdiko hegoaldeko udalerri bat da, Ezpeletako kantonamenduan kokatua. Xareta elkartea osatzen du, Ainhoa, Urdazubi eta Zugarramurdi udalerriekin batera."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CE%B7%CE%BC%CE%B1%CE%AF%CE%B1_%CF%84%CE%B7%CF%82_%CE%A4%CE%BF%CF%85%CF%81%CE%BA%CE%B9%CE%BA%CE%AE%CF%82_%CE%94%CE%B7%CE%BC%CE%BF%CE%BA%CF%81%CE%B1%CF%84%CE%AF%CE%B1%CF%82_%CF%84%CE%B7%CF%82_%CE%92%CF%8C%CF%81%CE%B5%CE%B9%CE%B1%CF%82_%CE%9A%CF%8D%CF%80%CF%81%CE%BF%CF%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Flag_of_the_President_of_the_Turkish_Republic_of_Northern_Cyprus.svg","page_title":"Σημαία της Τουρκικής Δημοκρατίας της Βόρειας Κύπρου","context_page_description":"Η σημαία της Τουρκικής Δημοκρατίας της Βόρειας Κύπρου βασίζεται στα φερώνυμα σύμβολα στη σημαία της Τουρκίας δηλαδή στα χρώματα της τουρκικής σημαίας τα σύμβολά της. Στη σημαία του ψευδοκράτους υπάρχουν δύο κόκκινες οριζόντιες λωρίδες ανά μία στο άνω και στο κάτω μέρος. Επίσης, η ορθία ημισέληνος και το αστέρι, φέρονται στο μέσον με κόκκινο χρώμα.\\nΗ σημαία επιλέχθηκε έπειτα από διαγωνισμό."},{"page_url":"https://ceb.wikipedia.org/wiki/Star%C3%BD_Bohum%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/View_of_Star%C3%BD_Bohum%C3%ADn.JPG","page_title":"Starý Bohumín","context_page_description":"Bahin nga lungsod ang Starý Bohumín sa Nasod nga Czech. Nahimutang ni sa lalawigan sa Moravskoslezský kraj, sa sidlakang bahin sa nasod, 280 km sa sidlakan sa Prague ang ulohan sa nasod. 200 metros ibabaw sa dagat kahaboga ang nahimutangan sa Starý Bohumín, ug adunay 23,034 ka molupyo.\\nAng yuta palibot sa Starý Bohumín kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 271 ka metro ug 4.9 km sa kasadpan sa Starý Bohumín. Dunay mga 881 ka tawo kada kilometro kwadrado sa palibot sa Starý Bohumín nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Ostrava, 9.9 km sa habagatan sa Starý Bohumín. Hapit nalukop sa kabalayan ang palibot sa Starý Bohumín.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 21 °C, ug ang kinabugnawan Enero, sa -7 °C. Ang kasarangang pag-ulan 1,236 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 160 milimetro nga ulan, ug ang kinaugahan Abril, sa 62 milimetro."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%B9%BF%E5%AF%A8%E7%9C%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/ChinaLiuzhouLuzhai.png","page_title":"鹿寨県","context_page_description":"鹿寨県は中華人民共和国広西チワン族自治区柳州市に位置する県。"},{"page_url":"https://es.wikipedia.org/wiki/Bernardino_Rossi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Lucia_Malatesta_by_his_husband_Bernardino_Rossi.png.jpg","page_title":"Bernardino Rossi","context_page_description":"Bernardino Rossi fue un pintor italiano que desarrolló su carrera mayoritariamente en el Ducado de Módena.​"},{"page_url":"https://pl.wikipedia.org/wiki/Mala_Subotica","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Mala_Subotica%2C_Glavna_ulica.jpg","page_title":"Mala Subotica","context_page_description":"Mala Subotica – wieś w Chorwacji, w żupanii medzimurskiej, w gminie Mala Subotica. W 2011 roku liczyła 1986 mieszkańców."},{"page_url":"https://en.wikipedia.org/wiki/Outpatients_(band)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Outpatients_in_Buenos_Aires%2C_Argentina.jpg","page_title":"Outpatients (band)","context_page_description":"Outpatients was an American hardcore/metal band formed in Westfield, Massachusetts in 1982 by brothers Vis Helland and Scott Helland with drummer Mike Kingsbury, and is considered to be among the first western mass hardcore bands to cross over to a thrash metal sound, and to tour outside the United States. Outpatients were known for their highly energetic live stage shows while maintaining a tight musical performance. The group’s sound, imagery and themes have been referenced and borrowed by numerous subsequent bands."},{"page_url":"https://en.wikipedia.org/wiki/Heathenry_(new_religious_movement)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Amulet_Thor%27s_hammer_%28copy_of_find_from_Sk%C3%A5ne%29_2010-07-10.jpg","page_title":"Heathenry (new religious movement)","context_page_description":"Heathenry, also termed Heathenism, contemporary Germanic Paganism, or Germanic Neopaganism, is a modern Pagan religion. Scholars of religious studies classify it as a new religious movement. Developed in Europe during the early 20th century, its practitioners model it on the pre-Christian belief systems adhered to by the Germanic peoples of the Iron Age and Early Middle Ages. In an attempt to reconstruct these past belief systems, Heathenry uses surviving historical, archaeological, and folkloric evidence as a basis, although approaches to this material vary considerably.\\nHeathenry does not have a unified theology but is typically polytheistic, centering on a pantheon of deities from pre-Christian Germanic Europe. It adopts cosmological views from these past societies, including an animistic view of the cosmos in which the natural world is imbued with spirits. The religion's deities and spirits are honored in sacrificial rites known as blóts in which food and libations are offered to them. These are often accompanied by symbel, the act of ceremonially toasting the gods with an alcoholic beverage."},{"page_url":"https://en.wikipedia.org/wiki/British_Rail_Mark_4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Mark_IV_TSO_Interior.jpg","page_title":"British Rail Mark 4","context_page_description":"British Rail's fourth design of passenger carriages was designated Mark 4, built for use in InterCity 225 sets on the East Coast Main Line between King's Cross, Leeds, Newcastle and Edinburgh.\\nAs of July 2020, 19 Mark 4s have been scrapped, 144 are still in service, and 139 are in storage."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D8%B1%D9%88%D9%85%DB%8C%D8%AF_%DA%86%DB%8C%D9%86%DA%A9%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Bromid_zine%C4%8Dnat%C3%BD.PNG","page_title":"برومید چینکو","context_page_description":"برومید چینکو بیر شیمیایی ماده. آغ، کریستال، تۇز حالتینده تاپیلار. متال هالید کیمی تانینیر. برومید چینکو بروم بیلشیک‌لری گروه یا قروپوندا یئرلشیر."},{"page_url":"https://fr.wikipedia.org/wiki/Comerica_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Comerica_Scoreboard.jpg","page_title":"Comerica Park","context_page_description":"Le Comerica Park est un stade de baseball situé dans le centre de Détroit, aux États-Unis, à côté du Ford Field, le stade des Lions. Il a été construit pour remplacer le vieux Tiger Stadium. Le stade est sponsorisé par Comerica qui est une société de services financiers originaire de Détroit dont le siège social a été déplacé à Dallas en 2007.\\nDepuis 2000, ses locataires sont les Tigers de Detroit, une équipe de baseball évoluant en Ligue majeure de baseball et qui jouait auparavant au populaire, mais ancien, Tiger Stadium. Le Comerica Park a une capacité de 41 782 places."},{"page_url":"https://fi.wikipedia.org/wiki/Bhopal","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Taj-ul-Masjid%2C_Bhopal.jpg","page_title":"Bhopal","context_page_description":"Bhopal on Madhya Pradeshin osavaltion pääkaupunki keskisessä Intiassa. Kaupungissa asui 1 883 381 ihmistä vuoden 2011 väestönlaskennan mukaan. Bhopal sijaitsee kukkulaisella alueella Malwan ylätasangolla. Etelää kohti mentäessä maa kohoaa hiljalleen Vindhya-vuoristoksi."},{"page_url":"https://de.wikipedia.org/wiki/Antoine_Laurent_de_Lavoisier","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Lavoisier_decomposition_air.png","page_title":"Antoine Laurent de Lavoisier","context_page_description":"Antoine Laurent de Lavoisier war ein französischer Chemiker und Naturwissenschaftler, Rechtsanwalt, Hauptzollpächter, Ökonom und Leiter der französischen Pulververwaltung. Er führte quantitative Messmethoden in die Chemie ein, erkannte die Rolle des Sauerstoffs bei der Verbrennung und widerlegte damit die damals vorherrschende Phlogistontheorie. Lavoisier schuf viele Grundlagen der modernen Chemie. Er gilt als deren Begründer und als Vater der ersten chemischen Revolution. Trotz seines hohen wissenschaftlichen Ansehens und seines Engagements für Reformen wurde er wegen seiner Rolle im Ancien Régime ein Opfer der Terrorherrschaft während der Französischen Revolution."},{"page_url":"https://sv.wikipedia.org/wiki/Isbit","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Eiswuerfelform-silikon.jpg","page_title":"Isbit","context_page_description":"Isbit är en bit av is, och kan använda för att kyla ned någonting, exempelvis drycker såsom drinkar. Större isstycken brukar kallas isblock. Isbad kan syfta på vatten med isblock eller isbitar i."},{"page_url":"https://es.wikipedia.org/wiki/Plummer_(cr%C3%A1ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Plummer_sattelite_craters_map.jpg","page_title":"Plummer (cráter)","context_page_description":"Plummer es un cráter de impacto lunar. Se encuentra en la cara oculta de la Luna, al norte de la enorme planicie amurallada del cráter Apolo. A menos de un diámetro de Plummer hacia el norte se halla el cráter Wilsing, de tamaño similar.\\nSe trata de una formación de cráteres gastada, con varios impactos notables en el brocal. El más grande de éstos es el cráter satélite Plummer M, que yace sobre el sector meridional del borde. Un poco más pequeño es Plummer W, que se superpone a parte del borde exterior noroeste. Un cráter relativamente reciente también corta el borde hacia el este. El suelo interior de Plummer está marcado por solo unos pequeños cráteres, y un pico central bordea el punto medio por el este."},{"page_url":"https://es.wikipedia.org/wiki/Curt_Bois","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Bundesarchiv_B_145_Bild-P047613%2C_Curt_Bois_und_Fritz_Kortner_im_Schiller-Theater.jpg","page_title":"Curt Bois","context_page_description":"Curt Bois fue un actor alemán.\\nBois nació en Berlín y comenzó a actuar en 1907, convirtiéndose en uno de los primeros niños actores del cine, con un papel en la película del cine mudo Bauernhaus und Grafenschloß. En 1909, fue el actor principal en Der Kleine Detektiv.\\nLa carrera de Bois abarcó ochenta años, un período cuya duración no ha sido superada por otro actor. Su última actuación fue en 1987 en la película Der Himmel über Berlin de Wim Wenders. A lo largo de su carrera Bois actuó en teatro, cabaret, musicales, y cine mudo y sonoro.\\nEn 1933 Bois deja Alemania a causa del nazismo, en 1934 se exilia en los Estados Unidos, donde encontró trabajo en Broadway. En 1937, encuentra trabajo en Hollywood, y comienza a actuar en películas americanas, su papel más conocido fue en Casablanca. Tras la Segunda Guerra Mundial Bois decidió que era seguro volver a Alemania, lo que hizo en 1952. Acabó su vida y su carrera en Alemania, primero en la Alemania Oriental, y más tarde en la Alemania Occidental. Bois murió en Berlín, la ciudad donde nació, a la edad de 90 años.​"},{"page_url":"https://fr.wikipedia.org/wiki/Vanth","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Vanth.jpg","page_title":"Vanth","context_page_description":"Vanth, dans la mythologie étrusque, est la messagère de mort, c'est une déesse chtonienne, qui habite le monde souterrain."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_l%C3%A9%C4%8Div%C3%BDch_rostlin,_D%E2%80%93%C4%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Datura_stramonium_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-051.jpg","page_title":"Seznam léčivých rostlin, D–Ď","context_page_description":"Toto je seznam léčivých rostlin, jejichž český název začíná písmeny D a Ď.\\nCELÝ SEZNAM A-B-C-Č-D+Ď-E+F+G-H-Ch+I+J-K-L-M-N+O-P-R+Ř-S+Š-T+U-V+W+Y-Z+Ž"},{"page_url":"https://nl.wikipedia.org/wiki/Haritalodes_derogata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Haritalodes_derogata.jpg","page_title":"Haritalodes derogata","context_page_description":"Haritalodes derogata is een vlinder uit de familie grasmotten. De wetenschappelijke naam van deze soort is voor het eerst geldig gepubliceerd in 1775 door Fabricius.\\nDe soort komt voor in tropisch Afrika."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%BB%8D%E6%9C%8D_(%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9B%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/NRA_soldier_with_C96_and_gas_mask.jpg","page_title":"軍服 (中華民国)","context_page_description":"中華民国の軍服とは、中華民国建国以降、中華民国軍で使用されている軍服である。\\n中華人民共和国の軍服については、こちらを参照。"},{"page_url":"https://pt.wikipedia.org/wiki/Pal%C3%A1cio_dos_x%C3%A1s_de_Xirv%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Hajji_Gayyib_bathhouse%2C_2005.jpg","page_title":"Palácio dos xás de Xirvão","context_page_description":"Palácio dos xás de Xirvão é o maior monumento do ramo de Xirvão-Absheron da arquitectura do Azerbaijão, situado na cidade antiga de Bacu. O complexo contém o edifício principal do palácio, Divanhane, o cemitério burial vault, a mesquita de shah com um minarete, o mausoléu de Saíde Iáia Bacuvi, um portal na parte oriental da porta de Murade, um reservatório e os restos da casa dos banhos.\\nO palácio está representado no lado anverso da nota de 10,000 manat de 1994-2006 e na nota de 10 novos manat em circulação desde 2006."},{"page_url":"https://fr.wikipedia.org/wiki/Pic_ouentou","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Lineated_Woodpecker_%28Dendropicus_lineatus%29_female_%2828558789666%29.jpg","page_title":"Pic ouentou","context_page_description":"Le Pic ouentou est une espèce d'oiseaux de la famille des Picidae."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B2%E0%A4%BE%E0%A4%B5%E0%A4%BE%E0%A4%B0%E0%A4%BF%E0%A4%B8_%E0%A4%95%E0%A5%8D%E0%A4%B7%E0%A5%87%E0%A4%A4%E0%A5%8D%E0%A4%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/EricTheRedsLand.gif","page_title":"लावारिस क्षेत्र","context_page_description":"लावारिस क्षेत्र, जिसे लातिनी भाषा में 'टेरा नलिस' कहते हैं, ऐसे भौगोलिक क्षेत्र को कहा जाता है जिसपर किसी राष्ट्र का अधिकार न हो। ऐसे क्षेत्रों पर क़ब्ज़ा करके उन्हें किसी देश का भाग बनाया जा सकता है हालांकि वर्तमान विश्व में अधिकतर ऐसे क्षेत्रों पर नियंत्रण करना अंतर्राष्ट्रीय संधियों द्वारा वर्जित है।\\nउदाहरण के लिए सन् १९२० तक आर्कटिक महासागर में स्थित स्वालबार्ड द्वीप समूह एक लावारिस क्षेत्र था। यहाँ किसी भी देश का स्थाई क़ब्ज़ा नहीं था और केवल गर्मियों में व्हेल पकड़ने वाले कुछ मछुआरे यहाँ आया करते थे। ९ फ़रवरी १९२० में की गई स्वालबार्ड संधि के अंतर्गत इस लावारिस क्षेत्र को नोर्वे का हिस्सा बना दिया गया। इसी तरह ऑस्ट्रेलिया पर क़ब्ज़ा करने के लिए ब्रिटेन ने वहाँ के आदिवासियों को अनदेखा करते हुए उसे एक लावारिस क्षेत्र' घोषित कर दिया और उसपर क़ब्ज़ा कर लिए। १९६७ की अंतरिक्ष संधि के अंतर्गत चन्द्रमा और अन्य खगोलीय वस्तुएँ हमेशा के लिए लावारिस क्षेत्र घोषित की गई हैं। इनपर किसी देश का क़ब्ज़ा मान्य नहीं होगा और यह सभी मानवों की सांझी धरोहर बताई जाती हैं।"},{"page_url":"https://en.wikipedia.org/wiki/Continental_shelf","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Continental_shelf.png","page_title":"Continental shelf","context_page_description":"A continental shelf is a portion of a continent that is submerged under an area of relatively shallow water known as a shelf sea. Much of these shelves has been exposed during glacial periods and interglacial periods. The shelf surrounding an island is known as an insular shelf.\\nThe continental margin, between the continental shelf and the abyssal plain, comprises a steep continental slope, surrounded by the flatter continental rise, in which sediment from the continent above cascades down the slope and accumulates as a pile of sediment at the base of the slope. Extending as far as 500 km from the slope, it consists of thick sediments deposited by turbidity currents from the shelf and slope. The continental rise's gradient is intermediate between the gradients of the slope and the shelf.\\nUnder the United Nations Convention on the Law of the Sea, the name continental shelf was given a legal definition as the stretch of the seabed adjacent to the shores of a particular country to which it belongs."},{"page_url":"https://en.wikipedia.org/wiki/VIII_Fighter_Command","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/RAF_Debden_-_8th_Fighter_Command_P-51D_Mustangs_on_Line.jpg","page_title":"VIII Fighter Command","context_page_description":"The VIII Fighter Command was a United States Army Air Forces unit of command above the Wings and below the numbered air force. Its primary mission was command and control of fighter operations within the Eighth Air Force. In the World War II European Theater, its primary mission was air superiority. Its last assignment was with the United States Air Forces in Europe, being stationed at RAF Honington,\\nIt was formed at Selfridge Field, Michigan in February 1942. In May, the headquarters moved to England to conduct combat operations over Occupied Europe. After the end of the European War in May 1945, VIII Fighter Command took part in the occupation of Germany until May 1946 while simultaneously coordinating its own demobilization. It inactivated in March 1946 at RAF Honington, the last Royal Air Force station used by the USAAF to be returned to the British Air Ministry."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%9Aled%C5%BA_(turystyka)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Zeltnagel.jpg","page_title":"Śledź (turystyka)","context_page_description":"Śledź – w turystyce przedmiot będący częścią namiotu, szpikulec, długi kawałek pręta lub zaostrzony kołek wbijany w ziemię, czasami z haczykiem lub otworkiem na końcu, wykonany zwykle z metalu, drewna, plastiku lub materiału kompozytowego. Śledzie służą do przytrzymania namiotu do ziemi, rozciągnięcia i wzmocnienia całej konstrukcji. Śledzie są albo bezpośrednio łączone z namiotem, albo z przymocowanymi do niego linkami. Zadanie śledzi mogą czasami spełniać inne stabilne przedmioty, takie jak wbite w ziemie małe kłody, wytrzymałe gałązki, krzewy itd."},{"page_url":"https://simple.wikipedia.org/wiki/Los_Angeles_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Curving_ramp_supported_over_Arroyo_Seco.jpg","page_title":"Los Angeles River","context_page_description":"The Los Angeles River is a river flowing through Los Angeles County, California, in the United States. About 51 miles long, it flows from Canoga Park south and west to its end at the Long Beach Harbor, in San Pedro Bay, part of the Pacific Ocean. The basin is rimmed by the San Gabriel Mountains, Santa Monica Mountains and Santa Susana Mountains, as well as several smaller mountain ranges. Much of the water that flows in the Los Angeles River flows in from tributaries that come from the mountains.\\nThe river was once free-flowing, winding across a floodplain that occupied much of the Los Angeles Basin. With its frequent floods, it often changed course, causing erosion and depositing silt in other places. When the city of Los Angeles had its first settlers around the 1850s, the river was its main water source. With the opening of the Los Angeles Aqueduct in 1913, the Los Angeles River was no longer needed as a water source. Today, the Los Angeles River runs in a fixed course through a concrete channel for nearly its whole length. It is heavily polluted. The primary source of water during summer and fall is the Donald C. Tillman Water Reclamation Plant in Van Nuys."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CE%BA%CE%BF%CF%84%CE%BF%CF%8D%CF%83%CF%83%CE%B1_%CE%A6%CE%B1%CF%81%CF%83%CE%AC%CE%BB%CF%89%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Trichalkon%2C_Skotoussa%2C_Thessaly%2C_mid_4th_century_BC.jpg","page_title":"Σκοτούσσα Φαρσάλων","context_page_description":"Η Σκοτούσσα ήταν αρχαία πόλη της Θεσσαλίας μεταξύ των Φαρσάλων και της Λάρισας. Είναι κυρίως γνωστή για την περιοχή Κυνός Κεφαλές έξω από την πόλη όπου δόθηκε η ομώνυμη μάχη κατά την αρχαιότητα μεταξύ των Μακεδόνων και των Ρωμαίων. Στην σημερινή εποχή, σε κοντινή περιοχή υπάρχει μικρός οικισμός με την ίδια ονομασία ο οποίος υπάγεται στον δήμο Φαρσάλων, και σύμφωνα με την απογραφή του 2011 έχει πληθυσμό 97 κατοίκων."},{"page_url":"https://en.wikipedia.org/wiki/Frankfurt_City_Link_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/V36406_Eiserner-Steg_30092007.JPG","page_title":"Frankfurt City Link Line","context_page_description":"The Frankfurt City Link Line in Frankfurt am Main, Germany, emerged in the 19th century as a link line between Frankfurt's western stations at the Gallustor and the Frankfurt-Hanau railway in the east of the city. It was an initiative by the government of the Free City of Frankfurt.\\nOn 31 July 1859, services opened on the 6 km long route that, for the most part, followed the northern bank of the river Main. It was initially operated by the Frankfurt-Hanau Railway Company and, from 1872, the Hessian Ludwig Railway Company. Since the annexation of the free city into the Kingdom of Prussia in 1866 the line has remained in the ownership of the city authorities.\\nTo begin with only freight services ran between the stations within the city to the customs house and the harbour. From 1 June 1869 passenger services were also operated, including express trains from Frankfurt's western stations to central Germany. This traffic ended when in 1873 the state-operated Frankfurt–Bebra railway picked up these services on the left bank of the Main.\\nIn 1880 the line was extended by 1.7 km to the west."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D9%85%D8%B9_%D8%AA%D9%83%D8%A7%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/HamTak2.jpg","page_title":"جامع تكاب","context_page_description":"جامع تكاب هو مسجد تاريخي يعود إلى عصر القاجاريين، ويقع في تكاب."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A1%9C%EB%B2%A0%EB%A5%B4%ED%86%A0_%ED%8E%98%EB%A0%88%EC%9D%B4%EB%9D%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/RobertoPereyra.jpg","page_title":"로베르토 페레이라","context_page_description":"로베르토 막시밀리아노 페레이라는 아르헨티나의 축구 선수로 현재 프리미어리그 클럽인 왓퍼드에서 뛰고 있다."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B2%BD%EB%9D%BC%EA%B5%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/%EB%B6%80%EB%B2%BD%EB%A3%A8.jpg","page_title":"벽라교","context_page_description":"벽라교는 해방 전 평양에 있었던 다리로, 능라도의 수원지에서 평양 시내에 수도물을 공급하는 대형 수도관을 부설한 다리이다. 통칭 수도국 다리로 불렸다."},{"page_url":"https://en.wikipedia.org/wiki/Egon_Friedell","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Egon_Friedell.jpg","page_title":"Egon Friedell","context_page_description":"Egon Friedell was a prominent Austrian cultural historian, playwright, actor and Kabarett performer, journalist and theatre critic. Friedell has been described as a polymath. Before 1916, he was also known by his pen name Egon Friedländer."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%94%D0%B6%D0%B0%D0%B2%D0%B0%D0%BD%D1%8C%D0%BD%D1%96_%D0%91%D0%B0%D0%BA%D0%B0%D1%87%D1%87%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Giovanni_Boccaccio.jpg","page_title":"Джаваньні Бакачча","context_page_description":"Джаваньні Бакачча — італьянскі паэт і празаік, яскравы прадстаўнік гуманізму Раньняга Адраджэньня. Пазашлюбны сын флярэнтынскага купца. Дзяцінства правёў у Флярэнцыі, потым вывучаў права і гандаль у Нэапалі. Пасьля навучаньня вярнуўся ў Флярэнцыю. Сябраваў з Пэтраркам. Быў вялікім знаўцам клясыкі, перш за ўсё Тацыта і Тыта Лівія. Пачаў пісаць вершы і паэмы для арыстакратычнай публікі каралеўскага двара, якія зрабілі яго вядомым паэтам."},{"page_url":"https://de.wikipedia.org/wiki/Scenic_Airlines","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Scenic_Airlines_Ford_5-AT-B_Tri-Motor_at_McCarran_International_Airport.jpg","page_title":"Scenic Airlines","context_page_description":"Scenic Airlines ist eine amerikanische Fluggesellschaft mit Sitz in Las Vegas.\\nSie hat sich auf die Durchführung von Ausflugs- und Besichtigungsflügen zwischen Las Vegas und dem Grand Canyon spezialisiert."},{"page_url":"https://pt.wikipedia.org/wiki/Norbury_Manor","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Norbury%2C_Derbyshire_-_Ralph_Fitzherbert_and_wife_detail.jpg","page_title":"Norbury Manor","context_page_description":"O Norbury Manor é um palácio rural inglês constituído por um solar do século XV, em Estilo Isabelino, e por um edifício medieval em pedra do século XIII, Norbury Hall, conhecido como The Old Manor. Situa-se em Norbury, próximo de Ashbourne, no Derbyshire. É um listed building classificado com o Grau I."},{"page_url":"https://ca.wikipedia.org/wiki/Gerd_von_Rundstedt","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Bundesarchiv_Bild_183-L08129%2C_Gerd_v._Rundstedt.jpg","page_title":"Gerd von Rundstedt","context_page_description":"Karl Rudolf Gerd von Rundstedt. Conegut per ser un dels millors generals de la Wehrmacht durant la Segona Guerra Mundial, i per tenir un punt de vista apolític al llarg de la seva carrera.\\nNeix a Aschersleben dins d'una família aristòcrata prussiana pertanyent a l'elit Junker, von Rundstedt s'allista a l'exèrcit alemany l'any 1892. Ingressa a l'Escola de Guerra de Berlín l'any 1902, una institució que només acceptava 160 estudiants a l'any, dels quals el 75% mai acabava la instrucció.\\nEl 22 de gener de 1902 es casa amb Luise Bila von Götz amb qui té un fill, Hans Gerd von Rundstedt.\\nDurant la I Guerra Mundial ascendeix successivament en rang fins al 1918, quan és promogut a comandant."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%B1%D0%BE%D0%BD%D0%B0%D1%82_%D0%BA%D0%B0%D0%BB%D1%8C%D1%86%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Calcium_carbonate.png","page_title":"Карбонат кальция","context_page_description":"Карбона́т ка́льция — неорганическое химическое соединение, соль угольной кислоты и кальция. Химическая формула.\\nВ природе встречается в виде многочисленных минералов, например, кальцита, арагонита и ватерита, является главной составной частью известняка, мрамора, мела, входит в состав скорлупы яиц птиц и пресмыкающихся, а также в состав раковин моллюсков и некоторых других беспозвоночных.\\nНерастворим в воде и этаноле.\\nЗарегистрирован как белый пищевой краситель."},{"page_url":"https://sl.wikipedia.org/wiki/Kri%C5%BEarka_razreda_Spirit","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/MS_Costa_Mediterranea_3.jpg","page_title":"Križarka razreda Spirit","context_page_description":"Spirit ja razred osemnajstih potniških križark. Gradilo jih je podjetje Kvaerner Masa-Yards, v finski ladjedelnici Hietalahti. Nekaj ladij so zgradili tudi v Fincantierijevi ladjedelnici Marghera. Z ladjami operirajo družbe Carnival Cruise Lines, Costa Cruises, P&O Cruises, Cunard Line and Holland America Line - vse družbe so podružnice od Carnival Corporation. Ladje so velikosti Panamax, kar pomeni, da lahko plujejo skozi Panamski prekop.\\nLeta 2009 so predstavili križarko Costa Luminosa, ki je hibrid med razredom Spirit in razredom Vista.\\nSpirit je z 18 ladjami najbolj številen razred potniških križark."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B5%E0%A5%87%E0%A4%AC_%E0%A4%B8%E0%A4%B0%E0%A5%8D%E0%A4%B5%E0%A4%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Inside_and_Rear_of_Webserver.jpg","page_title":"वेब सर्वर","context_page_description":"वेब सर्वर वह सॉफ्टवेयर होता है जो वेब पेज सर्व करता है, अर्थात वह सॉफ्टवेयर जो वेब पेजों को उपयोक्ताओं तक पहुंचाता है। इसे दो भागों में बांट कर देखा जा सकता है: वह मशीन जिस पर वैबसर्वर को स्थापित किया जाता है और वो सॉफ्टवेयर जो वैब सर्वर की तरह काम करता है। ये पहला हार्डवेयर व दूसरा सॉफ्टवेयर होते हैं। सामान्यतयावे वेब पेज HTTP प्रोटोकॉल द्वारा उपयोक्ताओं तक पहुंचाये जाते है। किसी भी कंप्यूटर में वेब सर्वर का सॉफ्टवेयर स्थापित कर और उसे इंटरनेट से जोड़ कर उपयोक्ता उसे अंतरजाल पर वेब पेज प्रदान करने वाले वेब सर्वर में बदल सकते हैं। उपयोक्ता जो भी वेब पेज अंतरजाल पर देखते हैं वे उनके कंप्यूटर पर पास किसी ना किसी वेब सर्वर के द्वारा ही पहुंचाये जाते हैं। यदि उपयोक्ता अपने कंप्यूटर पर केवल सॉफ्टवेयर स्थापित करें और उसे इंटरनैट से ना जोड़े तो भी वो पूरा वेब सर्वर है जो कि केवल स्थानीय रूप से उपयोक्ता के लिये काम करेगा।"},{"page_url":"https://en.wikipedia.org/wiki/Fishing_industry_in_Russia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Russian_Federation_%28orthographic_projection%29.svg","page_title":"Fishing industry in Russia","context_page_description":"The coastline of the Russian Federation is the fourth longest in the world after the coastlines of Canada, Greenland, and Indonesia. The Russian fishing industry has an exclusive economic zone of 7.6 million km² including access to twelve seas in three oceans, together with the landlocked Caspian Sea and more than two million rivers.\\nAccording to the FAO, in 2005 the Russian fishing industry harvested 3,190,946 tonnes of fish from wild fisheries and another 114,752 tonnes from aquaculture. This made Russia the ninth leading producer of fish, with 2.3 percent of the world total."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_P%C5%A1ov%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Chlum_-_Kostel_svat%C3%A9ho_Jilj%C3%AD.jpg","page_title":"Seznam kulturních památek v Pšově","context_page_description":"Tento seznam nemovitých kulturních památek v obci Pšov v okrese Karlovy Vary vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://pl.wikipedia.org/wiki/Gy%C5%91ri_ETO_KC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Gy%C5%91ri_Graboplast_ETO_II.-LRI-Mal%C3%A9v_SC.jpg","page_title":"Győri ETO KC","context_page_description":"Győri ETO KC – klub piłki ręcznej z Węgier, powstały w 1948 roku z siedzibą w Győr. Klub dzieli się na dwie sekcje: kobiet i mężczyzn. Drużyny występują w najwyższej klasie rozgrywek piłki ręcznej na Węgrzech. Drużyna kobiet występuje pod nazwą Győri Audi ETO KC, a drużyna mężczyzn nosi nazwę GyőrHő ETO FKC"},{"page_url":"https://fr.wikipedia.org/wiki/Bawley","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Bawley_Doris_lo284_from_Leigh%2C_built_by_john_cann_at_Harwich.jpg","page_title":"Bawley","context_page_description":"Un bawley est un type de voilier anglais gréé en cotre, utilisé dans l'estuaire de la Tamise et la Medway pour la pêche à la crevette et le ramassage des huitres du XIXᵉ au XXᵉ siècle.\\nLes bawleys ont été équipés de moteurs durant le XXᵉ siècle, les exemplaires restant sont utilisés comme voilier de loisir."},{"page_url":"https://io.wikipedia.org/wiki/Listo_pri_prezidanti_di_Salvador","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Juan_Lindo00001.JPG","page_title":"Listo pri prezidanti di Salvador","context_page_description":"La prezidanto esas la chefo di stato e chefo di guvernerio di Salvador. Segun nuna konstituco, la populo elektas lu por 5-yara periodo.\\nYen la listo di prezidanti di Salvador depos 1841."},{"page_url":"https://ca.wikipedia.org/wiki/Liocourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Eglise_Liocourt.JPG","page_title":"Liocourt","context_page_description":"Liocourt és un municipi francès, situat al departament del Mosel·la i a la regió del Gran Est. L'any 2007 tenia 139 habitants."},{"page_url":"https://vi.wikipedia.org/wiki/Poysippi,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/WIMap-doton-Poysippi.png","page_title":"Poysippi, Wisconsin","context_page_description":"Poysippi là một thị trấn thuộc quận Waushara, tiểu bang Wisconsin, Hoa Kỳ. Năm 2010, dân số của thị trấn này là 912 người."},{"page_url":"https://es.wikipedia.org/wiki/Hospital_del_Henares","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Logotipo_del_SERMAS_%28RPS_10-03-2012%29.png","page_title":"Hospital del Henares","context_page_description":"El Hospital Universitario del Henares es un hospital general público situado en el municipio de Coslada, en España."},{"page_url":"https://eo.wikipedia.org/wiki/Courtonne-les-Deux-%C3%89glises","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Map_commune_FR_insee_code_14194.png","page_title":"Courtonne-les-Deux-Églises","context_page_description":"Courtonne-les-Deux-Églises estas franca komunumo situanta en departemento Calvados, regiono Normandio.\\nĜiaj enloĝantoj nomiĝas Courtonnais."},{"page_url":"https://es.wikipedia.org/wiki/Essigny-le-Grand","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Essigny_le_grand.png","page_title":"Essigny-le-Grand","context_page_description":"Essigny-le-Grand es una comuna francesa situada en el departamento de Aisne, de la región de Alta Francia."},{"page_url":"https://az.wikipedia.org/wiki/Berlin_zoopark%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Berlin_Elefantentor_09-2017.jpg","page_title":"Berlin zooparkı","context_page_description":"Berlin zooparkı — Almaniyanın paytaxtı Berlində yerləşən zoopark."},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%BA%CF%81%CE%B1%CE%BD_%CE%9A%CE%B1%CE%BD%CE%AC%CF%81%CE%B9%CE%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Gran_Canaria_NWW.jpg","page_title":"Γκραν Κανάρια","context_page_description":"Η Γκραν Κανάρια είναι το τρίτο μεγαλύτερο νησί των Καναρίων Νήσων, στον Ατλαντικό, 210 χλμ. από την βορειοδυτική ακτή της Αφρικής, και ανήκει στην Ισπανία. Βρίσκεται νοτιοανατολικά της Τενερίφης και δυτικά της Φουερτεβεντούρα. Είναι το δεύτερο μεγαλύτερο σε πληθυσμό νησί του αρχιπελάγους, μετά από Τενερίφη. Το νησί είναι ηφαιστειακής προέλευσης, το οποίο προήλθε περισσότερο από σχισμές ηφαιστειακής λάβας.\\nΤο νησί κατοικήθηκε από τους Γκουάντσες ή Κανάριος, οι οποίοι ήταν Βέρβεροι που αφίχθησαν εκεί αρκετά νωρίς, το 500 π.Χ. Οι Κανάριος ονόμαζαν το νησί Ταμαράν. Το νησί διεκδικήθηκε από την Ισπανία τον 15ο αιώνα.\\nΗ επιφάνεια της Γκραν Κανάρια είναι 1.560 χλμ² και το μέγιστο υψόμετρο της είναι 1.949 μ. Έχει σχεδόν κυκλικό σχήμα, με διάμετρο περίπου 50 χλμ.\\nΤο νησί έχει πληθυσμό 846.085 κατοίκους από τους οποίους οι 381.271 στην πρωτεύουσα Λας Πάλμας ντε Γκραν Κανάρια. Η πόλη είναι η μεγαλύτερη των Καναρίων Νήσων, επίσης η πρωτεύουσα της επαρχίας Λας Πάλμας, και επίσης μια απ' τις δυο πρωτεύουσες της αυτόνομης κοινότητας των Καναρίων Νήσων, μαζί με την Σάντα Κρουθ ντε Τενερίφε."},{"page_url":"https://en.wikipedia.org/wiki/16-cell","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Venn_0000_0001_0001_0110.png","page_title":"16-cell","context_page_description":"In four-dimensional geometry, a 16-cell is a regular convex 4-polytope. It is one of the six regular convex 4-polytopes first described by the Swiss mathematician Ludwig Schläfli in the mid-19th century. It is also called C₁₆, hexadecachoron, or hexdecahedroid.\\nIt is a part of an infinite family of polytopes, called cross-polytopes or orthoplexes, and is analogous to the octahedron in three dimensions. It is Coxeter's polytope. Conway's name for a cross-polytope is orthoplex, for orthant complex. The dual polytope is the tesseract, which it can be combined with to form a compound figure. The 16-cell has 16 cells as the tesseract has 16 vertices."},{"page_url":"https://it.wikipedia.org/wiki/Duello_Burr-Hamilton","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Aaron_Burr-2.jpg","page_title":"Duello Burr-Hamilton","context_page_description":"Il duello Burr-Hamilton ebbe luogo l'11 luglio 1804 a Weehawken, località del New Jersey non distante da New York, tra i due uomini politici Aaron Burr — all'epoca vicepresidente in carica degli Stati Uniti — e Alexander Hamilton, già primo segretario al tesoro dal 1789 al 1795.\\nIl duello fu il culmine di una lunga e aspra rivalità tra i due politici e si risolse con la morte di Hamilton, deceduto il giorno dopo essere stato ferito dal colpo sparatogli da Burr.\\nSi trattò di una delle rivalità interpersonali più famose della storia degli Stati Uniti: la tensione tra i due raggiunse un punto insostenibile quando su un quotidiano di Albany, in piena campagna governatoriale di New York del 1804 che vedeva lo stesso Burr tra i candidati alla massima carica di quello stato, apparve un articolo che riportava dichiarazioni di Hamilton che Burr ritenne diffamatorie.\\nAll'epoca già illegale in molti Stati dell'Unione, compresi lo stesso New York e il New Jersey, il duello si tenne in quest'ultimo stato per scelta dei contendenti per via della minore severità nell'applicazione della legge al riguardo."},{"page_url":"https://en.wikipedia.org/wiki/1994_Fairchild_Air_Force_Base_B-52_crash","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/BGgodsey.jpg","page_title":"1994 Fairchild Air Force Base B-52 crash","context_page_description":"On Friday, 24 June 1994, a United States Air Force Boeing B-52 Stratofortress crashed at Fairchild Air Force Base, Washington, United States, after its pilot, Lieutenant Colonel Arthur \\"Bud\\" Holland, maneuvered the bomber beyond its operational limits and lost control. The B-52 stalled, fell to the ground and exploded, killing Holland and the three other field-grade officers on board the aircraft. In addition, one person on the ground suffered injuries during the accident, but survived. The crash was captured on video and was shown repeatedly on news broadcasts throughout the world.\\nThe subsequent investigation concluded that the crash was attributable primarily to three factors: Holland's personality and behavior; USAF leaders' delayed or inadequate reactions to earlier incidents involving Holland; and the sequence of events during the aircraft's final flight. The crash is now used in military and civilian aviation environments as a case study in teaching crew resource management. It is also often used by the U.S."},{"page_url":"https://nn.wikipedia.org/wiki/Columbitt","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Columbite.jpg","page_title":"Columbitt","context_page_description":"Columbitt-gruppa er ei gruppe mineral som omfattar blant anna columbitt-Fe, columbitt-Mn, columbitt-Mg og fersmitt. Denne mineralgruppa er nærskyld med euxenitt-gruppa. Columbitt krystalliserer rombisk, er svart med submetallisk glans og er hardt og tungt. Det er kalla opp etter figuren Columbia.\\nColumbitt- er karakteristisk for granittiske pegmatittgangar og finst fleire stader i Noreg. Det er kjemisk sett eit jarn-niob-oksid, FeNb₂O₆, som dannar blandkrystaller med det tilsvarande tantalmineral, FeTa₂O₆.\\nColumbitt- MnNb₂O₆ finst ofte på same måte som columbitt- men er ikkje så vanleg. Minerala kan berre skiljast ved kjemiske analysar. Columbitt- er kjent frå mange pegmatittar i Østfold og Iveland-Evje-området. Columbitt- er kjent frå til dømes Sørfold, Tokke og Iveland."},{"page_url":"https://no.wikipedia.org/wiki/Rochester_(Kent)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Rochester_Cathedral_from_Castle.JPG","page_title":"Rochester (Kent)","context_page_description":"Rochester er en liten by i Kent i England. Den ligger ved elven Medway, omkring 50 km fra London. I henhold til folketellingen i 2001 var det 59 788 innbyggere i byen, noe som økte noe til 62 982 innbyggere i 2011.\\nRochester mistet sin status som city, og fikk dermed den lavere statusen town under en omorganisering av lokaladministrasjonen i 1998. Dette ble ikke oppdaget av myndighetene før i 2002, og man venter på at dronning Elisabeth II igjen skal gi den den høyere rangen. Byen har en lang historie som tilsier at den skal ha dette; i 903 fikk Rochester rett til å prege mynt, et tegn på høy status, og den første borgermesteren ble valgt allerede i 1461. Ettersom den mistet sin status ved et uhell omtales den fortsatt konsekvent som city av innbyggerne.\\nByen utgjør sammen med Chatham og Gillingham et sammenhengende urbant område kjent som Medwaybyene, med et felles befolkningstall på omkring 250 000. Områder på den andre siden av Medway har lenge vært administrert fra Rochester. Siden 1998 har dette området vært en enhetlig myndighet.\\nDet ligger flere historiske bygninger i byen, med Rochester Castle og Rochesterkatedralen som de viktigste."},{"page_url":"https://ca.wikipedia.org/wiki/Municipi_de_Kalix","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Kalix_Municipality_in_Norrbotten_County.png","page_title":"Municipi de Kalix","context_page_description":"Kalix és un municipi del Comtat de Norrbotten, al nord de Suècia. El seu centre administratiu està situat a Kalix. Ocupa una superfície de 3.746 km² amb 16.144 habitants.\\nEl 1924 el municipi de Töre va ser separat del municipi de Nederkalix passant a formar el seu propi municipi. El 1967 els dos es van reunificar creant l'actual municipi."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Ministerpr%C3%A4sidenten_von_Tschechien","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Milo%C5%A1_Zeman_2012-12-03_cropped.jpg","page_title":"Liste der Ministerpräsidenten von Tschechien","context_page_description":"Dies ist eine Liste der Ministerpräsidenten der Tschechischen Republik seit deren Gründung am 1. Januar 1993."},{"page_url":"https://en.wikipedia.org/wiki/St_Olaf%27s_Church,_Wasdale","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/StOlafsChurchWasdaleHead.jpg","page_title":"St Olaf's Church, Wasdale","context_page_description":"St Olaf's Church in Wasdale Head, Cumbria, is England's smallest parish church. The earliest record of the church is from 1550, though it probably predates this, and it is likely that there was an earlier church on this site."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%83%A0%E6%AF%94%E5%A3%BD%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Sotetsu_line_symbol.svg","page_title":"惠比壽站","context_page_description":"惠比寿站是位于日本东京都涩谷区惠比寿南一丁目，属于东日本旅客铁道、东京地铁的铁路车站。此站是涩谷区内最南的铁路车站。"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%99%BB%E5%90%89%E7%B4%85%E6%9F%B3%E6%A1%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Shorea_polysperma.jpg","page_title":"登吉紅柳桉","context_page_description":"登吉红柳桉是菲律宾的特有种龙脑香科植物之一。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BC%D0%B2%D0%BE%D0%BB%D1%8B_%D1%8E%D0%B0%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Wellcome_in_Taiwan_Reifang.jpg","page_title":"Символы юаня","context_page_description":"Символы или знаки юаня — традиционные иероглифы их упрощённые версии, слоги и основанные на латинице графемы, используемые для краткого обозначения юаня и других денежных единиц региона, чьи названия восходят к юаню, прежде всего иены и воны."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B9%D0%B2%D0%BE%D1%80%D0%BE%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%B2%D1%96%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Grayvoron_COA_%28Kursk_Governorate%29_%281841%29.png","page_title":"Грайворонський повіт","context_page_description":"Грайворонский повіт — адміністративно-територіальна одиниця Курської губернії в складі Російської імперії. У квітні-грудні 1918 році входив до складу України потім перейшов до складу РРФСР. Повітове місто — Грайворон.\\nПовіт був створений в 1838 рік на основі Хотмижського повіту. У 1928 році повіт було скасовано."},{"page_url":"https://de.wikipedia.org/wiki/Astrocaryum_vulgare","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Astrocaryum_species_%283769223568%29.jpg","page_title":"Astrocaryum vulgare","context_page_description":"Astrocaryum vulgare ist eine Palmenart. Sie ist im Amazonasgebiet heimisch. Die essbaren Früchte der Art werden zur Ölgewinnung genutzt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%BE%D0%B3%D0%BE_%D1%85%D1%83%D0%B4%D0%BE%D0%B6%D0%BD%D0%B8%D0%BA%D0%B0_%D0%92._%D0%9A._%D0%9D%D0%B5%D1%87%D0%B8%D1%82%D0%B0%D0%B9%D0%BB%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Exposition_Salsk_Art_Museum_named_after_Nechitailo.jpg","page_title":"Сальский музей имени народного художника В. К. Нечитайло","context_page_description":"Сальский музей имени народного художника В. К. Нечитайло — художественный музей, основанный в г. Сальске в 1977 году. В фондах музея содержится 3030 экспонатов. Экспозиционно-выставочные залы имеют площадь 504 кв. м."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AE%E0%A5%81%E0%A4%82%E0%A4%97_%E0%A4%AC%E0%A5%80%E0%A4%A8_%E0%A4%A1%E0%A5%8B%E0%A4%B8%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Pesarattu.jpg","page_title":"मुंग बीन डोसा","context_page_description":"मूंग बीन डोसा, रोटी की तरह पतली होती हैं एवं डोसा के समान होती है। इसमें मूंग की दाल का घोल इस्तेमाल होता हैं लेकिन डोसा के विपरीत इसमें उड़द की दाल का प्रयोग नहीं होता है। पेसरा अट्टू को नाश्ते में और स्नैक के रूप में भी खाया जाता हैं एवं यह भारत के आंध्र प्रदेश और राजस्थान में काफी लोकप्रिय है। यह आमतौर पर अदरक या इमली की चटनी के साथ परोसा जाता है। हरी मिर्च, अदरक और प्याज का प्रयोग इस नाश्ते के विभिन्न प्रारूपों में किया जाता है।"},{"page_url":"https://en.wikipedia.org/wiki/Juhani_Wahlsten","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Juhani_Wahlsten.jpg","page_title":"Juhani Wahlsten","context_page_description":"Juhani \\"Juuso\\" Wahlsten was a Finnish professional ice hockey player who played in the SM-sarja. He played for KalPa, Ilves, HJK, and TPS. He was inducted into the Finnish Hockey Hall of Fame in 1986."},{"page_url":"https://pl.wikipedia.org/wiki/Neumayer_(krater_ksi%C4%99%C5%BCycowy)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Neumayer_crater_as15-96-13093.jpg","page_title":"Neumayer (krater księżycowy)","context_page_description":"Neumayer – księżycowy krater uderzeniowy o średnicy około 84 km, położony w bezpośrednim sąsiedztwie kraterów Helmholtza, Demonaxa i Hale’a. Decyzją Międzynarodowej Unii Astronomicznej w 1935 roku został nazwany nazwiskiem Georga von Neumayera, niemieckiego meteorologa i hydrografa."},{"page_url":"https://es.wikipedia.org/wiki/XO_(juego)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Subditos-Diago-HoVe.jpg","page_title":"XO (juego)","context_page_description":"El XO es un juego de estrategia para dos personas, cuyo objetivo es el exterminio total del enemigo que intentará por todos los medios exterminarte. La duración de la partida es de, aproximadamente, 1 hora y requiera altas dosis de concentración e inteligencia. De reglas sencillas le hace un juego ameno y entretenido."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D0%B0%D1%80%27%D1%94%D0%B2%D0%BE_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%96%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Moscow_Salarievo_Metro_station_04-2016.jpg","page_title":"Салар'єво (станція метро)","context_page_description":"«Салар'єво» — станція Сокольницької лінії Московського метрополітену, що розташована за МКАД у Новомосковському адміністративному окрузі між Київським шосе та селом Салар'єво. Відкриття відбулося 15 лютого 2016 року, у складі черги «Рум'янцево» — «Салар'єво»."},{"page_url":"https://uk.wikipedia.org/wiki/CAPN2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/PBB_GE_CAPN2_208683_at_fs.png","page_title":"CAPN2","context_page_description":"CAPN2 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 1-ї хромосоми. Довжина поліпептидного ланцюга білка становить 700 амінокислот, а молекулярна маса — 79 995.\\nКодований геном білок за функціями належить до гідролаз, протеаз, тіолових протеаз.\\nЗадіяний у таких біологічних процесах як поліморфізм, ацетиляція.\\nБілок має сайт для зв'язування з іонами металів, іоном кальцію.\\nЛокалізований у клітинній мембрані, цитоплазмі, мембрані."},{"page_url":"https://pl.wikipedia.org/wiki/O%C5%9Bmiornice","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Tremoctopus_violaceus5.jpg","page_title":"Ośmiornice","context_page_description":"Ośmiornice – rząd głowonogów, ośmioramiennych mięczaków, do którego zaklasyfikowano około 300 gatunków. Są to zwierzęta dwubocznie symetryczne, mające dwoje oczu i dziób, otwór gębowy leży w centralnym punkcie względem ramion, nieprawidłowo nazywanych czasami „czułkami”. Miękkie ciało potrafi szybko zmieniać kształt. Do pływania mięczak wykorzystuje syfon, przez który wyrzuca wodę, głowa znajduje się na przedzie, wzniesiona. Syfon służy także wymianie gazowej. Złożony układ nerwowy wiąże się ze świetnym wzrokiem u większości gatunków, ośmiornice należą też do najinteligentniejszych bezkręgowców, prezentujących najbardziej złożone zachowania.\\nZamieszkują zróżnicowane regiony oceanów, w tym rafy koralowe, wody pelagiczne i dno morskie. Niektóre żyją w strefie międzypływowej, inne zasiedlają abisal. Większość gatunków charakteryzuje się szybkim wzrostem osobniczym, wczesnemu dojrzewaniu towarzyszy krótkie życie. Podczas rozrodu samiec wykorzystuje specjalne ramię do przeniesienia pakietu nasienia bezpośrednio do jamy płaszczowej samicy, po czym starzeje się i umiera. Samica składa zapłodnione jaja w norze i opiekuje się nimi aż do wyklucia się młodych, po czym również ginie."},{"page_url":"https://de.wikipedia.org/wiki/Fran%C3%A7ois_Coty","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Coty_Figaro_R%C3%A9forme.jpg","page_title":"François Coty","context_page_description":"François Coty war ein französischer Parfümeur und Industrieller sowie Zeitungsverleger. Coty gilt als Begründer der modernen Parfümerie. Als Publizist propagierte er antikommunistische, antisemitische und faschistische Ideen und unterstützte Gruppierungen der extremen Rechten in Frankreich. Sein 1904 gegründetes Unternehmen ist heute der Kosmetikkonzern Coty Inc. mit Sitz in New York City."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9D%D0%B5%D0%BD%D0%B0%D0%B4%D0%BE%D0%B2%D0%B8%D1%9B%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Sima_Nenadovi%C4%87_01.jpg","page_title":"Ненадовићи","context_page_description":"Ненадовићи су породица обор-кнеза Тамнавске и Посавске кнежине Ваљевске нахије Алексе Ненадовића, његовог брата војводе Јакова Ненадовића, обласног господара, првог попечитеља унутрашњих дела, војводе и протојереја Матеје Ненадовића, првог председника Правитељствујушчег совјета Србије, војводе тамнавске кнежине Јеврема Ненадовића, војводе Симе Ненадовића, Љубомира Ненадовића - Чика Љубе, књижевника, министра просвете и кнегиње Кнежевине Србије Персиде Карађорђевић, рођ. Ненадовић, мајке краља Петра I Карађорђевића."},{"page_url":"https://uk.wikipedia.org/wiki/Decticus_albifrons","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Sauterelle_nocturne_Grenade.jpg","page_title":"Decticus albifrons","context_page_description":"Decticus albifrons — вид коників, які поширені від Середземного моря до середньої Азії."},{"page_url":"https://ia.wikipedia.org/wiki/Mohamet_ibn_Musa_al-Khwarizmi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/1983_CPA_5426_%281%29.png","page_title":"Mohamet ibn Musa al-Khwarizmi","context_page_description":"Mohamet ibn Musa al-Khwarizmi era un mathematico, astronomo, e geographo persian. Ille ha nate cerca a Khwarazm in Uzbekistan, que era parte del dynastia afrigid native, e ha morte c. 850. Ille laborava pro le majoritate de su vita como un erudito in le Cassa de Sagessa in Bagdad.\\nSu prime libro, le Libro Compendiose re Calculation per Completion e Balanciamento, scribite c. 820, era le prime libro re le solution systematic de equationes quadratic e linear. Consequentemente, ille es considerate ser le patre del algebra. In le seculo 12, su Arithmetic, que explicava le numeros arabe, era traducite al latino, exponite le systema positional decimal al mundo occidental. Ille era un del prime que usava zero pro marcar nulles in notation positional. Le parola algorithmo se deriva de su nomine. Ille revideva e actualisava le Geographia de Ptolemeo, e scribeva plure obras re astronomia e astrologia.\\nSu libro non solmente es mathematic, sed linguistic. Le parola \\"algebra\\" se deriva del al-jabr, un del duo operationes usate pro solver equationes quadratic, como il es describite in su libro."},{"page_url":"https://vo.wikipedia.org/wiki/Salgesch","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Karte_Gemeinde_Salgesch_2007.png","page_title":"Salgesch","context_page_description":"Salgesch binon zif in kanton: Wallis, in Jveizän. Salgesch topon videtü 46°18’ N e lunetü 7°34’ L.\\nSürfat ela Salgesch binon mö 11,4 km².\\nSalgesch labon belödanis 1."},{"page_url":"https://hu.wikipedia.org/wiki/Stazione_di_Lesmo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Stazione_di_Lesmo.jpg","page_title":"Stazione di Lesmo","context_page_description":"Stazione di Lesmo vasútállomás Olaszországban, Lombardia régióban, Lesmo településen."},{"page_url":"https://vec.wikipedia.org/wiki/Chaux-des-Crotenay","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Mairie_de_Chaux_des_Crotenay.JPG","page_title":"Chaux-des-Crotenay","context_page_description":"Chaux-des-Crotenay el xé on comun de 404 abitanti del departemento de Jura che el fa parte del rejon Bourgogne-Franche-Comté in Fransa."},{"page_url":"https://ca.wikipedia.org/wiki/Cru%C3%AFlles_(vila)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Cru%C3%AFlles.jpg","page_title":"Cruïlles (vila)","context_page_description":"Cruïlles és una vila del Baix Empordà que forma part del municipi de Cruïlles, Monells i Sant Sadurní de l'Heura, del qual n'és el centre administratiu. Va estar constituït com a municipi fins al 1973, quan es va fusionar amb Monells i Sant Sadurní de l'Heura per formar el municipi actual. És el segon nucli més poblat del terme, després del Puigventós.\\nEl poble fou seu de la de Baronia de Cruïlles, que al segle xiii, també adquiriren Peratallada. El vast territori cruïllenc s'estén des de la plana de l'Empordà fins a ocupar gran part del Massís de les Gavarres. El poble es troba al Pla de Cruïlles, més amunt del Daró, al peu de la carretera comarcal GI-664 entre la Bisbal d'Empordà i Cassà de la Selva, a un parell de quilòmetres de la Bisbal.\\nA nivell monumental hi destaquen la Torre del Castell, el Monestir de Sant Miquel de Cruïlles l'Església parroquial de Santa Eulàlia de Cruïlles o l'Ermita de la Mare de Déu de l'Esperança. A més a Cruïlles shi han diverses restes de la muralla que cloïen la població en l'edat mitjana. Uns llenços que formen l'angle nord-oest pertanyien potser a una torre de planta quadrada d'uns 5 m de costat i 5 m d'alçada al nivell de les espitlleres."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B5%D1%80%D0%B2%D0%BE%D0%BD%D0%B8%D0%B9_%D0%9A%D0%BB%D1%8E%D1%87_(%D0%B4%D0%B6%D0%B5%D1%80%D0%B5%D0%BB%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Reka_krklutch.PNG","page_title":"Червоний Ключ (джерело)","context_page_description":"Червоний Ключ — друге по дебіту та величині джерело в світі, після джерела Фонтен де Воклюз у Франції. Дебіт джерела 14,88 м³/сек.\\nЧервоний Ключ — найбільше джерело питної води в Росії, та друге у Європі."},{"page_url":"https://sv.wikipedia.org/wiki/Parallellport","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Parallel_computer_printer_port.jpg","page_title":"Parallellport","context_page_description":"En parallellport är ett slags kontaktdon som finns på vissa persondatorer för anslutning till diverse kringutrustning, främst äldre skrivare. Den kallas ibland Centronicsport. IEEE 1284-standarden definierar den dubbelriktade varianten av porten.\\nUSB-gränssnittet har för det mesta ersatt parallellporten – 2007 ansluts de flesta skrivare med USB-ledningar, och datorer har alltmer sällan ett parallellportuttag.\\nParallellporten är enkel att styra via mjukvara och uppskattas därför av personer som vill ansluta egenbyggd elektronik till en dator."},{"page_url":"https://fr.wikipedia.org/wiki/B%C3%A9r%C3%A9nice_II","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Head_Berenike_II_Glyptothek_Munich.jpg","page_title":"Bérénice II","context_page_description":"Bérénice II est la fille de Magas, roi de Cyrène et d’Apama II, née autour de 267 / 276. Elle fait assassiner son premier époux Démétrios Kalos, demi-frère du roi de Macédoine Antigonos Gonatas. Elle épouse ensuite en 246 Ptolémée III Évergète Iᵉʳ avec qui elle règne entre 246 et 222. Elle est la première reine à battre monnaie à son effigie.\\nFervente adoratrice de la déesse Bubastis protectrice des parturientes, elle ordonne la construction d'un temple dédié à la déesse à la suite de son accouchement de son deuxième enfant, le futur Ptolémée IV, né en l'absence de son père Ptolémée III parti guerroyer en Syrie.\\nDurant l'absence de son mari en Syrie, elle fait vœu à la déesse Aphrodite de lui sacrifier sa merveilleuse chevelure. Son mari étant revenu sain et sauf, elle coupe une boucle de ses cheveux et en fait une offrande au temple de la déesse à Zéphyrium. La chevelure ayant disparu de façon mystérieuse, Conon de Samos, l'astronome de la cour, l'expliqua de façon romantique en indiquant un amas stellaire et disant que l'offrande avait tellement plu à la déesse qu'elle l'avait traduit aux cieux. Cet astérisme est encore appelé la « Chevelure de Bérénice »."},{"page_url":"https://de.wikipedia.org/wiki/Nyhavn","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Nyhavn-panorama.jpg","page_title":"Nyhavn","context_page_description":"Der Nyhavn ist ein zentraler Hafen in der dänischen Hauptstadt Kopenhagen und eine der wichtigsten Sehenswürdigkeiten der Stadt.\\nDer 1673 fertiggestellte Kanal Nyhavn wurde in Auftrag gegeben, um einen Stichkanal vom Kopenhagener Hafen zum Platz Kongens Nytorv zu schaffen. Die farbenfrohen Giebelhäuser an beiden Seiten des kleinen Hafenarms entstanden vorwiegend im 18. und 19. Jahrhundert. Das Hafenmilieu brachte frühzeitig zahlreiche Tavernen hervor, und die Gegend ist bis heute mit ihren vielen Restaurants, Bierstuben und Tanzlokalen neben der Istedgade eines der bekanntesten Vergnügungsviertel Kopenhagens. Hafenrundfahrten und Museumsschiffe erinnern an die Zeit als Handelshafen, deren Bedeutung dem 400 Meter langen und drei Meter tiefen Kanal spätestens Anfang des 20. Jahrhunderts abhanden ging. Der Märchendichter Hans Christian Andersen zählte zeitweise zu den Bewohnern Nyhavns, an dessen Ende sich das Schloss Charlottenborg befindet."},{"page_url":"https://ht.wikipedia.org/wiki/Barnard,_Missouri","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/MOMap-doton-Barnard.png","page_title":"Barnard, Missouri","context_page_description":"Barnard se yon vil nan eta Missouri"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Connecticut_state_symbols","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Map_of_USA_CT.svg","page_title":"List of Connecticut state symbols","context_page_description":"The following is a list of symbols of the U.S. state of Connecticut. Symbols are found in Chapter 33, Sections 3.105–110 of the General Statutes of Connecticut, and are listed in the Connecticut State Register and Manual."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%A5%D0%BE%D0%BB%D0%BC%D0%BE%D0%B3%D0%BE%D1%80%D1%8B_(%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C_%D1%8E%D0%BB%D1%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Yar_shosse_aug2016.jpg","page_title":"Холмогоры (автомобиль юлы)","context_page_description":"«Холмогоры» М-8 федераль автомобиль юлы — - Мәскәү — Ярославль — Вологда — Архангельск Рәсәй Федерацияһының федераль әһәмиәтле автомобиль юлы. Оҙонлоғо — 1157,224 км, боролоп тейеп киткән юлдары менән — 1288,472 км.\\nҺыу ятҡылыҡтары: Пироговское, Учинское, Пестовское һыуһаҡлағыстары; күлдәр — Лесное, Торбеево, Плещеево]], Неро.\\nЮлда хәрәкәт көслө. 2016 йыл аҙағынан Клязьма микрорайонына юл файҙаланыуға тапшырылған Пушкино киң һыҙатлы заманса автомобиль юлы, эстакадалы, светофорһыҙ. Ивантеево шоссеһында трасса 6 һыҙатҡа ҡала, һәр яҡҡа икешәр.\\nМ8 өлөшләтә Мәскәүҙән Ярославҡа тиклем E 115 европа маршруты буйлап үтә."},{"page_url":"https://es.wikipedia.org/wiki/Bas%C3%ADlica_de_San_Andr%C3%A9s_(Vercelli)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Monumento_funebre_dell%27abate_francese_tommaso_gallo%2C_1350_ca._02.jpg","page_title":"Basílica de San Andrés (Vercelli)","context_page_description":"La basílica de San Andrés es una iglesia medieval italiana, uno de los monumentos más importantes y conocidos de la ciudad piamontina de Vercelli. Es un ejemplo temprano de la arquitectura gótica italiana, inspirada en modelos cistercienses. Tiene, desde tiempo inmemorial, la dignidad eclesiástica de basílica menor.​\\nFue fundada en 1219 por voluntad del cardenal Guala Bicchieri y completada en 1227. En ella se mezclan de forma paradigmática la tradición románica y las nuevas influencias del gótico europeo. La fachada estrecha entre dos torres, tiene tres amplios portales abocinados. Dos haces de columnillas rodean el portal central y siguen hacia arriba hasta el más bajo de los dos órdenes de logias que separan la fachada verdadera de un frontón triangular de inspiración clasizante. El gran rosetón se coloca en la intersección de las diagonales que cortan la fachada. El diseño es racionalmente proporcionado, «lúcido como un teorema y lleno de tensión contenida: o como una verdad lógica intuida en el éxtasis». El proyectista le dio un gran valor a la calidad cromática de los materiales utilizados: está el blanco de los enfoscados, el rojo del ladrillo, el verde de las formas."},{"page_url":"https://es.wikipedia.org/wiki/Honda_Civic_(Cuarta_Generaci%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Honda_Civic_Shuttle_003.JPG","page_title":"Honda Civic (Cuarta Generación)","context_page_description":"Creado por jaque\\nEn 1987, el Honda Civic de cuarta generación salió al mercado, rediseñado respecto a la generación previo, estéticamente/aerodinámicamente con mayores dimensiones y una línea de capó más baja. Se ofrecieron una amplia gama de modelos y niveles de equipamiento para diversos mercados alrededor del mundo. La cuarta generación introdujo suspensión trasera totalmente independiente en toda la gama de modelos y una distancia entre ejes de 2500mm. Además, el Honda CR-X siguió siendo parte de la familia Civic que incluyó los modelos HF, DX y el modelo Si en los EE.UU."},{"page_url":"https://en.wikipedia.org/wiki/Rothbury_Branch","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Wansbeck_%26_Rothbury.png","page_title":"Rothbury Branch","context_page_description":"The Rothbury Branch was a 13-mile single track railway line in Northumberland, England. It was built by the Northumberland Central Railway and was conceived as part of an alternative trunk route from Newcastle to Berwick.\\nThere were serious problems raising money for the ambitious scheme, and it was scaled back to run from Scotsgap to Rothbury. It opened in 1870.\\nEven so, it was always short of money and had to request the North British Railway to take it, and its debt, over; it did so in 1872.\\nThe line was never busy and closure to passenger traffic took place in 1952; after a period of limited goods operation, the line closed completely in 1963."},{"page_url":"https://en.wikipedia.org/wiki/Potala_Palace","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Potala-from-behind_07-2005.jpg","page_title":"Potala Palace","context_page_description":"The Potala Palace is a dzong fortress in the city of Lhasa, in Tibet. It was the winter palace of the Dalai Lamas from 1649 to 1959, has been a museum since then, and is a World Heritage Site since 1994.\\nThe palace is named after Mount Potalaka, the mythical abode of the bodhisattva Avalokiteśvara. The 5th Dalai Lama started its construction in 1645 after one of his spiritual advisers, Konchog Chophel, pointed out that the site was ideal as a seat of government, situated as it is between Drepung and Sera monasteries and the old city of Lhasa. It may overlay the remains of an earlier fortress called the White or Red Palace on the site, built by Songtsen Gampo in 637.\\nThe building measures 400 metres east-west and 350 metres north-south, with sloping stone walls averaging 3 metres thick, and 5 metres thick at the base, and with copper poured into the foundations to help proof it against earthquakes. Thirteen storeys of buildings, containing over 1,000 rooms, 10,000 shrines and about 200,000 statues, soar 117 metres on top of Marpo Ri, the \\"Red Hill\\", rising more than 300 metres in total above the valley floor."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BF%D0%BE%D1%80%D0%B8%D0%BA%D0%B8-%D0%B0%D1%80%D0%B3%D0%B8%D1%80%D0%BE%D0%BF%D0%B5%D0%BB%D0%B5%D0%BA%D1%83%D1%81%D1%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Argyropelecus_aculeatus.jpg","page_title":"Топорики-аргиропелекусы","context_page_description":"Топорики-аргиропелекусы — род глубоководных морских рыб из семейства топориковых отряда стомиеобразных.\\nТопорики-аргиропелекусы имеют серебристые, высокие, сжатые с боков тела и большие, не телескопические глаза. Все они относительно малы, длина тела от 5,1 до 12 см. Встречаются в Атлантическом, Тихом и Индийском океанах.\\nОкаменелости этого рода показывают, что он существовал, по крайней мере, с позднего эоцена, около 40 миллионов лет назад."},{"page_url":"https://es.wikipedia.org/wiki/Guadalteba","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Escudo_de_Ca%C3%B1ete_la_Real.png","page_title":"Guadalteba","context_page_description":"Guadalteba es una de las nueve comarcas de la provincia de Málaga, en la comunidad autónoma de Andalucía. Toma su nombre del río homónimo, afluente del Guadalhorce.\\nSegún la división comarcal de la Diputación de Málaga, Guadalteba limita al este con la Comarca de Antequera; al sureste, con el Valle del Guadalhorce; al sur, con la Sierra de las Nieves; y al suroeste, con la Serranía de Ronda. Al oeste y al norte, limita con las provincia de Cádiz y Sevilla respectivamente.​"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%98%D7%9C%D7%99%D7%94_%D7%A7%D7%A1%D7%A4%D7%A8%D7%A1%D7%A7%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Nkasperskaya-front.jpg","page_title":"נטליה קספרסקי","context_page_description":"נטליה קספרסקי, או קספרסקיה היא יזמת טכנולוגיית מידע, נשיאת קבוצת החברות אינפו-ווטץ', ומייסדת שותפה ומנכ\\"לית לשעבר של מעבדות קספרסקי. היא אחת מהנשים העשירות ברוסיה, ואחת מהאישים המפורסמים, המשפיעים בתעשיית טכנולוגיית המידע הרוסית."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturschutzgebiete_im_Landkreis_Hersfeld-Rotenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Naturschutzgebiet_%E2%80%9EAuf_dem_Ried_bei_Iba%E2%80%9C_%283%29.jpg","page_title":"Liste der Naturschutzgebiete im Landkreis Hersfeld-Rotenburg","context_page_description":"Im hessischen Landkreis Hersfeld-Rotenburg gibt es folgende Naturschutzgebiete:"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%92%96%E5%95%A1%E7%83%98%E7%84%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/440_degrees_full_city_roast_coffee.png","page_title":"咖啡烘焙","context_page_description":"烘焙咖啡使咖啡生豆的化學與物理性質轉變為已烘焙的咖啡製品。烘焙的過程使得生豆膨脹並改變其顏色、口感、氣味與密度，因而產生了咖啡的特殊風味。未烘焙的咖啡豆與已烘焙的含有相似的酸度、蛋白質與咖啡因，但缺少其美好滋味。過程需要足夠的熱度以加速美拉德反應與其它能添增其風味的化學反應。\\n由於咖啡生豆較已烘焙咖啡豆穩定許多，烘焙過程多傾向於消費市場附近進行。如此一來減少了已烘焙咖啡豆運送的時間，使咖啡豆的貨架壽命最大化。絕大多數的咖啡豆是以商業化的大規模烘焙，但有些咖啡飲者為了精準掌控新鮮度與口感，會自行烘焙咖啡豆。"},{"page_url":"https://en.wikipedia.org/wiki/South_Carolina_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/William_Moultrie_portrait.jpg","page_title":"South Carolina Line","context_page_description":"The South Carolina Line was a formation within the Continental Army. The term \\"South Carolina Line\\" referred to the quota of numbered infantry regiments assigned to South Carolina at various times by the Continental Congress. These, together with similar contingents from the other twelve states, formed the Continental Line. The concept was particularly important in relation to the promotion of commissioned officers. Officers of the Continental Army below the rank of brigadier general were ordinarily ineligible for promotion except in the line of their own state."},{"page_url":"https://en.wikipedia.org/wiki/Game_of_Thrones_(season_2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Carice_van_Houten_by_Gage_Skidmore.jpg","page_title":"Game of Thrones (season 2)","context_page_description":"The second season of the fantasy drama television series Game of Thrones premiered in the United States on HBO on April 1, 2012, and concluded on June 3, 2012. It was broadcast on Sunday at 9:00 pm in the United States, consisting of 10 episodes, each running approximately 50–60 minutes. The season mostly covers the events of A Clash of Kings, the second novel of the A Song of Ice and Fire series by George R. R. Martin, adapted for television by David Benioff and D. B. Weiss. HBO ordered the second season on April 19, 2011, which began filming in July 2011, primarily in Ireland, Northern Ireland, Croatia and Iceland.\\nThe story takes place in a fictional world, primarily on a continent called Westeros, with one storyline occurring on another continent to the east, Essos. Like the novel, the season follows up the dramatic death of Lord Eddard \\"Ned\\" Stark, with all of the Starks being separated across Westeros. Season two mainly centers around the War of the Five Kings, fought among the leaders of Westerosi factions who are either staking a claim to the Iron Throne, or seeking independence from it."},{"page_url":"https://en.wikipedia.org/wiki/Japanese_Antarctic_Expedition","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Ross_Ice-Shelf.jpg","page_title":"Japanese Antarctic Expedition","context_page_description":"The Japanese Antarctic Expedition of 1910–12, in the ship Kainan Maru, was the first such expedition by a non-European nation. It was concurrent with two major Antarctic endeavours led respectively by Roald Amundsen and Robert Falcon Scott, and has been relatively overlooked in polar history. After failing to land in its first season, the Japanese expedition's original aim of reaching the South Pole was replaced by less ambitious objectives, and after a more successful second season it returned safely to Japan, without injury or loss of life.\\nThe brainchild of an army reserve lieutenant, Nobu Shirase, the expedition was privately funded. It left Japan in November 1910, and after its first season's failure was forced to spend the winter of 1911 in Australia. In its second Antarctic season, 1911–12, it made no major scientific or geographical discoveries, but could claim some significant achievements. These included the first landing on the coast of King Edward VII Land, the fastest recorded sledging journey, and the most easterly point along the Antarctic coast, to that date, reached by a ship. It also became only the fourth team to travel beyond the 80°S mark."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A4%E3%83%9E%E3%83%8F%E3%83%8F%E3%82%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/%E3%83%A4%E3%83%9E%E3%83%8F%E3%83%8F%E3%82%B3_Anaphalis_margaritacea.JPG","page_title":"ヤマハハコ","context_page_description":"ヤマハハコはキク科ヤマハハコ属の多年草。雌雄異株。"},{"page_url":"https://ja.wikipedia.org/wiki/%E9%AF%A8%E9%AA%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Whale_skeleton.png","page_title":"鯨骨","context_page_description":"鯨骨は、クジラの骨、歯を指す言葉である。また、鉱物に置換されて化石化したものも慣習的に「骨」としてこれを含む。なお、鯨ひげは皮膚が変化したものであり、厳密には歯ではないので鯨骨には含まれない。\\n古来、世界各地の海浜地域で、海産物としてさまざまに利用されてきたことが、遺跡や貝塚から判明している。また、その大きさから比較的保存性が高く、世界中で多数の骨と化石が発掘されている。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kellergassen_in_Maissau","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Limberg_Kellergasse_Steinweg.jpg","page_title":"Liste der Kellergassen in Maissau","context_page_description":"Die Liste der Kellergassen in Maissau führt die Kellergassen in der niederösterreichischen Gemeinde Maissau an.\\nDie vom zur Gemeinde Maissau gehörenden Ort Wilhelmsdorf erreichbare und benutzte Kellergasse wird in dieser Liste nicht angeführt, da sie auf dem Gebiet der Gemeinde Ravelsbach liegt. Nicht in einer Kellergasse liegt das denkmalgeschützte Stiftspresshaus in Unterdürnbach, dessen Portal mit 1760 bezeichnet ist."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_settlements_in_Algeria","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Blida_houses.JPG","page_title":"List of settlements in Algeria","context_page_description":"This is a list of Algerian cities and towns with more than 100,000 inhabitants, and towns and villages with more than 20,000 inhabitants."},{"page_url":"https://no.wikipedia.org/wiki/Romerriket","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Toga_Illustration-2.svg","page_title":"Romerriket","context_page_description":"Romerriket var en italisk sivilisasjon som vokste ut fra bystaten Roma i oldtiden, grunnlagt på den italienske halvøy på 700-tallet f.Kr. I løpet av sin tolv århundre lange livstid endret den romerske sivilisasjonen fra å være monarki via republikk til å bli et keiserrike. Romerriket kom til å dominere Vest-Europa og hele området rundt Middelhavet gjennom erobring og assimilering. Fra å begynne som en enkel bosetning, ekspanderte Roma til et av de største riker i den antikke verden med et beregnet folketall på mellom 50 og 90 millioner innbyggere og dekket et område på rundt 5 millioner km² på sitt høydepunkt i året 117 e.Kr.\\nVia erobring og assimilering kom Romerriket til å dominere sørlige og vestlige Europa, Anatolia, Nord-Afrika, og deler av nordlige og østlige Europa. Roma dominerte alle områder langs Middelhavet, og var en av de mektigste faktorene i den antikke verden. Det er ofte gruppert inn i den klassiske antikken sammen med antikkens Hellas, og deres sammenlignbare kultur og samfunn blir betegnet som som den gresk-romerske verden."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BC%D0%B5%D1%80%D1%88%D0%B8%D0%B5_%D0%B2_%D0%BC%D0%B0%D1%80%D1%82%D0%B5_2016_%D0%B3%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Ken_Howard_2014.jpg","page_title":"Умершие в марте 2016 года","context_page_description":"Это список известных людей, соответствующих установленным критериям значимости, умерших в марте 2016 года.\\nПричина смерти указывается лишь в исключительных случаях. В остальных случаях — не указывается.\\n← Февраль 2016"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B9%D0%BD%D1%8B_%D0%AE%D1%81%D1%82%D0%B8%D0%BD%D0%B8%D0%B0%D0%BD%D0%B0_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Sens_Ch%C3%A2sse.jpg","page_title":"Войны Юстиниана I","context_page_description":"Правление Юстиниана I сопровождалось многочисленными войнами, которые привели к захвату обширных территорий в западном Средиземноморье, утраченных Римской империей в V веке. В качестве христианского императора Юстиниан считал своим долгом восстановить прежние границы государства. На востоке он продолжил войну с Персией, начатую в правление его предшественника Юстина I, и конфликты на этом направлении продолжались с перерывами до 562 года. На западе Юстиниан вёл успешные войны с возникшими на территории Западной Римской империи варварскими королевствами. В результате войны 533—534 годов было завоёвано королевство вандалов и аланов в Северной Африке, а война с остготами в 535—554 годах принесла Византии власть над Италией. Менее успешные войны с королевством вестготов привели к расширению византийских владений в Испании.\\nБлагодаря трудам Прокопия Кесарийского и других византийских историков войны Юстиниана хорошо изучены. Структурно византийская армия была достаточно похожа на вооружённые силы Римской империи предыдущих столетий. Как и прежде, основными компонентами сухопутных сил была полевая армия и приграничные войска, однако в VI веке смысл этих понятий изменился."},{"page_url":"https://ja.wikipedia.org/wiki/Might_and_Delight","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Might_and_Delight_Grey_logo.png","page_title":"Might and Delight","context_page_description":"Might and Delightは、ストックホルムを拠点とする、2010年設立のゲーム開発・販売を行うスウェーデンのゲーム会社である。主に『Shelter』シリーズの開発で知られている。"},{"page_url":"https://pt.wikipedia.org/wiki/Lia_F%C3%A1il","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Tara_stone.jpg","page_title":"Lia Fáil","context_page_description":"Lia Fáil é um menir, monumento pré-histórico de pedra, irlandês situado no Hill of Tara, o qual, segundo a mitologia irlandesa, serve como pedra de homenagem ao Grande Rei da Irlanda desde o ano 500. Conforme a mitologia céltica, Lia Fáil foi trazida ao país europeu pelos Tuatha Dé Danann através das ilhas nórdicas.\\nO menir foi vandalizado em duas ocasiões. A primeira foi em junho de 2012 quando foi acertada por um martelo em onze lugares diferentes; isso rompeu alguns fragmentos da pedra que não puderam ser recuperados. Na segunda vez, foi em 29 de maio de 2014, em que foi coberta por uma pintura negra em quase um terço de sua superfície."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%B1%D8%AF%D9%88_%DA%A9%D8%B1%DB%8C%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Ardo_Kreek_2014_CEV_final_t200416.jpg","page_title":"آردو کریک","context_page_description":"آردو کریک بازیکن والیبال اهل استونی، عضو تیم ملی والیبال استونی و باشگاه پاریس است."},{"page_url":"https://fr.wikipedia.org/wiki/Communes_du_canton_des_Grisons","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Karte_Gemeinden_des_Kantons_Graub%C3%BCnden_farbig_2020.png","page_title":"Communes du canton des Grisons","context_page_description":"Cet article présente une liste des communes du canton des Grisons."},{"page_url":"https://simple.wikipedia.org/wiki/Mircea_Snegur","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Signature_of_Mircea_Snegur.png","page_title":"Mircea Snegur","context_page_description":"Mircea Ion Snegur is a Moldovan politician. He was the first President of Moldova from 1990 to 1997. Before that, he was Chairman of the Presidium of the Supreme Soviet from 1989 to 1990 and Chairman of the Supreme Soviet from 27 April to 3 September 1990."},{"page_url":"https://en.wikipedia.org/wiki/Fuch%C5%AB_Station_(Tokyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Fuchu-station-platforms-nov14-2015.jpg","page_title":"Fuchū Station (Tokyo)","context_page_description":"Fuchū Station is a railway station on the Keio Line in Fuchū, Tokyo, Japan, operated by the private railway operator Keio Corporation."},{"page_url":"https://pl.wikipedia.org/wiki/Rezerwat_przyrody_Prze%C5%82om_Bia%C5%82ki_pod_Krempachami","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Prze%C5%82om_Bia%C5%82ki_a4.jpg","page_title":"Rezerwat przyrody Przełom Białki pod Krempachami","context_page_description":"Przełom Białki pod Krempachami – krajobrazowy rezerwat przyrody w województwie małopolskim, w powiecie nowotarskim. Jest położony na terenie miejscowości Krempachy i Nowa Biała, niewielki jego fragment leży także w miejscowości Trybsz.\\nRezerwat leży w granicach Południowomałopolskiego Obszaru Chronionego Krajobrazu oraz obszaru siedliskowego sieci Natura 2000 PLH120024 „Dolina Białki”."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%81%D1%82%D0%BE%D1%80%D1%96%D1%8F_%D0%BF%D0%BE%D1%88%D1%82%D0%B8_%D1%82%D0%B0_%D0%BF%D0%BE%D1%88%D1%82%D0%BE%D0%B2%D0%B8%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%A8%D0%B2%D0%B5%D1%86%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Svarsmarken1929.JPG","page_title":"Історія пошти та поштових марок Швеції","context_page_description":"Історія пошти та поштових марок Швеції охоплює ранній період, класичний і сучасний період. Починаючи з 1855 р. Швеція видає власні поштові марки, а з 1875 р. входить у Всесвітній поштовий союз. Поштові операції в країні здійснює компанія «Posten AB»."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%82%D1%82%D0%BE%D0%BA%D0%BA%D0%BE%D1%80%D1%82%D0%BE%D0%BE%D1%80%D0%BC%D1%96%D1%83%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Greenland.A2003233.1340.250m.jpg","page_title":"Іттоккортоорміут","context_page_description":"Іттоккортоорміут — місто на сході Ґренландії в комуні Сермерсоок, центр колишньої комуни Іттоккортоорміут, скасованої в 2009 році."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_Ewangelicko-Augsburska_w_Wi%C5%9Ble","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Ko%C5%9Bci%C3%B3%C5%82_ewangelicko-augsburski_aposto%C5%82%C3%B3w_Piotra_i_Paw%C5%82a_w_Wi%C5%9Ble_4.JPG","page_title":"Parafia Ewangelicko-Augsburska w Wiśle","context_page_description":"Parafia Ewangelicko-Augsburska w Wiśle – parafia luterańska w Wiśle, należąca do diecezji cieszyńskiej. Ma siedzibę w centrum miasta, gdzie też znajduje się jej kościół parafialny. W 2019 liczyła 2822 wiernych."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Latvia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Holiday_decorations_to_May_1._1919._Riga_%281%29.jpg","page_title":"History of Latvia","context_page_description":"The history of Latvia began around 9000 BC with the end of the last glacial period in northern Europe. Ancient Baltic peoples arrived in the area during the second millennium BC, and four distinct tribal realms in Latvia's territory were identifiable towards the end of the first millennium AD. Latvia's principal river Daugava, was at the head of an important trade route from the Baltic region through Russia into southern Europe and the Middle East that was used by the Vikings and later Nordic and German traders.\\nIn the early medieval period, the region's peoples resisted Christianisation and became subject to attack in the Northern Crusades. Latvia's capital city Riga, founded in 1201 by Germans at the mouth of the Daugava, became a strategic base in a papally-sanctioned conquest of the area by the Livonian Brothers of the Sword. It was to be the first major city of the southern Baltic and, after 1282, a principal trading centre in the Hanseatic League.\\nBy the 16th century, Baltic German dominance in Terra Mariana was increasingly challenged by other powers."},{"page_url":"https://en.wikipedia.org/wiki/Randolph,_New_Jersey","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Census_Bureau_map_of_Randolph%2C_New_Jersey.png","page_title":"Randolph, New Jersey","context_page_description":"Randolph is a township in Morris County, New Jersey, United States. As of the 2010 United States Census, the township's population was 25,734, reflecting an increase of 887 from the 24,847 counted in the 2000 Census, which had in turn increased by 4,873 from the 19,974 counted in the 1990 Census.\\nAccording to the 2010 Census, Randolph was the 3rd most-populous municipality in Morris County and its 21 square miles land area is the 8th largest in the county. The community maintains a diverse population of nearly 26,000 residents.\\nEstablished in 1968, the County College of Morris is located on 200+ acres in the northern part of the township along Route 10.\\nIn 2013, in the Coldwell Banker edition of, “Best Places to Live in New Jersey for Booming Suburbs.” Randolph was the number one ranked town in Morris County and fourth overall in the state citing \\"job growth, high percentage of home ownership, good schools, access to local shopping and community safety.\\" Niche.com ranked Randolph amongst the Top 50 in its 2019 rankings of the \\"Best Places to Live\\" in New Jersey."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%BD%D0%B5%D0%BF%D0%B0%D0%BB%D1%83%D0%B1%D0%BD%D0%B8_%D0%BA%D1%80%D0%B0%D0%B9%D1%86%D0%B5%D1%80%D0%B8_%D1%82%D0%B8%D0%BF_%E2%80%9E%D0%A2%D0%BE%D0%BF%D0%B0%D0%B7%E2%80%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/HMS_Topaze_%281903%29_IWM_Q_021861.jpg","page_title":"Бронепалубни крайцери тип „Топаз“","context_page_description":"Tопаз са серия бронепалубни крайцери от 3-ти ранг на Британския Кралски флот, построени през 1900-те години на 20 век. Представляват развитие на крайцерите от типа „Пелорус“. Всички кораби имат имена на скъпоценни камъни. Серията кораби понякога се нарича и тип „Джем“. От проекта са построени 4 единици: „Топаз“, „Аметист“, „Даймънд“ и „Сапфир“.\\nКрайцера „Аметист“ става първият голям военен кораб с паротурбинна енергетична установка. Първоначално Кралския флот смятал да построи още 4 крайцера от този тип, но впоследствие започва строежа на крайцери скаути. По този начин, крайцерите от типа Топаз са последните бронепалубни крайцери 3-ти ранг в британския флот."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%87%D9%86%D8%B1%D9%89_%D9%85%D9%88%D8%B1%D9%8A%D8%A7%D9%88_%D8%AF_%D9%85%D9%8A%D9%84%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/New_knesset_building_2_%28cropped%29.jpg","page_title":"هنرى مورياو د ميلين","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nهنرى مورياو د ميلين كان محامى من بلجيكا."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B2%D0%B5%D0%BD%D1%8F%D1%89%D0%B8%D0%B5_%D0%BA%D0%B5%D0%B4%D1%80%D1%8B_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8_(%D0%B4%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Lob_%D0%9A%D0%BE%D1%80%D0%B5%D0%BD%D1%8C%D1%81%D0%BA%D0%B8%D0%B5_%D1%80%D0%BE%D0%B4%D0%BD%D0%B8%D0%BA%D0%B81.jpg","page_title":"Звенящие кедры России (движение)","context_page_description":"«Звеня́щие ке́дры Росси́и» — новое религиозное движение, возникшее в конце 1990-х и основанное на идеях из серии книг «Звенящие кедры России» Владимира Мегре. Главная героиня книг — живущая в сибирской тайге девушка со сверхъестественными способностями Анастасия.\\nИсследователи рассматривают движение в качестве варианта «русского Нью Эйдж». Однако последователи движения причисляют себя к современному язычеству, претендуют на роль продолжателей некоей древней традиции.\\nДвижение действует в России и ряде других стран."},{"page_url":"https://en.wikipedia.org/wiki/Saki_Satomi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Satomi_saki_shogi.jpg","page_title":"Saki Satomi","context_page_description":"Saki Satomi is a Japanese women's professional shogi player ranked 1-dan. Her older sister Kana is also a women's professional shogi player."},{"page_url":"https://sk.wikipedia.org/wiki/Saint-Martin-de-Sescas","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Saint-Martin-de-Sescas_Mairie.jpg","page_title":"Saint-Martin-de-Sescas","context_page_description":"Saint-Martin-de-Sescas je francúzska obec, ktorá sa nachádza v departemente Gironde, v regióne Akvitánsko."},{"page_url":"https://ro.wikipedia.org/wiki/Lesdins","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Map_commune_FR_insee_code_02420.png","page_title":"Lesdins","context_page_description":"Lesdins este o comună în departamentul Aisne din nordul Franței. În 2008 avea o populație de 811 de locuitori."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%82%A4%E3%82%B9%E5%9B%BD%E9%89%84Re450%E5%BD%A2%E9%9B%BB%E6%B0%97%E6%A9%9F%E9%96%A2%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/BT_Re4-4_96.jpg","page_title":"スイス国鉄Re450形電気機関車","context_page_description":"スイス国鉄Re450形電気機関車は、スイスのスイス連邦鉄道の都市近郊列車で使用される電気機関車である。"},{"page_url":"https://ca.wikipedia.org/wiki/Xil%C3%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/IUPAC-cyclic.svg","page_title":"Xilè","context_page_description":"El xilè o xilol és una mescla de tres isòmers estructurals de l'hidrocarbur aromàtic dimetilbenzè de fórmula química C₆H₄(CH₃)₂. El xilè és un líquid molt inflamable, transparent, incolor i d'olor dolça. En general s'obté per refinació del petroli cru en un procés anomenat alquilació. També és produït com un subproducte de la carbonització del carbó de coc procedent de forns de coc, extret del gas cru de benzol, o per deshidrociclodimerització i de metilació del toluè i el benzè. També es fabriquen a partir de reformat catalític. El xilè és usat com a solvent en la impressió, el cautxú i el cuir."},{"page_url":"https://tr.wikipedia.org/wiki/G%C3%BCney,_Denizli","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Denizli_location_G%C3%BCney.png","page_title":"Güney, Denizli","context_page_description":"Güney, Denizli ilinin bir ilçesidir.\\nAdıgüzeller Barajı, Cindere Barajı ve Güney Şelalesi ile ünlüdür. Güney'deki şaraplık bağların üzümleri şarap üreticileri arasında yoğun ilgi görmektedir. Ancak bağcıların yetiştirdiği üzümler ekonomik açıdan yeterince değerlendirilememektedir. İlçe aşırı derecede göç vermiştir ve vermeye de devam etmektedir. Ayrıca Pamukkale Şarapları'nın tek fabrikası Güney'dedir. Kavaklıdere, Doluca, Sevilen, Diren, Mey, Vinkara gibi şarap üreticileri bu bölgede bağcılık faaliyetleri yürütmektedirler.\\nGüney ilçesi Denizli'ye 75 km ve Uşak'a 75 km mesafede bulunmaktadır. Güney ilçesinin sınırları Uşak il sınırına kadar devam etmektedir."},{"page_url":"https://nl.wikipedia.org/wiki/Hybe","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Hybe%2C_domo_de_Albert_%C5%A0karvan%2C_de_maldekstre.jpg","page_title":"Hybe","context_page_description":"Hybe is een Slowaakse gemeente in de regio Žilina, en maakt deel uit van het district Liptovský Mikuláš.\\nHybe telt 1.579 inwoners."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E9%BA%A6%E8%82%AF%E9%BD%90%C2%B7%E9%B2%8D%E5%A8%81%E5%B0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Mackbowell.jpg","page_title":"麦肯齐·鲍威尔","context_page_description":"麥肯齊·鮑威爾爵士，曾任加拿大總理。"},{"page_url":"https://es.wikipedia.org/wiki/Elecci%C3%B3n_legislativa_de_Francia_de_1902","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/France_Chambre_des_deputes_1902.png","page_title":"Elección legislativa de Francia de 1902","context_page_description":"Las elecciones legislativas de Francia de 1902 se realizaron el 27 de abril y 11 de mayo de 1902."},{"page_url":"https://en.wikipedia.org/wiki/James_Casey_(American_football)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/James_Casey_-_Houston_Texans.jpg","page_title":"James Casey (American football)","context_page_description":"James Byron Casey is a former American football tight end and fullback who is the tight ends coach for the Cincinnati Bengals. He was drafted by the Houston Texans in the fifth round of the 2009 NFL Draft and has also played for the Philadelphia Eagles and Denver Broncos of the National Football League. He played college football at Rice University and played baseball and football at Azle High School."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%93%D0%B0%D0%BC%D0%BE%D1%82%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Homoty_gm._Mielnik.JPG","page_title":"Гамоты","context_page_description":"Гамо́ты — вёска ў Сямяціцкім павеце Падляскага ваяводзтва Польшчы. Знаходзіцца ў гміне Мельнік.\\nПразь вёску праходзіць ваяводзкая дарога 658."},{"page_url":"https://zh.wikipedia.org/wiki/1923%E5%B9%B4%E5%8D%97%E7%BE%8E%E8%B6%B3%E7%90%83%E9%94%A6%E6%A0%87%E8%B5%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Fachada_Estadio_Gran_Parque_Central.JPG","page_title":"1923年南美足球锦标赛","context_page_description":"1923年南美足球锦标赛第7届南美足球锦标赛，于1923年10月29日至12月2日在乌拉圭首都蒙得维的亚举行。共有 4 支南美球队参与，包括巴西、阿根廷、乌拉圭及巴拉圭，智利队因故第2 次退出比赛。总共进行了6 场比赛，乌拉圭以 3 战全胜的佳绩，第 2 次夺得该项赛事冠军。上届冠军巴西队三战皆负，排名垫底。\\n本次比赛也被用来作为1924年巴黎奥运会南美区的预选赛。"},{"page_url":"https://fi.wikipedia.org/wiki/Keisarin_uudet_vaatteet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Emperor_Clothes_01.jpg","page_title":"Keisarin uudet vaatteet","context_page_description":"Keisarin uudet vaatteet on yksi tanskalaisen Hans Christian Andersenin kirjoittamista satuklassikoista."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89lections_l%C3%A9gislatives_tuvaluanes_de_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Enele_Sopoaga_2014.jpg","page_title":"Élections législatives tuvaluanes de 2019","context_page_description":"Des élections législatives ont lieu aux Tuvalu le 9 septembre 2019 afin de renouveler l'ensemble des députés du parlement national, le Fale i Fono, à l'issue de leur mandat de quatre ans. Les Tuvalu sont une monarchie parlementaire fondée sur le modèle de Westminster. À la suite des élections, le Parlement élit le Premier ministre. Ce scrutin de 2019 voit la défaite d'Enele Sopoaga, à la tête du gouvernement depuis 2013, et l'élection à sa succession de Kausea Natano, le chef de l'Opposition parlementaire sortante.\\nIl n'existe pas de partis politiques aux Tuvalu ; tous les candidats se présentent sans étiquette, mais s'associent à des factions."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%89%E3%83%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Pescadoadobado.jpg","page_title":"アドボ","context_page_description":"アドボとは、マリネを意味する単語。また、フィリピンの肉や野菜の煮込み料理の名称でもある。酢が使われることが多く、常温での保存性を高めた料理法であるといえる。語源はスペイン語で「マリネする」または「漬ける」を意味する動詞アドバルである。「マリネした」や「漬けた」を意味する過去分詞形はアドバードまたはアドバーダとなる。"},{"page_url":"https://it.wikipedia.org/wiki/Ducato_di_Lituania","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Old_Trakai.jpg","page_title":"Ducato di Lituania","context_page_description":"Il Ducato di Lituania o talvolta Ducato di Vilnius fu uno stato-comunità costituitosi dopo l’unione di alcuni gruppi etnici lituani nel corso del tredicesimo secolo. fino al 1413. La maggior parte del tempo, i territori di tale Ducato confluirono nel Granducato di Lituania. Altri nomi utilizzati, in epoche diverse tra loro, per identificare il Ducato furono Aukštaitija o Terre di Lituania, Ducato di Vilnius, Lithuania Propria o semplicemente Lituania."},{"page_url":"https://hu.wikipedia.org/wiki/%C3%9Czbegiszt%C3%A1n_vil%C3%A1g%C3%B6r%C3%B6ks%C3%A9gi_helysz%C3%ADnei","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Poi_Kalon_Ensemble%2C_Bukhara_%284933989373%29.jpg","page_title":"Üzbegisztán világörökségi helyszínei","context_page_description":"Üzbegisztán területéről eddig öt helyszín került fel a Világörökségi Listára, harminc helyszín a javaslati listán várakozik a felvételre."},{"page_url":"https://en.wikipedia.org/wiki/Vermont_Route_118","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/VT_118_in_Berkshire.jpg","page_title":"Vermont Route 118","context_page_description":"Vermont Route 118 is a state highway in the U.S. state of Vermont. The highway runs 28.549 miles from VT 100 in Eden north to VT 108 in Berkshire. VT 118 connects several towns in northern Lamoille County and eastern Franklin County, including the covered bridge–rich town of Montgomery. The town of Berkshire maintains the highway north of VT 105."},{"page_url":"https://ca.wikipedia.org/wiki/Symphysodon_discus","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Symphysodon_discus_05.jpg","page_title":"Symphysodon discus","context_page_description":"El discus és una espècie de peix de la família dels cíclids i de l'ordre dels perciformes. És una de les dues espècies del gènere Symphysodon."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AA%D9%86%D8%A7%D9%81%D8%B3_%D8%A8%D9%8A%D9%86_%D8%AA%D9%88%D9%86%D8%B3_%D9%88%D9%85%D8%B5%D8%B1_%D9%81%D9%8A_%D9%83%D8%B1%D8%A9_%D8%A7%D9%84%D9%82%D8%AF%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Egypt_against_Tunisia_2012.jpg","page_title":"التنافس بين تونس ومصر في كرة القدم","context_page_description":"المباراة بين الفريق المصري والتونسي هي واحدة من أفضل المباريات الأفريقية وأكثرها إثارة في تاريخهم القاري الطويل. التقى الفريقان 39 مرة في كل من المباريات الرسمية والودية. جمعت المنتخبين 25 مباراة رسمية و14 مباراة ودية."},{"page_url":"https://sh.wikipedia.org/wiki/H%C3%BCmpfershausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/H%C3%BCmpfershausen_in_SM.png","page_title":"Hümpfershausen","context_page_description":"Himpfershauzen je opština u njemačkoj saveznoj državi Tiringija. Jedno je od 65 opštinskih središta okruga Šmalkalden-Majningen. Prema procjeni iz 2010. u opštini je živjelo 432 stanovnika. Posjeduje regionalnu šifru 16066033."},{"page_url":"https://en.wikipedia.org/wiki/Estonian_vernacular_architecture","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Estonian_Open_Air_Museum.004.JPG","page_title":"Estonian vernacular architecture","context_page_description":"The Estonian vernacular architecture consists of a number of traditional vernacular architectural styles throughout Estonia, embodied in villages, farmyards and farm houses. The oldest written sources describing Estonian villages date back to the 13th century, when they were mentioned in the Liber Census Daniae and by the chronicler Henry of Livonia."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D1%85%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Ayuntamiento_de_Mijas.jpg","page_title":"Міхас","context_page_description":"Міхас — муніципалітет в Іспанії, у складі автономної спільноти Андалусія, у провінції Малага. Населення — 76 362 особи.\\nМуніципалітет розташований на відстані близько 430 км на південь від Мадрида, 23 км на південний захід від Малаги.\\nНа території муніципалітету розташовані такі населені пункти:\\nЕнтрерріос: 855 осіб\\nЛас-Лагунас: 41299 осіб\\nМіхас: 4070 осіб\\nКалаонда-Чапарраль: 25364 особи\\nОсунільяс-Пенья-Бланкілья: 2991 особа\\nВальтокадо-Алькерія: 1783 особи"},{"page_url":"https://fr.wikipedia.org/wiki/Milow_(chanteur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Milow2.JPG","page_title":"Milow (chanteur)","context_page_description":"Jonathan Vandenbroeck, connu sous le pseudonyme de Milow, né le 14 juillet 1981 à Borgerhout dans la Province d'Anvers, est un chanteur-compositeur belge. Il est le fondateur de \\"Homerun Records\\" qui distribue ses propres disques."},{"page_url":"https://en.wikipedia.org/wiki/Eurasian_nuthatch","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Sitta_europaea_europaea%2C_%C3%96nner%C3%B6d%2C_Sweden_2.jpg","page_title":"Eurasian nuthatch","context_page_description":"The Eurasian nuthatch or wood nuthatch is a small passerine bird found throughout the Palearctic and in Europe, where its name is the nuthatch. Like other nuthatches, it is a short-tailed bird with a long bill, blue-grey upperparts and a black eye-stripe. It is a vocal bird with a repeated loud dwip call. There are more than 20 subspecies in three main groups; birds in the west of the range have orange-buff underparts and a white throat, those in Russia have whitish underparts, and those in the east have a similar appearance to European birds, but lack the white throat.\\nIts preferred habitat is mature deciduous or mixed woodland with large, old trees, preferably oak. Pairs hold permanent territories, and nest in tree holes, usually old woodpecker nests, but sometimes natural cavities. If the entrance to the hole is too large, the female plasters it with mud to reduce its size, and often coats the inside of the cavity too. The 6–9 red-speckled white eggs are laid on a deep base of pine or other wood chips.\\nThe Eurasian nuthatch eats mainly insects, particularly caterpillars and beetles, although in autumn and winter its diet is supplemented with nuts and seeds."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D8%B1%DB%8C%D8%A7%D9%86_%D9%85%D8%AF%D9%88%D8%B1_%D8%A7%D9%82%D8%AA%D8%B5%D8%A7%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Circular_flow_of_income_and_expenditure.jpg","page_title":"جریان مدور اقتصاد","context_page_description":"این جریان مدور درآمد یا جریان چرخشی یک مدل اقتصادی است که در آن عمده جریان به وسیله مبادله پول، کالا و خدمات و… بین بخش‌های مختلف اقتصاد نمایش داده می‌شود. جریان پول و کالا در یک مدار بسته مبادله می‌شود. تجزیه و تحلیل این جریان چرخشی بر اساس حسابهای ملی است و در نتیجه در حوزه اقتصاد کلان است.\\nایده جریان چرخشی در اثر Richard Cantillon نیز موجود بود. فرانسوا Quesnay آن را توسعه داد و با عنوان Tableau économique بیان کرد. تحول مهم در اثر Quesnay را کارل مارکس' در جلد دوم سرمایه ایجاد کرد: نقد اقتصاد سیاسی و بعد از او جان مینارد کینز' نظریه عمومی اشتغال بهره و پول را بیان کرد. ریچارد استون نیزدر ادامه این مفهوم را برای سازمان ملل متحد و سازمان همکاری اقتصادی و توسعه گسترش داد که در حال حاضر در سطح بین‌المللی استفاده می‌شود."},{"page_url":"https://en.wikipedia.org/wiki/Mount_Storm_Lake","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Mount_storm_lake_2011.jpg","page_title":"Mount Storm Lake","context_page_description":"Mount Storm Lake – also known as New Stony River Reservoir – is a 1,200 acres reservoir created in 1965 on the Stony River in Grant County, West Virginia. It serves as a cooling pond for the Dominion 1.6 gigawatt Mount Storm Power Station, which provides electricity to more than two million customers in Northern Virginia. The reservoir stands at an altitude of 3,244 feet."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E8%A5%BF%E6%B5%B7%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/%C5%8Cshima_Bridge_1030950.jpg","page_title":"西海市","context_page_description":"西海係日本長崎縣一市，人口有3萬。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Vlotho","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Vlotho-Denkmal-088-2012-05-13-0477.jpg","page_title":"Liste der Baudenkmäler in Vlotho","context_page_description":"Die Liste der Baudenkmäler in Vlotho enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Vlotho im Kreis Herford in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Vlotho eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%87%91%E7%89%9B%E5%BA%A7%E8%BF%BD%E8%B9%A4%E8%80%85627%E5%B7%A6%E8%BC%AA%E6%89%8B%E6%A7%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Taurus_627-KLM_357MAG_008.jpg","page_title":"金牛座追蹤者627左輪手槍","context_page_description":"金牛座追蹤者627是一款由巴西槍械製造商金牛座國際槍械公司所設計和生產的現代化單／雙動操作7發式轉輪手槍，發射.357 S&W麥格農或火力相對較弱的.38 S&W特種彈這二種手槍子彈。"},{"page_url":"https://cs.wikipedia.org/wiki/Vodn%C3%AD_park_%C4%8Cab%C3%A1rna","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/%C4%8Cab%C3%A1rna_-_Ekosyst%C3%A9m_na_T%C3%BDneck%C3%A9m_potoce.jpg","page_title":"Vodní park Čabárna","context_page_description":"Přírodní vodní park Čabárna leží v těsné blízkosti Kladna, mezi Švermovem a Brandýskem a má rozlohu 3,5 ha. Jedná se o soustavu rybníků, která tvoří přírodní ekosystém na Týneckém potoce. V roce 1998 byl park prohlášen za významný krajinný prvek České republiky, jehož území je hojně navštěvované v rámci environmentální výchovy nebo prostého pobytu v přírodě."},{"page_url":"https://en.wikipedia.org/wiki/Berrien_City,_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Princeton_Junction_Fire_Co_1_building.jpg","page_title":"Berrien City, New Jersey","context_page_description":"Berrien City, also known simply as Berrien, is an unincorporated community located within West Windsor Township in Mercer County, New Jersey, United States. The area is located within the Princeton Junction census designated place centered about the intersection of Alexander Road and Scott Avenue, located within walking distance of the Princeton Junction train station and Princeton-Hightstown Road. It was developed as an upper-middle class development after World War I and features homes constructed about 100 years ago. Most of the homes still exist with some small businesses located along Alexander Road with the West Windsor Arts Center operating its facilities out of the former Princeton Junction Fire Company fire station."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B8%D0%B3%D0%BE%D1%80%D0%BB%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Vihorlat_%28v_zime%29_034.jpg","page_title":"Вигорлат","context_page_description":"Вигорлат — горы на востоке Словакии и частично на Украине, часть Вигорлат-Гутинской гряды. Наивысшая точка — гора Вигорлат, 1076 м.\\nВигорлат в основном покрыт буковыми, дубовыми и ясеневыми лесами. Здесь обитают волк, рысь, дикая кошка, выдра, из птиц неясыть, филин. Также встречаются редкие насекомые — Альпийский усач, жук-носорог.\\nВ XIX веке, здесь была найдена железная руда, после сего начались горные работы. В результате этой деятельности сильно пострадали леса Вигорлата. Добыча прекратилась в 1904 году.\\nИз массива гор берёт своё начало река Окна."},{"page_url":"https://eu.wikipedia.org/wiki/Guadalupeko_gotorlekua","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Fuerte_de_Nuestra_Se%C3%B1ora_de_Guadalupe._Bateria_fuegos_curvos_de_la_bater%C3%ADa_acasamatada_de_la_Obra_de_la_Izquierda.JPG","page_title":"Guadalupeko gotorlekua","context_page_description":"Guadalupeko gotorlekua Jaizkibelgo mendian 1900. urtean eraiki zen gotorlekua da, Hondarribian kokatua, Guadalupeko baselizatik hurbil. Oiartzungo lubaki-eremua delakoa osatzen zuten hiru gotorlekuetan handiena da, eta karlisten altxamenduei aurre egiteko eraiki ziren. Artilleriako pieza handiekin hornitu zuten. Gotorlekuak hiru atal ditu, erdikoa, eskuinekoa eta ezkerrekoa izenez ezagunak direnak. Erdiko atalak aurrealde bakarra du. Eskuinekoak eta ezkerrekoak hiru aurrealde eta bateria estali gabe bat dute.\\n1934. urtean kartzelatzat erabili zen, Arrasate eta inguruko matxinoak bertan preso izan baitzituzten. Espainiako Gerra Zibilaren hasieran Errepublikaren eskuetan izan zen, eta Irungo guduan protagonismo garrantzitsua izan zuen, bai errekete eta legionarioen kontra, bai Almirante Cervera eta España gerraontzien kontra. Irun eskuindar matxinoen eskuetan erortzear zela, zenbait eskuindar pertsonaia ezagun fusilatu zituzten bertan, adibidez, Joaquín Beuntza.\\nGaur egunean Hondarribiko Udalarena da."},{"page_url":"https://pl.wikipedia.org/wiki/Herakliusz_Lisowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Irakli_Liso%C5%ADski._%D0%86%D1%80%D0%B0%D0%BA%D0%BB%D1%96_%D0%9B%D1%96%D1%81%D0%BE%D1%9E%D1%81%D0%BA%D1%96_%281898%29.jpg","page_title":"Herakliusz Lisowski","context_page_description":"Józef Lisowski herbu Jeż z przydomkiem Odrowąż, imię zakonne Herakliusz – duchowny greckokatolicki, w 1783 mianowany arcybiskupem połockim, konsekrowany 18 kwietnia 1784. W lipcu 1806 przeniesiony na urząd metropolity kijowskiego i zwierzchnika unitów w Rosji.\\nBył synem Józefa herbu Jeż z przydomkiem Odrowąż i Konstancji z Łepkowskich.\\nOdznaczony Orderem Świętego Stanisława w 1787 roku."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89quipe_cycliste_Groupama-FDJ","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Sandy.CasarC.jpg","page_title":"Équipe cycliste Groupama-FDJ","context_page_description":"L’équipe cycliste Groupama-FDJ est une équipe française de cyclisme professionnel sur route créée en 1997. Elle a le statut d'équipe World Tour depuis 2012. Depuis sa création, elle est financée par la société de loterie nationale française, la Française des jeux, qui est rejointe en 2018 par la société d'assurance Groupama. Elle est dirigée par l'ancien coureur Marc Madiot.\\nElle a notamment brillé lors de sa première année, remportant le classement de la Coupe du monde grâce aux victoires de Frédéric Guesdon dans Paris-Roubaix et de Davide Rebellin dans la Classique de Saint-Sébastien et le Grand Prix de Zurich. Par la suite, Guesdon en 2006 et Philippe Gilbert en 2008 remportent Paris-Tours, Arnaud Démare gagne Milan-San Remo en 2016 et Thibaut Pinot le Tour de Lombardie 2018. Sur les grands tours, Pinot a obtenu la troisième place sur le Tour de France 2014.\\nL'équipe a également compté dans ses rangs Baden Cooke, Bradley McGee ou Sandy Casar.\\nUne équipe féminine et une équipe continentale sont aussi liées à la structure."},{"page_url":"https://vi.wikipedia.org/wiki/Xa_l%E1%BB%99_Li%C3%AAn_ti%E1%BB%83u_bang_68","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Interstate_68_map.png","page_title":"Xa lộ Liên tiểu bang 68","context_page_description":"Xa lộ Liên tiểu bang 68 là một xa lộ liên tiểu bang dài 112,6 dặm nằm trong hai tiểu bang West Virginia và Maryland, kết nối Xa lộ Liên tiểu bang 79 trong thành phố Morgantown đến Xa lộ Liên tiểu bang 70 trong thị trấn Hancock. I-68 cũng là Hành lang E thuộc Hệ thống Xa lộ Phát triển Vùng Appalachia. Từ năm 1965 cho đến khi xa lộ cao tốc được xây dựng hoàn thành năm 1991, nó có tên là Quốc lộ Hoa Kỳ 48. Tại tiểu bang Maryland, xa lộ được biết với tên là Xa lộ cao tốc Quốc gia, cái tên gợi nhớ đến Lộ Quốc gia lịch sử mà I-68 chạy song song giữa khu chưa hợp nhất Keysers Ridge và thị trấn Hancock. Xa lộ cao tốc này phần lớn chạy qua các khu vực nông thôn, và băng qua vô số đỉnh núi nằm dọc theo đường của nó. Một chỗ xa lộ chạy cắt ngang qua đồi núi nằm trong khu vực Đồi Sideling phơi bày nhiều đặc điểm địa chất, thu hút khách tham quan.\\nCông cuộc xây dựng I-68 bắt đầu vào năm 1965 và tiếp tục trong hơn 25 năm cho đến khi hoàn thành vào ngày 2 tháng 8 năm 1991. Trong lúc con lộ này đang được xây dựng thì người ta tiên đoán rằng điều kiện kinh tế sẽ cải thiện dọc theo hành lang này. Hai thành phố lớn được xa lộ này kết nối là Morgantown và Cumberland."},{"page_url":"https://sv.wikipedia.org/wiki/Sierck-les-Bains","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Map_commune_FR_insee_code_57650.png","page_title":"Sierck-les-Bains","context_page_description":"Sierck-les-Bains är en kommun i departementet Moselle i regionen Grand Est i nordöstra Frankrike. Kommunen ligger i kantonen Sierck-les-Bains som tillhör arrondissementet Thionville-Est. År 2009 hade Sierck-les-Bains 1 720 invånare."},{"page_url":"https://es.wikipedia.org/wiki/Teatro_Romea_(Murcia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Teatro_Romea_Murcia.jpg","page_title":"Teatro Romea (Murcia)","context_page_description":"El teatro Romea de Murcia está situado en la plaza de Julián Romea del centro histórico de la ciudad de Murcia. Se trata del principal teatro de la localidad y uno de los más importantes del país."},{"page_url":"https://de.wikipedia.org/wiki/Grootberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Namibia_Grootberg_sunset.jpg","page_title":"Grootberg","context_page_description":"Der Grootberg ist ein Tafelberg im Damaraland, Region Kunene, Namibia mit 1640 m Höhe über dem Meeresspiegel. Der Berg ist vulkanischen Ursprungs und bildet ein Richtung Süden offenes, U-förmiges Plateau über dem Canyon des Klip Rivier. Der Klip ist ein linker Zufluss des Ugab.\\nDer Grootberg liegt rund 80 km westlich von Kamanjab. Der Berg kann über den Grootberg Pass und die Hauptstraße C39 auch von Twyfelfontein bzw. Torra Bay erreicht werden. Eine gleichnamige Lodge befindet sich auf dem Grootberg."},{"page_url":"https://en.wikipedia.org/wiki/Almohad_reforms","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Mapa_reconquista_almohades-en.svg","page_title":"Almohad reforms","context_page_description":"The Almohad reforms were a series of changes to the existing religious climate in Islamic Spain over the course of seventy years. The preceding Almoravid dynasty, while more repressive than some governments in Al-Andalus, was not violent. The religious fundamentalism of the Almohad Caliphate caused a massive emigration of Jews and Christians from southern Iberia to the Christian north and North Africa, specifically Egypt."},{"page_url":"https://en.wikipedia.org/wiki/Lhorong_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/NH-47-5.jpg","page_title":"Lhorong County","context_page_description":"Lhorong County is a county of the Qamdo Prefecture in the Tibet Autonomous Region. The county covers an area of 8,108 km² and has a population of around 40,000 as of 2003. The word Lhorong means \\"valley in the south\\" or \\"river in the south\\" in Tibetan."},{"page_url":"https://de.wikipedia.org/wiki/SSV_Ulm_1846","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Hoeness_BMK.jpg","page_title":"SSV Ulm 1846","context_page_description":"Der SSV Ulm 1846 Fußball e. V., kurz SSV Ulm 1846 Fußball und weiterhin allgemein bekannt als SSV Ulm 1846, ist ein Fußballverein aus der schwäbischen Stadt Ulm. Er entstand 2009 durch Abspaltung der Fußballabteilung vom Gesamtverein SSV Ulm 1846. Die Vereinsfarben des im Volksmund „die Spatzen“ genannten Klubs sind wie die Ulmer Stadtfarben Schwarz und Weiß. Der Verein, der als Fußballabteilung des Muttervereins von 1999 bis 2000 in der Bundesliga spielte und nach der dritten Insolvenz 2014 in der fünftklassigen Fußball-Oberliga Baden-Württemberg antrat, spielt inzwischen wieder in der Regionalliga Südwest."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%95%E0%A7%8B%E0%A6%95%E0%A7%8B%E0%A6%B8_(%E0%A6%95%E0%A6%BF%E0%A6%B2%E0%A6%BF%E0%A6%82)_%E0%A6%A6%E0%A7%8D%E0%A6%AC%E0%A7%80%E0%A6%AA%E0%A6%AA%E0%A7%81%E0%A6%9E%E0%A7%8D%E0%A6%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/H.M._Queen_Elizabeth_and_Prince_Philip_at_the_Cocos_Islands%2C_April_1954.jpg","page_title":"কোকোস (কিলিং) দ্বীপপুঞ্জ","context_page_description":"কোকোস দ্বীপপুঞ্জ অস্ট্রেলীয় বাহ্যিক সীমানার মধ্যে ভারত মহাসাগর সমন্বয়ে গঠিত একটি ছোট দ্বীপমালা। অস্ট্রেলিয়া ও শ্রীলঙ্কা এবং কাছাকাছি ইন্দোনেশীয় দ্বীপ সুমাত্রার প্রায় মাঝপথে এই দ্বীপটি অবস্থিত। এই দ্বীপটি দক্ষিণ-পূর্ব এশিয়া এবং দক্ষিণ গোলার্ধের মধ্যবর্তী একটি অংশ। ১৯৫৫ সালে সরকারি সীমানার এই দ্বীপের দুইটি নামকরণ করা হয়েছিল; যা হলো কোকোস দ্বীপপুঞ্জ বা কিলিং দ্বীপ।"},{"page_url":"https://it.wikipedia.org/wiki/Siliqua_(botanica)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Capsella_bursa_pastoris_1_beentree.jpg","page_title":"Siliqua (botanica)","context_page_description":"Sìliqua è il frutto caratteristico della famiglia delle Brassicaceae. È un frutto secco deiscente che a maturità libera i semi aprendosi spontaneamente. Deriva da un ovario bicarpellare sincarpico con numero variabile di semi. Si apre in 2 valve lungo la linea di sutura delle foglie carpellari, che a maturità si fendono ma non si separano completamente. Le due valve sono separate da un setto persistente membranoso, detto replo, sul quale sono inseriti i semi.\\nIl frutto si chiama sìliqua quando il diametro longitudinale supera quello trasversale, siliquetta quando è isodiametrico o cuoriforme."},{"page_url":"https://de.wikipedia.org/wiki/DeSoto_Fireflite","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/DeSoto_fire_flite_sp.m_Bj_1959_160_Kmh_6276_ccm_213_Kw_zGG_2355_seite.JPG","page_title":"DeSoto Fireflite","context_page_description":"Der DeSoto Fireflite war ein in mehreren Modellgenerationen angebotenes Fahrzeug der zum Chrysler-Konzern gehörenden Automobilmarke DeSoto. 1955 und 1956 war der Fireflite das Spitzenmodell der Marke, bevor er diesen Rang ab 1957 an den Adventurer abgab."},{"page_url":"https://cy.wikipedia.org/wiki/McKeesport,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Karl_Brown_in_Home%2C_Sweet_Home.jpg","page_title":"McKeesport, Pennsylvania","context_page_description":"Tref yn Allegheny County, yn nhalaith Pennsylvania, Unol Daleithiau America yw McKeesport, Pennsylvania. ac fe'i sefydlwyd ym 1795, 1842, 1891."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B8%D1%80%D0%B0%D0%BC_%D0%90%D0%B1%D0%B8%D1%84%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/%D0%A5%D1%80%D0%B0%D0%BC_I.jpg","page_title":"Хирам Абифф","context_page_description":"Хирам Абифф — персонаж, который занимает видное место в аллегориях ритуала третьего градуса масонства.\\nХирам представлен как главный архитектор Храма царя Соломона, который был убит тремя нечестивцами во время неудачной попытки заставить его раскрыть тайный пароль мастера. Этот сюжет объясняется в наставлениях, которые следуют в ходе проведения ритуала посвящения в градус мастера-масона. Сама история является уроком верности своему слову и краткости жизни.\\nМногочисленные исследователи масонства предполагают, что Хирам Абифф как масонский символ может быть основан на одном или нескольких Хирамах, которые фигурируют в Библии."},{"page_url":"https://la.wikipedia.org/wiki/Haverskerque","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Blason_de_la_ville_de_Cond%C3%A9-sur-l%27Escaut_%2859%29_Nord-France.svg","page_title":"Haverskerque","context_page_description":"Haverskerque est commune 1485 incolarum praefecturae Septentrionis in Franciae borealis regione Septentrione et Freto."},{"page_url":"https://pl.wikipedia.org/wiki/Gavilanes","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Vista_de_Gavilanes.JPG","page_title":"Gavilanes","context_page_description":"Gavilanes – gmina w Hiszpanii, w prowincji Ávila, w Kastylii i León, o powierzchni 29,16 km². W 2011 roku gmina liczyła 651 mieszkańców."},{"page_url":"https://pl.wikipedia.org/wiki/National_Medal_of_Science","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/James_E._Darnell.jpg","page_title":"National Medal of Science","context_page_description":"National Medal of Science – wyróżnienia przyznawane przez prezydenta Stanów Zjednoczonych naukowcom za znaczący wkład w rozwój nauk społecznych, biologicznych, chemicznych, technicznych, matematycznych i fizycznych.\\nMedal został ustanowiony przez Kongres Stanów Zjednoczonych 25 sierpnia 1959. Pierwsza ceremonia wręczenia wyróżnienia miała miejsce 18 lutego 1963, John F. Kennedy uhonorował wówczas Theodore'a von Kármána."},{"page_url":"https://pt.wikipedia.org/wiki/Junkers_Ju_87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Bundesarchiv_Bild_183-J20509%2C_Russland%2C_Kampf_um_Stalingrad%2C_Luftangriff.jpg","page_title":"Junkers Ju 87","context_page_description":"O Junkers Ju 87, popularmente conhecido como Stuka, foi um bombardeiro utilizado pela força aérea alemã e pela Regia Aeronautica Italiana durante a Segunda Guerra Mundial."},{"page_url":"https://it.wikipedia.org/wiki/Tallero_di_Modena","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Crespellani_150.jpg","page_title":"Tallero di Modena","context_page_description":"A Modena i talleri furono coniati più frequentemente che in altre zecche italiane.\\nSi tratta quasi esclusivamente di monete per il commercio con l'estero, principalmente con il Levante. Spesso sono il prodotto di vere e proprie speculazioni, poiché venivano coniate monete con minor contenuto di metallo prezioso.\\nTale prassi era ampiamente diffusa nel '600, e diede luogo al fenomeno delle coniazioni d'imitazione ed in alcuni casi a vere e proprie truffe internazionali, come nel caso del luigino.\\nSolo una moneta, il tallero di Ercole III, è inserita nella normale circolazione del ducato, ma fu coniata solo nel 1795 e 1796."},{"page_url":"https://pt.wikipedia.org/wiki/Trabalhista_Futebol_Clube","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/TrabalhistaFC.jpg","page_title":"Trabalhista Futebol Clube","context_page_description":"Trabalhista Futebol Clube foi um clube de futebol da cidade de Florianópolis, no estado de Santa Catarina. Participou de 4 edições do Campeonato Catarinense de Futebol: 1924, 1925, 1926 e 1927.\\nSagrou-se vice campeão de 1924, disputando a final contra o Avaí Futebol Clube."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%8A%D8%A7%D9%86_%D8%A7%D9%86%D8%AF%D9%88%D8%AA%D8%B4_%DA%86%D9%88%D9%86%D9%88%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/General_Jean_Andoche_Junot.jpg","page_title":"چيان اندوتش چونوت","context_page_description":"چيان اندوتش چونوت كان عسكرى برتبه ديڤيسيونال جينيرال من فرنسا."},{"page_url":"https://fr.wikipedia.org/wiki/Transformateur_de_puissance","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Tragschnabelwagen_mit_Transformator_%288788%29.jpg","page_title":"Transformateur de puissance","context_page_description":"Un transformateur de puissance est un composant électrique haute-tension essentiel dans l'exploitation des réseaux électriques. Sa définition selon la commission électrotechnique internationale est la suivante : « Appareil statique à deux enroulements ou plus qui, par induction électromagnétique, transforme un système de tension et courant alternatif en un autre système de tension et courant de valeurs généralement différentes, à la même fréquence, dans le but de transmettre de la puissance électrique ». Sa principale utilité est de réduire les pertes dans les réseaux électriques. Il peut être monophasé ou triphasé et recevoir divers couplages : étoile, triangle et zigzag.\\nOn retrouve les transformateurs de puissance dans différents types d'applications : dans les réseaux de transmission électrique, dans la distribution électrique, dans les usines en amont de fours électriques notamment et dans les trains. Chacun répondant à des contraintes et des usages très différents."},{"page_url":"https://de.wikipedia.org/wiki/Fic%C4%83tar","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Racovita_jud_Timis.png","page_title":"Ficătar","context_page_description":"Ficătar ist ein Dorf im Kreis Timiș, in der Region Banat, im Südwesten Rumäniens. Ficătar gehört zur Gemeinde Racovița."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Wien/Floridsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/GuentherZ_2009-02-14_0014_Gaswerk_Leopoldau_Haupteingang.jpg","page_title":"Liste der denkmalgeschützten Objekte in Wien/Floridsdorf","context_page_description":"Die Liste der denkmalgeschützten Objekte in Wien/Floridsdorf enthält die 67 denkmalgeschützten, unbeweglichen Objekte des 21. Wiener Gemeindebezirks Floridsdorf."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%82%AF%E3%82%A2%E3%82%B6%E3%83%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Saussurea_ussuriensis_1.JPG","page_title":"キクアザミ","context_page_description":"キクアザミは、キク科トウヒレン属の多年草。"},{"page_url":"https://war.wikipedia.org/wiki/Buddleja_delavayi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Buddleja_delavayii%2C_Longstock.jpg","page_title":"Buddleja delavayi","context_page_description":"An Buddleja delavayi in uska species han Magnoliopsida nga ginhulagway ni François Gagnepain. An Buddleja delavayi in nahilalakip ha genus nga Buddleja, ngan familia nga Scrophulariaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://hu.wikipedia.org/wiki/%C3%96stringen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Rathaus_Oestringen060909.jpg","page_title":"Östringen","context_page_description":"Östringen település Németországban, azon belül Baden-Württembergben. Lakosainak száma 13 015 fő. +/- Östringen Bad Schönborn és Ubstadt-Weiher községekkel határos."},{"page_url":"https://ht.wikipedia.org/wiki/Abilene,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Abilene_from_the_Enterprise_Building.jpg","page_title":"Abilene, Texas","context_page_description":"Abilene se yon vil nan eta Texas, nan Etazini.\\nNan lane 2000 li te genyen 115,930 moun."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D1%80%D0%BE%D0%B3%D0%B0_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B8%D1%85_%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Caminowalkingoutpamplona.jpg","page_title":"Дорога французских королей","context_page_description":"Дорога французских королей — главная паломническая дорога на севере Испании, протягивающаяся на 675,5 км от Памплоны до Сантьяго де Компостелы, часть Пути Святого Иакова.\\nПродолжительность — примерно 35 дней.\\nБлагоприятное время — с апреля по октябрь."},{"page_url":"https://en.wikipedia.org/wiki/Focke-Wulf_GL_18","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Focke-Wulf_GL_18_D-967_Helgoland_DLH.JPG","page_title":"Focke-Wulf GL 18","context_page_description":"The Focke-Wulf GL 18 was a 1920s German light transport monoplane, designed and built by Focke-Wulf."},{"page_url":"https://nl.wikipedia.org/wiki/Gulik-Kleefse_Successieoorlog","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Siege_and_capture_of_Julich_by_Maurice_of_Orange_in_1610.jpg","page_title":"Gulik-Kleefse Successieoorlog","context_page_description":"De Gulik-Kleefse Successieoorlog was een conflict over de opvolging van de kinderloos gestorven hertog van Gulik Kleef en Berg. De oorlog duurde van 1609 tot 1614. Aan het begin van de oorlog streden de erfgenamen Brandenburg en Palts-Neuburg samen met hun bondgenoten tegen de commissaris van de keizer om de hertogdommen in handen te krijgen. Vervolgens brak over de verdeling van de gebieden een nieuwe oorlog uit. De calvinistische keurvorst Johan Sigismund van Brandenburg werd hierin gesteund door de Republiek en het katholieke Palts-Neuburg door Spanje. De oorlog werd beëindigd met het Verdrag van Xanten, waarin Brandenburg Kleef en Mark kreeg en Palts-Neuburg Gulik en Berg. Pas in 1666 werd het conflict over de verdeling definitief opgelost."},{"page_url":"https://es.wikipedia.org/wiki/Repelente_en_espiral","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Mosquito_coil.JPG","page_title":"Repelente en espiral","context_page_description":"Un insecticida en espiral, coloquialmente espiral, es un incienso repelente de insectos; posee la típica forma de espiral que le da su nombre, y por lo general está compuesto de una pasta seca de polvo de piretro. El rollo o bobina se sostiene por la parte del centro de la espiral, quedando de este modo suspendido en el aire, permitiendo de esta manera una traza continua. La brasa normalmente empieza en el cabo exterior de la espiral y lentamente se propaga hacia el centro, expulsando el humo repelente de mosquitos.​ Un insecticida en espiral típico puede medir alrededor 15 cm de diámetro y dura alrededor de 7 a 12 horas. Los repelentes en espiral son ampliamente utilizados en Asia, África, Australia y América del Sur.​"},{"page_url":"https://pl.wikipedia.org/wiki/J%C3%B3zef_Jodkowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Jadkouski.jpg","page_title":"Józef Jodkowski","context_page_description":"Józef Jodkowski – polski archeolog, numizmatyk, historyk ziemi grodzieńskiej."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B2%D0%B5%D0%B7%D0%B4%D0%BE%D0%B2%D0%B8%D0%BA_%D0%B1%D0%B0%D1%85%D1%80%D0%BE%D0%BC%D1%87%D0%B0%D1%82%D1%8B%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Gaestrum_fimbriatum_1.jpg","page_title":"Звездовик бахромчатый","context_page_description":"Звездови́к бахро́мчатый — вид грибов, включённый в род Звездовик семейства Звездовиковые."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D1%83%D1%80%D0%B0%D0%BD%D0%B0,_%D0%A4%D1%80%D0%B0%D0%BD%D1%87%D0%B5%D1%81%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Arms_Rene_Anjou_Louvre_Revoil394.jpg","page_title":"Лаурана, Франческо","context_page_description":"Франческо Лаурана или Франческо де ла Врана — скульптор и медальер из Далмации. Считается одновременно итальянским и хорватским скульптором."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Aurisina","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Stazione_Aurisina.jpg","page_title":"Stazione di Aurisina","context_page_description":"La stazione di Aurisina è una stazione ferroviaria posta sulla linea Trieste-Vienna. Importante nodo di scambio fino alla prima guerra mondiale, perse via via importanza, fino a vedere interrotto il servizio viaggiatori, negli anni novanta del XX secolo."},{"page_url":"https://pl.wikipedia.org/wiki/Quercus_garryana","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Quercus_garryana_range_map.png","page_title":"Quercus garryana","context_page_description":"Quercus garryana Douglas ex Hook. – gatunek roślin z rodziny bukowatych. Występuje naturalnie w południowo-zachodniej Kanadzie oraz zachodnich Stanach Zjednoczonych."},{"page_url":"https://es.wikipedia.org/wiki/Alumbrado_de_gas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/A_Peep_at_the_Gas_Lights_in_Pall_Mall_Rowlandson_1809.jpg","page_title":"Alumbrado de gas","context_page_description":"El alumbrado de gas es una tecnología utilizada para producir luz a partir de un combustible gaseoso como por ejemplo el hidrógeno, el metano, el propano, el butano, el acetileno o el etileno.\\nAntes de la electricidad el alumbrado de gas se convirtió en un sistema bastante extendido y económico para permitir el uso público en general. El alumbrado a gas fue el medio más popular de iluminación en las ciudades y barrios desde principios de los años 1800. Al principio, las farolas de gas tenían que ser encendidas a mano, pero al cabo de unos años las farolas se pudieron encender por sí mismas.\\nLa luz de gas hoy en día se suele utilizar solamente para acampar, donde la alta densidad de energía de un combustible de hidrocarburos, en combinación con la naturaleza modular de los contenedores, permite producir luz brillante y de larga duración de forma barata y sin complejos equipos."},{"page_url":"https://de.wikipedia.org/wiki/Rienzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Illustrirte_Zeitung_%281843%29_07_013_2_Irene_-_Fr%C3%A4ul_W%C3%BCst.PNG","page_title":"Rienzi","context_page_description":"Rienzi, der letzte der Tribunen ist eine große tragische Oper in fünf Akten mit sechzehn Nummern von Richard Wagner. Sie wurde 1842 uraufgeführt. Auch das Libretto stammt, wie bei allen Opern Wagners, vom Komponisten. Die Oper handelt in freien Zügen vom Leben des spätmittelalterlichen römischen Staatsmanns und Volkstribuns Cola di Rienzo.\\nRienzi gilt als Adolf Hitlers Lieblingsoper und spielte während der Zeit des Nationalsozialismus eine zentrale Rolle, unter anderem auf den Reichsparteitagen in Nürnberg."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9F%BC%E7%8E%89%E7%9C%8C%E3%81%AE%E8%A6%B3%E5%85%89%E5%9C%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Tokorozawa_Aviation_Museum.JPG","page_title":"埼玉県の観光地","context_page_description":"埼玉県の観光地は、埼玉県内の主要な観光地に関する項目である。"},{"page_url":"https://fi.wikipedia.org/wiki/Eduskunnan_puhemies","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Maria_Lohela_2015.jpg","page_title":"Eduskunnan puhemies","context_page_description":"Eduskunnan puhemies on Suomen eduskunnan jäsen, joka johtaa puhetta eduskunnan täysistunnoissa eli hän on eduskunnan puheenjohtaja. Puhemies istuu istuntosalin edustalla korkeimmalla korokkeella ja poikkeaa muista kansanedustajista siten, ettei itse osallistu keskusteluun tai äänestyksiin eduskunnassa ja yleensä pysyttelee päivänpolitiikan ulkopuolella. Vaikka puhemieskin on valittu kansanedustajaksi jostain puolueesta, hän ei tehtävässään saa syrjiä tai suosia mitään puoluetta. Puhemies johtaa puhetta täysistuntojen lisäksi kansliatoimikunnassa sekä puhemiesneuvostossa, johon kuuluvat puhemies, varapuhemiehet ja valiokuntien puheenjohtajat.\\nPuhemiehestä katsoen korokkeen vasemmalla puolella on hallituksen aitio, oikealla puolella virkamiesaitio, jossa muun muassa tulkit työskentelevät. Korokkeen edessä pyöreän pöydän ääressä työskentelevät pöytäkirjasihteerit. Valtakunnan hierarkiassa eduskunnan puhemies on toinen heti presidentin jälkeen. Poliittista valtaa eduskunnan puhemiehellä ei kuitenkaan juuri ole.\\nEduskunnan puhemies on viime vuosikymmeninä ollut toisen suuren hallituspuolueen jäsen ja tullut eri puolueesta kuin pääministeri."},{"page_url":"https://de.wikipedia.org/wiki/Schachnotation","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/SCD_algebraic_notation.svg","page_title":"Schachnotation","context_page_description":"Zum Aufzeichnen von Schachpartien oder Schachstellungen gibt es verschiedene Systeme der Schachnotation.\\nUm die Züge während der Partie niederzuschreiben, benutzen die Spieler in der Regel vorgedruckte Partieformulare. Eine einzelne Schachstellung kann in der Schachliteratur durch ein Diagramm abgebildet werden, auf dem festgelegte Symbole die einzelnen Steine bzw. Figuren verkörpern."},{"page_url":"https://ga.wikipedia.org/wiki/An_Dothra","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Little_Dargle_River_in_northern_Churchtown_%28geograph_3546705%29.jpg","page_title":"An Dothra","context_page_description":"Is ceann den trí phríomhabhainn i mBaile Átha Cliath in Éirinn í Abhainn na Dothra, lena n-áirítear an Life, a bhfuil an Dothra ina craobh-abhann is príomhúla dá cuid, agus an Tulcha."},{"page_url":"https://de.wikipedia.org/wiki/Pfarrkirche_Oberkohlst%C3%A4tten","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Pfarrkirche_Oberkohlst%C3%A4tten_Interior_01.JPG","page_title":"Pfarrkirche Oberkohlstätten","context_page_description":"Die römisch-katholische Pfarrkirche Oberkohlstätten steht an der oberen Dorfstraße in der Ortschaft Oberkohlstätten in der Gemeinde Unterkohlstätten im Bezirk Oberwart im Burgenland. Sie ist dem heiligen Leonhard geweiht und gehört zum Dekanat Rechnitz in der Diözese Eisenstadt. Das Bauwerk steht unter Denkmalschutz."},{"page_url":"https://cs.wikipedia.org/wiki/T-34","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/T-34_Subtypes.jpg","page_title":"T-34","context_page_description":"T-34 byl sovětský střední tank vyvinutý na přelomu 30. a 40. let 20. století, který měl zásadní a trvalý dopad na konstrukci tanků. V době svého vzniku v roce 1940 byl podle amerického autora Stevena Zalogy nejlepším středním tankem na světě. Disponoval bezprecedentní kombinací palebné síly, mobility, ochrany a robustnosti. Jeho rychlopalný tankový kanón ráže 76,2 mm poskytoval podstatně vyšší palebnou sílu než měly některé konstrukce jeho současníků, zatímco jeho šikmým pancéřováním jen obtížně pronikaly nejmodernější protitankovými zbraněmi. Když se v roce 1941 poprvé objevil, označil ho německý generál Paul Ludwig Ewald von Kleist za „nejlepší tank na světě“ a Heinz Guderian potvrdil „obrovskou nadřazenost“ T-34 nad stávajícími německými obrněnci té doby. Ačkoli byla jeho výzbroj i ochrana později v průběhu války překonána, často je zmiňován jako nejúčinnější a nejvlivnější tanková konstrukce druhé světové války\\nT-34 byl během druhé světové války základem sovětských obrněných sil."},{"page_url":"https://it.wikipedia.org/wiki/Bruny_Island","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/The_Spit_Bruny_Island_retouched.jpg","page_title":"Bruny Island","context_page_description":"Bruny Island è un'isola situata lungo la costa sud-orientale della Tasmania, dalla quale è separata dal canale di D'Entrecasteaux. Sia l'isola che il canale prendono il nome dall'esploratore francese Antoine Bruni d'Entrecasteaux. L'isola era nota agli aborigeni della Tasmania col nome di Alonnah-Lunawanna, ed infatti i due insediamenti presenti su di essa si chiamano, rispettivamente, Alonnah e Lunawanna."},{"page_url":"https://pt.wikipedia.org/wiki/NGC_1152","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/NGC1152_-_SDSS_DR14.jpg","page_title":"NGC 1152","context_page_description":"NGC 1152 é uma galáxia lenticular localizada na direcção da constelação de Eridanus. Possui uma declinação de -07° 45' 35\\" e uma ascensão recta de 2 horas, 57 minutos e 33,6 segundos.\\nA galáxia NGC 1152 foi descoberta em 10 de Novembro de 1885 por Lewis A. Swift."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E9%B2%81%E6%B2%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Arusha2.png","page_title":"阿鲁沙","context_page_description":"阿鲁沙是一座位于坦桑尼亚东北部的城市，在乞力马扎罗山西南约90公里。它是坦桑尼亚阿鲁沙区的首府，有人口约34万也是东非共同体总部所在地。阿鲁沙的北部紧邻阿鲁沙国家公园，其中有梅鲁火山，及位于其山脚著名的恩戈罗戈罗火山口。这座城市也因东非著名的游牧民族马赛人而著名。\\n未来预计在东非联邦成立后，成为联邦国首都所在地。"},{"page_url":"https://pl.wikipedia.org/wiki/Lampa_z_wyj%C5%9Bciem_indukcyjnym","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Inductive_output_tube_%28IOT%29_for_UHF_ATSC_broadcast_television%2C_manufactured_by_e2v_and_shown_new_in_packaging.jpg","page_title":"Lampa z wyjściem indukcyjnym","context_page_description":"Lampa z wyjściem indukcyjnym jest lampą mikrofalową przeznaczoną do wzmacniania sygnałów wielkiej częstotliwości UHF. Stanowi ona skrzyżowanie klistronu i triody. Składa się z katody wysyłającej elektrony, zespołu elektrod ogniskujących wyemitowane elektrony w wąską wiązkę, siatki, anody przyśpieszającej oraz rezonatora i kolektora. Emitowane przez katodę elektrony są formowane w wąską wiązkę i przyspieszane przez anodę. Natężenie wiązki elektronów w tej lampie jest modulowane za pomocą siatki. W związku z tym sygnał wejściowy jest podawany pomiędzy siatkę a katodę. Skupiona wiązka elektronów przechodzi następnie przez rezonator, równoważny rezonatorowi wyjściowemu klistronu. Pobudzony tą wiązką rezonator emituje pole elektromagnetyczne, które jest wyprowadzane na zewnątrz lampy jako wzmocniony sygnał użyteczny. Elektrony kończą swój bieg na kolektorze.\\nLampy z wyjściem indukcyjnym zostały wynalezione i opatentowane w końcu lat 30. XX w. W latach 80. ponownie znalazły zastosowanie w nadajnikach telewizyjnych UHF dużej mocy zastępując mało wydajne klistrony."},{"page_url":"https://en.wikipedia.org/wiki/Water_and_religion","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Anant_Chaturdashi.jpg","page_title":"Water and religion","context_page_description":"Water is considered a purifier in most religions."},{"page_url":"https://ru.wikipedia.org/wiki/AIGLX","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Linux_graphics_drivers_DRI_current.svg","page_title":"AIGLX","context_page_description":"AIGLX — проект с открытым исходным кодом для поддержки непрямого GLX-рендеринга, совместимого с X.Org и DRI-драйверами. Создан сообществом Red Hat и Fedora Linux. Удалённый X11-клиент получает аппаратно ускоренный рендеринг через протокол GLX; эта разработка необходима чтобы задействовать аппаратное ускорение для программ, управляющих прозрачностью в OpenGL."},{"page_url":"https://ca.wikipedia.org/wiki/Coll_de_Nufenen","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Nufenen_Pass.jpg","page_title":"Coll de Nufenen","context_page_description":"El coll de Nufenen, amb una elevació de 2.478 metres, és el port de muntanya més alt amb carretera pavimentada de Suïssa. Es troba entre els cims dels pics Pizzo Gallina i Nufenenstock.\\nLa carretera va d'Ulrichen, al cantó de Valais, cap a la vall de Bedretto al cantó de Ticino, enllaçant Brig amb Airolo. No és el pas més baix entre les dues valls car es troba un quilòmetre al nord d'un punt sense nom, lleugerament més baix a 2.440 metres, el qual és travessat per un camí.\\nEl coll és de construcció relativament recent, sent obert al trànsit de vehicles de motor d'ençà el setembre de 1969.\\nA l'est de la part superior del coll hi ha el naixement del riu Ticino. Cap al del nord es veuen vistes dels Alps Bernesos, incloent-hi el Finsteraarhorn, mentre que cap al sud s'hi pot veure la glacera de Gries."},{"page_url":"https://pt.wikipedia.org/wiki/M%C3%A4larh%C3%B6jden","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/M%C3%A4larh%C3%B6jden.jpg","page_title":"Mälarhöjden","context_page_description":"Mälarhöjden é um bairro da cidade de Estocolmo, situado na zona de Söderort, junto ao Lago Malar. Faz parte da comuna de Estocolmo, integrando a freguesia de Hägersten-Liljeholmen.\\nFaz fronteira com os bairros de Hägersten, Västertorp, Fruängen e Bredäng, possuindo ainda fronteira aquática com a comuna de Ekerö.\\nO terreno que constitui o bairo é muito acidentado, situando-se o seu ponto mais alto a 71 metros de altitude."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_peixos_de_Kansas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Blue_catfish_tenn_aquarium.JPG","page_title":"Llista de peixos de Kansas","context_page_description":"Aquesta llista de peixos de Kansas inclou 44 espècies de peixos que es poden trobar actualment a Kansas ordenades per l'ordre alfabètic de llurs noms científics."},{"page_url":"https://nl.wikipedia.org/wiki/Dukenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Laagbouw_in_Tolhuis.jpg","page_title":"Dukenburg","context_page_description":"Dukenburg is een stadsdeel gesitueerd aan de zuidwestkant van Nijmegen. In 1965 werd een begin gemaakt met het bouwen op de plaatselijk vrij natte grond."},{"page_url":"https://es.wikipedia.org/wiki/Andr%C3%A9s_Lima","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/%28Andr%C3%A9s_Lima%29_La_alcaldesa%2C_en_la_lectura_de_los_Episodios_Nacionales_que_celebra_el_2_de_mayo_junto_a_la_estatua_de_Gald%C3%B3s_10_%28cropped%29.jpg","page_title":"Andrés Lima","context_page_description":"Andrés Lima Fernández de Toro es un actor y director teatral español vinculado a la compañía de teatro Animalario.\\nEl 30 de septiembre de 2019 fue galardonado con el Premio Nacional de Teatro.​"},{"page_url":"https://de.wikipedia.org/wiki/Solmspark","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Solmspark_-_Ansicht_vom_Brentanopark_aus.jpg","page_title":"Solmspark","context_page_description":"Der Solmspark ist neben dem Brentanopark einer der beiden großen Parks im Frankfurter Stadtteil Rödelheim. Er ist etwa fünf Hektar groß."},{"page_url":"https://sh.wikipedia.org/wiki/Flughafen_Stuttgart","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Stuttgart_Airport_2006_by-RaBoe_01.jpg","page_title":"Flughafen Stuttgart","context_page_description":"Aerodrom Stuttgart je međunarodni aerodrom u Nemačkoj. Smešten je 13 km južno od centralna Štutgarta i važan je hub za nemačke niskotarifne avio-kompanije Germanwings i TUIfly.\\nPo broju putnika je sedmi aerodrom u Nemačkoj i jedini veći aerodrom sa samo jednom pistu. Kroz aerodrom je 2007. prošlo 10.326.027 putnika."},{"page_url":"https://en.wikipedia.org/wiki/Australian_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Australian_Birds.jpg","page_title":"Australian Museum","context_page_description":"The Australian Museum is a heritage-listed museum at 1 William Street, Sydney central business district, New South Wales, Australia currently under renovation. It is the oldest museum in Australia, with an international reputation in the fields of natural history and anthropology. It was first conceived and developed along the contemporary European model of an encyclopedic warehouse of cultural and natural history and features collections of vertebrate and invertebrate zoology, as well as mineralogy, palaeontology and anthropology. Apart from exhibitions, the museum is also involved in Indigenous studies research and community programs. In the museum's early years, collecting was its main priority, and specimens were commonly traded with British and other European institutions. The scientific stature of the museum was established under the curatorship of Gerard Krefft, himself a published scientist.\\nThe museum is located at the corner of William Street and College Street in the Sydney central business district, in the City of Sydney local government area of New South Wales, and was originally known as the Colonial Museum or Sydney Museum."},{"page_url":"https://fr.wikipedia.org/wiki/Arles_sous_le_gouvernement_des_podestats","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Castillo_monzon.jpg","page_title":"Arles sous le gouvernement des podestats","context_page_description":"Arles sous le gouvernement des podestats est une période très brève, au début du XIIIᵉ siècle, de l'histoire de la cité rhodanienne. Le gouvernement des podestats est une forme de gouvernement communal mis en place en 1220 et succédant au consulat, instauré un siècle plus tôt. Il correspond à un nouvel et précaire équilibre des forces communales en relation avec l'environnement politique complexe de l'époque, apportant principalement des limitations aux prérogatives de l’archevêque.\\nLa podestarie est créée à l'image de celles de l'Italie voisine avec qui la cité arlésienne entretient de nombreux contacts. Ce mode d'administration se traduit par le fait de confier la conduite de la ville à un personnage appelé podestat, véritable gouverneur de la cité. Il s'agit généralement d'un étranger — plus précisément d'un Italien — non lié aux factions arlésiennes, recruté et renouvelé chaque année pour assurer un gouvernement neutre ; il est muni de pouvoirs temporaires mais toutefois très étendus."},{"page_url":"https://de.wikipedia.org/wiki/Liste_bekannter_Personen_mit_Bezug_zur_Freien_Schulgemeinde_Wickersdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Feininger_laurence_karl_johann_1925.jpg","page_title":"Liste bekannter Personen mit Bezug zur Freien Schulgemeinde Wickersdorf","context_page_description":"Diese Liste enthält bekannte Personen des ehemaligen reformpädagogischen Landerziehungsheims Freie Schulgemeinde Wickersdorf bei Saalfeld im Thüringer Wald. Sie erlaubt auf Basis der ganz unterschiedlich handelnden Charaktere und ihrer Lebenswege eine differenziertere historische Ein- und Zuordnung dieses schulischen Pilotprojekts, das sich in den ersten Jahrzehnten durch seinen musischen Schwerpunkt, ganz besonders jedoch durch das maßgeblich von Martin Luserke initiierte „Darstellende Spiel“ von den meisten anderen Schulprojekten unterschied. Für viele künstlerisch und pädagogisch interessierte Zeitgenossen in Deutschland, Österreich und weiteren Ländern wurde die FSG Wickersdorf ein diskussionswürdiges „freies“ privates Internatsschulprojekt – parteienübergreifend."},{"page_url":"https://lmo.wikipedia.org/wiki/Millery_(FR-69)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Lyon-Sud_097.JPG","page_title":"Millery (FR-69)","context_page_description":"Millery l'è 'n cümü fransés de la regiù Rhône-Alpes, endèla Frància centro-meridiunàla. El fa part del cantù de Givors, del circondàre de Lione e del dipartimènt del Rodano.\\nEl g'ha 'na popolasiù de 3 647 abitàncc, dato agiurnàt al ginee 2011.\\nEl sò teretóre el g'ha 'na superfìce de 9,22 km² e 'l và de 'na altèsa mìnima de 155 méter a 'na altèsa màsima de 304 méter söl leèl del mar."},{"page_url":"https://es.wikipedia.org/wiki/Torneo_Apertura_2017_(Costa_Rica)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Lim%C3%B3n_F%C3%BAtbol_Club.png","page_title":"Torneo Apertura 2017 (Costa Rica)","context_page_description":"El Torneo Apertura 2017 fue la edición 109.° del campeonato de liga de la Primera División del fútbol costarricense.\\nLa principal novedad para la temporada 2017-18 sería el cambio de nomenclatura para ambos torneos, volviendo a utilizar los términos de Apertura y Clausura. Además, en esta competencia dio inicio el equipo de Guadalupe Fútbol Club, el cual reemplazó a Belén.\\nEl club ascendido para este año deportivo fue el Municipal Grecia, ocupando el lugar que dejó el conjunto de San Carlos, pero manteniendo el mismo número de representantes de la provincia de Alajuela.\\nPara este torneo, el analista José Adrián Martinez, aseguró que la «clasificación a la cuadrangular fue un logro casi tan digno como lograr el campeonato». Dicha aseveración fue acuerpada por el secretario técnico Juan Padilla."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BE%8E%E5%9C%8B%E5%8D%B0%E7%AC%AC%E5%AE%89%E7%B4%8D%E5%B7%9E%E9%A6%AC%E9%87%8C%E6%81%A9%E5%B8%82%E6%A9%9F%E5%A0%B4%E6%92%9E%E6%A9%9F%E4%BA%8B%E6%95%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Cessna.fa150k.g-aycf.arp.jpg","page_title":"美國印第安納州馬里恩市機場撞機事故","context_page_description":"馬里恩市機場撞機事故在2018年4月2日於美國印第安納州馬里恩市機場發生，造成2人死亡。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%81%D1%82%D0%B5%D0%BB_%D0%86%D0%B2%D0%B0%D0%BD%D0%B0_%D0%A5%D1%80%D0%B5%D1%81%D1%82%D0%B8%D1%82%D0%B5%D0%BB%D1%8F_(%D0%9A%D0%B0%D0%BC%D0%B0%D1%97)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Kamaji%2C_Rynak._%D0%9A%D0%B0%D0%BC%D0%B0%D1%96%2C_%D0%A0%D1%8B%D0%BD%D0%B0%D0%BA_%281878%29.jpg","page_title":"Костел Івана Хрестителя (Камаї)","context_page_description":"Костел святого Івана Хрестителя — римо-католицький храм у Камаях, зведений у 1606 році. Об'єкт Державного реєстру історико-культурних цінностей Республіки Білорусь."},{"page_url":"https://nl.wikipedia.org/wiki/Nationale_vogel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Ciconia_ciconia_1.jpg","page_title":"Nationale vogel","context_page_description":"Een nationale vogel is een vogel die traditioneel of anderszins wordt gebruikt om een natie te symboliseren of representeren. Ook staten binnen een natie, zoals de staten die deel uitmaken van de Verenigde Staten van Amerika, worden vaak gerepresenteerd door een vogel.\\nDe status van nationale vogel kan zowel officieel als officieus zijn. Een voorbeeld van het laatste is de haan, die Frankrijk traditioneel symboliseert maar geen officiële status heeft.\\nEr zijn nationale vogels die symbool staan voor diverse landen. De Afrikaanse zeearend is de nationale vogel van zeker drie Afrikaanse landen: Namibië, Zambia en Zimbabwe.\\nDe meeste landen hebben een nationale vogel. Indien een land geen nationale vogel heeft, wordt soms een officieuze stemming uitgeschreven om er een te kiezen. In 2015 werd de roodborst na een door de Britse vogelkundige David Lindo georganiseerde stemming gekozen als nationale vogel van het Verenigd Koninkrijk. In hetzelfde jaar werd de grutto verkozen als nationale vogel van Nederland in een door de VARA en de Vogelbescherming georganiseerde wedstrijd."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BD%D0%BD%D0%B0_%D0%A4%D1%80%D0%B5%D0%B1%D0%B5%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Anna_Frebel_at_Night_of_Science_2018_%282%29_%28cropped%29.jpg","page_title":"Анна Фребель","context_page_description":"Анна Фребель — німецький астроном, яка працює над вивченням і виявленням найстаріших зірок."},{"page_url":"https://nl.wikipedia.org/wiki/FC_Twente_in_het_seizoen_2009/10_(vrouwen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/VanBrummelen.jpg","page_title":"FC Twente in het seizoen 2009/10 (vrouwen)","context_page_description":"Het seizoen 2009/2010 was het 3e jaar in het bestaan van de vrouwentak van de voetbalclub FC Twente. De Tukkers kwamen uit in de Nederlandse Eredivisie en namen deel aan het toernooi om de KNVB beker, waarin het in de halve finales door Ter Leede werd uitgeschakeld."},{"page_url":"https://sh.wikipedia.org/wiki/Sr%C4%91an_Srdi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Sr%C4%91an_Srdi%C4%87_u_Mikro-naselju%2C_septembar_2017.jpg","page_title":"Srđan Srdić","context_page_description":"Srđan Srdić je srpski romanopisac, autor kratkih priča, esejista, urednik, izdavač i predavač kreativnog pisanja. Objavio je tri romana, dve zbirke priča i knjigu eseja, a kao autor ili urednik objavljivao je tekstove u nekoliko antologija kratkih priča i mnogobrojnim književnim časopisima."},{"page_url":"https://it.wikipedia.org/wiki/Cologno_Monzese","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Cologno_Monzese_piazza.jpg","page_title":"Cologno Monzese","context_page_description":"Cologno Monzese è un comune italiano di 48 030 abitanti della città metropolitana di Milano in Lombardia. Dal febbraio 2017, il comune fa parte della zona Adda-Martesana."},{"page_url":"https://es.wikipedia.org/wiki/Esbareich","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Esbareich_mairie.jpg","page_title":"Esbareich","context_page_description":"Esbareich es una población y comuna francesa, situada en la región de Mediodía-Pirineos, departamento de Altos Pirineos, en el distrito de Bagnères-de-Bigorre y cantón de Mauléon-Barousse."},{"page_url":"https://en.wikipedia.org/wiki/Reflection_(mathematics)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Simx2%3Dtransl_OK.svg","page_title":"Reflection (mathematics)","context_page_description":"In mathematics, a reflection is a mapping from a Euclidean space to itself that is an isometry with a hyperplane as a set of fixed points; this set is called the axis or plane of reflection. The image of a figure by a reflection is its mirror image in the axis or plane of reflection. For example the mirror image of the small Latin letter p for a reflection with respect to a vertical axis would look like q. Its image by reflection in a horizontal axis would look like b. A reflection is an involution: when applied twice in succession, every point returns to its original location, and every geometrical object is restored to its original state.\\nThe term reflection is sometimes used for a larger class of mappings from a Euclidean space to itself, namely the non-identity isometries that are involutions. Such isometries have a set of fixed points that is an affine subspace, but is possibly smaller than a hyperplane. For instance a reflection through a point is an involutive isometry with just one fixed point; the image of the letter p under it\\nwould look like a d. This operation is also known as a central inversion, and exhibits Euclidean space as a symmetric space."},{"page_url":"https://de.wikipedia.org/wiki/Touques_(Calvados)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Tqstthom01.jpg","page_title":"Touques (Calvados)","context_page_description":"Touques ist eine Gemeinde im französischen Département Calvados in der Region Normandie mit 3719 Einwohnern. Durch die Gemeinde fließt der Fluss Touques. Benachbarte Gemeinden sind Trouville-sur-Mer und Deauville.\\nIn Touques befindet sich das Pferdegestüt Haras de Meautry der Familie Rothschild."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D9%8A%D9%85%D9%8A%D8%AF%D8%A7%D8%B2%D9%88%D9%84%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Imidazolines.svg","page_title":"إيميدازولين","context_page_description":"إيميدازولين هو مركب عضوي حلقي غير متجانس وغير مشبع له الصيغة الكيميائية C₃H₆N₂. يتألف المركب بنيوياً من حلقة خماسية حاوية على ذرتي نتروجين غير متجاورتين؛ بالإضافة إلى وجود رابطة مضاعفة واحدة؛ ويطلق على مشتقاته اسم إيميدازولينات، وهي تنتمي إلى مجموعة البيرولينات.\\nتنتج هذه المركبات من تفاعل هدرجة واحدة من الرابطتين المضاعفتين لمركب إيميدازول."},{"page_url":"https://oc.wikipedia.org/wiki/Boda","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Sakyamuni_cuts_his_hair%2C_Tang_Dynasty.jpg","page_title":"Boda","context_page_description":"Siddharta Gautama foguèt un mèstre espiritual de la region nòrd èst del soscontinent indian qu'ensenhèt çò qu'es a l'origina del bodisme. Dins la majoritat de las tradicions bodistas, es considerat coma lo \\"Boda Suprèm\\" de nòstra epòca. Las datas de sa naissença e de sa mòrt son incertanas: la majoritat dels primièrs istorians del sègle XX datavan sa vida entre 563 ab. C e 483 ab. C mas mai recentament, en un collòqui d'especialistas d'aquela question, « los especialistas son totjorn mas reticents afirmar sens resèrvas sus los faches istorics de la vida del Boda e de sos ensenhaments ».\\nGautama, conegut tanben coma Śakyamuni, es la figura clau del bodisme, e las istòrias sus sa vida, los discorsses e las règlas monasticas forman part de las cresenças dels bodistas. Divèrses recuèlhs dels ensenhaments atribuits a Gautama se transmetèron per tradicion orala e lo primièr escrich data de 400 ans après."},{"page_url":"https://gl.wikipedia.org/wiki/Oficina_Filat%C3%A9lica_e_Numism%C3%A1tica_da_Cidade_do_Vaticano","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Museo_filatelico_e_numismatico_nei_musei_vaticani_00.JPG","page_title":"Oficina Filatélica e Numismática da Cidade do Vaticano","context_page_description":"A Oficina Filatélica e Numismática da Cidade do Vaticano é a entidade responsable da emisión dos selos postais e das moedas da Cidade do Vaticano."},{"page_url":"https://hu.wikipedia.org/wiki/Balony","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Balony53.JPG","page_title":"Balony","context_page_description":"Balony község Szlovákiában, a Nagyszombati kerület Dunaszerdahelyi járásában."},{"page_url":"https://en.wikipedia.org/wiki/Rural_Municipality_of_Rosedale_No._283","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/SK_RM_283_Rosedale.svg","page_title":"Rural Municipality of Rosedale No. 283","context_page_description":"The Rural Municipality of Rosedale No. 283 is a rural municipality in the Canadian province of Saskatchewan within Census Division No. 11 and SARM Division No. 5. It is located in the central portion of the province along Highway 11 between Saskatoon and Regina."},{"page_url":"https://fi.wikipedia.org/wiki/%C5%BDodzina","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/BELAZ_truck_zhodino.jpg","page_title":"Žodzina","context_page_description":"Žodzina eli Žodino on keskikokoinen Valko-Venäjän teollisuuskaupunki, joka sijaitsee Minskin alueella, maanteitse vain 57 kilometriä Minskin keskustasta koilliseen. Žodzinaa voi pitää yhtenä miljoonakaupunki Minskin esikaupungeista. Žodzinan pinta-ala on 19 km² ja asukasluku 61 724. Žodzina on Valko-Venäjän kaupungeista uusimpia, se sai kaupunkioikeudet 1963. Hallinollisesti Žodzina on suoraan Minskin alueen keskushallinnon alainen kaupunki, vaikka maantieteellisesti se sijaitsee Smaljavitšyn piirin sisällä.\\nŽodzinan työnantajiin kuuluu on raskaiden maansiirtokoneiden ja kaivoskoneiden valmistaja BelAZ, jolla on noin 11 000 työntekijää. Toinen tärkeä teollisuuslaitos on vaatevalmistaja \\"SVITANAK\\".\\nŽodzinassa on ammattikorkeakoulu muttei korkeampia oppilaitoksia. Kaksi Valko-Venäjän maatalouden tutkimuskeskuksesta toimii kaupungissa.\\nLiikenneyhteyksistä tärkeimpiin kuuluu kantatie P53, jota pitkin Minskin keskustaan on 57 ja Barysaun keskustaan 18 kilometrin matka. Valko-Venäjän suurin valtatie – moottoritie M1 eli eurooppatie E30 – kulkee 11 km Žodzinan keskustan eteläpuolitse tuoden yhteyden niin Moskovaan kuin Varsovankin suuntaan."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%80%E3%82%A4%E3%83%90%E3%83%BC%E3%82%B7%E3%83%86%E3%82%A3%E6%9D%B1%E4%BA%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Divercity-3.JPG","page_title":"ダイバーシティ東京","context_page_description":"ダイバーシティ東京は、東京都江東区青海にある複合商業施設およびオフィスビル。三井不動産商業マネジメントが運営・管理する「ダイバーシティ東京 プラザ」とサンケイビルが運営・管理する「ダイバーシティ東京 オフィスタワー」で構成されている。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%A6%D7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Le_Destroit_-_WLM_2015_by_ovedc_90.jpg","page_title":"חצב","context_page_description":"הֶחָצָב הוא סוג במשפחת האספרגיים. הסוג כולל כ-100 מינים אפריקניים וים-תיכוניים."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%8E%D0%B2%D1%96%D0%BB%D0%B5%D0%B9%D0%BD%D0%B8%D1%85_%D1%82%D0%B0_%D0%BF%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D1%85_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_%D0%B7_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%BE%D1%86%D1%96%D0%BD%D0%BD%D0%B8%D1%85_%D0%BC%D0%B5%D1%82%D0%B0%D0%BB%D1%96%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/%D0%9A%D0%BE%D0%B7%D0%B0%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D1%87%D0%BE%D0%B2%D0%B5%D0%BD_%D0%B0%D0%B2%D0%B5%D1%80%D1%81.jpeg","page_title":"Список ювілейних та пам'ятних монет України з дорогоцінних металів","context_page_description":"Спи́сок ювіле́йних та па́м'ятних моне́т Украї́ни з дорогоці́нних мета́лів — це список пам'ятних та ювілейних монет, випущених Національним банком України, за матеріалом виготовлення які є срібними, золотими або біметалевими з срібла й золота. Всього ювілейних та пам'ятних монет за час незалежності України станом на 19 березня 2020 року було випущено 848. З них 381 з дорогоцінних металів. Ювілейні і пам'ятні монети почали випускатися Національним банком з 1995 року, з 848 монет — 21 монета номінована в карбованцях і 827 у гривнях.\\nНижче наведена класифікація дорогоцінних монет за металом та датою випуску."},{"page_url":"https://cs.wikipedia.org/wiki/U_Va%C5%88k%C5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/P%C5%99%C3%ADrodn%C3%AD_pam%C3%A1tka_U_Va%C5%88k%C5%AF_%2801%29.jpg","page_title":"U Vaňků","context_page_description":"U Vaňků je přírodní památka ev. č. 2036 západně od obce Bystřička v okrese Vsetín. Oblast spravuje Agentura ochrany přírody a krajiny ČR.\\nDůvodem ochrany je listnatý les s přirozenou skladbou dřevin a přilehlé louky s bohatou populací ladoňky karpatské."},{"page_url":"https://pt.wikipedia.org/wiki/Merlines","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Viaduc-du-chavanon.jpg","page_title":"Merlines","context_page_description":"Merlines é uma comuna francesa na região administrativa da Nova Aquitânia, no departamento de Corrèze. Estende-se por uma área de 14,07 km². Em 2010 a comuna tinha 803 habitantes."},{"page_url":"https://en.wikipedia.org/wiki/Germ_layer","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Endoderm2.png","page_title":"Germ layer","context_page_description":"A germ layer is a primary layer of cells that forms during embryonic development. The three germ layers in vertebrates are particularly pronounced; however, all eumetazoans produce two or three primary germ layers. Some animals, like cnidarians, produce two germ layers making them diploblastic. Other animals such as chordates produce a third layer between these two layers, making them triploblastic. Germ layers eventually give rise to all of an animal’s tissues and organs through the process of organogenesis."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%B2%D1%83%D1%88%D0%B8%D0%BD,_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/%D0%A0%D0%B5%D0%BA%D1%82%D0%BE%D1%80_%D0%9D%D0%93%D0%A3%D0%AD%D0%A3_1.jpg","page_title":"Первушин, Виктор Александрович","context_page_description":"Виктор Александрович Первушин — доктор экономических наук, профессор, организатор и первый ректор Новосибирского института народного хозяйства."},{"page_url":"https://en.wikipedia.org/wiki/Minimum_bounding_box_algorithms","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Tetraeder_animation_with_cube.gif","page_title":"Minimum bounding box algorithms","context_page_description":"In computational geometry, the smallest enclosing box problem is that of finding the oriented minimum bounding box enclosing a set of points. It is a type of bounding volume. \\"Smallest\\" may refer to volume, area, perimeter, etc. of the box.\\nIt is sufficient to find the smallest enclosing box for the convex hull of the objects in question. It is straightforward to find the smallest enclosing box that has sides parallel to the coordinate axes; the difficult part of the problem is to determine the orientation of the box."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B8%E0%A4%BF%E0%A4%82%E0%A4%A7%E0%A5%81_%E0%A4%9C%E0%A4%B2_%E0%A4%B8%E0%A4%AE%E0%A4%9D%E0%A5%8C%E0%A4%A4%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Indus.A2002274.0610.1km.jpg","page_title":"सिंधु जल समझौता","context_page_description":"सिन्धु जल संधि, नदियों के जल के वितरण लिए भारत और पाकिस्तान के बीच हुई एक संधि है। इस सन्धि में विश्व बैंक ने मध्यस्थता की। इस संधि पर कराची में 19 सितंबर, 1960 को भारत के प्रधानमंत्री जवाहरलाल नेहरू और पाकिस्तान के राष्ट्रपति अयूब खान ने हस्ताक्षर किए थे।\\nइस समझौते के अनुसार, तीन \\"पूर्वी\\" नदियों — ब्यास, रावी और सतलुज — का नियंत्रण भारत को, तथा तीन \\"पश्चिमी\\" नदियों — सिंधु, चिनाब और झेलम — का नियंत्रण पाकिस्तान को दिया गया। हालाँकि अधिक विवादास्पद वे प्रावधान थे जनके अनुसार जल का वितरण किस प्रकार किया जाएगा, यह निश्चित होना था। क्योंकि पाकिस्तान के नियंत्रण वाली नदियों का प्रवाह पहले भारत से होकर आता है, संधि के अनुसार भारत को उनका उपयोग सिंचाई, परिवहन और बिजली उत्पादन हेतु करने की अनुमति है। इस दौरान इन नदियों पर भारत द्वारा परियोजनाओं के निर्माण के लिए सटीक नियम निश्चित किए गए। यह संधि पाकिस्तान के डर का परिणाम थी कि नदियों का आधार भारत में होने के कारण कहीं युद्ध आदि की स्थिति में उसे सूखे और अकाल आदि का सामना न करना पड़े।\\n1960 में हुए सिंधु जल समझौते के बाद से भारत और पाकिस्तान में कश्मीर मुद्दे को लेकर तनाव बना हुआ है। हर प्रकार के असहमति और विवादों का निपटारा संधि के ढांचे के भीतर प्रदत्त कानूनी प्रक्रियाओं के माध्यम से किया गया है।"},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%97%E0%B1%8D%E0%B0%B0%E0%B1%80%E0%B0%B8%E0%B1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/MacedonEmpire.jpg","page_title":"గ్రీస్","context_page_description":"గ్రీస్ హెలెస్ అనికూడా అంటారు. ఆగ్నేయ ఐరోపాలోని ఒక దేశం. గ్రీస్ ఐరోపా, ఆసియా, ఆఫ్రికా కూడలి వద్ద ఉంది. బాల్కన్ ద్వీపకల్పం దక్షిణ కొనలో ఉంది. వాయవ్య సరిహద్దులో అల్బేనియా భూభాగ సరిహద్దులను, ఉత్తర సరిహద్దులో \\" రిపబ్లిక్ ఆఫ్ మాసిడోనియా \\", బల్గేరియా, ఈశాన్య సరిహద్దులో టర్కీ ఉన్నాయి. ప్రధాన భూభాగానికి తూర్పు సరిహద్దులో ఎజియన్ సముద్రం, పశ్చిమ సరిహద్దులో అయోనియన్ సముద్రం పశ్చిమాన ఉన్నాయి. దక్షిణసరిహద్దులో క్రెటెన్ సముద్రం, మధ్యధరా సముద్రం. 13,676 km పొడవుతో, మధ్యధరా సముద్ర తీరం, గ్రీసు సముద్ర తీరప్రాంతం ప్రపంచంలోని పొడవైన సముద్ర తీరప్రాంతాలలో 11వ స్థానంలో ఉంది. ఇందులో పెద్ద సంఖ్యలో ద్వీపాలు ఉన్నాయి. వాటిలో 227 మానవ నివాసిత ప్రాంతాలుగా ఉన్నాయి. గ్రీస్‌లో 80% శాతం గ్రీస్ పర్వతము, మౌంట్ ఒలింపస్ 2,918 మీటర్లు ఎత్తైన శిఖరం ఉన్నాయి. దేశంలో తొమ్మిది భౌగోళిక ప్రాంతాలు ఉన్నాయి: మేసిడోనియా, సెంట్రల్ గ్రీస్, పెలోపొన్నీస్, తెస్సాలి, ఎపిరస్, ది ఏజియన్ దీవులు, థ్రేస్, క్రీట్, ఐయోనియన్ ద్వీపాలు.\\nగ్రీస్ పాశ్చాత్యనాగరికత విలసిల్లిన ప్రాంతంగా భావించబడుతుంది.\\nపాశ్చాత్య తత్వశాస్త్రం, ఒలింపిక్ గేమ్స్, వెస్ట్రన్ లిటరేచర్, హిస్టరీగ్రఫీ, పొలిటికల్ సైన్స్, మేజర్ సైంటిఫిక్ అండ్ మ్యాథమెటికల్ సూత్రాలు, పాశ్చాత్య నాటకం వంటివి జన్మస్థలంగా పాశ్చాత్య నాగరికత, గ్రంథంగా గ్రీస్ పరిగణించబడుతుంది. క్రీ."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B8%D0%BD%D0%BE%D1%81%D1%8A%D1%91%D0%BC%D0%BE%D1%87%D0%BD%D1%8B%D0%B9_%D0%B0%D0%BF%D0%BF%D0%B0%D1%80%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Path%C3%A9-Baby_hand_movie_camera_%28right%29.jpg","page_title":"Киносъёмочный аппарат","context_page_description":"Киносъёмочный аппара́т, киносъёмочная ка́мера, кинока́мера — устройство, предназначенное для записи движущегося изображения на киноплёнку. Процесс записи называется киносъёмкой, а полученное в результате изображение используется для создания кинофильма. В процессе киносъёмки при помощи объектива на светочувствительной киноплёнке последовательно фиксируются фотографические изображения отдельных фаз движения объекта съёмки с частотой, превышающей порог человеческого восприятия. В результате при воспроизведении полученного фильма зрители воспринимают последовательность неподвижных изображений как одно непрерывно движущееся. Стандартная частота киносъёмки звукового кинематографа во всём мире составляет 24 кадра в секунду.\\nДо изобретения видеомагнитофона в 1957 году киносъёмочные аппараты были единственным средством фиксации движущегося изображения, и кроме постановочного и документального кино использовались для научных исследований и на телевидении, в том числе для записи телепрограмм."},{"page_url":"https://en.wikipedia.org/wiki/Satyadev_Kancharana","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Satyadev-Mana-oori-ramayanam-audio-launch.jpg","page_title":"Satyadev Kancharana","context_page_description":"Satyadev Kancharana, known professionally as Satya Dev, is an Indian actor who primarily works in Telugu cinema. Starting with supporting roles, Satyadev established himself as a leading actor. He is known for his performances in Jyothi Lakshmi, Kshanam, Mana Oori Ramayanam, Bluff Master, Brochevarevarura and Uma Maheswara Ugra Roopasya."},{"page_url":"https://de.wikipedia.org/wiki/St._Leodegar_im_Hof","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Vorzeichen_S%C3%BCdseite_IMG_1380.jpg","page_title":"St. Leodegar im Hof","context_page_description":"Die Hofkirche St. Leodegar ist eines der Wahrzeichen der Stadt Luzern in der Schweiz. Die Hofkirche ist die Hauptkirche der römisch-katholischen Pfarrei St. Leodegar im Hof, einer der acht katholischen Stadtpfarreien Luzerns und sie ist zugleich die Stiftskirche des Kollegiat-Stifts St. Leodegar. Die Hofkirche wurde von 1633 bis 1639 teilweise auf den Fundamenten der 1633 abgebrannten romanischen Basilika gebaut und ist eine der wenigen Kirchen, die während des Dreissigjährigen Kriegs nördlich der Alpen gebaut wurden und eine der grössten und kunsthistorisch wertvollsten Kirchen der deutschen Spätrenaissance."},{"page_url":"https://de.wikipedia.org/wiki/Bickenbach_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Schlo%C3%9F_Alsbach_2006-12-26_16-51-26.jpg","page_title":"Bickenbach (Adelsgeschlecht)","context_page_description":"Die Familie von Bickenbach war ein mitteldeutsches Rittergeschlecht mit Besitzungen in den fränkischen Ritterkantonen Odenwald und Steigerwald."},{"page_url":"https://es.wikipedia.org/wiki/Karl_Krumbacher","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Karl_Krumbacher.jpg","page_title":"Karl Krumbacher","context_page_description":"Karl Krumbacher fue un erudito alemán, ​ un experto en la lengua, literatura, historia y cultura griegas bizantinas. Fue uno de los principales fundadores del estudio bizantino como disciplina académica independiente en las universidades modernas.​​​\\nNació en Kürnach im Allgäu en el Reino de Baviera. Estudió filología clásica y lingüística indoeuropea en las Universidades de Múnich y Leipzig.​ En 1879 aprobó el Examen Estatal y fue a partir de entonces que estuvo activo como profesor de escuela secundaria hasta 1891.​ En 1883 obtuvo su doctorado y en 1885 su habilitación en filología griega medieval y moderna. Desde 1897 fue profesor de Historia y Literatura en griego medieval y moderno en la Universidad de Múnich, ​ y titular de la cátedra de Estudios Bizantinos —de reciente creación—, ​ la primera cátedra en esta materia en el mundo. Fundó la Byzantinische Zeitschrift, la revista académica más antigua de Estudios Bizantinos, ​ y el Byzantinisches Archiv. Su colaborador en ese momento era Bozidar Prokić, el renombrado «bizantinista de Belgrado». Murió en Múnich en 1909. Su sucesor como profesor de Estudios Bizantinos fue August Heisenberg."},{"page_url":"https://en.wikipedia.org/wiki/108_Shiva_Temples","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Chirakkal_Mahadeva_Temple_Puliyanam_Top_View.JPG","page_title":"108 Shiva Temples","context_page_description":"This is a List of the 108 Shiva Temples mentioned in the Shivala Sotram."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%83%D9%88%D9%84%D9%8A%D9%85%D8%B3_%D8%A5%D8%B3%D8%A8%D8%A7%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Yellow_flower_with_critters.jpg","page_title":"سكوليمس إسباني","context_page_description":"السكوليمس الإسباني أو السنًارية الإسبانية نوع نباتي ينتمي إلى جنس السكوليمس من الفصيلة النجمية."},{"page_url":"https://de.wikipedia.org/wiki/Latrobe_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Australia-Map-VIC-LGA-Latrobe.png","page_title":"Latrobe City","context_page_description":"Latrobe City ist ein lokales Verwaltungsgebiet im australischen Bundesstaat Victoria, das gleichzeitig Stadtstatus besitzt. Das Gebiet ist 1425,6 km² groß und hat etwa 73.000 Einwohner.\\nLatrobe liegt etwa 150 km östlich der Hauptstadt Melbourne im Südosten von Victoria und umfasst sechs größere Ortschaften: Boolarra, Churchill, Yallourn North, Moe, Traralgon und Morwell. Der Sitz des City Councils befindet sich in Morwell im Zentrum von Latrobe.\\nLatrobe City liegt im Latrobe Valley, dem Zentrum des Braunkohleabbaus und der Energieerzeugung in Victoria. Die Kohlekraftwerke in Loy Yang, Hazelwood, Morwell und Yallourn gehören zu den größten Australiens. Allein Loy Yang deckt ein Drittel des Stromverbrauchs des Bundesstaats. Nachteil der Braunkohleverstromung ist allerdings der hohe CO₂-Ausstoß. Das Kraftwerk Hazelwood ist laut WWF das Kraftwerk, bei dem im Vergleich der Kraftwerke aller führenden Industrienationen der größte Anteil CO₂ anfällt. Hazelwood ist alleine für über 5 % der Emissionen des Treibhausgases von ganz Australien verantwortlich."},{"page_url":"https://de.wikipedia.org/wiki/Johannes_Remus_Quietanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Remus_Quietanus_Schreibkalender_1625.jpg","page_title":"Johannes Remus Quietanus","context_page_description":"Johann Rudrauf war ein deutscher Astronom, Astrologe, Arzt und Kalendermacher. Er korrespondierte mit Galileo Galilei, Johannes Kepler und Johannes Faber. Er war einer der vier ersten Beobachter eines Merkurtransits am 7. November 1631."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_kulturm%C3%A4rkta_bruksfartyg_i_Sverige","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Juno_Diana.JPG","page_title":"Lista över kulturmärkta bruksfartyg i Sverige","context_page_description":"Lista över kulturmärkta fartyg i Sverige är en lista över de drygt 130 bruksfartyg som har kulturmärkts av Statens Maritima Museer sedan 2001, till och med juni 2016.\\nDet senast k-märkta fartyget var M/S Soten i juni 2016."},{"page_url":"https://ca.wikipedia.org/wiki/Unveiling_a_parallel:_a_romance_(1893)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Unveilingparalle00jone_0005.jpg","page_title":"Unveiling a parallel: a romance (1893)","context_page_description":"Descobrint un món paral·lel: un romanç, novel·la de ciència-ficció publicada al 1893 per Dues dones d'Occident posteriorment identificades com les escriptores Alice Ilgenfritz Jones i Ella Merchant de Cedar Rapids, Iowa.\\nAlice Ilgenfritz Jones va publicar altres novel·les com: High Water Mark, Beatriz de Bayou Têche i El Cavaller de Sant Denis. També va escriure relats curts de ficció i obres d'assaig de viatges durant la seva carrera.\\nElla Merchant és una figura més desconeguda."},{"page_url":"https://en.wikipedia.org/wiki/Hypselodoris_saintvincentia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Hypselodoris_saintvincentia.jpg","page_title":"Hypselodoris saintvincentia","context_page_description":"Hypselodoris saintvincentia is a species of colourful sea slug or dorid nudibranch, a marine gastropod mollusk in the family Chromodorididae."},{"page_url":"https://de.wikipedia.org/wiki/Kanadische_Red_Ensign","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Flag_of_Ontario.svg","page_title":"Kanadische Red Ensign","context_page_description":"Die Kanadische Red Ensign war mit Unterbrechungen von 1868 bis 1965 die offizielle, aber niemals vom Parlament bestätigte Flagge Kanadas. Sie besteht aus dem klassischen Red Ensign mit einem Wappen Kanadas in der Mitte der rechten Hälfte."},{"page_url":"https://de.wikipedia.org/wiki/Karl_Christoph_von_Linsing","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Hameln_Dempterhaus_Fassade1-.JPG","page_title":"Karl Christoph von Linsing","context_page_description":"Karl Christoph von Linsing, zeitgenössisch und in Eigenschreibweise Christoph Carl von Linsing[en], war ein deutscher Offizier, zuletzt im Rang eines Generalleutnants im Dienste des Kurfürstentums Hannover."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E5%9B%BE%E9%87%8C%E5%90%95%E5%B0%94%E8%A5%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Map_commune_FR_insee_code_58293.png","page_title":"图里吕尔西","context_page_description":"圖里呂爾西是法國涅夫勒省的一個市鎮，位於該省南部，和阿列省接壤，屬於訥韋爾區。該市鎮總面積25.54平方公里，2009年時的人口為424人。"},{"page_url":"https://sk.wikipedia.org/wiki/Hod_o%C5%A1tepom","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Bregje_crolla_Europacup_2007.jpg","page_title":"Hod oštepom","context_page_description":"Hod oštepom je atletická disciplína, v ktorej sa hádže oštepom na vzdialenosť. Hod oštepom je disciplína pre mužský desaťboj a pre ženský sedemboj. Mužský oštep je dlhý od 260 do 270 centimetrov a má hmotnosť 800 gramov, ženský oštep je dlhý od 230 do 240 centimetrov a má hmotnosť 600 gramov. Aby hod platil, musí oštep letieť do kruhového výseku vymedzeného bielymi čiarami. Musí tiež dopadnúť hrotom vpred, nie je však nutné, aby sa zapichol do zeme."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D1%80%D0%BD%D0%B0_(%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Panorama_castelli_di_Arnad_1.JPG","page_title":"Арна (Италия)","context_page_description":"Арна̀ е село и община в Северна Италия, автономен регион Вале д'Аоста. Разположено е на 361 m надморска височина. Населението на общината е 1323 души."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AF%D8%A7%D8%A6%D8%B1%D8%A9_%D8%A7%D9%84%D8%AA%D8%A7%D8%B3%D8%B9%D8%A9_%D9%81%D9%8A_%D8%A8%D8%A7%D8%B1%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Facade_of_Op%C3%A9ra_Garnier%2C_France_2011.jpg","page_title":"الدائرة التاسعة في باريس","context_page_description":"الدائرة التاسعة في باريس هي واحدة من 20 دائرة في مدينة باريس الفرنسية."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%A0%E3%82%B9%E3%83%86%E3%83%AB%E3%83%80%E3%83%A0%E3%81%AE%E9%81%8B%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Amsterdam%2C_monumentale_panden_aan_Kloveniersburgwal_2007-03-26_14.21.JPG","page_title":"アムステルダムの運河","context_page_description":"この項目では、アムステルダムの運河について扱う。「北のヴェネツィア」と呼ばれる都市の一つでもある、オランダの憲法上の首都アムステルダムは、100km 以上の運河と約90の島々、そして1500もの橋から成り立っている。\\n3つの主要な運河であるヘーレン運河 、プリンセン運河 、ケイザー運河 は、いずれもオランダが黄金時代を迎えていた17世紀に掘られたもので、都市の周りを同心円状に巡っている。それらは「グラクテンゴルデル」として知られ、主要な運河沿いには実に1550もの記念建造物群が存在している。ヘーレン運河、プリンセン運河、ケイザー運河、ヨルダーン地区などを含む17世紀の環状運河地区は、2010年にUNESCOの世界遺産リストに登録された。"},{"page_url":"https://pl.wikipedia.org/wiki/Jurklo%C5%A1ter","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Kartuzija_Jurklo%C5%A1ter_%284%29.jpg","page_title":"Jurklošter","context_page_description":"Jurklošter – wieś w Słowenii, w gminie Laško. W 2018 roku liczyła 70 mieszkańców."},{"page_url":"https://ur.wikipedia.org/wiki/%DA%88%DB%8C_%D8%A8%DB%8C%DA%A9%D8%A7_%DA%A9%D8%A7%D8%A4%D9%86%D9%B9%DB%8C%D8%8C_%D9%86%DB%8C%D9%88_%D9%85%DB%8C%DA%A9%D8%B3%DB%8C%DA%A9%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/De_Baca_County_Court_House.jpg","page_title":"ڈی بیکا کاؤنٹی، نیو میکسیکو","context_page_description":"ڈی بیکا کاؤنٹی، نیو میکسیکو ریاستہائے متحدہ امریکا کا ایک کاؤنٹی جو نیو میکسیکو میں واقع ہے۔"},{"page_url":"https://nl.wikipedia.org/wiki/Bayerische_Oberlandbahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/BOB_720%2B725.JPG","page_title":"Bayerische Oberlandbahn","context_page_description":"De Bayerische Oberlandbahn GmbH is een private spoorwegonderneming, gevestigd in Holzkirchen. BOB is een dochter van Transdev GmbH die tot 2006 Connex Verkehr GmbH heette en tot 16 maart 2015 Veolia Verkehr GmbH.\\nDe lijnen die BOB bedient, verbindt München met de in de Beierse Alpen gelegen eindstations Bayrischzell, Lenggries en Tegernsee. Doordat de spoorlijnen ten zuiden van Holzkirchen niet geëlektrificeerd zijn, wordt het netwerk geëxploiteerd met dieseltreinstellen. Sinds 15 december 2013 exploiteert de Bayerische Oberlandbahn onder de naam Meridian de concessie E-Netz Rosenheim tussen München, Salzburg en Kufstein. Daarnaast heeft BOB ook een onderhoudsbedrijf in Lenggries voor het onderhoud van de eigen treinen. Bij de start van Meridian kwamen er twee onderhoudsbedrijven in Regensburg en Freilassing daarbij."},{"page_url":"https://fr.wikipedia.org/wiki/Route_d%C3%A9partementale_306_(Essonne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Route_d%C3%A9partementale_306_%28Essonne%29_01.jpg","page_title":"Route départementale 306 (Essonne)","context_page_description":"La route départementale 306 est une route départementale située dans le département français de l'Essonne et dont l'importance est aujourd'hui restreinte à la circulation routière locale. Elle constitue le trajet essonnien de l'ancienne route nationale 306 entre Saclay et Gif-sur-Yvette."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D8%A7%D8%B2_%D8%B3%D9%81%D8%B1_%D8%A5%D9%8A%D8%B1%D8%A7%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Gozarname10.jpg","page_title":"جواز سفر إيراني","context_page_description":"جواز السفر الإيراني يتم إصداره للمواطنين الإيرانيين بغرض الرحلات الدولية. جواز السفر هو بمثابة إثبات على الجنسية الإيرانية.\\nجواز السفر الإيراني عنابي اللون عليه شعار إيران في الأعلى. مكتوب عليه بالفارسية:\\" جمهوری اسلامی ایران\\" وتعني باللغة العربية: جمهورية إيران الإسلامية."},{"page_url":"https://fr.wikipedia.org/wiki/Fontaine_(Laval,_place_des_Quatre-Docteurs-Bucquet)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Fontaine_de_la_place_des_Quatre-Docteurs-Bucquet.JPG","page_title":"Fontaine (Laval, place des Quatre-Docteurs-Bucquet)","context_page_description":"La fontaine de Patience est une fontaine située à Laval, dans le département de la Mayenne."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Cambridgeshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/CottenhamChurch-November2003-014.jpg","page_title":"Grade I listed buildings in Cambridgeshire","context_page_description":"There are approximately 372,905 listed buildings in England and 2.5% of these are Grade I. This page is a list of these buildings in the county of Cambridgeshire, by district."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Vieux-Turnhout","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Oud-Turnhout_-_Sint-Antonius_Abtkerk.jpg","page_title":"Liste des monuments historiques de Vieux-Turnhout","context_page_description":"Cette page regroupe l'ensemble des monuments classés de la ville belge de Vieux-Turnhout."},{"page_url":"https://sv.wikipedia.org/wiki/Smilacaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Sarsaparillae2.JPG","page_title":"Smilacaceae","context_page_description":"Smilacaceae är en familj av enhjärtbladiga växter. Smilacaceae ingår i ordningen liljeordningen, klassen enhjärtbladiga blomväxter, fylumet kärlväxter och riket växter. Enligt Catalogue of Life omfattar familjen Smilacaceae 256 arter.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/Osmundastrum","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Cinnamon_Fern_Osmunda_cinnamomea_Closeup_3008px.JPG","page_title":"Osmundastrum","context_page_description":"Osmundastrum is genus of leptosporangiate ferns in the family Osmundaceae with one accepted species, Osmundastrum cinnamomeum, the cinnamon fern. It is native to the Americas and eastern Asia, growing in swamps, bogs and moist woodlands.\\nIn North America it occurs from southern Labrador west to Ontario, and south through the eastern United States to eastern Mexico and the West Indies; in South America it occurs west to Peru and south to Paraguay. In Asia it occurs from southeastern Siberia south through Japan, Korea, China and Taiwan to Myanmar, Thailand and Vietnam."},{"page_url":"https://es.wikipedia.org/wiki/Dynamo_(productora)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Trademark_Dynamo.png","page_title":"Dynamo (productora)","context_page_description":"Dynamo Producciones es una casa productora Colombiana con presencia física y operativa en Bogotá, Madrid, México y Nueva York. Ha participado en la producción de más de 56 proyectos audiovisuales, dentro de los cuales destacan prestar los servicios de producción de la serie de Netflix Narcos y la producción de la primera serie original en Colombia para la misma plataforma Distrito Salvaje."},{"page_url":"https://fi.wikipedia.org/wiki/Punarintakukastaja","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Naturalis_Biodiversity_Center_-_RMNH.AVES.132171_1_-_Dicaeum_pectorale_pectorale_S._Muller%2C_1843_-_Dicaeidae_-_bird_skin_specimen.jpeg","page_title":"Punarintakukastaja","context_page_description":"Punarintakukastaja on kukastajien heimoon kuuluva varpuslintu."},{"page_url":"https://fr.wikipedia.org/wiki/Ta%C8%99ca","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Tasca_judetul_Neamt.jpg","page_title":"Tașca","context_page_description":"Tașca est une commune roumaine du județ de Neamț, dans la région historique de Moldavie et dans la région de développement du Nord-Est."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BC%D0%B0%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Simmaco_-_mosaico_Santa_Agnese_fuori_le_mura.jpg","page_title":"Симах","context_page_description":"Святий Симах — п'ятдесят перший папа Римський, народився на Сардинії в родині Фортуната. Того ж дня, що й Симах меншістю, яка симпатизувала візантійській церкві, був обраний папою Лаврентій, настоятель церкви Санта Прасседе у Римі. Обрання Лаврентія підтримував імператор Східної Римської імперії Анастасій I, прихильником Симаха король готів Теодоріх Великий.\\nУ 501 році прихильник Лаврентія сенатор Фестус звинуватив папу Симаха у співжительстві з жінкою. Синод, скликаний Теодоріхом, прийняв рішення, згідно з яким папа не підлягає суду людей, але є відповідальним лише перед Божим судом."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_Mexikos_presidenter","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Jos%C3%A9_Mariano_Salas.jpg","page_title":"Lista över Mexikos presidenter","context_page_description":"Mexikos president är landets stats- och regeringschef.\\nMexiko har varit en republik under huvuddelen av sin historia som en suverän stat, med undantag av åren 1822 till 1823 samt från 1864 till 1867."},{"page_url":"https://fr.wikipedia.org/wiki/Col_du_Galibier","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Col_du_Galibier_-566.jpg","page_title":"Col du Galibier","context_page_description":"Le col du Galibier est un col routier des Alpes françaises situé à 2 642 m d'altitude entre les départements de la Savoie au nord et des Hautes-Alpes au sud. Il relie ainsi Saint-Michel-de-Maurienne via le col du Télégraphe, à Briançon et La Grave via le col du Lautaret. Il marque ainsi la limite entre les Alpes du Nord et les Alpes du Sud françaises. Ce col est fermé à la circulation l'hiver et la route ouvre pour la période estivale habituellement vers la fin mai ou au début du mois de juin, après son déneigement.\\nSitué entre le massif des Arves et le massif des Cerces, en particulier le chaînon du Galibier, il est le cinquième plus haut col routier des Alpes françaises, après le col de l'Iseran, le col Agnel, le col de la Bonette et le col de Restefond."},{"page_url":"https://en.wikipedia.org/wiki/Greater_Gabbard_wind_farm","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Harwich_Greater_Gabbard_Siemens_windturbine_nacelles2.JPG","page_title":"Greater Gabbard wind farm","context_page_description":"Greater Gabbard is a 504 MW wind farm on sandbanks 23 kilometres off the coast of Suffolk in England at a cost of £1.5 billion. Onshore construction activities commenced in early July 2008 at Sizewell. It was completed on 7 September 2012 with all of the Siemens SWT3.6–107 turbines connected.\\nA 336 MW extension of the project called Galloper Wind Farm was commissioned in April 2018."},{"page_url":"https://eu.wikipedia.org/wiki/Tutleky","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Tutleky_-_obecn%C3%AD_%C3%BA%C5%99ad.jpg","page_title":"Tutleky","context_page_description":"Tutleky Txekiar Errepublikako udalerri bat da. 352 biztanle ditu eta 5,55 kilometro koadroko azalera. Rychnov nad Kněžnouko barrutian dago."},{"page_url":"https://de.wikipedia.org/wiki/Pony-Car","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Salon_de_l%27auto_de_Gen%C3%A8ve_2014_-_20140305_-_Ford_20.jpg","page_title":"Pony-Car","context_page_description":"Unter Pony Cars versteht man eine Gattung amerikanischer Automobile. Diese Fahrzeuge sind für damalige US-Verhältnisse eher kleine Coupés und Cabrios mit großen 6- oder 8-Zylinder-Motoren. Die Bezeichnung geht auf den 1964 als zweites Auto dieser Art eingeführten Ford Mustang zurück. Das erste Auto dieser Art war der Plymouth Barracuda, den Chrysler zwei Wochen vor dem Ford vorstellte. Der Name „Pony Car“ leitet sich vom Kühlergrill-Logo des Ford Mustang ab, das ein galoppierendes Pferd zeigt. Das wesentliche Designmerkmal wurde mit „long hood, short deck“ umschrieben, also einer langen Motorhaube und einem kurzen Heck.\\nDie Fahrzeuge waren relativ günstig in der Anschaffung und richteten sich so vor allem an junge Kunden. Analog zu dem parallel existierenden Trend der Muscle Cars gab es die Fahrzeuge mit extrem hohen Motorleistungen von teilweise mehr als 400 PS. Die meisten Pony Cars wurden bereits Mitte der 1970er mit dem Ende der Muscle-Car-Ära wieder eingestellt. Einzig einen Ford Mustang gab es durchgehend bis in jüngste Zeit."},{"page_url":"https://fr.wikipedia.org/wiki/Chemin_de_fer_transcaucasien","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/%D0%A1%D1%85%D0%B5%D0%BC%D0%B0_%D0%97%D0%B0%D0%BA%D0%B0%D0%B2%D0%BA%D0%B0%D0%B7%D1%81%D0%BA%D0%BE%D0%B9_%D0%B6%D0%B4.jpg","page_title":"Chemin de fer transcaucasien","context_page_description":"Le chemin de fer transcaucasien est une ligne ferroviaire construite sous l'Empire russe à partir de 1865. Elle reliait Poti, en Géorgie actuelle, à Bakou, en Azerbaïdjan. En 1922, elle devient une partie des chemins de fer soviétiques. Elle est fermée lors de l'éclatement de l'Union soviétique en 1991. Sa réouverture, en projet depuis les années 2010, est réalisée en octobre 2017 sous la forme de la ligne Bakou-Tbilissi-Kars avec la participation de la Turquie."},{"page_url":"https://ca.wikipedia.org/wiki/Antonio_Maria_Bononcini","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Antonio_Maria_Bononcini.jpg","page_title":"Antonio Maria Bononcini","context_page_description":"Antonio Maria Bononcini, va ser un compositor italià nascut i mort a Modena. Era germà de Giovanni, que també va ser considerat un músic distingit en la seva època.\\nEstrenà amb èxit algunes òperes, entre elles:\\nLa regina creduta\\nRe\\nArminio\\nTigrane, re d'Armenia\\nGriselda\\nCajo Gracco\\nTumo Aricino\\nAstianatte\\nEteocle\\nTambé és autor d'una cantata per a Nadal i un oratori titulat La decollazione di S. Gianbattista."},{"page_url":"https://la.wikipedia.org/wiki/Epigonatium","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Meister_der_Aphentico-Kirche_in_Mistra_001.jpg","page_title":"Epigonatium","context_page_description":"Nulla Vicipaediae Latinae pagina huc annectitur.\\nQuaesumus in alias commentationes addas nexus ad hanc paginam relatos. Quo facto hanc formulam delere licet.\\n→ Interpretationes vernaculae\\nEpigonatium est vestimentum liturgicum in Ecclesia Orientali. Formam quadratam exhibet, cingulo sive sacco adhaesum et femur dextrum circumdatum est. Cruce sive gladio ornatum est. Epigonatium “gladius spiritualis” episcopi habetur. Usque ad saeculum 12 unice episcopis relictum fuit."},{"page_url":"https://pl.wikipedia.org/wiki/Pavel_Tigrid","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Pavel_Tigrid_-_podpis.jpg","page_title":"Pavel Tigrid","context_page_description":"Pavel Tigrid, urodzony jako Pavel Schönfeld – czeski dziennikarz, polityk i publicysta."},{"page_url":"https://fr.wikipedia.org/wiki/Rochegude_(Gard)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/095_Rochegude_%2830430%29.jpg","page_title":"Rochegude (Gard)","context_page_description":"Rochegude est une commune française située dans le département du Gard en région Occitanie."},{"page_url":"https://en.wikipedia.org/wiki/Friday_the_13th","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Alitalia-17.jpg","page_title":"Friday the 13th","context_page_description":"Friday the 13th is considered an unlucky day in Western superstition. It occurs when the 13th day of the month in the Gregorian calendar falls on a Friday, which happens at least once every year but can occur up to three times in the same year—for example, in 2015, Friday the 13th occurred in February, March, and November. 2017 through 2020 will all have two Friday the 13ths each, and the years 2021 and 2022 will both have just one occurrence each.\\nFriday the 13th occurs in any month that begins on a Sunday."},{"page_url":"https://ca.wikipedia.org/wiki/P%C3%ADnax","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Locri_Pinax_Of_Persephone_And_Hades.jpg","page_title":"Pínax","context_page_description":"Dins de la cultura de l'antiga Grècia i la Magna Grècia, un pínax, o «taula», és una tauleta votiva de fusta pintada, terracota, marbre o bronze, que es feia servir com a objecte votiu, dipositat en un santuari, o com a article commemoratiu, tot fixant-lo dins d'una cambra mortuòria. En la vida quotidiana, pínax també podia indicar una tauleta per a escriure, recoberta amb cera. En un context cristià, les icones pintades són pínakes. En el teatre de l'antiga Grècia, eren imatges acolorides, ja sigui tallades en pedra o fusta, o fins i tot fabricades amb tela, que es penjaven com a fons a les escenes.\\nEls pínakes de marbre s'esculpien individualment, mentre que els de terracota es realitzaven en motlles, i els de bronze podien crear-se en forma repetitiva a partir d'un model al qual se li prenia un motlle de cera i resina, seguint la tècnica anomenada model a la cera perduda. A Locri, s'hi han recuperat milers de pínakes acuradament sepultats que, majoritàriament, van pertànyer als santuaris de Persèfone o d'Afrodita.\\nL'arquitecte romà Vitruvi esmenta la presència de pínakes a les cel·les dels temples, i fins i tot com a possessió de les persones."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_%C4%BEud%C3%AD,_ktor%C3%AD_leteli_do_vesm%C3%ADru","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Commander_Eileen_Collins_-_GPN-2000-001177.jpg","page_title":"Zoznam ľudí, ktorí leteli do vesmíru","context_page_description":"Toto je kompletný zoznam ľudí, ktorí leteli do vesmíru, podľa nižšie definovaných kritérií.\\nMená zobrazené šikmým písmom sú cestovatelia, ktorí opustili nízku obežnú dráhu Zeme, ikonka označuje tých, ktorí pristáli na povrchu Mesiaca. Vlajka zobrazuje štátnu príslušnosť cestovateľa v čase letu. Dátum úmrtia hrubo označuje osobu, ktorá zahynula počas misie.\\nKritériá pre určenie ľudí, ktorí sa zúčastnili vesmírneho letu sa líšia podľa krajín. Kritériá Medzinárodnej leteckej federácie definujú vesmírny let ako let nad 100 kilometrov. V Spojených štátoch sú profesionálni, vojenskí a komerční astronauti už tí, ktorí cestovali nad 80 kilometrov. V doleuvedenom zozname sú zapísaní ľudia podľa definície COSPAR, teda ľudia, ktorí uskutočnili orbitálny let. Nie je tu teda uvedený Joseph Walker, ktorý spĺňa kritériá FAI a v experimentálnom raketopláne X-15 v roku 1963 dvakrát vystúpil nad hranicu 100 km, avšak nevykonal orbitálny let. Rovnako nie sú uvedení ani piloti komerčného raketoplánu spoločnosti SpaceShipOne.\\nĽudí, ktorí zahynuli počas príprav na vesmírny let alebo zahynuli pred dosiahnutím požadovanej výšky, ako napr."},{"page_url":"https://de.wikipedia.org/wiki/Louis_VI._Henri_Joseph_de_Bourbon,_prince_de_Cond%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Louis_VI_Henri_de_Bourbon%2C_Prince_de_Cond%C3%A9%2C_Delaval%2C_Chantilly.jpg","page_title":"Louis VI. Henri Joseph de Bourbon, prince de Condé","context_page_description":"Ludwig VI. Heinrich Joseph, Herzog von Bourbon, 9. „Prince de Condé“ war ein Mitglied der französischen Königsfamilie aus dem Haus Bourbon und der letzte Herzog von Bourbon."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%8A%D9%81%D8%B1%D8%AA%D9%88%D9%86_%D9%88%D9%88%D9%8A%D9%83%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Everton_Weekes.jpg","page_title":"ايفرتون وويكس","context_page_description":"ايفرتون وويكس لاعب كريكت من باربادوس."},{"page_url":"https://sv.wikipedia.org/wiki/Sankt_Stefansklostret","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/St._Stepanos_Monastery_-_panoramio.jpg","page_title":"Sankt Stefansklostret","context_page_description":"Sankt Stefansklostret är ett av Armeniska apostoliska kyrkans kloster omkring 15 km nordväst om staden Jolfa i Östazarbaijan i nordvästra Iran. Klostret, som fått sitt namn efter Sankt Stefan, ligger i en djup kanjon längs floden Arax på den iranska sidan gränsen mellan Azerbajdzjan och Iran. Det byggdes på 800-talet och återuppbyggdes under Safavidernas era efter att flera jordbävningar skadat den."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%AA%E0%B0%B5%E0%B0%A8%E0%B0%B8%E0%B1%8D%E0%B0%A5%E0%B0%BF%E0%B0%A4%E0%B0%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Czechia%2C_Jicin%2C_Wallenstein%27s_square.jpg","page_title":"పవనస్థితి","context_page_description":"పవనస్థితి లేదా వాతావరణస్థితి అనగా వేడి లేదా చల్లని, తడి లేదా పొడి, ప్రశాంతత లేదా ఈదర, స్పష్టమైన లేదా మేఘావృతమైన డిగ్రీకి వాతావరణం యొక్క స్థితి. అత్యధిక పవనస్థితి విషయాలు స్ట్రాటో ఆవరణమునకు కొద్దిగా క్రింద ట్రోపో ఆవరణములో ఏర్పడుతాయి. పవనస్థితి ఉష్ణోగ్రత, అవక్షేపణ కార్యాచరణను అనునిత్యం సూచిస్తుంది, అయితే క్లైమేట్ అనే పదం చాలా ఎక్కువ కాలం పైగా వాతావరణ పరిస్థితుల యొక్క గణాంకాలను సూచిస్తుంది. ఫలానా దాని యొక్క పవనస్థితి అని ప్రత్యేకంగా తెలియపరచనప్పుడు, సాధారణంగా అది భూమి యొక్క వాతావరణస్థితి అని అర్థం చేసుకోవాలి."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B4%D0%BE%D0%B1%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/%D0%9A%D0%B0%D0%B4%D0%BE%D0%B1%D0%BD%D0%B5._%D0%A1%D1%96%D0%BB%D1%8C%D1%80%D0%B0%D0%B4%D0%B0._%D0%A4%D0%90%D0%9F.jpg","page_title":"Кадобна","context_page_description":"Ка́добна — село Калуського району, Брошнів-Осадської ОТГ Івано-Франківської області."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B3%A2%E5%A4%9A%E9%BB%8E%E5%90%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Calle_25_de_Enero.jpg","page_title":"波多黎各","context_page_description":"波多黎各自由邦是美国在加勒比海地区的一个自治邦，距离佛罗里达州迈阿密东南1600公里，首府为圣胡安。在西班牙语里波多黎各的意思是“富裕海港”。波多黎各是大安地列斯群岛四个大岛中最小的一个岛，位于多米尼加共和国东面，小安地列斯群岛西北，包含一个主岛和若干小岛。官方语言为西班牙语和英语，其中西班牙语处于支配地位。波多黎各人口接近340万，整个地区分为78个市级行政区。波多黎各的历史、热带风情、自然景观和传统美食使其成为世界闻名的旅游胜地。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Chambornay-l%C3%A8s-Bellevaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Chambornay-l%C3%A8s-Bellevaux%2C_la_chapelle_Saint_Justin.jpg","page_title":"Chambornay-lès-Bellevaux","context_page_description":"Chambornay-lès-Bellevaux sī ūi-tī Hoat-kok Franche-Comté toā-khu Haute-Saône koān ê chi̍t ê commune."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%A7%E3%83%BC%E3%83%B3%E3%83%BB%E3%83%9E%E3%82%A4%E3%82%B1%E3%83%AB%E3%82%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Shawn_Michaels_Sweet_Chin_Music_Chile_08.jpg","page_title":"ショーン・マイケルズ","context_page_description":"ショーン・マイケルズは、アメリカ合衆国の元プロレスラー。アリゾナ州チャンドラー生まれ、テキサス州サンアントニオ出身。\\n1988年から2度目の引退をした2010年まで、約20年以上、WWEに在籍した。プロレスラーとして卓越した技術と圧倒的なカリスマ性、派手なパフォーマンスなどで絶大な人気を誇り、ベビーフェイスとヒール、シングルとタッグの両方で活躍した。ショーストッパー=ショーの主役、ボーイ・トーイ、セクシー・ボーイ、アイコン、メイン・イベンター、ミスター・レッスルマニアなど多くの異名を持つ。最終所属はWWEのRAW。"},{"page_url":"https://tr.wikipedia.org/wiki/2015_CONCACAF_Alt%C4%B1n_Kupa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/PPL_Park_Interior_from_the_River_End_2010.10.02_%28cropped%29.jpg","page_title":"2015 CONCACAF Altın Kupa","context_page_description":"2015 CONCACAF Altın Kupa, 7-26 Temmuz tarihleri arasında ABD ile Kanada'nın ev sahipliğinde düzenlenen 23. CONCACAF Altın Kupa turnuvasıdır. 12 takımın katılımıyla gerçekleştirilen turnuvanın final maçında Jamaika'yı 3-1'lik skorla yenen Meksika, turnuva tarihindeki 10. şampiyonluğunu elde etti. Bu sonuçla Meksika, Rusya'da düzenlenecek 2017 FIFA Konfederasyonlar Kupası'na katılacak CONCACAF temsilcisinin belirlenmesi için 2013 CONCACAF Altın Kupa şampiyonu Amerika Birleşik Devletleri ile bir play off maçı oynamaya da hak kazandı. Jamaika ise turnuva tarihinde bu aşamaya kadar yükselen ilk Karayip ülkesi oldu. Şampiyona, 2003'teki turnuvadan sonra ilk kez bir üçüncülük maçına da sahne oldu. Amerika Birleşik Devletleri'ni, normal ve uzatma süresi 1-1 sona eren üçüncülük maçında, penaltı vuruşlarındaki 3-2'lik skorla yenen Panama, turnuvayı üçüncülükle tamamladı.\\n7 gol kaydeden Amerikalı Clint Dempsey, turnuvanın en golcü oyuncusu oldu. Turnuvanın en değerli oyuncusu Andrés Guardado, en iyi genç oyuncusu Jesús Corona, en iyi kalecisi Jaime Penedo olarak seçilirken; Fair Play Ödülü'nün sahibi Jamaika millî takımı olarak belirlendi."},{"page_url":"https://it.wikipedia.org/wiki/Operazione_di_salvataggio_in_Iraq_del_22_ottobre_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Joshua_Wheeler_portrait.jpg","page_title":"Operazione di salvataggio in Iraq del 22 ottobre 2015","context_page_description":"L'operazione di salvataggio in Iraq è stata un'azione militare avuto luogo il 22 ottobre 2015 con l'obiettivo di soccorrere 70 prigionieri iracheni catturati dallo Stato Islamico"},{"page_url":"https://nl.wikipedia.org/wiki/Thompson_(rivier)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Fraser_joins_Thompson_River_at_Lytton.JPG","page_title":"Thompson (rivier)","context_page_description":"De Thompson is een 489 kilometer lange rivier in Canada en de belangrijkste zijrivier van de Fraser. De rivier werd door ontdekkingsreiziger Simon Fraser vernoemd naar zijn vriend David Thompson.\\nDe Thompson stroomt door het centrale deel van zuidelijk Brits-Columbia en kent twee belangrijke bovenlopen: de South Thompson River en de North Thompson River. De North Thompson geldt als de bovenloop van de Thompson River. Bij Kamloops draait de North Thompson naar het westen en mondt de South Thompson uit in de North Thompson. Vanaf dit punt heet de rivier gewoon Thompson River.\\nIn de rivier leven verschillende soorten Pacifische zalm en forel. De geologische geschiedenis van het stroomgebied van de Thompson is sterk beïnvloed geweest door vergletsjering en verschillende grote glaciale meren hebben zich gevormd in de riviervallei tijdens de afgelopen 12.000 jaar. Sinds 8.300 jaar geleden is er menselijke bewoning in het gebied.\\nEr wordt geraft op de rivier en er wordt aan hengelen gedaan."},{"page_url":"https://hr.wikipedia.org/wiki/Slava_Vojvodine_Kranjske","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Kranjska-Valvasor.jpg","page_title":"Slava Vojvodine Kranjske","context_page_description":"Slava Vojvodine Kranjske enciklopedijsko je djelo koje je izdano 1689. godine u Nürnbergu. Autor enciklopedije je Janez Vajkard Valvasor. Smatra se njegovim najvećim djelom i najvažnijem znanstvenome djelu o Kranjskoj, Valvasarovoj domovini, današnjem dijelu središnje Slovenije.\\nCijelo se djelo sastoji od 4 svezaka ili knjiga koja su podijeljena na 15 poglavlja ili knjiga. Djelo sveukupno ima 3532 stranica, 24 priloga i 528 bakroreza. Valvasor je predstavio Kranjsku preko nekoliko znanosti, poput povijesti, zemljopisa, topografije, medicine, etnologije, biologije, geologije, itd.\\nZbog visoke cijene tiskanja, Valvasor je bio prisiljen prodati dvorac Bogenšperk i svoje rodno mjesto u Ljubljani, nakon čega se preselio u Krško gdje je jednu godine kasnije umro."},{"page_url":"https://fi.wikipedia.org/wiki/Laukkanahikas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Mycetinis_scorodonius_334947.jpg","page_title":"Laukkanahikas","context_page_description":"Laukkanahikas on Marasmiaceae-heimoon kuuluva sienilaji. Sitä tavataan Etelä-Suomessa yleisenä, pohjoisempana se on harvinaisempi ja Lapissa se ei kasva ollenkaan. Laukkanahikkaan lakki on 1–3 senttimetrin levyinen ja sen jalka on 1–4 senttimetrin korkuinen. Sitä tavataan heinä-lokakuussa. Laukkanahikasta muistuttavat kuusenneulasnahikas ja oksaratasnahikas."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%90%D7%A8%D7%9F_%D7%9E%D7%95%D7%A8%D7%99%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Maren_Morris_2019_by_Glenn_Francis.jpg","page_title":"מארן מוריס","context_page_description":"מארן לארה מוריס היא זמרת-יוצרת, כותבת שירים ומפיקה מוזיקלית אמריקאית. המיני-אלבום הראשון שלה Maren Morris, הצליח להיכנס לשניים ממצעדי הבילבורד. אלבום הבכורה שלה שיצא על ידי חברת תקליטים מסחרית הוא Hero. האלבום הגיע למקום החמישי במצעד הבילבורד 200 ולמקום הראשון במצעד אלבומי הקאנטרי. מוריס חברה בלהקת הבנות The Highwomen, בה חברות ברנדי קרלייל, אמנדה שיירס ונטלי המבי.\\nאלבומה הראשון Walk On, יצא בשנת 2005, אך לא נחשב לאלבום הבכורה שלה, היות שלא יצא על ידי חברת תקליטים מסחרית. סינגל הבכורה שלה \\"My Church\\", הגיע למקום השלישי במצעד שירי הקאנטרי, ולמקום החמישי במצעד שירי הקאנטרי. הסינגל השלישי שלה \\"I Could Use a Love Song\\", היה הראשון שלה שהגיע למקום הראשון במצעד הקאנטרי אירפליי. בהמשך, הוציאה את הלהיט הבינלאומי \\"The Middle\\" ביחד עם זד. השיר הגיע למקום החמישי במצעד הבילבורד הוט 100, וקיבל שלוש מועמדויות בטקס פרסי גראמי ה-61. אלבומה השני Girl, יצא לאור ב-8 במרץ 2019, על ידי חברת התקליטים קולומביה נאשוויל ולפניו יצא סינגל בעל אותו השם."},{"page_url":"https://pt.wikipedia.org/wiki/Juelz_Santana","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/JuelzSantanHSJul05.jpg","page_title":"Juelz Santana","context_page_description":"LaRon Louis James conhecido pelo nome artístico de Juelz Santana é um rapper, ator e produtor musical estadunidense de origem dominicana. É um dos membros do grupo The Diplomats, junto com Cam'ron, rapper que o ajudou no seu início de carreira."},{"page_url":"https://de.wikipedia.org/wiki/Chattanooga_(Tennessee)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/HamiltonCountyCourthouseChattanooga.jpg","page_title":"Chattanooga (Tennessee)","context_page_description":"Chattanooga ist mit rund 178.000 Einwohnern die viertgrößte Stadt des US-Bundesstaates Tennessee. Sie liegt im Südosten des Bundesstaates am Ufer des Tennessee River in der Nähe der Grenze zu Georgia und ist der Mittelpunkt der Metropolregion Chattanooga."},{"page_url":"https://simple.wikipedia.org/wiki/Shel_Dorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Shel_Dorf_%282085929919%29_%28cropped%29.jpg","page_title":"Shel Dorf","context_page_description":"Sheldon \\"Shel\\" Dorf was an American comic-strip letterer and freelance artist. He is known for being the founder of the San Diego Comic-Con International. Dorf lettered the Steve Canyon comic strip for the last 12 to 14 years of the strip's run."},{"page_url":"https://ca.wikipedia.org/wiki/Pratoveccio_Stia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/PratovecchioPanorama.JPG","page_title":"Pratoveccio Stia","context_page_description":"Pratoveccio Stia és un nou municipi situat al territori de la província d'Arezzo, a la regió de la Toscana. Prové de la fusió dels municipis de Pratoveccio i Stia.\\nLimita amb els municipis de Bagno di Romagna, Castel San Niccolò, Londa, Montemignaio, Pelago, Poppi, Rufina, San Godenzo i Santa Sofia.\\nPertanyen al municipi de San Giovanni Valdarno les frazioni de Casalino, Gualdo, Lonnano, Papiano, Porciano, Pratovecchio, Stia, Tartiglia i Villa."},{"page_url":"https://id.wikipedia.org/wiki/Mordovia_Arena","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/MordoviaArenaStadium.jpg","page_title":"Mordovia Arena","context_page_description":"Mordovia Arena adalah sebuah stadion yang terletak di Saransk, Rusia. Stadion ini mulai dibangun pada tahun 2010. Pembangunan stadion ini rampung pada 2018 dan akan menyelenggarakan pertandingan sepak bola, terutama laga kandang FC Mordovia Saransk. Total area fasilitas adalah 122.700 meter persegi.\\nStadion sepak bola ini digunakan selama pergelaran Piala Dunia FIFA 2018. Arena terletak di bagian tengah kota dan dalam jarak berjalan kaki dari infrastruktur utama kota. Desain stadion didasarkan pada gambar matahari, simbol utama dari mitos kuno dan legenda orang-orang Mordvin. Setelah Piala Dunia FIFA, stadion ini diharapkan berfungsi sebagai pusat olahraga dan rekreasi terbesar Saransk dan Mordovia."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%84%BF%E5%AD%90%E5%AF%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Jioufen.jpg","page_title":"焿子寮","context_page_description":"焿子寮，是新北市瑞芳區的一個地名，位於該區北部。相較於今日行政區，其範圍大致包括瑞濱里東端、海濱里、基山里、頌德里、福住里、崇文里、永慶里不含最東端。\\n知名的山城——九份聚落即位於本地區東南部。"},{"page_url":"https://en.wikipedia.org/wiki/Tsentralny_City_District,_Novosibirsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Novosibirsk_KrasnyProspekt_trolley_07-2016_img2.jpg","page_title":"Tsentralny City District, Novosibirsk","context_page_description":"Tsentralny City District is an administrative district of Central Okrug, one of the 10 raions of Novosibirsk, Russia. The area of the district is 6.4 sq km. Population: 78 794."},{"page_url":"https://ceb.wikipedia.org/wiki/Penstemon_attenuatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Penstemon_attenuatus3.jpg","page_title":"Penstemon attenuatus","context_page_description":"Espesye sa tanom nga bulak ang Penstemon attenuatus. Una ning gihulagway ni David Douglas. Ang Penstemon attenuatus sakop sa kahenera nga Penstemon sa kabanay nga Plantaginaceae."},{"page_url":"https://it.wikipedia.org/wiki/DJ_Korsakoff","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Airbeat_One_2015_Korsakoff_Lindsay_van_der_Eng_by_Denis_Apel-1862.jpg","page_title":"DJ Korsakoff","context_page_description":"Korsakoff, pseudonimo di Lindsay Van Der Erg, è una disc jockey olandese."},{"page_url":"https://fr.wikipedia.org/wiki/Bethlehem_(Afrique_du_Sud)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/NG_Kerk_Bethlehem_02.jpg","page_title":"Bethlehem (Afrique du Sud)","context_page_description":"Bethlehem est une ville de l'est de la province de l'État-Libre en Afrique du Sud. Elle est située à 1 700 m d'altitude dans une vallée fertile au bord de la rivière Liebenbergs au sud des montagnes de Rooiberg.\\nFondée par les Boers en 1859 dans l'État libre d'Orange, la ville a été baptisée en l'honneur de la Bethléem de la Bible."},{"page_url":"https://fi.wikipedia.org/wiki/Valmet_(traktori)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Valmetlogo4.jpg","page_title":"Valmet (traktori)","context_page_description":"Valmet on Valmetin vuosina 1952–1995 valmistama traktorimallisto. Aluksi petrolikäyttöisiä Valmeteja alettiin valmistaa Takran ja tuontitraktoreiden korvaamiseksi. Suomalainen traktorinvalmistus jatkui 1982 esitellyillä Volvo BM Valmet -traktoreilla, joista tuli 1983 pohjoismainen markkinajohtaja Volvo BM:n ansiosta sekä siksi, että keskusosuusliike Hankkija otti edustuksen itselleen."},{"page_url":"https://de.wikipedia.org/wiki/Laurids_de_Thurah","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Laurids_Lauridsen_Thurah_1754.jpg","page_title":"Laurids de Thurah","context_page_description":"Laurids Lauridsen de Thurah, auch Lauritz de Thurah war ein dänischer Architekt, Baumeister, Architekturhistoriker und Topograf."},{"page_url":"https://en.wikipedia.org/wiki/Malangen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Malangen_IMG_4934_malangen.JPG","page_title":"Malangen","context_page_description":"Malangen is a former municipality in Troms county in Norway. The 372-square-kilometre municipality existed from 1871 until its dissolution in 1964. The old municipality surrounded the Malangen fjord and today that area is divided between the municipalities of Balsfjord, Lenvik, Tromsø, and Målselv. The administrative centre was the village of Mortenhals where the main church for the municipality, Malangen Church, is located."},{"page_url":"https://sv.wikipedia.org/wiki/Tennisstadion,_Stockholm","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Tennisstadion_febr_2015b.jpg","page_title":"Tennisstadion, Stockholm","context_page_description":"Tennisstadion, Stockholm ligger vid Södra Fiskartorpsvägen 20 på Norra Djurgården i Stockholm, inte långt från Östermalms IP."},{"page_url":"https://pt.wikipedia.org/wiki/Kirklin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Kirklin_water_tower.jpg","page_title":"Kirklin","context_page_description":"Kirklin é uma cidade localizada no estado americano de Indiana, no Condado de Clinton."},{"page_url":"https://ceb.wikipedia.org/wiki/Acacia_verticillata","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Acacia_verticillata.jpg","page_title":"Acacia verticillata","context_page_description":"Espesye sa sitaw nga una nga gihulagway ni L'her., ug nga gihatagan sa eksakto nga ngalan ni Carl Ludwig von Willdenow ang Acacia verticillata. Ang Acacia verticillata sakop sa kahenera nga Acacia sa kabanay nga Fabaceae."},{"page_url":"https://de.wikipedia.org/wiki/Historisches_Museum_der_Stadt_Luxemburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Historisches_Museum_der_Stadt_Luxemburg_8325-026.jpg","page_title":"Historisches Museum der Stadt Luxemburg","context_page_description":"Das Historische Museum der Stadt Luxemburg ist ein 1996 eröffnetes Museum in Luxemburg mit einer Dauerausstellung und regelmäßigen Wechselausstellungen.\\nDas Museumsgebäude, das von der luxemburgischen Architektin Conny Lentz geplant wurde, besteht aus bis zu acht Stockwerken und umfasst sowohl moderne Gebäudeteile, als auch vier Bürger- und Patrizierhäuser aus dem 17. bis 19. Jahrhundert. Während die Dauerausstellung im Erdgeschoss und den ersten beiden Obergeschossen exponiert ist, werden in der dritten bis fünften Etage die Wechselausstellungen präsentiert."},{"page_url":"https://en.wikipedia.org/wiki/D%C3%BCsseldorf-Gerresheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Duesseldorf-Gerresheim_St_Maria_vom_Frieden.JPG","page_title":"Düsseldorf-Gerresheim","context_page_description":"Gerresheim is one of the City of Düsseldorf, Germany's fifty boroughs. It is located in the eastern part of the municipality. Gerresheim is much older than Düsseldorf itself, having been an independent city with a rich history for over 1,000 years. Gerresheim merged voluntarily with Düsseldorf in 1909.\\nThe borough had 28,209 inhabitants and covered 6.47 square kilometers as of December 31, 2007."},{"page_url":"https://et.wikipedia.org/wiki/K%C3%A4rbes%C3%B5is","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Ophrys_insectifera_ochroleuca_sharper.jpg","page_title":"Kärbesõis","context_page_description":"Kärbesõis on sugukonda käpalised ja perekonda putukõis kuuluv taimeliik. Kärbesõie rahvapärased nimetused on kärpselill, kärbsejuur ja kärblase juur.\\n2015. aastal valiti Eestis aasta orhideeks kärbseõis. Aasta orhidee valimise eesmärk on liiki laiemalt tutvustada, selle elu lähemalt uurida, saada täpsemat pilti liigi levikust Eestis ja pöörata rohkem tähelepanu leiukohtade kaitsmisele.\\nKõik Eestis kasvavad orhideeliigid on 1983. aastast riikliku looduskaitse all. Kärbesõis kuulub II kaitsekategooriasse."},{"page_url":"https://vi.wikipedia.org/wiki/Papilio_mechowianus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Papilio_mechowianus.JPG","page_title":"Papilio mechowianus","context_page_description":"Papilio mechowianus là một loài bướm thuộc họ Bướm phượng. Loài Papilio mechowianus được mô tả năm 1885 bởi Dewitz. Loài bướm Papilio mechowianus sinh sống ở."},{"page_url":"https://de.wikipedia.org/wiki/Parlamentswahl_in_Portugal_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Wahlkreiskarte_Portugal_2015_Linksparteien.svg","page_title":"Parlamentswahl in Portugal 2015","context_page_description":"Die Parlamentswahl in Portugal 2015 fand am 4. Oktober 2015 statt. Gewählt wurden die Abgeordneten der Assembleia da República für die vierjährige Legislaturperiode bis 2019. Dabei verlor die amtierende Regierung unter Premierminister Pedro Passos Coelho die absolute Mehrheit im Parlament. Das Wahlbündnis von PSD und CDS, Portugal à Frente, blieb aber die relativ stärkste Kraft. Die Wahlbeteiligung lag bei knapp 57 Prozent."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_del_Miracle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Santuari_del_Miracle_-_Esgl%C3%A9sia_-_Exterior%2C_fa%C3%A7ana_de_llevant.JPG","page_title":"Iglesia del Miracle","context_page_description":"La actual iglesia del Miracle es el tercer templo edificado en el prado de Bassadòria, del Santuario del Miracle en el municipio de, comarca catalana del Solsonés, como consecuencia de la Aparición de la Virgen sucedida el 3 de agosto de 1458 a dos hermanos pastores."},{"page_url":"https://pl.wikipedia.org/wiki/Lee_Jung-soo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Lee_Jung-Soo.jpg","page_title":"Lee Jung-soo","context_page_description":"Lee Jung-soo – południowokoreański piłkarz występujący na pozycji obrońcy w Charlotte Independence."},{"page_url":"https://en.wikipedia.org/wiki/Royal_Mint_Court","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/The_old_Royal_Mint_building_-_geograph.org.uk_-_735466.jpg","page_title":"Royal Mint Court","context_page_description":"Royal Mint Court is a property on Little Tower Hill in Tower Hill and is in London's East End, close to the City of London financial district.\\nThe site was the home of the Royal Mint from 1809 until 1967 and was earlier the site of a Cistercian abbey, built in 1348 and known in its time as Eastminster. Eastminster's foundations are relatively well preserved and visible in the partially open basement of the site.\\nAfter the Dissolution of the Monasteries, the 5.5 acre property was used as a victualling yard for the Royal Navy, then as a tobacco warehouse, before becoming a mint in 1809. After the mint relocated, the site was redeveloped with a new office and residential block added to the complex alongside the two remaining Grade II listed mint buildings.\\nIn 2017, Royal Mint Court was again set to be redeveloped with plans for a new office, shopping and leisure complex. Planning permission was granted in July 2016. However in May 2018 the site was sold to the People's Republic of China to be used for their new London embassy."},{"page_url":"https://pt.wikipedia.org/wiki/Estampures","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/%C3%89glise_d%27Estampures_%28Hautes-Pyr%C3%A9n%C3%A9es%2C_France%29.jpg","page_title":"Estampures","context_page_description":"Estampures é uma comuna francesa na região administrativa de Occitânia, no departamento dos Altos Pirenéus. Estende-se por uma área de 5,56 km². Em 2010 a comuna tinha 78 habitantes."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A7%80%ED%8F%AC%EC%8A%A4_2_%EC%8B%9C%EB%A6%AC%EC%A6%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/NVIDIA_GeForce2_Ultra.jpg","page_title":"지포스 2 시리즈","context_page_description":"지포스 2는 엔비디아의 2세대 지포스 칩이었다. 지포스 256의 뒤를 잇는 그래픽 카드였다. 다이렉트엑스 7.0을 지원하였으며, 다음의 칩셋을 제공하였다.\\n시장 진입 모델: 지포스 2 MX\\n일반 모델: 지포스 2 GTS, 지포스 2 Pro, 지포스 2 Ti\\n하이엔드 모델: 지포스 2 울트라\\n지포스 2의 코드 이름은 NV11, NV15, NV16로 분류되기도 하며, 2000년에 공개되었다."},{"page_url":"https://fr.wikipedia.org/wiki/Cognac_(Charente)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/CognacMairie1.JPG","page_title":"Cognac (Charente)","context_page_description":"Cognac est une commune du Sud-Ouest de la France, sous-préfecture du département de la Charente. Ses habitants sont les Cognaçais et les Cognaçaises.\\nDeuxième agglomération de la Charente après Angoulême, Cognac est également au cœur de la deuxième aire urbaine de ce département où son rayonnement urbain déborde dans la Charente-Maritime voisine et regroupe 48 271 habitants en 2016. Depuis 2012, la ville de Cognac est labellisée « Ville d'art et d'histoire » par le ministère de la Culture et de la Communication."},{"page_url":"https://pl.wikipedia.org/wiki/Stargard","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Scania_L94UB4X2.JPG","page_title":"Stargard","context_page_description":"Stargard – miasto w Polsce w województwie zachodniopomorskim, siedziba powiatu stargardzkiego, położone na Równinie Pyrzycko-Stargardzkiej, nad Iną. Początki istnienia stałych osad ludzkich sięgają VI wieku, jest jednym z najstarszych miast Polski. Najstarsze miasto na Pomorzu – prawa miejskie uzyskało w 1243. Rozwojowi osady sprzyjało położenie przy krzyżujących się szlakach handlowych, prowadzących z Santoka do Wolina i ze Szczecina do Kołobrzegu. Ważny węzeł komunikacyjny oraz ośrodek przemysłowy, usługowy i kulturalny. Miasto jest siedzibą powiatu stargardzkiego i gminy. Wraz ze Szczecinem, Świnoujściem, Policami, Goleniowem i Gryfinem tworzy aglomerację szczecińską. Jest trzecim miastem pod względem liczby ludności w województwie i 56. w Polsce.\\nWedług danych z 30 czerwca 2019 Stargard liczył 67 795 mieszkańców."},{"page_url":"https://en.wikipedia.org/wiki/Leadlight","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Art_Deco_Stained_Glass_in_a_Melbourne_House.jpg","page_title":"Leadlight","context_page_description":"Leadlights, leaded lights or leaded windows are decorative windows made of small sections of glass supported in lead cames. The technique of creating windows using glass and lead came is discussed at came glasswork. The term leadlight could be used to describe all windows in which the glass is supported by lead, but traditionally and correctly, a distinction is made between stained glass windows and leadlights, the former being associated with the ornate painted images on windows of churches and other such works of architecture and the latter with the windows of vernacular commercial and domestic architecture and defined by its simplicity.\\nSince the traditional technique of setting glass into lead cames is the same in both cases, in the late 20th century the divisions between \\"leadlight\\" and \\"stained glass\\" became blurred, and the terms are now often incorrectly used interchangeably for any window employing this technique, while the term \\"stained glass\\" is often extended to apply to any windows, sculpture, and works of art using coloured glass."},{"page_url":"https://cs.wikipedia.org/wiki/Evangelick%C3%BD_h%C5%99bitov_v_Horn%C3%ADm_%C5%BDukov%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/2018_Horni_Zukov_Burda.jpg","page_title":"Evangelický hřbitov v Horním Žukově","context_page_description":"Evangelický hřbitov v Horním Žukově se nachází se nachází ve městě Český Těšín, v části Horní Žukov, a to na ul. Koňakovské. Má rozlohu 2430 m²."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B3%D8%AA%D8%B1%DA%AF%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Belv%C3%A1rosi_r.k.pl%C3%A9b%C3%A1niatemplom_%286227._sz%C3%A1m%C3%BA_m%C5%B1eml%C3%A9k%29_2.jpg","page_title":"استرگم","context_page_description":"اِسترگم در مجارستان در کوماروم-استرگوم واقع شده‌است. جمعیت این شهر ۳۰٫۲۶۱ نفر است."},{"page_url":"https://pt.wikipedia.org/wiki/Avenida_do_Doutor_Louren%C3%A7o_Peixinho","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Avenida_Dr._Louren%C3%A7o_Peixinho_04.jpg","page_title":"Avenida do Doutor Lourenço Peixinho","context_page_description":"A Avenida do Doutor Lourenço Peixinho é a principal avenida de Aveiro, Portugal, estendendo-se desde a estação ferroviária até à Praça General Humberto Delgado, no centro da cidade. Com cerca de 1100 metros de comprimento, esta artéria assenta num eixo retilíneo de cerca de 30 metros de largura, com quatro faixas rodoviárias, separadas por uma placa central arborizada. Nesta secção central existe igualmente uma ciclovia, criada em apoio ao às bicicletas de utilização gratuíta BUGA, projeto pioneiro em Portugal.\\nProjetada inicialmente como Avenida do Cojo, em 1907 e construída a partir de 1918, com o nome Avenida Central, esta artéria permitiu ligar de forma fácil, rápida e funcional o caminho-de-ferro ao centro da cidade e às industrias de sal e peixe, baseadas na Ria de Aveiro, facilitando um percurso que apenas era possível através de dois caminhos indiretos e de difícil transposição. A abertura deste eixo fez parte das grandes transformações que a cidade sofreu durante o século XX e permitiu o seu desenvolvimento e expansão para nordeste."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_l%27%C3%89thiopie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Africa_1909%2C_Edward_Hertslet_%28Horn_of_Africa%2C_detail%29.jpg","page_title":"Histoire de l'Éthiopie","context_page_description":"La Corne de l'Afrique, et en particulier le territoire de l'actuelle Éthiopie, se trouve au cœur de l'histoire de l'humanité. On y trouve les restes de certains des plus anciens hominidés connus mais également les plus anciennes traces de l'homo sapiens moderne, après le Maroc depuis mai 2017 - Djebel Irhoud, 300 000 ans.\\nL'existence d'un royaume qualifié d'« éthiopien » au sud de l'Égypte est très tôt évoquée dans l'Antiquité par les sources grecques et égyptiennes, sans que sa localisation précise soit clairement identifiée.\\nLe royaume d'Aksoum, connu comme l'une des quatre puissances de l'époque, qui apparaît vers le Iᵉʳ siècle, unifie des royaumes antérieurs. Des sources locales deviennent ensuite disponibles avec l'apparition du ge'ez vers le IVᵉ siècle.\\nAu XIᵉ siècle, l'installation de la dynastie Zagwe créée une entité politique au nord du territoire avec Lalibela comme capitale. Elle est renversée par la dynastie salomonienne qui lui succède à partir du XIIIᵉ siècle."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%9F%B3%E8%80%81%E4%BA%BA%E6%B5%B4%E5%A0%B4%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/%E7%9F%B3%E8%80%81%E4%BA%BA%E6%B5%B4%E5%9C%BA%E7%AB%99-%E6%B5%B7%E9%A3%8E1.jpg","page_title":"石老人浴場站","context_page_description":"石老人浴场站位于中国青岛市崂山区，是青岛地铁2号线的一站，未来将成为与5号线的换乘站。"},{"page_url":"https://nn.wikipedia.org/wiki/Glasur","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Periodo_nara%2C_giara_invetriata_a_tre_a_colori%2C_VIII_sec.JPG","page_title":"Glasur","context_page_description":"Glasur er eit glatt dekke på keramikk laga av knuste mineral. Glasuren gjev det keramiske produktet ein sterk, vasstett og dekorativ overflate.\\nGlasuren blir som regel påført etter første brenning av keramikken. Alt etter føremål, eigenskapar og farge har han varierende sammensetning."},{"page_url":"https://sh.wikipedia.org/wiki/Farmingville,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Bald-hill-memorial.jpg","page_title":"Farmingville, New York","context_page_description":"Farmingvil je naseljeno mesto bez administrativnog statusa u američkoj saveznoj državi Njujork."},{"page_url":"https://sv.wikipedia.org/wiki/Triangelns_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Cykelparkering_vid_Triangeln.jpg","page_title":"Triangelns station","context_page_description":"Station Triangeln är en underjordisk järnvägsstation i centrala Malmö vid köpcentrumet Triangeln, som togs i drift 12 december 2010.\\nStationen är en underjordisk bergrumsstation under Triangeln med rulltrappor och hissar som leder upp dels till Triangelns köpcentrum och Sankt Johanneskyrkan, norra uppgången, samt till Tandvårdshögskolan och Skånes universitetssjukhus i Malmö, södra uppgången. Station Triangeln är en del av Citytunneln, en järnvägstunneln som går under centrala Malmö. Station Triangeln byggdes i ett underjordiskt bergrum, cirka 25 meter under markytan med två spår och en mellanliggande perrong. Stationen har ritats av KHR Arkitekter och Sweco och utsågs till 2011 års vinnare av arkitekturpriset Kasper Salin-priset.\\nPerrongen är 250 meter lång och 14,5 meter bred. Stationsrummet har ett innertak cirka fem meter över plattformen. Stationen trafikeras av Skånetrafikens lokaltåg Pågatågen samt Öresundstågen. Malmö har två underjordiska stationer: dels station Triangeln, dels Malmö centralstations nya underjordiska stationsdel."},{"page_url":"https://vi.wikipedia.org/wiki/Heckler_%26_Koch_G3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Exercise_TRIDENT_JUNCTURE_%2822778497686%29.jpg","page_title":"Heckler & Koch G3","context_page_description":"Heckler & Koch G3 là súng trường chiến đấu sử dụng đạn 7.62×51mm NATO, được phát triển vào những năm 1950 bởi nhà sản xuất vũ khí Đức Heckler & Koch phối hợp với cơ quan phát triển và thiết kế nhà nước Tây Ban Nha CETME. Nó cũng là nguyên nhân chính khai sinh ra một trong những khẩu súng tiểu liên nổi tiếng nhất thế giới: Heckler & Koch MP5."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%BA%BA%E9%A1%9E%E8%A1%8C%E7%82%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Humanactionscholar.jpg","page_title":"人類行為","context_page_description":"《人类行为的经济学分析》是奥地利经济学派经济学家路德维希·冯·米塞斯所著的钜作。米塞斯在这本书中详细阐述了经济学的运作，坚定支持一个自由放任的市场经济体制—亦即纯粹的资本主义。米塞斯排斥经济学里的实证主义，支持一个先验的知识论系统，并且提出了一种名为“人类行为学”的研究方式，以方法论的个人主义作为研究的基础。米塞斯在书中强力的主张自由市场机制不但可以完全取代任何政府计划的体制，更重要的，自由市场本身就是人类文明的根基。"},{"page_url":"https://ca.wikipedia.org/wiki/Khon_Kaen_(prov%C3%ADncia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Amphoe_Khon_Kaen.png","page_title":"Khon Kaen (província)","context_page_description":"Khon Kaen és una de les províncies de Tailàndia, situada a la Isaan i que limita, en el sentit de les agulles del rellotge, amb les províncies de Nongbua Lamphu, Udon Thani, Kalasin, Maha Sarakham, Buriram, Nakhon Ratchasima, Chaiyaphum, Phetchabun i Loei. Es troba a la zona central de l'altiplà de Khorat, banyada pel riu Chi."},{"page_url":"https://hu.wikipedia.org/wiki/Kiskunhalas","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Kiskunhalas_v%C3%A1rosh%C3%A1za.JPG","page_title":"Kiskunhalas","context_page_description":"Kiskunhalas város Bács-Kiskun megyében, a Kiskunságban, a Kiskunhalasi járásban."},{"page_url":"https://en.wikipedia.org/wiki/International_School_Suva","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Iss_entry.jpg","page_title":"International School Suva","context_page_description":"International School Suva is an independent, co-educational day school in Laucala Beach Estate in Suva, Fiji, offers preschool, primary and secondary education. The curriculum provided at International School Suva includes the International Baccalaureate, the International General Certificate of Secondary Education and the Australian Capital Territory Senior Secondary Certificate and Australian Tertiary Admission Rank. The school was funded in 1973, and it provides an education for around 500 students representing over 40 different nations from preschool to secondary school. There are currently 80 staff, with 35 from local Fijian community and 11 from North America and the United Kingdom. ISS is the only international school that delivers the International Baccalaureate programme in Fiji. In addition, all year 11 and year 12 students are expected to complete either the Duke of Edinburgh's Award programme or the Creative, Action, Service programme as one of the extracurricular programmes."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%B5%D9%86_%D9%84%D8%A7%D9%84%D8%A8%D8%A7%D8%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Lal_Bagh%2C_South_Gate_Dhaka_1904.jpg","page_title":"حصن لالباغ","context_page_description":"حصن لالباغ أو ‏ هو مجمع حصن مغولي يعود إلى القرن السابع عشر يقف أمام نهر بوريجانجا في الجزء الجنوبي الغربي من دكا، بنغلاديش. بدأ البناء في 1678 ميلادي من قبل المغولي سوبدار محمد عزام شاه الذي كان ابن الإمبراطور أورنجزيب والإمبراطور نفسه في وقت لاحق. لم يواصل خلفه شايات خان العمل، رغم أنه بقي في دكا حتى عام 1688.\\nلم يكن الحصن قد اكتمل أبداً، وغير مشغول لفترة طويلة، حتى أن معظم ما كان هناك تم تنظيفه أو بنائه، والموقع المعاد ترميمه والمحافظ عليه الآن يصل إلى المباني الحديثة."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%99%E1%83%A0%E1%83%98%E1%83%A1%E1%83%A2%E1%83%98%E1%83%9C%E1%83%90_%E1%83%93%E1%83%90%E1%83%9C%E1%83%98%E1%83%94%E1%83%9A%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Three_children_of_King_Christian_II_of_Denmark_by_Jan_Gossaert_%281526%29.jpg","page_title":"კრისტინა დანიელი","context_page_description":"კრისტინა დანიელი — ოლდენბურგების დინასტიის წარმომადგენელი. დანიის, ნორვეგიისაა და შვედეთის მეფე კრისტიან II-ისა და მისი ცოლის, დედოფალ იზაბელა ჰაბსბურგის უფროსი ასული. მილანის ჰერცოგინია 1534-1535, ხოლო ლოთარინგიის ჰერცოგინია 1544-1545 წლებში. თავისი ვაჟის, ლოთარინგიის ჰერცოგ შარლ III-ის რეგენტი 1545-1552 წლებში. 1561-1590 წლებში იყო დანიის, ნორვეგიისა და შვედეთის სამეფო ტახტების მოსარჩელე. საბოლოოდ 1578-84 წლებში მიენიჭა ტორტონას ლედის წოდება."},{"page_url":"https://nl.wikipedia.org/wiki/Sandra_Ringwald","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/FIS_Skilanglauf-Weltcup_in_Dresden_PR_CROSSCOUNTRY_StP_7066_LR10_by_Stepro.jpg","page_title":"Sandra Ringwald","context_page_description":"Sandra Ringwald is een Duitse langlaufster. Ze vertegenwoordigde haar vaderland op de Olympische Winterspelen 2018 in Pyeongchang."},{"page_url":"https://de.wikipedia.org/wiki/Grandola_ed_Uniti","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Chiesa_di_San_Siro_%28Codogna%29%2C_lato_nord.jpg","page_title":"Grandola ed Uniti","context_page_description":"Grandola ed Uniti ist eine Gemeinde mit 1313 Einwohnern in der italienischen Provinz Como in der Region Lombardei."},{"page_url":"https://sv.wikipedia.org/wiki/El_Caco","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/El_Caco.jpg","page_title":"El Caco","context_page_description":"El Caco är ett norskt stoner metal-band från Lillestrøm. Deras manager är den f.d. fotbollsspelaren Dan Eggen.\\nEl Caco tilldelades Alarmprisen 2006 i klassen \\"metal\\" för albumet The Search.\\nBandet nominerades till Spellemannprisen 2005 i klassen \\"Metal\\" för albumet The Search och Spellemannprisen 2012 i klassen \\"Metal\\" för albumet Hatred, Love & Diagrams."},{"page_url":"https://pt.wikipedia.org/wiki/Vicente_Sampaio","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Solar_dos_Sampaios_com_decora%C3%A7%C3%A3o_natalina.jpg","page_title":"Vicente Sampaio","context_page_description":"Vicente de Paulo Sampaio Rocha foi um escritor e professor brasileiro, patrono da cadeira nº 25 da Academia de Letras e Artes do Ceará."},{"page_url":"https://vi.wikipedia.org/wiki/Phrynocephalus_helioscopus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Phrynocephalus_helioscopus.JPG","page_title":"Phrynocephalus helioscopus","context_page_description":"Phrynocephalus helioscopus là một loài thằn lằn trong họ Agamidae. Loài này được Pallas mô tả khoa học đầu tiên năm 1771."},{"page_url":"https://hu.wikipedia.org/wiki/NATO_Korai_El%C5%91rejelz%C5%91_%C3%A9s_L%C3%A9gt%C3%A9rellen%C5%91rz%C5%91_Programigazgat%C3%B3s%C3%A1g","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/AWACS_Bourget_2009.jpg","page_title":"NATO Korai Előrejelző és Légtérellenőrző Programigazgatóság","context_page_description":"A NATO Korai Előrejelző és Légtérellenőrző Programigazgatóság 1978. december 8-án alakult a NATO logisztikai szervezetének részeként. A NAPMO polgári szervezet, beszámolni az Észak-atlanti Tanácsnak köteles, mivel annak közvetlenül alárendelt.\\nA szervezet létrehozását az 1970-es évek második felének az a katonai nézete alapozta meg, mely szerint a földi felderítő eszközök képességeit ki kell egészíteni a nagyon gyors, és kis magasságon repülő harci repülőgépeket is sikeresen felderítő képességgel. A NATO katonai hatóságai szerint ezt a földfelszín felett, nagy magasságban telepített radarok képesek biztosítani, mint például a repülőgép fedélzetre telepített eszközök."},{"page_url":"https://lt.wikipedia.org/wiki/Gurkai_(Sedlc%C5%B3_apskritis)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Gorki_village_gm_Przesmyki.JPG","page_title":"Gurkai (Sedlcų apskritis)","context_page_description":"Gurkai – kaimas Lenkijos rytuose, Pžesmikų valsčiuje, Sedlcų apskrityje, Mazovijos vaivadijoje. Kaimas yra apie 3 km į pietvakarius nuo Pžesmikų, apie 22 km į šiaurės rytus nuo Sedlcų ir apie 106 km į rytus nuo vaivadijos centro Varšuvos. Nuo XIII–XIV a. iki 1569 m. Liublino unijos priklausė Lietuvos Didžiajai kunigaikštystei."},{"page_url":"https://pt.wikipedia.org/wiki/Acrolepia_autumnitella","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Acrolepia_autumnitella_E-MK-11482a.jpg","page_title":"Acrolepia autumnitella","context_page_description":"Acrolepia autumnitella é uma espécie de insetos lepidópteros, mais especificamente de traças, pertencente à família Glyphipterigidae.\\nA autoridade científica da espécie é Curtis, tendo sido descrita no ano de 1838.\\nTrata-se de uma espécie presente no território português."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A5%E3%83%AA%E3%82%A2%E3%83%B3%E3%83%BB%E3%82%A4%E3%83%BC%E3%82%A6%E3%82%A7%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Julian_Ewell.jpg","page_title":"ジュリアン・イーウェル","context_page_description":"ジュリアン・ジョンソン・イーウェルは、アメリカの軍人。アメリカ陸軍の将校として、第二次世界大戦、朝鮮戦争、ベトナム戦争などに従軍した。ベトナム戦争中の第9歩兵師団長、ベトナム第2野戦軍司令官としてその名を知られる。最終階級は中将。"},{"page_url":"https://de.wikipedia.org/wiki/Elmar_Fischer_(Bischof)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Hirschgraben2FK.JPG","page_title":"Elmar Fischer (Bischof)","context_page_description":"Elmar Fischer ist emeritierter römisch-katholischer Bischof der Diözese Feldkirch."},{"page_url":"https://pl.wikipedia.org/wiki/Gieorgij_Szachnazarow","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Sergei_Shakhrai_2014.jpg","page_title":"Siergiej Szachraj (polityk)","context_page_description":"Siergiej Michaiłowicz Szachraj, rosyjski polityk.\\nAbsolwent wydziału prawa Uniwersytetu Rostowskiego. Od 1991 do 1992 państwowy doradca Republiki Federalnej Socjalistycznych Republik Radzieckich ds. polityki prawnej. Od 1991 do 1994 wiceprzewodniczący Państwowego Komitetu Federacji Rosyjskiej ds. Federacji i Narodowości. Od listopada 1992 członek Rady Bezpieczeństwa. Od stycznia 1994 minister ds. narodowości i polityki regionalnej Rosji. Deputowany do Dumy Państwowej i przewodniczący parlamentarnej frakcji \\"Partii Rossijskogo Jedinstwa i Sogłasija\\"."},{"page_url":"https://en.wikipedia.org/wiki/Bastiaan_Ragas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Bastiaan_ragas-1442683947.jpg","page_title":"Bastiaan Ragas","context_page_description":"Bastiaan Johannes Ragas is a Dutch singer and actor. Born in Lisse, he was the youngest of three brothers. Ragas learnt piano and guitar at school. He also participated and traveled with the international musical group Up With People during their 1989-1990 tour. He first came into the public eye as a member of the Anglo-Dutch boy band Caught in the Act in the 1990s.\\nCaught in the Act broke up in 1998 and Ragas embarked on a solo career. His first album, Tomorrow is Looking Good, was released in 2000. Also in 2000, he played Radames in the Dutch production of the musical Aïda. He later played d'Artagnan in Joop van den Ende's 2003–2004 production of 3 Musketiers.\\nRagas has also worked in film, appearing in the West Frisian language film De Sportman van de Eeuw and providing the Dutch voice of Sinbad in Sinbad: Legend of the Seven Seas. Working on Sinbad he met TV presenter Tooske Breugem and they later starred together in 3 Musketiers in which she played Constance. Their 2003 single Alles reached number in the Dutch charts. They married in 2005 and have three daughters. Ragas also has a son by a previous relationship with singer and TV presenter Laura Vlasblom."},{"page_url":"https://no.wikipedia.org/wiki/Sirusho","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Sirusho_pic.jpg","page_title":"Sirusho","context_page_description":"Siranusj Harutjunjan er en armensk sanger og komponist, bedre kjent som Sirusho.\\nSirusho var med i Eurovision Song Contest 2008 med sangen «Qele Qele», som kom på 4.-plass med 199 poeng, og det er det beste resultatet Armenia har fått i Eurovision Song Contest."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E9%A6%99%E6%B8%AF%E5%85%AC%E5%85%B1%E5%B1%8B%E9%82%A8%E4%B8%80%E8%A6%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Kin_Sang_Estate_%28full_view%29.JPG","page_title":"香港公共屋邨一覽","context_page_description":"呢個係香港資助出租公共屋邨嘅一覽表。去到2020年4月為止，香港總共有251個公共屋邨同超過85萬個單位。呢個表以地區劃分，再以首次入伙年份排（「一邨」、「二邨」等等有細分嘅屋邨會當係唔同屋邨同埋由原址分拆而成嘅，個表入面會放埋一齊，方便比較）。\\n公共屋邨，就係指由政府、志願團體或者私營企業興建，再以廉價租畀低收入居民嘅住宅。而家香港提供公共屋邨嘅機構有三間，分別係香港房屋委員會（房委會）、香港房屋協會（房協）同埋香港平民屋宇有限公司（平民屋宇）。另外重有兩間情況唔清楚嘅建屋團體，佢哋而家嘅情況就連房委會同房協都唔清楚：\\n香港模範屋宇會：原本起同管理鰂魚涌模範邨，之後喺1979年11月由房屋委員會接管。\\n香港經濟屋宇會：原本起同管理大角咀葛量洪夫人新村，之後因為起西九龍走廊，1977年1月1號開始部分單位要由政府接管同拆卸。直到1980年代淨低嘅單位都因應房協「市區改善計劃」而拆咗，呢啲單位而家嘅位置係喺房協頌賢花園，喺1988年落成。"},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Gifu-Hashima","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Gifu_Hashima_Station_01.JPG","page_title":"Bahnhof Gifu-Hashima","context_page_description":"Der Bahnhof Gifu-Hashima befindet sich in der Vorstadt Hashima von Gifu in Japan."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%84%D8%A7%D9%8A%D8%B3_%D8%A3%D8%AF%D9%88%D9%84%D9%81_%D9%81%D9%84%D9%85%D9%86%D8%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Fleming%2C_Claes_Adolph_%28ur_Svenska_landtmarskalkar%29.jpg","page_title":"كلايس أدولف فلمنج","context_page_description":"كلايس أدولف فلمنج هو سياسي سويدي، ولد في 24 أبريل 1771 في السويد، وتوفي في 12 مايو 1831 في السويد."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A1%9C%EB%A7%88_%EC%A0%9C%EA%B5%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Roman_Colosseum_With_Moon.jpg","page_title":"로마 제국","context_page_description":"로마 제국은 황제 지배 체제 혹은 원수정을 사실상 시작한 기원전 27년부터 몰락까지의 로마를 일컫는다. 로마 제정 시대의 종식은 395년 동서 로마의 분할, 476년 서로마 제국 멸망, 1453년 동로마 제국 멸망 등 관점에 따라 다르게 볼 수 있다.\\n로마 제국은 지중해 동부의 헬레니즘 문화권과 이집트, 유대, 서부의 옛 카르타고, 히스파니아, 갈리아 등의 기존 영토에 이어 브리타니아와 라인 강 서쪽의 게르마니아, 그리스 북쪽의 다키아까지 판도를 넓혔다. 이러한 패권주의는 로마 제국에 막대한 부를 안겨주었을 뿐만 아니라, 로마 제국의 문화를 고대 지중해 세계에 널리 퍼뜨려, 로마 제국의 건축, 법, 정치, 종교 등이 전해지게 되었다."},{"page_url":"https://de.wikipedia.org/wiki/Castle_Ashby_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Castle_Ashby_from_Jones%27_views_%281819%29.JPG","page_title":"Castle Ashby House","context_page_description":"Castle Ashby House ist ein Landhaus beim Dorf Castle Ashby in der englischen Grafschaft Northamptonshire. Es ist einer der Sitze des Marquess of Northampton."},{"page_url":"https://de.wikipedia.org/wiki/Goldruten","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Solidago_virgaurea_Sturm11.jpg","page_title":"Goldruten","context_page_description":"Die Goldruten, auch Goldrauten genannt, sind eine Pflanzengattung innerhalb der Familie der Korbblütler. Die etwa 100 Arten sind hauptsächlich in Nordamerika verbreitet."},{"page_url":"https://en.wikipedia.org/wiki/Nuclear_Reactor_Operator_Badge","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/USA_-_Nuclear_Reactor_Operators_2.png","page_title":"Nuclear Reactor Operator Badge","context_page_description":"The Nuclear Reactor Operator Badge is a decoration of the United States Army which was issued between the years of 1965 and 1990. In 1991, the decoration was declared obsolete by Army Regulation 600-8-22, but uniform regulations permit the continued wearing of badges awarded before then. The Nuclear Reactor Operator Badge is worn above the ribbons over the left pocket flap of the Army uniform, in the same position as the Parachutist Badge.\\nThe Nuclear Reactor Operator Badge was first authorized on June 18, 1965. The badge was issued in four degrees; the basic badge was awarded upon completion of the U.S. Army Nuclear Power Plant Operators Course. The Nuclear Reactor Operator Badge was worn on dress uniforms and also on duty uniforms in a subdued version. Miniature Nuclear Reactor Operator Badges were authorized for wear on dinner dress attire."},{"page_url":"https://lt.wikipedia.org/wiki/Urvin%C4%97_hiena","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Proteles_cristatus1.jpg","page_title":"Urvinė hiena","context_page_description":"Urvinė hiena, žeminis vilkas, urvinis vilkas – hieninių šeimai priklausantis plėšrus žinduolis, gyvenantis Pietų ir Rytų Afrikos savanose. Panašus į vilkus, bet neturi tokių tvirtų žandikaulių ir dantų, nes daugiausia minta termitais ir vabzdžių lervomis. Kartais gaudo peles ar ėda ant žemės perinčių paukščių kiaušinius. Žeminio vilko dryžuotas kailis – puiki maskuotė."},{"page_url":"https://ca.wikipedia.org/wiki/O_Bolo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Situacion_O_Bolo.PNG","page_title":"O Bolo","context_page_description":"O Bolo és un municipi de la Província d'Ourense a Galícia. Pertany a la Comarca de Valdeorras. És format per nombroses pedanies com les de Santa Cruz, Chao das Donas i Cambela."},{"page_url":"https://hu.wikipedia.org/wiki/Merviller","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Viaduc_de_Criviller.jpg","page_title":"Merviller","context_page_description":"Merviller település Franciaországban, Meurthe-et-Moselle megyében. Merviller Baccarat, Bertrichamps, Brouville, Gélacourt, Montigny, Reherrey, Vacqueville és Veney községekkel határos."},{"page_url":"https://de.wikipedia.org/wiki/Lack","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Hesse_Lackbef%C3%BCllung.jpg","page_title":"Lack","context_page_description":"Lack ist ein flüssiger oder auch pulverförmiger Beschichtungsstoff, der dünn auf Gegenstände aufgetragen wird und durch chemische oder physikalische Vorgänge zu einem durchgehenden, festen Film aufgebaut wird. Lacke bestehen in der Regel aus Bindemitteln wie Harze, Dispersionen oder Emulsionen, Füllstoffen, Pigmenten, Lösemitteln, und Additiven, wie Biozide.\\nDie drei Hauptaufgaben von Lacken sind:\\nProtektion,\\nDekoration und\\nFunktion.\\nSchätzungen zufolge wurden im Jahr 2007 weltweit etwa 28 Milliarden Liter Lack im Wert von 92 Milliarden US-Dollar produziert."},{"page_url":"https://en.wikipedia.org/wiki/Xijiao_line","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Bagou_Station_%28Xijiao_Line%29_Platform_20171231.jpg","page_title":"Xijiao line","context_page_description":"The Xijiao Line of the Beijing Subway is a light rail line in Haidian District of Beijing. It runs west and north from Bagou on Line 10 to the Fragrant Hills - a total length of 8.8 km. It was opened on December 30, 2017."},{"page_url":"https://pl.wikipedia.org/wiki/Henryk_Pillati","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Pillati_Death_of_Berek_Joselewicz.jpg","page_title":"Henryk Pillati","context_page_description":"Henryk Pillati – polski malarz, rysownik, ilustrator i karykaturzysta."},{"page_url":"https://de.wikipedia.org/wiki/Mayor%E2%80%99s_Destiny","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Mayors_Destiny.jpg","page_title":"Mayor’s Destiny","context_page_description":"Mayor’s Destiny ist eine vierköpfige deutsche Pop-, Rock- und Country-Band. Sie wurde 2008 gegründet und mit ihrer Debütsingle Cross Your Heart bekannt. Diese schaffte es auf Platz 53 der deutschen Singlecharts. Mayor’s Destiny standen bei Icezone Music unter Vertrag. Ihren größten Auftritt hatten sie am 30. Mai 2008 bei The Dome 46 in Bremen."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%BE%D9%88%D8%B1%D9%B9_%D8%A8%D9%84%DB%8C%D8%A6%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Andaman_chatham_is.jpg","page_title":"پورٹ بلیئر","context_page_description":"پورٹ بلیئر\\nتلفظ; بنگالی: পোর্ট ব্লেয়ার; ہندی: पोर्ट ब्लेयर جزائر انڈمان پر ضلع انڈمان کا سب سے بڑا شہر اور بلدیاتی کونسل ہے۔ جزائر انڈمان و نکوبار کا دارالحکومت بھی ہے۔\\nبرطانوی دور کی بدنام جیل کالا پانی یہیں واقع ہے۔"},{"page_url":"https://it.wikipedia.org/wiki/Aleksandrov-Kalinin_AK-1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/%D0%95%D0%B4%D0%B8%D0%BD%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%90%D0%9A-1_%22%D0%94%D0%BE%D0%B1%D1%80%D0%BE%D0%BB%D0%B5%D1%82%22._%D0%90%D0%BD%D0%B3%D0%B0%D1%80._%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%B3%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%B0%D0%B2%D0%B8%D0%B0%D1%86%D0%B8%D0%B8._%D0%A3%D0%BB%D1%8C%D1%8F%D0%BD%D0%BE%D0%B2%D1%81%D0%BA._%D0%9D%D0%BE%D1%8F%D0%B1%D1%80%D1%8C_2013_-_panoramio.jpg","page_title":"Aleksandrov-Kalinin AK-1","context_page_description":"L'Aleksandrov-Kalinin AK-1 fu il primo aereo di linea sovietico. Realizzato in un unico esemplare nell'ambito di un programma di ricerca tecnologica, prese il nome dai due progettisti, Vladimir Leont'evič Aleksandrov e Vladimir Vladimirovič Kalinin."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%99%D7%92%D7%99%D7%98%D7%9C%D7%99/%D7%90%D7%A0%D7%9C%D7%95%D7%92%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Radiocontrolledclock.jpg","page_title":"דיגיטלי/אנלוגי","context_page_description":"דיגיטלי ואנלוגי הם תכונות של אותות או סדרת התרחשויות. המושגים משמשים רבות בתחומי האלקטרוניקה והמחשוב.\\nהתקנים אנלוגיים עוקבים אחרי מהלכם של אירועים ושל גדלים פיזיקליים ממשיים ומבטאים אותם בצורה פלט אשר דומה לאירוע עצמו. בהתאם לכך הייצוג האנלוגי מבטא על פי רוב פעולה מתמשכת ורציפה. בהתאם לכך, האות האנלוגי הוא אות רציף שמספר הערכים שהוא יכול לקבל אינו סופי.\\nלעומתו, הייצוג הדיגיטלי הוא בדיד ומחולק למספרים. לכן אות דיגיטלי הוא אות שיכול לקבל מספר סופי של ערכים. דוגמה לכך היא ההבדל בין מחוג הדקות בשעון אנלוגי - היכול להיות בכל אחד מאינסוף המקומות שבין השנתות הסמוכות - לבין שעון דיגיטלי, אשר יכול להראות רק 60 ערכים שונים בחיווי הדקות שלו."},{"page_url":"https://es.wikipedia.org/wiki/Joaquim_Josep_Ve%C3%A0_Bar%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/JoaquimVe%C3%A0Baro_Veracruz.jpg","page_title":"Joaquim Josep Veà Baró","context_page_description":"Joaquim Josep Veà Baró fue un científico primatólogo español.\\nDiscípulo de Jordi Sabater Pi, fue profesor de psicobiología de la Universidad de Barcelona y director del Centro Especial de Investigación de Primates de la misma universidad. Su investigación en la selva de Zaire y Veracruz se centró en las relaciones entre el medio ambiente y el comportamiento de los primates no humanos en la naturaleza y los cambios producidos en estas relaciones debido a la actividad humana.\\nMurió en Barcelona el 23 de febrero de 2016, dos años después de que se le detectara un cáncer.​"},{"page_url":"https://pt.wikipedia.org/wiki/For%C3%A7as_Terrestres_da_Eslov%C3%A1quia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Slovak_Army_Roundel.png","page_title":"Forças Terrestres da Eslováquia","context_page_description":"As Forças Terrestres da Eslováquia são o ramo terrestre da República Eslovaca. Atuam nas Forças armadas de seu país, exercendo as funções de um exército de prestar suporte e ajuda e ainda guerrear via terrestre."},{"page_url":"https://el.wikipedia.org/wiki/NGC_1128","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/3c75.jpg","page_title":"NGC 1128","context_page_description":"Ο NGC 1128 είναι ένας από τους γαλαξίες του σμήνους γαλαξιών Abell 400. Είναι το κέντρο της ραδιοπηγής 3C 75 και περιέχει δύο υπερμεγέθεις μαύρες τρύπες που βρίσκονται σε περιδίνηση η μία γύρω από την άλλη. Σύμφωνα με προσομοιώσεις σταδιακά η απόσταση ανάμεσα στις δύο μαύρες τρύπες θα μειωθεί μέχρι που θα συγχωνευθούν. Ο αστρονόμος Λιούις Α. Σουίφτ ανεκάλυψε τον NGC 1128 το 1886."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8C%D5%B8%D6%82%D5%A4%D5%B8%D5%AC%D6%86_%D4%B4%D5%AB%D5%A6%D5%A5%D5%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Diesel_Unterschrift.png","page_title":"Ռուդոլֆ Դիզել","context_page_description":"Ռուդոլֆ Դիզել, մարտի 18, 1858, Մարսել - սեպտեմբերի 30, 1913, Լա Մանշ, գերմանացի ինժեներ, սեղմումից բռնկվող ներքին այրման շարժիչի ստեղծողը։"},{"page_url":"https://de.wikipedia.org/wiki/Tsavagattaq","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Tsavagattaq.jpg","page_title":"Tsavagattaq","context_page_description":"Tsavagattaq ist ein Bergmassiv im ostgrönländischen Renland. Es ist unter Bergsteigern für seine drei spitzen Gipfel bekannt.\\nDie drei Gipfelspitzen sind die Nordspitze, die Turmspitze in der Mitte und die niedrigere Südspitze.\\nIn unmittelbarer Nähe befindet sich die spektakuläre Grundtvigskirken, welche 2010 von einer Schweizer Bergsteigergruppe um Roger Schäli mit großer Medienresonanz bestiegen wurde."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%87%8E%E8%9B%9E%E8%9D%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Agriolimacidae_-_Deroceras_cf._agreste.JPG","page_title":"野蛞蝓","context_page_description":"野蛞蝓为一种陆生会呼吸空气的蛞蝓类动物，属柄眼目旋蜗牛亚目蛞蝓下目的野蛞蝓科野蛞蝓属。"},{"page_url":"https://fi.wikipedia.org/wiki/Guilin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Guilin_Scene.jpg","page_title":"Guilin","context_page_description":"Guilin on prefektuuritason kaupunki Guangxin zhuangien autonomisella alueella Etelä-Kiinassa. Kaupungin pinta-ala on 27 809 km² ja asukasluku on 4 747 963. Kaupungin keskusta sijaitsee linnuntietä noin 330 kilometriä autonomisen alueen pääkaupunki Nanningista koilliseen."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9A%E0%B5%86%E0%B4%B1%E0%B5%81%E0%B4%95%E0%B5%8A%E0%B4%A8%E0%B5%8D%E0%B4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Kanak_Champa_%28Pterospermum_acerifolium%29_in_Hyderabad_W_IMG_7125.jpg","page_title":"ചെറുകൊന്ന","context_page_description":"ഇന്ത്യ, മ്യാന്മർ, ശ്രീലങ്ക എന്നിവിടങ്ങളിൽ കാണപ്പെടുന്ന വൃക്ഷം. മലന്തുടലി, കനകചമ്പ എന്നും അറിയപ്പെടുന്ന ചെറുകൊന്ന ഒരു നിത്യഹരിതവൃക്ഷമാണ്. 30 മീറ്ററോളം ഉയരം വയ്ക്കും. ഇലകളുടെ മുകൾവശത്തിന് പച്ചനിറവും അടിവശത്തിന് ചാരനിറവുമാണ്. വലിയ ഇലകൾ ഭക്ഷണം കഴിക്കാൻ ഉപയോഗിക്കാറുണ്ട്. രാത്രിയിൽ പുഷ്പിക്കുന്ന വെളുത്തപൂക്കളാണ് ചെറുകൊന്നയ്ക്ക്. തണൽമരമായും അലങ്കാരവൃക്ഷമായും നട്ടുവളർത്തുന്നു. ഇലയുടെ അടിയിലുള്ള പൊടി മുറിവുണക്കാൻ ഉപയോഗിക്കാറുണ്ട്. അൾസറിനെതിരെ ഔഷധമാണ്."},{"page_url":"https://nl.wikipedia.org/wiki/Tegula_hotessieriana","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Tegula_hotessieriana_001.jpg","page_title":"Tegula hotessieriana","context_page_description":"Tegula hotessieriana is een slakkensoort uit de familie van de Tegulidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1842 door d’Orbigny."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E6%BA%AA%E5%BF%A0%E5%8B%87%E4%BE%AF%E5%BB%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/%E8%A5%BF%E6%BA%AA%E5%BF%A0%E5%8B%87%E4%BE%AF%E5%BB%9F_%E9%96%80%E7%A5%9E_%283%29.jpg","page_title":"西溪忠勇侯廟","context_page_description":"西溪忠勇侯廟，古名王公宮，臺灣澎湖縣湖西鄉西溪村廟宇，主祀忠勇侯，法師流派為「普庵派」。"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0_%D0%A1%D0%B8%D0%BC%D0%B8%D1%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Nikola_Simic_-_Producenti_-_premijera_13.jpg","page_title":"Никола Симиќ","context_page_description":"Никола Симиќ бил српски глумец, најпознат по неговата улога како Мита Пантиќ во неколку филмови, особено во југословенскиот филм „Tesna koža“. Тој учествувал во повеќе од 160 филмови почнувајќи од 1957 година."},{"page_url":"https://ceb.wikipedia.org/wiki/R%C5%AF%C5%BE%C4%8Fka","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/R%C5%AF%C5%BE%C4%8Fka_prapor.png","page_title":"Růžďka","context_page_description":"Lungsod ang Růžďka sa Nasod nga Czech. Nahimutang ni sa lalawigan sa Zlínský kraj, sa sidlakang bahin sa nasod, 270 km sa sidlakan sa Prague ang ulohan sa nasod. 389 metros ibabaw sa dagat kahaboga ang nahimutangan sa Růžďka, ug adunay 877 ka molupyo.\\nAng yuta palibot sa Růžďka kay medyo bungtoron. Ang kinahabogang dapit sa palibot dunay gihabogon nga 581 ka metro ug 1.0 km sa habagatan sa Růžďka. Dunay mga 459 ka tawo kada kilometro kwadrado sa palibot sa Růžďka nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Vsetín, 6.1 km sa habagatan sa Růžďka. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Růžďka. Sa rehiyon palibot sa Růžďka, kabukiran talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Enero, sa -10 °C. Ang kasarangang pag-ulan 1,189 milimetro matag tuig. Ang kinabasaan nga bulan Enero, sa 145 milimetro nga ulan, ug ang kinaugahan Abril, sa 57 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Northern_Thai_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Thai_dancer_Chiang_Mai_2005_045.jpg","page_title":"Northern Thai people","context_page_description":"The Northern Thai people or Tai Yuan, self-designation khon muang are a Tai ethnic group, native to eight provinces in Northern Thailand, principally in the area of the former kingdom of Lan Na. As a Tai group, they are closely related to Tai Lü and Tai Khün with regards to common culture, language and history as well as to Thailand's dominant Thai ethnic group. There are approximately 6 million Tai Yuan. Most of them live in Northern Thailand, with a small minority 29,442 living across the border in Bokeo Province and Sainyabuli Province and Luang Namtha Province of Laos. Their language is called Northern Thai, Lanna or Kham Mueang."},{"page_url":"https://en.wikipedia.org/wiki/%C5%8Csakaj%C5%8Dk%C5%8Den_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Osakajokoen_Sta01s4s3200.jpg","page_title":"Ōsakajōkōen Station","context_page_description":"Ōsakajō-kōen Station is a railway station on the West Japan Railway Company Osaka Loop Line in Jōtō-ku, Osaka, Japan. The station name translates as Osaka Castle Park."},{"page_url":"https://de.wikipedia.org/wiki/Arthur_Georg_Pino_von_Friedenthal","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Arthur_Pino_von_Friedenthal.png","page_title":"Arthur Georg Pino von Friedenthal","context_page_description":"Arthur Georg Freiherr Pino von Friedenthal war ein österreichisch-schlesischer Generalmajor."},{"page_url":"https://is.wikipedia.org/wiki/Sk%C3%B3gbursti","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Orgyia_anttiqua_3_beentree.jpg","page_title":"Skógbursti","context_page_description":"Skógbursti er fiðrildi í ættinni Erebidae. Hann er útbreiddur um mestallt norðurhvel, en hefur helst fundist á sunnanverðu Íslandi."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D1%81%D1%82%D0%B0_%D0%A1%D0%BB%D0%BE%D0%B2%D0%B0%D1%87%D1%87%D0%B8%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Coat_of_arms_of_Levo%C4%8Da.png","page_title":"Міста Словаччини","context_page_description":"Це список міст та містечок Словаччини."},{"page_url":"https://nl.wikipedia.org/wiki/Plan-d%27Aups-Sainte-Baume","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Grot_van_Maria_Magdalena_bij_Plan_d%E2%80%99Aups.jpg","page_title":"Plan-d'Aups-Sainte-Baume","context_page_description":"Plan-d'Aups-Sainte-Baume is een gemeente in het Franse departement Var en telt 764 inwoners. De plaats maakt deel uit van het arrondissement Brignoles. In Plan d’Aups bevindt zich op 1500 m. hoogte het pelgrimsoord Grot van Maria Magdalena. Hier zou deze vrouw uit het leven van Jezus Christus na haar aankomst in Frankrijk 30 jaar hebben gewoond en gebeden. Na haar overlijden zou zij in het nabije Saint-Maximin-la-Sainte-Baume zijn begraven."},{"page_url":"https://it.wikipedia.org/wiki/Qilian_Shan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/DEMQilianShan.png","page_title":"Qilian Shan","context_page_description":"I monti Qilian, in cinese 祁連山山: Qilian Shan o Ch'i-lien Shan, noti anche come Nan Shan, sono un'impervia catena montuosa situata al confine tra le province di Qinghai e Gansu.\\nI ghiacciai presenti nell'area ricoprono una superficie di circa 1970 km² e contengono circa 95 km³ di ghiaccio. Questa vasta riserva di ghiaccio costituisce la più importante riserva idrica per impiego agricolo e industriale e utilizzo pubblico per il corridoio di Hexi a nord e per il bacino del Qaidam a sud. Tali monti si innalzano fino a 5800 m, e la maggior parte delle vette supera i 4000 m. La neve ricopre le cime dei monti, e branchi di bestiame domestico pascolano nelle valli ben irrigate.\\nBaluardo insormontabile e privo di passi, la catena montuosa forma il confine meridionale del corridoio di Hexi, storico passaggio tra la Cina orientale e l'Asia centrale."},{"page_url":"https://fr.wikipedia.org/wiki/Melogold","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Melogold_Hybrid.jpg","page_title":"Melogold","context_page_description":"Melogold, désigne un agrume hybride triploïde de pamplemoussier Siamese Sweet 2N sans acidité et le pomélo Marsh 4N développé à University of California Riverside par Robert K. Soost et James W. Cameronen en 1958 et commercialisé en 1986 lors d'une campagne qui vit également naitre Oroblanco."},{"page_url":"https://vi.wikipedia.org/wiki/Tr%C6%B0%E1%BB%9Dng_kinh_doanh","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/ESSEC_campus_Cergy.PNG","page_title":"Trường kinh doanh","context_page_description":"Trường kinh doanh là một tổ chức giáo dục đại học cấp các văn bằng về quản trị kinh doanh hoặc quản lý. Theo Kaplan, các Trường kinh doanh là \\"các tổ chức giáo dục chuyên giảng dạy các khóa học và chương trình liên quan đến kinh doanh và quản lý\\". Một ngôi trường như vậy cũng có thể được gọi là Trường quản lý, Trường quản trị kinh doanh, hoặc B-school. Trường kinh doanh dạy các chủ đề như kế toán, quản trị, chiến lược, kinh tế, kinh doanh, tài chính, quản lý nhân sự, khoa học quản lý, hệ thống thông tin quản lý, kinh doanh quốc tế, hậu cần, tiếp thị, tâm lý tổ chức, quan hệ công chúng, phương pháp nghiên cứu và thực tế bất động sản cùng nhiều chủ đề khác."},{"page_url":"https://nl.wikipedia.org/wiki/Europa_(beeld)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Europa_Hans_Kuijper.JPG","page_title":"Europa (beeld)","context_page_description":"Europa is een beeld van Hans Kuyper.\\nHet beeld stamt uit circa 1995. Vanaf 2005 staat in een parkje nabij de Arend Westermanbrug, ten noordwesten van de plaats waar de Postjeswetering en Admiralengracht samenvloeien. De doorgaande weg waaraan het kunstwerk te zien is heet de Postjesweg. Vanaf plaatsing tot 2005 stond het beeld op het Columbusplein.\\nHet beeld laat een zich in het water bevindende jongeman zien, die naar de bodem duikt. Daarbij gaf Kuyper het water weer in de vorm van de zuil; aan de handen en voeten bevinden zich spiraalvormige uiteinden die staan voor het kolkende water achter de duiker. Het bronzen beeld staat op een betonnen ondergrond, dat weggewerkt is met klinkers."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%81%B0%E8%84%9A%E6%9F%B3%E8%8E%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Pale-legged_Leaf_Warbler_-_Cropped.jpg","page_title":"灰脚柳莺","context_page_description":"灰脚柳莺又名淡脚柳莺，为柳莺科柳莺属的鸟类。在中国大陆，分布于内蒙古、东部沿海等地。该物种的模式产地在福建。"},{"page_url":"https://de.wikipedia.org/wiki/Albeuve","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Albeuve-Rue.jpg","page_title":"Albeuve","context_page_description":"Albeuve ist eine Ortschaft und früher selbständige politische Gemeinde im Distrikt Greyerz des Kantons Freiburg in der Schweiz. Am 1. Januar 2002 fusionierte Albeuve zusammen mit Neirivue, Lessoc und Montbovon zur neuen Gemeinde Haut-Intyamon, deren Gemeindeverwaltung sich in Albeuve befindet. Der frühere deutsche Name Weissbach wird heute nicht mehr verwendet."},{"page_url":"https://hu.wikipedia.org/wiki/Raiamas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Raiamas_bola_Day.png","page_title":"Raiamas","context_page_description":"A Raiamas a csontos halak főosztályának sugarasúszójú halak osztályába, a pontyalakúak rendjébe, a pontyfélék családjába, és az Rasborinae alcsaládjába tartozó nem."},{"page_url":"https://hu.wikipedia.org/wiki/K%C3%B6nig-oszt%C3%A1ly","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Internment_at_Scapa_Flow.svg","page_title":"König-osztály","context_page_description":"A König-osztály a Császári Haditengerészet egyik csatahajóosztálya volt, melynek négy egysége az első világháború elején állt szolgálatba. Tagjai a König, a Großer Kurfürst, a Markgraf és a Kronprinz voltak. A „Königek” az őket megelőző Kaiser-osztály továbbfejlesztett változatai voltak, hozzájuk képest a legjelentősebb különbség a lövegtornyok elrendezésének módosítása volt.\\nTöbbnyire együtt tevékenykedve a haditengerészet fő erőit tömörítő Nyílt-tengeri Flotta III. csatahajórajához tartozó V. divíziót alkották. A háború számos hadműveletében részt vettek, így ott voltak a skagerraki csatában is, ahol a német csatavonal élét képezték. Mindegyik hajó túlélte a világháborút és 1918 novemberében Scapa Flow-ban internálták őket, ahol 1919. június 21-én Ludwig von Reuter ellentengernagy utasítására legénységük elsüllyesztette őket a Hochseeflotte többi itt lévő egységével együtt, hogy a britek ne szerezhessék meg őket."},{"page_url":"https://en.wikipedia.org/wiki/Ancient_Rome","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Pont_du_Gard_BLS.jpg","page_title":"Ancient Rome","context_page_description":"In historiography, ancient Rome is Roman civilization from the founding of the Italian city of Rome in the 8th century BC to the collapse of the Western Roman Empire in the 5th century AD, encompassing the Roman Kingdom, Roman Republic and Roman Empire until the fall of the western empire.\\nThe civilisation began as an Italic settlement in the Italian Peninsula, traditionally dated to 753 BC, that grew into the city of Rome and which subsequently gave its name to the empire over which it ruled and to the widespread civilisation the empire developed. The civilization was led and ruled by the Romans, alternately considered an ethnic group or a nationality. The Roman Empire expanded to become one of the largest empires in the ancient world, still ruled from the city, with an estimated 50 to 90 million inhabitants covering 5.0 million square kilometres at its height in AD 117.\\nIn its many centuries of existence, the Roman state evolved from an elective monarchy to a democratic classical republic and then to an increasingly autocratic semi-elective military dictatorship during the Empire."},{"page_url":"https://simple.wikipedia.org/wiki/David_Halberstam","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/David_Halberstam_1978.JPG","page_title":"David Halberstam","context_page_description":"David Halberstam was an American journalist and historian of Jewish descent. He was known for his early work on the Vietnam War, his work on politics, history, the Civil Rights Movement, business, media, American culture, and his later sports journalism. He won a Pulitzer Prize for journalism in 1964."},{"page_url":"https://en.wikipedia.org/wiki/Mere,_Belgium","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Gotegemmolen_Mere_rad.JPG","page_title":"Mere, Belgium","context_page_description":"Mere is a sub-municipality of Erpe-Mere in Flanders. It is located on the Molenbeek-Ter Erpenbeek in the Denderstreek in the southeast of East Flanders and belongs to Arrondissement of Aalst. It is bordered by the sub-municipalities of Erpe, Ottergem, Bambrugge and Aaigem and the municipalities Haaltert and Aalst. Mere has 5033 inhabitants as of 1 January 2003 and an area of 5.77 km. The population density is 873 inhabitants / km ²."},{"page_url":"https://fr.wikipedia.org/wiki/Baron_Corbin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Baron_Corbin_with_Andr%C3%A9_the_Giant_trophy.jpg","page_title":"Baron Corbin","context_page_description":"Thomas Pestock, est un catcheur américain connu sous le nom de ring de King Corbin. Il travaille actuellement à la World Wrestling Entertainment, dans la division SmackDown."},{"page_url":"https://sk.wikipedia.org/wiki/Saint-Vallier-de-Thiey","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Map_commune_FR_insee_code_06130.png","page_title":"Saint-Vallier-de-Thiey","context_page_description":"Saint-Vallier-de-Thiey je francúzska obec, ktorá sa nachádza v departemente Alpes-Maritimes, v regióne Provence-Alpes-Côte d’Azur."},{"page_url":"https://vi.wikipedia.org/wiki/Jarocin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Flaga_Jarocina.png","page_title":"Jarocin","context_page_description":"Jarocin là một thị trấn thuộc hạt Jarocin, tỉnh Greater Poland, miền trung Ba Lan. Từ năm 1975-1998, thị trấn nằm trong tỉnh Kalisz, kể từ năm 1999 đến nay, nó thuộc quyền quản lý của tỉnh Greater Poland. Thị trấn có diện tích 14,44 km². Tính đến năm 2006, dân số của thị trấn là 25.834 người với mật độ 1.800 người/km².\\nJarocin là một thị trấn lịch sử và đã được trao đặc quyền thị trấn theo luật Magdeburg từ thế kỷ thứ 13. [1] Tòa thị chính Ratusz được xây dựng từ những năm 1799 - 1804, hiện nay nó được sử dụng làm Bảo tàng Jarocin là một trong những địa điểm thu hút khách du lịch nhất của thị trấn\\nThị trấn cũng được biết đến rộng rãi thông qua Lễ hội Jarocin, đây là một trong những lễ hội âm nhạc punk rock đầu tiên của Warsaw trước đây cũng như của cả Châu Âu. Lễ hội Jarocin đầu tiên được tổ chức vào năm 1980. [2]"},{"page_url":"https://af.wikipedia.org/wiki/Susan_Gerbic","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Gerbic_John_Edward.jpg","page_title":"Susan Gerbic","context_page_description":"Susan Marie Gerbic is 'n Amerikaanse skeptiese aktivis wat in Salinas, Kalifornië woon. Gerbic is die medestigter van Monterey County Skeptics, stigter en leier van die Guerrilla-skeptisime op Wikipedia-projek, ' n gereelde bydraer tot Skeptical Inquirer, en 'n medewerker van die Committee for Skeptical Inquiry. Gerbic het 'n groot deel van haar skeptiese aktivisme toegespits op mense wat beweer dat hulle heldersiende mediums is, soos Sylvia Browne, Tyler Henry en Thomas John, wat sy 'hartseervampiere' noem."},{"page_url":"https://sl.wikipedia.org/wiki/Gdynia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Basen-portowy-gdynia.jpg","page_title":"Gdynia","context_page_description":"Gdynia je mesto in pristanišče na severu Poljske in Pomorjanskega vojvodstva. Leži ob Baltskem morju, ob Gdanskem zalivu.\\nLeta 2014 je mestno prebivalstvo štelo 247.792 ljudi, skupaj s sosednjima mestoma pa tvori konurbacijo Tromestje z 747.370 prebivalci."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Illnau-Effretikon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Trafostation_DSC2263.jpg","page_title":"Liste der Kulturgüter in Illnau-Effretikon","context_page_description":"Die Liste der Kulturgüter in Illnau-Effretikon enthält alle Objekte in der Gemeinde Illnau-Effretikon im Kanton Zürich, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind weitere geschützte Objekte zu finden, die im Verzeichnis der Objekte von überkommunaler Bedeutung der kantonalen Denkmalpflege zu finden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://et.wikipedia.org/wiki/Mereelustik","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Vetikad.jpg","page_title":"Mereelustik","context_page_description":"Mereelustik ehk talassobios on ookeanide ja merede elustik.\\nMereelustiku uurimisega tegeleb eeskätt merebioloogia.\\nTavaliselt eristatakse meres kahte elupaikade rühma: veemassi ja veepõhja.\\nMere pelagiaali elustiku ehk pelagose moodustavad järgmised organismide rühmitused: plankton ehk hõljum, nekton ehk ujum, neuston ehk pindkileorganismid ja pleuston. Bentaali elustiku ehk bentose moodustavad aga füto- ja zoobentos."},{"page_url":"https://it.wikipedia.org/wiki/Relazioni_bilaterali_tra_Giappone_e_Regno_Unito","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Japan_United_Kingdom_Locator.png","page_title":"Relazioni bilaterali tra Giappone e Regno Unito","context_page_description":"Le relazioni bilaterali tra il Giappone e il Regno Unito sono iniziate formalmente nel 1854, ma già nel 1600 l'opera diplomatica del navigatore inglese William Adams si rivelò decisiva per l'avvio dei primi accordi commerciali tra i due paesi. Prima di lui, nel XVI secolo, due giovani avventurieri giapponesi noti con i nomi cristiani di Christopher e Cosmas parteciparono ad alcune delle spedizioni dell'esploratore Thomas Cavendish. Con l'inizio del periodo di sakoku le relazioni tra i due paesi si interruppero, ma la firma sul trattato di amicizia del 1854 permise di ristabilire i legami i quali, nonostante un'altra pausa durante la seconda guerra mondiale, rimangono tuttora molto forti.\\nNel corso degli anni studiosi e media hanno fatto spesso ricorso all'espressione \\"Gran Bretagna d'oriente\\" per riferirsi al Giappone, a causa di alcune affinità storico-culturali, come l'adozione della monarchia parlamentare, l'essere una nazione insulare e un'enfasi nel modo di comportarsi rivolta all'autodisciplina personale, all'autocontrollo, alla modestia, alla riservatezza e alla correttezza nell'ambito delle relazioni sociali."},{"page_url":"https://hu.wikipedia.org/wiki/EML_Kalev","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Kalev_class_submarine_Estonia.png","page_title":"EML Kalev","context_page_description":"Az EML Kalev az Észt Haditengerészet brit gyártmányú dízel-elektromos meghajtású aknarakó tengeralattjárója volt, melyet a brit Vickers-Armstrongs Ltd. gyártott. Építését 1935 májusában kezdték el. 1936-ban bocsátották vízre, majd 1940-ben szovjet fennhatóság alá került. A második világháború során három bevetést hajtott végre. Az utolsó bevetéséről 1941 őszén azonban nem tért vissza, valószínűleg aknára futott és elsüllyedt a Finn-öbölben. Testvérhajója Lembit, amely napjainkban múzeumhajó Tallinnban."},{"page_url":"https://ga.wikipedia.org/wiki/Bournbrook","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Bournbrook_High_Street.jpg","page_title":"Bournbrook","context_page_description":"Is ceantar suite i mBirmingham é Bournbrook."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_Iberische_vlinders","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Melanargia_lachesis_M_2.jpg","page_title":"Lijst van Iberische vlinders","context_page_description":"Dit is een lijst van vlinders die voorkomen op het Iberisch Schiereiland met vermelding van de Spaanse naam."},{"page_url":"https://pt.wikipedia.org/wiki/M%C3%BChlpfad","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/M%C3%BChlpfad01.jpg","page_title":"Mühlpfad","context_page_description":"Mühlpfad é um município da Alemanha localizado no distrito de Rhein-Hunsrück, estado da Renânia-Palatinado.\\nPertence ao Verbandsgemeinde de Emmelshausen."},{"page_url":"https://de.wikipedia.org/wiki/Hochkreuz_Konrad-Adenauer-Park","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Hochkreuzadenauerpark.JPG","page_title":"Hochkreuz Konrad-Adenauer-Park","context_page_description":"Das Hochkreuz Konrad-Adenauer-Park befindet sich in Düren in Nordrhein-Westfalen im dortigen Park.\\nDas in der zweiten Hälfte des 19. Jahrhunderts errichtete Kreuz steht im Konrad-Adenauer-Park in der Innenstadt in der Kölnstraße gegenüber dem evangelischen Friedhof. Der Park war bis zum Beginn des 20. Jahrhunderts der zentrale Friedhof.\\nDas ca. 5 m hohe neugotische Sandsteinkreuz steht auf einem achteckigen, mit vier Stufen abgetreppten Sockel. Auf diesem steht ein Kreuzpfeiler mit einem annähernd lebensgroßen, steinernen Korpus.\\nDas Bauwerk ist unter Nr. 1/059 in die Denkmalliste der Stadt Düren eingetragen."},{"page_url":"https://nl.wikipedia.org/wiki/Anse","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Vue_Anse_69.jpg","page_title":"Anse","context_page_description":"Anse is een gemeente in het Franse departement Rhône en telt 4744 inwoners. De plaats maakt deel uit van het arrondissement Villefranche-sur-Saône. In de gemeente ligt spoorwegstation Anse.\\nBezienswaardig is het Castellum romain."},{"page_url":"https://de.wikipedia.org/wiki/Bansin","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Schloonsee.jpg","page_title":"Bansin","context_page_description":"Bansin ist ein Seeheilbad und Ortsteil der Gemeinde Ostseebad Heringsdorf auf der Insel Usedom im Landkreis Vorpommern-Greifswald in Mecklenburg-Vorpommern.\\nBansin gehört mit Heringsdorf und Ahlbeck zu den drei Kaiserbädern. Mit diesen und seit 2011 mit dem polnischen Seebad Świnoujście ist Bansin über die mit einer Länge von über zwölf Kilometern längste Strandpromenade Europas verbunden.\\nDer Ort ist durch geschlossene Ensembles der Bäderarchitektur geprägt, die oftmals Hotels und Ferienwohnungen beherbergen. Am 31. Dezember 2003 hatte Bansin als noch eigenständige Gemeinde 2503 Einwohner."},{"page_url":"https://en.wikipedia.org/wiki/Brit_Award_for_International_Female_Solo_Artist","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Bj%C3%B6rk_%40deer_lake_park_2.jpg","page_title":"Brit Award for International Female Solo Artist","context_page_description":"The Brit Award for International Female Solo Artist is an award given by the British Phonographic Industry, an organisation which represents record companies and artists in the United Kingdom. The accolade is presented at the Brit Awards, an annual celebration of British and international music. The winners and nominees are determined by the Brit Awards voting academy with over one-thousand members, which comprise record labels, publishers, managers, agents, media, and previous winners and nominees.\\nThe award was first presented in 1989 as International Female Solo Artist. The accolade was not handed out at the 1990, 1992 and 1993 ceremonies, with the award for International Solo Artist being awarded instead. The award for International Female Solo Artist was reinstated in 1994, and has been given ever since.\\nBjörk is the artist with the most wins and nominations in the category, with four awards won out of nine nominations. Artists from the United States have won the accolade eleven times, more than any other country."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9F%AF%E6%A1%A5%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Ke_Bridge_in_Shaoxing_01_2017-08.jpg","page_title":"柯桥区","context_page_description":"柯橋區是中華人民共和國浙江省紹興市的一個市轄區。柯橋區也是中國大陸經濟發達的縣級行政區之一，其綜合競爭力2010年位居浙江省第二位，全國百強縣第五位。地理上，柯橋區東與越城區交界，東北部和東南部與上虞區交界，南部和西南部分別與嵊州市、諸暨市交界，西部和北部與杭州市蕭山區交界，東北部一角瀕杭州灣。面積1196平方千米，人口72萬。郵政編碼312030。區人民政府駐柯橋街道群賢路1661號。工業以紡織、印染為主。商業以紡織品批發為主，是亞洲最大的布市場集散地。2007年中國百強縣排名第六。柯橋、楊汛橋兩鎮居民戶均固定資產超過120萬元，居浙江省首位。2009年實現GDP655.26億元，人均GDP超過1.3萬美元。\\n2013年10月國務院批覆同意撤銷紹興縣，設立紹興市柯橋區，以原紹興縣的行政區域為柯橋區的行政區域，柯橋區人民政府駐柯橋街道群賢路1661號。"},{"page_url":"https://es.wikipedia.org/wiki/Basaltos_del_Ca%C3%B1%C3%B3n_Miles","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Ca%C3%B1%C3%B3n_Miles%2C_Yuk%C3%B3n%2C_Canad%C3%A1%2C_2017-08-26%2C_DD_133.jpg","page_title":"Basaltos del Cañón Miles","context_page_description":"Los Basaltos del Cañón Miles son un conjunto de rocas que incluyen varias exposiciones de flujos de lava basática, así como formaciones cónicas producto de erupciones y flujo en un paisaje preglacial den la parte surcentran de Yukón."},{"page_url":"https://en.wikipedia.org/wiki/Dude_Ranch_(album)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Blink-182_at_the_Whiskey_in_Los_Angeles%2C_10-7-1996.jpg","page_title":"Dude Ranch (album)","context_page_description":"Dude Ranch is the second studio album by American rock band Blink-182, released on June 17, 1997, by Cargo Music and MCA Records, making it their major record label debut. MCA signed the band in 1996 following moderate sales of their 1995 debut Cheshire Cat and their growing popularity in Australia. Dude Ranch was the band's final recording released on Cargo and the last to feature their full original lineup, as in 1998 drummer Scott Raynor was dismissed from the band.\\nThe band recorded the album from December 1996 to January 1997 at Big Fish Studios in Encinitas, California with producer Mark Trombino. With lyrical material written on their nonstop tours over the previous years, as well as completed songs, the band recorded with Trombino in sessions that lasted for five weeks. During production, the members of Blink-182 were plagued with difficulties only made worse by the rushed schedule: bassist Mark Hoppus and guitarist Tom DeLonge, co-vocalists for the band, were having vocal problems and Raynor had to record his drum tracks with a supposed injury to both feet.\\nThe album was released in the summer of 1997 and was a success."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D1%80%D0%B1%D0%B8_%D1%83_%D0%90%D1%83%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%98%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/JelenaDokicUSopen2011_cropped.jpg","page_title":"Срби у Аустралији","context_page_description":"Срби у Аустралији су грађани Аустралије српског порекла или људи рођени у Србији који живе и раде у Аустралији."},{"page_url":"https://id.wikipedia.org/wiki/The_Sacramento_Union","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Sacramento_Union_logo.png","page_title":"The Sacramento Union","context_page_description":"The Sacramento Union adalah sebuah surat kabar harian yang didirikan pada tahun 1851 di Sacramento, California. Ini adalah surat kabar harian tertua dari barat Sungai Mississippi sebelum menutup pintunya setelah 143 tahun pada Januari 1994, karena tak dapat bersaing dengan The Sacramento Bee, yang didirikan pada tahun 1857, tepat enam tahun setelah Union."},{"page_url":"https://fr.wikipedia.org/wiki/Lons-le-Saunier","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Lons_Statue_Rouget_de_Lisle.jpg","page_title":"Lons-le-Saunier","context_page_description":"Lons-le-Saunier est le chef-lieu du département du Jura en Bourgogne-Franche-Comté. Elle fait partie de la région culturelle et historique de Franche-Comté. La ville est située à une altitude de 243 mètres. Elle compte 17 459 habitants dans une aire urbaine de 58 674 habitants.\\nLa ville doit son nom à ses sources salées, d'abord exploitées par les Romains, qui ont fait la fortune de familles de Bourgogne, de Vienne et de Chalon à partir du Moyen Âge, mais aussi de nombreuses abbayes et couvents.\\nSes habitants sont nommés les Lédoniens et les Lédoniennes.\\nEn 2016, elle est la 6ᵉ ville de Franche-Comté avec 17 311 habitants, juste devant Vesoul et derrière Pontarlier."},{"page_url":"https://it.wikipedia.org/wiki/Medici","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Ritratto_di_Ferdinando_Gonzaga.jpg","page_title":"Medici","context_page_description":"La casata dei Medici è un'antica famiglia fiorentina, protagonista di centrale importanza nella storia d'Italia e d'Europa dal XV al XVIII secolo.\\nI Medici ottennero, de Facto, il controllo prima della città di Firenze, e del Granducato di Toscana poi, tranne qualche interruzione di breve durata, il potere mediceo durò dal 1434, con la signoria di Cosimo il Vecchio, al 1737, con la morte di Gian Gastone, ultimo granduca.\\nOriginari della regione del Mugello, probabilmente appartenenti alla piccola nobiltà di campagna inurbata a partire dal XII secolo, inizialmente le attività dei Medici delle prime generazioni riguardarono la mercatura tessile, l'agricoltura e solo sporadicamente l'attività bancaria.\\nCon la fondazione del Banco dei Medici, ad opera di Giovanni di Bicci, la famiglia acquistò nel tempo ricchezza e potere, divenendo finanziatrice delle realtà più influenti nel panorama politico europeo. Il Banco, ad esempio, finanziò il Papa, la conquista del Ducato di Milano da parte di Francesco Sforza, la vittoria di Edoardo di York nella Guerra delle due rose."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%8A%D9%86%D8%AC%D9%88_%D9%83%D9%88%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Godzilla_Resurgence_World_Premiere_Red_Carpet-_Kora_Kengo_%2827989041363%29.jpg","page_title":"كينجو كورا","context_page_description":"كينجو كورا هو ممثل ياباني، ولد في 12 نوفمبر 1987 في اليابان."},{"page_url":"https://en.wikipedia.org/wiki/Gabriel_Loire","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/FUMCA_-_Sanctuary_Stained_Glass_-_The_Crucifixion.jpg","page_title":"Gabriel Loire","context_page_description":"Gabriel Loire was a French stained glass artist of the twentieth century whose extensive works, portraying various persons or historical scenes, appear in many venues around the world. He founded the Loire Studio in Chartres, France which continues to produce stained glass windows. Loire was a leader in the modern use of \\"slab glass\\", which is much thicker and stronger than the stained glass technique of the Middle Ages. The figures in his windows are mostly Impressionistic in style."},{"page_url":"https://es.wikipedia.org/wiki/Pedro_Nolasco_Cruz_Vergara","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Estudio_sobre_Literatura_Chilena.jpg","page_title":"Pedro Nolasco Cruz Vergara","context_page_description":"Pedro Nolasco Cruz Vergara fue un crítico literario, escritor y político chileno.​"},{"page_url":"https://vi.wikipedia.org/wiki/T%E1%BA%A7n_s%E1%BB%91_c%E1%BB%B1c_k%E1%BB%B3_th%E1%BA%A5p","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Clam_Lake_ELF.jpg","page_title":"Tần số cực kỳ thấp","context_page_description":"Tần số cực kỳ thấp là thuật ngữ được dùng để chỉ bức xạ điện từ có tần số từ 3 đến 300 Hz, và bước sóng tương ứng từ 100.000 đến 1000 km. Trong khoa học khí quyển, có một định nghĩa thay thế khác được đưa ra, trong đó định nghĩa ELF có tần số từ 3 Hz đến 3 kHz. Đối với khoa học từ quyển, các dao động điện từ tần số thấp hơn được coi như nằm trong dải ULF, do đó cũng được xác định khác nhau trong Băng tần Vô tuyến ITU.\\nCác sóng vô tuyến ELF được tạo ra từ sét và các rối loại tự nhiên trong từ trường của Trái Đất, vì vậy chúng là đề tài nghiên cứu của các nhà khoa học khí quyển. Do các khó khăn trong việc chế tạo các máy phát có thể tạo ra sóng dài như vậy, nên tần số ELF được dùng trong vài hệ thống thông tin. Sóng ELF có thể xuyên qua nước biển đến độ sâu vài trăm mét, vì vậy quân đội Mỹ và Nga đã sử dụng các trạm phát ELF để liên lạc với các tàu ngầm đang hoạt động dưới biển. Tần số của dòng điện xoay chiều trong lưới điện là 50 hoặc 60 Hz, nằm trong băng tần này, nên lưới điện là một nguồn bức xạ ELF không chủ ý."},{"page_url":"https://nl.wikipedia.org/wiki/Nuphar","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Nuphar_polysepala_%281%29.jpg","page_title":"Nuphar","context_page_description":"Nuphar is een geslacht van waterplanten uit de waterleliefamilie. De soorten uit het geslacht komen voor op het noordelijk halfrond, waar ze aangetroffen worden in het biogeografische gebied Holarctis en aangrenzende subtropische gebieden."},{"page_url":"https://vi.wikipedia.org/wiki/Potoroidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Potorous_gilberti_-_Gould.jpg","page_title":"Potoroidae","context_page_description":"Potoroidae là một họ động vật có vú trong bộ Hai răng cửa. Họ này được Gray miêu tả năm 1821."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Grau-du-Roi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Le_Grau-du-Roi_-_Eglise_Saint-Pierre_%2829256651273%29.jpg","page_title":"Le Grau-du-Roi","context_page_description":"Le Grau-du-Roi, est une commune située dans le sud-est de la France dans le département du Gard en région Occitanie."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_9_november","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Abraham_Vinkeles%2C_Fagel_en_Perponcher_bij_de_prins_in_Londen.jpg","page_title":"Lijst van personen geboren op 9 november","context_page_description":"Dit is een lijst van personen die geboren zijn op 9 november.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n1271 - Song Gongdi, kroonprins, keizer van China en keizer, dichter en uit de Song-dynastie bewerken\\n1389 - Isabella van Valois, Franse hertogin en koningin-gemalin bewerken\\n1414 - Albrecht Achilles van Brandenburg, markgraaf, Keurvorst uit Brandenburg bewerken\\n1455 - Jan V van Nassau-Dillenburg, Duitse graaf, Stadhouder bewerken\\n1464 - Filippa van Egmont, Franse hertogin en hertogin, aristocraat bewerken\\n1467 - Karel van Gelre, graaf, aristocraat bewerken\\n1541 - Menso Alting, Nederlandse theoloog bewerken\\n1542 - Anders Sørensen Vedel, Deense historicus en priester bewerken\\n1566 - Christiaan van Brunswijk-Lüneburg, hertog, verkozen bisschop bewerken\\n1580 - Dirck Hartog, Nederlandse ontdekkingsreiziger bewerken\\n1589 - Moulay Ali Cherif, Marokkaanse bewerken"},{"page_url":"https://pl.wikipedia.org/wiki/Gubernia_witebska","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Dvinsk_1912.jpg","page_title":"Gubernia witebska","context_page_description":"Gubernia witebska – jednostka administracyjna Imperium Rosyjskiego utworzona w 1802 na miejscu województwa witebskiego sprzed 1772. Odpowiada północno-wschodniej części dzisiejszego obwodu witebskiego Białorusi a także wschodniej części Łotwy oraz niektórym rejonom Rosji."},{"page_url":"https://en.wikipedia.org/wiki/CAESAR_self-propelled_howitzer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/CAESAR-openphotonet_PICT6026.JPG","page_title":"CAESAR self-propelled howitzer","context_page_description":"The CAESAR is a French self-propelled 155 mm/52-calibre gun-howitzer, installed on a 6x6 truck chassis. Examples built for the French Army use a Renault Sherpa 10 chassis, examples built for export utilize the 6x6 Unimog U2450L chassis. The CAESAR platform was developed by the former GIAT Industries and is operated by the French, Indonesian, Saudi Arabian, and Thai militaries."},{"page_url":"https://es.wikipedia.org/wiki/Biopesticida","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Beauveria.jpg","page_title":"Biopesticida","context_page_description":"El término biopesticida se suele utilizar para los productos utilizados en el control de plagas principalmente de la agricultura cuyo origen es procedente de algún organismo vivo.\\nPrincipalmente son bacterias, pero también hay productos derivados de hongos, como pueden ser las Trichoderma spp. y Ampelomyces quisqualis. Bacillus subtilis también es utilizado en el control de ciertos patógenos de las plantas. También hay ejemplo de control de hierbas y roedores mediante biopesticidas.\\nHay autores que definen a los biopesticidas como cualquier pesticida de origen biológico, organismos vivos o sustancias sintetizadas por ellos.​ Según esto se incluirían como insecticidas organismos vivos, como hongos, bacterias, virus etc. y compuestos obtenidos de las plantas y utilizados directamente o extraídos mediante infusiones, extracciones u otros sistemas.\\nSi sus efectos se producen en insectos, arácnidos u hongos, se podría hablar de bioinsecticidas, bioacaricidas o biofungicidas respectivamente.\\nUn ejemplo bien conocido como biopesticida es Bacillus thuringiensis, una bacteria que provoca una enfermedad en insectos de los órdenes Lepidoptera, Coleoptera y Diptera."},{"page_url":"https://nl.wikipedia.org/wiki/Resolutie_1947_Veiligheidsraad_Verenigde_Naties","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/The_Peres_House_for_Peace_in_Jaffa.jpg","page_title":"Resolutie 1947 Veiligheidsraad Verenigde Naties","context_page_description":"Resolutie 1947 van de Veiligheidsraad van de Verenigde Naties werd op 29 oktober 2010 met unanimiteit van stemmen aangenomen door de Veiligheidsraad van de Verenigde Naties.\\nMet deze resolutie behandelde de Veiligheidsraad het rapport over de vijfjaarlijkse evaluatie van de Vredesopbouwcommissie en vroeg ze de uitvoering van de aanbevelingen erin.\\nTer zelfder datum nam ook de Algemene Vergadering van de Verenigde Naties een gelijkaardige resolutie aan."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%B0%E1%83%90%E1%83%A0%E1%83%98_%E1%83%A8%E1%83%A3%E1%83%9B%E1%83%98_%E1%83%A3%E1%83%9B%E1%83%AA%E1%83%A0%E1%83%9D%E1%83%A1%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Harry_Shum_by_Gage_Skidmore.jpg","page_title":"ჰარი შუმი უმცროსი","context_page_description":"ჰარი შუმი, — ამერიკელი მსახიობი და მოცეკვავე. მან მოცეკვავის კარიერა დაიწყო ბიონსესთან, მერაია კერისთან, ჯენიფერ ლოპესთან, ჯესიკა სიმპსონთან და მსგავს შემსრულებლებთან მუშაობით. გამოჩნდა რამდენიმე მუსიკალურ ფილმში, მათ შორის „ნაბიჯი წინ 2: ქუჩები“ და „ნაბიჯი წინ 3D“. პოპულარობა მოუტანა მაიკ ჩენგის როლმა ტელესერიალში „კლუბი“."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Kiel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Varendorf%2821%29Ausschnitt-b.jpg","page_title":"Liste der Straßen und Plätze in Kiel","context_page_description":"In dieser Liste sind die Namen der Straßen und Plätze der schleswig-holsteinischen Landeshauptstadt Kiel aufgeführt. Aktuell gültige Straßenbezeichnungen sind in Fettschrift angegeben.\\nNicht mehr existierende Straßen sind durch * gekennzeichnet. Außerdem ist der Stadtteil bzw. sind die Stadtteile aufgeführt in der bzw. in denen die Straße liegt. Das Jahr der Namensgebung und kurze Erklärungen zu den Straßennamen ergänzen die Liste.\\nAufgrund der großen Anzahl der Kieler Straßennamen ist die Liste in alphabetisch sortierte Unterlisten aufgeteilt."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A7%D7%A1%D7%95%D7%A1_V90","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Maxus_V90_003.jpg","page_title":"מקסוס V90","context_page_description":"\\"מקסוס V90\\" היא מכונית מסחרית מתוצרת יצרנית הרכב הסינית Maxus חברת בת של SAIC Motor אשר מיוצרת משנת 2019."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%AD%D9%8A%D8%B1%D9%87_%D8%B3%D8%AA%D8%B1%D9%8A%D8%AA%D8%A8%D9%8A%D8%B1%D8%AC%D9%8A%D8%B1_%D9%88%D9%8A%D9%87%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Streitberger_Weiher.jpg","page_title":"بحيره ستريتبيرجير ويهير","context_page_description":"ستريتبيرجير ويهير بحيره فى المانيا."},{"page_url":"https://en.wikipedia.org/wiki/Kor%C3%A7%C3%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/M%C3%ABspnj%C3%ABtorja_e_pare_shqipe%2C_Kor%C3%A7%C3%AB.jpg","page_title":"Korçë","context_page_description":"Korçë is a city and municipality in southeastern Albania, and the seat of Korçë County. It was formed at the 2015 local government reform by the merger of the former municipalities Drenovë, Korçë, Lekas, Mollaj, Qendër Bulgarec, Vithkuq, Voskop and Voskopojë, that became municipal units. The seat of the municipality is the city Korçë. The total population is 75,994, in a total area of 806.67 km². The population of the former municipality at the 2011 census was 51,152. It is the sixth largest city in Albania. It stands on a plateau some 850 m above sea level, surrounded by the Morava Mountains."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AA%E3%82%A2%E3%83%B3%E3%83%BB%E3%83%96%E3%83%95%E3%82%A3%E3%82%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/2014_10_04_11-45Rallye_France%2C_Parc_assistance_Colmar%2C_Bryan_Bouffier.jpg","page_title":"ブリアン・ブフィエ","context_page_description":"ブリアン・ブフィエは、フランス・ドローム県出身のラリードライバー。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1985/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Yrj%C3%B6_Nikkanen.jpg","page_title":"Lijst van personen overleden in 1985/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 1985.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_kuil_Buddha","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/ShwedagonCrowdedDay.JPG","page_title":"Daftar kuil Buddha","context_page_description":"Ini adalah daftar kuil, biara, stupa, dan pagoda Buddha yang ada di Wikipedia, dibagi menurut lokasi."},{"page_url":"https://de.wikipedia.org/wiki/Enger","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Engeri._Westf_Standbild_des_Sachsen-Herzogs_Wittekind.png","page_title":"Enger","context_page_description":"Enger ist eine kreisangehörige Stadt im Südwesten des ostwestfälischen Kreises Herford im Nordosten von Nordrhein-Westfalen. Mit knapp über 20.000 Einwohnern ist Enger nach Definition eine Mittelstadt. Die Stadt Enger führt seit dem 19. März 2012 offiziell den Beinamen Widukindstadt, weil in der Stadt der Sachsenherzog Widukind begraben sein soll. Enger wurde 804 erstmals schriftlich erwähnt und hat seit 1719 das Stadtrecht."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%81%D1%83%D0%BB%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Masouleh.jpg","page_title":"Масуле","context_page_description":"Масуле́ — деревня на северо-западе Ирана, в провинции Гилян.\\nДеревня была основана в X веке и населена в основном талышами. Население — ок. 800 человек. Масуле расположена в северном Эльбурсе неподалеку от шоссе Решт-Зенджан, в 50 км от берега Каспийского моря. Климат — влажный, частые туманы. Уникальная планировка делает Масуле популярным у туристов.\\nДеревня Масуле предложена Ираном для включения в список Всемирного наследия."},{"page_url":"https://vec.wikipedia.org/wiki/Cazideroque","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/%C3%89glise_de_Cazideroque.JPG","page_title":"Cazideroque","context_page_description":"Cazideroque el xé on comun de 230 abitanti del departemento de Lot-et-Garonne che el fa parte del rejon Nova Acuitania in Fransa."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Miami_County,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/North_Main_in_the_Piqua-Caldwell_HD%2C_blue_sky.jpg","page_title":"National Register of Historic Places listings in Miami County, Ohio","context_page_description":"This is a list of the National Register of Historic Places listings in Miami County, Ohio.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Miami County, Ohio, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in an online map.\\nThere are 45 properties and districts listed on the National Register in the county, including one National Historic Landmark.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://ca.wikipedia.org/wiki/Brebotte","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Brebotte-90.jpg","page_title":"Brebotte","context_page_description":"Brebotte és un municipi francès del departament del Territori de Belfort i de la regió de Borgonya - Franc Comtat. El 2007 tenia 324 habitants."},{"page_url":"https://es.wikipedia.org/wiki/%C3%93ptica_Correctiva_de_Sustituci%C3%B3n_Axial_del_Telescopio_Espacial","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Corrective_Optics_Space_Telescope_Axial_Replacement.jpg","page_title":"Óptica Correctiva de Sustitución Axial del Telescopio Espacial","context_page_description":"La Óptica Correctiva de Sustitución Axial del Telescopio Espacial es el instrumento que se diseñó con el objeto de corregir la aberración esférica del Telescopio espacial Hubble para la luz enfocada en los instrumentos FOC, FOS y GHRS.​ Construido por Ball Aerospace Corp., reemplazó al Fotómetro de Alta Velocidad durante la primera Misión de Servicio en el Hubble en 1993.​\\nLas operaciones de reparación del telescopio generaron espectaculares imágenes de los astronautas trabajando en el espacio sobre el Hubble, que suscitaron el interés de los medios de comunicación de todo el mundo.​ Numerosos titulares de prensa, para explicar de forma sencilla en qué consistía la reparación, parafrasearon a los técnicos de la NASA y hablaron de ponerle gafas al Hubble. La reparación, que duró seis horas y cuarenta y siete minutos, fue efectuada en diciembre de 1993 por los astronautas Story Musgrave y Jeffrey Hoffman, que habían llegado hasta el telescopio espacial a bordo del transbordador Endeavour.​"},{"page_url":"https://no.wikipedia.org/wiki/Havb%C3%B8lge","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Rompiente.jpg","page_title":"Havbølge","context_page_description":"En havbølge er en overflatebevegelse som opptrer i det øverste laget i havet og brer seg som en bølge. Havbølger skyldes vanligvis fjerne vinder eller geologiske hendelser og kan reise mange tusen kilometer før de slår mot land. De kan variere i størrelse fra små krusninger til enorme tsunamier. Det er lite bevegelser av individuelle vannpartikler til tross for den store energimengden og kraften den dytter forover med. I stedet beveger de seg i hovedsak i elipser."},{"page_url":"https://da.wikipedia.org/wiki/Dick_Tracy","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Dick_Tracy.jpg","page_title":"Dick Tracy","context_page_description":"Dick Tracy er en tegneserie om detektiven Dick Tracy. Serien blev skabt af Chester Gould, og den udkom første gang d. 4. oktober 4, 1931 i avisen Detroit Mirror. Den blev distribueret af Chicago Tribune New York News Syndicate. Gould skrev og tegnede serien indtil 1977.\\nDick Tracy har optrådt i utallige film første gang i 1937, senest i Dick Tracy fra 1990 med Warren Beatty og Madonna på rollelisten."},{"page_url":"https://fr.wikipedia.org/wiki/Tramway_de_Gand","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Tramway_de_Gand_-_Rame_PCC_6217_%C3%A0_Rabot.JPG","page_title":"Tramway de Gand","context_page_description":"Le tramway de Gand est un réseau de tramway desservant la ville belge éponyme créé en 1874, et exploité depuis 1991 par le service de transports flamands De Lijn.\\nLe réseau de tramway comprend 3 lignes qui relient les quartiers de la ville à sa proche banlieue. Les lignes 1 et 4 comprennent dans leurs parcours de routes courtes fonctionnant pendant les heures de pointe. La longueur totale du réseau est de 28 km."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Szeged","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Szeged-matematikus2.jpg","page_title":"University of Szeged","context_page_description":"The University of Szeged is a large research university in Hungary. It is located in Hungary's third-largest city, Szeged, in Csongrád County in the Southern Great Plain. The University is one of Hungary's most important universities and is among the most prominent higher education institutions in Central Europe. According to the Academic Ranking of World Universities by Shanghai Jiao Tong University, it was ranked 203rd–300th in the complete list, 80th–123rd in the scientific ranking of European universities, and first in the Hungarian national ranking. In 2013 it was ranked 401-500 in the world, 124th–168th in the scientific ranking of European universities, and second in the national ranking. In 2014, the QS World University Rankings put the University of Szeged as 501-550 among universities globally. Its highest ranked subject area was Modern Languages with 101–150 globally. The University's operating budget for 2014 was US$220 million."},{"page_url":"https://da.wikipedia.org/wiki/Alfa_Romeo_159","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Alfa_Romeo_159_Norway.jpg","page_title":"Alfa Romeo 159","context_page_description":"Alfa Romeo 159 var en stor mellemklassebil fra Alfa Romeo, som afløste Alfa Romeo 156 i 2005. 159 fandtes som stationcar og som sedan med forskellige benzin- og dieselmotorer."},{"page_url":"https://es.wikipedia.org/wiki/Templo_de_la_Concordia_(Agrigento)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Concordiatempel_Tempio_della_Temple_of_Concordia_de_la_Concorde_Tal_der_Tempel_Valle_dei_Templi_Agrigento_Sizilien_Foto_Wolfgang_Pehlemann_DSC07490.jpg","page_title":"Templo de la Concordia (Agrigento)","context_page_description":"El templo de la Concordia es un templo griego de la antigua ciudad de Akragas situado en el Valle de los Templos de Agrigento.​ En la actualidad, todavía se desconoce a quién fue dedicado este templo, pero el nombre de \\"templo de la Concordia\\" está documentado ya en el siglo XVI por Tommaso Fazello, uno de los primeros historiadores, geógrafos y arqueólogos sicilianos.​ Construido en los años 440-430 a. C., está considerado, por su estado de conservación, uno de los edificios sagrados de la época clásica más notables del mundo griego."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_insulelor_din_ora%C8%99ul_Vene%C8%9Bia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Isole_di_cannaregio.png","page_title":"Lista insulelor din orașul Veneția","context_page_description":"Acest articol prezintă insulele din orașul Veneția, din Italia.\\nLaguna Venețiană este o lagună a Mării Adriatice, în care este situat orașul Veneția. Insulele și insulițele orașului, cuprinse între canale, sunt grupate mai jos după cartierul respectiv."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%A4gerh%C3%A4uschen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Jaegerhaeuschen_1_db.jpg","page_title":"Jägerhäuschen","context_page_description":"Das Jägerhäuschen im Kottenforst bei Bonn ist eine um 1730 bis 1740 gebaute Unterkunft und war eine Station für die Parforce-Jagden des Kölner Kurfürsten Clemens August. Es steht als Baudenkmal unter Denkmalschutz."},{"page_url":"https://it.wikipedia.org/wiki/Elezioni_parlamentari_in_Messico_del_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Nueva_alianza.png","page_title":"Elezioni parlamentari in Messico del 2018","context_page_description":"Le elezioni parlamentari in Messico del 2018 si tennero il 1º luglio, contestualmente alle elezioni presidenziali.\\nI cittadini messicani furono chiamati a rinnovare tutti i 500 membri della Camera che sarebbero restati in carica per 3 anni e anche i 128 senatori che sarebbero restati in carica fino al 2024."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%8B%E9%9A%9B%E7%AB%99_(%E8%8E%AB%E6%96%AF%E7%A7%91%E5%9C%B0%E9%90%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Mezhduarodnaya_st.JPG","page_title":"國際站 (莫斯科地鐵)","context_page_description":"国际站是莫斯科地铁的一个车站。国际站于2006年8月30日启用，是菲利线开往莫斯科城的支线的车站，也是该支线最新的车站。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A7%8D%E0%A6%9F%E0%A7%8D%E0%A6%B0%E0%A7%87%E0%A6%9E%E0%A7%8D%E0%A6%9C%E0%A6%BE%E0%A6%B0_%E0%A6%A5%E0%A6%BF%E0%A6%82%E0%A6%B8_(%E0%A6%AE%E0%A6%B0%E0%A6%B6%E0%A7%81%E0%A6%AE_%E0%A7%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Matt_Duffer_by_Gage_Skidmore.jpg","page_title":"স্ট্রেঞ্জার থিংস (মরশুম ১)","context_page_description":"মার্কিন কল্পবিজ্ঞান-ভৌতিক ওয়েব টেলিভিশন ধারাবাহিক স্ট্রেঞ্জার থিংসের প্রথম মরশুমটি শুধুমাত্র নেটফ্লিক্সের ওয়েব স্ট্রীমিঙের মাধ্যমে ১৫ই জুলাই ২০১৬ সালে মুক্তি পায়। ধারাবাহিকটি ডাফ ভ্রাতৃদ্বয় দ্বারা নির্মিত এবং তারা সহ শন লেভি এবং ড্যান কোহেন এই ধারাবাহিকের নির্বাহী প্রযোজক। প্রথম মরশুমের শ্রেষ্ঠাংশে আছেন উইনোনা রাইডার, ডেভিড হারবার, ফিন উল্ফহার্ড, মিলি ববি ব্রাউন, গেটন ম্যাটার‍্যাজো, কেলেব ম্যাকলখলিন, ন্যাটালিয়া ডায়ার, চার্লি হিটন, কারা বুয়োনো, ম্যথিউ মোডাইন, নোয়া শ্ন্যাপ এবং জো কিরি।"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%BA%AB%E5%93%A5%E8%8F%AF%E5%85%AC%E5%9C%92%E5%8F%8A%E5%BA%B7%E6%A8%82%E5%B1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Harbour_Green_Park%2C_Vancouver_%282012%29_-_1.JPG","page_title":"溫哥華公園及康樂局","context_page_description":"温哥华公园及康乐局，又作温哥华公园局，是加拿大不列颠哥伦比亚省温哥华一个民选市政机构，负责管理温哥华市内230个公众公园和绿化空间，以及市内的公众溜冰场、游泳池、哥尔夫球场及社区中心等康乐设施。公园局连主席在内共由七名民选委员组成，是全加拿大唯一一个由民选委员组成的市立公园及康乐部门。公园局委员选举每隔三年联同温哥华市长、温哥华市议会及温哥华教育局选举一并举行。\\n随着史丹利公园于1888年对外开放，市政府于同年委任一个由六人组成的公园委员会以管理该片土地。到了1890年，市政府解散公园委员会，并改为成立一个由三名民选委员组成的温哥华公园局来接管市内的公众公园。民选委员数目于1904年增至五人，再于1929年增至七人，以配合温哥华市于同年与南温哥华自治区和格雷岬自治区合并；民选委员数目自此维持为七人至今。该机构的正式名称于1956年改为公园及公众康乐局，再于1974年改为现称。\\n不列颠哥伦比亚省议会于1953年通过的温哥华宪章中第485至497节确认了公园局的角色和民选性质。"},{"page_url":"https://ca.wikipedia.org/wiki/Frontera_entre_la_Xina_i_Corea_del_Nord","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Border_stone_china-corea.jpg","page_title":"Frontera entre la Xina i Corea del Nord","context_page_description":"La frontera entre la República Popular de la Xina i la República Popular Democràtica de Corea és la frontera terrestre que delimita els territoris d'aquests dos Estats. És la frontera històrica entre els règims xinesos i coreans anteriors des de finals del segle XIV. Fou establerta el 1962 pels dos estats actuals i no és acceptada per Corea del Sud, l'altre estat de la Península de Corea."},{"page_url":"https://sv.wikipedia.org/wiki/Phacelia_davidsonii","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Phacelia_davidsonii.jpg","page_title":"Phacelia davidsonii","context_page_description":"Phacelia davidsonii är en strävbladig växtart som beskrevs av Asa Gray. Phacelia davidsonii ingår i Faceliasläktet som ingår i familjen strävbladiga växter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%A0v%C3%A1b%C3%ADnov","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/%C5%A0v%C3%A1b%C3%ADnov_B._Chalupa%2C_SV.jpg","page_title":"Švábínov","context_page_description":"Švábínov je chatová osada, část obce Chlístovice v okrese Kutná Hora. Nachází se asi 4,5 km na jih od Chlístovic ve Švábinovském lese. Jsou zde evidovány čtyři adresy. Trvale zde nežije žádný obyvatel.\\nŠvábínov leží v katastrálním území Všesoky o výměře 4,28 km²."},{"page_url":"https://tr.wikipedia.org/wiki/Crotalus_scutulatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Crotalus_scutulatus_02.JPG","page_title":"Crotalus scutulatus","context_page_description":"Crotalus scutulatus ABD'nin güneybatı ve Meksika'nın orta bölgelerinde bulunan, Crotalinae ailesinden zehirli bir yılan türüdür. Güçlü nörotoksik zehiri ile bilinen yılanın burada anlatılan aday ile birlikte toplam iki alttürü bulunmaktadır.\\nMaksimum 137.3 cm olmak üzere bu tür ortalama olarak 100 cm'nin altında bir uzunluğa erişebilirler. Renkler çevreye bağlı olarak, kahverenginin tonlarından soluk sarıya kadar değişkenlik gösterir."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D1%82%D1%80%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Contreuve-FR-08-mairie-03.JPG","page_title":"Контрев","context_page_description":"Контре́в — муніципалітет у Франції, у регіоні Шампань-Арденни, департамент Арденни. Населення — 62 осіб.\\nМуніципалітет розташований на відстані близько 175 км на схід від Парижа, 50 км на північний схід від Шалон-ан-Шампань, 50 км на південь від Шарлевіль-Мезьєра."},{"page_url":"https://en.wikipedia.org/wiki/List_of_heads_of_state_of_Argentina","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/AntonioAlvarezJonte.jpg","page_title":"List of heads of state of Argentina","context_page_description":"Argentina has had many different types of heads of state as well as many different types of government. During pre-Columbian times, the territories that today form Argentina were inhabited by nomadic tribes without any defined government. During the Spanish colonization of the Americas, the King of Spain retained the ultimate authority over the territories conquered in the New World, appointing viceroys for local government. The territories that would later become Argentina were first part of the Viceroyalty of Peru and then the Viceroyalty of the Río de la Plata. The May Revolution started the Argentine War of Independence by replacing the viceroy Baltasar Hidalgo de Cisneros with the first national government. It was the Primera Junta, a junta of several members, which would grow into the Junta Grande with the incorporation of provincial deputies. The size of the juntas gave room to internal political disputes among their members, so they were replaced by the First and Second Triumvirate, of three members."},{"page_url":"https://it.wikipedia.org/wiki/Palazzo_Bardi-Tempi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Palazzo_Bardi-Tempi%2C_portale_2.JPG","page_title":"Palazzo Bardi-Tempi","context_page_description":"Palazzo Bardi-Tempi si trova a Firenze in via de' Benci 2, angolo via Mozza e Lungarno delle Grazie 28."},{"page_url":"https://pl.wikipedia.org/wiki/Les_Villages_Vov%C3%A9ens","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Gare_de_Voves_2.jpg","page_title":"Les Villages Vovéens","context_page_description":"Les Villages Vovéens – gmina we Francji, w Regionie Centralnym-Dolina Loary, w departamencie Eure-et-Loir. W 2013 roku populacja ludności na terenie obecnej gminy wynosiła 3833 mieszkańców.\\nGmina została utworzona 1 stycznia 2016 roku z połączenia czterech wcześniejszych gmin: Montainville, Rouvray-Saint-Florentin, Villeneuve-Saint-Nicolas oraz Voves. Siedzibą gminy została miejscowość Voves."},{"page_url":"https://de.wikipedia.org/wiki/Chaetopelma_olivaceum","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Chaetopelma_gracile_in_a_jar01.jpg","page_title":"Chaetopelma olivaceum","context_page_description":"Chaetopelma olivaceum ist eine Spinne aus der Familie der Vogelspinnen. Die Art ist überwiegend in Vorderasien vertreten, wobei sie jedoch auch in Ägypten und im Sudan sowie auf Zypern vorkommt.\\nDie englischen Trivialbezeichnungen von Chaetopelma olivaceum lauten Israeli black tarantula, Black furry, Black tarantula und Middle East gold;."},{"page_url":"https://ro.wikipedia.org/wiki/Schitul_Crasna","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/SchitulCrasnaGJ_%2867%29.JPG","page_title":"Schitul Crasna","context_page_description":"Schitul Crasna este o mănăstire de călugări din Arhiepiscopia Craiovei, așezată în satul Crasna-Ungureni, comuna Crasna, Gorj, județul Gorj, la poalele munților Parângului. Este situat la 30 km est de Târgu-Jiu pe șoseaua care duce la Novaci. În august 2010 avea o obște de 8 călugări. Ansamblul schitului Crasna este prezent pe lista monumentelor istorice, cu codul GJ-II-a-A-09288."},{"page_url":"https://az.wikipedia.org/wiki/%C4%B0nsanl%C4%B1%C4%9F%C4%B1n_be%C5%9Fiyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/South_Africa-Gauteng-Maropeng01.jpg","page_title":"İnsanlığın beşiyi","context_page_description":"İnsanlğın beşiyi — CAR-ın Qautenq vilayəti, Yohannesburq şəhərinin 50 km şimal-qərbində yerləşən, paleoantropoloji ərazi. 1999-cu ildə UNESCO tərəfindən Ümumdünya irsi elan edilmişdir. Hazırda 47 000 hektar ərazini əhatə edir və əhəng daşı mağaraları kompleksini ehtiva edir.\\nLakin, mövcud arxeoloji və fosil sübutlarına görə, insanlığın beşiyi tez-tez \\"bəşəriyyətin beşiyi\\" kimi xatırlanan Şərqi Afrikadakı Afar üçbucağıdır.\\nƏrazidəki Sterkfonteyn mağaraları 1947-ci ildə Robert Brum və Con Telbot Robinson tərəfindən tapılmış 2.3 milyon illik bir Australopithecus africanus fosilinin kəşf edildiyi yer idi. Tapıntı 1924-cü ildə qazıntı işlərinin davam etdiyi Cənubi Afrikanın şimal-qərb viyalətindəki Taunq-da Raymond Dart tərəfindən \\"Taung uşağı\\" olaraq bilinən, yetkinlik yaşına çatmayan Australopithecus africanus kəlləsinin kəşfini təsdiqləməyə kömək etdi.\\nƏraziyə daxil olmasa da, yaxınlığındakı Rayzinq-Star mağara sistemində, müvəqqəti olaraq Homo naledi adlandırılan nəsli kəsilmiş bir növün on beş fosil skeleti tapılan Dinaledi otağı var.\\nTəkcə Sterkfonteyn 2010-cu ildən əvvəl tapılmış erkən hominid fosillərinin üçdə birindən çoxunu ehtiva etmişdir."},{"page_url":"https://eo.wikipedia.org/wiki/Urba_municipo_Nova_Gorica","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Grb_Mestne_ob%C4%8Dine_Nova_Gorica.jpg","page_title":"Urba municipo Nova Gorica","context_page_description":"Urbo občina Nova Gorica estas unu el la 212 slovenaj municipoj. Ĝi situas en la Regiono Goriška. La administra centro estas la urbo Nova Gorica. La municipo konsistas el 45 setlejoj kaj totala kampara regiono estas 279 km². Komence de 2014 ĝi havis 31 773 loĝantojn."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Japan","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Japan_Tokyo3.png","page_title":"History of Japan","context_page_description":"The first human habitation in the Japanese archipelago has been traced to prehistoric times around 30,000 BC. The Jōmon period, named after its cord-marked pottery, was followed by the Yayoi people in the first millennium BC when new technologies were introduced from continental Asia. During this period, the first known written reference to Japan was recorded in the Chinese Book of Han in the first century AD.\\nBetween the fourth century and the ninth century, Japan's many kingdoms and tribes gradually came to be unified under a centralized government, nominally controlled by the Emperor of Japan. This imperial dynasty continues to reign over Japan. In 794, a new imperial capital was established at Heian-kyō, marking the beginning of the Heian period, which lasted until 1185. The Heian period is considered a golden age of classical Japanese culture. Japanese religious life from this time and onwards was a mix of native Shinto practices and Buddhism.\\nOver the following centuries, the power of the emperor and the imperial court declined, passing first to great clans of civilian aristocrats – most notably the Fujiwara – and then to the military clans and their armies of samurai."},{"page_url":"https://en.wikipedia.org/wiki/Bilikal_Rangaswamy_Betta","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Bilikal_Rangaswamy_Betta_4.jpg","page_title":"Bilikal Rangaswamy Betta","context_page_description":"Bilikal Ranganatha Swamy Betta is a hill near Kanakapura town in the Indian state of Karnataka. It is located 70 km south of Bangalore city. Atop the hill is a temple dedicated to Lord Ranganatha Swamy. The temple and an adjacent quarters is housed underneath a huge granite rock. The hill is also known by the name Billikal Betta due to the whitish rocks near the summit that is visible from a long distance. The peak is at a height of 3780 feet."},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Butschatsch%E2%80%93Jarmolynzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Old_railway_station_1_Buchach.jpg","page_title":"Bahnstrecke Butschatsch–Jarmolynzi","context_page_description":"Die Bahnstrecke Butschatsch–Jarmolynzi ist eine Nebenbahn in der Ukraine. Sie verläuft von Butschatsch, einer Kleinstadt in der südlichen Oblast Ternopil über Kopytschynzi, einer Kleinstadt südöstlich von Ternopil und Hussjatyn nach Jarmolynzi, einem regionalen Zentrum in der südlichen Oblast Chmelnyzkyj.\\nDer Betrieb wird durch die Ukrainischen Bahnen, im Speziellen die Lwiwska Salisnyzja und die Piwdenno-Sachidna Salisnyzja geführt.\\nDie gesamte Strecke ist eingleisig ausgeführt und nicht elektrifiziert."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A2%85%E8%8E%B1_(%E4%BC%8A%E5%8B%92-%E7%BB%B4%E8%8E%B1%E8%AE%B7%E7%9C%81)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Map_commune_FR_insee_code_35174.png","page_title":"梅莱 (伊勒-维莱讷省)","context_page_description":"梅莱是法国伊勒-维莱讷省的一个市镇，位于该省东北部，属于富热尔-维特雷区。该市镇总面积15.5平方公里，2009年时的人口为667人。"},{"page_url":"https://nl.wikipedia.org/wiki/Kasteel_van_Fontaine-l%27%C3%89v%C3%AAque","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Fontaine-l%27Eveque_JPG01d.jpg","page_title":"Kasteel van Fontaine-l'Évêque","context_page_description":"Het Kasteel van Fontaine-l'Évêque is een kasteel te Fontaine-l'Évêque in de Belgische provincie Henegouwen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B4%D0%BE%D0%B2%D0%BD%D0%B8%D0%BA%D0%B8_(%D0%BF%D0%B0%D1%80%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/%D0%9F%D0%B0%D1%80%D0%BA%D1%81%D0%B0%D0%B4%D0%BE%D0%B2%D0%BD%D0%B8%D0%BA%D0%B88.jpg","page_title":"Садовники (парк)","context_page_description":"Садовники — парк расположен на территории Южного административного округа города Москвы, в районе Нагатино-Садовники."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Landschaftsschutzgebiete_in_der_Oberpfalz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/WeidenBlockh%C3%BCtteSteinbruch_04.JPG","page_title":"Liste der Landschaftsschutzgebiete in der Oberpfalz","context_page_description":"Die Liste der Landschaftsschutzgebiete in der Oberpfalz bindet folgende Listen der Landschaftsschutzgebiete in Oberpfälzer Landkreisen und Städten aus dem Artikelnamensraum ein:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%83%D1%80%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%BD%D0%B5_%D1%82%D0%BE%D0%B2%D0%B0%D1%80%D0%B8%D1%81%D1%82%D0%B2%D0%BE_%C2%AB%D0%9A%D0%B0%D1%80%D0%BF%D0%B0%D1%82%D1%81%D1%8C%D0%BA%D1%96_%D1%81%D1%82%D0%B5%D0%B6%D0%BA%D0%B8%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Logo_%D1%81%D1%82%D0%B5%D0%B6%D0%BA%D0%B8.png","page_title":"Туристичне товариство «Карпатські стежки»","context_page_description":"Туристи́чне товари́ство «Карпа́тські сте́жки» — українське громадське об'єднання, створене з метою захисту культурних, екологічних, соціальних прав та свобод громадян. Організація об'єднує членів з усієї країни. Створена у 2001 р. під назвою «Івано-Франківська регіональна Фундація» Василем Гутиряком. У 2013 році відповідно до Закону України «Про громадські об'єднання» організація перереєстрована під сучасною назвою. Головою ТТКС є Василь Фіцак.\\nТТКС є членом Української асоціації активного і екологічного туризму, партнером-підписантом Сопронської декларації Central and Eastern European Greenways, є партнером PTTK. ТТКС відповідно до договорів про співпрацю є партнером Карпатського національного природного парку, Карпатського біосферного заповідника, природного заповідника «Ґорґани». Організація є членом Громадської Ради при департаменті міжнародного співробітництва, євроінтеграції та розвитку туристичної інфраструктури Івано-Франківської облдержадміністрації, бере участь в розробці програм ОДА, зокрема, регіональної цільової програми розвитку туризму на 2016-2020 роки"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_st%C3%A4dtischen_Denkmalzonen_in_Tschechien","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Sedlec-Prcice_CoA_CZ.jpg","page_title":"Liste der städtischen Denkmalzonen in Tschechien","context_page_description":"Die Liste der städtischen Denkmalzonen in Tschechien enthält alle Städte, in denen insgesamt 253 städtische Denkmalzonen ausgewiesen sind. Die Schutzwürdigkeit ergibt sich aus dem besonderen historischen Verhältnis oder als Teil der umgebenden Landschaft des Ortes. Denkmalzonen haben weniger schutzwürdige Gebäude als Denkmalreservate.\\nDie Liste ist nach den Regionen gegliedert.\\nDie Aufnahme der Orte in die Denkmalliste erfolgte in den Jahren 1990 bis 2004."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%87%D8%A7%DB%8C%D9%86%D8%B1%DB%8C%D8%B4_%D8%A2%D9%86%D8%AA%D9%88%D9%86_%D8%AF_%D8%A8%D8%A7%D8%B1%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Anton_de_Bary.jpg","page_title":"هاینریش آنتون د باری","context_page_description":"هاینریش آنتون دو باری یک زیست‌شناس اهل آلمان بود.\\nاو پدر آسیب‌شناسی گیاهی یعنی پدر گیاهپزشکی خوانده می‌شود. آنتون دو باری اولین کسی بود که قارچ را به عنوان عامل بیماری شناخت. او برای فهمیدن دلیل بیماری باد زدگی سیب زمینی آزمایش ساده‌ای را انجام داد. او دو دسته سیب زمینی را در شرایط مشابه دما و رطوبت کاشت. به گروه کنترل هیچ ماده‌ای اضافه نشد. به روی سیب زمینی‌های گروه دوم، هاگ‌های گیاهان بیمار ریخته شد. در گروه کنترل همهٔ گیاهان سالم ماندند ولی تمام سیب زمینی‌ها ی گروه دوم به بیماری مبتلا شدند. او اولین کسی بود که نشان داد فقط نباید متوجه گیاهان بیمار بود بلکه باید به موجودات عامل بیماری هم توجه کرد. تنها یک سال بعد یعنی در سال ۱۸۶۱ لویی پاستور نظریهٔ میکرب را ارائه کرد. و"},{"page_url":"https://de.wikipedia.org/wiki/M%C3%BCdisdorfer_Kunstgraben_und_R%C3%B6sche","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/M%C3%BCdisdorfer_Kunstgraben_in_M%C3%BCdisdorf_%283%29.jpg","page_title":"Müdisdorfer Kunstgraben und Rösche","context_page_description":"Der Müdisdorfer Kunstgraben mit dem Abschnitt der Müdisdorfer Rösche ist ein Kunstgraben zwischen Großhartmannsdorf und Brand-Erbisdorf im Erzgebirge aus dem 16. Jahrhundert.\\nEr diente mittelbar der zusätzlichen Zuführung von Aufschlagwasser für den Freiberger Bergbau und ist Teil der Revierwasserlaufanstalt Freiberg."},{"page_url":"https://de.wikipedia.org/wiki/Siebenb%C3%BCrger_Sachsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Landsmannschaften_Vertriebenendenkmal_P%C3%B6stlingberg.jpg","page_title":"Siebenbürger Sachsen","context_page_description":"Die Siebenbürger Sachsen sind eine deutschsprachige Minderheit im heutigen Rumänien, die die Reliktmundart Siebenbürgisch-Sächsisch sprechen. Sie sind seit dem 12. Jahrhundert in dem Landesteil Siebenbürgen ansässig und sind damit die älteste noch existierende deutsche Siedlergruppe in Osteuropa. Ihr Siedlungsgebiet liegt außerhalb des zusammenhängenden deutschen Sprachraums und hatte nie Anschluss an reichsdeutsches Territorium.\\nSiebenbürgen entwickelte sich ab dem 12. Jahrhundert als Teil des Königreichs Ungarn. Nach der Teilung Ungarns 1540 war es als Fürstentum Siebenbürgen unter der Oberhoheit des Osmanischen Reiches zumindest innenpolitisch weitgehend autonom. Im Großen Türkenkrieg besetzten die Habsburger das Fürstentum und gliederten es 1699 im Vertrag von Karlowitz der Habsburgermonarchie ein. Nach der Niederlage Österreich-Ungarns im Ersten Weltkrieg proklamierte die Karlsburger Nationalversammlung am 1. Dezember 1918 die Vereinigung Siebenbürgens mit dem rumänischen Altreich."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%92%8C%E6%B3%89%E5%A4%9A%E6%91%A9%E5%B7%9D%E9%A7%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Izimitamagawastn.jpg","page_title":"和泉多摩川駅","context_page_description":"和泉多摩川駅は、東京都狛江市東和泉四丁目にある、小田急電鉄小田原線の駅である。駅番号はOH 17。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%98%D0%BD%D0%B4%D0%B8%D0%B8_(%D0%BC%D0%B0%D1%80%D0%BA%D1%81%D0%B8%D1%81%D1%82%D1%81%D0%BA%D0%B0%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Cpimmobile.jpg","page_title":"Коммунистическая партия Индии (марксистская)","context_page_description":"Коммунистическая партия Индии (марксистская) — влиятельная индийская политическая партия левого толка. Основана в 1964 году, в настоящее время насчитывает свыше 1 миллиона членов. Генеральный секретарь ЦК КПИ с 2015 года — Ситарам Йечури."},{"page_url":"https://sco.wikipedia.org/wiki/Paykan","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Peykan_chaldoran.jpg","page_title":"Paykan","context_page_description":"The Paykan was an automobile produced by the Iranian company Iran Khodro Industrial Group. The car was very popular in Iran from the late 1960s to the late 1990s. It is often referred to as the Iranian \\"chariot\\".\\nThe Paykan design was based on the 1967 Hillman Hunter, which was originally designed and manufactured by the British Rootes Group.\\nThe design was introduced to Iran by Mahmoud Khayami, co-founder of the Iran Khodro or IKCO. He accurately predicted that Iran was in need of a simple \\"no-frills\\" automobile within the price range of ordinary folks.\\nIn 1967, Rootes began exporting Hunters to Iran Khodro in \\"complete knock down\\" kit form, for assembly in Iran. In 1972 it seemed that every car in Iran was a Paykan. By the mid 1970s, full scale manufacturing of the car, minus the engine, had started in Iran.\\nIn 1978, Peugeot took ownership of the Rootes company after it collapsed under the partnership Chrysler Europe; a year later Peugeot ended Hunter production. Thereafter, the Paykan's engine production tooling was moved to Iran and was in full-scale production under Peugeots license until 2005."},{"page_url":"https://zh.wikipedia.org/zh-tw/10%E5%84%84%E4%BA%BA%E8%B5%B7%E7%BE%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/OneBillionRising.FarragutSquare.WDC.14February2013-crowd.jpg","page_title":"10億人起義","context_page_description":"10億人起義是一個全球運動，2012年由伊芙·恩斯勒發起，旨在終止對婦女的性侵害及性暴力。根據聯合國數據顯示，全球有三分之一的女性曾經在一生中遭受性暴力，大約近10億人。"},{"page_url":"https://sk.wikipedia.org/wiki/Helpfau-Uttendorf","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Helpfau-Uttendorf_im_Bezirk_BR.png","page_title":"Helpfau-Uttendorf","context_page_description":"Helpfau-Uttendorf je trhová obec v Rakúsku v spolkovej krajine Horné Rakúsko v okrese Braunau am Inn.\\nŽije tu 3 351 obyvateľov."},{"page_url":"https://de.wikipedia.org/wiki/Schatz_von_Berthouville","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Silver_jug_Isthmian_Games_Berthhouville_CdM_Paris.jpg","page_title":"Schatz von Berthouville","context_page_description":"Der Schatz von Berthouville ist ein Fund von Silberobjekten aus dem 2. Jahrhundert, der 1830 in Villeret in der Nähe von Berthouville im Département Eure in der Normandie entdeckt wurde und heute zur Sammlung des Cabinet des Médailles der Bibliothèque nationale de France in Paris gehört."},{"page_url":"https://en.wikipedia.org/wiki/House_of_Wittelsbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/King_Otto_of_Greece.jpg","page_title":"House of Wittelsbach","context_page_description":"The House of Wittelsbach is a German-Bavarian dynasty, with branches that rule, or have ruled over territories including: Bavaria, Holland, Zeeland, Cologne, Sweden, Romania, Bohemia, Hungary, Denmark, Norway, Greece and the Holy Roman Empire. The House of Windsor, the reigning royal house of the British throne, are descendants of Sophia of Hanover, a Wittelsbach Princess and Electress of Hanover."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_equ%C3%ADvocos_comuns","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Violent_crime_rates_by_gender_1973-2003.png","page_title":"Lista de equívocos comuns","context_page_description":"Esta é uma lista de equívocos comuns, tais como mitos populares ou interpretações errôneas de fatos. Cada item comunica uma correção e não o fato errôneo em si. Esta lista é feita para ser concisa, porém mais detalhes podem ser encontrados nos respectivos artigos."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AD%E0%A5%8C%E0%A4%A4%E0%A4%BF%E0%A4%95%E0%A5%80_%E0%A4%AE%E0%A5%87%E0%A4%82_%E0%A4%A8%E0%A5%8B%E0%A4%AC%E0%A5%87%E0%A4%B2_%E0%A4%B5%E0%A4%BF%E0%A4%9C%E0%A5%87%E0%A4%A4%E0%A4%BE%E0%A4%93%E0%A4%82_%E0%A4%95%E0%A5%80_%E0%A4%B8%E0%A5%82%E0%A4%9A%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Ivar_Giaever.jpg","page_title":"भौतिकी में नोबेल विजेताओं की सूची","context_page_description":"भौतिकी के विभिन्न क्षेत्रों में वैज्ञानिकों को रॉयल स्वीडिश एकेडमी ऑफ साइंसेज द्वारा प्रतिवर्ष भौतिकी में नोबेल पुरस्कार दिया जाता है। यह अल्फ्रेड नोबेल के 1895 के वसीयत द्वारा स्थापित पांच नोबेल पुरस्कारों में से एक है, जो भौतिकी में उत्कृष्ट योगदान के लिए प्रदान किया गया है। नोबेल की इच्छा के अनुसार, यह पुरस्कार नोबेल फाउंडेशन द्वारा दिया जाता है और रॉयल स्वीडिश एकेडमी ऑफ साइंसेज द्वारा प्रदान किया जाता है। यह पुरस्कार स्टॉकहोम में 10 दिसंबर को एक वार्षिक समारोह में नोबेल की मृत्यु की वर्षगांठ पर प्रदान किया जाता है। प्रत्येक प्राप्तकर्ता को एक पदक, एक डिप्लोमा और एक मौद्रिक पुरस्कार, जो कि पूरे वर्ष में भिन्न होता है, मिलता है।"},{"page_url":"https://hu.wikipedia.org/wiki/Barzy-sur-Marne","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Barzy_sur_marne_%C3%A9glise_%284%29.JPG","page_title":"Barzy-sur-Marne","context_page_description":"Barzy-sur-Marne település Franciaországban, Aisne megyében. Lakosainak száma 385 fő. Barzy-sur-Marne Le Charmel, Courtemont-Varennes, Jaulgonne, Passy-sur-Marne és Trélou-sur-Marne községekkel határos."},{"page_url":"https://hr.wikipedia.org/wiki/Me%C4%91uplanetna_tvar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Nacreous_clouds_Antarctica.jpg","page_title":"Međuplanetna tvar","context_page_description":"Međuplanetarna tvar je tvar u prostoru između planeta u Sunčevu sustavu. Sastoji se od vrlo rijetkog plina, čestica Sunčeva vjetra te od čestica prašine. Nastaje emisijom sa Sunca, sudaranjem meteoroida i planetoida i oslobađa se iz kometa dok prolaze oko Sunca. Sunčev vjetar polako je potiskuje u svemir. Teško se može opažati. Sunčeva svjetlost raspršena na česticama prašine u području ekliptike naziva se zodijačka svjetlost."},{"page_url":"https://war.wikipedia.org/wiki/Punjab,_Pakistan","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Kushti_%28in_Bharatpur_March_2013%29.jpg","page_title":"Punjab, Pakistan","context_page_description":"An Punjab an kanan Pakistan ikaduha nga probinsya kun babasehon ha kadako han lugar, nga nasunod la ha Balochistan, ngan amo liwat an may gidadamoi nga populasyon, nga ginbabanabanahan may-ada 110,012,442 ha tuig 2017. Ini in may katubtuban ha mga Pakistan nga mga probinsya Sindh, Balochistan, ngan Khyber Pakhtunkhwa, an enclave han Islamabad, ngan Azad Kashmir. Ini liwat in ginsasapitan han mga estado han Indya nga Punjab, Rajasthan ngan Jammu ngan Kashmir. An ulohan han probinsya han Punjab amo an syudad han Lahore, usa ka sentro han kultura, kasaysayan, ekonomika, ngan cosmopolitana han Pakitan."},{"page_url":"https://de.wikipedia.org/wiki/Bienitz","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/Schomburgk-Stein.jpg","page_title":"Bienitz","context_page_description":"Der Bienitz ist ein flacher bewaldeter Hügel im Nordwesten Leipzigs."},{"page_url":"https://sr.wikipedia.org/wiki/Klapov_oscilator","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Clapp_oscillator.png","page_title":"Klapov oscilator","context_page_description":"Klapov oscilator je jedan od nekoliko tipova elektronskih oscilatora izgrađenih od tranzistora i mreže pozitivne povratne sprege, koristeći kombinaciju jednog kalema sa kondenzatorom za određivanje frekvencije, zbog čega su i nazvani LC oscilatori."},{"page_url":"https://ca.wikipedia.org/wiki/Ll%C3%BAdria_comuna","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Fischotter_Lutra_lutra1.jpg","page_title":"Llúdria comuna","context_page_description":"La llúdria o llúdriga, sí o no amb l'epíte comuna també coneguda com a llúdria de riu europea, és una espècie de llúdria europea i asiàtica de la família Lutrinae que és típica d'aigües dolces. Als Països Catalans està en regressió."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%89%E0%A4%9A%E0%A5%8D%E0%A4%9A-%E0%A4%B5%E0%A5%8B%E0%A4%B2%E0%A5%8D%E0%A4%9F%E0%A4%A4%E0%A4%BE_%E0%A4%A1%E0%A5%80%E0%A4%B8%E0%A5%80_%E0%A4%AA%E0%A4%BE%E0%A4%B0%E0%A5%87%E0%A4%B7%E0%A4%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/12_pulse_bridge.png","page_title":"उच्च-वोल्टता डीसी पारेषण","context_page_description":"उच्च-वोल्टता डीसी पारेषण बड़ी मात्रा में विद्युत शक्ति के पारेषण की विधि है जिसमें विद्युत शक्ति परम्परागत एसी के बजाय डीसी रूप में भेजी जाती है। इसके कुछ विशिष्ट लाभ हैं; जैसे - लम्बी दूरी तक विद्युत शक्ति भेजने के लिये यह विधि सस्ती पड़ती है; इसमें उर्जा का क्षय कम होता है; कई लाइनों को आपस में जोड़ना आसान है आदि।"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%96%D0%B8%D0%B2%D1%80%D0%B5%D0%B7%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Givrezac_eg_1.JPG","page_title":"Живрезак","context_page_description":"Живреза́к — коммуна во Франции, находится в регионе Пуату — Шаранта. Департамент коммуны — Шаранта Приморская. Входит в состав кантона Сен-Жени-де-Сантонж. Округ коммуны — Жонзак.\\nКод INSEE коммуны — 17178."},{"page_url":"https://sv.wikipedia.org/wiki/%C3%96rgrytev%C3%A4gen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Svenska_M%C3%A4ssan_Gothia_Towers.jpg","page_title":"Örgrytevägen","context_page_description":"Örgrytevägen är en knappt 700 meter lång gata i stadsdelarna Heden, Bö och Gårda i Göteborg. Gatan går mellan Korsvägen och Sankt Sigfrids plan. Vid Korsvägen ansluter Örgrytevägen till bland annat Evenemangsstråket på Skånegatan, och vid Sankt Sigfrids plan till bland annat Danska vägen. Gatan fick sitt namn år 1891.\\nLängs Örgrytevägen ligger Svenska mässan, Gothia Towers, Liseberg och Örgryte gamla kyrka. Vägen korsas av Mölndalsån och E6:ans motorväg.\\nÖrgrytevägen trafikeras av spårvagnslinje 5, Lisebergslinjen samt ett antal busslinjer. Längs gatan ligger buss- och spårvagnshållplatserna Korsvägen, Liseberg och Sankt Sigfrids plan. I höjd med E6:an finns den underjordiska pendeltågsstationen Lisebergs station som ligger i Gårdatunneln, vilken passerar under Örgrytevägen.\\nDen planerade tågtunneln Västlänken kommer att byggas under Korsvägen och Liseberg och gå parallellt med Örgrytevägen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8_(1832)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Daniel_O%27Connell_-_Project_Gutenberg_13103.jpg","page_title":"Парламентские выборы в Великобритании (1832)","context_page_description":"Парламентские выборы в Великобритании проходили с 8 декабря 1832 по 10 января 1833. Они были проведены после роспуска в 1832 Палаты общин Великобритании в связи с проведением избирательной реформы и стали первыми, прошедшими по новому закону.\\nВ выборах участвовали тори, правящие виги и независимые ирландские кандидаты из Ассоциации против унии, организации, созданной Дэниэлом О’Коннеллом, и выступавшей против англо-ирландской унии. Правящие виги под руководством графа Грея одержали уверенную победу над тори во главе с герцогом Веллингтоном, получив почти 70 % голосов."},{"page_url":"https://en.wikipedia.org/wiki/%C5%BBniwiarz_Group","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/AK_Zniwiarz_Slowackiego.jpg","page_title":"Żniwiarz Group","context_page_description":"The Żniwiarz Group was a group of military units in Żoliborz in Warsaw, Poland, which took part in the Warsaw Uprising of 1944.\\nThe group was created in 1942 and included a group of schoolboys of the Prince Józef Poniatowski Secondary School and youth of Marymont. In the beginning of 1943, upon the creation og Kedyw, it was created the 9th company of military subversion Żniwiarz, which was a military unit at the disposal of the commander of the Sub-district II of Żoliborz, pseudonym Żywiciel."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_n%C3%B6rdlichen_Boston","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/BostonMA_Milestone7.jpg","page_title":"Liste der Einträge im National Register of Historic Places im nördlichen Boston","context_page_description":"Die Liste der Einträge im National Register of Historic Places im nördlichen Boston im Suffolk County in Massachusetts führt alle Bauwerke, National Historic Landmarks und Historic Districts im nördlichen Stadtgebiet von Boston auf, die in das National Register of Historic Places aufgenommen wurden.\\nDie Liste wurde aufgrund der Vielzahl der Einträge ausgelagert und ist gemeinsam mit der Liste der Einträge im National Register of Historic Places im südlichen Boston integraler Bestandteil der Liste der Einträge im National Register of Historic Places im Suffolk County, die alle außerhalb von Boston gelegenen Einträge enthält."},{"page_url":"https://de.wikipedia.org/wiki/Johann_David_Heinichen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Heinichen_musicalischer_circul.png","page_title":"Johann David Heinichen","context_page_description":"Johann David Heinichen war ein deutscher Komponist und Musiktheoretiker."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A4%E3%82%B0%E3%82%A2%E3%83%AB2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Panzermuseum_Munster_2010_0934.JPG","page_title":"ヤグアル2","context_page_description":"ヤグアル2は、ドイツの対戦車ミサイル装備型の自走対戦車ミサイル発射機。ラケーテンヤークトパンツァー4とも呼ばれる。ドイツ連邦軍が保有・運用していた。"},{"page_url":"https://vi.wikipedia.org/wiki/T%E1%BB%95ng_th%E1%BB%91ng_Kyrgyzstan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Sooronbay_Jeenbekov_at_the_Eurasian_Intergovernmental_Council_meeting%2C_7_March_2017.jpg","page_title":"Tổng thống Kyrgyzstan","context_page_description":"Tổng thống Kyrgyzstan là người đứng đầu nhà nước và là quan chức cao nhất của Kyrgyzstan. Tổng thống, theo quy định của Hiến pháp Kyrgyzstan, \\"...là biểu tượng của sự đoàn kết của người dân và quyền lực nhà nước, và là người đảm bảo Hiến pháp của nước Cộng hoà Kyrgyzstan, và của một cá nhân và công dân.\\" Tổng thống được cử tri quốc gia này bầu trực tiếp không quá hai nhiệm kỳ năm năm. Chức vụ Tổng thống được thiết lập vào năm 1990 thay thế cho chức Chủ tịch Hội đồng tối cao đã tồn tại từ năm 1936 trong khi nước này còn là Cộng hoà Xã hội chủ nghĩa Kyrgyzstan.\\nTổng thống đầu tiên được bầu cử theo thể thức phổ thông đầu phiếu là Askar Akayev, người đã thôi chức vụ này vào ngày 24 tháng 3 năm 2005. Cuộc bầu cử tháng 7 cùng năm với kết quả Kurmanbek Bakiev được bầu vào chức vụ này với nhiệm kỳ 5 năm."},{"page_url":"https://de.wikipedia.org/wiki/Olimpijski_komite_Slovenije","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Bogdan_Gabrovec.jpg","page_title":"Olimpijski komite Slovenije","context_page_description":"Das Olimpijski komite Slovenije ist das Nationale Olympische Komitee in Slowenien mit Sitz in Ljubljana. Insgesamt 39 Fachverbände olympischer Sportarten, davon 32 Sommer- und sieben Wintersportarten, sind Mitglied im OKS."},{"page_url":"https://en.wikipedia.org/wiki/Peter_von_Hagenbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Blason_Hagenbach.svg","page_title":"Peter von Hagenbach","context_page_description":"Peter von Hagenbach was a Bourguignon knight from Alsace and Germanic military and civil commander.\\nHe was born into an Alsatian-Burgundian family, originally from Hagenbach and owned a castle there.\\nHe was instated as bailiff of Upper Alsace by Charles the Bold, Duke of Burgundy, to administer the territories and rights on the Upper Rhine which had been mortgaged by Duke Sigmund of Further Austria for 50,000 florins in the Treaty of St. Omer in 1469. There he coined the term Landsknecht—from German, Land + Knecht.\\nIt was originally intended to indicate soldiers of the lowlands of the Holy Roman Empire as opposed to the Swiss mercenaries. As early as 1500 the misleading spelling \\"Lanzknecht\\" became common because of the phonetic and visual similarity between Lands and Lanze.\\nFollowing a rebellion by towns of the Upper Rhine against his tyranny, Hagenbach was put on trial for the atrocities committed during the occupation of Breisach, found guilty of war crimes, and beheaded at Breisach. His trial by an ad hoc tribunal of the Holy Roman Empire in 1474 was the first “international” recognition of commanders’ obligations to act lawfully."},{"page_url":"https://de.wikipedia.org/wiki/Andrew_Howard","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Andrew_Howard_2016.png","page_title":"Andrew Howard","context_page_description":"Andrew Howard ist ein walisischer Schauspieler."},{"page_url":"https://en.wikipedia.org/wiki/Wilford","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Plaque_on_Smith%27s_Bank_in_Nottingham.jpg","page_title":"Wilford","context_page_description":"Wilford is a village close to the centre of the city of Nottingham, UK. The village is bounded to the north and west by the River Trent and to the east by the embankment of the now closed Great Central Railway."},{"page_url":"https://sv.wikipedia.org/wiki/Gustav_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Gustav_III_av_Per_Krafft_d%C3%A4.jpg","page_title":"Gustav III","context_page_description":"Gustav III, född 13 januari /24 januari 1746, död 29 mars 1792, var Sveriges kung 1771–1792.\\nHan var son till Adolf Fredrik och Lovisa Ulrika, bror till Karl XIII, far till Gustav IV Adolf, och kusin till Katarina II av Ryssland. På grund av sitt stora kulturintresse kallas han ibland \\"Teaterkungen\\". Han instiftade bland annat Svenska Akademien.\\n1772 genomförde han en statsvälvning då riksrådet avsattes och Sveriges första politiska partier, hattarna och mössorna, upplöstes, vilket även satte punkt för de partistrider som tidigare hade präglat svensk inrikespolitik. Genom den nya 1772 års regeringsform delades den politiska makten återigen mellan konungen och riksdagen. Samma år avskaffade Gustav III även tortyr som förhörsmetod, och tortyrkammaren Rosenkammaren stängdes för alltid. Gustav III genomdrev dessutom en inskränkt tryckfrihetsförordning 1774.\\nEfter riksdagen 1778–1779 liberaliserades ekonomin och strafflagstiftningen, där exempelvis dödsstraffet begränsades och barnamordsplakatet infördes."},{"page_url":"https://en.wikipedia.org/wiki/The_20_Hunchakian_gallows","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Kegham_Vanigian.jpg","page_title":"The 20 Hunchakian gallows","context_page_description":"The 20 Hunchakian gallows is the common name for the group of Hunchakian activists who were hanged in the Sultan Beyazıt Square of Constantinople on June 15, 1915 during the Armenian Genocide."},{"page_url":"https://en.wikipedia.org/wiki/Plumbing","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Plumber_uses_two_wrenches_to_tighten_a_fitting.jpg","page_title":"Plumbing","context_page_description":"Plumbing is any system that conveys fluids for a wide range of applications. Plumbing uses pipes, valves, plumbing fixtures, tanks, and other apparatuses to convey fluids. Heating and cooling, waste removal, and potable water delivery are among the most common uses for plumbing, but it is not limited to these applications. The word derives from the Latin for lead, plumbum, as the first effective pipes used in the Roman era were lead pipes.\\nIn the developed world, plumbing infrastructure is critical to public health and sanitation.\\nBoilermakers and pipefitters are not plumbers although they work with piping as part of their trade and their work can include some plumbing."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A2%D1%8B%D1%85%D0%BE%D0%B2%D0%B0_(%D0%B3%D0%BC%D1%96%D0%BD%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Tychowo_gm.png","page_title":"Тыхова (гміна)","context_page_description":"Тыхо́ва — вяскова-гарадская гміна ў Польшчы, уваходзіць у склад Бялагардскага павета Заходнепаморскага ваяводства. Сядзіба размешчана ў Тыхове. Плошча гміны складае 350,45 км². Станам на 2014 год у гміне Тыхова пражывалі 7000 чалавек, шчыльнасць — 20 чал./км². Адміністрацыйна падзелена на 20 салецтваў."},{"page_url":"https://vi.wikipedia.org/wiki/H%C3%A0_%C4%90%C3%B4ng_(th%C6%B0%C6%A1ng_nh%C3%A2n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Madame_Si2.jpg","page_title":"Hà Đông (thương nhân)","context_page_description":"Hà Đông tước KBE JP là thương nhân người lai Âu Á, nhà tư sản mại bản, nhà từ thiện tại Hồng Kông thuộc Anh. Ông được mọi người biết đến là \\"Hương Cảng Đại lão\\" được phong tước hiệp sĩ năm 1915 và 1955."},{"page_url":"https://pt.wikipedia.org/wiki/Id%C3%A1cio_de_Chaves","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Reino_de_Galicia_Suevos.png","page_title":"Idácio de Chaves","context_page_description":"Idácio de Chaves, também conhecido como Idácio de Límica, por ser natural da ciuitas romana de Forum Limicorum, foi um bispo e cronista galaico-romano do século V."},{"page_url":"https://sv.wikipedia.org/wiki/Ch%C3%A2teau-Arnoux-Saint-Auban","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Ch%C3%A2teau_de_Ch%C3%A2teau-Arnoux_-193.jpg","page_title":"Château-Arnoux-Saint-Auban","context_page_description":"Château-Arnoux-Saint-Auban är en kommun i departementet Alpes-de-Haute-Provence i regionen Provence-Alpes-Côte d'Azur i sydöstra Frankrike. Kommunen ligger i kantonen Volonne som ligger i arrondissementet Forcalquier. År 2009 hade Château-Arnoux-Saint-Auban 5 318 invånare."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%85%A7%E7%94%B0%E5%93%A5%E5%BE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/%E6%9D%B1%E4%BA%AC%E5%A4%A7%E5%AD%A6%E7%B7%8F%E5%90%88%E5%9B%B3%E6%9B%B8%E9%A4%A8.JPG","page_title":"內田哥德","context_page_description":"内田哥德是由建筑师内田祥三形成，主导日本东京大学本乡校区的建筑样式。"},{"page_url":"https://nn.wikipedia.org/wiki/Mikrofon","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Dynamic-microphone-senn-rotated.jpg","page_title":"Mikrofon","context_page_description":"Mikrofon er akustoelektrisk omformar som omformar lydtrykk til eit elektrisk signal. Mikrofonar har ein membran som vert sett i rørsle når trykket varierer. Membranrørsla vert så konvertert til ei elektrisk spenning, enten ved hjelp av ein variabel kapasitans, ved hjelp av elektromagnetisk kopling, pizoelektrisk omforming eller optisk kopling.\\nMikrofonar vert nytta til mange føremål, som opptak av tale og musikk i konsertsalar, på sener, i opptaks- og kringkastingsstudio, i samband med forsterkingsanlegg av tale i forsamlingslokale, i store i telefonrøyr og så bortetter. Eit anna bruksområde er laboratoriemålingar, måling av støy og så vidare. Desse bruksområda sett ulike krav til mikrofonane og det finst difor mange ulike mikrofontypar."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BB%D0%BA%D0%B0_%D0%9C%D0%B0%D1%80%D0%BA%D0%BE%D0%B2%D0%B8%D1%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Milka_Markovi%C4%87_sa_ordenom_Sv._Save%2C_1910.jpg","page_title":"Милка Марковић","context_page_description":"Милка Марковић. била је једна од најбољих српских драмских уметница и прва жена редитељ код нас. Глумила је у Народном позоришту у Београду и Српском народном позоришту у Новом Саду."},{"page_url":"https://nl.wikipedia.org/wiki/Tielerwaard","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Riverscape_of_the_Linge_river.jpg","page_title":"Tielerwaard","context_page_description":"De Tielerwaard is een streek in de Nederlandse provincies Gelderland en Zuid-Holland, en is een onderdeel van de grotere landstreek de Betuwe. Met de Tielerwaard wordt van oudsher het deel van de Betuwe in Gelderland aangeduid dat in het noorden wordt begrensd door het riviertje de Linge en in het zuiden door de Waal. In het oosten loopt deze waard door tot Tiel; stroomafwaarts in het westen viel de historische kern van Gorinchem er net buiten. Sinds 1986 behoort het Tielerwaardse dorp Dalem tot de Zuid-Hollandse gemeente Gorinchem en ligt, als gevolg van oostelijke stadsuitbreiding, ook een deel van de stad Gorinchem in de Tielerwaard.\\nDe Tielerwaard gaat in noordelijke richting over in de Neder-Betuwe, in zuidelijke richting in de Bommelerwaard en in westelijke richting in de Vijfheerenlanden en de Alblasserwaard. Bekende plaatsen in de streek zijn Tiel en Geldermalsen. De streek is tamelijk dunbevolkt en overwegend agrarisch van karakter, met vee- en fruitteelt."},{"page_url":"https://fr.wikipedia.org/wiki/Topola","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Topola_and_Oplenac.JPG","page_title":"Topola","context_page_description":"Topola est une ville et une municipalité de Serbie situées dans le district de Šumadija. Au recensement de 2011, la ville comptait 4 573 habitants et la municipalité dont elle est le centre 22 207.\\nLe nom de Topola signifie le « peuplier ». La ville est célèbre pour le Mausolée royal d'Oplenac, qui abrite les dépouilles de 22 membres de la dynastie Karađorđević qui a régné sur la Principauté de Serbie, sur le Royaume de Serbie et, enfin, sur le Royaume de Yougoslavie aux XIXᵉ et XXᵉ siècles."},{"page_url":"https://is.wikipedia.org/wiki/Steinunn_Krist%C3%ADn_%C3%9E%C3%B3r%C3%B0ard%C3%B3ttir","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/SteinunnKristinThordardottir-01.jpg","page_title":"Steinunn Kristín Þórðardóttir","context_page_description":"Steinunn Kristín Þórðardóttir, fædd 9. apríl 1972 í Reykjavík, er framkvæmdastjóri Glitnis banka í London, og varamaður í stjórn Glitnir Bank ASA í Noregi og Glitnis sjóða á Íslandi. Hún situr einnig í framkvæmdastjórn Bresk-íslenska viðskiptaráðsins og er ennfremur í stjórn óháðu þróunar og mannúðarsamtakanna, ICEAID.\\nSteinunn útskrifaðist með BA gráðu í alþjóðaviðskiptum og stjórnmálum frá University of South Carolina 1995 og hlaut síðan MBA gráðu frá Thunderbird School of Global Management í Arizona 1999.\\nSteinunn starfaði í eignastýringardeild Glitnis frá 1995-97 og síðan í alþjóðadeild bankans en fór síðan til starfa hjá Enron Corporation í Bandaríkjunum og Evrópu.\\nSteinunn sneri aftur til Íslands 2001 og var ráðin á alþjóðasvið Glitnis, og varð í ágúst 2003 forstöðumaður alþjóða lánveitinga. Í nóvember 2005 var Steinunn síðan útnefnd framkvæmdastjóri Gliltnis banka í Bretlandi og suður Evrópu, fyrst kvenna til að stýra íslenskri fjármálastofnun erlendis."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D0%BB%D0%B0%D0%B7%D1%83%D0%BD%D1%96%D0%B2_%D0%A0%D0%BE%D1%81%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Phrynocephalus_mystaceus.jpg","page_title":"Список плазунів Росії","context_page_description":"У даному списку наведені усі плазуни, які проживають на території Росії.\\nЗагалом підтверджено проживання приблизно 89 плазунів."},{"page_url":"https://it.wikipedia.org/wiki/Antonio_Le%C3%B3n_Ortega","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/CristoPerdonHuelva.jpg","page_title":"Antonio León Ortega","context_page_description":"Antonio León Ortega è stato uno scultore spagnolo. Di scuola madrilena, sviluppò uno stile personale nella scultura sacra andalusa del XX secolo."},{"page_url":"https://en.wikipedia.org/wiki/Lapa_do_Santo","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Lapa_do_Santo_-_Sepultamento_19_-_Foto_de_Campo_Exposicao_08.jpg","page_title":"Lapa do Santo","context_page_description":"Lapa do Santo is an archaeological site located in the northern part of the Lagoa Santa karst, in the state of Minas Gerais in east-central Brazil. It documents human presence since ca. 12000 years ago presenting three discrete occupation phases that correspond to the early, middle and late Holocene. Llithic technology, zooarchaeology, and multi-isotopic analyses indicate groups of hunter gathers with low mobility and a subsistence strategy focused on gathering plant foods and hunting small and mid-sized mammals. The use of Lapa do Santo as an interment ground started between 10.3-10.6 cal kyBP with primary burials. Between 9.4-9.6 cal kyBP central elements in the treatment of the dead were tooth removal, mutilation, defleshing, exposure to fire and possibly cannibalism, all to reduce the body ahead of reburial of the remains while adhering to strict rules. In the absence of monumental architecture or grave goods, these groups were using parts of fresh corpses to elaborate their rituals. As part of this funerary agenda Lapa do Santo presents the oldest case in the New World of decapitation."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AD%E0%B8%B2%E0%B8%99%E0%B9%82%E0%B8%95%E0%B8%99%E0%B8%AD%E0%B8%9F_%E0%B8%AD%E0%B8%B2%E0%B8%99-24","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Antonow_an-24.jpg","page_title":"อานโตนอฟ อาน-24","context_page_description":"อานโตนอฟ อาน-24 องค์การนาโตกำหนดสัญลักษณ์ เป็น \\"Coke\\" อาน-24 เป็นเครื่องบินโดยสารที่ใช้เครื่องยนต์เทอร์โบใบพัดแบบแรกของสำนักแผนแบบอานโตนอฟ เครื่องต้นแบบบินเป็นครั้งแรกในเดือนเมษายน ปี ค.ศ. 1960 และเริ่มรับผู้โดยสารในเดือน กันยายน ปี ค.ศ. 1963"},{"page_url":"https://en.wikipedia.org/wiki/Turner_Sports_Cars","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/1959_Turner_950_Sports_-_Flickr_-_exfordy.jpg","page_title":"Turner Sports Cars","context_page_description":"Turner Sports Car Company Limited was a 1950s British sports car manufacturer, that closed in 1966."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%DB%8C%D9%85%D8%A8%D8%B1%D8%B2%D8%A7%D9%82%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Chiesa_di_San_Marcellino_-_Campanile.jpg","page_title":"ایمبرزاقو","context_page_description":"ایمبرزاقو ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۲۴۳۱ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۲۴۹ متر یۇکسک‏لیکده یئر آلیب. و لومباردیا اوستانیندا یئرلشیب."},{"page_url":"https://sv.wikipedia.org/wiki/Essoyes","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Essoyes_mairie.JPG","page_title":"Essoyes","context_page_description":"Essoyes är en kommun i departementet Aube i regionen Grand Est i nordöstra Frankrike. Kommunen ligger i kantonen Essoyes som ligger i arrondissementet Troyes. År 2009 hade Essoyes 693 invånare."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%AB%98%E9%B4%A8%E7%A5%9E%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Takakamo-jinja_Higashi-jinja.jpg","page_title":"高鴨神社","context_page_description":"高鴨神社は、奈良県御所市鴨神の金剛山東山麓にある神社。式内社。旧社格は県社。\\n京都府京都市の賀茂神社を始めとする全国のカモ神社の総本社と称する。葛木御歳神社・鴨都波神社に対して「上鴨社」と称される。\\n4月中旬から5月初旬にかけて500種2,200鉢以上の日本サクラソウが咲く。"},{"page_url":"https://sv.wikipedia.org/wiki/S%C3%B6dra_milit%C3%A4rdistriktet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/AM.088358.jpg","page_title":"Södra militärdistriktet","context_page_description":"Södra militärdistriktet var ett militärdistrikt inom svenska Försvarsmakten som verkade åren 2000–2005. Förbandsledningen var förlagd i Göteborgs garnison i Göteborg."},{"page_url":"https://sco.wikipedia.org/wiki/%C3%9C%C3%A7_%C5%9Eerefeli_Mosque","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Inner_court_of_the_%C3%9C%C3%A7_%C5%9Eerefeli_Mosque.jpg","page_title":"Üç Şerefeli Mosque","context_page_description":"The Üç Şerefeli Mosque is a 15t-century Ottoman mosque in Edirne, Turkey."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B8%D1%81_%D0%A0%D0%B0%D0%B4%D0%BE%D1%98%D0%BA%D0%BE%D0%B2%D0%B8%D1%9B%D0%B0_%D0%BE%D1%80%D0%B0%D1%85_(%D0%9F%D0%BE%D0%B4%D0%B3%D0%BE%D1%80%D0%B0%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Zapis-1052-Podgorac-Radojkovica-orah_20160706_3843.jpg","page_title":"Запис Радојковића орах (Подгорац)","context_page_description":"Запис Радојковића орах (Подгорац) се налази на парцели чији је власник Радојковић Милан."},{"page_url":"https://nl.wikipedia.org/wiki/Prodeinotherium","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Prodeinotherium_bavaricum.JPG","page_title":"Prodeinotherium","context_page_description":"Prodeinotherium is een uitgestorven slurfdier uit de familie Deinotheriidae die tijdens het Mioceen leefde."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D1%81%D1%82%D0%B0_%D1%82%D0%B0_%D0%BC%D1%96%D1%81%D1%82%D0%B5%D1%87%D0%BA%D0%B0_%D1%88%D1%82%D0%B0%D1%82%D1%83_%D0%9C%D0%B0%D1%85%D0%B0%D1%80%D0%B0%D1%88%D1%82%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/CIDCO_Aerial-_Canought_Place.jpg","page_title":"Міста та містечка штату Махараштра","context_page_description":"Згідно з даними перепису населення 2001 року у штаті Махараштра зафіксовано 242 міста та 136 містечок. Нижче наведено список усіх міських населених пунктів у розрізі округів, а також подано оновлені дані згідно з переписом населення 2011 року."},{"page_url":"https://ca.wikipedia.org/wiki/Edifici_al_carrer_Sant_Sebasti%C3%A0,_8_(Valls)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/175_Edifici_al_c._Sant_Sebasti%C3%A0%2C_8_%28Valls%29%2C_balcons.jpg","page_title":"Edifici al carrer Sant Sebastià, 8 (Valls)","context_page_description":"L'Edifici al carrer Sant Sebastià, 8 és una obra neoclàssica de Valls protegida com a Bé Cultural d'Interès Local."},{"page_url":"https://es.wikipedia.org/wiki/Hedera_canariensis","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Hedera_canariensis2.jpg","page_title":"Hedera canariensis","context_page_description":"La hiedra de Canarias o Hedera canariensis, es una especie de trepadora de hoja perenne perteneciente a la familia de las araliáceas."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%A6%AC%E9%AB%98%C2%B7%E6%96%BD%E8%92%99%E5%B0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Marco_Simone_%285038454279%29.jpg","page_title":"馬高·施蒙尼","context_page_description":"马尔科·西蒙尼，前意大利足球运动员，司职前锋或中场，退役后成为足球教练。马尔科·西蒙尼曾2度效力意大利俱乐部AC米兰，为AC米兰在各项比赛上场245场，打进74球，并4次赢得意甲冠军、2次赢得欧冠。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%9A%E8%B3%80%E5%9F%8E%E5%B8%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Tagajo.jpg","page_title":"多賀城市","context_page_description":"多賀城市は、宮城県のほぼ中央に位置する市である。市の名称は陸奥国府「多賀城」に因む。旧宮城郡の範囲に当たる。仙台市の北東側に隣接するため、そのベッドタウンとしての性格も持ち合わせている。仙台市への通勤率は43.2パーセント。"},{"page_url":"https://es.wikipedia.org/wiki/Margarita_Diez-Colunje_y_Pombo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Cuadro_geneal%C3%B3gico_revista_Popay%C3%A1n.png","page_title":"Margarita Diez-Colunje y Pombo","context_page_description":"Margarita Diez-Colunje y Pombo fue una historiadora, traductora y genealogista colombiana."},{"page_url":"https://pt.wikipedia.org/wiki/P%C3%A9cs","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Pecs_-_Hungary_-_EU.JPG","page_title":"Pécs","context_page_description":"Pécs é uma cidade e um condado urbano da Hungria, localizada no sudoeste do país. Pécs é a capital do condado de Baranya e a quinta maior cidade do país. No passado, era conhecida pelo nome alemão de Fünfkirchen.\\nOs romanos a chamavam de Sopianas e era a capital da Panônia Valéria.\\nA Universidade de Pécs, fundada em 1367, é das mais antigas do mundo.\\nEm Pécs encontra-se uma amendoeira, com mais de 100 anos. Recebeu o prémio de Árvore Europeia do Ano em 2019."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_G%C3%B6d%C3%B6ll%C5%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Treppenahaus_G%C3%B6d%C3%B6ll%C3%B6.JPG","page_title":"Schloss Gödöllő","context_page_description":"Das Schloss Gödöllő liegt ca. 25 Kilometer nordöstlich der ungarischen Hauptstadt Budapest in der Stadt Gödöllő. Es wurde im 18. Jahrhundert für den Grafen Antal Grassalkovich I. errichtet und ist auch unter dessen Namen bekannt. In der zweiten Hälfte des 19. Jahrhunderts war es die bevorzugte Residenz der österreichischen Kaiserin und ungarischen Königin Elisabeth. Nach dem Zweiten Weltkrieg wurde das Schloss unter der sozialistischen Regierung Ungarns stark vernachlässigt und drohte zu verfallen. Es wird seit 1996 in Abschnitten restauriert und ist seitdem für Besucher zugänglich.\\nDas Schloss ist – gemessen an der überbauten Grundfläche – der größte Barockpalast Ungarns."},{"page_url":"https://fr.wikipedia.org/wiki/Girls_band","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/TheBanglesLiveinSydney2010.jpg","page_title":"Girls band","context_page_description":"Le terme girls band, littéralement « groupe de filles », est une expression dérivée de la version masculine boys band. Il s'agit d'un groupe musical composé uniquement de filles, ou de femmes."},{"page_url":"https://sv.wikipedia.org/wiki/La_Chapelle-sous-Dun","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Map_commune_FR_insee_code_71095.png","page_title":"La Chapelle-sous-Dun","context_page_description":"La Chapelle-sous-Dun är en kommun i departementet Saône-et-Loire i regionen Bourgogne-Franche-Comté i östra Frankrike. Kommunen ligger i kantonen La Clayette som tillhör arrondissementet Charolles. År 2009 hade La Chapelle-sous-Dun 408 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Clara_L._Brown_Dyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/CLARA_L._BROWN_DYER.jpg","page_title":"Clara L. Brown Dyer","context_page_description":"Clara L. Brown Dyer was an American artist who specialized in landscape painting. Also a reader and speaker, she was prominent in clubs and the social scenes of Maine, including being the organizer and president of the Maine branch of United States Daughters of 1812."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%82%E3%81%96%E3%81%BF%E9%87%8E%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Yokohama-municipal-subway-B32-Azamino-station-gate2.jpg","page_title":"あざみ野駅","context_page_description":"あざみ野駅は、神奈川県横浜市青葉区あざみ野二丁目にある、東急電鉄と横浜市営地下鉄の駅である。"},{"page_url":"https://de.wikipedia.org/wiki/West_Highland_Way","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/West_Highland_Way_2005_Coe.jpg","page_title":"West Highland Way","context_page_description":"Der West Highland Way ist ein schottischer Fernwanderweg von Milngavie bei Glasgow nach Fort William.\\nDer Weg beginnt in den Lowlands und führt in die Highlands, vorbei an Schottlands größtem Süßwassersee, dem Loch Lomond, berührt den Taleingang des Glen Coe und endet unweit des höchsten Bergs Schottlands, dem Ben Nevis. Die Gesamtwanderlänge beträgt 154 km. Der Weg wird gemeinsam von dem Highland Council und dem Loch Lomond & Trossachs Interim Committee bewirtschaftet. Durchschnittlich sind 50.000 Wanderer pro Jahr auf dem Weg unterwegs. Je nach Etappeneinteilung werden für den gesamten Weg meistens sechs bis neun Tage benötigt."},{"page_url":"https://eu.wikipedia.org/wiki/Ormaiztegi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Ormaiztegi_-_Ayuntamiento_3.JPG","page_title":"Ormaiztegi","context_page_description":"Ormaiztegi Gipuzkoa hegoaldeko udalerri bat da, Goierri eskualdekoa. 1.300 biztanle zituen\\n2016. urtean, eta 6,77 km². Autobusak egiten dituen Irizar enpresaren egoitza delako da ezaguna."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%95%E0%B8%B5%E0%B9%88%E0%B8%88%E0%B8%B9%E0%B9%8B%E0%B9%80%E0%B8%AD%E0%B8%B5%E0%B9%8A%E0%B8%A2%E0%B8%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Tu_Di_Gong.jpg","page_title":"ตี่จู๋เอี๊ยะ","context_page_description":"ถู่ที้กง, โถ่วตีกง หรือ ในภาษาจีนกลางเรียกว่า ถู่ตี้เฉิน บางครั้งเรียกสั้น ๆ ว่า ถู่ตี้ หรือที่ชาวไทยเชื้อสายจีนเรียกกันว่า ตี่จู๋เอี๊ยะ เป็นเทพเจ้าที่ของชุมชน ที่อยู่อาศัย หรือสถานที่ ตามความเชื่อของศาสนาพื้นบ้านจีนรวมทั้งชาวไทยเชื้อสายจีนในประเทศไทยปัจจุบัน"},{"page_url":"https://nv.wikipedia.org/wiki/Yaadaa%C5%82ch%C3%ADi%CA%BCii_bitsiit%CA%BC%C3%A1%C3%A1d_halb%C3%A1h%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Swee_waxbill_%28Estrilda_melanotis%29_-_part_of_series_%285845892391%29.jpg","page_title":"Yaadaałchíiʼii bitsiitʼáád halbáhígíí","context_page_description":"Yaadaałchíiʼii bitsiitʼáád halbáhígíí éí tsídii tsídígíí dah yikahjí atah yisdzoh, áádóó éí Naakaii Łizhiní Bikéyahdi hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Coccopygia melanotis\\" deiłníigo dayózhí."},{"page_url":"https://de.wikipedia.org/wiki/Audry_(Sormonne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Vaux-Villaine_%28Ardennes%29_lavoir_de_Villaine.JPG","page_title":"Audry (Sormonne)","context_page_description":"Die Audry ist ein Fluss in Frankreich, der im Département Ardennes in der Region Grand Est verläuft. Sie entspringt unter dem Namen Praelle im Gemeindegebiet von Marlemont, entwässert generell in östlicher Richtung durch den Regionalen Naturpark Ardennen und mündet nach rund 20 Kilometern an der Gemeindegrenze von Sormonne und Remilly-les-Pothées als rechter Nebenfluss in die Sormonne. Im Mündungsabschnitt unterquert sie sie Autobahn A 304."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A6%D0%B7%D1%96%D0%BD%D1%87%D0%B6%D0%BE%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Administrative_Division_Jingzhou.png","page_title":"Цзінчжоу","context_page_description":"Цзінчжоу — міський округ у китайській провінції Хубей."},{"page_url":"https://es.wikipedia.org/wiki/Ch%C3%A2teau_Frontenac","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Chateau_Frontenac_1923.jpg","page_title":"Château Frontenac","context_page_description":"El castillo de Frontenac es un hotel histórico y una de las atracciones más populares en la ciudad de Quebec, provincia de Quebec."},{"page_url":"https://ca.wikipedia.org/wiki/Alconera","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Alconera-Badajoz_03.JPG","page_title":"Alconera","context_page_description":"Alconera és un municipi de la província de Badajoz, a la comunitat autònoma d'Extremadura."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BD%D1%87%D0%B8%D1%9B%D0%B5%D0%B2%D0%B0_%D0%BE%D0%BC%D0%BE%D1%80%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Serbische_Fichte_Passau.JPG","page_title":"Панчићева оморика","context_page_description":"Панчићева оморика је врста смрче, ендемит Балканског полуострва и терцијерни реликт. Име је добила по српском ботаничару Јосифу Панчићу који ју је открио на планини Тари 1875. године, код села Заовине и Растишта. Научни назив оморика потиче од локалног имена за ову четинарску врсту."},{"page_url":"https://nl.wikipedia.org/wiki/Labrihe","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Map_commune_FR_insee_code_32173.png","page_title":"Labrihe","context_page_description":"Labrihe is een gemeente in het Franse departement Gers en telt 187 inwoners. De plaats maakt deel uit van het arrondissement Condom."},{"page_url":"https://tr.wikipedia.org/wiki/Papa%C4%9Fans%C4%B1lar_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Guaiabero.jpg","page_title":"Papağansılar listesi","context_page_description":"Papağansılar, tropikal ve subtropikal bölgelerin büyük bir bölümünde bulunan, Psittaciformes takımını oluşturan, 387 türü günümüzde yaşayan 402 tür kuştur. Takım üç üst familyaya ayrılır: Psittacoidea, Cacatuoidea ve Strigopoidea. Genel olarak pantropikal bir dağılıma sahip olan papağanların bazı türleri Güney yarımkürede ılıman bölgelerde de yaşar. Papağanlarda en büyük çeşitlilik Güney Amerika ve Avustralasya'da görülür.\\nCacatuoidea üst familyası hareket edebilen kafa ibikleri, karotid arterlerin farklı düzeni, safra kesesi, kafatası kemiklerinde farklılıklar Psittacoidea üyelerinde ışığı saçarak canlı renklerde görünmesini sağlayan Dyck dokulu tüylerin eksikliği gibi oldukça farklılıklar içerir. Önceleri kendilerine ait Loriidae familyasında sınıflandırılan lori ve loriketler artık Psittaculidae familyası içinde yer alan Loriinae alt familyasının Loriini oymağını oluşturur. Porto Riko papağanı bazı türler popülasyon darboğazına maruz kalmıştır ve dolayısıyla düşük genetik değişkenlik ve düşük üreme başarısı sonucu koruma durumlarında zorluklar ortaya çıkmıştır.\\nPsittaciformes takımının taksonomisi üzerine son zamanlara kadar bir görüş birliği yoktu."},{"page_url":"https://pt.wikipedia.org/wiki/Regus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Regus_logo15.png","page_title":"Regus","context_page_description":"Regus é uma empresa multinacional que oferece espaços de trabalho e escritórios prontos em Business Centers em todo o mundo. Em 26 de Janeiro de 2015 operava já 2.300 centros de negócios em 120 países. Fundada em Bruxelas, na Bélgica, em 1989, a Regus tem sede em Luxemburgo, emprega 8.375 colaboradores e está cotada na Bolsa de Valores de Londres no índice FTSE 250. Em 2013, o Grupo Regus apresentava receitas de £1,533.5m com lucros operacionais de £205.3m."},{"page_url":"https://en.wikipedia.org/wiki/Manningham_United_FC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Manningham_United_Promotion.jpg","page_title":"Manningham United FC","context_page_description":"Manningham United Blues Football Club is an Australian soccer club from Templestowe, a suburb of Melbourne, Victoria. The club was formed in 1965 by local Italian Australians and was formerly known as Fawkner Blues.\\nIn 2010, Fawkner SC split from the club. Manningham United plays their senior games at Park Avenue Reserve while the majority of their junior games are played at Timberidge."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27ingr%C3%A9dients_de_la_cuisine_tha%C3%AFlandaise","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Bai_yanang_%E0%B9%83%E0%B8%9A%E0%B8%A2%E0%B9%88%E0%B8%B2%E0%B8%99%E0%B8%B2%E0%B8%87_Tiliacora_triandra.JPG","page_title":"Liste d'ingrédients de la cuisine thaïlandaise","context_page_description":"La cuisine thaïlandaise, bien que semblable en certains points avec celle de ses voisins chinois, indiens et birmans, se démarque par des saveurs et ingrédients originaux : curry, menthe, citronnelle, coriandre, basilic rouge. Pimentée à l'excès pour le palais occidental et presque toujours accompagnée de nuoc mam, elle rencontre un succès international croissant. Voici donc une liste des ingrédients utilisés en cuisine thaïlandaise."},{"page_url":"https://en.wikipedia.org/wiki/Medical_Cadet_Corps","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Medics-p013020.jpg","page_title":"Medical Cadet Corps","context_page_description":"The Medical Cadet Corp is a program of the Seventh-day Adventist Church started in the 1930s in the United States with the intention of preparing young men of draft age for military service in noncombatant roles. The training included drill, first aid, military courtesies, organization of medical corps, defense against chemical warfare, principles of anatomy and physiology, physical exercises and character development. The program was temporarily suspended at the end of World War II. It was reactivated in 1950 and in the next few years was adapted internationally. The program was deactivated by the General Conference of Seventh-day Adventists in the early 1972 but continued independently in a few locations with an emphasis on rescue and disaster response.\\nIn 2016, the Medical Cadet Corps, a component of the World Service Organization that is under the umbrella of the General Conference Department of Adventist Chaplaincy Ministries, was reactivated as a worldwide program."},{"page_url":"https://en.wikipedia.org/wiki/Umbarra","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/The_funeral_of_Queen_Narelle%2C_wife_of_King_Merriman_at_Wallaga_Lake%2C_William_Henry_Corkhill.jpg","page_title":"Umbarra","context_page_description":"Umbarra, or King Merriman was an Aboriginal elder of the Djirringanj/Yuin people of the Bermagui area on the South Coast of New South Wales.\\nAlthough Aboriginal people traditionally did not have kings or chiefs, only elders, the white colonial powers used to often grant king plates to certain elders, hence the moniker King."},{"page_url":"https://fr.wikipedia.org/wiki/Pi%C3%A8ce_de_1_franc_Premi%C3%A8re_R%C3%A9publique","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/1francRepublique1992avers.png","page_title":"Pièce de 1 franc Première République","context_page_description":"La pièce de Un franc Première république commémore la proclamation de la Première République en France lors de la Révolution en 1792 soit 200 ans plus tôt. L'avers reprend la Marianne de Dupré utilisée sur certaines pièces de l'époque."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B9%9D%E5%85%AD%E5%BC%8F%E8%89%A6%E8%BC%89%E6%88%B0%E9%AC%A5%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/A5M_Claude.jpg","page_title":"九六式艦載戰鬥機","context_page_description":"九六式艦載戰鬥機是日本海軍第一架國產全金屬單翼戰鬥機，其前身被稱為九試單戰，1935年三菱重工的設計打敗中島飛機得標，隨即取代中島九五式艦載戰鬥機成為日軍航空母艦主要戰鬥機，盟軍代號「Claude」。"},{"page_url":"https://it.wikipedia.org/wiki/Ferrovia_Chivasso-Asti","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Asti-Chivasso_1914_timetable.jpg","page_title":"Ferrovia Chivasso-Asti","context_page_description":"La ferrovia Chivasso-Asti è una linea di carattere regionale che univa Asti con la linea Torino-Milano, presso Chivasso.\\nIl servizio ferroviario fu sospeso nel 2012."},{"page_url":"https://simple.wikipedia.org/wiki/Hylobates","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Weisshandgibbon_tierpark_berlin.jpg","page_title":"Hylobates","context_page_description":"The genus Hylobates is one of the four genera of gibbons. It is the most widespread type of gibbon; there are six or seven species. Individuals in this genus are characterized by 44 chromosomes and often have a ring of white fur around their faces."},{"page_url":"https://zh.wikipedia.org/zh-my/%E7%BF%BC%E8%99%9F%E5%88%97%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/JR_East_shinkansen_400_tsubasa_6cars.jpg","page_title":"翼號列車","context_page_description":"“翼”是一种在东日本旅客铁道东北新干线和山形新干线运行的特别急行列车的班次名称。“翼”是山形新干线的专属班次，于1992年7月1日正式启用成为新干线的班次，也是首个新干线直行特急班次。启用初期“翼”只往来于东京和山形路段间，但当山形新干线山形至新庄路段于1999年12月4日通车后，“翼”的行走路线也配合延长至新庄。\\n在成为新干线班次前，“翼”原本是奥羽本线上的特急列车，于1961年10月启用，往返于东京和秋田、青森两地之间。"},{"page_url":"https://de.wikipedia.org/wiki/Luftangriffe_auf_die_Leunawerke","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Avro_Lancaster_Mk_1_ExCC.jpg","page_title":"Luftangriffe auf die Leunawerke","context_page_description":"Im Zweiten Weltkrieg erfolgten 22 schwere Luftangriffe der US Army Air Forces und der Royal Air Force auf den Großraum Merseburg/Leuna. Hauptziel waren die Leunawerke der I.G. Farben bei Merseburg, einer der bedeutendsten Standorte der Chemie-Industrie im Deutschen Reich. Einer seiner Schwerpunkte war die „Kohleverflüssigung“, die Herstellung von synthetischem Benzin aus Braunkohle in Hydrierwerken. Vom 12. Mai 1944 bis zum 4. April 1945 warfen in 22 Angriffen insgesamt 6.552 viermotorige Bomber fast 18.000 Tonnen Bombenlast über dem Großraum Leuna/Merseburg/Lützkendorf/Schkopau ab, davon trafen etwa 10 % das Leunawerk selber. Es entstanden in dieser „Schlacht um Leuna“ im Werk und dessen Umgebung schwerste Schäden, die mit großem Aufwand zwischen den Angriffen immer wieder behelfsmäßig repariert wurden. In der Belegschaft gab es 341 Tote und 703 Verletzte. Mit dem darauf folgenden Ausfall von 90 % der deutschen Benzinproduktion war der Krieg laut Albert Speer für das Deutsche Reich auch „produktionstechnisch verloren“."},{"page_url":"https://pl.wikipedia.org/wiki/Nov%C3%A1_Ves_(Ostrawa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Nov%C3%A1_Ves_CoA.jpg","page_title":"Nová Ves (Ostrawa)","context_page_description":"Nová Ves – jeden z 23 obwodów miejskich miasta statutarnego Ostrawy, stolicy kraju morawsko-śląskiego, we wschodnich Czechach. Jest to także jedna z 39 gmin katastralnych w jego granicach o nazwie Nová Ves u Ostravy i powierzchni 306,6994 ha. Populacja w 2001 wynosiła 603 osób, zaś w 2012 odnotowano 234 adresów."},{"page_url":"https://es.wikipedia.org/wiki/Almohadillas_adhesivas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Almohadillas.jpg","page_title":"Almohadillas adhesivas","context_page_description":"Las almohadillas adhesivas en las patas de varios vertebrados e invertebrados son unas estructuras que les permite a estos caminar sobre sustratos verticales e incluso \\"patas arriba\\", a veces sobre superficies tan lisas como el vidrio transparente de una ventana.\\nLos animales que poseen almohadillas adhesivas no solo pueden sujetarse con gran fuerza, sosteniendo hasta 100 veces su propio peso, sino que también pueden correr sin dificultad sobre una pared. Es evidente que esta adaptación tan útil para animales pequeños que necesitan trepar árboles, esconderse bajo las hojas o buscar refugio o alimento por entre las rocas, evolucionó independientemente más de una vez."},{"page_url":"https://hu.wikipedia.org/wiki/Phoenix_%C5%B1rszonda","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Snow_Queen_Animation.gif","page_title":"Phoenix űrszonda","context_page_description":"A Phoenix űrszonda a Mars Scout bolygókutató űrszondaprogram első küldetése, melyet a Mars Surveyor 2001 törölt Mars-szonda félkész leszállóegységéből alakítottak ki. Alapvető feladata az esetleges marsi élet feltételei, jelei után való kutatás volt – utaljanak ezek akár jelenlegi, akár régmúltbeli életre. A Spirit és az Opportunity marsjárókkal szemben a Phoenix nem tudott közlekedni a Mars felszínén, viszont lényegesen kifinomultabb műszerekkel rendelkezett.\\nA leszállóegység 2008. május 25-én sikeresen leszállt a Mars felszínére. Július 31-én megerősítették, hogy a szonda elérte fő célját, vízjeget talált közvetlenül a Mars felszíne alatt. A küldetésnek a beköszöntő marsi ősz vetett véget 2008 novemberében, de a szonda így is túlteljesítette az eredetileg tervezett küldetést mind időtartam, mind eredmények tekintetében, így a küldetés sikeresnek mondható."},{"page_url":"https://en.wikipedia.org/wiki/Giovanni_Messe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Giovanni_Messe.jpg","page_title":"Giovanni Messe","context_page_description":"Giovanni Messe was an Italian general, politician, and field marshal. He is considered by many to have been the best Italian general of the Second World War."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%A6%AC%E7%B4%B9%E7%88%BE%E4%BA%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/MH_-map_A.png","page_title":"馬紹爾人","context_page_description":"马绍尔人，为马绍尔共和国的主体民族，主要分布在马绍尔群岛上，使用的语言主要是英语和马绍尔语，近代被德国、日本、美国殖民，岛上残留了选多殖民时期遗留的习俗，但马绍尔人还是保留了许多自己的习俗，两者混合成现在的马绍尔人。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A2%97%E6%AF%9B%E7%81%AF%E5%8F%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Mashike_lighthouse_2015.jpg","page_title":"増毛灯台","context_page_description":"増毛灯台とは、北海道増毛郡増毛町に建つ灯台である。北海道で13番目に古い灯台である。見晴らしがよく、増毛市街から留萌方面の海岸線までを一望できる。"},{"page_url":"https://es.wikipedia.org/wiki/Mantequilla_de_cannabis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Marijuana_Cookies_%2832180501184%29.jpg","page_title":"Mantequilla de cannabis","context_page_description":"La mantequilla de Marrakech, más comúnmente, mantequilla de cannabis o mantequilla de marihuana es una mantequilla que ha sido infusionada con algún componente de la marihuana, ​ por lo que tiene efectos psicotrópicos, además de ingrediente base para muchos comestibles de cannabis que llevan mantequilla, como tartas y pasteles. Se elabora a partir de disolver tetrahidrocannabinol, el principal constituyente psicoactivo del cannabis, en mantequilla común.​\\nTeóricamente la mantequilla de Marrakech no se usa pura.​ Generalmente se usa en la preparación de «pasteles espaciales» en lugar de mantequilla normal o en la preparación de otras especialidades culinarias de cannabis que requieran mantequilla. También se puede usar resina de cannabis, es decir, hachís."},{"page_url":"https://pl.wikipedia.org/wiki/Storczyca_kulista","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Traunsteinera_globosa_a1.jpg","page_title":"Storczyca kulista","context_page_description":"Storczyca kulista – gatunek rośliny z rodziny storczykowatych. Łacińską nazwę rodzajową nadano jej dla uczczenia zasług austriackiego aptekarza Josepha Traunsteinera."},{"page_url":"https://ht.wikipedia.org/wiki/Morven,_Georgie","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Morven_City_Hall%2C_Brooks_County.JPG","page_title":"Morven, Georgie","context_page_description":"Morven, Georgie se yon vil Etazini. Li sitye nan leta Georgie.\\nChèf-lye li se?\\n."},{"page_url":"https://it.wikipedia.org/wiki/Dosson","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Autobus_Mercedes-Benz_Citaro_di_MOM-Mobilit%C3%A0_di_Marca_per_Dosson%2C_Linea_9.jpg","page_title":"Dosson","context_page_description":"Dosson è una frazione del comune italiano di Casier, in provincia di Treviso.\\nNonostante la denominazione del comune, Dosson è il centro principale di quest'ultimo sia dal punto di vista demografico, sia da quello amministrativo."},{"page_url":"https://en.wikipedia.org/wiki/Keith_Baker_(game_designer)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/KeithbakerCROP.jpg","page_title":"Keith Baker (game designer)","context_page_description":"Keith Baker is a game designer and fantasy novel author. In addition to working with Wizards of the Coast on the creation of Eberron, he has also contributed material for Goodman Games, Paizo Publishing and Green Ronin Publishing."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD-26","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%BE%D0%B2_%D0%90%D0%BD-26_7205%2C_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3_-_%D0%9B%D0%B5%D0%B2%D0%B0%D1%88%D0%BE%D0%B2%D0%BE_RP55390.jpg","page_title":"Ан-26","context_page_description":"Ан-26 — советский военно-транспортный самолёт, разработанный в КБ Антонов. Он является модификацией исходной модели Ан-24. Благодаря большой ширине проёма грузового люка и установке специальной трап-створки возможна удобная погрузка как с земли, так и из кузова автомобиля, что значительно ускоряет и облегчает погрузочно-разгрузочные работы. Ан-26 оснащён двумя турбовинтовыми двигателями АИ-24ВТ и одним дополнительным реактивным РУ-19А-300, установленным в правой гондоле основного двигателя.\\nВ Китае был разработан и выпускается Xian Y-7, созданный на базе Ан-26.\\nВ настоящее время эксплуатируется пассажирская модификация Ан-26-100 с вместимостью до 43 человек. Самолёты переделаны в пассажирские на заводе из базовой грузовой модификации и имеют недостаток — отсутствие багажных полок. Всего построено 1 403 самолёта этого типа."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_El_Paso_County,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Old_Bnai_Zion_Synagogue_03.JPG","page_title":"National Register of Historic Places listings in El Paso County, Texas","context_page_description":"This is a list of the National Register of Historic Places listings in El Paso County, Texas.\\nThis is intended to be a complete list of properties and districts listed on the National Register of Historic Places in El Paso County, Texas. There are 12 districts, one National Historic Landmark, 43 individual properties, and one former property listed on the National Register in the county. Two of these sites are State Historic Sites. Nine sites are also listed as Recorded Texas Historic Landmarks including three that are State Antiquities Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted May 29, 2020."},{"page_url":"https://fr.wikipedia.org/wiki/A_Love_Sublime","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Browning-Tod-A-love-sublime-1917.jpg","page_title":"A Love Sublime","context_page_description":"A Love Sublime est un film américain de Tod Browning et Wilfred Lucas, sorti en 1917."},{"page_url":"https://simple.wikipedia.org/wiki/Latino-Faliscan_languages","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Linguistic_Landscape_of_Central_Italy.png","page_title":"Latino-Faliscan languages","context_page_description":"The Latino-Faliscan languages are a large branch of Italic languages. They were first spoken in what is now Italy. It is the only branch with languages still spoken. The only branch of Latino-Faliscan languages with languages still spoken is the Romance languages, which came from Latin. Latin was spread across Europe by the Roman Empire, and Latin then split into many branches over time. There were also at least three other Latino-Faliscan languages that are now extinct."},{"page_url":"https://ca.wikipedia.org/wiki/Green_(cr%C3%A0ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/AS11-42-6333_Green_M_crater.jpg","page_title":"Green (cràter)","context_page_description":"Green és un cràter d'impacte situat en la cara oculta de la Lluna, just a l'oest de l'enorme plana emmurallada del cràter Mendeléiev, i està gairebé unit amb la vora oest-nord-oest del cràter Hartmann.\\nGreen no s'ha erosionat significativament, encara que alguns cràters petits marquen el seu contorn i les seves parets interiors. El perímetre és gairebé circular, però mostra un sortint cap a l'exterior en el seu costat oriental, amb indicis d'un corriment de terres. Els costats interiors inclouen algunes estructures terraplenades, sobretot cap al nord-est. En el punt central del relativament pla sòl interior presenta una cresta central. El fons del cràter és més pla en la seva meitat occidental, amb algunes elevacions suaus en l'est. Només uns pocs petits cràters marquen el seu interior."},{"page_url":"https://ca.wikipedia.org/wiki/Convent_i_esgl%C3%A9sia_de_la_Merc%C3%A8_(Girona)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/LA_MERC%C3%88_Fa%C3%A7ana1.2010.jpg","page_title":"Convent i església de la Mercè (Girona)","context_page_description":"El Convent i església de la Mercè és una església del municipi de Girona inclosa en l'Inventari del Patrimoni Arquitectònic de Catalunya."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%8A%D9%81%D8%B1%D9%84%D9%89_(%D8%A7%D8%B3%D9%83%D8%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Beverly_Main_Post_Office%2C_Beverly%2C_MA.jpg","page_title":"بيفرلى (اسكس)","context_page_description":"بيفرلى مدينه امريكيه اداريا بتتبع مقاطعه اسكس."},{"page_url":"https://en.wikipedia.org/wiki/Wolfgang,_Count_of_Hohenlohe-Weikersheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Schloss_und_Park_Weikersheim.jpg","page_title":"Wolfgang, Count of Hohenlohe-Weikersheim","context_page_description":"Wolfgang, Count of Hohenlohe-Weikersheim was the first Count of Hohenlohe-Weikersheim. He was the son of Louis Casimir of Hohenlohe-Waldenburg, who styled himself Count of Neuenstein, Langenburg, Weikersheim, Künzelsau, Kirchberg and Ingelfingen and his wife, Anna of Solms-Lich."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_evangelisch-lutherischen_Kirchen_in_Hamburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Math-claud-kirch_wolliner_str.jpg","page_title":"Liste der evangelisch-lutherischen Kirchen in Hamburg","context_page_description":"Zur ehemaligen Evangelisch-Lutherischen Kirche im Hamburgischen Staate gehörten die fünf Hamburger Hauptkirchen und eine große Anzahl weiterer. Die bekannteste Kirche ist die Michel genannte Hauptkirche Sankt Michaelis, mit ihrem charakteristischen Turm das Wahrzeichen der Stadt. Die alte Hauptkirche St. Nikolai ist seit ihrer der Zerstörung im Zweiten Weltkrieg nur noch Mahnmal. Die älteste lutherische Kirche im Stadtgebiet, die Sinstorfer Kirche, gehörte bis 1977 zur Evangelisch-Lutherischen Landeskirche Hannovers."},{"page_url":"https://fr.wikipedia.org/wiki/L%27Histoire_silencieuse_des_Sourds","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Exposition_d%27histoire_silencieuse_des_Sourds.jpg","page_title":"L'Histoire silencieuse des Sourds","context_page_description":"L'Histoire silencieuse des Sourds est la première exposition sur l’histoire sourde et la langue des signes française se déroulant du 19 juin 2019 au 6 octobre 2019 au Panthéon à Paris. Il s’agit d’« une introduction à l’histoire des Sourds avec ses périodes de progrès pour l’instruction et l’intégration, ses grandes figures de sourds-muets instruits et engagés comme\\nJeanne Stuart ou l’architecte Étienne de Fay, la création de la première association sourde à Paris en 1836 par Ferdinand Berthier [ainsi que] ses périodes de régression, avec la montée de l’eugénisme à la fin du XIXᵉ siècle et au XXᵉ siècle »."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%A1%E0%A9%87%E0%A8%A8%E0%A9%80%E0%A8%85%E0%A8%B2_%E0%A8%B0%E0%A9%88%E0%A9%B1%E0%A8%A1%E0%A8%95%E0%A8%B2%E0%A8%BF%E0%A8%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Danielradcliffesignature.png","page_title":"ਡੇਨੀਅਲ ਰੈੱਡਕਲਿਫ","context_page_description":"ਡੇਨੀਅਲ ਜੋਕੋਬ ਰੈੱਡਕਲਿਫ ਇੱਕ ਅੰਗਰੇਜ਼ੀ ਅਦਾਕਾਰ ਹੈ ਜੋ ਹੈਰੀ ਪੋਟਰ ਨਾਮ ਦੀ ਫ਼ਿਲਮ ਲੜੀ ਵਿੱਚ ਹੈਰੀ ਪੋਟਰ ਦੀ ਮਸਹੂਰ ਭੂਮਿਕਾ ਲਈ ਜਾਣਿਆ ਜਾਂਦਾ ਹੈ। ਉਸਨੇ ਬੀਬੀਸੀ ਇਕ ਦੀ 1999 ਦੀ ਟੈਲੀਵਿਜ਼ਨ ਫ਼ਿਲਮ ਡੇਵਿਡ ਕਪਰਫੀਲਡ ਵਿੱਚ 10 ਸਾਲ ਦੀ ਉਮਰ ਵਿੱਚ ਆਪਣਾ ਅਭਿਨੈ ਅਰੰਭ ਕੀਤਾ ਸੀ, ਜਿਸ ਤੋਂ 2001 ਵਿੱਚ \\" ਦਾ ਟੇਲਰ ਓਫ ਪਨਾਮਾ\\" ਪੇਸ਼ ਕੀਤਾ ਗਿਆ ਸੀ। 11 ਸਾਲ ਦੀ ਉਮਰ ਵਿਚ, ਉਹ ਪਹਿਲੀ ਹੈਰੀ ਪੋਟਰ ਫਿਲਮ ਵਿਚ ਹੈਰੀ ਪੋਟਰ ਦੇ ਰੂਪ ਵਿਚ ਕਾਸਟ ਕੀਤਾ ਗਿਆ ਸੀ ਅਤੇ 2011 ਵਿਚ ਅੱਠਵਾਂ ਅਤੇ ਆਖਰੀ ਫ਼ਿਲਮ ਦੀ ਹਿੱਸੇ ਦੀ ਰਿਲੀਜ਼ ਤਕ 10 ਸਾਲ ਤੱਕ ਉਸ ਲੜੀ ਵਿਚ ਕੰਮ ਕੀਤਾ।\\nਰੈੱਡਕਲਿਫ ਨੇ 2007 ਵਿਚ ਲੰਡਨ ਅਤੇ ਨਿਊਯਾਰਕ ਵਿਚ ਐਕਜ਼ ਦੇ ਕਾਰਪੋਰੇਸ਼ਨਾਂ ਵਿਚ ਅਭਿਨੈ ਸ਼ੁਰੂ ਕੀਤਾ। ਉਸ ਦੀਆਂ ਫਿਲਮਾਂ ਵਿੱਚ ਡਰਾਮੇ ਫਿਲਮ 'ਦਿ ਵਮਿਨ ਇਨ ਬਲੈਕ' ਸ਼ਾਮਲ ਹੈ, ਜੋ ਸੁਤੰਤਰ ਫਿਲਮ\\n\\"ਕਿੱਲ ਯੋਊਰ ਡਾਰਲਿੰਗਸ\\", ਵਿਗਿਆਨਿਕ ਗਲਪ ਫੈਨਟੈਂਸੀ \\"ਵਿਕਟਰ ਫ੍ਰੈਂਨਸਟਾਈਨ\\" ਅਤੇ ਕਮੇਡੀ ਡ੍ਰਾਮਾ \\"ਸਵਿੱਸ ਆਰਮੀ ਮੈਨ\\", ਡਿਗਰੀ ਰੋਮਾਂਚਕ ਫਿਲਮ \\"ਨਾਓ ਯੂ ਸੀ ਮੀ 2\\" ਅਤੇ ਥ੍ਰਿਲਰ \\"ਇਮਪੀਰੀਅਮ\\" ।"},{"page_url":"https://de.wikipedia.org/wiki/Northbridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Motherboard_diagram.svg","page_title":"Northbridge","context_page_description":"Die Northbridge bezeichnet eine Hardwarekomponente einer modernen PC-Hauptplatine. Traditionell ist die Northbridge ein separater Chip, der sich im Gegensatz zur Southbridge dicht an der CPU befindet, um Daten schnell transferieren zu können. Die beiden Chips werden zusammen als Chipsatz bezeichnet. Eine Notwendigkeit, die Northbridge als separaten Chip vorzusehen, besteht jedoch nicht.\\nIntel bezeichnet einige seiner Northbridges als Memory Controller Hubs. Bei den Prozessoren auf Nehalem-Basis beschreibt der Begriff Uncore unter anderem die im Prozessor integrierte Northbridge-Funktionalität."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%AD%E5%9B%BD%E9%93%81%E8%B7%AF25Z%E5%9E%8B%E5%AE%A2%E8%BD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/201608_Interior_of_RZ25Z_First_Class.jpg","page_title":"中国铁路25Z型客车","context_page_description":"25Z型客車，是中國鐵路客車車型之一，屬於160km/h級別的准高速客車，主要用於中、短途城際特快列車。25Z型客車的「Z」代表准高速，構造速度為160km/h。由四方機車車輛廠、長春客車廠和南京浦鎮車輛廠研製，在1993年至1996年間前後共生產了兩批。由於25Z型客車沒有進行統型，所以前後兩批和各鐵路局的25Z型客車不是完全相同的。\\n25Z型客車是中國鐵路的第一代准高速客車，雖然未有普及全國，但其研製和提速試驗數據為後來大量生產的25K型客車，以及由1997年起的中國鐵路大提速累積了大量經驗。\\n2015年1月1日，根據中國鐵路總公司規定，原廠製造25Z列車外觀需統一漆成附帶雙黃線的墨綠色，俗稱「偽綠皮」或「高阻綠」。"},{"page_url":"https://sk.wikipedia.org/wiki/Anna_Stuartov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Wissing%2C_Willem_-_Queen_Anne%2C_1687.jpg","page_title":"Anna Stuartová","context_page_description":"Anna Stuartová bola kráľovná Anglicka, Škótska a Írska od 8. marca 1702."},{"page_url":"https://fr.wikipedia.org/wiki/Skate_Canada_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Yuliya_Lipnitskaya_at_the_Skate_Canada_2013_02.jpg","page_title":"Skate Canada 2013","context_page_description":"Le Skate Canada est une compétition internationale de patinage artistique qui se déroule au Canada au cours de l'automne. Il accueille des patineurs amateurs de niveau senior dans quatre catégories: simple messieurs, simple dames, couple artistique et danse sur glace.\\nLe quarantième Skate Canada est organisé du 25 au 27 octobre 2013 au Harbour Station à Saint-Jean dans le Nouveau-Brunswick. Il est la deuxième compétition du Grand Prix ISU senior de la saison 2013/2014.\\nSaint-Jean a déjà organisé cet événement à deux reprises en 1995 et 1999."},{"page_url":"https://it.wikipedia.org/wiki/Alvar_Aalto","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Alvar_and_Elissa_Aalto.jpg","page_title":"Alvar Aalto","context_page_description":"Hugo Alvar Henrik Aalto è stato un architetto, designer e accademico finlandese, tra le figure più importanti nell'Architettura del XX secolo e ricordato – assieme a Ludwig Mies van der Rohe, Walter Gropius, Frank Lloyd Wright e Le Corbusier – come maestro del Movimento Moderno."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_imaginilor_aniversare_Hubble","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/HH_901_and_HH_902_in_the_Carina_nebula_%28captured_by_the_Hubble_Space_Telescope%29.jpg","page_title":"Lista imaginilor aniversare Hubble","context_page_description":"Lista imaginilor aniversare Hubble este o listă de imagini lansate pentru a sărbători aniversările Telescopului Spațial Hubble. I se sărbătorește „ziua de naștere” la data de 24 aprilie, fiind lansat pe orbită la 24 aprilie 1990, de către echipajul Space Shuttle Discovery."},{"page_url":"https://en.wikipedia.org/wiki/1924_in_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Marlon_Brando.jpg","page_title":"1924 in the United States","context_page_description":"Events from the year 1924 in the United States."},{"page_url":"https://hu.wikipedia.org/wiki/Appingedam_vas%C3%BAt%C3%A1llom%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Voor-_en_linker_zijgevel_-_Appingedam_-_20024037_-_RCE.jpg","page_title":"Appingedam vasútállomás","context_page_description":"Appingedam vasútállomás vasútállomás Hollandiában, Appingedam városában."},{"page_url":"https://en.wikipedia.org/wiki/St_Jude%27s_Church,_Kensington","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/St_Jude%27s_Church%2C_Kensington%2C_Cafe_view_east_543.JPG","page_title":"St Jude's Church, Kensington","context_page_description":"St Jude's Church, Courtfield Gardens, Kensington, London, was designed by architects George Godwin and Henry Godwin, and built between 1867–70; the tower and spire were constructed in 1879. It was built on the northern portion of Captain Robert Gunter's estate. The project was overseen by Reverend J. A. Aston, and financed by John Derby Allcroft, a wealthy glove manufacturer. The construction, not including the tower, pulpit, font and organ cost £11,300, and was undertaken by Myers & Sons.\\nThe building is now occupied by St Mellitus College, led by the Dean, Andy Emerton. The College runs ordination and theology courses. It is also occupied by a homeless charity, the Earl's Court Project. On Sundays the building is one of five sites where the church of Holy Trinity Brompton meets."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%B0%E6%96%B9%E5%B9%B3%E5%9D%87%E6%99%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Equation_of_time.svg","page_title":"地方平均時","context_page_description":"地方平均時は、特定の経度における視太陽時の時間の変動を補正し、一様な時間間隔を刻むように調整された太陽時の一形態である。\\n地方平均時は、19世紀の初めに時間帯が導入される以前に使用されていた。それ以降でも天文学や航法で使用されることがある。"},{"page_url":"https://es.wikipedia.org/wiki/Maia_(madre_de_Buda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Maya_Nepal_Musee_Guimet_23092007_1.jpg","page_title":"Maia (madre de Buda)","context_page_description":"La reina Maia de Sakia, fue la madre biológica de Gautama Buda, el sabio en cuyas enseñanzas se fundó el budismo. Era hermana de Mahapajapati Gotami, la primera monja budista ordenada por Buda.​​\\nEn la tradición budista, Maia murió a poco de nacer Buda -generalmente se dice que siete días después- y volvió a la vida en un cielo budista-hindú, una pauta que se cree se repite en los nacimientos de todos los Budas.​ Por lo tanto, Maia no crio a su hijo, quien en cambio fue criado por su tía materna Mahapajapati Gotami.​ Sin embargo, de vez en cuando Maia descendía del cielo para aconsejar a su hijo.​\\nMāyā significa \\"ilusión\\" en sánscrito. A Maia también se la llama Mahāmāyā y Māyādevī. En tibetano se la llama Gyutrulma y en japonés se la conoce como Maya-bunin. En cingalés también se la conoce como මහාමායා දේවී."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%B5%CF%81%CF%8C%CE%BD_(%CE%A3%CE%BF%CE%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/P%C3%A9ronne_-_La_somme_au_d%C3%A9bouch%C3%A9_de_la_Cologne.JPG","page_title":"Περόν (Σομ)","context_page_description":"Το Περόν είναι γαλλική κοινότητα, υπονομαρχία του νομού Σομ, στη διοικητική περιοχή Ω-ντε-Φρανς, στο βόρειο τμήμα της Γαλλίας. Ο πληθυσμός ανέρχεται σε 7.579 κατοίκους.\\nΗ πόλη βρίσκεται στην περιοχή όπου το 1916 διεξήχθη η αιματηρή μάχη του Σομ και αργότερα δύο ακόμη μάχες το 1918, κατά τη διάρκεια του Α' Παγκοσμίου Πολέμου.\\nΜέσα στα τείχη του ερειπωμένου κάστρου του Περόν στεγάζεται το μουσείο Ιστορικό του Μεγάλου Πολέμου και πολλά μνημεία στην πόλη είναι αφιερωμένα στους νεκρούς του Α' Παγκοσμίου Πολέμου.\\nΟι κάτοικοι ονομάζονται Περοναί."},{"page_url":"https://br.wikipedia.org/wiki/Senones","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Map_Gallia_Tribes_Towns.png","page_title":"Senones","context_page_description":"Ar Senones, pe Senoned, a oa ur bobl c’halian a oa o vevañ e hanternoz Galia Celtica, er c’horn-bro zo en-dro da gêr Sens hiziv. En-dro dezho e oa ar pobloù-mañ: Lingones er reter, Parisii en norzh, Carnutes er c‘hornôg, Bituriges er su. Agedincum ha Metiosedum e oa o c’hêrioù brasañ.\\nLod eus ar Senoned a yeas dreist d’an Alpoù da vont da chom e Gallia Cisalpina, war-dro 400 kent JK. Asambles ganto e voe pobloù galian all o vont eus Gallia Transalpina da hanternoz Italia, evel ar Voied pe ar Senoned. Kemer a rejont perzh en arigrap Roma e 390 kent JK. En em ziazeañ a rejont war aod reter Italia ha ganto e voe savet kêr Sena Gallica, a zeuas da vezañ o c’hêr-benn.\\nE-pad ouzhpenn kant vloaz e voe ar Senones o vrezeliañ a-enep ar Romaned. A-benn ar fin e voent trec’het gant ar c’hoñsul Publius Cornelius Dolabella e 283 kent JK, ha kaset kuit eus o bro. War-lerc’h ne voe ket klevet anv anezho e Galia Cisalpina ken. Marteze ez ejont da draoñienn an Danav, a-gevret gant pobloù galian all.\\nAr Senoned a oa o chom e hanternoz Galia Celtica, goude bezañ graet emglev gant Julius Caesar, a skarzhas o roue Cavarinos, a oa bet anvet gant ar Romaned."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D1%80%D0%BE%D0%B1%D0%BA%D0%B0_%D0%BF%D0%B5%D1%80%D0%B5%D0%B4%D0%B0%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/AutomatikW116.JPG","page_title":"Автоматическая коробка передач","context_page_description":"Автоматическая коробка передач в широком смысле — коробка передач, устройство и механика работы которой позволяют ей в процессе движения транспортного средства самостоятельно определять наиболее подходящее доступное передаточное отношение, переходить с одного передаточного отношения на другое, обеспечивать упрощённую для водителя процедуру трогания с места и выполнять это всё автоматически, наиболее оптимально подстраивая внешнюю скоростную характеристику двигателя под заданную водителем скорость движения в текущих дорожных условиях. Автоматическая КП есть один из двух широко распространённых типов коробок передач, применяемых на разноплановых колёсных, гусеничных и рельсовых транспортных средствах.\\nКонструкция современных АКП не имеет общего вида, но ввиду того, что в исторической ретроспективе подавляющее большинство АКП сделаны на основе планетарных коробок передач в сборе с гидротрансформатором, под АКП по умолчанию понимается именно подобная конструкция."},{"page_url":"https://ast.wikipedia.org/wiki/Cascante","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Cascante_-_Iglesia_de_La_Victoria.JPG","page_title":"Cascante","context_page_description":"Cascante ye un conceyu y una ciudá española de la Comunidá Foral de Navarra, asitiada na Ribera de Navarra, na Merindad de Tudela y a 104 km de la capital de la comunidá, Pamplona. La so población n'2017 ye de 3780 habitantes."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%B3%E3%82%B6%E3%82%B9%E5%B7%9E%E9%81%B8%E5%87%BA%E3%81%AE%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E5%90%88%E8%A1%86%E5%9B%BD%E4%B8%8A%E9%99%A2%E8%AD%B0%E5%93%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Sam_Brownback_official_portrait_3.jpg","page_title":"カンザス州選出のアメリカ合衆国上院議員","context_page_description":"以下は、カンザス州選出のアメリカ合衆国上院議員の一覧である。\\nカンザス州は、1861年1月29日に連邦に加わった。カンザス州は第2部と第3部に属する上院議員を選出している。現在のカンザス州選出の上院議員はパット・ロバーツとジェリー・モランである。"},{"page_url":"https://gl.wikipedia.org/wiki/H%C3%A9ctor_C%C3%A1mpora","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Museo_del_Bicentenario_-_Afiche_%22Lealtad%22.jpg","page_title":"Héctor Cámpora","context_page_description":"Héctor José Cámpora, chamado afectuosamente El Tío, nado en Buenos Aires o 26 de marzo de 1909 e finado en Cidade de México o 18 de decembro de 1980, foi un odontólogo e político arxentino, que chegou a ser Presidente da Nación."},{"page_url":"https://da.wikipedia.org/wiki/Firs%C3%A5rskrigen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/WilliamOfOrange1580.jpg","page_title":"Firsårskrigen","context_page_description":"Firsårskrigen eller det hollandske oprør varede fra 1568 til 1648 og var Nederlands frihedskamp mod Spanien.\\nDen startede med den spanske statholder, Hertugen af Albas, hårde forfølgelse af de nederlandske calvinister, og henrettelsen af de fremtrædende adelsmænd Egmont og Hoorn i Bryssel i det nuværende Belgien.\\nFredsaftalen i Münster den 30. januar 1648 afsluttede krigen mod Spanien og markerede Nederlands endelige løsrivelse fra det Tysk-romerske rige."},{"page_url":"https://en.wikipedia.org/wiki/Giovanni_Battista_Piatti","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/G_B_Piatti.jpg","page_title":"Giovanni Battista Piatti","context_page_description":"Giovanni Battista Piatti was an Italian civil engineer from Milan."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Georges-Blancaneix","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Saint-Georges-Blancaneix_village.JPG","page_title":"Saint-Georges-Blancaneix","context_page_description":"Saint-Georges-Blancaneix, également appelée Saint-Georges-de-Blancaneix, est une commune française située dans le département de la Dordogne, en région Nouvelle-Aquitaine."},{"page_url":"https://ro.wikipedia.org/wiki/Zbat","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/SprtPeoriaGrandExcursion06282004.jpg","page_title":"Zbat","context_page_description":"Zbatul este o placă plană sau puțin curbată, montată împreună cu altele asemănătoare pe o roată numită roată cu zbaturi ce se rotește în jurul unui ax perpendicular pe direcția de înaintare și care creează forța de propulsie necesară deplasării unei nave.\\nRoata cu zbaturi este un tip de propulsor antecedent elicei, care se întâlnește din ce în ce mai rar, exclusiv la nave de ape interioare.\\nRoțile cu zbaturi erau acționate aproape în exclusivitate de motoare cu abur, pentru propulsarea vapoarelor cu abur sau a navelor cu zbaturi."},{"page_url":"https://sv.wikipedia.org/wiki/Human_(album_av_Brandy_Norwood)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Natasha_Bedingfield_2012_Shankbone_3.JPG","page_title":"Human (album av Brandy Norwood)","context_page_description":"Human är det femte studioalbumet av den amerikanska artisten Brandy. Skivan blev Brandys debut hos skivbolaget Epic Records efter att hon lämnat Atlantic Records år 2005. Albumet gavs ut den 5 december 2008 i Frankrike och under första kvartalet 2009 i de flesta andra länder. Brandy återförenades med långtidspartnern Rodney \\"Darkchild\\" Jerkins som inte varit närvarande på föregångaren Afrodisiac. Hon arbetade även med RedOne, Bruno Mars, Chase N. Cashe, D'Mile, Toby Gad och Hit-Boy. Efter att ha varit inblandad i en bilolycka där en tvåbarnsmamma omkom ville artisten skapa ett mer känslosamt och personligt musikalbum. Human blev en stiländring för Brandy som till stor del lämnade R&B-genren och istället fokuserade på pop och country.\\nHuman blev en kommersiell flopp - veckan efter utgivningen hade skivan sålts i 73 000 exemplar och debuterat på plats 15 på Billboard 200. Det blev artistens lägsta toppnotering på albumlistan sedan debuten Brandy femton år tidigare. Med en total försäljning på cirka 190 000 exemplar misslyckades den att matcha föregående albumhits och blev också Brandys sämst säljande album hittills i karriären. Musikkritikers reaktioner på skivan var blandade."},{"page_url":"https://cs.wikipedia.org/wiki/Jan_Horn%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Jan_Horn%C3%ADk_2018.jpg","page_title":"Jan Horník","context_page_description":"Jan Horník je od roku 2018 místopředseda Senátu PČR, od roku 2004 senátor za obvod č. 1 – Karlovy Vary, od roku 2000 zastupitel Karlovarského kraje, od roku 1990 starosta města Boží Dar a v letech 2017 až 2019 místopředseda hnutí STAN."},{"page_url":"https://en.wikipedia.org/wiki/Counter_(digital)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Early_SSA_accounting_operations.jpg","page_title":"Counter (digital)","context_page_description":"In digital logic and computing, a counter is a device which stores the number of times a particular event or process has occurred, often in relationship to a clock. The most common type is a sequential digital logic circuit with an input line called the clock and multiple output lines. The values on the output lines represent a number in the binary or BCD number system. Each pulse applied to the clock input increments or decrements the number in the counter.\\nA counter circuit is usually constructed of a number of flip-flops connected in cascade. Counters are a very widely used component in digital circuits, and are manufactured as separate integrated circuits and also incorporated as parts of larger integrated circuits."},{"page_url":"https://lt.wikipedia.org/wiki/Lawrence_Alma-Tadema","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Alma-Tadema.jpg","page_title":"Lawrence Alma-Tadema","context_page_description":"Lorensas Alma-Tadema – iš Nyderlandų kilęs Anglijos istorinio žanro tapytojas."},{"page_url":"https://nn.wikipedia.org/wiki/The_Midnight_Gospel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/TmgLogo.png","page_title":"The Midnight Gospel","context_page_description":"The Midnight Gospel er ein amerikansk animert fjernsynsserie skapt av Pendleton Ward og Duncan Trussell. Det er den første animerte produksjonen frå Ward for Netflix. Serien går føre seg i ein dimensjon kjend som «The Chromatic Ribbon» og handlar om spacecastaren Clancy som eig ein forboden multivers-simulator. Gjennom denne reiser han gjennom verder som er i ferd med å gå under og intervjuar nokre av innbyggjarane for «spacecasten» sin. Programmet er gjesta av mellom andre Phil Hendrie, Stephen Root, Drew Pinsky, Trudy Goodman, Jason Louv, Caitlin Doughty, Damien Echols, Maria Bamford, Joey Diaz, David Nichtern, og Deneen Fendig.\\nThe Midnight Gospel vart utgjeve på Netflix den 20. april 2020."},{"page_url":"https://pt.wikipedia.org/wiki/Ramal_de_Matosinhos","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/PostalMatosinhosSardinhaComboio.jpg","page_title":"Ramal de Matosinhos","context_page_description":"O Ramal de Matosinhos, originalmente conhecido como Ramal de Leixões, e também conhecido como Linha de Leça, foi um troço ferroviário, em bitola métrica, que ligava a Estação Ferroviária de Senhora da Hora, na Linha do Porto à Póvoa e Famalicão, ao Porto de Leixões, em Portugal. Foi construído em 1884 para a construção do Porto de Leixões, servindo para o transporte de pedra desde as pedreiras de São Gens, e posteriormente foi adaptado para o transporte em geral de passageiros e mercadorias, tendo entrado ao serviço comercial em 6 de Maio de 1893. Foi encerrado em 1 de Julho de 1965. Na década de 2000, parte do leito deste Ramal foi aproveitado para a construção da Linha A do Metro do Porto;"},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%96%B0%E8%8A%9D%E6%B5%A6%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/JR_JI_line_symbol.svg","page_title":"新芝浦站","context_page_description":"新芝浦站是一个位于神奈川县横滨市鹤见区末广町二丁目，属于东日本旅客铁道、日本货物铁道鹤见线的铁路车站。车站编号是JI 51。"},{"page_url":"https://tg.wikipedia.org/wiki/%D0%90%D0%BB%D0%B2%D0%B0%D1%80%D0%B5%D1%81_%D0%9B%D1%83%D0%B8%D1%81_%D0%A3%D0%BE%D0%BB%D1%82%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/LWA_Picture_Final.jpg","page_title":"Алварес Луис Уолтер","context_page_description":"Алварес Луис Уолтер — физики америкоӣ, узви АИ ШМА. Барандаи Ҷоизаи Нобел дар бахши физика"},{"page_url":"https://ca.wikipedia.org/wiki/Resoluci%C3%B3_1969_del_Consell_de_Seguretat_de_les_Nacions_Unides","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Obrigado_Barrack.jpg","page_title":"Resolució 1969 del Consell de Seguretat de les Nacions Unides","context_page_description":"La Resolució 1969 del Consell de Seguretat de les Nacions Unides fou adoptada per unanimitat el 24 de febrer de 2011. Després de reafirmar les resolucions 1599, 1677, 1690, 1703, 1704, 1745, 1802, 1867 i 1912 sobre la situació a Timor Oriental, el Consell va decidir ampliar el mandat de la Missió Integrada de les Nacions Unides a Timor Oriental durant un any, fins al 26 de febrer de 2012."},{"page_url":"https://pl.wikipedia.org/wiki/Chrystus_Frasobliwy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Chrystus_Frasobliwy_w_Kro%C5%9Bcienku_nad_Dunajcem.jpg","page_title":"Chrystus Frasobliwy","context_page_description":"Chrystus Frasobliwy – w ikonografii chrześcijańskiej jest to przedstawienie rozmyślającej postaci Jezusa Chrystusa w pozycji siedzącej, z głową opartą na dłoni. Na głowie znajduje się korona cierniowa zaś na ciele widoczne są ślady biczowania. Według niektórych autorów ma to być przedstawienie momentu na Golgocie, tuż przed ukrzyżowaniem, choć figurę tę można także interpretować jako symboliczne streszczenie Męki Pańskiej.\\nPrzedstawienie to znacznie częściej wykorzystywane jest w rzeźbie niż w malarstwie."},{"page_url":"https://pt.wikipedia.org/wiki/Don_Henley","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Don_Henley.jpg","page_title":"Don Henley","context_page_description":"Donald Hugh \\"Don\\" Henley é um músico, cantor, compositor e baterista estadunidense, mais conhecido como um dos fundadores da banda de rock The Eagles. Mais tarde, lançou uma bem sucedida carreira solo, ganhando sete prêmios Grammy e atingindo os dez mais da Billboard Hot 100 seis vezes. Em 2008, foi nomeado o 87ᵒ melhor cantor de todos os tempos pela revista Rolling Stone. Desde 1994 divide sua atividade musical entre os Eagles e sua carreira solo."},{"page_url":"https://pt.wikipedia.org/wiki/Urania_leilus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Cramer%26Stoll-uitlandsche_kapellen_vol._1-_plate_085.jpg","page_title":"Urania leilus","context_page_description":"Urania leilus é uma mariposa, ou traça, neotropical diurna da família Uraniidae, encontrada a leste dos Andes; na Bolívia, Peru, Equador, Colômbia, Venezuela, Trinidad, Suriname, Guiana Francesa e Brasil amazônico; registrada como um visitante ocasional nas Pequenas Antilhas, tais como ilhas de São Cristóvão e Nevis, Barbados e Dominica. Foi classificada por Carolus Linnaeus, com a denominação de Papilio leilus, em 1758. Suas lagartas se alimentam de plantas do gênero Omphalea. Esta espécie é aparentada com Chrysiridia rhipheus, conhecida por Rainha-de-Madagáscar e considerada a mariposa mais bonita do mundo."},{"page_url":"https://tr.wikipedia.org/wiki/Ulusal_Bat%C4%B1_Sanatlar%C4%B1_M%C3%BCzesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/National_museum_of_western_art05s3200.jpg","page_title":"Ulusal Batı Sanatları Müzesi","context_page_description":"Ulusal Batı Sanatları Müzesi, Japonya'nın başkenti Tokyo'da bulunan Batılı sanatlar ile ilgili bir halka açık sanat müzesidir. Müze Taitō semtinde Ueno Parkı'nda yer almaktadır.\\nUlusal Batı Sanatları Müzesi, 10 Haziran 1959 tarihinde kuruldu. Müze, düşüncesini müzesinde yansıttığı Matsukata Kojiro'nun çekirdek sanat koleksiyonu etrafında geliştirildi. Müzenin ana binası Le Corbusier tarafından tasarlanmıştır.\\nMüze, kuruluşundan bu yana daimi koleksiyonunu kurma ve geliştirme çabalarıyla her yıl sanat eserleri satın aldı. Müzede 14. yüzyıldan 20. yüzyılın başlarına kadar olan resim ve heykel örnekleri de dahil olmak üzere yaklaşık 4500 eser bulunmaktadır.\\nMüze, Temmuz 2016 tarihinde UNESCO tarafından Le Corbusier'in 17 eseri ile birlikte Dünya Miras Listesi'ne dahil edildi."},{"page_url":"https://it.wikipedia.org/wiki/M2_(astronomia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Messier2_crop.jpg","page_title":"M2 (astronomia)","context_page_description":"M 2 è un ammasso globulare visibile nella costellazione dell'Aquario."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%97%E0%B8%A8%E0%B8%9A%E0%B8%B2%E0%B8%A5%E0%B8%94%E0%B8%B4%E0%B8%A5%E0%B8%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Dili_Reisfelder.jpg","page_title":"เทศบาลดิลี","context_page_description":"ดิลี เป็น 1 ใน 13 เทศบาลของประเทศติมอร์-เลสเต เป็นที่ตั้งของกรุงดิลีเมืองหลวงของประเทศ และเป็นเทศบาลที่มีประชากรและความหนาแน่นประชากรมากที่สุด"},{"page_url":"https://de.wikipedia.org/wiki/Bassewitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Kirche_Basse_02.jpg","page_title":"Bassewitz","context_page_description":"Bassewitz ist der Name eines alten mecklenburgischen Adelsgeschlechts, das nach dem westlich von Gnoien gelegenen Basse benannt ist. Der Basse – in der Jägersprache die Bezeichnung für einen älteren Keiler – ist das Wappentier der Familie."},{"page_url":"https://en.wikipedia.org/wiki/Bauxite_tailings","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Bauxite_bedarieux_herault.jpg","page_title":"Bauxite tailings","context_page_description":"Bauxite tailings, also known as bauxite residue, red mud, red sludge, or alumina refinery residues, is a highly alkaline waste product composed mainly of iron oxide that is generated in the industrial production of alumina. It is important to differentiate between the alkaline waste generated in the Bayer process and the tailings generated during the mining of bauxite. The scale of production makes the waste product an important one, and issues with its storage are reviewed and every opportunity is explored to find uses for it.\\nOver 95% of the alumina produced globally is through the Bayer process; for every tonne of alumina produced, approximately 1 to 1.5 tonnes of bauxite tailings/residue are also produced. Annual production of alumina in 2018 was approximately 126 million tonnes resulting in the generation of over 160 million tonnes of bauxite tailings/residue."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Br%C3%BCcken_%C3%BCber_den_Necker","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/M%C3%BChle_Br%C3%BCcke_%C3%BCber_den_Necker%2C_St._Peterzell_SG_-_Mogelsberg_SG_20190420-jag9889.jpg","page_title":"Liste der Brücken über den Necker","context_page_description":"Die Liste der Brücken über den Necker enthält die Brücken von der Quelle in der Nähe der Ofenlochschlucht bis zur Mündung bei Lütisburg in die Thur."},{"page_url":"https://fr.wikipedia.org/wiki/Highcroft_Racing","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Highcroft_ARX-01a.jpg","page_title":"Highcroft Racing","context_page_description":"Highcroft Racing est une écurie de course automobile américaine, basée à Danbury, et fondée par le pilote Duncan Dayton en 1989. Initialement fondée pour permettre à Duncan Dayton de participer à des courses de véhicules historiques, avec la restauration et la préparation des voitures, l'équipe a participé au championnat American Le Mans Series de 2006 à 2011."},{"page_url":"https://hu.wikipedia.org/wiki/Plaza_Mayor_(Torre%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Panor%C3%A1mica_Plaza_Mayor.jpg","page_title":"Plaza Mayor (Torreón)","context_page_description":"A Plaza Mayor a mexikói Torreón város főtere. 2012-ben alakították ki, azóta számos rendezvényt és koncertet tartottak már a téren, de több tízezren itt ünnepelték például a Santos Laguna labdarúgócsapat 2015-ös és 2018-as bajnoki címét is, sőt, volt már helyszíne tüntetéseknek is."},{"page_url":"https://ca.wikipedia.org/wiki/Felip_Neri","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Santa_Maria_in_Vallicella_Rome_06.jpg","page_title":"Felip Neri","context_page_description":"Felip Neri, anomenat l'apòstol de Roma, va néixer a Florència, el 21 de juliol de 1515 i va morir a Roma el 26 de maig de 1595. Fou fundador de la Congregació de l'Oratori."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_F%C3%BCssen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/F%C3%BCssen%2C_Schrannengasse_8_20170629_002.jpg","page_title":"Liste der Baudenkmäler in Füssen","context_page_description":"Auf dieser Seite sind die Baudenkmäler der schwäbischen Stadt Füssen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://sv.wikipedia.org/wiki/Galago_(sl%C3%A4kte)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Galago_senegalensis.jpg","page_title":"Galago (släkte)","context_page_description":"Galago är ett släkte i familjen galagoer som i sin tur tillhör ordningen primater. I släktet finns fyra till fjorton arter som förekommer i centrala och södra Afrika."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D8%A7%D8%AF%D9%87_%D8%A7%DB%8C%DB%B1%DB%B0_(%D8%A7%D9%86%DA%AF%D9%84%D8%B3%D8%AA%D8%A7%D9%86)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/A10_road_map.png","page_title":"جاده ای۱۰ (انگلستان)","context_page_description":"جاده ای۱۰ یکی از جاده‌های کشور انگلستان است.\\nاین جاده از شهر لندن شروع و در شهر کینگز لین در شهرستان نورفک به پایان میرسد، طول این جاده ۱۴۵.۵ کیلومتر است."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%90%D1%82%D0%B0%D0%BD%D0%B0%D1%81%D0%B8%D1%98%E2%80%9C_-_%D0%A1%D1%82%D0%B5%D1%9A%D0%B5_(%D0%BD%D0%BE%D0%B2%D0%B0_%D1%86%D1%80%D0%BA%D0%B2%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/%D0%92%D0%B8%D0%BA%D0%B8%D0%B5%D0%BA%D1%81%D0%BF%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D1%98%D0%B0_%D0%9F%D1%80%D0%B5%D1%81%D0%BF%D0%B0_14.jpg","page_title":"Црква „Св. Атанасиј“ - Стење (нова црква)","context_page_description":"Свети Атанасиј — мала црква во селото Стење, сместена близу новоизградената плажа во Стење."},{"page_url":"https://en.wikipedia.org/wiki/Kishori_Godbole","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/KishoriGodbole.jpg","page_title":"Kishori Godbole","context_page_description":"Kishori Godbole is a Marathi TV and film actress. She is the daughter of Marathi singer Jaywant Kulkarni. She is known for her role as Mrs. Vibhavari Suhaas Tendulkar in Mrs Tendulkar. She is also a well known theater actress of many plays. She played the character of Shoba in Sachin Pilgaonkar's TV series Had Kar Di, aired on Zee TV. Currently, she is playing Bayaza Maa in Sony TV's show Mere Sai - Shraddha Aur Saburi."},{"page_url":"https://nl.wikipedia.org/wiki/Teveren","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Pfarrkirche_in_Teveren.JPG","page_title":"Teveren","context_page_description":"Teveren is een plaats in de Duitse gemeente Geilenkirchen in de deelstaat Noordrijn-Westfalen. Het dorp ligt ca. 3 km ten zuidwesten van de stad Geilenkirchen aan de Landesstrasse 42, die van Randerath over Teveren naar Heerlen leidt en aan de Kreisstrasse 3, die Frelenberg met Gillrath verbindt. Langs Teveren stroomt de Roode Beek, die ter plekke ook wel de \\"Teverener Bach\\" wordt genoemd. Vlak bij Teveren ligt de Teverener Heide, een beschermd natuurgebied. De bevolking is in tegenstelling tot de omgeving voor een aanzienlijk deel protestant, wat veroorzaakt is door naoorlogse immigratie. Het dialect wordt Teverener Platt genoemd en wordt gerekend tot het Limburgs, alhoewel het plaatselijke dialect in een overgangsgebied ligt met het Ripuarisch."},{"page_url":"https://ca.wikipedia.org/wiki/Fran%C3%A7ois_Besch","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/The_Alzette_in_Luxembourg-City.JPG","page_title":"François Besch","context_page_description":"François Besch és un fotògraf luxemburguès. Es troba entre els pioners del smartphone de la fotografia artística. És autodidacta i està vivint i treballant des de l'any 2006 a Bivange, el lloc de naixement del també fotògraf luxemburguès Edward Steichen."},{"page_url":"https://it.wikipedia.org/wiki/Yokohama_Film_Festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Ryoko_Hirosue_at_Kochi_Yosakoi_Matsuri_1_cropped.jpg","page_title":"Yokohama Film Festival","context_page_description":"ll Festival del film di Yokohama o Yokohama Film Festival è un festival cinematografico che si tiene annualmente a Yokohama, in Giappone.\\nAd ogni edizione vengono premiati, insieme al \\"Miglior Film\\", i dieci migliori film dell'anno. Al Festival sono assegnati inoltre i premi per le più importanti categorie artistiche e tecniche, in particolare quelli per i migliori attori, attrici e registi emergenti, nonché uno o più premi speciali alla carriera. Dal 1981 al 1987 è stato assegnato un premio per il \\"Miglior Film Indipendente\\" mentre dal 1984 viene assegnato un \\"Premio Speciale della Giuria\\"."},{"page_url":"https://it.wikipedia.org/wiki/Famiglia_Anoa%27i","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/WWE_Champion_The_Rock_2013.jpg","page_title":"Famiglia Anoa'i","context_page_description":"La famiglia Anoa'i è una storica famiglia attiva nel mondo del wrestling originaria delle Samoa Americane.\\nIl reverendo Anoa'i Amituana'i e Peter Maivia sono \\"fratelli di sangue\\", una connessione che continua con Afa e Sika, che considerano Maivia loro zio. Quest'ultimo sposò Ofelia Fuataga, che aveva già una figlia di nome Feagaimaleata, adottata e cresciuta come fosse sua. Feagaimaleata sposò il wrestler Rocky Johnson e la coppia generò Dwayne Johnson, meglio conosciuto come The Rock. Inoltre Vera Anoa'i, sorella di Afa e Sika, ha sposato Solofa Fatu, dando inizio anche alla dinastia Fatu, di cui fanno parte Umaga, Rikishi e molti altri."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%A1%D5%A6%D5%A3%D5%A5%D5%B6_%D4%B1%D5%BC%D5%A1%D5%BB%D5%AB%D5%B6_%D5%AF%D5%A1%D5%A9%D5%B8%D5%B2%D5%AB%D5%AF%D5%B8%D5%BD%D5%AB_%D5%B0%D5%B8%D6%82%D5%B7%D5%A1%D6%80%D5%B1%D5%A1%D5%B6_(%D5%8E%D5%A1%D5%B2%D5%A1%D6%80%D5%B7%D5%A1%D5%BA%D5%A1%D5%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/%D5%8E%D5%A1%D5%A6%D5%A3%D5%A5%D5%B6_%D4%B1%D5%BC%D5%A1%D5%BB%D5%AB%D5%B6_%D5%AF%D5%A1%D5%A9%D5%B8%D5%B2%D5%AB%D5%AF%D5%B8%D5%BD%D5%AB_%D5%B0%D5%B8%D6%82%D5%B7%D5%A1%D6%80%D5%B1%D5%A1%D5%B6_%285%29.JPG","page_title":"Վազգեն Առաջին կաթողիկոսի հուշարձան (Վաղարշապատ)","context_page_description":"Վազգեն Առաջին կաթողիկոսի հուշարձան, Ամենայն Հայոց Կաթողիկոս Վազգեն Առաջինին նվիրված հուշարձան Արմավիրի մարզի Վաղարշապատ քաղաքում՝ Էջմիածնի մայր տաճարի հարևանությամբ գտնվող քաղաքային զբոսայգում։ Հուշարձանը տեղադրվել է 2010 թվականին։"},{"page_url":"https://fr.wikipedia.org/wiki/Boog_Powell_(baseball,_1993)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Boog_Powell_2017.jpg","page_title":"Boog Powell (baseball, 1993)","context_page_description":"Herschel Mack Powell IV est un joueur de champ extérieur des Athletics d'Oakland de la Ligue majeure de baseball.\\nCouramment appelé Boog Powell, il n'a aucun lien de parenté avec l'ancien joueur Boog Powell, mais hérite de ce surnom à cause de son grand-père, admirateur de cette vedette du baseball des années 1960 et 1970."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%88%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D0%B8_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/2018_Ukraine_Stamp_15.jpg","page_title":"Знаки поштової оплати України 2018","context_page_description":"Знаки поштової оплати України 2018 — перелік поштових марок, введених в обіг Укрпоштою у 2018 році.\\nЗ 22 січня по 26 грудня 2018 року було випущено 90 поштових марок, у тому числі 89 пам'ятних та одна стандартна марка дев'ятого випуску. Тематика комеморативних марок охопила ювілеї визначних дат, подій, пам'яті видатних діячів культури та інши. До обігу надійшли знаки поштової оплати номіналом 5,00; 9,00; та 15,00 гривень, дев'ятого випуску стандартних марок із літерним номіналом «D», а також «V», «W», «Z».\\nМарки було надруковано державним підприємством «Поліграфічний комбінат „Україна“».\\nВідсортовані за датою введення."},{"page_url":"https://fr.wikipedia.org/wiki/Grottes_des_F%C3%A9es_de_Saalfeld","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Saalfelder_Feengrotte_%287%29.JPG","page_title":"Grottes des Fées de Saalfeld","context_page_description":"Les grottes des fées de Saalfeld sont des grottes d'une ancienne mine à proximité de Saalfeld, en Thuringe en Allemagne. Elles sont notables pour ses concrétions particulièrement colorées."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/L%C3%B4-m%C3%A1_h%C3%B4ng-t%C3%A8_lia%CC%8Dt-toa%E2%81%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Montemartini_-_Carino_1030439.JPG","page_title":"Lô-má hông-tè lia̍t-toaⁿ","context_page_description":"Lô-má hông-tè sī Lô-má Tè-kok ê thóng-tī-chiá, chū in kong-bîn kap kun-tūi kiàn-li̍p khí koân-le̍k. Tè-kok sī tùi Lô-má Kiōng-hô-kok hoat-tián--chhut-lâi-ê. Thâu chi̍t ūi hông-tè sī Augustus, bô tia̍t-pia̍t ê hâm-thâu, sī chhái-ēng goân-ló thâu-lâng chè-tō͘ chheng-hō. Chit khoán chêng-hêng liân-sio̍k liáu 300 tang, thang hō chò Goân-siú sî-tāi.\\nTē-saⁿ Sè-kí Gûi-ki liáu-āu, Diocletianus kā tong-sî ê tè-chèng kái-chìn jî-chhiá chèng-sek-hòa, kiàn-li̍p khí Kún-chú sî-tāi.\\nHiān-tāi kóng ê \\"hông-tè\\", hoan-e̍k-siōng tùi-tâng ê Latin-gí sī imperator, goân-lâi sī kun-tūi tùi sêng-kong ê chiong-kun ê chheng-hō. Le̍k-sú-ka sú-iōng hông-tè chi̍t jī, lâi pau-koat Lô-má Tè-kok sî-tāi chē khoán ê kun-chú hâm-thâu."},{"page_url":"https://fr.wikipedia.org/wiki/Test_de_Rorschach","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Rorschach_blot_07.jpg","page_title":"Test de Rorschach","context_page_description":"Le test de Rorschach ou psychodiagnostic de Rorschach est un outil de l'évaluation psychologique de type projectif élaboré par le psychanalyste Hermann Rorschach en 1921. Il consiste en une série de planches graphiques présentant des taches symétriques a priori non figuratives qui sont proposées à la libre interprétation de la personne évaluée. Analysées par la personne administrant le test, les réponses fournies servent à évaluer la personnalité du sujet.\\nLe test n'a fait aucune preuve de son efficacité et comme tel l'utilisation de ce test a presque disparu de la recherche scientifique en psychologie ou psychiatrie. En dépit de son inefficacité, il reste largement utilisé en psychologie clinique et dans l'évaluation psychologique plus généralement.\\nLe test projectif de Rorschach est généralement associée à la paréidolie, phénomène psychologique qui se base sur l'interprétation personnelle de considérer des formes indéfinies comme des formes reconnaissables."},{"page_url":"https://hu.wikipedia.org/wiki/Fouras","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/FourasVille.JPG","page_title":"Fouras","context_page_description":"Fouras település Franciaország délnyugati részén, Charente-Maritime megyében, a Poitou-Charentes régióban. Lakosainak száma 4047 fő. Fouras Île-d’Aix, Saint-Laurent-de-la-Prée, Yves és Port-des-Barques községekkel határos."},{"page_url":"https://eu.wikipedia.org/wiki/Apogon_mydrus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/FMIB_47478_Mionorus_mydrus.jpeg","page_title":"Apogon mydrus","context_page_description":"Apogon mydrus Apogon generoko animalia da. Arrainen barruko Actinopterygii klasean sailkatzen da, Apogonidae familian."},{"page_url":"https://pt.wikipedia.org/wiki/Porto_(transporte)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Porto_flutuante_de_Manaus.jpg","page_title":"Porto (transporte)","context_page_description":"Um porto é uma área, abrigada das ondas e correntes, localizada à beira de um oceano, mar, lago ou rio, destinada à atracação de barcos e navios, com o pessoal e serviços necessários ao carregamento e descarregamento de carga e ao estoque temporário deles, como instalações para o movimento de pessoas e carga ao redor do setor portuário, e, em alguns casos, terminais especialmente designados para acomodação de passageiros.\\nUm porto que está localizado à beira de um oceano ou de um mar é constantemente chamado de porto marítimo. À beira de um rio ou estuário é chamado um porto fluvial. Já um pequeno porto destinado principalmente à recreação é mais habitualmente chamado de marina.\\nNormalmente os cálculos de estruturas portuárias para atracação dos barcos em segurança, como quebra-mares, molhes, bacias de evolução e outras são efetuados por especialistas em engenharia hidráulica utilizando-se de modelos matemáticos e de modelos físicos em laboratórios de hidráulica marítima.\\nIndispensáveis para um porto são:\\nPresença de profundos canais de água;\\nProteção contra o vento e ondas;\\nAcesso a estradas e ferrovias."},{"page_url":"https://en.wikipedia.org/wiki/Patrick_Gilmore","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Patrick_S._Gilmore.jpg","page_title":"Patrick Gilmore","context_page_description":"Patrick Sarsfield Gilmore was an Irish-born American composer and bandmaster who lived and worked in the United States after 1848. While serving in the Union Army during the U.S. Civil War, Gilmore wrote the lyrics to the song \\"When Johnny Comes Marching Home\\". This was published under the pseudonym Louis Lambert in September 1863."},{"page_url":"https://fr.wikipedia.org/wiki/D%C5%8Dtaku","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Dotaku_TNM.jpg","page_title":"Dōtaku","context_page_description":"Les dōtaku sont des cloches japonaises fondues dans un bronze relativement peu épais et richement ornementées. Les cloches dōtaku apparaissent dans des dépôts rituels à la période Yayoi moyen, mais de nombreux dōtaku anciens datent des IIᵉ et IIIᵉ siècles. Au cours d'une des premières phases de leur évolution les dōtaku ont été ornés de motifs représentants des éléments de la nature et des animaux ou des scènes de chasse, de travail agricole etc., les historiens pensent que les dōtaku servaient aux prières pour avoir une bonne récolte. En effet les animaux y figurant étaient des ennemis naturels des parasites attaquant les rizières.\\nDans la région du Kansai, de nombreux dōtaku ont été retrouvés généralement loin des lieux habités, peut-être aux limites des terroirs."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B5%A4%E7%9B%AE%E5%9F%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Akame_castle_itikumon.JPG","page_title":"赤目城","context_page_description":"赤目城は現在の愛知県愛西市赤目町に存在した日本の城。"},{"page_url":"https://en.wikipedia.org/wiki/Court_of_Appeal_of_New_Zealand","image_url":"https://upload.wikimedia.org/wikipedia/en/4/4e/Court_of_Appeal_Wellington_front_door.jpg","page_title":"Court of Appeal of New Zealand","context_page_description":"The Court of Appeal of New Zealand is the principal intermediate appellate court of New Zealand. It is also the final appellate court for a number of matters. In practice, most appeals are resolved at this intermediate appellate level, rather than in the Supreme Court. The Court of Appeal has existed as a separate court since 1862 but, until 1957, it was composed of judges of the High Court sitting periodically in panels. In 1957 the Court of Appeal was reconstituted as a permanent court separate from the High Court. It is located in Wellington."},{"page_url":"https://eo.wikipedia.org/wiki/Ne%C4%9Dopaseroj","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Emeropterix.jpg","page_title":"Neĝopaseroj","context_page_description":"Montofringoj aŭ Neĝopaseroj estas palearktisa genro de birdoj de la familio de paseroformaj. Anoj el la genro ne estas grandaj birdoj.\\nLa genro Montifringilla spite ties scienca nomo kaj komuna nomo, estas paseroj de la familio de Paseredoj, kaj ne veraj fringoj de la familio de Fringedoj. La genro estas foje disigita en tri. Tamen kiel ambaŭ nomoj sugestas, ties troviĝo estas en montaroj de suda Eŭrazio super alteco 1.800 m.s.m. kaj iras de Pireneoj tra Alpoj orienten tra Himalajo, Tibeto ĝis okcidenta Ĉinio."},{"page_url":"https://de.wikipedia.org/wiki/Eschweiler_(Wiltz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Coat_of_arms_eschweiler_luxbrg.png","page_title":"Eschweiler (Wiltz)","context_page_description":"Eschweiler ist eine Ortschaft der luxemburgischen Gemeinde Wiltz. Bis Ende 2014 war Eschweiler der Hauptort der gleichnamigen Gemeinde, die zum Kanton Wiltz gehörte."},{"page_url":"https://de.wikipedia.org/wiki/Wei%C3%9Fstreifen-Aalgrundel","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Pholidichthys_leucotaenia_2.jpg","page_title":"Weißstreifen-Aalgrundel","context_page_description":"Die Weißstreifen-Aalgrundel ist ein Meeresfisch der im westlichen Pazifik im Bereich der südwestlichsten Inseln der Philippinen, Sulawesis bis zu den Salomon-Inseln, sehr versteckt in Korallenriffen bis in 20 Meter Tiefe vorkommt. Der wissenschaftliche Name weist auf Ähnlichkeit mit Pholis aus der Familie der Butterfische hin; leucotaenia bedeutet \\"weißer Streifen\\" und weist auf die Färbung der Jungfische hin."},{"page_url":"https://tr.wikipedia.org/wiki/Maguindanao","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Ph_seal_maguindanao.png","page_title":"Maguindanao","context_page_description":"Maguindanao, Filipinler'de, Mindanao Adasındaki Bangsamoro Özerk Bölgesi'nde bulunan bir il."},{"page_url":"https://pl.wikipedia.org/wiki/Posta%C4%87_literacka","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Robinson_crusoe_rescues_friday-1868.jpg","page_title":"Postać literacka","context_page_description":"Postać literacka – fikcyjna osoba ukazana w świecie przedstawionym dzieła literackiego. Może być tożsama z podmiotem mówiącym dzieła, ale najczęściej jest od niego różna. Jest uwidoczniana w tekście przez opis – cech wyglądu i charakteru oraz działań, a także może wyrażać w tekście swoje myśli i odczucia. Natomiast jej sposób zaistnienia w świecie przedstawionym jest uzależniony od motywacji i charakterystyki.\\nJest określonym układem motywów uzależnionych od konkretnych zasad scalających, np.:\\nstereotypu utrwalonego w danym gatunku literackim,\\nwzorca osobowego dostępnego obserwacji w świecie rzeczywistym, którego jest w założeniu literacką emanacją,\\nideału, będącego wzorcem wychowawczym godnym rozpowszechniania.\\nW utworach opartych na fabule można dostrzec zazwyczaj hierarchię ważności występujących osób. Można wyróżnić postaci pierwszo-, drugo- i trzecioplanowe, a spośród pierwszoplanowych – główną postać, której losy tworzą główny wątek fabuły. Postacie drugoplanowe, nazywane niekiedy pobocznymi, uczestniczą w niektórych wydarzeniach, zaś trzecioplanowe, zwane epizodycznymi, w pojedynczych sytuacjach, zaistniałych na marginesie głównego nurtu wydarzeń w utworze literackim."},{"page_url":"https://pt.wikipedia.org/wiki/Patellogastropoda","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Common_limpets2.jpg","page_title":"Patellogastropoda","context_page_description":"Patellogastropoda, historicamente denominada de Docoglossa, é uma subclasse da classe Gastropoda. Também são conhecidos pelo termo lapa, embora esse termo também se aplique a moluscos de outros clados."},{"page_url":"https://sv.wikipedia.org/wiki/V%C3%A4nsterforward_(ishockey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Ovechkin.jpg","page_title":"Vänsterforward (ishockey)","context_page_description":"Vänsterforward är en spelarposition inom ishockeyn. Vänsterforwarden är en anfallsspelare med utgångspunkt till vänster om centerforwarden i anfallsriktningen. På motsatt sida om centerforwarden håller högerforwarden till."},{"page_url":"https://en.wikipedia.org/wiki/Hakea_commutata","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Hakea_commutataDistMap25.png","page_title":"Hakea commutata","context_page_description":"Hakea commutata is a shrub in the family Proteaceae native to Western Australia. A variable species in shape and growing requirements, including mallee heath, sand and along creek lines."},{"page_url":"https://en.wikipedia.org/wiki/1954","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/David_Lee_Roth_Smashbox_2008.jpg","page_title":"1954","context_page_description":"1954 was a common year starting on Friday of the Gregorian calendar, the 1954th year of the Common Era and Anno Domini designations, the 954th year of the 2nd millennium, the 54th year of the 20th century, and the 5th year of the 1950s decade."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B5%D0%BC%D0%B8%D1%8F_%D0%93%D0%B8%D0%BB%D1%8C%D0%B4%D0%B8%D0%B8_%D0%BA%D0%B8%D0%BD%D0%BE%D0%B0%D0%BA%D1%82%D1%91%D1%80%D0%BE%D0%B2_%D0%A1%D0%A8%D0%90_(2018)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/James_Franco_%28Cropped%29.jpg","page_title":"Премия Гильдии киноактёров США (2018)","context_page_description":"24-я церемония вручения премии Гильдии киноактёров США за заслуги в области кинематографа и телевидения за 2017 год состоялась 21 января 2018 года в Лос-Анджелесе, штат Калифорния. Номинанты были объявлены 13 декабря 2017 года. 4 декабря 2017 года было объявлено, что у церемонии появится свой ведущий — первый за всю 24-летнюю историю премии, им стала актриса Кристен Белл.\\nПочётный приз за жизненные достижения был вручён актёру Моргану Фримену."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%95%D7%96%D7%99%D7%90%D7%95%D7%A0%D7%99_%D7%93%D7%99%D7%98%D7%A1%D7%95%D7%A0%D7%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/National_Cultural_History_Museum-166.jpg","page_title":"מוזיאוני דיטסונג","context_page_description":"מוזיאוני דיטסונג של דרום אפריקה הוא ארגון של ממשלת דרום אפריקה המאגד שמונה מוזיאונים לאומיים בפרובינציית חאוטנג, רובם בפרטוריה או בסמוך אליה ומיעוטם ביוהנסבורג.\\nמוזיאוני דיטסונג מציגים מגוון עשיר של אוספים, פריטים ותצוגות אודות בוטניקה, זואולוגיה, פלאונטולוגיה, היסטוריה בכלל והיסטוריה צבאית בפרט, תרבות, גאולוגיה, אנתרופולוגיה וארכאולוגיה. המוזיאונים נועדו להציג לציבור הרחב את המורשת והעולם המדעי והתרבותי של דרום אפריקה בכלל ושל העולם הפרט. בנוסף לכך המוזיאונים עוסקים גם במחקר ובחינוך וחלקם מהווים אתרי תיירות בולטים."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%B1%D8%A7%D9%8A%D8%AA%D9%88%D8%A7%D8%AA%D8%B1%D8%B2_(%D9%86%D9%8A%D9%88%D9%8A%D9%88%D8%B1%D9%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Brightwaters-ny-map.png","page_title":"برايتواترز (نيويورك)","context_page_description":"برايتواترز هي منطقة سكنية تقع في الولايات المتحدة في مقاطعة سوفولك، نيويورك. يقدر عدد سكانها بـ 3,103 نسمة ومساحتها 2.6 كم² وترتفع عن سطح البحر 7 متر."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_im_Landkreis_Rottal-Inn","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Wappen_von_Egglham.png","page_title":"Liste der Wappen im Landkreis Rottal-Inn","context_page_description":"Die Liste der Wappen im Landkreis Rottal-Inn zeigt die Wappen der Gemeinden im bayerischen Landkreis Rottal-Inn."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B5%D0%BA%D1%81%D0%BF%D0%B8%D1%80,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Gilbert_WShakespeares_Plays.jpg","page_title":"Шекспир, Уильям","context_page_description":"Уи́льям Шекспи́р — английский поэт и драматург, зачастую считается величайшим англоязычным писателем и одним из лучших драматургов мира. Часто именуется национальным поэтом Англии. Дошедшие до нас работы, включая некоторые, написанные совместно с другими авторами, состоят из 38 пьес, 154 сонетов, 4 поэм и 3 эпитафий. Пьесы Шекспира переведены на все основные языки и ставятся чаще, чем произведения других драматургов.\\nШекспир родился и вырос в городе Стратфорд-апон-Эйвоне. В 18 он женился на Энн Хатауэй, в браке с которой имел трёх детей: дочь Сюзанну и двойняшек Хемнета и Джудит. Карьера Шекспира началась между 1585 и 1592 годами, когда он переехал в Лондон. Вскоре он стал успешным актёром, драматургом, а также совладельцем театральной компании под названием «Слуги лорда-камергера», позже известной как «Слуги короля». Около 1613 года, в возрасте 48 лет он вернулся в Стратфорд, где умер тремя годами позже."},{"page_url":"https://en.wikipedia.org/wiki/Jaffna_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Jaffna_Station_2.jpg","page_title":"Jaffna railway station","context_page_description":"Jaffna railway station is a railway station in the city of Jaffna in northern Sri Lanka. Owned by Sri Lanka Railways, the state-owned railway operator, the station is one of the busiest in the country, linking the north with the capital Colombo.\\nThe popular Yarl Devi service, which operates on the Northern Line, calls at this station. In the late 1980s the station suffered heavy damage due to the civil war. All railway services on the Northern Line north of Vavuniya had stopped by 1990. The station was abandoned, suffering further damage in the following years. The civil war ended in 2009 and the government started various projects to rebuild the line and stations. The Northern Line between Pallai and Jaffna was re-opened on 13 October 2014."},{"page_url":"https://hu.wikipedia.org/wiki/S%C3%A1rgahas%C3%BA_lugas%C3%A9p%C3%ADt%C5%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Yellow-breasted_Bowerbird.jpg","page_title":"Sárgahasú lugasépítő","context_page_description":"A sárgahasú lugasépítő a madarak osztályának verébalakúak rendjébe és a lugasépítő-félék családjába tartozó faj.\\nTudományos nevét Carl Lauterbach német botanikusról kapta."},{"page_url":"https://en.wikipedia.org/wiki/Sweetbitter","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Union-square-cafe1.jpg","page_title":"Sweetbitter","context_page_description":"Sweetbitter is a 2016 novel by American author Stephanie Danler, published by Alfred A. Knopf. It is Danler's first published book. It was written by the author over a seven-year period, and, despite receiving glowing press before its release, received mixed reviews.\\nThe book is based in part on Danler's experience as a waitress in New York City."},{"page_url":"https://pt.wikipedia.org/wiki/Carlos,_3.%C2%B0_Pr%C3%ADncipe_de_Leiningen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Johann_Daniel_Mottet_-_Carl_Emich%2C_Prince_of_Leiningen_%281804-1856%29.jpg","page_title":"Carlos, 3.° Príncipe de Leiningen","context_page_description":"Carlos Frederico Guilherme Emico, Príncipe de Leiningen KG foi um nobre alemão e meio-irmão mais velho da rainha Vitória do Reino Unido."},{"page_url":"https://nl.wikipedia.org/wiki/Boeing","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Air_France_Boeing_777-300ER_F-GSQD_take_off_Charles_de_Gaulle_23_Jan_2005.jpg","page_title":"Boeing","context_page_description":"The Boeing Company, veelal afgekort tot Boeing, is een Amerikaans lucht- en ruimtevaartbedrijf, opgericht door William Edward Boeing. Het hoofdkantoor is gevestigd in Chicago in de Boeing International Headquarters. Boeing is wereldwijd de grootste producent van vliegtuigen naar omzet en de tweede als het gaat om het aantal afgeleverde toestellen. Boeing is ook de grootste producent van militaire producten. Het bedrijf is opgenomen in de Dow Jones Industrial Average."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1950","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Sonia_Bragga.jpg","page_title":"Lijst van personen geboren in 1950","context_page_description":"Dit is een lijst van personen die geboren zijn in 1950.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://vi.wikipedia.org/wiki/Norfolk,_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/MontageNorfolkVAUSA.jpg","page_title":"Norfolk, Virginia","context_page_description":"Norfolk là một thành phố ở tiểu bang Virginia, Hoa Kỳ. Với dân số khoảng 237.764 năm 2002, đây là thành phố lớn thứ hai ở bang Virginia sau Virginia Beach."},{"page_url":"https://nl.wikipedia.org/wiki/Vondelpark","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Paviljoen_Vondelspark.jpg","page_title":"Vondelpark","context_page_description":"Het Vondelpark is een langgerekt stadspark in Amsterdam, daterend uit 1865. Het park ligt in het stadsdeel Amsterdam-Zuid, op de grens met het stadsdeel Amsterdam-West. Het strekt zich uit van de Stadhouderskade tot aan de Amstelveenseweg. Bij de opening in 1865 heette het park het Nieuwe Park, in de volksmond Wandelpark. Na de onthulling in oktober 1867 van het Vondelmonument, een standbeeld ter ere van de dichter en toneelschrijver Joost van den Vondel, werd de naam gewijzigd in Vondelpark. Sinds 1996 is het park een rijksmonument."},{"page_url":"https://it.wikipedia.org/wiki/Ascanio_della_Corgna","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Ascanio_della_Corgna_condottiero_italiano.png","page_title":"Ascanio della Corgna","context_page_description":"Ascanio della Corgna è stato un condottiero italiano.\\nFu il primo marchese sovrano di Castiglione del Lago, dal 1563, per otto anni."},{"page_url":"https://br.wikipedia.org/wiki/Fontaine-Notre-Dame_(Norzh)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Bundesarchiv_Bild_146-1982-031-31A%2C_Frankreich%2C_britischer_Beutepanzer.jpg","page_title":"Fontaine-Notre-Dame (Norzh)","context_page_description":"Fontaine-Notre-Dame a zo ur gumun eus departamant Norzh e Bro-C'hall."},{"page_url":"https://es.wikipedia.org/wiki/Pep_Guardiola","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Guardiola_training_cropped.jpg","page_title":"Pep Guardiola","context_page_description":"Josep Guardiola i Sala, conocido como Pep Guardiola, ​ es un exfutbolista y actual entrenador español. Actualmente dirige al Manchester City de la Premier League de Inglaterra.​\\nComo jugador, ocupaba la posición de centrocampista y desarrolló la mayor parte de su carrera profesional en el Fútbol Club Barcelona durante los años 1990, con el que ganó seis Ligas, dos Copas del Rey, cuatro Supercopas de España, una UEFA Champions League, una Recopa de Europa y dos Supercopas de la UEFA. Con la selección de fútbol de España ganó la medalla de oro en los Juegos Olímpicos de 1992 y participó también en el Mundial de 1994 y la Eurocopa 2000.\\nGuardiola fue el entrenador del equipo azulgrana desde julio de 2008 hasta junio de 2012, periodo en el que ganó 14 títulos. Con el equipo azulgrana ganó, de manera consecutiva, los seis títulos a los que aspiraba el equipo en el 2009. De este modo Guardiola se convirtió en el primer entrenador de fútbol en el mundo en conseguir seis títulos oficiales en un mismo año. Solo otros seis equipos europeos han logrado el denominado triplete, pero ninguno ha conseguido seis trofeos en un mismo año natural.​​"},{"page_url":"https://pl.wikipedia.org/wiki/Amphicar","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Amphicar-main-ffm001.jpg","page_title":"Amphicar","context_page_description":"Amphicar – jedna z pierwszych masowo produkowanych amfibii."},{"page_url":"https://da.wikipedia.org/wiki/BBC_HD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/BBC_Logo_-_2.jpg","page_title":"BBC HD","context_page_description":"BBC HD er en High Definition TV-kanal fra BBC som startet sine sendinger 1. december 2007. Kanalen sender kun programmer i High Definition. Blandt programmene findes en del af det samme som bliver vist på for eksempel BBC One. Forskellen er at disse programmer sendes i HD på BBC HD. Kanalen viser også en række sportsudsendelser i HD, blandt andet Fodbold-EM 2008 og OL i Beijing. For at kunne tage kanalen må man have en forbindelse til kabel- eller satellit-tv."},{"page_url":"https://pt.wikipedia.org/wiki/Lo_Scopone_scientifico","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Lo_scopone_scientifico_%28tavolo_da_gioco%29.png","page_title":"Lo Scopone scientifico","context_page_description":"Lo scopone scientifico é um filme italiano de 1972, dos gêneros comédia e drama, dirigido por Luigi Comencini e roteirizado por Rodolfo Sonego."},{"page_url":"https://fi.wikipedia.org/wiki/Chappaquiddickin_sillan_onnettomuus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Edgartown_ma_highlight.png","page_title":"Chappaquiddickin sillan onnettomuus","context_page_description":"Chappaquiddickin sillan onnettomuus oli vuonna 1969 Yhdysvaltain Massachusettsissa tapahtunut onnettomuus, jossa demokraattisen puolueen senaattori Edward Kennedyn auto suistui veteen ja kyydissä ollut nainen sai surmansa. Tapaus vahingoitti Kennedyn julkista kuvaa."},{"page_url":"https://nl.wikipedia.org/wiki/Johnstones_lori","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Mindanao_Lorikeet_%28Trichoglossus_johnstoniae%29.jpg","page_title":"Johnstones lori","context_page_description":"Johnstones lori is een papegaaiachtige die alleen voorkomt in de Filipijnen."},{"page_url":"https://fr.wikipedia.org/wiki/Knivskjellodden","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Nortdkapp%26Knivskjellodden.JPG","page_title":"Knivskjellodden","context_page_description":"Knivskjellodden est le point le plus au nord de la Norvège et de l'Europe situé sur l'île de Magerøya.\\nBien que le Cap Nord soit généralement considéré comme étant le point le plus au nord de l'Europe, ce dernier se situe 1 611 m plus au sud que Knivskjellodden. Ce « statut » du cap Nord est dû à son caractère plus majestueux avec ses hautes falaises dominant l'océan et son accès plus facile par le plateau. Les deux sites se trouvent sur Magerøya et sont distants de 4 km environ à vol d'oiseau.\\nOn peut accéder à Knivskjellodden à pied par un chemin non-balisé de 9 km de long depuis un parking situé quelques kilomètres au sud du cap Nord."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Chemnitz-Sonnenberg,_A%E2%80%93H","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Dresdner_Stra%C3%9Fe_80.JPG","page_title":"Liste der Kulturdenkmale in Chemnitz-Sonnenberg, A–H","context_page_description":"Die Liste der Kulturdenkmale in Chemnitz-Sonnenberg, A–H enthält die Kulturdenkmale des Chemnitzer Stadtteils Sonnenberg, die in der Denkmalliste vom Landesamt für Denkmalpflege Sachsen mit Stand vom 20. Juni 2013 erfasst wurden und deren Straßenname mit A–H beginnt. Zusätzlich sind die aus der Denkmalliste gestrichenen Kulturdenkmale aufgeführt.\\nDie Liste ist nach den Anfangsbuchstaben der Adresse aufgeteilt."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%A9%E1%83%94%E1%83%A0%E1%83%9C%E1%83%98%E1%83%92%E1%83%9D%E1%83%95%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/BudArhiepiskop.JPG","page_title":"ჩერნიგოვი","context_page_description":"ჩერნიგოვი — ისტორიული ნოღა ოორუე უკრაინას. ჩერნიგოვი რე ჩერნიგოვიშ ოლქიშ ნანანოღა. ნოღას რე თეატრეფი, კლუბეფი, ინსტიტუტეფი, სკოლეფი, კინოეფი დო შხვა ოგურაფე-ბორჯიშოღალი დჷნაწესებუეფი."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1922","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Richard_Achilles_Ballinger.png","page_title":"Lijst van personen overleden in 1922","context_page_description":"Dit is een lijst van personen die overleden zijn in 1922.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://eu.wikipedia.org/wiki/Euskal_Herriko_musika_garaikidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Xabi_Solano.jpg","page_title":"Euskal Herriko musika garaikidea","context_page_description":"Euskal Herriko musika garaikidea XIX. mende erdialdetik aurrera Euskal Herrian egindako euskarazko nahiz erdarazko musika da. Askotariko estiloek bilakaera desberdinak izan dituzte, baina guztiek ere lotura dute garai horretatik aurrera izandako industrializazio eta aldaketa demografikoekin. XX. mende bukaerako eta XXI. mendeko gizarte mediatikoak sofistikazio handia eta elkarreragin bereziak sortu ditu jatorrizko euskal musika, musika jaso klasikoen eta nazioarteko pop musika berrien artean. Euskal Herriko musika sorkuntza eta emanaldiak norbanakoen eta gizataldeen identitaterako ezin besteko elementu bilakatu dira.\\nXIX. mendean, euskal foruen galera eta identitatearen krisia gertatzearekin batera, euskal kulturaren berpizkunde bat izan zen, eta hainbat abesbatza talde sortu. Burdinbidearen Euskal Herriko etorrerak eskusoinu txikia ekarri zuen, harrezkero herri musikan sendo errotua, ordu arteko txistu eta txirulaz gain. Herri ohitura eta musikari buruzko interes etnografikoa ere agertu zen, ikertzaile dirudunek eta erlijio gizonek bultzatuta."},{"page_url":"https://uk.wikipedia.org/wiki/Tachikawa_Ki-77","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Japanese_airplane_Ki-77%28A-26%29_cariied_on_USS_Bogue.jpg","page_title":"Tachikawa Ki-77","context_page_description":"Tachikawa Ki-77 — експериментальний літак дальнього радіуса дії Імперської армії Японії періоду Другої світової війни."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%BD%D1%8F_%D0%91%D1%96%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/RussianAsHomeLanguage2009rural.PNG","page_title":"Населення Білорусі","context_page_description":"Населення Білорусі. Чисельність населення країни на липень 2020 року становила 9,477 млн осіб. Чисельність білорусів стабілізувалась і незначно зменшується, народжуваність 2015 року становила 10,7 ‰, смертність — 13,36 ‰, природний приріст — -0,2 %."},{"page_url":"https://en.wikipedia.org/wiki/IBM_BladeCenter","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/IBM_HS20_blade_server.jpg","page_title":"IBM BladeCenter","context_page_description":"The IBM BladeCenter was IBM's blade server architecture, until it was replaced by Flex System. The x86 division was later sold to Lenovo in 2014."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B1%E3%83%B3%E3%83%BB%E3%83%86%E3%82%A3%E3%83%AC%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Tyrrell_with_P34.jpg","page_title":"ケン・ティレル","context_page_description":"ケン・ティレルは、イングランド出身の元レーシングドライバーで、F1コンストラクター「ティレル・レーシング」のオーナー。\\n野心的な技術を積極的に取り入れながらチームを名門に育て上げ、1998年に引退するまでF1に情熱を注ぎ続けた。ニックネームは「アンクル・ケン」。"},{"page_url":"https://en.wikipedia.org/wiki/%C3%85boulevarden","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/M%C3%B8lleparken_%28%C3%A5en%29.jpg","page_title":"Åboulevarden","context_page_description":"Åboulevarden is a street and promenade in Aarhus, Denmark. It is 975 meters long and runs west to east from Vester Allé to Europaplads at Dokk1. The street is situated in the Indre by neighborhood where it is a popular thoroughfare for pedestrians. The center contains Aarhus river which splits the street in a north and south side. The north side is pedestrianized in its entire length and contains the park Mølleparken and the recreational space Vadestedet. The south side has a road on the western third, providing access to Emil Vetts Passage, Busgaden and the parking complex for Magasin du Nord. The east section is one of the most popular areas in the city for outdoor congregation, packed with bars and cafés."},{"page_url":"https://de.wikipedia.org/wiki/Mexikanische_Chia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Salvia_hispanica_%2810461546364%29.jpg","page_title":"Mexikanische Chia","context_page_description":"Die Mexikanische Chia ist eine ursprünglich fast nur in Mexiko und Zentralamerika vorkommende Pflanzenart der Gattung des Salbei innerhalb der Familie der Lippenblütler."},{"page_url":"https://cs.wikipedia.org/wiki/Vojensk%C3%BD_pozorovatel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/MONUCcz.jpg","page_title":"Vojenský pozorovatel","context_page_description":"Vojenský pozorovatel je příslušník mírové mise mezinárodní vládní organizace, jehož charakteristika a hlavní úkoly závisí na mandátu a charakteru konkrétní operace.\\nZpravidla jde o člena mnohonárodní jednotky působící v rámci vojenské části mírové mise.\\nNejčastějším úkolem vojenského pozorovatele je monitorování politické, vojenské a bezpečnostní situace v oblasti ozbrojeného konfliktu. K dalším povinnostem obvykle patří pravidelné patrolování, získávání informací nejrůznějšího charakteru, a jejich předávání formou pravidelných hlášení. Základní zásadou práce vojenského pozorovatele je jeho absolutní nestrannost a aktivní přístup při zprostředkování řešení sporů mírovou cestou, přičemž je nutná aktivní spolupráce s vládními i nevládními humanitárními organizacemi působícími v místě působení. Na rozdíl od příslušníků ozbrojených složek mírových misí ale pozorovatel většinou nemá pravomoc přímo do konfliktu zasahovat. Pro zachování míru v krizové oblasti má velký význam i prostá přítomnost „vozidla s modrým praporem“, kterou místní obyvatelstvo často chápe jako konkrétní doklad mezinárodního zájmu o další mírový vývoj a určitou záruku bezpečnosti."},{"page_url":"https://it.wikipedia.org/wiki/Adrian_Peterson_(giocatore_di_football_americano_1985)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Adrian_Peterson_2013_Pro_Bowl.JPG","page_title":"Adrian Peterson (giocatore di football americano 1985)","context_page_description":"Adrian Lewis Peterson è un giocatore di football americano statunitense, soprannominato A.D. e Purple Jesus, che gioca nel ruolo di running back per il Washington Football Team della National Football League.\\nPeterson fu scelto dai Minnesota Vikings come settimo assoluto nel Draft NFL 2007, giocandovi per dieci stagioni fino al 2016.\\nPeterson al college giocò a football all'Università dell'Oklahoma dove stabilì il record NCAA per un freshman correndo 1.925 yard nella stagione 2004. Nominato unanimemente All-American, fu il primo freshman ad arrivare in finale nelle votazioni dell'Heisman Trophy, giungendo secondo dietro il quarterback di USC Matt Leinart. Peterson terminò la sua carriera universitaria al terzo nella classifica di tutti i tempi dei Sooners per yard corse.\\nDopo la prima stagione in cui stabilì il record NFL per il maggior numero di yard corse in una partita, Peterson fu nominato miglior rookie offensivo dell'anno. Fu anche premiato come miglior giocatore del Pro Bowl, diventando il quinto giocatore della storia a correre oltre 3.000 yard nelle sue prime due stagioni."},{"page_url":"https://es.wikipedia.org/wiki/Copa_Mundial_de_Rugby_de_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/City_of_Manchester_Stadium_East_Stand.jpg","page_title":"Copa Mundial de Rugby de 2015","context_page_description":"La Copa Mundial de Rugby de 2015 fue la VIII edición de la Copa del Mundo de Rugby de la World Rugby. El campeonato tuvo lugar entre el 18 de septiembre y el 31 de octubre de 2015. En la reunión extraordinaria de la World Rugby que tuvo lugar el 28 de julio de 2009 en Dublín se anunció que esta edición tendría lugar en Inglaterra, aunque también se disputaron partidos en el Millennium Stadium de Cardiff, capital de Gales.​\\nSe esperaba que el evento generase un impacto económico de 2000 millones de libras esterlinas y unos rendimientos de explotación audiovisual y patrocinadores cifrados de en 200 millones de libras.​"},{"page_url":"https://de.wikipedia.org/wiki/Pi%C3%A9gut-Pluviers","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Piegut-voie-romaine_04.jpg","page_title":"Piégut-Pluviers","context_page_description":"Piégut-Pluviers, okzitanisch Puei 'gut e Pluviers, ist eine französische Gemeinde mit 1166 Einwohnern im Département Dordogne in der Region Nouvelle-Aquitaine. Sie gehört zum Arrondissement Nontron und zum Kanton Périgord Vert Nontronnais. Zuständiger Gemeindeverband ist die Communauté de communes du Périgord Nontronnais. Die Einwohner werden Piégutains bzw. Piégutaines genannt."},{"page_url":"https://pt.wikipedia.org/wiki/Amoral","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Amoral_at_Tuska_Open_Air_2012.jpg","page_title":"Amoral","context_page_description":"Amoral foi uma banda de power metal de Helsinque, Finlândia. Esses músicos combinam elementos do heavy metal, death metal melódico, e metal progressivo. Amoral já lançou cinco álbuns, fizeram vários shows em bares, clubes, festivais e outros eventos na Finlândia, Europa, e Japão."},{"page_url":"https://sv.wikipedia.org/wiki/Drosera_whittakeri","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Drosera_whittakeri_tuber_2_Darwiniana.jpg","page_title":"Drosera whittakeri","context_page_description":"Drosera whittakeri är en sileshårsväxtart som beskrevs av Jules Émile Planchon. Drosera whittakeri ingår i släktet sileshår, och familjen sileshårsväxter.\\nArtens utbredningsområde är:\\nNew South Wales.\\nVictoria.\\nInga underarter finns listade i Catalogue of Life."},{"page_url":"https://gl.wikipedia.org/wiki/Moreira_negra","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Morus_nigra_B.jpg","page_title":"Moreira negra","context_page_description":"A moreira negra é unha especie de árbore froiteira orixinaria de Asia occidental; e naturalizada en América do Norte, en Europa e na China, que pertence á familia das moráceas. Foi introducida coma cultivo en toda a conca mediterránea dende a antigüidade polos seus froitos, as amoras, hoxe pouco apreciados. En Galiza non é tradicional o cultivo, atopándose coma ornamental nalgúns xardíns urbanos."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%B9%CE%B3%CF%85%CF%80%CF%84%CE%B9%CE%B1%CE%BA%CE%AD%CF%82_%CF%80%CF%85%CF%81%CE%B1%CE%BC%CE%AF%CE%B4%CE%B5%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Al-Kurru%2Cmain_pyramid.jpg","page_title":"Αιγυπτιακές πυραμίδες","context_page_description":"Οι αιγυπτιακές πυραμίδες είναι αρχαίες κατασκευές σε σχήμα πυραμίδας που βρίσκονται στην Αίγυπτο.\\nΜέχρι το Νοέμβριο του 2008 οι πηγές αναφέρουν είτε 118 είτε 138 ως τον αριθμό των επιβεβαιωμένων αιγυπτιακών πυραμίδων. Οι περισσότερες χτίστηκαν ως τάφοι για τους φαραώ και τις συζύγους τους κατά τη διάρκεια του Παλαιού και Μέσου Βασιλείου.\\nΟι πιο παλιές γνωστές αιγυπτιακές πυραμίδες έχουν βρεθεί στη Σακάρα, βορειοδυτικά της Μέμφιδος. Η παλιότερη μεταξύ αυτών είναι η Πυραμίδα του Ζοζέρ που κατασκευάστηκε κατά τη διάρκεια της Τρίτης Δυναστείας. Η πυραμίδα και το περιβάλλον συγκρότημα σχεδιάστηκε από τον αρχιτέκτονα Ιμχοτέπ, και γενικά θεωρείται το παλιότερο μνημείο του κόσμου που κατασκευάστηκε εξωτερικά με χτίσιμο από πέτρα.\\nΟι πιο γνωστές αιγυπτιακές πυραμίδες είναι αυτές της Γκίζα, στα προάστια του Καΐρου. Κάποιες από τις Πυραμίδες της Γκίζας είναι ανάμεσα στις μεγαλύτερες κατασκευές που έχουν χτιστεί ποτέ. Η Πυραμίδα του Χέοπα είναι η μεγαλύτερη από τις αιγυπτιακές πυραμίδες. Είναι το μόνο από Επτά θαύματα του αρχαίου κόσμου που υπάρχει ακόμα μέχρι σήμερα."},{"page_url":"https://fr.wikipedia.org/wiki/Essai_de_choc_automobile","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Vehicle_crash_test_at_the_General_Motors_Vehicle_Safety_and_crash_Worthiness_Laboratory.jpg","page_title":"Essai de choc automobile","context_page_description":"Un essai de choc est une opération réalisée en laboratoire consistant à tester le comportement des véhicules en cas de choc ou de collision. Le véhicule testé est soit projeté à une vitesse donnée sur un obstacle massif, soit immobilisé et soumis à un choc d'un mobile de masse déterminée de façon à reconstituer les conditions d'un choc et de mesurer les déformations de sa structure et les dommages résultants pour les passagers. Ceux-ci sont souvent représentés par des mannequins spécialement étudiés : les dispositifs anthropomorphes d'essai. Ces essais, destructeurs par définition, sont relativement coûteux et doivent être soumis à un protocole rigoureux pour en tirer le maximum d'enseignements."},{"page_url":"https://pl.wikipedia.org/wiki/Miasta_Ugandy","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Mbarara_at_Sundown.jpg","page_title":"Miasta Ugandy","context_page_description":"Według danych oficjalnych pochodzących z 2011 roku Uganda posiadała ponad 90 miast o ludności przekraczającej 10 tys. mieszkańców. Stolica kraju Kampala jako jedyne miasto liczyło ponad milion mieszkańców; 3 miasta z ludnością 100÷500 tys.; 14 miast z ludnością 50÷100 tys.; 23 miasta z ludnością 25÷50 tys. oraz reszta miast poniżej 25 tys. mieszkańców."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%81%D0%BF%D0%B5%D0%BA%D1%82_%D0%90%D0%B7%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/%D0%90%D0%B7%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%28%D0%9B%D0%B5%D0%BD%D1%96%D0%BD%D0%B0%29_%D0%BF%D1%80%D0%BE%D1%81%D0%BF%D0%B5%D0%BA%D1%82%2C_%D0%91%D0%B5%D1%80%D0%B4%D1%8F%D0%BD%D1%81%D1%8C%D0%BA%2C_%D0%BF%D1%80%D0%BE%D1%81%D0%BF._%D0%90%D0%B7%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%28%D0%9B%D0%B5%D0%BD%D1%96%D0%BD%D0%B0%29%2C_%D0%97%D0%B0%D0%BF%D0%BE%D1%80%D1%96%D0%B7%D1%8C%D0%BA%D0%B0_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C.jpg","page_title":"Проспект Азовський","context_page_description":"Проспект Азовський — головна магістраль міста Бердянськ, основний адміністративний, торговий і культурний центр міста. Одна з найдовших вулиць міста. Починається з Мелітопольського шосе і закінчується Приморською площею. На перетині з Італійською вулицею починається пішохідна зона. До проспекту прилучаються: вулиця Шевченка, вулиця Грецька. Перетинають проспект Азовський: вулиця Консульська, вулиця Свободи, вулиця Італійська, проспект Перемоги, вулиця Земська, вулиця Лютеранська. Протяжність — 1,3 км."},{"page_url":"https://gl.wikipedia.org/wiki/Pazo_de_Vilane","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Pazo_de_Vilane.jpg","page_title":"Pazo de Vilane","context_page_description":"O Pazo de Vilane é un pazo situado no lugar de Vilane, na parroquia de San Xoán de Antas de Ulla, no concello lugués de Antas de Ulla. Hoxe é sede dunha granxa sostíbel que produce ovos campeiros e marmeladas de froitos do bosque entre outros produtos."},{"page_url":"https://en.wikipedia.org/wiki/Mandolin-banjo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Mandolinbanjos.jpg","page_title":"Mandolin-banjo","context_page_description":"The mandolin-banjo is a hybrid instrument, combining a banjo body with the neck and tuning of a mandolin or violin. It is a soprano banjo. It has been independently invented in more than one country, being called banjolin and banjourine in English-speaking countries, banjoline and bandoline in France, and the Cümbüş in Turkey.\\nThe instrument has the same scale length as a mandolin; with 4 courses of strings tuned identically to the violin and mandolin. The movable bridge stands on a resonant banjo-like head typically 10 inches in diameter and currently usually made of plastic. Originally heads were made of skin and varied in diameter to as small as five inches. Larger heads were favored, however, as they were louder, and thus more audible in band settings."},{"page_url":"https://de.wikipedia.org/wiki/Liste_schw%C3%A4bischer_Adelsgeschlechter/R","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Reischach.jpg","page_title":"Liste schwäbischer Adelsgeschlechter/R","context_page_description":null},{"page_url":"https://pl.wikipedia.org/wiki/Silzen","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Silzen_in_IZ.png","page_title":"Silzen","context_page_description":"Silzen – miejscowość i gmina w Niemczech, w kraju związkowym Szlezwik-Holsztyn, w powiecie Steinburg, wchodzi w skład urzędu Itzehoe-Land."},{"page_url":"https://en.wikipedia.org/wiki/Diesel_locomotive","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/DieselMechanicalLocomotiveSchematic.svg","page_title":"Diesel locomotive","context_page_description":"A diesel locomotive is a type of railway locomotive in which the prime mover is a diesel engine. Several types of diesel locomotives have been developed, differing mainly in the means by which mechanical power is conveyed to the driving wheels.\\nEarly internal combustion locomotives and railcars used kerosene and gasoline as their fuel. Rudolf Diesel patented his first compression-ignition engine in 1898, and steady improvements to the design of diesel engines reduced their physical size and improved their power-to-weight ratios to a point where one could be mounted in a locomotive. Internal combustion engines only operate efficiently within a limited torque range, and while low power gasoline engines could be coupled to mechanical transmissions, the more powerful diesel engines required the development of new forms of transmission. This is because clutches would need to be very large at these power levels and would not fit in a standard 2.5 m-wide locomotive frame, or wear too quickly to be useful.\\nThe first successful diesel engines used diesel–electric transmissions, and by 1925 a small number of diesel locomotives of 600 hp were in service in the United States."},{"page_url":"https://eo.wikipedia.org/wiki/Krumv%C3%AD%C5%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Krumv%C3%AD%C5%99%2C_main_street.jpg","page_title":"Krumvíř","context_page_description":"Krumvíř estas municipo kun 1 173 loĝantoj, situanta en suda Moravio."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%BA%D0%B8_%D1%81_%D0%B2%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Pictures_at_the_Exhibition_1st_edition.jpg","page_title":"Картинки с выставки","context_page_description":"«Картинки с выставки» — цикл фортепианных пьес русского композитора Модеста Петровича Мусоргского. Написан в 1874 году в память о друге Мусоргского, художнике и архитекторе Викторе Гартмане."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%89%E3%83%9F%E3%83%88%E3%83%AA%E3%83%BC%E3%83%BB%E3%82%A4%E3%83%AF%E3%83%8E%E3%83%95%E3%82%B9%E3%82%AD%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/USSR_stamp_D.Ivanovsky_1964_4k.jpg","page_title":"ドミトリー・イワノフスキー","context_page_description":"ドミトリー・イワノフスキーは、ロシアの微生物学者である。1892年、タバコモザイク病の病原が細菌濾過器を通過しても感染性を失わないことを発見した。ウイルス学の創始者の一人である 。\\nレニングラード州のNisiでうまれた。サンクトペテルブルク大学で学んだ。1890年にサンクトペテルブルク科学アカデミーの植物研究所の助手となり、1895年からは講師、1901年からワルシャワ大学の教授、1915年からはRostower大学の教授を務めた。1887年に当時流行していたタバコモザイク病の調査のためにウクライナとベッサラビアに派遣された。3年後、クリミア地方で流行したタバコモザイク病の調査にも派遣された。タバコモザイク病の病原が細菌よりも小さく、陶製のシャンベラン型濾過器を透過することを、発見し、1892年の記事、1902年の論文で発表した。\\nタバコモザイクウイルスについては、オランダのマルティヌス・ベイエリンクも独立して、濾過器を透過した濾液中の病原体が感染を起こし増殖することを示したが、最初に発見したのはイワノフスキーであることが認められた。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D1%96%D0%B4%D0%BE%D0%BC%D0%B8%D1%85_%D0%BB%D1%8E%D0%B4%D0%B5%D0%B9,_%D0%BF%D0%BE%D1%85%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D1%85_%D0%BD%D0%B0_%D0%9B%D1%83%D0%BA%27%D1%8F%D0%BD%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D0%BC%D1%83_%D0%BA%D0%BB%D0%B0%D0%B4%D0%BE%D0%B2%D0%B8%D1%89%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/uk/3/3f/%D0%86%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2_%D0%92%D0%BE%D0%BB%D0%BE%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87.jpg","page_title":"Список відомих людей, похованих на Лук'янівському кладовищі","context_page_description":"закатованих у 1918 році на вулиці Садовій військами М. Муравйова;\\nзакатованих у 1919 році денікінцями;\\nпартизанів: Корницького Олексія Івановича і Селезня Василя Харитоновича. Загинули 13 жовтня 1943 року;\\nгероїв-дніпровців. На могилі монументальний пам'ятник. Текст: «Матросы Днепровской флотилии Рябыхин Юрий Николаевич 1922–1944 гг., три человека неизвестных, павших в бою за честь, свободу и независимось нашей Родины. 19. Х. 1941».\\nучасників бою під Крутами Володимира Наумовича та Володимира Шульгина. Також з ними поховано організатора і керівника Української студентської громади у Києві, що також загинув під Крутами.;\\nробітників 4-го хлібзаводу: Красиня І., Ріндак С., Гуральник В., Кухарь П., Войтенко А., розстріляних на хлібзаводі 27 лютого 1942 року."},{"page_url":"https://sco.wikipedia.org/wiki/Kramatorsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Kramatorsk_prapor.png","page_title":"Kramatorsk","context_page_description":"Kramatorsk is a ceety in Donetsk Oblast, in eastren Ukraine. Accordin tae latest estimates, the ceety's population wis aboot 200,000 fowk.\\nThe ceety is a important mechanical ingineerin centre in Ukraine. At various periods, Kramatorsk wis a place o residence for a nummer o notable fowk includin Leonid Bykov, Joseph Kobzon an the youngest person tae iver become FIDE Warld Champion Ruslan Ponomariov."},{"page_url":"https://es.wikipedia.org/wiki/Escultura_del_Renacimiento_en_Arag%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Veruela_-_Sepulcro_del_abad_Lope_Marco.jpg","page_title":"Escultura del Renacimiento en Aragón","context_page_description":"La escultura del Renacimiento en Aragón presenta características propias que la pueden diferenciar del resto de España.​ En la labra de los rostros, paños y actitudes, las formas son serenas y líricas, con un fondo goticista que se verá claramente en la obra de su mejor representante, el escultor valenciano Damián Forment. Esta etapa supone para la escultura aragonesa una época de gran esplendor y junto con la escuela castellana va a dar a España lo mejor de este arte.​\\nA pesar de las buenas relaciones existentes entre el reino de Aragón e Italia no se dio el hecho de que trabajaran artistas llegados de Italia, con excepción del florentino Juan de Moreto, afincado en Aragón. La única pieza importada fue la del sepulcro de Bellpuig en la región catalana, realizado por el escultor renacentista italiano Giovanni da Nola."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Geldrop","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Heggestraat_67_Geldrop_Monument_515920.jpg","page_title":"Lijst van rijksmonumenten in Geldrop","context_page_description":"De plaats Geldrop telt 33 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://it.wikipedia.org/wiki/Sjuntorp","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Sjuntorps_fabrik.jpg","page_title":"Sjuntorp","context_page_description":"Sjuntorp è un'area urbana della Svezia situata nel comune di Trollhättan, contea di Västra Götaland.\\nLa popolazione rilevata nel censimento 2010 era di 2 124 abitanti."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%A8%E0%A9%88%E0%A8%A8%E0%A9%80%E0%A8%A4%E0%A8%BE%E0%A8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Nainital_Lake_and_Town.JPG","page_title":"ਨੈਨੀਤਾਲ","context_page_description":"ਨੈਨੀਤਾਲ ਭਾਰਤ ਦੇ ਉੱਤਰਾਖੰਡ ਰਾਜ ਦਾ ਇਕ ਪ੍ਰਮੁੱਖ ਸੈਰ ਸਪਾਟੇ ਵਾਲਾ ਥਾਂ ਹੈ। ਕੂਮਾਊ ਖੇਰਰ ਵਿਚ ਨੈਨੀਤਾਲ ਜਿਲ੍ਹੇ ਦਾ ਬਹੁਤ ਮਹੱਤਵ ਹੈ। ਨੈਨੀ ਦਾ ਅਰਥ ਹੈ 'ਅੱਖਾਂ' ਅਤੇ ਤਾਲ ਦਾ ਅਰਥ ਹੈ 'ਝੀਲ' ਹੈ। ਨੈਨੀਤਾਲ ਜਿਲ੍ਹੇ ਵਿਚ ਅੱਜ ਵੀ ਸਭ ਤੋਂ ਵੱਧ ਝੀਲਾਂ ਹਨ ਜਿਸ ਕਰਕੇ ੲਿਸ ਨੂੰ ਭਾਰਤ ਦਾ \\"ਲੇਕ ਅਾਫ਼ ਡਿਸਟ੍ਰਿਕ\\" ਕਿਹਾ ਜਾਂਦਾ ਹੈ। ਬਰਫ਼ ਨਾਲ ਢਕੀਆਂ ਪਹਾੜੀਆਂ ਵਿਚਕਾਰ ਵਸਿਆ ਇਹ ਥਾਂ ਝੀਲਾਂ ਨਾਲ ਵੀ ਆਲੇ-ਦੁਆਲੇ ਤੋਂ ਘਿਰਿਆ ਹੈ। ਇਨ੍ਹਾਂ ਵਿਚੋਂ ਸਭ ਤੋਂ ਪ੍ਰਮੁੱਖ ਝੀਲ ਨੈਨੀ ਹੈ ਜਿਸ ਕਰਕੇ ਇਸ ਥਾਂ ਦਾ ਵੀ ਨੈਨੀਤਾਲ ਪੈ ਗਿਆ। ਨੈਨੀਤਾਲ ਦੇ ਚਾਰੇ ਪਾਸੇ ਕੁਦਰਤੀ ਨਜ਼ਾਰਿਆਂ ਦੀ ਭਰਮਾਰ ਹੈ।"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_governadores_do_Maranh%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Francisco_de_Paula_Pereira_Duarte.png","page_title":"Lista de governadores do Maranhão","context_page_description":"Esta é uma lista dos governantes do Maranhão, estado da República Federativa do Brasil.\\nO Maranhão foi uma das capitanias criadas quando da divisão do Brasil por D. João III, doada, de acordo com o historiador Pedro Calmon, anteriormente a junho de 1535, tendo sido seus primeiros capitães-donatários Fernando Álvares de Andrade, João de Barros e Aires da Cunha.\\nEm 13 de junho de 1621, Filipe IV de Espanha, numa tentativa de tornar mais eficaz a defesa militar da região contra os ataques de Neerlandeses, elevou-a à condição de Estado do Maranhão, com administração independente do Estado do Brasil, ao Sul, e ficando a compreender as capitanias do Maranhão, do Pará, do Piauí e do Ceará. Entre 1652 e 1655, esteve dividido em duas capitanias, a de São Luís e a do Grão-Pará, para logo depois ser reunificado.\\nEm 1737, a sua designação oficial passou a ser a de Estado do Grão-Pará e Maranhão. Em 1775, o Estado foi abolido, dividido nas capitanias do Maranhão, Grão-Pará, Piauí e São José do Rio Negro, e estas integradas no Vice-Reino do Brasil."},{"page_url":"https://cs.wikipedia.org/wiki/C%C3%ADtolibsk%C3%A1_skladatelsk%C3%A1_%C5%A1kola","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/C%C3%ADtoliby_z%C3%A1mek.JPG","page_title":"Cítolibská skladatelská škola","context_page_description":"Cítolibská skladatelská škola je významný fenomén českého hudebního klasicismu. Jejími členy byli hudebníci a komponisté, kteří působili ve 2. polovině 18. století především na panství Cítoliby na Lounsku. Hudba příslušníků školy byla nahrána na zvukové nosiče a stala se součástí repertoáru mnoha českých i zahraničních hudebních těles. Hlavní zásluhu na znovuobjevení této hudby má Zdeněk Šesták, který uspořádal první koncert složený ze skladeb \\"cítolibských mistrů\\" už roku 1949."},{"page_url":"https://hu.wikipedia.org/wiki/China_Railways_SS1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/China_Railways_6Y1_0001_on_test.jpg","page_title":"China Railways SS1","context_page_description":"A China Railways SS1 sorozat egy kínai 25 kV 50 Hz váltakozó áramú, Co'Co' tengelyelrendezésű villamosmozdony-sorozat. A China Railways üzemelteti. Összesen 826 db készült belőle, 7 db 6Y1 sorozat és 819 SS-1 sorozat. A mozdonyok közül a SS-1 008-as a Kínai Vasúti múzeumba került."},{"page_url":"https://en.wikipedia.org/wiki/Hemiphractus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Hemiphractus_fasciatus_with_babies_at_EVACC_%284357556801%29.jpg","page_title":"Hemiphractus","context_page_description":"Hemiphractus is a genus of frogs, the horned treefrogs, in the family Hemiphractidae. These overall brownish frogs have a pointed snout and a casque on the head. They are nocturnal, relatively rare and native to humid lowland and highland forests in northern South America and Panama, where typically found on the ground or at relatively low levels in vegetation."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AF%80%E0%AE%B0%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%BF_%E0%AE%B5%E0%AE%A3%E0%AF%8D%E0%AE%9F%E0%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Cannon-diagram2.svg","page_title":"பீரங்கி வண்டி","context_page_description":"பீரங்கி வண்டி அல்லது பீரங்கி வண்டி என்பது முன்னணித் தாக்குதலுக்காக வடிவமைக்கப்பட்ட கவசம் பூட்டிய போரிடும் ஊர்தியாகும். பீரங்கி வண்டி எஃகு கவசம் கொண்டு உருவாக்கப்படுகிறது. இதில் உயர் சுடுதிறன் உள்ள சுடுகலன்கள் அல்லது எந்திரத் துப்பாக்கிகள் பொருத்தப்பட்டிருக்கும். இதன் கவசமும், வேகமான இயங்குதிறமும், உயர் சுடுதிறமும் வலுவான கவசத் தாங்கியும் இதைத் தற்காலத் தரைப் போரின் ஒரு முதன்மை வாய்ந்த முன்னணி ஆயுதமாக ஆக்கியுள்ளது. இதில் அமைந்த எந்திரத் துப்பாக்கியை அனைத்து பக்கமும் திருப்பி தாக்க முடியும். இதை முதலாம் உலக போரின் போது இங்கிலாந்து உருவாக்கியது. முதல் உலகப் போரின் போது குறைந்த அளவே இது பயன்பட்டது. ஆனால் இரண்டாம் உலகப் போரின்போது பேரளவு வடிவமைப்பு மாற்றம் பெற்றது."},{"page_url":"https://tr.wikipedia.org/wiki/Hermes_House_Band","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/2018-05-13_ZDF_Fernsehgarten_Hermes_House_Band-7771.jpg","page_title":"Hermes House Band","context_page_description":"Hermes House Band, 1984 yılında Hollanda'nın Rotterdam kentinde Hermes Öğrenci Derneğinin üyeleri tarafından kurulmuş müzik grubu. Bu grubun en önemli özelliği, öğrenim hayatını tamamlayan grup üyelerinin hemen gruptan ayrılmasıdır. Grubun şimdiye kadar yaklaşık 75 üyesi olmuştur."},{"page_url":"https://hu.wikipedia.org/wiki/Antonio_Banderas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Antonio_banderas_%28cropped%29.jpg","page_title":"Antonio Banderas","context_page_description":"Antonio Banderas spanyol színész, énekes."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B9%8C%EC%B2%98%EB%9F%BC_%EB%90%98%EC%84%B8%EC%9A%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Be-like-Bill-1lib1ref.png","page_title":"빌처럼 되세요","context_page_description":"빌처럼 되세요는 미국에서 2015년부터 시작된 SNS 밈이다."},{"page_url":"https://en.wikipedia.org/wiki/St._Joseph,_La_Crosse_County,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/WIMap-doton-Greenfield.png","page_title":"St. Joseph, La Crosse County, Wisconsin","context_page_description":"St. Joseph is an unincorporated census-designated place in the town of Greenfield, La Crosse County, Wisconsin, United States. It is part of the La Crosse, Wisconsin Metropolitan Statistical Area. The community is located at the junction of State Highway 33 and county trunk highway M. As of the 2010 census, its population was 503."},{"page_url":"https://ca.wikipedia.org/wiki/Oettingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Wappen_Lehmingen.png","page_title":"Oettingen","context_page_description":"Oettingen in Bayern és una ciutat alemanya de l'estat federal Baviera, en el districte Donau-Ries de la regió administrativa de Suàbia."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%85%D8%AF%D9%86_%D8%A5%D8%B3%D8%B1%D8%A7%D8%A6%D9%8A%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Poleg_interchange.jpg","page_title":"قائمة مدن إسرائيل","context_page_description":"تشتملُ قائمة المُدن الإسرائيليَّة على تلك المُستعمرات البشريَّة التي يصدق عليها وصف «مدينة» إلى جانب المُستوطنات اليهوديَّة القائمة على أراضي الضفَّة الغربيَّة وفي القُدس الشرقيَّة. تأسس قسمٌ من المُدن الإسرائيليَّة كمُستعمراتٍ سكنها اليهود المُهاجرين من أوروپَّا خلال عهد الانتداب البريطاني على فلسطين، ونمت مع مُرور الوقت حتَّى أصبحت مُدنًا، كذلك، فقد استولت العصابات الصهيونيَّة على قسمٍ عظيمٍ من مُدن فلسطين التاريخيَّة وأرغمت أهلها من العرب المُسلمين والمسيحيين على هجرها، وأحلَّت بدلًا منهم عائلاتٍ يهوديَّةٍ مُهاجرة. كذلك، استولت المُنظمة الصهيونيَّة على مُدنٍ عربيَّةٍ أُخرى في فلسطين وأخضعتها لِسُلطتها، مع بقاء أهلها الأصليين فيها، أو إحلال بعض العائلات اليهوديَّة معهم، فأصبحت تلك المُدن مُختلطة. تستندُ هذه القائمة على الدليل الحالي لِدائرة الإحصاء المركزيَّة الإسرائيليَّة. ينُصُّ النظام الإداري الإسرائيلي على إمكانيَّة منح أي تجمُّع حضري حق تكوين مجلسٍ بلديٍّ من قِبل وزارة الدَّاخليَّة الإسرائيليَّة ما أن يتخطّى عدد سُكَّانها 20,000 نسمة. إنَّ وصف «مدينة» في القانون الإسرائيلي لا يصدق على البلديَّات المحليَّة أو التكتُلات الحضاريَّة، على الرُغم من أنَّ أغلب المُدن الكُبرى غالبًا ما يعيش ضمن حُدودها قسمٌ صغيرٌ من أهالي منطقتها الحضريَّة أو منطقتها الكُبرى."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%95%E1%80%AE%E1%80%87%E1%80%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Eq_it-na_pizza-margherita_sep2005_sml.jpg","page_title":"ပီဇာ","context_page_description":"ပီဇာ ဆိုသည်မှာ အီတလီအစားအစာ တစ်မျိုးဖြစ်သည်။ ပီဇာရရှိရန် ဝိုင်းအောင်လုပ်ထားသည့် ဂျုံနှစ်ပွကို ခရမ်းချဉ်နှစ်၊ ဒိန်ခဲ နှင့် အခြားအဆာပလာများ ထည့်ကာ မီးပြင်းတွင်ဖုတ်၍ ပြုလုပ်ကြသည်။ ရိုးရာနည်းအတိုင်းပြုလုပ်လိုပါက ထင်းမီးသုံးထားသည့် မုန့်ဖုတ်ဖိုကို အသုံးကြရမည် ဖြစ်သည်။ စားသောက်ဆိုင်ကဲ့သို့ အကျအနပြင်ဆင်သည့်နေရာများတွင် ဇွန်းခက်ရင်းဖြင့် စားကြသော်လည်း အသုံးများသည့်စားနည်းမှာ အစိတ်ငယ်ပိုင်းကာ လက်ဖြင့်စားခြင်း ဖြစ်သည်။ ပီဇာစိတ်များကို ပီဇက်တက် ဟု အခေါ်ရှိသည်။\\nပီဇာဟူသော စကားလုံးကို ကန်ပေနီးယား နယ်စပ်၊ အီတလီတောင်ပိုင်းမြို့တစ်ခုမှရသည့် ရာစု လက်ရေးမူ တစ်ခုတွင် စတွေ့ရကြောင်း မှတ်တမ်းရှိသည်။ ခေတ်သစ်ပီဇာမှာ နေပယ်မြို့တွင် ပေါ်ပေါက်လာခြင်းဖြစ်ပြီး အခြားနိုင်ငံအသီးသီးသို့ ပျံ့နှံ့သွားတော့သည်။ လူကြိုက်အများဆုံးအစားအစာများအနက် တစ်ခုအပါအဝင်ဖြစ်ပြီး ဥရောပနှင့် မြောက်အမေရိကားရှိ အသင့်စားအမယ်တစ်ခုအဖြစ် အသုံးတော်ခံနေသည်။ ပီဇာဆိုင် သို့မဟုတ် မြေထဲပင်လယ်ထွက် အစားအစာများရောင်းသည့် စားသောက်ဆိုင်တို့တွင် အိမ်အရောက်ပို့စနစ်ကို ဝန်ဆောင်မှုပေးလေ့ရှိသည်။ ဖုတ်ပြီးသားပီဇာကို ခဲထားပြီး အိမ်သို့ရောက်မှ အပူပေး၍ အသင့်စားနိုင်ရန် စီမံပေးထားသည်။\\nအကျိုးအမြတ်မယူသည့် အဖွဲ့တစ်ခုဖြစ်သော နေပယ်ထွက် ပီဇာအသင်း ကို ၁၉၈၄ ခုနှစ်တွင် ထူထောင်ပြီး နေပယ်မြို့၌ ရုံးချုပ်ဖွင့်ထားသည်။"},{"page_url":"https://it.wikipedia.org/wiki/Bandiera_d%27Italia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Flag_of_the_Repubblica_Cisalpina.svg","page_title":"Bandiera d'Italia","context_page_description":"La bandiera d'Italia, conosciuta anche, per antonomasia, come il Tricolore, è il vessillo nazionale della Repubblica Italiana. È una bandiera a tre colori composta da verde, bianco e rosso, colori nazionali dell'Italia, partendo dall'asta, a tre bande verticali di eguali dimensioni, così definita dall'articolo 12 della Costituzione della Repubblica Italiana, pubblicata sulla Gazzetta Ufficiale nº 298, edizione straordinaria, del 27 dicembre 1947. La legge ne regolamenta utilizzo ed esposizione, tutelandone la difesa e prevedendo il reato di vilipendio della stessa; ne prescrive altresì l'insegnamento nelle scuole insieme agli altri simboli patri italiani.\\nAlla bandiera italiana è dedicata la Festa del Tricolore, istituita dalla legge nº 671 del 31 dicembre 1996, che si tiene ogni anno il 7 gennaio. Questa celebrazione commemora la prima adozione ufficiale del tricolore come bandiera nazionale da parte di uno Stato italiano sovrano, la Repubblica Cispadana, che avvenne a Reggio nell'Emilia il 7 gennaio 1797, sulla scorta degli eventi susseguenti alla rivoluzione francese che propugnò, tra i suoi ideali, l'autodeterminazione dei popoli."},{"page_url":"https://fr.wikipedia.org/wiki/Martin-p%C3%AAcheur_d%27Europe","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Weingartener_Moor_03.JPG","page_title":"Martin-pêcheur d'Europe","context_page_description":"Le Martin-pêcheur d'Europe est une espèce d'oiseaux, espèce type de la famille des Alcedinidae. Cet oiseau est un bon indicateur naturel de la qualité d'un milieu aquatique."},{"page_url":"https://ca.wikipedia.org/wiki/Valsos_op._34_(Chopin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Chopin_Valse_Op_34_No_2_intro.png","page_title":"Valsos op. 34 (Chopin)","context_page_description":"Els tres Valsos op. 34, van ser compostes per Frédéric Chopin entre 1834 i 1838 i publicats el 1838 amb el títol de Grans valsos brillants. Amb el temps, aquest títol ha quedat reservat per al Vals en mi bemoll major, op. 18.\\n1) Vals en la bemoll major, op. 34, núm. 1\\nÉs un dels dels valsos de Chopin més llargs. En la tonalitat de la bemoll major. La peça s'introdueix amb una fanfàrria abans de la modulació a re bemoll major a través d'una secció central bonica i tranquil·la. La part final, un altre cop en la bemoll major, porta a una coda amb la que conclou la peça.\\n2) Vals en la menor, op. 34 núm. 2\\nAquest vals animat però lent està en la tonalitat de la menor. Tot i que va ser el primer a ser compost, fou el segon en ser publicat.\\n3) Vals en fa major, op. 34 núm. 3\\nVa ser compost el 1838 i publicat el mateix any."},{"page_url":"https://fr.wikipedia.org/wiki/Natalia_Molchanova","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Molchanova_Natalia_1%2C_Danmark%2C_Aarhus%2C_5th_Individual_freediving_World_Championship%2C_2009.jpg","page_title":"Natalia Molchanova","context_page_description":"Natalia Vadimovna Molchanova, née le 8 mai 1962 à Oufa et portée disparue le 2 août 2015 à Formentera, est une championne russe d'apnée et la présidente de la fédération russe d'apnée. Elle a obtenu 41 records mondiaux en plongée en apnée et 23 titres de championne du monde. Elle est la première femme au monde à avoir effectué une plongée en Poids Constant de plus de 100 mètres, dès 2009 à Charm el-Cheikh, puis lors des championnats du monde de Kalamata en 2011."},{"page_url":"https://it.wikipedia.org/wiki/Baldovino_II_di_Fiandra","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Baldwin_II_-_Count_of_Flanders.jpg","page_title":"Baldovino II di Fiandra","context_page_description":"Baldovino II, soprannominato il Calvo, è stato il secondo conte di Fiandra, dall'879 alla sua morte."},{"page_url":"https://en.wikipedia.org/wiki/Marco_Beltrame","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/San_Mois%C3%A8_%28Venice%29_Interno_-_Cristoforo_Ivanovich.jpg","page_title":"Marco Beltrame","context_page_description":"Marco Beltrame was an Italian sculptor of the Baroque period, active mainly in his birthplace, Venice."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%95%E0%B8%B8%E0%B9%88%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Taupini%C3%A8res_-_Mole-hills.jpg","page_title":"ตุ่น","context_page_description":"ตุ่น หรือ ติ่ง เป็นสัตว์เลี้ยงลูกด้วยนมวงศ์หนึ่ง ในอันดับตุ่น ใช้ชื่อวงศ์ว่า Talpidae ซึ่งครั้งหนึ่ง จะจัดให้ตุ่นอยู่ในอันดับสัตว์กินแมลง\\nตุ่น มีลักษณะคล้ายหนูตะเภาตัวอ้วน ๆ ซึ่งเป็นสัตว์ในอันดับสัตว์ฟันแทะ แต่ทว่าตุ่นมีอันดับแยกออกมาเองต่างหาก ซึ่งใกล้เคียงกับหนูผี มากกว่า มีขนอ่อนนุ่ม สีคล้ำอย่างสีเทาหรือสีดำ ตลอดทั้งลำตัว ซึ่งขนนี้มีคุณลักษณะพิเศษที่สามารถบิดไปในทิศทางใดก็ได้ แตกต่างจากสัตว์ประเภทอื่น ๆ ส่วนหางสั้น\\nตุ่นอาศัยในโพรงใต้ดินตลอดเวลา จะไม่ขึ้นมาบนพื้นดิน หากไม่จำเป็น ดังนั้นจึงมีหูและตาเล็กมาก เพราะแทบไม่ได้ใช้ประโยชน์ และถูกเก็บซ่อนอยู่ใต้ขน เพื่อป้องกันมิให้ดินเข้าเวลาขุดดิน ในบางชนิดจะมีหนังพิเศษปิดเหนือตาด้วย ขาคู่หน้าของตุ่นซ่อนอยู่ใต้ขน ซึ่งจะยื่นออกมาแต่ส่วนปลายเป็นข้อมือที่มีเล็บที่แข็งแรง 5 เล็บ ซึ่งใช้ในการขุดโพรงดิน แต่จะใช้เดินบนพื้นดินไม่ได้เลย หากตุ่นขึ้นมาบนดินจะทำได้เพียงแค่คืบคลาน"},{"page_url":"https://war.wikipedia.org/wiki/Lygodactylus_klemmeri","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Lygodactylus_klemmeri_distribution.png","page_title":"Lygodactylus klemmeri","context_page_description":"An Lygodactylus klemmeri in uska species han Reptilia nga ginhulagway ni Georges Pasteur hadton 1965. An Lygodactylus klemmeri in nahilalakip ha genus nga Lygodactylus, ngan familia nga Gekkonidae. Ginklasipika han IUCN an species komo harani ha karat-an. Waray hini subspecies nga nakalista."},{"page_url":"https://en.wikipedia.org/wiki/Bob_Fitch","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Bob_Fitch_1940.jpg","page_title":"Bob Fitch","context_page_description":"Robert E. Fitch was an American athlete and coach. He broke the world record in the discus throw in 1946 with a mark of 54.93 m. He developed a rotational technique referred to as the \\"Minnesota Whip\\" and delivered a masters thesis on the subject. His training mate Fortune Gordien went on to break world records and win Olympic medals.\\nFitch was a two-time American champion in the discus and was the winner of the 1942 NCAA Championships. He was also part of the University of Minnesota championship-winning college football. He later became golf coach for Indiana University and developed the team into a top level NCAA side, winning six Big Ten Conference titles during his tenure from 1957 to 1989 – a record for an Indiana coach."},{"page_url":"https://es.wikipedia.org/wiki/Alalakh","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Syria2mil.JPG","page_title":"Alalakh","context_page_description":"Alalakh o Alalaḫ, es el nombre de una antigua ciudad y su asociada ciudad-estado del valle del río Amuq, localizada en la región de Hatay al sur de Turquía cerca de la ciudad de Antioquía, y hoy en día representada por una extensa ciudad-montículo conocida como Tell Atchana."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%91%D7%97%D7%99%D7%A8%D7%95%D7%AA_%D7%94%D7%A4%D7%A8%D7%9C%D7%9E%D7%A0%D7%98%D7%A8%D7%99%D7%95%D7%AA_%D7%91%D7%90%D7%A1%D7%98%D7%95%D7%A0%D7%99%D7%94_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Estonian_Election_2015_Largest_Party_By_Electoral_Districts.png","page_title":"הבחירות הפרלמנטריות באסטוניה 2015","context_page_description":"הבחירות לפרלמנט באסטוניה 2015 נערכו ב-1 במרץ 2015. הצבעה אלקטרונית ומוקדמת התקיימה בין ה-19 בפברואר ל-25 בפברואר ואחוז ההצבעה עמד על 33% מקולות הבוחרים. מפלגת השלטון זכתה בבחירות וקיבלה 27.7% מהקולות - ירידה של כאחוז מהבחירות הקודמות ושל שלושה מושבים בפרלמנט - וראש הממשלה טאווי רייוואס זכה בכהונה נוספת."},{"page_url":"https://sh.wikipedia.org/wiki/Manuel_de_Falla","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Paul_Dukas_01.jpg","page_title":"Manuel de Falla","context_page_description":"Manuel de Falja bio je najugledniji španski kompozitor ranog 20. veka. Uz Enrikea Granadosa i Isaka Albeniza jedan je od najznačajnijih predstavnika španskog muzičkog nacionalizma. Bio je jedan od prvih kompozitora iz te tradicije koji je postao poznat širom Evrope i Amerike, prekinuvši na taj način izolovanost španske muzike od 18. veka.\\nU njegovom stvaralaštvu mogu se uočiti uticaji kako španske muzičke tradicije, tako i francuske muzike i evropske avangarde. Komponovao je balete: Ljubav čarobnica i Trorogi šešir; opere: Kratak život i Lutkarsko pozorište majstora Pedra; i instrumentalna dela, među kojima se ističu Betička fantazija za klavir i Koncert za čembalo. Njegovo delo za klavir i orkestar Noći u vrtovima Španije blisko je estetici impresionizma. Ostavio je za sobom nedovršenu scensku kantatu Atlantida na kojoj je radio poslednjih dvadeset godina života.\\nNakon završetka Španskog građanskog rata emigrirao je u Argentinu i tamo umro 1946. godine.\\n\\""},{"page_url":"https://mg.wikipedia.org/wiki/Lope_de_Vega","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/LopedeVega.jpg","page_title":"Lope de Vega","context_page_description":"Lope de Vega dia mpanoratra tantara tsangana, Poeta, mpanao asa soratra mizaka ny zom-pirenen'i Espaina teraka ny 5 Desambra 1562 tao Madrid ary maty ny 27 Aogositra 1635 tao Madrid"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Munkebo_(k%C3%A0u-khu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Munkebo_Kirke_fra_syd.jpg","page_title":"Munkebo (kàu-khu)","context_page_description":"Munkebo sī Tan-be̍h Kerteminde chū-tī-chhī lāi ê chi̍t ê kàu-khu."},{"page_url":"https://pt.wikipedia.org/wiki/Drillia_roseola","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Drillia_roseola_001.jpg","page_title":"Drillia roseola","context_page_description":"Drillia roseola é uma espécie de gastrópode do gênero Drillia, pertencente a família Drilliidae."},{"page_url":"https://zh.wikipedia.org/zh-cn/NHK%E5%B9%BF%E6%92%AD%E7%94%B5%E8%A7%86%E4%B8%AD%E5%BF%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/NHK_Broadcasting_Center_2016.jpg","page_title":"NHK广播电视中心","context_page_description":"NHK广播电视中心，或直译为NHK放送中心，是日本广播协会的总部所在地，位于东京都涩谷区的神南，邻近国立代代木竞技场和代代木公园。1964年启用，最早做为该年东京奥运的国际广播中心使用，经过扩建之后，NHK总部在1973年从东京内幸町的东京放送会馆转移至此。NHK的大部分节目均在此制作，除了肩负NHK总台的职责之外，也兼设首都圈放送中心，负责对东京都会区的广播业务。其广播区域为关东广域圈。\\nNHK广播电视中心的建地内共有6栋建筑，除了主要功能的广播制播设施外，亦附设数个设施：\\nNHK摄影棚公园\\n1995年3月22日开幕，为面向视听人与一般民众的广播体验设施。\\nNHK音乐厅\\n1973年6月20日开馆，为东京著名表演厅之一。毎年除夕现场直播的NHK红白歌合战在此举行。\\n中国中央电视台、韩国放送公社、澳大利亚广播公司等海外公共媒体与国营媒体机构的驻日站点也在NHK广播电视中心中。\\n由于NHK广播电视中心使用时间近半世纪，为了因应耐震、节能与灾害应对上的需求，同时强化自身做为世界领先媒体机构的地位，NHK在2016年8月30日发表改建基本计划，将以设计及施工统包的方式改建NHK音乐厅以外的所有建筑，预计在2020年东京奥运结束后分阶段动工、2025年部分启用、2036年全部完工。"},{"page_url":"https://pt.wikipedia.org/wiki/Tolosa_(Espanha)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Tolosa_Archivo_Provincial_DSC00051.JPG","page_title":"Tolosa (Espanha)","context_page_description":"Tolosa é um município da Espanha na província de Guipúscoa, comunidade autónoma do País Basco. Tem 37,39 km² de área e em 2016 tinha 19 175 habitantes."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B7%D9%8A%D8%AB%D8%A7%D8%B1%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Tipulidae_April_2008-2.jpg","page_title":"طيثارية","context_page_description":"الطيثارية أو الطيثاريات أو الذباب البجعي هي فصيلة من الحشرات تتبع رتبة ذوات الجناحين من طائفة الحشرات. يتميَّز الذباب البجعي البالغ بنحافته وأرجله الطويلة؛ حيث قد يتراوح طول أرجله ما بين 2–60 مليمتر، في حين يصل طول أرجل الأنواع التي تعيش في مناخٍ استوائيٍ إلى 001 مليمتر أو 9.3 بوصات.\\nفي المملكة المتحدة وجزيرة أيرلندا ونيوفاوندلاند ونوفا سكوشا يُعرف هذا الذباب باسم الحشرة ذات الأرجل \\"القوائم\\" الطويلة، كما يُطلق هذا الاسم أيضًا على حيوانين آخرين غير متصلين من مفصليات الأرجل وهما: الحيوان المنتمي لفصيلة العنكبيات والمعروف باسم أوبليون وقبو العنكبوت الذي يُعرف باسم فولسيداي. تُعرف يرقة الذباب البجعي الأوروبي باسم ذات السترة الجلدية. وقد تتسبب هذه اليرقات في تلف المُروج حيث تتغذى على جذور النباتات العشبية. ويُطلق على هذا الذباب أحيانًا في ولاية أوريغون اسم الذباب الزاحف المجنح.\\nكما شاع إطلاق العديد من الأسماء الأخرى على الذباب البجعي والتي يُعد معظمها محليًا ومن بينها صقر البعوض وآكلات البعوض والبعوض الذئبي والفلنيرية وبعوض جوليووبر.\\nوتم تشريح أكثر من 4250 نوعًا من أنواع الذباب البجعي قام بتشريح معظمها اختصاصي الحشرات تشارلز بول ألكسندر."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D1%8C%D0%B2%D0%B0%D1%82%D0%BE%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Calvatone-Chiesa_parrocchiale.jpg","page_title":"Кальватоне","context_page_description":"Кальватоне — муніципалітет в Італії, у регіоні Ломбардія, провінція Кремона.\\nКальватоне розташоване на відстані близько 400 км на північний захід від Рима, 105 км на схід від Мілана, 33 км на схід від Кремони.\\nНаселення — 1208 осіб.\\nЩорічний фестиваль відбувається 10 серпня. Покровитель — San Biagio."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mammals_of_Sumatra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/DHOLE_4_VU3SBF.jpg","page_title":"List of mammals of Sumatra","context_page_description":"This is a list of mammal species found in the Sumatra, Indonesia."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D9%8A%D9%83%D9%8A%D9%85%D8%A7%D9%86%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/LocationSouthAmerica.png","page_title":"ويكيمانيا","context_page_description":"ويكيمانيا هو المؤتمر السنوي الذي يُعقد للاحتفال بجميع مشاريع المعرفة المجانية التي تستضيفها مؤسسة ويكيميديا وتشمل: ويكيميديا كومنز، وميدياويكي، وويكي الكتب، وويكي بيانات، وويكي الأخبار، وويكيبيديا، وويكاموس، وويكي الرحلات، وويكي الجامعة. يسبق المؤتمر ثلاثة أيام تُدعى أيام ما قبل المؤتمر، ويتطلَلب حضورها تسجيلا مُسبقا، حيث تتضمن عدة نشاطات منها إقامة الهاكاثون، وإعطاء مقدمة حول ويكيمانيا خاصة للويكيميدين الذي يحضرون ويكيمانيا لأول مرة وغيرها من النشاطات. تضم ويكيمانيا ثلاث إلى أربع أيام من المؤتمرات والمناقشات والاجتماعات والتدريب وورش العمل، التي يحضرها مئات من المتطوعين وقادة المعرفة الحرة من جميع أنحاء العالم حيث يجتمعون لمناقشة القضايا، والحديث عن المشاريع الجديدة والأساليب، وتبادل الأفكار.\\nمنذ عام 2011، تم الإعلان في ويكيمانيا عن الفائز بجائزة ويكيميدي العام وهي عبارة عن جائزة سنوية، أطلقها مؤسس ويكيبيديا \\"جيمي ويلز\\" عام 2011 بهدف عَنونة أهم الإنجازات العظيمة تجاه ويكيبيديا. عُقد 15 مؤتمرًا حتى عام 2019، كان أولها في فرانكفورت بألمانيا من 4 حتى 8 أغسطس 2005، وعقد أحدثها زمناً في ستوكهولم في السويد في الفترة من 14-18 أغسطس 2019؛ وعُقدت نسخة واحدة حتى الآن في منطقة عربيّة، حيث استضافت مدينة الإسكندريّة في مصر النسخة الرابعة من المؤتمر في الفترة ما بين 17 إلى 19 يوليو 2008."},{"page_url":"https://en.wikipedia.org/wiki/Our_Lady_of_Lourdes_Shrine,_Villianur","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Villianur_shrine_Grotto.jpg","page_title":"Our Lady of Lourdes Shrine, Villianur","context_page_description":"Our Lady of Lourdes Shrine is a famous Marian shrine located in Villianur Town, Puducherry, India. This Roman Catholic shrine is devoted to Our Lady of Lourdes."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%95%BF%E8%B6%BE%E9%92%9D%E5%8F%A3%E8%9E%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/LongToedsBreeding.jpg","page_title":"长趾钝口螈","context_page_description":"長趾鈍口螈 是鈍口螈科中的一種摩爾蠑螈。成年長趾鈍口螈通常身長4.1-8.9厘米，其特徵為周身夾雜的黑色、棕色、和黃色色素斑點，以及位於後肢突出生長的第四根腳趾。化石記錄, 遺傳學和 生物地理學的研究表明：長趾鈍口螈和藍點鈍口螈均起源於同一祖先。由於古新世時期北美中大陸航道的流失，它們的祖先遷移至科迪勒拉山脈西部地區。\\n長趾鈍口螈主要分布於海拔高度範圍可至2800米的太平洋西北部地區。它們的棲息地種類繁多，其中包括溫帶雨林，針葉林，山地河岸帶，山艾樹灌木平原，紫果冷杉林，半乾旱地區的山艾樹林，絹雀麥平原，以及沿著山地湖區石岸邊的高山草甸。在水中野生繁育階段，長趾鈍口螈生活於水流速度較慢的溪流、池塘、以及湖中。寒冬時節是長趾鈍口螈的冬眠期，它們依靠先前儲藏在皮膚以及尾部的能量儲備來維持生命。\\n長趾鈍口螈的五個亞種有著不同的遺傳史和基因史，通過它們不同的顏色以及皮膚紋理進行表型區分。儘管國際自然保護聯盟將長趾鈍口螈劃分為無危物種，各式的土地開發活動都對蠑螈的棲息地造成了不良影響甚至威脅到了它們的生存。"},{"page_url":"https://sv.wikipedia.org/wiki/West_Warwick","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/West_Warwick_Memorial.jpg","page_title":"West Warwick","context_page_description":"West Warwick är en kommun i Kent County i delstaten Rhode Island, USA med cirka 29 581 invånare. Den har enligt United States Census Bureau en area på 21,0 km²."},{"page_url":"https://cs.wikipedia.org/wiki/Trnkov","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Slovakia_Trnkov_4.jpg","page_title":"Trnkov","context_page_description":"Trnkov je obec na Slovensku v okrese Prešov. První písemná zmínka o obci pochází z roku 1330."},{"page_url":"https://pt.wikipedia.org/wiki/Danny_Herrera","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Napalm_drummer.jpg","page_title":"Danny Herrera","context_page_description":"Danny Herrera é um baterista norte-americano de ascendência mexicana. Ele juntou-se a banda inglesa de grindcore Napalm Death em 1991, substituindo Mick Harris. Sua primeira aparição na banda foi no álbum Utopia Banished lançado em 1992.\\nE de acordo com o vocalista Mark \\"Barney\\" Greenway, ele toca todos os tipos de blast beats apenas com um pedal.\\nHerrera também já tocou em alguns shows da banda inglesa de black metal, Anaal Nathrakh."},{"page_url":"https://es.wikipedia.org/wiki/Rattus_norvegicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Rattus_norvegicus_1.jpg","page_title":"Rattus norvegicus","context_page_description":"La rata parda, rata de alcantarilla, rata gris, rata marrón o rata aleconi, también denominada rata china, rattus eloy, rata noruega o guarén o más comúnmente conocida como rata cuartero, es una especie de roedor miomorfo de la familia Muridae.​ Es una de las ratas más conocidas y comunes; está ligada a las actividades humanas y gracias a ello ha colonizado todo el mundo desde sus orígenes en China, siendo una plaga en algunas zonas. Ha dado origen a las ratas albinas y otras variedades utilizadas por el hombre como animal de laboratorio o doméstico.​ No se reconocen subespecies.​"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89mile_Rousseaux","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/P%C3%A8re-Lachaise_-_Division_10_-_Rousseaux_01.jpg","page_title":"Émile Rousseaux","context_page_description":"Émile Rousseaux est un graveur français né à Abbeville en 1831 et mort à Paris en 1874."},{"page_url":"https://es.wikipedia.org/wiki/Ch%C3%A8vreville_(Mancha)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/FranceNormandieChevrevilleEglise.jpg","page_title":"Chèvreville (Mancha)","context_page_description":"Chèvreville era una comuna francesa situada en el departamento de Mancha, de la región de Normandía, que el 1 de enero de 2016 pasó a ser una comuna delegada de la comuna nueva de Grandparigny​ al fusionarse con las comunas de Martigny, Milly y Parigny."},{"page_url":"https://de.wikipedia.org/wiki/Der_Eishockeysport","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Der_Eishockeysport.jpg","page_title":"Der Eishockeysport","context_page_description":"Das Der Eishockeysport war eine österreichische Eishockeyzeitschrift, die zwischen 1925 und 1938 wöchentlich in Wien erschien. Sie trug den Nebentitel Offizielles Organ des Österreichischen Eishockey-Verbandes und wurde von diesem herausgegeben."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%95%D0%BB%D0%B8%D0%B7%D0%B0%D0%B1%D0%B5%D1%82_%D0%A4%D1%80%D0%B8%D0%B4%D0%B5%D1%80%D0%B8%D0%BA%D0%B0_%D0%A1%D0%BE%D1%84%D0%B8%D1%8F_%D1%84%D0%BE%D0%BD_%D0%91%D1%80%D0%B0%D0%BD%D0%B4%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B3-%D0%91%D0%B0%D0%B9%D1%80%D0%BE%D0%B9%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Eckersdorf-Schloss_Fantaisie.JPG","page_title":"Елизабет Фридерика София фон Бранденбург-Байройт","context_page_description":"Елизабет Фридерика София фон Бранденбург-Байройт е немска принцеса, маркграфиня от княжество Бранденбург-Байройт и чрез женитба херцогиня на Вюртемберг.\\nТя е единствената дъщеря на маркграф Фридрих III фон Бранденбург-Байройт и първата му съпруга принцеса Вилхелмина Пруска, дъщеря на пруския крал Фридрих Вилхелм I и София Доротея фон Брауншвайг-Люнебург. Тя е племенница на крал Фридрих II от Прусия. Баща ѝ Фридрих започва да се интересува от други жени и се жени втори път на 20 септември 1759 г. в Брауншвайг за София Каролина Мария фон Брауншвайг-Волфенбютел, племенница на първата му съпруга.\\nЕлизабет Фридерика София е смятана за една от най-красивите принцеси по това време. През януари 1744 г. управляващият херцог Карл Евгений фон Вюртемберг посещава Байройт и се влюбва в единствената дъщеря на маркграф Фридрих III. За нея се стремят маркграфа от Бранденбург-Ансбах и датския крал, но тя се решава за херцога на Вюртемберг. Елизабет Фридерика София фон Бранденбург-Байройт се омъжва на 26 септември 1748 г. в Байройт за херцог Карл Евгений фон Вюртемберг. За сватбата се открива маркграфската опера в Байройт и се секат монети с техните портрети.\\nБракът първо е щастлив."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D1%80%D0%B8%D1%86%D1%8F_%D1%80%D1%83%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/%D0%93%D0%BD%D1%96%D0%B7%D0%B4%D0%BE_%D0%B2%D1%96%D0%B2%D1%81%D1%8F%D0%BD%D0%BA%D0%B8%2C_%D1%89%D0%B5%D0%B2%D1%80%D0%B8%D0%BA%D0%B0_%D0%B0%D0%B1%D0%BE_%D0%BB%D1%96%D1%81%D0%BE%D0%B2%D0%BE%D0%B3%D0%BE_%D0%B6%D0%B0%D0%B9%D0%B2%D0%BE%D1%80%D0%BE%D0%BD%D0%BA%D0%B0.jpg","page_title":"Нориця руда","context_page_description":"Нориця руда, або лісова — вид гризунів з роду нориця підродини щурових родини хом'якові."},{"page_url":"https://ca.wikipedia.org/wiki/Catedral_de_Salzburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Salzburgo_Catedral._B%C3%B3veda_Crucero_S.JPG","page_title":"Catedral de Salzburg","context_page_description":"La Catedral de Salzburg està ubicada al centre de la ciutat de Salzburg i representa és un dels millors exemples d'església barroca del Nord dels Alps."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%82%AC%E5%B3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Fuga_Island_Tide_Gauge_1927.jpg","page_title":"フガ島","context_page_description":"フガ島は、フィリピンのバブヤン諸島の島の一つ。\\nカガヤン州アパリの町に属す。2000年の国勢調査によれば人口1,786人、312世帯。"},{"page_url":"https://lt.wikipedia.org/wiki/Policija","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Peugeot_406%2C_Saarland_Police_car.jpg","page_title":"Policija","context_page_description":"Policija – administracinė institucija viešajai tvarkai prižiūrėti, tos institucijos pajėgos bei tos institucijos būstinė.\\nSpecialios viešosios tvarkos priežiūros institucijos atsirado dar Senovės Graikijoje ir Romoje. Pirmą kartą oficialiai įteisinta Prancūzijos 1789 m. „Žmogaus ir piliečio teisių deklaracijos“ 12 straipsnyje: „žmogaus ir piliečio teises užtikrina viešosios pajėgos, šios pajėgos yra steigiamos visų naudai ir jų negalima panaudoti niekam kitam, tik tam, kam jos yra skirtos“."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%B6%E0%B0%BE%E0%B0%A4%E0%B0%B5%E0%B0%BE%E0%B0%B9%E0%B0%A8%E0%B1%81%E0%B0%B2%E0%B1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/East_Gateway_-_Stupa_1_-_Sanchi_Hill_2013-02-21_4398.JPG","page_title":"శాతవాహనులు","context_page_description":"శాతవాహనులు దక్షిణ, మధ్య భారతదేశంను కోటిలింగాల, ధరణికోట, జూన్నార్ ల నుండి పరిపాలించారు. శాతవానుల తొలి రాజధాని తెలంగాణ ప్రాంతంలోని కోటిలింగాల. వీరి పరిపాలన క్రీ.పూ. 230 సం. నుండి మొదలై సుమారు 450 సంవత్సరాలు కొనసాగింది. వీరి జనరంజక పరిపాలన వీరికి శాంతికాముకులుగా పేరు తెచ్చింది.బౌద్ధ సాహిత్యాన్ని బట్టి దక్షిణ దేశ చరిత్రను క్రీ.పూ 6వ శతాబ్దం నుంచి మనం అంచనా వేయ వచ్చు.\\n.\\nఆంధ్రులు మధ్య ఆసియా నుండి తరచు దండయాత్రలు ఎదుర్కొంటూ, శక్తిమంతమైన విశాల సామ్రాజ్యాన్ని పరిపాలించారు. వీరి సైనిక శక్తితో పాటు, వ్యాపార దక్షత, నావికా కౌశలానికి చరిత్రలో మొట్టమొదటి సారిగా ఆగ్నేయ ఆసియాలో భారత కాలనీలు స్థాపించడమే తార్కాణం. మౌర్య వంశ సామంతులుగా రాజకీయజీవితం ప్రారంభించిన శాతవాహనులు క్రీ.పూ. 232లో అశోకుని మరణము తర్వాత స్వాతంత్ర్యము ప్రకటించుకొన్నారు. 'ఆంధ్ర' యొక్క ప్రస్తావన అల్ బెరూని వ్రాతలలో కూడా ఉంది. ఈయన దక్షిణ భారతదేశంలో మాట్లాడే భాష \\"ఆంధ్రి\\" అని వ్రాశాడు. ఈయన గ్రంథం కితాబుల్ హింద్ ఆనాటి ఆంధ్రదేశములోని కొన్ని ఆచారవ్యవహారాలను, సంప్రదాయాలను వర్ణిస్తుంది.\\nశాతవాహనులు, వాశిష్ఠీపుత్ర శ్రీ పులోమావి తో ప్రారంభించి తమ నాణేలపై రాజుల ముఖచిత్రాలు ముద్రించిన తొలి భారతీయ స్థానిక పాలకులుగా భావిస్తారు. ఈ సంప్రదాయం వాయువ్యాన పరిపాలించిన ఇండో-గ్రీకు రాజుల నుండి వచ్చింది."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%96%91%EB%8F%99%EB%AF%B8%EB%A6%AC%EA%B3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Parapercis_hexophtalma_1.jpg","page_title":"양동미리과","context_page_description":"양동미리과는 통구멍목에 속하는 조기어류 과의 하나이다. 보통 얕은 수심 바다의 모래 또는 작은 돌 바닥에서 서식하는 저서 물고기이다. 남아메리카와 남아프리카 원해와 일본 등 극동의 인도-태평양에서 발견된다. 일부 종은 식용으로 쓰인다. 다섯줄양동미리와 쌍동가리, 눈동미리, 열쌍동가리, 칠색동가리, 청대구, 황쌍동가리, 노랑열동가리 등을 포함하고 있다."},{"page_url":"https://pt.wikipedia.org/wiki/Regi%C3%A3o_de_Le%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Espa%C3%B1a_y_Portugal_%281770%29.jpg","page_title":"Região de Leão","context_page_description":"Leão é uma região histórica espanhola com origem no Reino de Leão, e mais tarde definida como tal na divisão territorial espanhola de 1833. Esta divisão agregava as atuais províncias de Leão, Samora e Salamanca mas carecia de quaisquer competências ou órgãos administrativos ou doutro tipo, tendo apenas um caráter meramente classificativo.\\nDurante a Segunda República, foi concedida a possibilidade da região poder eleger um juíz próprio no tribunal de garantias constitucionais, abrindo a porta à possibilidade de vir a gozar de um estatuto de autonomia próprio, no entanto, o rebentar da Guerra Civil Espanhola e a posterior ditadura frearam qualquer tentativa autonomista séria na região.\\nAtualmente, apenas as forças políticas leonesistas exigem a autonomia para estas províncias. No Parlamento de Castela e Leão, esta corrente obteve apenas um representante dos 32 eleitos pela região leonesa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B3%D1%80%D0%B5%D0%B1%D0%BD%D0%BE%D0%B9,_%D0%A0%D0%B8%D0%BC%D0%B8%D0%B4%D0%B0%D0%BB%D0%B2_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Sukhar_02.jpg","page_title":"Погребной, Римидалв Иванович","context_page_description":"Римида́лв Ива́нович Погребно́й — советский и российский архитектор, проектировщик и строитель наземных и подземных объектов Московского метрополитена."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B2%E0%B8%A2%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%99%E0%B8%B2%E0%B8%A1%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%A1%E0%B8%AB%E0%B8%B2%E0%B8%81%E0%B8%A9%E0%B8%B1%E0%B8%95%E0%B8%A3%E0%B8%B4%E0%B8%A2%E0%B9%8C%E0%B8%A3%E0%B8%B2%E0%B8%8A%E0%B8%A7%E0%B8%87%E0%B8%A8%E0%B9%8C%E0%B8%A1%E0%B8%B9%E0%B8%AE%E0%B8%B1%E0%B8%A1%E0%B8%AB%E0%B8%A1%E0%B8%B1%E0%B8%94%E0%B8%AD%E0%B8%B2%E0%B8%A5%E0%B8%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Abbas_Helmy_Pasha_I.JPG","page_title":"รายพระนามพระมหากษัตริย์ราชวงศ์มูฮัมหมัดอาลี","context_page_description":"ราชวงศ์มูฮัมหมัดอาลีเป็นราชวงศ์ที่ปกครองประเทศอียิปต์ระหว่างปี ค.ศ. 1805-ค.ศ. 1953"},{"page_url":"https://jv.wikipedia.org/wiki/Gy%C3%B6rgy_Garics","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Gy%C3%B6rgy_Garics_Austria.jpg","page_title":"György Garics","context_page_description":"György Garics ya iku juru main bal-balan sing kewarganagaraané Austria kalairan Hongaria sing main kanggo klub Bologna, lan biyasa main ing posisi bèg.\\nGarics miwiti karir junioré ing klub Haladás VSE lan Rapid Vienna salanjuté miwiti karir senioré ing klub mau. Sempet pindah ing Napoli lan Atalanta, sadurungé gabung karo Bologna ing taun 2010."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8F%D5%B8%D6%82%D5%BC%D5%A2%D5%B8%D6%82%D5%B6%D5%A5%D5%A5%D5%B4%D5%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Painuva_kivi.JPG","page_title":"Տուռբունեեմե","context_page_description":"Տուռբունեեմե, գյուղ Էստոնիայի Հարյումաա նահանգի Կուուսալու շրջանում։\\n2011 թվականի տվյալներով գյուղում բնակվում էր 68 մարդ։"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%B1%DA%AF%D9%88_(%D9%81%DB%8C%D9%84%D9%85_%DB%B2%DB%B0%DB%B1%DB%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Ben_Affleck_2009.jpg","page_title":"آرگو (فیلم ۲۰۱۲)","context_page_description":"آرگو نام فیلمی سینمایی محصول کشور آمریکا به سال ۲۰۱۲ میلادی و ساختهٔ بن افلک است. داستان این فیلم دربارهٔ وقایع بحران گروگان‌گیری در سفارت ایالات متحده آمریکا در تهران است، که در آن، ۶ دیپلمات آمریکایی توانستند از منزل سفیر کانادا در تهران به خارج از ایران بگریزند. در این فیلم بازیگرانی چون بن افلک، آلن آرکین، برایان کرانستون و امید ابطحی به نقش‌آفرینی می‌پردازند. تهیه‌کنندگان این فیلم بن افلک، جرج کلونی و گرانت هسلو هستند.\\nآرگو نامزد هفت جایزهٔ مختلف در هشتاد و پنجمین دوره جوایز اسکار بود و در نهایت سه اسکار بهترین فیلم، بهترین فیلمنامهٔ اقتباسی و بهترین تدوین را کسب کرد. این نخستین‌بار از سال ۱۹۸۹ و برنده‌شدن رانندگی برای خانم دیزی بود که فیلمی بدون نامزدی برای عنوان بهترین کارگردانی، برندهٔ اسکار بهترین فیلم می‌شد. آرگو نامزد پنج جایزه گلدن گلوب شد که دو جایزه را از آن خود کرد؛ آرگو همچنین برنده جایزه بهترین فیلم از طرف انجمن تهیه کنندگان آمریکا شد. این فیلم با ۹۳٪ امتیاز بالایی را با رای کاربران سایت راتن تومیتوز به‌دست آورد. آرگو همچنین جایزه‌های بهترین فیلم، بهترین کارگردانی و تدوین را از مراسم بفتا به‌دست آورد."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B9%D9%84%D8%A7%D9%85%D9%87_%D8%A7%D8%B3%D8%AA%D9%81%D9%87%D8%A7%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Question_mark.svg","page_title":"علامه استفهام","context_page_description":"علامه استفهام, ده علامه رمزيه اللى بيرمز للسؤال او وبتحط فى نهايه جمله استفهاميه."},{"page_url":"https://it.wikipedia.org/wiki/Isalorhynchus_genovefae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Isalorhynchus_genovefae.jpg","page_title":"Isalorhynchus genovefae","context_page_description":"L’isalorinco è un rettile erbivoro estinto, appartenente ai rincosauri. Visse tra il Triassico medio e il Triassico superiore e i suoi resti fossili sono stati ritrovati in Madagascar."},{"page_url":"https://en.wikipedia.org/wiki/Platanus_occidentalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Sycamore_trunk_and_branches.JPG","page_title":"Platanus occidentalis","context_page_description":"Platanus occidentalis, also known as American sycamore, American planetree, western plane, occidental plane, buttonwood, and water beech, is a species of Platanus native to the eastern and central United States, the mountains of northeastern Mexico, extreme southern Ontario, and possibly extreme southern Quebec. It is usually called sycamore in North America, a name which can refer to other types of tree in other parts of the world.\\nThe species epithet occidentalis is Latin for \\"western\\", referring to the Western Hemisphere, because at the time when it was named by Carl Linnaeus, the only other species in the genus was P. orientalis, native to the Eastern Hemisphere."},{"page_url":"https://hu.wikipedia.org/wiki/Erwig_nyugati_g%C3%B3t_kir%C3%A1ly","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Erwig_tremissis_680_612197.jpg","page_title":"Erwig nyugati gót király","context_page_description":"Erwig, más írásmóddal Ervig nyugati gót király 680-tól 687-ig.\\nErurich Wamba megbuktatása után királlyá kenette, és a tizenkettedik toledói nemzetgyűlés által is elismertette magát. Ez a nemzetgyűlés enyhített a Wamba szigorú törvényein, tágította az egyházi menedékjogot, a megüresedő püspöki székek betöltését a toledói érsekre bízta s törvénnyé emelte Erwignek a zsidók ellen kibocsátott 28 rendeletét. E törvény vérengző dühvel szentesítette az üldözést és az eddigieknél jóval kegyetlenebb intézkedéseket tartalmazott. Megtiltotta a zsidóknak ünnepeik megtartását, szertartásaik gyakorlását s nem volt szabad fiaikat és szolgáikat a keresztelés alól kivonni.\\nA tehetetlen király alatt egy kikeresztelkedett zsidóból lett érsek, a toledói Julianus ragadta magához az uralmat s jobban dühöngött egykori rokonai ellen, mint maguk a született gótok.\\nKét évvel később ült egybe a tizenharmadik nemzetgyűlés, mely a királyságra nézve végzetes határozatokat hozott."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%96%B0%E7%AB%B9%E7%A5%9E%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Shinchiku_Jinja.jpg","page_title":"新竹神社","context_page_description":"新竹神社为台湾日治时期位于新竹市的神社，设立于1918年，社格属国币小社，为新竹州社格最大之神社。神社现址在台湾新竹市新竹市北区，战后成为内政部移民署新竹收容所直到2018年迁出。新竹神社许多建筑及构件仍存在，其于2001年被列为新竹市定古迹，目前计划修复中。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%27%D1%8F%D0%BD%D0%BE%D0%B2%D1%83%D0%B3%D1%96%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%BA%D0%BE%D0%BA%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Coke_Ovens_Abercwmboi.jpg","page_title":"Кам'яновугільний кокс","context_page_description":"Кокс кам'яновугільний — різновид коксу, твердий шпаристий грудкоподібний продукт коксування вугілля. Має сірий колір. Вміст вуглецю у вугіллі становить від 78-89 до 90-95 %, вміст вуглецю в кам'яновугільному коксі — 96-98 %. Зольність до 9-11 %. Вологість 0,5-4,0 %. Теплота згоряння 29-33 МДж/кг. Вихід кам'яновугільного коксу при коксуванні становить 75-78 %. Є бездимним паливом у металургії, при виплавці чавуну слугує також відновником залізної руди й розпушувачем шихти.\\nДоменний кам'яновугільний кокс повинен мати розмір грудок не менше 10 мм, ливарний кокс використовується для ливарного виробництва, вміст сірки у ньому не повинен перевищувати 1,2-1,3 %. Кокс для газогенераторних установок повинен мати тугоплавку золу.\\nВ Україні перший якісний кам'яновугільний кокс вперше було вироблено 1799 р., набагато раніше, ніж в багатьох інших країнах Європи. Його виготовили на вугільній копальні в Лисичому Байраку для потреб Луганського чавуноливарного заводу. Обсяг першої партії коксу склав 19 тис. пудів. Роботи проводились під керівництвом шотландських інженерів К. Гаскойна та А. Сміта."},{"page_url":"https://hu.wikipedia.org/wiki/Ralf_Rangnick","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/2019-03-30_Fu%C3%9Fball%2C_M%C3%A4nner%2C_1._Bundesliga%2C_RB_Leipzig_-_Hertha_BSC_StP_3875_LR10_by_Stepro.jpg","page_title":"Ralf Rangnick","context_page_description":"Ralf Rangnick német labdarúgó, a Red Bull cég sport- és futballfejlesztési részleg vezetője."},{"page_url":"https://eo.wikipedia.org/wiki/Reli%C5%9Do","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Sliced_red_chillis_in_soy.jpg","page_title":"Reliŝo","context_page_description":"Reliŝo estas dolĉa aŭ/kaj pikanta peklita saŭco, ĝenerale uzata kiel kondimento.\\nĜi povas esti glata aŭ kun pecetoj, dolĉa aŭ spica, akra aŭ milda.\\nOni faras ĝin el diversaj ethakitaj legomoj.\\nEn Kanado ĝi estas tre ŝatata kiel apetitiga rimedo.\\nVidu ankaŭ: Hendersona reliŝo"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%D9%8A%D9%88%D8%AA_%D8%A7%D9%84%D8%AF%D9%88%D9%84%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Wolfsburg7.jpg","page_title":"ماريوت الدولية","context_page_description":"ماريوت الدولية هي شركة ضيافة متنوعة أمريكية تدير مجموعة واسعة من الفنادق والمنتجعات والامتيازات وما يتصل بها من مرافق السكن. أسسها جون ويلارد ماريوت، وتقاد الشركة الآن من قبل ابنه، الرئيس التنفيذي بيل ماريوت والرئيس والمدير التنفيذي آرني سورنسون.\\nيقع مقرها الرئيسي فيبيثيسدا، في الولايات المتحدة الأمريكيةماريلاند، وتمتلك الشركة أكثر من 4087 فندق ومنشأة في أكثر من 80 دولة حول العالم، أكثر من 697000 غرفة بالإضافة ل 195000 غرفة تحت الإنشاء والتجهيز.\\nفي شهر حزيران عام 2014، ماريوت الدولية افتتحت الفندق رقم 4000، فندق ماريوت ماركيز في واشنطن العاصمة."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%B3%D8%AA%D9%88%D9%86_%D9%88%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/ImperialCollegeLondon.jpg","page_title":"آستون وب","context_page_description":"آستون وب یک معمار اهل بریتانیا بود.\\nوی همچنین برنده جوایزی همچون مدال طلای ای‌آی‌ای شده است."},{"page_url":"https://sv.wikipedia.org/wiki/Riksdagsvalet_i_Sverige_1982","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Ulf_Adelsohn_grayscale_1000x1221px.png","page_title":"Riksdagsvalet i Sverige 1982","context_page_description":"Riksdagsvalet i Sverige 1982 till Sveriges riksdag hölls den 19 september 1982. För första gången sedan 1976 fick Sverige en socialdemokratisk regering."},{"page_url":"https://fr.wikipedia.org/wiki/Limbe_(technologie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Heure_Soleil_entr%C3%A9e_dans_Cancer-toutes_infos.png","page_title":"Limbe (technologie)","context_page_description":"Un limbe est le bord gradué d'un cercle ou d'un secteur circulaire visible sur un astrolabe, un sextant, un graphomètre, etc. Dans le cas d'un astrolabe, il est gradué en heures et en degrés par quadrant et il permet de lire une valeur pointée par la règle."},{"page_url":"https://de.wikipedia.org/wiki/Dirk_W%C3%BCllbier","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Bundesarchiv_Bild_183-1990-0905-037%2C_HFC_Chemie_-_1._FC_Dynamo_Dresden_3-1.jpg","page_title":"Dirk Wüllbier","context_page_description":"Dirk Wüllbier ist ein ehemaliger deutscher Fußballspieler und heutiger -trainer."},{"page_url":"https://pl.wikipedia.org/wiki/AP-5","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/LZK_AP5_filmprojector.jpg","page_title":"AP-5","context_page_description":"AP-5 − kinowy projektor filmowy służący do projekcji na taśmie 35 mm, produkowany w latach 50. XX wieku przez Łódzkie Zakłady Kinotechniczne. Był to wówczas jeden z najpopularniejszych modeli wykorzystywanych w polskich kinach, na bazie jego konstrukcji powstały kolejne projektory produkowane w ŁZK.\\nProjektor przeznaczony był dla kin dysponujących salami do 1000 miejsc."},{"page_url":"https://ru.wikipedia.org/wiki/Psychic_TV","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Psychictv-cologne-2004.jpg","page_title":"Psychic TV","context_page_description":"Psychic TV — британская рок-группа, созданная Дженезисом Пи-Орриджем в 1982 году, после «прекращения миссии» группы Throbbing Gristle. Состав коллектива неоднократно менялся, за исключением Пи-Орриджа — ведущего вокалиста и автора текстов; в числе исполнителей, внесших вклад в деятельность группы в разные годы: Питер Кристоферсон, Алекс Фергюссон, Фред Джанелли, Ларри Трэшер и другие.\\nВ 1986 году группа начала издавать серию из 23-х концертных альбомов, но без объяснений прекратила издание, выпустив только 17. Десятый из них, обычно упоминаемый под названием «Album 10», можно было приобрести, только предоставив «опознавательные знаки», содержащиеся на предыдущих 9-ти альбомах. Группа впоследствии была занесена в «книгу Гиннесса» за наибольшее количество альбомов, выпущенных за один год.\\nОдновременно с возникновением группы был организован и «Храм психической юности». Предполагалось, что он станет «философским крылом» группы, а также будет выполнять функции фан-клуба группы, организованного наподобие культа. Пи-Орридж покинул его в 1991 г.\\nВ 1988 г. «Psychic TV» выпустили ранние альбомы эйсид-хаус-музыки в форме «фальшивых сборников», таких как «Jack The Tab» и «Tekno Acid Beat»."},{"page_url":"https://no.wikipedia.org/wiki/Dirk_Jan_de_Geer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Dirk_Jan_de_Geer.jpg","page_title":"Dirk Jan de Geer","context_page_description":"Dirk Jan de Geer var nederlandsk minister-president i to perioder, 1926 – 1929 og 1939 – 1940.\\nHan tilhørte det nederlandske partiet Christelijk-Historische Unie. Han ledet to regjeringer, Kabinet-De Geer I og II."},{"page_url":"https://ru.wikipedia.org/wiki/Static-X","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/KoichiFukuda.jpg","page_title":"Static-X","context_page_description":"Static-X — американская метал-группа из Лос-Анджелеса, Калифорния, игравшая преимущественно в стиле индастриал-метал с элементами ню-метала. Static-X была сформирована в 1994 году после распада Deep Blue Dream, прежней группы Уэйна Статика и Кена Джея. Они решили создать новую группу, но после безуспешных поисков музыкантов в Чикаго, Статик и Джей направились в Лос-Анджелес, где к ним присоединились Тони Кампос и Коити Фукуда. Окончательно формирование группы было завершено в 1998 году, когда Static-X подписали контракт с Warner Bros Records и приступили к записи своего дебютного альбома Wisconsin Death Trip, который стал платиновым в США. После записи альбома Start a War группа сменила лейбл на Reprise Records.\\nВ 2010-м группу покидает басист Тони Кампос, а Уэйн Статик объявляет, что Static-X находится в «замороженном состоянии». После этого Уэйн занимался своим сольным проектом. 4 октября 2011 года на лейбле Dirthouse Records он выпустил свой дебютный альбом Pighammer. Релиз занял 97 позицию в чарте Billboard 200, разойдясь в количестве 4,700 копий за первую неделю продаж."},{"page_url":"https://ceb.wikipedia.org/wiki/Sovodenj","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Postcard_of_Sovodenj_%283%29.jpg","page_title":"Sovodenj","context_page_description":"Lungsod ang Sovodenj sa Esklobeniya. Nahimutang ni sa munisipyo sa Gorenja Vas-Poljane, sa kasadpang bahin sa nasod, 40 km sa kasadpan sa Ljubljana ang ulohan sa nasod. 703 metros ibabaw sa dagat kahaboga ang nahimutangan sa Sovodenj, ug adunay 166 ka molupyo.\\nAng yuta palibot sa Sovodenj kay kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,015 ka metro ug 2.3 km sa amihanan-sidlakan sa Sovodenj. Dunay mga 24 ka tawo kada kilometro kwadrado sa palibot sa Sovodenj medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Idrija, 9.3 km sa habagatan sa Sovodenj. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Sovodenj. Sa rehiyon palibot sa Sovodenj, kabukiran talagsaon komon.\\nAng klima boreal. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 19 °C, ug ang kinabugnawan Disyembre, sa -4 °C. Ang kasarangang pag-ulan 2,160 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 318 milimetro nga ulan, ug ang kinaugahan Marso, sa 119 milimetro."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9F%E0%AF%81%E0%AE%B5%E0%AF%88%E0%AE%9F%E0%AF%8D_%E0%AE%9F%E0%AE%BF._%E0%AE%90%E0%AE%9A%E0%AE%A9%E0%AE%BE%E0%AE%B5%E0%AE%B0%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Dwight_D._Eisenhower%2C_official_photo_portrait%2C_May_29%2C_1959.jpg","page_title":"டுவைட் டி. ஐசனாவர்","context_page_description":"டுவைட் டேவிட் ஐசனாவர் 1953 முதல் 1961 வரை ஐக்கிய அமெரிக்காவின் 34ஆவது குடியரசுத் தலைவராக இருந்தார். இரண்டாம் உலகப் போரில் நட்பு அணி இராணுவத்தின் சிறந்த தலைவர் ஆவார். தலைவராக இருக்கும்பொழுது இவர் கொரியப் போரை நிறுத்தினார். இடைமாநில நெடுஞ்சாலை முறையும் அமெரிக்காவின் விண்வெளி திட்டமும் இவராலேயே தொடங்கப்பட்டன."},{"page_url":"https://no.wikipedia.org/wiki/Hjuldamper","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Maid_of_the_Loch_side.JPG","page_title":"Hjuldamper","context_page_description":"Hjuldamper er et skip med dampmaskin som driver skovlhjul som sørger for fremdriften. Hjulbåten representerte første fase i overgangen fra seilbåter til båter med motor. De første propeller for drift av skip ble først utviklet i 1836.\\nSkovlhjulene er fortrinnvis plassert ett på hver side da dette gir best manøvreringsegenskaper. Ulempen er at brygger og gangveier må tilpasses spesielt. Alternativt ble skovlhjulet plassert akterut. Dette var vanlig blant annet på elvebåter. Hjuldampere var spesielt vanlige å bruke på Mississippi eller Missouri i USA ettersom disse elvene var for grunne til at man kunne seile med vanlige båter.\\nI 1819 var DS «Savannah», det første dampskipet som krysset Atlanterhavet, i Arendal. «Savannah» var en hjuldamper med skovler på sidene og seilføring. Norges første dampskip DS «Constitutionen» og DS «Prinds Carl» var hjulbåter. De ble satt i trafikk i 1827. Norske DS «Skibladner» er verdens eldste operative hjuldamper i rutegående trafikk. Skibladner ble bygget i 1856 og går fortsatt i sommertrafikk på Mjøsa."},{"page_url":"https://nl.wikipedia.org/wiki/Slot_Linderhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Linderhof_Venusgrotte.JPG","page_title":"Slot Linderhof","context_page_description":"Slot Linderhof is een barokslot in het Graswangtal in Ettal bij Oberammergau, in de Duitse deelstaat Beieren. Het is het kleinste van de drie kastelen gebouwd in opdracht van Lodewijk II van Beieren en het enige dat vóór diens dood werd voltooid. Het kasteeltje ligt op 948 meter boven de zeespiegel. Linderhof was voor Lodewijk II zijn lievelingsverblijf, dat hij steevast \\"Mein Villa\\" noemde."},{"page_url":"https://de.wikipedia.org/wiki/Verkehr_in_Hemer","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Hemer-Schild%2C_Radweg1.JPG","page_title":"Verkehr in Hemer","context_page_description":"Der Verkehr in Hemer ist nur noch auf den Straßenverkehr beschränkt. Hemer ist dabei an Autobahnen, Bundes- und Landesstraßen angeschlossen. Vom Schienenverkehr wurde die Stadt nach der Aufgabe der Strecke nach Menden 1987 endgültig abgebunden. Den öffentlichen Personen-Nahverkehr organisiert die für den gesamten Märkischen Kreis zuständige Märkische Verkehrsgesellschaft."},{"page_url":"https://nl.wikipedia.org/wiki/Cruzeiro_do_Sul_(Acre)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/Catedral_de_Nossa_Senhora_da_Gl%C3%B3ria.jpg","page_title":"Cruzeiro do Sul (Acre)","context_page_description":"Cruzeiro do Sul is een gemeente in de Braziliaanse deelstaat Acre. De gemeente telt 82.622 inwoners.\\nCruzeiro do Sul beschikt over een luchthaven, Aeroporto Internacional de Cruzeiro do Sul, die ongeveer 10 km ten westen van de stad ligt."},{"page_url":"https://eo.wikipedia.org/wiki/Kizilkumo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Seidenstrasse_GMT_Ausschnitt_Zentralasien.jpg","page_title":"Kizilkumo","context_page_description":"Kizilkumo estas gruzo- kaj sablo-dezerto situanta plejparte en la centra malaltejo de Turano. Ĝi vastas ĉirkaŭ 298.000 km² kaj apartenas al la ŝtatoj Turkmenio, Uzbekio kaj Kazaĥio. En 1932 respektive 1936 Kazaĥio cedis grandan parton de Kizilkumo, nome la regionon de Navoji, al Uzbekio.\\nKizilkumo estas limigita en la nordo per rivero Sirdarjo, en sudokcidento de Amudarjo. Trans Amudarjo situas Karakumo, dezerto eĉ pli vasta ol Kizilkumo.\\nAntaŭ 60 milionoj da jaroj okazis faltiĝo de la altegaj montaroj Himalajo, Tianŝano kaj Pamiro. La estiĝantaj montaroj forbaris la maran regionon de Kizilkumo kaj Karakumo for de la monda oceano, proceso kiu daŭris ĉirkaŭ 25 milionojn da jaroj.\\nResursoj: tergaso, oro.\\nKizilkumo estas dezerto kun variaj pejzaĝoj. Multloke la ebenaĵoj estas kovritaj per gruzo kaj per la fajna ruĝa salo, kiu donis la nomon al Kizilkumo."},{"page_url":"https://br.wikipedia.org/wiki/Paul%C3%ADnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Infra_Jos%C3%A9_Paulino.jpg","page_title":"Paulínia","context_page_description":"Paulínia, zo unan eus kêrioù stad São Paulo e gevred Brazil. 118 km eus kêr São Paulo, ar gêr-benn. Tost da 83 544 a dud a oa enni e 2008."},{"page_url":"https://nl.wikipedia.org/wiki/Bosbrand_in_V%C3%A4stmanland_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/P%C3%A9lican_32_G%C3%A9rard_JOYON_PROT_CANADAIR_2006.jpg","page_title":"Bosbrand in Västmanland 2014","context_page_description":"De bosbrand in Västmanland was een bosbrand in het Mid-Zweedse landschap Västmanland. Hij ontstond op 31 juli 2014 in het noordoostelijke deel van de gemeente Surahammar, nabij de grens met de gemeente Sala. Het was de grootste bosbrand in Zweden sinds de jaren 1950. Dertienduizend hectare bos ging in vlammen op en er waren ongeveer vijfentwintig afgebrande of door brand beschadigde gebouwen. Bij de brand viel één dode. De brandbestrijdingsoperatie, waarvoor gedurende enkele dagen hulp werd verkregen van Franse en Italiaanse blusvliegtuigen, duurde tot 11 september."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A2%D8%B1%D8%B3%DA%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Coat_of_Arms_of_Arsk_%28Tatarstan%29.png","page_title":"آرسک","context_page_description":"آرسک روسیه اؤلکه‌سینده یئر آلان بیر شهردیر و تاتارستانندا یئرلَشیب. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا 18114 نفر دیر."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%84%DA%A9%D9%87_%D8%AA%D8%A7%D9%85%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Queen_Tamara_of_Georgia.jpg","page_title":"ملکه تامار","context_page_description":"تامار بعدا به عنوان تامار کبیر و تامار مقدس شناخته می شود به عنوان ملکه‌ای از سلسله باگراتیونی‌ها از سال ۱۱۷۸ تا ۱۲۱۳ میلادی بر پادشاهی متحد گرجستان حکومت کرد. دوران سلطنت او دورهٔ اوج اعتلا و برتری فرهنگ و تمدن گرجی، اوج پیشروف اقتصادی، موفقیت سیاسی، پیروزی نظامی در مناطق خاوری و قفقاز و آسایش و امنیت اجتماعی و مردمی و افزایش قدرت پادشاهی گرجستان که منجر به یکپارچگی و عصر طلایی تاریخ گرجستان بود می شود. جایگاه او به عنوان بالاترین و برجسته ترین مقام زن در حکومت گرجستان و حق مطلق و الهی حاکمیت او با لقب «پادشاه» در منابع تاریخی قرون وسطی تأیید شده‌است.\\nتامار فرزند گیورگی سوم، پادشاه گرجستان بود که در سال ۱۱۷۸ از سوی پدرش به عنوان حاکم گرجستان در کنار حکومت پدر اعلام شد. اما پس از مرگ گیورگی و به قدرت رسیدن مطلق تامار، او با مخالفت‌هایی از سوی طبقهٔ اشراف گرجستان با صعود به قدرت های کامل حاکم مواجه شد. تامار در برطرف کردن این مخالفت‌ها موفق بود و قدرت‌های خود را در مقابل تمام اشراف خودسر زیاد کرد و انها را زیر نظر گرفته و کنترل می کرد، همچنین او از قدرت و نفوذ بزرگان ارتش و کشوری بسیار کاست و پس از آن در روابط خارجی خود نیز سیاست‌هایی را دنبال کرد که موجب کاستن از خصومت و قدرت ترکان سلجوقی در آناتولی شد."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B1%9F%E8%A5%BF%E7%9C%81%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Ji%27an_Donggu_2018.05.14_09-31-08.jpg","page_title":"江西省文物保护单位","context_page_description":"江西省文物保护单位是江西省人民政府依照《江西省文物保护管理办法》批准的江西省省级文物保护单位。\\n目前已公布六批。\\n第一批：1957年7月公布\\n第二批：1959年11月公布\\n第三批：1987年12月公布\\n第四批：2000年7月公布，共48处\\n第五批：2006年12月18日公布，共121处：\\n古遗址：6处；\\n古墓葬：6处；\\n古建筑：66处；\\n石窟寺及石刻：5处；\\n近现代重要史迹及代表性建筑：35处；\\n其他：3处。\\n另与已有保护单位合并的项目：3处。\\n第六批：2018年3月9号公布，共684处。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Gro%C3%9Fsteingr%C3%A4ber_in_Schweden","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Stora_Kungsd%C3%B6sen_i_%C3%96stra_Torp_-_sensommar.jpg","page_title":"Liste der Großsteingräber in Schweden","context_page_description":"Die Liste der Großsteingräber in Schweden umfasst alle bekannten Großsteingräber auf dem Staatsgebiet Schwedens."},{"page_url":"https://ro.wikipedia.org/wiki/Bexley,_New_South_Wales","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/BexleyShops.jpg","page_title":"Bexley, New South Wales","context_page_description":"Bexley este o suburbie în Sydney, Australia."},{"page_url":"https://de.wikipedia.org/wiki/Schule_f%C3%BCr_Holzbildhauerei","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Schule_f%C3%BCr_Holzbildhauerei_Brienz.jpg","page_title":"Schule für Holzbildhauerei","context_page_description":"Die Schule für Holzbildhauerei ist in Brienz im Berner Oberland angesiedelt. Sie wurde 1884 als Schnitzlerschule Brienz gegründet und ist die einzige Ausbildungsstätte für Schnitzen bzw. Holz-Bildhauerei in der Schweiz. Die Brienzer Holzschnitzerei gehört zu den lebendigen Traditionen in der Schweiz."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D8%A7%D8%AC%D8%B1_%D9%81%D8%B1%D8%A7%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Portrait_of_Edith_Sitwell.jpg","page_title":"راجر فرای","context_page_description":"راجر الیوت فرای، نقاش، استاد دانشگاه کمبریج، عضو بلومزبری گروپ، و منتقد هنری اهل انگلستان بود."},{"page_url":"https://sk.wikipedia.org/wiki/Milan_%C4%8Corba","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Corba_2011a.JPG","page_title":"Milan Čorba","context_page_description":"Milan Čorba bol slovenský kostýmový výtvarník, scénograf a pedagóg. Vytvoril stovky kostýmových návrhov pre divadlo a film.\\nOd roku 1984 pôsobil v Slovenskom národnom divadle. Spolupracoval aj s Národním divadlom Brno a Národním divadlom moravskoslezským v Ostrave.\\nPôsobil ako pedagóg, dekan Divadelnej fakulty a rektor Vysokej školy múzických umení v Bratislave."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D9%88%D9%86%D8%AA%D8%A7%DB%8C%D9%86_%D8%AA%D8%A7%D9%BE%D8%8C_%D9%BE%D9%86%D8%B3%DB%8C%D9%84%D9%88%D8%A7%D9%86%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Blue_Giant_Meadow_Lake_2.JPG","page_title":"مونتاین تاپ، پنسیلوانیا","context_page_description":"مونتاین تاپ، پنسیلوانیا آمریکا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۱۰۹۸۲ نفر ایمیش و ۳۹ کیلومتر موربّع ساحه‌سی وار و پنسیلوانیا ایالتینده یئرلشیب."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B7%D0%BC%D0%B0%D0%B9%D0%BF%D0%B0%D1%80%D0%B0%D1%88%D0%B2%D0%B8%D0%BB%D0%B8,_%D0%97%D1%83%D1%80%D0%B0%D0%B1_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Zurab_Azmaiparashvili_2015_Wien.JPG","page_title":"Азмайпарашвили, Зураб Алексеевич","context_page_description":"Зураб Алексеевич Азмайпарашвили — грузинский, ранее советский, шахматист, гроссмейстер. Чемпион Европы. Заслуженный тренер ФИДЕ.\\nЧемпион СССР среди юношей. В составе команды СССР чемпион мира среди молодёжи.\\nЧлен символического клуба победителей чемпионов мира Михаила Чигорина с 8 апреля 1983 г.\\nВ 2014 году избран президентом Европейского шахматного союза. В июле 2017 года заявил, что будет баллотироваться в президенты ФИДЕ в 2018 году в Батуми, так как Кирсана Илюмжинова руководство ФИДЕ не поддержит из-за санкций, которые мешают работе организации."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BC%D0%B5%D0%BE%D0%BD_%D0%94%D0%B6%D1%83%D0%B3%D0%B0%D1%94%D1%86%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Simeon_Jughayetsi_%282%29.jpg","page_title":"Симеон Джугаєці","context_page_description":"Симеон Джугаєці — вірменський філософ, богослов, мовознавець, педагог і громадський діяч XVII століття."},{"page_url":"https://en.wikipedia.org/wiki/Kith_Meng","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Kith_Meng.jpg","page_title":"Kith Meng","context_page_description":"Kith Meng is a Cambodian businessman. He is the Chairman and CEO of The Royal Group which counts among its many holdings 45% of J Trust Royal Bank, the mobile phone operator Cellcard/CamGSM and 100% of Royal Railways. Meng also owns 100% stake in Cambodia's leading television and telecommunications networks CBS, Hydro Power Lower Sesan 2, a 400MW plant, Chailease Royal Leasing and Chailease Royal Finance in partnership with Chailease of Taiwan, Cambodian Broadcasting Corporation and CamGSM. Meng is known for his preferences for entering Cambodian companies into joint ventures including international companies."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%92%99%E7%89%B9%E5%88%A9%E5%B0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Montreal_-_Palais_des_Congr%C3%A8s_-_20050330.jpg","page_title":"蒙特利尔","context_page_description":"蒙特婁，又稱滿地可或蒙特利爾，是魁北克省內最大城市、加拿大第二大城市及北美第十五大城市。「蒙特婁」一詞來源於中古法語「Mont Royal」，意思為「皇家山」，至今蒙特婁城中心的地標皇家山仍以此命名。法語是蒙特婁的官方語言，也是城市裡最常用的語言，使用人口占城市總人口的60.5%，使得蒙特婁成為世界上的第三大法語城市，僅次於金夏沙和巴黎。英語也被廣泛的使用。\\n蒙特婁曾經是加拿大經濟首都，擁有最多的人口及最發達的經濟，但是在1976年蒙特婁奧運會後被安大略省的多倫多超過。今天蒙特婁仍然是加拿大最重要的經濟中心之一，航空工業、金融、設計、電影工業等行業發達。蒙特婁被認為是世界最佳宜居城市，並被聯合國教育、科學及文化組織認定為設計之城。1999年第35屆國際技能競賽在這裡舉行。"},{"page_url":"https://nl.wikipedia.org/wiki/Feyenoord_in_het_seizoen_2016/17","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Rotterdam%2C_caf%C3%A9_Barclay_aan_de_Karel_Doormanstraat_-_Feyenoord_scoort_1-0_in_de_kampioenswedstrijd_IMG_6754_2017-05-14_14.29.jpg","page_title":"Feyenoord in het seizoen 2016/17","context_page_description":"Dit is een pagina met diverse statistieken van voetbalclub Feyenoord in het seizoen 2016/17."},{"page_url":"https://hu.wikipedia.org/wiki/TER_Haute-Normandie","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Gare_de_Sotteville-l%C3%A8s-Rouen.JPG","page_title":"TER Haute-Normandie","context_page_description":"A TER Haute-Normandie egy regionális vasúthálózat Franciaországban, a Felső-Normandia régióban."},{"page_url":"https://hr.wikipedia.org/wiki/Jan_Henryk_D%C4%85browski","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Jan_Henryk_D%C4%85browski_1.PNG","page_title":"Jan Henryk Dąbrowski","context_page_description":"Jan Henryk Dąbrowski - poljski general i nacionalni heroj."},{"page_url":"https://et.wikipedia.org/wiki/Aberdeen_FC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Aberdeen%2C_Pittodrie_Stadium_-_geograph.org.uk_-_598024.jpg","page_title":"Aberdeen FC","context_page_description":"Aberdeen F.C. on Šotimaal Aberdeenis asuv jalgpalliklubi.\\nKlubi asutati 1903, kui ühinesid kolm kohalikku klubi Aberdeen F.C., Victoria United ja Orion F.C.. Esimese hooaja mängis Aberdeen Šotimaa Põhjaliigas, misjärel valiti 1904 Šotimaa jalgpalliliiga teise divisjoni ning hoolimata seal saavutatud 7. kohast valiti ta 1905 Šoti liiga esimesse divisjoni. Sellest ajast on Aberdeen igal hooajal mänginud Šotimaa kõrgeimas liigas ning üksnes Glasgow Celtic ja Glasgow Rangers on suutnud sedasama. Rangers läks 2012 pankrotti.\\nAberdeen on Šotimaa edukamaid meeskondi, tulnud 4 korda Šotimaa meistriks ja võitnud 7 Šotimaa karikat.\\nAberdeen on ainus Šotimaa meeskond, kes on võitnud kaks Euroopa trofeed, mõlemad samal aastal: Euroopa karikavõtjate karika ja Euroopa superkarika. Sel ajal, nimelt 1978–1986 oli Aberdeeni peatreener Alex Ferguson.\\nKuigi Aberdeen on viimane klubi väljaspool Glasgow'd, kes tulnud Šotimaa meistriks, ei ole ta pärast 1995. aastat, mil võideti Šotimaa liiga karikas, enam ühtki karikat võitnud. 21. sajandil ei ole Aberdeen kordagi isegi karikafinaalidesse jõudnud, viimati osales ta 2000 nii Šotimaa karikavõistluste kui liiga karika finaalis, kaotades mõlemad."},{"page_url":"https://la.wikipedia.org/wiki/Yi_Iongae","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/LeeYoungAe_2006.3.18-2.jpg","page_title":"Yi Iongae","context_page_description":"Yi Iongae est actrix Coreana."},{"page_url":"https://fr.wikipedia.org/wiki/500_miles_d%27Indianapolis_1997","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Indy500winningcar1997.JPG","page_title":"500 miles d'Indianapolis 1997","context_page_description":"Les 500 miles d'Indianapolis 1997, courus sur l'Indianapolis Motor Speedway les lundi 26 et mardi 27 mai 1997, ont été remportés par le pilote néerlandais Arie Luyendyk sur une G-Force-Aurora."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D1%80%D0%B4%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%BE%D0%BD%D0%BD%D0%B5%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Laerdalstunnelen.jpg","page_title":"Лердальский тоннель","context_page_description":"Лердальский тоннель — автомобильный тоннель, связывающий муниципалитеты Лердал и Эурланн норвежской губернии Согн-ог-Фьюране, расположенной в западной части Норвегии. Тоннель является частью европейской автомобильной дороги E16 между Осло и Бергеном.\\nДлина тоннеля составляет 24,5 километра. Его сооружение началось в 1995 году и в 2000 году было завершено. Тоннель стал самым длинным автомобильным тоннелем в мире, превзойдя Готардский автомобильный тоннель на 8 километров. Горы, сквозь которые проходит тоннель, достигают высоты 1600 метров.\\nОсобенностью конструкции тоннеля является наличие в нём трёх значительных по размерам искусственных пещер, расположенных на приблизительно равном расстоянии друг от друга и делящих, таким образом, тоннель на четыре примерно одинаковые по длине секции. Это сделано с целью снятия у водителей напряжения, возникающего при длительном движении в однообразных условиях, а также для того, чтобы дать им возможность отдохнуть."},{"page_url":"https://de.wikipedia.org/wiki/Abu_Sa%27id_(Timuride)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Abu_Said_seated_on_a_throne.png","page_title":"Abu Sa'id (Timuride)","context_page_description":"Abu Sa'id war ein timuridischer Herrscher, der von 1451 bis 1469 regierte.\\nNach der Ermordung des timuridischen Herrschers Abd al-Latifs im Mai 1450 kämpften mehrere Thronanwärter gegeneinander. In Buchara wurde Abu Sa'id zum Herrscher ausgerufen und konnte sich mit Hilfe des usbekischen Herrschers Abu'l-Chair gegen seinen ebenfalls timuridischen Rivalen Abdallah in Transoxanien durchsetzen. In Herat setzte sich Abu l-Qasim Babur ibn Baisonqur ibn Schah Ruch fest, nachdem er seinen Bruder Muhammad besiegt hatte. Beide hatten noch mit anderen Rivalen zu rechnen, sodass sie sich nach einem Vorstoß auf Balch und einem Gegenangriff auf Samarqand 1454 auf eine gemeinsame Grenze am Amudarja einigten.\\nEbenso waren die regelmäßigen Angriffe des Usbeken-Khans Abu'l-Chair unerfreulich, insbesondere als dieser 1454/55 einen rebellierenden Prinzen namens Uwais unterstützte.\\nNach dem Tod Abu l-Qasim Baburs 1457 kam es zu Wirren, die Dschahan Schah, Fürst der turkmenischen Qara Qoyunlu, nutzte, um im Juni 1458 Herat zu besetzen, bis ihn eine Revolte zur Umkehr zwang. Abu Said konnte im darauffolgenden Jahr diese Stadt erobern und verlagerte seinen Regierungssitz dorthin."},{"page_url":"https://pt.wikipedia.org/wiki/Trono_de_armas_de_Mo%C3%A7ambique","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Throne_of_Weapons%2C_British_Museum.jpg","page_title":"Trono de armas de Moçambique","context_page_description":"O Trono de Armas é uma escultura criada em 2002 por Cristóvão Canhavato a partir de armas não usadas. Pertence hoje ao Museu Britânico, sendo considerada o \\"mais eloquente objeto\\" do museu e exibida das mais diversas maneiras."},{"page_url":"https://it.wikipedia.org/wiki/Cratere_L._Clark","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Normal_l-clark_LROC.jpg","page_title":"Cratere L. Clark","context_page_description":"L. Clark è un cratere lunare di 15,3 km situato nella parte sud-orientale della faccia nascosta della Luna."},{"page_url":"https://fi.wikipedia.org/wiki/Philip_Massinger","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Philip_Massinger.jpg","page_title":"Philip Massinger","context_page_description":"Philip Massinger oli englantilainen näytelmäkirjailija, huomattavimpia Shakespearen nuorempia aikalaisia. Hän opiskeli Oxfordin yliopistossa ja vaikutti sitten Lontoossa näyttelijänä ja näytelmien kirjoittajana tukalissa oloissa.\\nMassinger kirjoitti enemmän Ben Jonsonia kuin Shakespearea seuraten runsaasti näytelmiä, joista useimmat yhteistyössä muiden kanssa. Niistä merkittävimpiä ovat marttyyridraama The virgin martyr, historiallinen näytelmä The great duke of Florence, The city madam ja porvarillinen huvinäytelmä A new way to pay old debts. Massingerin näytelmien luonteet ovat yksipuolisia, mutta taiteellisen vakavasti hahmoteltuja. Hän ei edusta Shakespearen jälkeisessä draamatuotannossa vallitsevaa ammattimaisuutta."},{"page_url":"https://it.wikipedia.org/wiki/Trasportatore_del_glucosio","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Beta-D-Glucose.svg","page_title":"Trasportatore del glucosio","context_page_description":"I trasportatori del glucosio sono un insieme di proteine di membrana che consentono il passaggio del glucosio attraverso la membrana plasmatica."},{"page_url":"https://en.wikipedia.org/wiki/Ruth_Elder","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Elder%2C_Ruth.jpg","page_title":"Ruth Elder","context_page_description":"Ruth Elder was an aviation pioneer and actress. She carried private pilot certificate P675, and was known as the \\"Miss America of Aviation.\\" She was a charter member of the Ninety-Nines.\\nIn 1927 she took off from New York in the airplane American Girl, George Haldeman as her pilot, in an attempt to become the first woman transatlantic airplane rider. Mechanical problems caused them to ditch the plane 360 miles from land, but they established a new over-water endurance flight record of 2,623 miles. It was also at the time the longest flight ever made by a woman. She and George were honored with a ticker-tape parade upon their return.\\nAfter her flight, she embarked on a series of lucrative speaking engagements and was given a movie contract. She starred in Moran of the Marines and The Winged Horseman.\\nIn 1929 she entered the first Women's Air Derby, flying in her Swallow, NC8730, and placed fifth.\\nShe married six times. She married Walter Camp, Jr., son of the early football innovator, on August 29, 1929, but filed for divorce in Reno, Nevada, on November 14, 1932. Her final union was with Ralph P. King, to whom she was married for 21 years and who outlived her."},{"page_url":"https://en.wikipedia.org/wiki/Jason_Rich","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Jason_Rich.jpg","page_title":"Jason Rich","context_page_description":"Jason Rich is a retired American professional basketball player. Standing at 1.91 m, Rich played as a guard. He played collegiately for Florida State, until 2008."},{"page_url":"https://ko.wikipedia.org/wiki/C-17_%EA%B8%80%EB%A1%9C%EB%B8%8C%EB%A7%88%EC%8A%A4%ED%84%B0III","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Medevac_mission%2C_Balad_Air_Base%2C_Iraq.jpg","page_title":"C-17 글로브마스터III","context_page_description":"C-17 글로브마스터 III는 1980년대에서 1990년대 초에 걸쳐 보잉 에서 개발된 265톤의 장거리 대형 전략 수송기이다. 미국 공군의 최대인 418톤 록히드 C-5 갤럭시 수송기와 함께 265톤 C-17은 미군의 국제적인 장거리 전략 수송 임무를 수행한다.\\nC-74 글로브마스터 또는 C-124 글로브마스터 II 라고도 불렸었다.\\n2008년, 보잉은 대한민국에 4대를 수출하려고 했었다."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CF%81%CF%87%CE%B1%CE%AF%CE%BF_%CE%B5%CE%BB%CE%BB%CE%B7%CE%BD%CE%B9%CE%BA%CF%8C_%CE%B8%CE%AD%CE%B1%CF%84%CF%81%CE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/2007-05-10_Epidauros%2C_Greece_5.jpg","page_title":"Αρχαίο ελληνικό θέατρο","context_page_description":"Το αρχαίο ελληνικό θέατρο, θεσμός της αρχαιοελληνικής πόλης-κράτους, διδασκαλία και τέλεση θεατρικών παραστάσεων, επ' ευκαιρία των εορτασμών του Διονύσου, αναπτύχθηκε στα τέλη της αρχαϊκής περιόδου και διαμορφώθηκε πλήρως κατά την κλασική περίοδο -κυρίως στην Αθήνα. Φέρει έναν έντονο θρησκευτικό και μυστηριακό χαρακτήρα κατά τη διαδικασία της γέννησής του, αλλά και έναν εξίσου έντονο κοινωνικό και πολιτικό χαρακτήρα κατά την περίοδο της ανάπτυξής του."},{"page_url":"https://en.wikipedia.org/wiki/Chebyshev_filter","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Cauer_Topology_Lowpass_Filter.svg","page_title":"Chebyshev filter","context_page_description":"Chebyshev filters are analog or digital filters having a steeper roll-off than Butterworth filters, and have passband ripple or stopband ripple. Chebyshev filters have the property that they minimize the error between the idealized and the actual filter characteristic over the range of the filter, but with ripples in the passband.\\nThis type of filter is named after Pafnuty Chebyshev because its mathematical characteristics are derived from Chebyshev polynomials.\\nThe type I Chebyshev filters are called usually as just \\"Chebyshev filters\\", the type II ones are usually called \\"inverse Chebyshev filters\\".\\nBecause of the passband ripple inherent in Chebyshev filters, the ones that have a smoother response in the passband but a more irregular response in the stopband are preferred for some applications\\n."},{"page_url":"https://es.wikipedia.org/wiki/Colonizaci%C3%B3n_de_la_selva_central","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Ashaninka_people_-_Minist%C3%A9rio_da_Cultura_-_Acre%2C_AC_%2858%29.jpg","page_title":"Colonización de la selva central","context_page_description":"La Colonización de la selva central también conocido como colonización del Perú meridional fue un proceso largo y sangriento que comenzó con las primeras tribus seguidas por el periodo incaico, colonial, y la actual época republicana, todos con el objetivo de reclamar para sí la selva central."},{"page_url":"https://it.wikipedia.org/wiki/Ascensidonio_Spacca","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Ascensidonio_Spacca_-Madonna_di_Costantinopoli.JPG","page_title":"Ascensidonio Spacca","context_page_description":"Ascensidonio Spacca detto Il Fantino è stato un pittore italiano.\\nCome seguace di Dono Doni, fu operante nel suo paese natale, oltre a prestare la sua opera nelle piccole città limitrofe come Montefalco, Trevi, Bettona, Spello, Gualdo Cattaneo.\\nLe sue opere possono essere definite di tardo manierismo, con chiari caratteri devozionali che nella realtà riflettevano i dettami della propaganda religiosa del dopo concilio di Trento. Tra le più note possiamo citare senz'altro la Pietà del 1596, opera esposta a Bevagna, il Processo del Beato Andrea di Spello del 1630 e gli affreschi presenti nel chiostro del convento di San Martino in Trevi.\\nChiamato \\"Il Fantino\\" per la sua bassa ed esile statura."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_de_Nuevo_Mundo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Metro_de_Madrid_-_Nuevo_Mundo_01.jpg","page_title":"Estación de Nuevo Mundo","context_page_description":"Nuevo Mundo es una estación de la línea ML-3 del Metro Ligero Oeste situada en la avenida homónima de Boadilla del Monte. Abrió al público el 27 de julio de 2007.​​\\nSu tarifa corresponde a la zona B2 según el Consorcio Regional de Transportes.​"},{"page_url":"https://nl.wikipedia.org/wiki/Retonfey","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Map_commune_FR_insee_code_57575.png","page_title":"Retonfey","context_page_description":"Retonfey is een gemeente in het Franse departement Moselle in de regio Grand Est en telt 895 inwoners."},{"page_url":"https://tr.wikipedia.org/wiki/Worcester_Kolej,_Oxford","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/UK-2014-Oxford-Worcester_College_02.jpg","page_title":"Worcester Kolej, Oxford","context_page_description":"Worcester College Oxford Üniversitesi'nin kolejlerinden bir tanesidir. Kolej bir Worcestershire baroneti olan Sir Thomas Cookes'un bağışıyla 1714 yılında kurulmuştur. Kolejin bir önceki ismi olan Gloucester Kolej aynı mekânda 13. yüzyıl sonundan itibaren, 1539'da manastırların feshedilmesine kadar eğitim vermeyi sürdürmüştür.\\nTemmuz 2010 itibarıyla Worcester'ın mal varlığı 16,7 milyon £'dur.\\nKolejin ünlü mezunları arasında medya patronu Rupert Murdoch, TV yapımcısı ve senarist Russell T Davies, ABD Yüce Mahkemesi üyesi Elena Kagan, aktris Emma Watson ve romancı Richard Adams bulunur."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%9A%D0%92_CCIR","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Nikkei_Radio.jpg","page_title":"УКВ CCIR","context_page_description":"Участок УКВ-радиодиапазона с частотами от 87,5 МГц до 108,0 МГц, и от 75,0 до 90,0 МГц.\\nПод влиянием интернациональной культуры, в обиходе называется по виду модуляции радиосигнала, который в радиовещании используется только на УКВ, «FM-диапазоном». В современных радиоприёмниках называется УКВ-2. Расширенным FM-диапазоном называют диапазон в радиоприёмнике, который включает в себя вместе и УКВ OIRT, и УКВ CCIR. В приёмниках немецкого производства УКВ диапазон обозначается UKW.\\nОтличия диапазонов УКВ CCIR и УКВ OIRT не только в полосе занимаемых ими частот, но и в технических параметрах излучаемого сигнала — полосе частот, отводимой для одной радиостанции, принципе кодирования стереосигнала, возможности подмешивания сигнала RDS: в УКВ OIRT невозможно использование системы радиопейджинга RDS совместно с системой полярной модуляции.\\nЧастоты для УКВ-радиовещания выделялись внутри телевизионных диапазонов, в частотном «окне» между телевизионными каналами, которые в CCIR и OIRT изначально отличались. На выбор частот для радиовещания, кроме того, повлияло желание сделать невозможным прослушивание зарубежных передач в пограничных зонах."},{"page_url":"https://lt.wikipedia.org/wiki/Vytautas_Norkus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Vytautas_Norkus.JPG","page_title":"Vytautas Norkus","context_page_description":"Vytautas Petras Norkus – Lietuvos krepšininkas, lengvaatletis, Europos čempionas."},{"page_url":"https://en.wikipedia.org/wiki/Immovable_Cultural_Monuments_of_National_Significance","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/John_the_Baptist_Church%2C_Akhatani_1.jpg","page_title":"Immovable Cultural Monuments of National Significance","context_page_description":"The Immovable Cultural Monuments of National Significance are buildings, structures, sites, or places in Georgia that have been determined to have nationwide cultural significance by meeting special criteria developed by the Ministry of Culture and are subject to preservation by the state.\\nThe monument must have an outstanding artistic or aesthetic value, be associated with a particularly important historical event, person, or overall national values.\\nThe original list of the Immovable Monuments of Cultural Heritage was approved in the Presidential decree No. 665 of 7 November 2006. Since then, it has been updated several times. After the amendments of 2013, the monument can be defined as having national significance by the resolution of the Government of Georgia based on the submission of the Ministry of Culture."},{"page_url":"https://fr.wikipedia.org/wiki/Flottage_du_bois","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Log-Drivers-1963.jpg","page_title":"Flottage du bois","context_page_description":"Le flottage du bois est un mode de transport par voie d'eau pour des pièces de bois de tailles variables, à l'état brut ou déjà débitées, assemblées entre elles ou pas. Influencé par les caractéristiques typographiques, hydrographiques, culturelles et climatiques de chaque région du monde, il prend des formes différentes et très variées en fonction des essences d'arbres des grandes zones forestières de la planète, mais surtout de la présence ou du degré de flottabilité du cours d'eau qui est aux abords des massifs forestiers où sont abattus les arbres.\\nTous ces facteurs variables engendrent une activité extrêmement localisée, très marquée par le mode de vie des populations autochtones, ce qui se manifeste d'abord par un vocabulaire pratiquement toujours régional. Des zones blanches côtoient des aires d'extension du flottage très actives dans de nombreux pays du monde. Le noyau géographique du flottage est l'Eurasie tout entière. De là, il a été exporté par les colons vers l'Amérique, l'Afrique et l'Océanie. En dehors de l'Amérique du Nord, il reste néanmoins très marginal voire très localisé dans ces trois continents."},{"page_url":"https://et.wikipedia.org/wiki/Dollar","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/United_States_one_dollar_bill%2C_obverse.jpg","page_title":"Dollar","context_page_description":"Dollariks nimetatakse mitme riigi, sõltkonna ja muu piirkonna rahaühikut. Dollarimärk on \\"$\\".\\nUSA dollar on maailma levinuim valuuta."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%B5%D1%80%D1%88%D0%BD%D1%96_(%D0%A2%D0%B8%D0%B2%D1%80%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/%D0%A8%D0%B5%D1%80%D1%88%D0%BD%D1%96_%D0%A8%D0%BA%D0%BE%D0%BB%D0%B0.jpg","page_title":"Шершні (Тиврівський район)","context_page_description":"Ше́ршні — село в Тиврівському районі Вінницької області. Населення — 901 особа."},{"page_url":"https://it.wikipedia.org/wiki/Storia_dei_Chicago_Bears","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Matt_Forte_Brandon_Marshall_Alshon_Jeffery_2014.jpg","page_title":"Storia dei Chicago Bears","context_page_description":"I Chicago Bears sono un club di football americano professionistico nato nel 1920 come membro fondatore della National Football League con sede a Chicago, Illinois, USA. Questa voce approfondisce la storia della franchigia dalla fondazione ad oggi."},{"page_url":"https://sv.wikipedia.org/wiki/Tarascon,_Bouches-du-Rh%C3%B4ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Tarascon-chateau-roi-rene.jpg","page_title":"Tarascon, Bouches-du-Rhône","context_page_description":"Tarascon är en kommun i departementet Bouches-du-Rhône i regionen Provence-Alpes-Côte d'Azur i sydöstra Frankrike. Kommunen ligger i kantonen Tarascon som ligger i arrondissementet Arles. År 2009 hade Tarascon 13 152 invånare.\\nTarascon bildar tillsammans med den jämnstora orten Beaucaire, som ligger på motsatt sida floden, ett storstadsområde med 28 000 invånare."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%A8%D8%A7%D9%88%D9%8A%D8%B7%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Bahariya-oasis.jpg","page_title":"الباويطي","context_page_description":"الباويطي عاصمة الواحات البحرية التابعة لمحافظة الجيزة بجمهورية مصر العربية، سكانها 30 ألف نسمة."},{"page_url":"https://ro.wikipedia.org/wiki/Albertina,_Minas_Gerais","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Albertinamgbrasoes.jpg","page_title":"Albertina, Minas Gerais","context_page_description":"Albertina este un oraș din unitatea federativă Minas Gerais, Brazilia."},{"page_url":"https://hr.wikipedia.org/wiki/Demagnetizacija","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/RMS_Queen_Mary_20Jun1945_NewYork.jpeg","page_title":"Demagnetizacija","context_page_description":"Demagnetizacija je uklanjanje magnetizma. Izvodi se tako da se materijal podvrgava magnetskomu polju, počevši od snažnoga magnetskoga polja, postupnim slabljenjem sve do nulte vrijednosti. Koristi se za brisanje podataka s magnetskih medija. Demagnetizacija broda naziva se degausacija."},{"page_url":"https://pt.wikipedia.org/wiki/Cultura_de_Hong_Kong","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/HK_YamPak_SinFungMing_Opera_costume_ChowSaiHin_60326.jpg","page_title":"Cultura de Hong Kong","context_page_description":"A cultura de Hong Kong pode ser descrita como um conjunto de práticas que começou na China e então se inclinou ao Ocidente no século XX. Mesmo após a transferência de soberania à China continental em 1997, Hong Kong ainda tem uma identidade própria."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%DB%8C%D9%86%D8%A7%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Wappen_Linau.png","page_title":"لیناو","context_page_description":"لیناو یک شهر در آلمان است که در هرتسوگتوم لاونبورگ واقع شده‌است.\\nلیناو ۱٬۱۷۲ نفر جمعیت دارد."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8C%97%E6%B4%8B%E5%86%9B%E9%98%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Chine_de_1917_%C3%A0_1920-zh.png","page_title":"北洋军阀","context_page_description":"北洋军阀，是中华民国早期最重要的民国军阀势力之一，由袁世凯培植的北洋新军的主要将领组成，袁世凯执掌政权后，袁世凯的“北洋新军”的主要将领雄霸一方，在1916年袁世凯死后，因无人具有足够能力统领整个北洋军队及政权，从而导致各领导人以所据地方割据，导致分裂，以军队为主要力量在各地建立势力范围。北洋军阀在名义上仍接受北京政府的支配。但北京政权实际上就是由北洋军阀中不同派系的实力较强军阀或军阀集团所控制，在紧张时期各派人马的抢夺下，导致北京政府对各地的军阀势力的实际控制比较薄弱，形成了实际上军阀割据的局面。故而在北洋军阀时期北京政府又有北洋军阀政府的称呼。也就在事实上造成北洋军阀通常仍有北洋政府颁发的正式官衔，如都督、巡阅使、经略使、镇守使或军政长官等。"},{"page_url":"https://ceb.wikipedia.org/wiki/Amphiuridae","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Amphipholis_squamata.jpg","page_title":"Amphiuridae","context_page_description":"Pamilya sa mga bakaybakay ang Amphiuridae. Ang Amphiuridae sakop sa kahanay nga Ophiurida, klase nga bakaybakay, ka-ulo nga mananap nga adunay panit ang tunokon, ug kaginharian nga mananap. Ang kabanay nga Amphiuridae adunay 507 nga espesye, segun sa Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Valley_Parade","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Valley_Parade_1990s.jpg","page_title":"Valley Parade","context_page_description":"Valley Parade est un stade de football localisé à Bradford. C'est l'enceinte du club de Bradford City Association Football Club."},{"page_url":"https://fr.wikipedia.org/wiki/Observatoires_du_Mauna_Kea","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/The_Keck_Subaru_and_Infrared_obervatories.JPG","page_title":"Observatoires du Mauna Kea","context_page_description":"Les observatoires du Mauna Kea sont un ensemble d'observatoires astronomiques indépendants, comptant les télescopes parmi les plus grands et les plus puissants du monde et situés au sommet du volcan Mauna Kea sur l'île d'Hawaï. Ils couvrent une zone de 2 km² connu sous le nom anglophone de astronomy Precinct - enceinte d'astronomie dans la réserve scientifique de Mauna Kea."},{"page_url":"https://en.wikipedia.org/wiki/Sylvia_Dubois","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/CWLarisonOrthography.png","page_title":"Sylvia Dubois","context_page_description":"Sylvia Dubois, also spelled as Silvia Dubois or Sylvie Dubois, was an African-American woman born into slavery who became free after striking her slave mistress. After gaining her freedom, Dubois moved to New Jersey where she lived with her children until her death. A physician by the name of C.W. Larison decided to document the life of Dubois and her journey to freedom in the book Silvia Dubois A Biografy of the Slav who Whipt Her Mistres and Gand Her Fredom."},{"page_url":"https://ro.wikipedia.org/wiki/Hardware","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Personal_computer%2C_exploded_6.svg","page_title":"Hardware","context_page_description":"Hardware-ul este partea fizică a unui sistem informatic, constituită din ansamblul de componente electrice, electronice și mecanice care împreună pot primi, prelucra, stoca și reda informații, sub diverse forme de semnale electrice, acustice sau optice, spre deosebire de software, care este partea logică — cea care comandă hardware-ul prin intermediul unor programe — și de datele asupra cărora operează respectivul sistem de calcul.\\nTermenul este un cuvânt englez care se pronunță aproximativ hard-uer și se traduce uzual cu echipament solid sau și cu articole de fierărie.\\nHardware este ansamblul elementelor fizice și tehnice cu ajutorul cărora datele se pot culege, verifica, prelucra, transmite, afișa și stoca, apoi suporturile de memorare a datelor, precum și echipamentele de calculator auxiliare — practic, toate componentele de calculatoare și rețele de calculatoare concrete, tangibile."},{"page_url":"https://simple.wikipedia.org/wiki/Craps","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Craps.jpg","page_title":"Craps","context_page_description":"Craps is a game that uses dice. It is a game of chance. Players make bets on the outcome of the roll. Players can bet other players or the casino. Players may wage money against each other or a bank. Because it requires little equipment, \\"street craps\\" can be played in informal settings. It is also very popular in the internet to play."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9A%E0%B5%86%E0%B4%B1%E0%B5%81%E0%B4%B8%E0%B5%82%E0%B4%B0%E0%B5%8D%E0%B4%AF%E0%B4%95%E0%B4%BE%E0%B4%A8%E0%B5%8D%E0%B4%A4%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Chinese_Wedelia_flower.jpg","page_title":"ചെറുസൂര്യകാന്തി","context_page_description":"സൂര്യകാന്തി ഉൾപ്പെടുന്ന അസ്റ്റെറെസിയെ കുടുംബത്തിൽപ്പെട്ട ഒരു ഏക വാർഷിക സസ്യമാണ് ചെറുസൂര്യകാന്തി. വെഡേലിയ ചൈനൻസിസ് എന്നാണ് സസ്യശാസ്ത്ര നാമം. ഇവ സൂര്യകാന്തികളെപ്പോലെ നിവർന്നുവളരാതെ നിലത്തു പടർന്ന് വളരുന്നു. അതിദ്രുതം വളരുന്ന ഇവ ചിലപ്പോൾ മറ്റു ചെടികളെ വളരാനനുവദിക്കാതെ, ഒരു പ്രദേശമാകെ പടർന്നു വളരുന്നു. കാണാൻ ഭംഗിയുള്ള മഞ്ഞനിറമുള്ള പൂക്കൾക്കു സാമാന്യം വലിപ്പമുണ്ട്."},{"page_url":"https://fr.wikipedia.org/wiki/Arabinosyl-nucl%C3%A9oside","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Clevudine_Formulae.png","page_title":"Arabinosyl-nucléoside","context_page_description":"Un arabinosyl-nucléoside est un analogue structurel de nucléoside dans lequel l'ose est le β-D-arabinofuranose à la place du β-D-ribofuranose.\\nCi-dessous sont représentés quelques exemples d'arabinosyl-nucléosides comparés à leur nucléoside correspondant :\\nIls sont généralement utilisés comme cytostatiques et antiviraux. D'autres exemples et dérivés sont représentés ci-dessous :"},{"page_url":"https://en.wikipedia.org/wiki/J._R._Tosh","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Himantura_toshi_csiro-nfc.jpg","page_title":"J. R. Tosh","context_page_description":"Dr James Ramsay Tosh FRSE was a 19th/20th century Scottish canal engineer and marine biologist. He gives his name to the Brown Whipray Himantura Toshi also known as Tosh's Whipray."},{"page_url":"https://pl.wikipedia.org/wiki/Loles_Le%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Loles_Le%C3%B3n._%2821635491842%29_%28cropped%29.jpg","page_title":"Loles León","context_page_description":"Maria Dolores León Rodríguez, Loles León – hiszpańska aktorka filmowa i telewizyjna. Jedna z najbardziej znanych aktorek Pedra Almodóvara."},{"page_url":"https://de.wikipedia.org/wiki/Stilm%C3%B6bel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Wiki_Wangenstuhl_Zeichg_um_1870_Anton_Spilker.jpg","page_title":"Stilmöbel","context_page_description":"Der Begriff Stilmöbel bezeichnet ein Möbel, bei dem zum Zeitpunkt der Herstellung ein früherer Möbelstil nachgebildet wurde. Entsprechend lautet die Definition für das Stilmöbel im Duden: „als Imitation eines früheren Stils hergestelltes Möbelstück“. Die Worterklärung vom DWDS [Wortauskunftssystem zur deutschen Sprache] fügt die zeitliche Dimension hinzu: „Möbel aus dem 19. oder 20. Jahrhundert, das in einem früheren Kunststil hergestellt worden sind [sic]“.\\nStilperioden erhalten gewöhnlich erst in ihrer letzten Phase oder nach dem Ende eine Bezeichnung, die in der Folge Bestand hat. So wurde der Begriff „Stilmöbel“ erst zu Beginn des 20. Jahrhunderts bekannt und wird seitdem zur Abgrenzung von anderen Möbeltypen benutzt. Das Diagramm des DWDS über die Worthäufigkeit zeigt, dass das Wort „Stilmöbel“ erst nach 1900 – etwa zur Zeit des Ersten Weltkrieges – aufkam und sich danach verbreitete, bis es um 1980 seinen Höhepunkt erreicht hatte und danach seltener wurde."},{"page_url":"https://de.wikipedia.org/wiki/Chartreuse_(Gebirge)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/La_Grande_Chartreuse_2005-10-28.jpg","page_title":"Chartreuse (Gebirge)","context_page_description":"Die Chartreuse ist ein voralpines Gebirgsmassiv aus Kalkstein in den nördlichen französischen Alpen. Das Massiv, dessen höchster Gipfel die Chamechaude mit einer Höhe von 2082 m ist, liegt in den Départements Savoie und Isère. Es wird geografisch den Chaînes Subalpines Septentrionales und geologisch den Französischen Kalkalpen zugeordnet. Das recht dünn besiedelte Berggebiet steht unter Naturschutz.\\nIn einem abgelegenen Seitental des Guiers-Mort gründete Bruno von Köln 1084 das Kloster Grande Chartreuse. Es ist das Mutterkloster des Kartäuserordens."},{"page_url":"https://en.wikipedia.org/wiki/Shushtar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/ShushtarMAP.jpg","page_title":"Shushtar","context_page_description":"Shushtar is a city and capital of Shushtar County, Khuzestan Province, Iran.\\nShushtar is an ancient fortress city, approximately 92 kilometres away from Ahvaz, the centre of the province. Much of its past agricultural productivity derives from the irrigation system which centered on the Band-e Kaisar, the first dam bridge in Iran. The Mayor of Shushtar is Ahmad Asefi."},{"page_url":"https://en.wikipedia.org/wiki/German_night_fighter_direction_vessel_Togo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/1948_Svalbard_-_bow.jpg","page_title":"German night fighter direction vessel Togo","context_page_description":"MS Togo was a German merchant ship that was launched in 1938. Requisitioned by Nazi Germany's Kriegsmarine as Schiff 14, in April 1940 she participated in the invasion of Norway; in August 1940 was converted to a minelayer as part of the German plan to invade England; then from June 1941 she began conversion to the armed auxiliary cruiser HSK Coronel.\\nFollowing Coronel's unsuccessful attempt in February 1943 to become the last German commerce raider of World War II, she was then used as a minesweeper before being recommissioned in late 1943 as NJL Togo, a night fighter direction vessel, operating in the Baltic Sea.\\nAs NJL Togo, she was the second of the Kriegsmarine's World War II radar ships, and the only one to survive the war.\\nAfter the war, Togo passed through various changes of ownership, name and function before finally being wrecked off the Mexican coast in 1984."},{"page_url":"https://eu.wikipedia.org/wiki/T%C3%A1bhairne_Leo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Tabhairne_Leo_%2895482813%29.jpg","page_title":"Tábhairne Leo","context_page_description":"Tábhairne Leo Irlandako Donegalgo konderriaren ipar-mendebaldean dagoen Croithlí herriko jatetxe eta taberna bat da. Taberna honek bai Donegalgo konderrian nahiz Irlandan osoan folk eta irlandar musika herrikoiaren zaletuen artean ospe handia du, bertan gauero folk musika emanaldiak izan ohi direlarik. Gaeltacht eramuan kokatua dago, hots, irlandera hiztunen eremuan.\\nTaberna hau Brennan familia, Clannad, Enya eta Moya Brennan musikari ospetsuekin estuki lotua dago, 1968an Leo Brennan-ek ireki baizuen, eta gaur egun Bartley Brennan bertako jabea baita. Musikari hauek taberna honetan hauek maiz zuzeneko emanaldiak eskeini ohi dituzte."},{"page_url":"https://cs.wikipedia.org/wiki/%C4%8Cesk%C3%A9_m%C3%ADstodr%C5%BEitelstv%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Praha%2C_Mala_Strana_-_Snemovni_1_%28vstupni_portal%29.jpg","page_title":"České místodržitelství","context_page_description":"České místodržitelství, respektive místodržitelství Království českého bylo nejvyšším orgánem státní správy na území Českého království v letech 1850–1918."},{"page_url":"https://pl.wikipedia.org/wiki/Derbyshire_Constabulary","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/England_-_Derbushire_Constabulary_%28bell%29_%286421763319%29.jpg","page_title":"Derbyshire Constabulary","context_page_description":"Derbyshire Constabulary – brytyjska formacja policyjna, pełniąca funkcję policji terytorialnej na obszarze hrabstwa ceremonialnego Derbyshire. Według stanu na 31 marca 2012, służba liczy 1819 funkcjonariuszy."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B3%D0%BB%D0%B0%D0%B2_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2_%D0%B2_2015_%D0%B3%D0%BE%D0%B4%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Rada_Krajowa_Platformy_Obywatelskiej_RP%2C_Warszawa_%286.02.2015%29_%2815836909753%29_%28cropped%29.jpg","page_title":"Список глав государств в 2015 году","context_page_description":"Rulers.org"},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%88%A9%E9%9D%9E%E4%BB%96%E6%98%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Lefetamine3d.png","page_title":"利非他明","context_page_description":"利非他明，是一種兼具興奮劑和鎮痛劑功效的精神類藥物。它在20世紀40年代間被發明出來，20世紀50年代後在日本被大規模使用。"},{"page_url":"https://pl.wikipedia.org/wiki/Pole_position","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Pole_position.svg","page_title":"Pole position","context_page_description":"Pole position – termin sportowy oznaczający pierwszą pozycję startową w szeregu wszystkich startujących w wyścigu, używany w sportach motorowych. Kolejność startowa zawodników najczęściej jest wyłaniana poprzez kwalifikacje, w czasie których kierowca próbuje osiągnąć jak najlepszy czas, zwycięzca kwalifikacji zajmuje pole position w wyścigu głównym.\\nNazwa pole position pochodzi z wyścigów konnych, w których najlepszy zawodnik startował przy wewnętrznej stronie owalu bieżni, pole środkowe było oddzielone od bieżni prostym płotem."},{"page_url":"https://eo.wikipedia.org/wiki/Kastelo_Engers","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Engers%2C_Schloss_Engers_von_Osten.jpg","page_title":"Kastelo Engers","context_page_description":"La kastelo Engers situas tuj ĉe la Rejno en Engers, urboparto de Neuwied en la germana federacia lando Rejnlando-Palatinato. La Trevira ĉefepiskopo kaj pricelektisto Johann Philipp von Walderdorff konstruigis la kastelon inter 1759 kaj 1764 kiel ĉaskastelo, plezurkastelo kaj somerrezidejo laŭ planoj de Johannes Seiz."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%A8%E0%A5%87%E0%A4%AA%E0%A4%BE%E0%A4%B2%E0%A4%95%E0%A4%BE_%E0%A4%AA%E0%A5%8D%E0%A4%B0%E0%A4%BE%E0%A4%95%E0%A5%83%E0%A4%A4%E0%A4%BF%E0%A4%95_%E0%A4%B8%E0%A4%AE%E0%A5%8D%E0%A4%AA%E0%A4%A6%E0%A4%BE%E0%A4%B9%E0%A4%B0%E0%A5%82%E0%A4%95%E0%A5%8B_%E0%A4%B8%E0%A5%82%E0%A4%9A%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/South_Face_of_Annapurna_I_%28Main%29.jpg","page_title":"नेपालका प्राकृतिक सम्पदाहरूको सूची","context_page_description":"नेपालका प्राकृतिक सम्पदाहरू अन्तर्गत हिमाल, नदी, ताल, झरना, राष्ट्रिय निकुञ्ज, वन्यजन्तु आरक्ष, खोला तथा वनजङ्गल रहेको छ ।\\nनेपालको प्राकृतिक सम्पदाको संरक्षण र संवर्द्धनका लागि राष्ट्रिय प्राकृतिक संरक्षण कोष २०३९ निर्माण गरी लागू गरिएको छ ।"},{"page_url":"https://ms.wikipedia.org/wiki/Cinco_de_Mayo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/BattleofPuebla2.jpg","page_title":"Cinco de Mayo","context_page_description":"Cinco de Mayo ialah hari perayaan untuk meraikan kemenangan tidak disangka-sangka tentera Mexico menentang tentera Perancis dalam Pertempuran Puebla pada 5 Mei 1862, di bawah kepimpinan Jeneral Ignacio Zaragoza Seguín. Ia bukan perayaan rasmi, tetapi sambutannya tertumpu di negeri Puebla, Mexico dan di Amerika Syarikat."},{"page_url":"https://en.wikipedia.org/wiki/Eliad_Nachum","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Shlomi_Shabat_%26_Eliad_Nachum_%281%29.jpg","page_title":"Eliad Nachum","context_page_description":"Eliad Nachum, known professionally by his first name Eliad is an Israeli singer, songwriter and television actor."},{"page_url":"https://da.wikipedia.org/wiki/Mazda_Lantis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Mazda_Lantis.jpg","page_title":"Mazda Lantis","context_page_description":"Mazda Lantis var en bilmodel fra Mazda. Modellen blev i Europa solgt som Mazda 323F.\\nModellen var bygget på samme platform som Mazda 323 og havde som standardudstyr el-justerbare sidespejle, servostyring, centrallåsesystem og el-ruder.\\nMotorprogrammet omfattede 4-cylindrede benzinmotorer på 1,5 og 1,8 liter med 88 hhv. 114 hk og en 6-cylindret benzinmotor på 2,0 liter med 144 hk."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A7%E3%82%A4%E3%82%B9%E3%83%86%E3%82%A3%E3%83%83%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/HOTAS_Cougar_Throttle_%287973432740%29.jpg","page_title":"ジョイスティック","context_page_description":"ジョイスティックは、スティックを傾けることで方向入力が行える入力機器の総称。航空機などの機械への入力機器として利用されるほか、コンピュータへの入力機器としても使用される。"},{"page_url":"https://eo.wikipedia.org/wiki/Kalia_fluoroacetato","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Potassium_chloroacetate.png","page_title":"Kalia fluoroacetato","context_page_description":"Kalia fluoroacetato estas kalia organika salo de la fluoroacetata acido, blanka senodora substanco tre toksa kaj uzata kiel pesticido, raticido, nature trovata en plantoj aŭ sinteze produktitaj en laboratorioj. Kalia unufluoroacetato estis izolita en la foliaro de la Dichapetalum cymosum, sudafrika planto, kaj estis la unua konata specimeno de nature okazanta organika fluorido.\\nLa planto, loke konata kiel \\"Gifblaar\\" kaŭzis la mortojn de multaj bovoj kaj estis agnoskita de Eŭropanoj kiel venenohava ĉirkaŭ 1890. Ekde tiam, fluoroacetataj kombinaĵoj estis izolitaj ekde venenaj plantoj en Aŭstralio, Brazilo"},{"page_url":"https://es.wikipedia.org/wiki/Nadezhda_Kr%C3%BApskaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/18951200-lenin-karteikarte-ochrana.jpg","page_title":"Nadezhda Krúpskaya","context_page_description":"Nadezhda Konstantínovna Krúpskaya, más conocida como Nadia Krúpskaya, fue una reconocida figura del Partido Comunista de la Unión Soviética y una de las principales responsables de la creación del sistema educativo soviético y pionera del desarrollo de las bibliotecas rusas. Su esposo fue el revolucionario bolchevique Vladímir Ilich Uliánov, Lenin.\\nNacida en San Petersburgo en el seno de una familia noble empobrecida, su madre era institutriz y su padre, oficial del Ejército con inclinaciones políticas radicales. A pesar de la penuria económica que sufrió la familia al fallecer su padre en 1883, logró completar su educación en un prestigioso gimnasio femenino de la capital rusa. Permaneció como profesora en esta institución hasta 1891. Convertida al marxismo a comienzos de la década, ingresó en el Grupo para la Lucha por la Emancipación de la Clase Obrera, donde conoció a Lenin en 1894. Detenida en agosto de 1896 como otros miembros de este, en 1897 aceptó cumplir su condena de exilio interior junto a Lenin en Siberia, para lo que tuvo que casarse con él por imposición de las autoridades rusas."},{"page_url":"https://tr.wikipedia.org/wiki/Ayd%C4%B1nc%C4%B1k,_Mersin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Aydincik.jpg","page_title":"Aydıncık, Mersin","context_page_description":"Aydıncık, Mersin ilinin bir ilçesidir."},{"page_url":"https://fr.wikipedia.org/wiki/The_Last_Summer","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Maia_Mitchell_at_Sundance_2018.jpg","page_title":"The Last Summer","context_page_description":"The Last Summer est une comédie romantique américaine sortie en 2019, réalisée par William Bindley à partir d'un scénario qu'il a coécrit avec Scott Bindley. Le film met en vedette K.J. Apa, Jacob Latimore, Maia Mitchell et Tyler Posey.\\nIl a été publié le 3 mai 2019 par la plateforme Netflix."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1962/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Dudovich.JPG","page_title":"Lijst van personen overleden in 1962/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 1962.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%B8%E6%85%B6%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/%E4%BC%B8%E6%85%B6%E5%AE%AE%E6%AD%A3%E9%9D%A2%E7%85%A7.jpg","page_title":"伸慶宮","context_page_description":"伸慶宮，又名張玉姑廟，是位於臺灣彰化縣伸港鄉溪底村的姑娘廟，香火在1950年代末到1960年代初盛行一時。"},{"page_url":"https://en.wikipedia.org/wiki/Revolt_of_the_Languedoc_winegrowers","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Jardins_Fontaine_N%C3%AEmes_1907.jpg","page_title":"Revolt of the Languedoc winegrowers","context_page_description":"The Revolt of the Languedoc winegrowers was a mass movement in 1907 in Languedoc and the Pyrénées-Orientales of France that was repressed by the government of Georges Clemenceau.\\nIt was caused by a serious crisis in winemaking at the start of the 20th century.\\nThe movement was also called the \\"paupers revolt\\" of the Midi.\\nIt was marked by the fraternization of the 17th line infantry regiment with the demonstrators in Béziers."},{"page_url":"https://vec.wikipedia.org/wiki/Isola","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Isola_village_-_mairie.jpg","page_title":"Isola","context_page_description":"Isola el xé on comun de 681 abitanti del departemento de Alpe Maritime che el fa parte del rejon Provensa-Alpe-Costa Axura in Fransa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D1%84%D0%BE%D1%80%D0%BC%D0%B0_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B9_%D0%B0%D1%80%D0%BC%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8B1943-45.png","page_title":"Военная форма Советской армии","context_page_description":"Военная форма Советской Армии — предметы форменной одежды и снаряжения военнослужащих Советской Армии, а также Правила их ношения в период с 1918 по 1991 г., установленные высшими правительственными органами для личного состава Советской Армии.\\nСтатья 1. Право ношения военной формы одежды имеют военнослужащие, состоящие на действительной военной службе в Советской Армии и Военно-Морском Флоте, суворовцы, нахимовцы, воспитанники военно-музыкальных училищ, учащиеся специальных школ-интернатов и военные строители, а также маршалы, генералы, офицеры, прапорщики и мичманы, состоящие в запасе или отставке с правом ношения военной формы одежды.\\n— ПРИЛОЖЕНИЕ № 1 к приказу Министра обороны СССР 1988 г. № 250."},{"page_url":"https://fr.wikipedia.org/wiki/Lhor","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Lhor_l%27%C3%A9glise_Saint-Pierre-aux-Liens.JPG","page_title":"Lhor","context_page_description":"Lhor est une commune française située dans le département de la Moselle en région Grand Est."},{"page_url":"https://ca.wikipedia.org/wiki/Noel_Molina_Tejedor","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Noel_Molina.jpg","page_title":"Noel Molina Tejedor","context_page_description":"Noel Molina Tejedor és un compositor, autor i productor musical.\\nPertany a la família Molina, saga familiar de diferents generacions d'artistes. És fill del cantant Antonio Molina, germà de l'actriu Ángela Molina i de la cantant Mónica Molina, així com oncle de l'actriu Olivia Molina. Inicia la seva marxa professional com a compositor, autor i productor musical amb la publicació de l'àlbum de debut de la seva germana Mónica que té un gran acolliment per part del públic i de la crítica arribant a ser Disc d'Or.\\nDesprés de la publicació del segon àlbum de l'artista, en el qual de nou n'exerceix com a compositor i productor l'èxit es confirma amb l'obtenció d'un Disc de Platí i les nominacions als Grammy Llatins del 2002 a Los Angeles com a millor disc d'interpretació femenina i als Premis de la Música a Espanya com a artista revelació.\\nA partir d'aquest moment se succeeixen les publicacions de diferents treballs com a compositor, autor i productor musical per a diversos artistes de primera línia de l'escena musical espanyola, alternant aquests amb enregistraments per a la televisió i les arts escèniques."},{"page_url":"https://sh.wikipedia.org/wiki/Aaron_Sorkin","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Aaron_Sorkin_at_the_Oxford_Union_1.jpg","page_title":"Aaron Sorkin","context_page_description":"Aaron Benjamin Sorkin je američki scenarist, producent i pisac kazališnih komada čiji radovi uključuju filmove kao što su Malo dobrih ljudi, Američki predsjednik, Društvena mreža i Igra pobjednika kao i televizijske serije Zapadno krilo, Sports Night i Studio 60 na Sunset Stripu.\\nNakon što je diplomirao na Sveučilištu Syracuse 1983. godine, Sorkin je većinu 80-tih godina prošlog stoljeća proveo u New Yorku kao glumac koji se pokušava probiti. Ipak, svoju strast pronašao je u pisanju kazališnih komada i vrlo brzo postao jedan od obećavajućih autora. Njegova predstava Malo dobrih ljudi zainteresirala je holivudskog producenta Davida Browna koji je otkupio prava na filmsku ekranizaciju prije nego što je predstava uopće doživjela svoju premijeru na kazališnim daskama.\\nProducentska kuća Castle Rock Entertainment zaposlila je Sorkina za adaptaciju kazališnog komada Malo dobrih ljudi u dugometražni film. Režirao ga je Rob Reiner, a sam film postao je box-office uspjeh. Sorkin je rane 90-te godine prošlog stoljeća proveo pišući još dva scenarija za Castle Rock: Malice i Američki predsjednik. Sredinom 90-tih radio je kao konzultant na scenariju za film Bulworth."},{"page_url":"https://ms.wikipedia.org/wiki/Tibet","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Yarlong_Tsangpo.jpg","page_title":"Tibet","context_page_description":"Tibet ialah sebuah kawasan penara di Asia Tengah dan petempatan asli bagi orang Tibet. Dengan ketinggian purata sebanyak 4,900 meter, Tibet merupakan rantau yang tertinggi di Bumi dan sering bergelar \\"Bumbung Dunia.\\"\\nKini, Tibet dikuasai Republik Rakyat China. Sebagai sebuah mandat eksklusif, Tibet juga secara rasminya dituntut Republik China. Dalam perdebatan kedaulatan Tibet, kerajaan Republik Rakyat China dan Kerajaan Tibet Dalam Buangan tidak bersepakat mengenai bila Tibet menjadi sebahagian China, dan sama ada penggabungannya dengan China ini sah mengikut undang-undang antarabangsa.\\nRaja Songtsän Gampo menyatukan berbilang bahagian di rantau ini pada abad ke-7. Sejak awal 1600-an, Dalai Lama yang sering dikenali sebagai pemimpin kerohanian rantau ini, dipercayai merupakan kedatangan Avalokiteśvara, iaitu bodhisattva belas kasihan.\\nSejak abad ke-17 hingga tahun 1959, Dalai Lama dan pemangku-pemangku mereka merupakan kuasa politik utama yang menguasai hal keagamaan dan pentadbiran Tibet dari pusat kerajaan tradisinya Lhasa, yang dianggap sebagai bandaraya paling suci di Tibet."},{"page_url":"https://it.wikipedia.org/wiki/RMS_Titanic","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Titanic_launched_at_Belfast.jpg","page_title":"RMS Titanic","context_page_description":"L'RMS Titanic è stato un transatlantico britannico della classe Olympic naufragato nelle prime ore del 15 aprile 1912, durante il suo viaggio inaugurale, a causa della collisione con un iceberg avvenuta nella notte.\\nSecondo di un trio di transatlantici, il Titanic, assieme ai suoi due gemelli RMS Olympic e HMHS Britannic, era stato progettato per offrire un collegamento settimanale di linea con l'America e garantire il dominio delle rotte oceaniche alla White Star Line. Costruito presso i cantieri Harland and Wolff di Belfast, il Titanic rappresentava la massima espressione della tecnologia navale del tempo ed era il più grande e lussuoso transatlantico del mondo.\\nDurante il suo viaggio inaugurale, entrò in collisione con un iceberg alle 23:40 di domenica 14 aprile 1912. L'impatto con l'iceberg provocò l'apertura di alcune falle sotto la linea di galleggiamento, allagando i primi 5 compartimenti stagni del transatlantico, che 2 ore e 40 minuti più tardi provocarono l'inabissamento della nave, facendola spezzare in due tronconi."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%9C%E0%A4%BE%E0%A4%AE%E0%A4%A4%E0%A4%BE%E0%A4%A1%E0%A4%BC%E0%A4%BE_%E0%A4%9C%E0%A4%BF%E0%A4%B2%E0%A4%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Jharkhandjamtara.png","page_title":"जामताड़ा जिला","context_page_description":"जामताड़ा जिला पूर्वी भारतीय राज्य झारखंड के 24 जिलों में से एक है। जामताड़ा शहर इस जिले का प्रशासनिक मुख्यालय है। यह जिला 23° 10' और 24° 05' उत्तरी अक्षांश और 86° 30' और 87° 15' पूर्वी देशांतर के बीच में स्थित है।"},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D1%85%D0%BC%D0%B0%D0%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Cornstarch_mixed_with_water.jpg","page_title":"Крахмал","context_page_description":"Крахмал – өсімдіктерде болатын полимерлік көмірсу: ₙ.\\nКрахмал— өсімдіктердің басты қосалқы көмірсуы; глюкоза қалдықтарынан түзілетін екі полисахаридтен тұрады. Ұн тәрізді ақ ұнтақ; көптеген өсімдіктерден алынады. Аспаздық пен кондитер фабрикаларында көбінесе картоп, бидай және жүгері крахмалын пайдаланады. Кисель, жеміс ботқаларын қоюлатуға, сондай-ақ кондитер бұйымдарына қосылады.\\nКартоп крахмалы. Картоп өндіріске гидравликалық транспортермен жуылып, жеңіл, ауыр қоспалардан ажыратылып, жуу машинасына түседі. Жуылған және өлшенген картоп ұнтақтау машинасында крахмалы босатылады. Келесі операция — осы ботқа сияқты қоймалжыңды ішіндегі жасушалық шырыннан бөлу. Ол үшін ботқаны крахмал сүтімен араластырып, әртүрлі електі аппараттарға береді. Електе ботқадан бос крахмал бөліп алынады және пайда болған крахмал сүті майда екінділерден тазаланады. Қалған өнім қайтадан ұнтақталады. Крахмал сүті езінді массасының көбінен ажырағанымен, құрамында әлі де езінді бар болғандықтан әрі қарай жібектен жасалған тор көздерден өткізіліп рафинацияланады."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_im_Landkreis_Eichsfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Wappen_Arenshausen.png","page_title":"Liste der Wappen im Landkreis Eichsfeld","context_page_description":"Diese Liste erfasst alphabetisch geordnet die Wappen der Städte, Gemeinden und ehemals selbständigen Gemeinden des Landkreises Eichsfeld in Thüringen."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Domont","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Gare_de_Domont_04.jpg","page_title":"Gare de Domont","context_page_description":"La gare de Domont est une gare ferroviaire française de la ligne d'Épinay-Villetaneuse au Tréport-Mers, située dans la commune de Domont. Elle se situe à 20 km de la gare de Paris-Nord.\\nC'est une gare SNCF desservie par les trains du réseau Transilien Paris-Nord."},{"page_url":"https://hu.wikipedia.org/wiki/Chamesol","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Eglise_de_Chamesol_2.JPG","page_title":"Chamesol","context_page_description":"Chamesol település Franciaországban, Doubs megyében. Chamesol Pierrefontaine-lès-Blamont, Montécheroux, Montjoie-le-Château, Saint-Hippolyte, Soulce-Cernay és Villars-lès-Blamont községekkel határos."},{"page_url":"https://de.wikipedia.org/wiki/%C4%8CSD-Baureihe_U_45.9","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Hluz-U45_9.jpg","page_title":"ČSD-Baureihe U 45.9","context_page_description":"In die Baureihe U 45.9 der Tschechoslowakischen Staatsbahnen waren schmalspurige Tenderlokomotiven für Bosnische Spur eingeordnet, die im Eigentum verschiedener Waldbahnen in der Slowakei und in Karpatenrussland standen. Es handelte sich dabei um vierfachgekuppelte Nassdampflokomotiven mit Außenrahmen.\\nU 45.901–903, Waldeisenbahn Orava, Hersteller: MÁVAG, Budapest\\nU 45.904–905, Waldeisenbahn Orava, Hersteller: Orenstein & Koppel, Berlin\\nU 45.905–906, Waldbahn Tereswatal, Hersteller: Adamov\\nU 45.907–910, Waldbahn Tereswatal, Hersteller: ČKD Praha"},{"page_url":"https://de.wikipedia.org/wiki/Jakob_Vetsch_(Bezirksammann)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/VetschJakob1886-1944Sig.jpg","page_title":"Jakob Vetsch (Bezirksammann)","context_page_description":"Jakob Vetsch war Bezirksammann des ehemaligen Bezirkes Werdenberg im Kanton St. Gallen in der Schweiz."},{"page_url":"https://nl.wikipedia.org/wiki/Fuji_(Shizuoka)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Flag_of_Fuji%2C_Shizuoka.png","page_title":"Fuji (Shizuoka)","context_page_description":"Fuji is een stad in de prefectuur Shizuoka in Japan."},{"page_url":"https://tr.wikipedia.org/wiki/Afro-dite","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Gladys_Del_Pilar_By_Daniel_%C3%85hs_Karlsson.jpg","page_title":"Afro-dite","context_page_description":"Afro-dite, İsveçli üç şarkıcının birleşiminden oluşan müzik grubudur. Grup üyeleri Blossom Tainton-Lindquist, Gladys del Pilar ve Kayo Shekoni'den oluşmaktadır. Grubun ismini Yunan Tanrıları Afrodit'ten almaktadır.\\nGrup üyeleri 2002 yılında Eurovision Şarkı Yarışması'na \\"Never let it go\\" adlı şarkıyla katılmış, Yarışmada sekizinci olmuştur. Grup üyeleri 2007 yılında albüm çıkarmıştır."},{"page_url":"https://en.wikipedia.org/wiki/Josip_Pirmajer","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Josip_Pirmajer_%281966%29.jpg","page_title":"Josip Pirmajer","context_page_description":"Josip Pirmajer was a Slovenian footballer who played for Yugoslavia and later became a manager."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D9%88%D8%AF%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Blundell_Park_-_geograph.org.uk_-_125740.jpg","page_title":"بودلی","context_page_description":"بودلی بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 9470 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://pl.wikipedia.org/wiki/Niemcowa_(polana)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/Niemcowa_BS2-3.jpg","page_title":"Niemcowa (polana)","context_page_description":"Niemcowa – polana grzbietowa w Paśmie Radziejowej, znajdująca się na grzbiecie Niemcowa – Kordowiec. Na grzbiecie tym, kolejno od dołu do góry jest 5 polan: Kordowiec, Poczekaj, Stos, Niemcowa i Kramarka. Polana znajduje się tylko częściowo w granicach gminy Rytro. Granica przebiega środkiem polany, większa część polany należy do miasta i gminy Piwniczna-Zdrój. Duża część polany jest zalesiona."},{"page_url":"https://en.wikipedia.org/wiki/Khaya","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Khaya_senegalensis_MS_2037.JPG","page_title":"Khaya","context_page_description":"Khaya is a genus of five species of trees in the mahogany family Meliaceae. The timber of Khaya is called African mahogany, and is valued as a substitute to genuine mahogany."},{"page_url":"https://en.wikipedia.org/wiki/Jewish_pope_Andreas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Jewish_pope.jpg","page_title":"Jewish pope Andreas","context_page_description":"Jewish pope Andreas is a legend about a Jewish pope. The 1906 Jewish Encyclopedia writes: \\"According to an old Spanish document discovered among some penitential liturgies by Eliezer ben Solomon Ashkenazi, the editor of \\"Ṭa'am Zeḳenim\\", Andreas was a Jew who, upon becoming a Christian, distinguished himself so markedly as to become successively cardinal and then pope.\\nDuring his pontificate, it is alleged, a calumny was lodged against the Jews, as the result of which an outbreak of the persecutions of the Jews was imminent. At the critical moment, however, the pope appeared on the scene and, by delivering a speech in favor of the Jews, succeeded in subduing the popular passion. The Jews sent a delegation of their most prominent and learned men to bear to the pontiff the expression of their gratitude. In response, the pope handed to the delegates a Selichot, or penitential prayer, which he had composed in the sacred tongue, and which he now requested them to spread broadcast among all Jewish communities, and to have incorporated in their books of prayer. This they did. The prayer bore the pope's signature \\"Andreas,\\" though in print one letter was inverted.\\""},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%81%96%E6%AF%8D%E7%84%A1%E5%8E%9F%E7%BD%AA%E4%B8%BB%E6%95%99%E5%BA%A7%E5%A0%82_(%E9%A6%99%E6%B8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Cathedra_of_The_Hong_Kong_Catholic_Cathedral_of_The_Immaculate_Conception_4830.JPG","page_title":"聖母無原罪主教座堂 (香港)","context_page_description":"圣母无原罪主教座堂是19世纪后期建成的哥特式圣堂及天主教香港教区的主教座堂，位于坚道16号。\\n主教座堂前身是位于砵典乍街和威灵顿街交界的圣堂，于1843年落成。圣堂于1858年扩建，然而一场火灾于1859年将圣堂焚毁。1860年，由于教会希望进一步扩充，于是原地重建圣堂。1860年重建的圣堂于1886年拆卸。现时位于坚道的圣堂于1883年进行动工仪式和开始建造。圣堂以砖和石建成，由位于伦敦的柯利和汉森公司设计。1888年12月8日，圣堂启用；神职人员于前一天在堂内举行首次弥撒。恩理觉主教、高若瑟主教和祝福主教于1938年将圣堂祝圣。它在香港保卫战中遭受破坏。随后的日占时期期间，这座圣堂跟其他宗教建筑相比下并没有受到很多破坏。香港宗座代牧区于1946年升为教区，圣堂变成主教座堂。主教座堂在2002年完成翻新工程。香港古物咨询委员会于2010年将它评为一级历史建筑。\\n主教座堂外有一个供举办不同活动之用的广场，正门上方有有一尊手握十字架的耶稣像。座堂内现时有一个主祭台、尖塔、圣体小堂、福传小堂、中华殉道圣人小堂和亡者小堂等设施。香港天主教教会的首任宗座监牧、3位宗座代牧及4位教区主教在座堂内安葬，教宗若望·保禄二世的圣髑于福传小堂存放。另外，主祭台和中华殉道圣人小堂亦分别安放了一些圣人的圣髑。"},{"page_url":"https://de.wikipedia.org/wiki/Niobgermanium","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/GeNb3_unit_cell.png","page_title":"Niobgermanium","context_page_description":"Niobgermanium ist eine intermetallische chemische Verbindung aus der Gruppe der Niob-Germanium-Verbindungen. Neben der gut untersuchten Form GeNb₃ sind noch GeNb, GeNb₂, GeNb₄, Ge₃Nb, Ge₇Nb₁₀, Ge0,8Nb3,2, Ge₃Nb₅, Ge₂Nb₃, Ge₂Nb sowie viele nichtstöchiometrische Phasen bekannt."},{"page_url":"https://pt.wikipedia.org/wiki/Correios_de_Mo%C3%A7ambique","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/A_Direc%C3%A7%C3%A3o_dos_Correios%2C_Tel%C3%A9grafos_e_Telefones_e_o_seu_pessoal_-_Louren%C3%A7o_Marques.jpg","page_title":"Correios de Moçambique","context_page_description":"A Empresa Nacional dos Correios de Moçambique, E. P., abreviada para Correios de Moçambique, E. P. é a empresa pública responsável pelo sistema postal de Moçambique.\\nA sua sede está situada no Edifício dos Correios de Maputo na capital do país."},{"page_url":"https://es.wikipedia.org/wiki/David_Arroyo","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Davidarroyo.jpg","page_title":"David Arroyo","context_page_description":"David Arroyo Durán es un ciclista profesional español que compitió en la modalidad de ruta entre 2001 y 2018 y desde 2019 compite en la de montaña.​ Entre sus victorias como profesional, cabe destacar una etapa en la Vuelta a España 2008 y el segundo puesto en la clasificación general del Giro de Italia 2010, donde además vistió la maglia rosa durante cinco días, hasta la antepenúltima etapa.​​​\\nSobresale en las etapas de montaña al ser un ciclista Escalador, ​ y en las carreras de tres semanas, aunque sufre en las etapas contrarreloj. Cuando era ciclista del Movistar Team, su temporada se centraba en dos picos de forma: uno en mayo para disputar el Giro de Italia y otro, en menor medida, para realizar el papel de gregario en el Tour de Francia o Vuelta a España, ​ pero con su fichaje como jefe de filas por el Caja Rural, su temporada 2013 se centró en la Vuelta a España, acudiendo como principal baza del equipo.​"},{"page_url":"https://en.wikipedia.org/wiki/Mark_Alan_Walker","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Mark_Soledad_Canyon4-1.jpg","page_title":"Mark Alan Walker","context_page_description":"Mark Alan Walker is an American philosopher. He is a Professor of Philosophy at New Mexico State University, where he occupies the Richard L. Hedden Endowed Chair in Advanced Philosophical Studies. Prior to his professorship at NMSU Prof. Walker taught at McMaster University in the department of philosophy and the Arts & Science Programme. He is the author of Happy-People Pills for All and Free Money for All. Walker founded and was president of the former nonprofit organization Permanent End International, which had been devoted to ending hunger, illiteracy and environmental degradation through the dissemination of modular aquaponics systems for farming. He serves on the editorial board of the Journal of Evolution and Technology and on the board of directors of the Institute for Ethics and Emerging Technologies. He is a former board member of the non-profit organization Humanity Plus.\\nProfessor Walker is a consequentialist who argues that humans have a responsibility to perfect themselves in the realm of morality and virtue."},{"page_url":"https://sv.wikipedia.org/wiki/Litas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/1_litas_%281994%29.jpg","page_title":"Litas","context_page_description":"Litas var den valuta som användes i Litauen tom 31 december 2014. Valutakoden var LTL. 1 Litas = 100 centų.\\nValutan infördes 1922 och ersatte den tidigare litauiska auksinas som infördes 1919. Valutan gällde fram till den sovjetiska ockupationen 1940. Litas återinfördes i juni 1993 och ersatte den tillfälliga Talonas.\\nValutan hade en bunden växelkurs from 2005 till euro genom ERM II. Litauens regering har siktat på att införa euron så snart som möjligt, men på grund av för hög inflation var det svårt för landet att uppfylla de nödvändiga konvergenskriterierna. From 1 januari 2015 är EUR officiell valuta i Litauen."},{"page_url":"https://de.wikipedia.org/wiki/Schahba","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Philippopolis_Teatro_romano_-_GAR_-_4-01.jpg","page_title":"Schahba","context_page_description":"Schahba ist eine Stadt, die etwa 87 km von Damaskus entfernt in Syrien liegt. Sie gehört zum Gouvernement as-Suwaida und hat ungefähr 15.000 Einwohner. Schahba gilt als der Geburtsort des römischen Kaisers Philippus Arabs, der von 244 bis 249 regierte und die bis dahin eher unbedeutende Siedlung während seiner Regierungszeit zu einer bedeutenden Stadt ausbauen lassen wollte. Nach seinem Tod kam dieses Projekt jedoch zum Erliegen."},{"page_url":"https://oc.wikipedia.org/wiki/Ed_Sheeran","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Ed_Sheeran_2013.jpg","page_title":"Ed Sheeran","context_page_description":"Edward Christopher Sheeran, mai conegut coma Ed Sheeran es un cantaire e cantautor anglés."},{"page_url":"https://fr.wikipedia.org/wiki/Jan_Ruiter","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Training_Nederlands_elftal_i.v.m._wedstrijd_Belgie_de_keepers_Jan_de_Ruiter_en_%2C_Bestanddeelnr_928-5330.jpg","page_title":"Jan Ruiter","context_page_description":"Jan Ruiter est un footballeur néerlandais, né le 24 novembre 1946 à Enkhuizen."},{"page_url":"https://en.wikipedia.org/wiki/Bronocice_pot","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Bronocice_drawn.png","page_title":"Bronocice pot","context_page_description":"The Bronocice pot, discovered in a village in Gmina Działoszyce, Świetokrzyskie Voivodeship in Małopolska, near Nida River, Poland, is a ceramic vase incised with one of the earliest known depictions of what may be a wheeled vehicle. It was dated by the radiocarbon method to the mid-fourth millennium BC, and is attributed to the Funnelbeaker archaeological culture. Today it is housed in the Archaeological Museum of Kraków, Poland."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B2%88%E6%8B%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Shen_Kua_sketch.jpg","page_title":"沈括","context_page_description":"沈 括は、北宋時代中期の政治家・学者。字は存中。夢渓丈人と号する。父は沈周。伯父は沈同。兄は沈扶。"},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%A8%E0%A5%8B%E0%A4%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/%E6%98%A5%E6%97%A5%E7%A5%9E%E7%A4%BE%E3%83%BC%E7%AF%A0%E5%B1%B1%E3%83%BC%E7%BF%81%E5%A5%89%E7%B4%8DP1011774.jpg","page_title":"नोह","context_page_description":"नोह, नो वा नोअ चौधौँ शताब्दीमा विकास भएको जापानी सांगीतिक नाटक हो । कानिमि र उनका छोरा जिएमीले जापानको मुरोमाची काल देखि विकास गर्दै ल्याएको भनिने यस नाट्य शैली हालसम्म पनि कायम रहेको पुरानो नाट्य कला हो । यसमा नृत्य, नाच र गीतको सम्मिश्रण रहन्छ । प्रदर्शकहरू मुकुन्डो लगाउँछन् र बिस्तारै नाच्दछन् ।\\nनोह, धेरैजसो जापानी लोक साहित्यमा आधरित हुन्छन् । विभिन्न नकाप मास्क, वस्त्रहरूले विभिन्न पात्रहरू जनाउँछन् भने नृत्यमा भावहरू प्रकट गरिन्छन् ।"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%AD%A3%E9%9B%80%E8%BB%8A%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Shojaku_Station_%2803%29_IMG_4645r_R_20150808.JPG","page_title":"正雀車站","context_page_description":"正雀站是一个位于大阪府摄津市阪急正雀，属于阪急电铁京都本线的铁路车站。车站编号为HK-66。"},{"page_url":"https://ca.wikipedia.org/wiki/Baix_alemany","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/DE-NDS-Ohlenb%C3%BCttel-Ortsschild.JPG","page_title":"Baix alemany","context_page_description":"El baix alemany és la designació global d'un contínuum lingüístic de germànics occidentals parlat a part dels Països Baixos i a tot el nord d'Alemanya, la característica principal del qual, a nivell fonètic, és el no haver participat en la segona mutació consonàntica, fet que el diferencia de l'alt alemany. El baix-alemany no és pas neerlandès ni el neerlandès és baix-alemany, però sí que és un dialecte baix-alemany el sassisch o saksisch que es parla a tot el territori oriental dels Països Baixos fins a l'Ijsselmeer. El baix-alemany només té en comú amb l'alemany el fet que tots dos es parlin a Alemanya. El baix-alemany no és pas un dialecte de l'alemany, com de vegades pot llegir-se. El baix-alemany tampoc no és baix-saxó: el baix-saxó només és un dels dialectes del baix-alemany."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A7%D9%84%D8%B3%D9%8A%D8%A7%D8%B1%D8%A7%D8%AA_%D8%A7%D9%84%D8%A3%D9%83%D8%AB%D8%B1_%D9%85%D8%A8%D9%8A%D8%B9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/00-02_Saturn_SL_2.jpg","page_title":"قائمة السيارات الأكثر مبيعا","context_page_description":"أفضل السيارات مبيعا أو السيارات الأكثر مبيعا هي سيارات الركاب والشاحنات الخفيفة التي، منذ إدخال براءة بنز موتورواغن في عام 1886، ويمكن أن تسمى أعلى السيارات مبيعا في الأسواق التي تتنافس فيها.\\nمع أن المراجع المُدرجة في هذه المقالة وضعت للتحقق من ادعاءات الصانعين، إلّا أن هناك دائما إمكانية عدم دقة أو مبالغة. أيضا، فلقد لوحظ بأن هناك سيارة معينة واحدة يمكن أن تباع في وقت واحد تحت عدة أسماء في الأسواق المختلفة، كما هو الحال على سبيل المثال مع نيسان صني؛ وفي مثل هذه الظروف غالبا ما توفر الشركات المصنعة مجموع عدد بيع الوحدات التراكمي فقط لجميع الموديلات. ونتيجة لذلك، لا يوجد معيار نهائي لقياس الوحدات المباعة؛ فولكس واجن تدعي بأن بيتل هي السيارة الأكثر مبيعا في التاريخ حيث لم تتغير بشكل كبير في جميع أوقات إنتاجها. على النقيض من ذلك، قامت تويوتا بتطبيق المجموع التراكمي على 11 جيل من أجيال سيارة كورولا منذ إنتاجها في عام 1966، والتي باعت منها أكثر من 40 مليون وحدة حتى يوليو تموز 2013."},{"page_url":"https://ceb.wikipedia.org/wiki/Roberts_(lungsod_sa_Tinipong_Bansa,_Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Roberts%2C_Wisconsin_1.jpg","page_title":"Roberts (lungsod sa Tinipong Bansa, Wisconsin)","context_page_description":"Lungsod ang Roberts sa Tinipong Bansa. Ang Roberts nahimutang sa kondado sa Saint Croix County ug estado sa Wisconsin, sa sidlakang bahin sa nasod, 1,400 km sa amihanan-kasadpan sa ulohang dakbayan Washington, D.C. 315 metros ibabaw sa dagat kahaboga ang nahimutangan sa Roberts, ug adunay 1,651 ka molupyo.\\nAng yuta palibot sa Roberts kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 334 ka metro ug 2.0 km sa amihanan-sidlakan sa Roberts. Dunay mga 38 ka tawo kada kilometro kwadrado sa palibot sa Roberts medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang River Falls, 14.6 km sa habagatan sa Roberts. Hapit nalukop sa kaumahan ang palibot sa Roberts. Sa rehiyon palibot sa Roberts, mga lanaw talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Enero, sa -14 °C. Ang kasarangang pag-ulan 1,069 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 192 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 32 milimetro."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Kiinan_maakunnallisista_moottoriteist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/S84-CN_%28HI%29_no_name.png","page_title":"Luettelo Kiinan maakunnallisista moottoriteistä","context_page_description":"Tämä luettelo kertoo Kiinan maakunnallisista moottoriteistä."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%95%B7%E7%B5%B2%F0%A9%B7%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Pangasius_sanitwongsei_Aquarium_tropical_du_Palais_de_la_Porte_Dor%C3%A9e_10_04_2016.jpg","page_title":"成吉思汗魚","context_page_description":"長絲𩷶是𩷶屬的一種底棲魚類。 俗稱成吉思汗、成吉思汗魚，分布於湄南河及湄公河。"},{"page_url":"https://ko.wikipedia.org/wiki/%ED%81%B4%EB%9D%BC%EC%8B%9C%EC%BD%94_%ED%94%8C%EB%9D%BC%ED%85%90%EC%84%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Cl%C3%A1sicoplatense1959.jpg","page_title":"클라시코 플라텐세","context_page_description":"클라시코 플라텐세 또는 라플라타 클라시코는 아르헨티나 프리메라 디비시온에서 라플라타를 연고로 하는 두 축구팀 에스투디안테스 라 플라타와 힘나시아 라 플라타의 더비 경기를 가리킨다.\\n라 플라타 더비는 매우 격렬하며, 2006년 아페르투라에서 힘나시아 팬이 더비 경기 중 자기팀 선수의 살해 위협과 관련되어 기소되는 등 여러 사건이 발생하곤 했다. 힘나시아 팬에 의한 유사한 사건이 보카 주니어스와의 경기 때도 있었는데, 이유는 힘나시아가 경기에 질 경우 라이벌 에스투디안테스보다 보카의 우승 가능성이 더 높아지기 때문이었다."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Nobelpreistr%C3%A4ger_f%C3%BCr_Physiologie_oder_Medizin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Edmond_Fischer_Nobel_Laureate_1992.jpg","page_title":"Liste der Nobelpreisträger für Physiologie oder Medizin","context_page_description":"Der Nobelpreis für Physiologie oder Medizin wird seit 1901 jährlich vergeben und ist seit 2017 mit 9 Millionen Schwedischen Kronen dotiert. Die Auswahl der Laureaten unterliegt dem Karolinska-Institut. Der Stifter des Preises, Alfred Nobel, verfügte in seinem Testament vom 27. November 1895, in dem die Vergabe der Auszeichnung geregelt wurde, der Nobelpreis für Physiologie oder Medizin solle demjenigen zuerkannt werden, „der die wichtigste Entdeckung in der Domäne der Physiologie oder Medizin gemacht hat“. Der Nobelpreis wird jedes Jahr am Todestag Alfred Nobels, dem 10. Dezember, vom schwedischen König überreicht.\\nSeit der ersten Nobelpreis-Verleihung wurden insgesamt 219 Personen ausgezeichnet, darunter befanden sich 207 Männer und zwölf Frauen. Bisher wurde noch niemand mehrfach mit dem Medizinnobelpreis ausgezeichnet. Bislang wurde der Preis 39-mal ungeteilt an eine Person vergeben. 33-mal wurde er zwischen zwei, 38-mal zwischen drei Personen aufgeteilt. Mit einer Quote von 1,98 Preisträgern pro Verleihung ist es der am stärksten aufgeteilte Nobelpreis. Neunmal wurde der Preis nicht verliehen, zuletzt 1942."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A6%D0%B5%D0%BF%D0%BD%D0%BE%D0%B9_%D0%BC%D0%BE%D1%81%D1%82_(%D0%91%D1%83%D0%B4%D0%B0%D0%BF%D0%B5%D1%88%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Budapest_bridge.jpg","page_title":"Цепной мост (Будапешт)","context_page_description":"Цепно́й мост, или мост Се́ченьи — висячий мост через реку Дунай, соединяющий две исторических части Будапешта — Буду и Пешт. Открыт в 1849 году, став первым постоянным мостом через Дунай. На момент открытия мост считался чудом света. Мост сыграл важную роль в экономической и общественной жизни Венгрии, стал одним из стимулов объединения Буды и Пешта в единый город Будапешт."},{"page_url":"https://es.wikipedia.org/wiki/Escultura_de_Albania","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Albania_from_Corfu_145.JPG","page_title":"Escultura de Albania","context_page_description":"La Escultura de Albania es toda manifestación artística en el terreno de la práctica escultórica, desde la prehistoria a nuestros días, realizada por los escultores de Albania, esculturas presentes en el territorio de Albania y esculturas fuera del país realizadas en Albania o por albaneses.\\nExiste una larga tradición escultórica en el territorio albanés. Desde la prehistoria existen indicios de la actividad artística, existiendo periodos de esplendor, como en la época clásica, y en el llamado renacimiento de la escultura albanesa, a finales del siglo XIX y todo el siglo XX.\\nDesde antes de la independencia del país, la escultura a soportado un alto valor simbólico del nacionalismo albanés. Las esculturas con el tema de Skanderbeg, se trocaron en pieza obligatoria en la Academia Albanesa de Bellas Artes a lo largo del siglo XX.\\nCon la llegada de la democracia, la caída de las esculturas del Enver Hoxha se ha convertido en un símbolo internacional.\\nLa actividad creadora sigue siendo sobresaliente, tanto dentro del territorio albanés como en la labor de los escultores albaneses emigrados alrededor del mundo, una constante en la historia de la escultura albanesa."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B9%D0%B1%D0%B5%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D1%96%D1%82%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/C301-Interior-Motor.JPG","page_title":"Тайбейський метрополітен","context_page_description":"Тайбейський метрополітен — система ліній метро в місті Тайбей, Республіка Китай. Більшість станцій мають острівну платформу, та мають систему горизонтальний ліфт. Метрополітен повністю доступний для людей з обмеженими можливостями: всі станції обладнані ліфтами, в потягах передбачені міста для інвалідних візків."},{"page_url":"https://vi.wikipedia.org/wiki/Pontikon%C3%AD%CC%B1si","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Pontikonisi_Island_05-06-06.jpg","page_title":"Pontikoní̱si","context_page_description":"Pontikoní̱si là một hòn đảo nhỏ của Hy Lạp nằm gần sát bên đảo Kérkyra. Đây là nơi tọa lạc của tu viện Pantokrator từ thời Đông La Mã khoảng thế kỷ 11-12.\\n\\"Pontikoní̱si\\" tạm dịch là \\"đảo chuột\\" nó bắt nguồn từ cụm từ \\"pontikós kai ni̱sí\\". \\"Chuột\\" là lũ chuột \\"di cư\\" theo đường biển bằng cách \\"tạm trú\\" trên các con tầu, còn trong tiếng Hy Lạp cổ thì \\"chuột\\" nói chung gọi là \\"mýs\\"."},{"page_url":"https://nl.wikipedia.org/wiki/Gardone_Riviera","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Vittoriale.jpg","page_title":"Gardone Riviera","context_page_description":"Gardone Riviera is een gemeente in de Italiaanse provincie Brescia en telt 2668 inwoners. De oppervlakte bedraagt 20,6 km², de bevolkingsdichtheid is 125 inwoners per km².\\nDe volgende frazioni maken deel uit van de gemeente: Fasano, San Michele, Morgnaga en Tresnico."},{"page_url":"https://de.wikipedia.org/wiki/Orlick%C3%A9_Z%C3%A1ho%C5%99%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Orlick%C3%A9_Z%C3%A1ho%C5%99%C3%AD_CoA.jpg","page_title":"Orlické Záhoří","context_page_description":"Orlické Záhoří ist eine Gemeinde im Okres Rychnov nad Kněžnou in Tschechien. Sie befindet sich zwölf Kilometer westlich von Bystrzyca Kłodzka im Tal der oberen Wilden Adler an der Grenze zu Polen."},{"page_url":"https://en.wikipedia.org/wiki/Carrier_Mills,_Illinois","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Saline_County_Illinois_Incorporated_and_Unincorporated_areas_Carrier_Mills_Highlighted.svg","page_title":"Carrier Mills, Illinois","context_page_description":"Carrier Mills, formerly Carrier's Mills and Morrilsville, also known as Catskin, is a village in Saline County, Illinois, United States. The population was 1,655 at the 2010 census. Carrier Mills was named after George Washington Carrier's saw and grist mills, and was one of the early Cairo and Vincennes Railroad boomtowns. Founded as a mill town, and then a coal mining community, Carrier Mills has slowly lost 44% of its population since the 1920 census high of 3,000 due to the shuttering of the local coal industry. The village has primarily become a bedroom community, located seven miles southwest of Harrisburg, which is the village's main source of employment, entertainment, and shopping. It is the third largest community in the Harrisburg Micropolitan Statistical Area outside of Eldorado and Harrisburg, and included in the Illinois-Indiana-Kentucky Tri-State Area. Carrier Mills also has a large African American population at 15%, compared to its neighbors, due to migration from the nearby community of Lakeview, the oldest African American settlement in the state of Illinois."},{"page_url":"https://sv.wikipedia.org/wiki/Erebia_aethiops","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Erebia_aethiops_egg.jpg","page_title":"Erebia aethiops","context_page_description":"Erebia aethiops är en fjärilsart som beskrevs av Eugen Johann Christoph Esper 1777. Erebia aethiops ingår i släktet Erebia och familjen praktfjärilar. Utöver nominatformen finns också underarten E. a. minor."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Torgau_(M%E2%80%93Z)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Torgau_Puschkinstrasse_6-01.jpg","page_title":"Liste der Kulturdenkmale in Torgau (M–Z)","context_page_description":"Die Liste der Kulturdenkmale in Torgau enthält die Kulturdenkmale in Torgau.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen.\\nAufgrund der großen Anzahl von Kulturdenkmalen ist die Liste aufgeteilt in die\\nListe der Kulturdenkmale in Torgau\\nListe der Kulturdenkmale in Torgau (M–Z)"},{"page_url":"https://fr.wikipedia.org/wiki/1206","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Mongol_Empire_c.1207.png","page_title":"1206","context_page_description":"Cette page concerne l’année 1206 du calendrier julien."},{"page_url":"https://en.wikipedia.org/wiki/Old_Bridge,_Bridgend","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Old_Bridge_Bridgend.jpg","page_title":"Old Bridge, Bridgend","context_page_description":"The Old Bridge is a medieval two arched stone footbridge that spans the River Ogmore at Bridgend in Wales. It is not known who designed or built the bridge, however it was built in approximately 1425. The bridge was repaired in 1775 and restored both in 2005 and 2011. The bridge is a scheduled ancient monument and a grade II* listed bridge."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%9Aniadowo_(wojew%C3%B3dztwo_podlaskie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/SM_%C5%9Aniadowo_Ko%C5%9Bci%C3%B3%C5%82_Wniebowzi%C4%99cia_NMP_%281%29_ID_634014.jpg","page_title":"Śniadowo (województwo podlaskie)","context_page_description":"Śniadowo – byłe miasto, obecnie wieś w Polsce położona w województwie podlaskim, w powiecie łomżyńskim, w gminie Śniadowo. Miejscowość jest siedzibą gminy Śniadowo."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%96%D0%BD%D0%BA%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Ginkgo_biloba0.jpg","page_title":"Гінкго","context_page_description":"Гінкго — рід унікальних листопадних голонасінних рослин. Рід з'явився 270 млн років тому в пермську добу, вірогідно від насінної папороті Peltaspermales. Швидкість еволюції була дуже повільною, майже всі його види вимерли до кінця пліоцену. Містить один живий вид — G. biloba, дерево висотою до 40 метрів і діаметром стовбура до 4,5 м. Крона спочатку пірамідальна, з віком розростається. У дикій природі росте тільки в Китаї, але культивується у всьому світі."},{"page_url":"https://de.wikipedia.org/wiki/Muroran-Hauptlinie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/785_Suzuran_Muroran_20071001.jpg","page_title":"Muroran-Hauptlinie","context_page_description":"Die Muroran-Hauptlinie ist eine Eisenbahnstrecke auf der japanischen Insel Hokkaidō, die von der Bahngesellschaft Hokkaido Railway Company betrieben wird. Sie verläuft von Oshamambe nach Iwamizawa. Ebenfalls zur Muroran-Hauptlinie gehört eine Zweigstrecke in der Stadt Muroran. Der Abschnitt zwischen Iwamizawa und Muroran wurde 1892 eröffnet, die restliche Strecke entstand schrittweise in den 1920er Jahren. Im Güter- und Schnellzugsverkehr spielt die Muroran-Hauptlinie eine bedeutende Rolle."},{"page_url":"https://fi.wikipedia.org/wiki/Brita_Borg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Brita_Borg.jpg","page_title":"Brita Borg","context_page_description":"Brita Kerstin Gunvor Borg oli ruotsalainen laulaja, näyttelijä ja revyytaiteilija. Hän loi muusikkona laajan levytys-, radio- ja showuran, jonka aikana hän teki huomattavaa yhteistyötä Povel Ramelin kanssa. Borg esiintyi useissa elokuvissa, monesti yhdessä Ramelin kanssa; hän työskenteli niin ikään teatterissa.\\nBorg oli Ruotsin euroviisuedustajana vuonna 1959. Hän sijoittui laulullaan ”Augustin” neljällä pisteellä jaetulle yhdeksännelle sijalle. Muita Brita Borgin laulamia tunnettuja kappaleita oli Ruotsin Svensktoppenissa monta viikkoa kesällä 1969 soinut Ljuva sextital."},{"page_url":"https://az.wikipedia.org/wiki/Vranov_nad_Toplyou","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Vranov_nad_Top%C4%BEou1.JPG","page_title":"Vranov nad Toplyou","context_page_description":"Vranov nad Toplyou — Slovakiyanın şərqində, Toplya çayının sahilində kiçik şəhər. Əhalisi 23 min nəfərə yaxındır."},{"page_url":"https://pl.wikipedia.org/wiki/Cerkiew_%C5%9Awi%C4%99tych_Kosmy_i_Damiana_w_Rybo%C5%82ach","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Podlaskie_-_Zab%C5%82ud%C3%B3w_-_Rybo%C5%82y_-_Cerkiew_%C5%9Bw_KiD_-_Cerkiew_-_front%3B_prawo.JPG","page_title":"Cerkiew Świętych Kosmy i Damiana w Rybołach","context_page_description":"Cerkiew Świętych Kosmy i Damiana – prawosławna cerkiew w Rybołach, główna świątynia parafii pod tym samym wezwaniem, należącej do dekanatu Bielsk Podlaski diecezji warszawsko-bielskiej."},{"page_url":"https://de.wikipedia.org/wiki/IC_4531","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/IC4531_-_SDSS_DR14.jpg","page_title":"IC 4531","context_page_description":"IC 4531 ist eine kompakte Galaxie vom Hubble-Typ C im Sternbild Bärenhüter am Nordsternhimmel. Sie ist schätzungsweise 708 Millionen Lichtjahre von der Milchstraße entfernt und hat einen Durchmesser von etwa 170.000 Lj.\\nIm selben Himmelsareal befinden sich u. a. die Galaxien NGC 5829, IC 4526, IC 4532, IC 4534.\\nDas Objekt wurde am 25. Juli 1903 von Stéphane Javelle entdeckt."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%87%D9%88%D8%AF_%D9%85%D9%88%D9%86%D9%88%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Yehud_Monoson_COA.png","page_title":"یهود مونوسون","context_page_description":"یهود مونوسون نام شهری در استان مرکزی اسرائیل است که جمعیت آن در سال ۲۰۰۶ ۲۵٬۵۰۰ نفر و مساحت آن ۵٫۰۱۴ کیلومتر مربع بوده است."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A0%D7%93%D7%A8%D7%94_%D7%92%D7%9C%D7%99%D7%A7%D7%A1%D7%9E%D7%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Andre_Glucksmann2.jpg","page_title":"אנדרה גליקסמן","context_page_description":"אנדרה גליקסמן היה פילוסוף, אקטיביסט וסופר יהודי צרפתי. נמנה עם דור הפילוסופים החדשים של הפילוסופים הצרפתים."},{"page_url":"https://ca.wikipedia.org/wiki/Saint-Georges-sur-Erve","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Ch%C3%A2teau_Foulletorte_douves.JPG","page_title":"Saint-Georges-sur-Erve","context_page_description":"Saint-Georges-sur-Erve és un municipi francès, situat al departament de Mayenne i a la regió de País del Loira. L'any 2007 tenia 405 habitants."},{"page_url":"https://es.wikipedia.org/wiki/Colegio_San_Pedro_Claver","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Logo_Colegio_sin_fondo.jpg.png","page_title":"Colegio San Pedro Claver","context_page_description":"Colegio San Pedro Claver es un colegio en la ciudad de Bucaramanga, Colombia, nombrado en honor a San Pedro Claver, santo patrono de los esclavos de Colombia.\\nEl colegio, propiedad de la Compañía de Jesús, se configura como uno de los más tradicionales de la ciudad de Bucaramanga y desde sus inicios ha albergado a numerosas personalidades de la sociedad santandereana y bumanguesa."},{"page_url":"https://ms.wikipedia.org/wiki/Capital_Square","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/KL_-_Cap_Square_Tower.JPG","page_title":"Capital Square","context_page_description":"Capital Square, yang sering disebut sebagai Cap Square, merupakan kondominium kediaman pencakar langit dan pusat membeli-belah di sepanjang Jalan Abdullah Abdul Kadir Munshi, di tengah bandar Kuala Lumpur, Malaysia, dibangunkan oleh Bandar Raya Developments Bhd. Selain dari ruang runcit, pembangunan merangkumi satu 36 tingkat kondominium blok dan satu blok pejabat bawah fasa 2. tingkat 1, yang terdiri satu blok pejabat 40-tingkat, Menara Multi-Purpose, telah disiapkan pada 1994. Menara Multi-Purpose ini juga rumah bagi ibu pejabat korporat Bandar Raya Developments Bhd. Komponen kediaman 36 tingkat kediaman Cap Square terdiri 180 unit apartmen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BA%D1%81%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%87,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%D0%9F%D0%B0%D1%82%D0%B5%D0%BD%D1%82_%D1%81%D0%BF%D0%BE%D1%81%D0%BE%D0%B1_%D0%BE%D1%87%D0%B8%D1%81%D1%82%D0%BA%D0%B8.jpg","page_title":"Максимович, Николай Георгиевич","context_page_description":"Никола́й Гео́ргиевич Максимо́вич — советский и российский учёный, Заслуженный эколог Российской Федерации, заместитель директора по научно-исследовательской работе Естественнонаучного института ПГНИУ. Занимается вопросами экологической геологии, гидрогеологии, геоэкологии, инженерной геологии, геохимии, карстоведения и спелеологии."},{"page_url":"https://bs.wikipedia.org/wiki/Skomarje_(Zre%C4%8De)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Skomarje_-_chapel_by_the_main_road.jpg","page_title":"Skomarje (Zreče)","context_page_description":"Skomarje je naseljeno mjesto u sastavu općine Zreče, regija Savinjska, Slovenija."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AE%89%E6%81%AF%E5%B8%9D%E5%9C%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Roman-Parthian_War_58-60-zh.svg","page_title":"安息帝國","context_page_description":"安息帝國，存在於公元前247年－224年，又稱阿爾薩息王朝或阿薩息斯王朝，西方史書稱其為帕提亞帝國，是古波斯地區古典時期的一個王朝。阿薩息斯王朝一名出自帕尼部落領袖阿爾沙克一世，趁著一名波斯總督起兵抵抗塞琉古帝國而征服了伊朗東北部的帕提亞地區，並在公元前三世紀中葉建立安息帝國。全盛時期的安息帝國疆域西達小亞細亞東南的幼發拉底河，東抵阿姆河。安息帝國座落在地中海的羅馬帝國與漢朝之間的貿易路線絲綢之路之上，使帝國成為了商貿中心。\\n安息帝國是一個由不同文化組成的國家，它在很大程度上吸納了包括波斯文化、希臘文化及地區文化的藝術、建築、宗教信仰及皇室標記。在安息帝國的前半段統治時期，宮廷採納了大量希臘文化的元素，但後期逐漸復興了伊朗傳統。安息帝國的統治者以萬王之王為銜頭，自稱是阿契美尼德王朝的後裔，他們仿傚阿契美尼德王朝的做法接納一方霸主成為附庸國，阿契美尼德王朝會由中央任命這些自治的總督。安息帝國也會任命一些總督，這些總督主要統領伊朗以外的地區，但他們的轄地較少，權力也不如阿契美尼德王朝的總督。隨著安息帝國的擴張，中央政府的所在地也沿著底格里斯河由尼薩遷往泰西封，其他多個城市也曾經成為首都。\\n在最初，塞琉古帝國是安息帝國在西線的敵人，斯基泰人則盤據在東面。不過，隨著安息帝國向西擴張，帝國也先後與亞美尼亞王國及羅馬帝國爆發衝突。安息帝國與羅馬帝國互相爭奪，爭取將亞美尼亞君主成為他們的附庸。前53年安息人在卡雷戰役徹底擊敗克拉蘇統領的羅馬軍隊。到前40年至39年，除了泰爾外，羅馬人控制的累范特地區被安息人攻陷。羅馬軍官馬克·安東尼對安息帝國進行反擊，多名羅馬將領也入侵美索不達米亞策應，塞琉西亞及泰西封的控制權數度易手，羅馬人始終不能牢固地控制這些地區。與對外戰爭相比，爭奪王位而頻繁爆發的內戰對安息帝國危害更大，法爾斯伊什塔克爾的統治者阿爾達希爾一世叛變，他在224年殺害了安息帝國最後一位統治者阿爾達班五世。阿爾達希爾一世建立了薩珊王朝，直至七世紀被穆斯林征服前一直統治著伊朗和近東大部分地區，安息帝國的分支阿薩息斯王朝則仍在亞美尼亞繼續其統治。\\n相對薩珊王朝甚至是更早的阿契美尼德王朝，以安息語、希臘語及其他語言記載的本土安息文獻較稀少。除了一些凌散的楔形文字簡、殘缺的陶器碎片、石刻、德拉克馬硬幣、殘存的羊皮紙文獻，安息帝國的歷史只能透過外來的資料而得知，這些外來資料主要是希臘史學和羅馬史學，也包括中國貨品在安息帝國流通而形成的中國史學。安息帝國的藝術品被史學家視為了解安息帝國社會和文化的有效來源，而關於這一方面的文獻資料卻匱乏。"},{"page_url":"https://de.wikipedia.org/wiki/Klingenform","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Klingenquerschnitte_2.jpg","page_title":"Klingenform","context_page_description":"Die Klingenform oder Klingengeometrie beschreibt Profil und Querschnitt der Klinge eines Schneidwerkzeugs oder einer Klingenwaffe. Dabei bestimmt der Anwendungszweck maßgeblich die Form. Mitunter beeinflussen auch Herstellungsprozess, Abnutzung und Verzierungen die Wahl der Form. Bei Steinklingen z. B. spielen auch das Ausgangsmaterial und Zufälle bei der Bearbeitung eine Rolle."},{"page_url":"https://lt.wikipedia.org/wiki/Teismin%C4%97_vald%C5%BEia","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Kauno_apygardos_teismas.jpg","page_title":"Teisminė valdžia","context_page_description":"Teisminė valdžia – valdžios dalis, atskirta pagal valdžių padalijimo principą, kurios pagrindinis uždavinys – spręsti teisinius ginčus. Teisminę valdžią įgyvendina teismai. Tai nepriklausoma ir savarankiška valdžia. Teismų paskirtis – teisingumo vykdymas sprendžiant nustatyta procesine tvarka baudžiamąsias, civilines ir administracines bylas. Teismai formuojami įvairiais būdais: teisėjai vienur renkami, kitur skiriami. Teismų nepriklausomybė nuo kitų valdžios institucijų užtikrinama tuo, kad teismai niekam nepavaldūs, išskyrus įstatymą. Svarbi teismų nepriklausomumo garantija – teisėjų kadencija, neliečiamybė, aukšta socialinė padėtis ir tinkamas materialinis aprūpinimas."},{"page_url":"https://vi.wikipedia.org/wiki/Diwali","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/The_Rangoli_of_Lights.jpg","page_title":"Diwali","context_page_description":"Diwali hay Dīpāvali là một lễ hội quan trọng trong văn hóa Ấn Độ Giáo. Người dân Ấn Độ và Nepal cũng như tại các cộng đồng Ấn giáo khác trên thế giới ăn mừng lễ Diwali vào đêm 13 kỳ trăng khuyết của tháng Ashwin cho tới ngày thứ hai của tháng Kartika trong lịch Ấn Độ. Đây còn được gọi là Lễ hội ánh sáng vì mọi người có phong tục thắp đèn dầu bấc vải để ăn mừng chiến thắng của thần Krishna trước Narakasura, biểu tượng cho chiến thắng của các thiện trước cái ác. Lễ hội cũng đóng vai trò quan trọng trong Phật giáo, đạo Sikh và đạo Jain.\\nDiwali hay Divali là một lễ hội Hindu cổ đại cử hành vào mùa thu hàng năm. Các lễ hội tâm linh có nghĩa là chiến thắng của ánh sáng trước bóng đêm. Việc chuẩn bị lễ hội và nghi lễ thường kéo dài trong một thời gian kéo dài năm ngày, nhưng ban đêm lễ hội chính của Diwali trùng với tối nhất, đêm trăng mới của tháng Kartika Hindu Âm dương. Trong lịch Gregorian, Diwali rơi từ giữa tháng mười đến giữa tháng mười một.\\nTrước khi tới đêm Diwali, người dân phải làm sạch, cải tạo và trang trí nhà cửa và văn phòng của họ."},{"page_url":"https://en.wikipedia.org/wiki/Red_Lake_(Romania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Prelucrare_3D_pentru_Lacul_Rosu%2C_Romania_-_version_1.gif","page_title":"Red Lake (Romania)","context_page_description":"Red Lake is a natural dam lake formed following the collapse of a slope due to the earthquake of January 23, 1838 at 18:45, 6.9 magnitude, VIII intensity, at the foot of Hasmasul Mare Mountain, near the Bicaz Gorge, at a distance of 26 km from Gheorgheni, in Harghita County. At the last measurements, made in 1987, its dimensions are: the lake lies on a perimeter of 2,830 m, the area is 114.676 m² and the volume of water that accumulates is 587.503 m³. The lake was formed at an altitude of 983 m, in a depression with a predominant subalpine climate."},{"page_url":"https://eu.wikipedia.org/wiki/Parisko_Notre-Dame_katedrala","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Paris_Notre-Dame_west_facade_-_Portail_du_Jugement_Dernier.jpg","page_title":"Parisko Notre-Dame katedrala","context_page_description":"Parisko Notre-Dame Katedrala, askotan Notre-Dame gisa ezaguna, Parisko 4. barrutian dagoen katedrala da. Frantziako arkitektura gotikoaren adibide finenetako bat dela esan ohi da. Ojiba-gangaren eta arku arbotanteen erabilerak, arrosa leiho erraldoi eta koloretsuak eta bere eskulturen izaera naturalistak aurreko arkitektura erromanikotik bereizten dute. Mariari eskainia, Jesusen amari, Parisko Île de la Cité uhartetxoan dago, Sena ibaiaren urek inguratzen dutena.\\n1163an eraikitzen hasi eta 1260ean amaitu zen, nahiz eta hurrengo mendeetan aldaketa ugari izan zituen. 1790eko hamarkadan, Frantziako iraultzan, elizak desakralizazioa jasan zuen, eta iruditeria erlijioso ugari suntsitu zen. 1831ean Victor Hugoren Notre-Dame de Paris eleberria argitaratu zenean, eraikinaren inguruko interesa piztu zen. Eugène Viollet-le-Ducek birgaitze proiektu handi bat abiatu zuen 1845ean, hogeita bost urtez iraun zuena. 1963an katedralaren fatxada nagusia garbitu zuten, haren jatorrizko kolorea itzuliz. 1991 eta 2000 urteetan ere berriro garbitu zuten.\\nParisko Artxidiozesiaren katedrala izanik, Notre-Damen dago Parisko artzapezpikuaren katedra."},{"page_url":"https://ast.wikipedia.org/wiki/Tabla_peri%C3%B3dica","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/ShortPT20b.png","page_title":"Tabla periódica","context_page_description":"La tabla periódica ye la presentación, en forma de tabla, de los elementos químicos ordenaos polos sos númberos atómicos, configuraciones electróniques y propiedaes químiques recurrentes. Esta forma d'ordenalos amuesa tendencies periódiques: coloca a los elementos con comportamientu químicu asemeyáu na mesma columna, y conforma cuatro bloques rectangulares colos elementos con propiedaes químiques asemeyaes. Les files de la tabla nómense periodos, y les columnes grupos. De forma xeneral, dientru d'una misma fila los elementos metálicos asítiense a la izquierda y los non metálicos a la derecha. Seis de los grupos tienen, amás del so númberu, un nome propiu d'usu y aceptación xeneralizaos; asina, los elementos del grupu 17 son los halóxenos, y los del grupu 18 los gases nobles.\\nLa tabla periódica puede usase pa derivar rellaciones ente les propiedaes de los elementos, y tamién pa predecir les propiedaes de nuevos elementos entá nun descubiertos o sintetizaos, y ye un marcu teóricu útil pa analizar el comportamientu químicu de los elementos, lo que fae que seya usada ampliamente neto en química que notres ciencies."},{"page_url":"https://en.wikipedia.org/wiki/List_of_National_Treasures_of_Japan_(ancient_documents)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Mongaku_rules.jpg","page_title":"List of National Treasures of Japan (ancient documents)","context_page_description":"The term \\"National Treasure\\" has been used in Japan to denote cultural properties since 1897.\\nThe definition and the criteria have changed since the introduction of the term. These ancient documents adhere to the current definition, and have been designated National Treasures since the Law for the Protection of Cultural Properties came into effect on June 9, 1951. The items are selected by the Agency for Cultural Affairs, a special body of the Ministry of Education, Culture, Sports, Science and Technology, based on their \\"especially high historical or artistic value\\". \\"Ancient documents\\" is one of thirteen categories of National Treasures recognized by the agency. The list presents 62 documents or sets of documents from classical to early modern Japan, from the Asuka period to the Meiji period. The actual number of items is more than 62 because groups of related objects have been combined into single entries. The list contains items of various type such as letters, diaries, records or catalogues, certificates, imperial decrees, testaments and maps."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%89%98%E7%88%BE%E6%AC%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/%D0%91%D1%83%D0%B4%D0%B8%D0%BD%D0%BE%D0%BA_%D0%B2_%D0%A2%D0%BE%D1%80%D1%87%D0%B8%D0%BD%D1%96_1930_%D1%80%D1%96%D0%BA.jpg","page_title":"托爾欽","context_page_description":"托尔钦，是乌克兰的市级镇，位于该国西北部沃伦州，距离卢茨克25公里，始建于1093年，面积10.52平方公里，2011年人口4,474，人口密度每平方公里425人。"},{"page_url":"https://hu.wikipedia.org/wiki/Modern_fizika","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Albert_Einstein_%28Nobel%29.png","page_title":"Modern fizika","context_page_description":"A modern fizika a fizika „Newton utáni” felfogása. Arra utal, hogy jelenségek klasszikus leírása hiányos, és a természet egy pontosabb, \\"modern\\" leírásához szükség van olyan elméletekre, amelyek magukba foglalják a kvantummechanika vagy Einstein relativitáselméletének, vagy mindkettőnek az elemeit. A kifejezést általában a 20. század elején vagy azt követően kifejlődött bármely fizikai tudományágra, vagy a 20. század eleji fizika által nagyban befolyásolt altudományra való hivatkozásként használjuk.\\nA kis sebességek és a nagy távolságok általában a klasszikus fizika területe. A modern fizika azonban gyakran szélsőséges körülményekről szól: a kvantumhatások jellemzően az atomokhoz mérhető távolságokhoz kapcsolódnak, míg a relativisztikus hatások jellemzően a fénysebességgel összemérhető sebességekkel vannak összefüggésben. A kvantum- és relativisztikus hatások általában minden léptékben léteznek, bár hatásuk a mindennapi életben elenyésző lehet."},{"page_url":"https://hu.wikipedia.org/wiki/T%C3%A1ncoslegyek","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Tanzfliege_Dance_fly.jpg","page_title":"Táncoslegyek","context_page_description":"A táncoslegyek a rovarok osztályában Légyalkatúak alrendjének egyik családja. Eleddig több, mint 3000 fajukat írták le. A táncoslegyek és a szúnyoglábú legyek legnagyobb magyarországi kutatója Wéber Mihály volt."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_Historic_Civil_Engineering_Landmarks","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Cumbres_%26_Toltec_Scenic_Railroad_excursion_train_headed_by_locomotive_484_in_2015.jpg","page_title":"Liste des Historic Civil Engineering Landmarks","context_page_description":"Ce qui suit est la liste des Historic Civil Engineering Landmarks, c'est-à-dire la liste des monuments historiques de génie civil, établie aux États-Unis par l' American Society of Civil Engineers depuis qu'elle a commencé le programme en 1964. Cette désignation est accordée à des projets, des structures et des sites situés aux États-Unis et dans le reste du monde. À compter de 2013, il y a plus de 260 éléments dans cette liste.\\nLes sections ou chapitres de la Société américaine des ingénieurs civils peuvent également désigner des éléments dans leur État ou leur région ; ces éléments ne sont pas répertoriés ici."},{"page_url":"https://de.wikipedia.org/wiki/Meppen-Hasel%C3%BCnner_Eisenbahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Vormeppen.jpg","page_title":"Meppen-Haselünner Eisenbahn","context_page_description":"Die Meppen-Haselünner Eisenbahn ist eine ehemalige Bahngesellschaft in Niedersachsen und bezeichnet heute noch deren Strecke von Meppen nach Essen/Oldenburg."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%BE%D1%88%D0%B0%D1%80%D0%BA%D0%B0_%D0%BD%D0%B0_%D0%9B%D0%B5%D1%82%D1%9A%D0%B8%D0%BC_%D0%BE%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D1%98%D1%81%D0%BA%D0%B8%D0%BC_%D0%B8%D0%B3%D1%80%D0%B0%D0%BC%D0%B0_2020_%E2%80%94_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D1%98%D1%81%D0%BA%D0%B8_%D0%BA%D0%B2%D0%B0%D0%BB%D0%B8%D1%84%D0%B8%D0%BA%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B8_%D1%82%D1%83%D1%80%D0%BD%D0%B8%D1%80_%D0%B7%D0%B0_%D0%BC%D1%83%D1%88%D0%BA%D0%B0%D1%80%D1%86%D0%B5_%D1%83_%D0%91%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Belgrade_Arena%2C_south_entrance_1%2C_Feb_2011.jpg","page_title":"Кошарка на Летњим олимпијским играма 2020 — Олимпијски квалификациони турнир за мушкарце у Београду","context_page_description":"Олимпијски квалификациони турнир у кошарци за мушкарце 2020. је једно од четири квалификациона турнира. Такмичење почиње 23. јуна, а завршава се финалном утакмицом 28. јуна 2020. у Београду у Србији."},{"page_url":"https://en.wikipedia.org/wiki/Ceardach","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Stirling_UK_relief_location_map.jpg","page_title":"Ceardach","context_page_description":"Ceardach is a small uninhabited island in Loch Lomond, in west central Scotland. The island lies east of Bucinch and north of Inchcruin. The name Ceardach means a smithy."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D1%80%D1%86%D0%BE-%D0%A2%D0%B8%D0%B0%D0%BD%D0%B5%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Iori_River_%28in_Tianeti%29_1.jpg","page_title":"Эрцо-Тианети","context_page_description":"Э́рцо-Тиане́ти — небольшая историко-географическая область в восточной Грузии, расположенная в долине реки Иори. Историческими пределами области являются район Душети на севере, Кахетия — на юге и востоке и река Арагви — на западе.\\nТерритория впервые упоминается в XI веке. К 1614 году она почти полностью опустела в результате захвата сефевидскими войсками Кахетинского царства, которому принадлежала эта область. Впоследствии опустевшие сёла заселили переселенцы из соседних грузинских земель."},{"page_url":"https://simple.wikipedia.org/wiki/Mark_Felt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/MarkFelt.jpg","page_title":"Mark Felt","context_page_description":"William Mark Felt, Sr. or W. Mark Felt was an agent of the Federal Bureau of Investigation, who retired as the Bureau's Associate Director in 1973. After denying his involvement with reporters Bob Woodward and Carl Bernstein for 30 years, Felt revealed himself to be the Watergate scandal's whistleblower, \\"Deep Throat\\" on May 31, 2005.\\nFelt was born on August 17, 1913 in Twin Falls, Idaho. He studied at the University of Idaho. Felt was married to Audrey Robinson from 1938 until her death in 1984. They had two children. Felt died on December 18, 2008 in Santa Rosa, California from heart failure, aged 95."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E8%8B%8F%E9%A9%AC%E6%8B%89%E5%8A%A0_(%E8%8F%B2%E5%BE%8B%E5%AE%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Ph_locator_samar_zumarraga.png","page_title":"苏马拉加 (菲律宾)","context_page_description":"蘇馬拉加是菲律賓薩馬省的一座城市，2015年人口共有16295人。"},{"page_url":"https://en.wikipedia.org/wiki/Antoetra","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Front_view_of_Antoetra.JPG","page_title":"Antoetra","context_page_description":"Antoetra is a town in Amoron'i Mania Region in central Madagascar 42 kilometers southeast of Ambositra. It is inhabited by the Zafimaniry tribe, a subgroup of the Betsileo tribe.\\nMany tourists come to the town each day to hike the nearby mountains and visit other Zafimaniry villages and to purchase souvenirs made from wood, which the tribe is well known for doing in Madagascar.\\nIn 2003, the Zafimaniry and their work with wood were considered to be Masterpieces of the Oral and Intangible Heritage of Humanity, a list maintained by UNESCO to protect and preserve their way of life which is being spoiled by tourism.\\nAntoetra is the capital for the county of Antoetra. An estimated 1,100 people live in the town."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D0%B5%D1%80%D1%81%D0%B0%D0%B9%D1%81%D0%BA%D0%B8_%D0%B4%D0%B2%D0%BE%D1%80%D0%B5%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/R%C3%A9ception_du_Grand_Cond%C3%A9_%C3%A0_Versailles_%28Jean-L%C3%A9on_G%C3%A9r%C3%B4me%2C_1878%29.png","page_title":"Версайски дворец","context_page_description":"Версайският дворец, наричан накратко Версай, е дворец, бивша резиденция на френските крале, откакто Луи ХІV премества там седалището на правителството до началото на Френската революция. Намира се в град Версай, днес предградие на Париж, регион Ил дьо Франс.\\nДо 1661 г. е обикновена ловна хижа, използвана понякога от Луи XIII. Строителните работи по сградата започват още в началото на управлението на Луи ХІV. Когато дворецът става достатъчно голям, той премества тук двора си и всички централни държавни органи. Традиционно се приема че това се дължи на петте размирни години, наречени Фронда, когато парижани няколко пъти въстават против кралската власт. Постепенно Версай и неговите градини се превръщат в цялостен комплекс, с други дворци и стават пример за останалите европейски владетели. Луи XV продължава да развива и разширява двореца, свой принос има и Мария Антоанета. Тук са сключени мирните договори през 1783 и 1919 г., а през 1871 г. в Огледалната зала е обявено създаването на Втората германска империя.\\nВерсай е обявен за част от Световното културно и природно наследство на ЮНЕСКО."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%99%AE%E7%BD%97%E6%97%BA%E6%96%AF%E7%9A%84%E5%9F%83%E8%8E%89%E8%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Eleanor_of_Provence.jpg","page_title":"普罗旺斯的埃莉诺","context_page_description":"普羅旺斯的埃莉諾是英格蘭金雀花王朝國王亨利三世的王后。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_vicomtes_de_Limoges","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Armes_Vicomtes_Limoges.svg","page_title":"Liste des vicomtes de Limoges","context_page_description":"La vicomté de Limoges dépendait du duché d'Aquitaine. Elle est formée au Xᵉ siècle par les comtes de Poitiers qui démembrent le comté de Limoges, et s'étendait sur le sud de la Haute-Vienne, le nord de la Dordogne, Mareuil, Saint-Jean-de-Côle, Thiviers, Nontron à Auberoche, Hautefort, Condat-sur-Vézère et Payzac, et l'ouest de la Corrèze.\\nLa seconde partie du Limousin constitue la vicomté de Tulle ou vicomté des Échelles."},{"page_url":"https://sh.wikipedia.org/wiki/Barkhausenov_efekt","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Dominios.png","page_title":"Barkhausenov efekt","context_page_description":"Barkhausenov magnetni efekt ili Barkhausenov učinak je naziv za šum u izlazu feromagneta, koji nastaje kada se mijenja magnetska sila primijenjena na njega. Barkhausenov učinak nastaje tijekom magnetiziranja feromagneta, a odnosi se na kretanje magnetskih domena pod utjecajem promjenjivog magnetnog polja. Ponašanje magnetskih domena ovisi o svojstvima mikrostrukture, kao što su veličina i orijentacija kristalnog zrna, hladna deformacija, mikrotvrdoća, zaostala naprezanja, dislokacije, nečistoće itd."},{"page_url":"https://da.wikipedia.org/wiki/Anatole_Litvak","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Litvak%2C_Anatole.jpg","page_title":"Anatole Litvak","context_page_description":"Anatole Litvak var en amerikansk filminstruktør.\\nHan indledte sin karriere i russisk film og teater, og debuterede som filminstruktør i 1923. Han var derefter virksom i Berlin, bl.a. som klipper for Georg Wilhelm Pabst, og i Paris og London. I Frankrig instruerede han biografsuccesen Mayerling med Charles Boyer og Danielle Darrieux. Han arbejdede i Hollywood fra 1937-56, hvor thrilleren Sorry Wrong Number blev en af hans største succeser. Han fik også meget opmærksomhed med The Snake Pit, om en sindslidende kvindes skæbne. Under 2. verdenskrig samarbejdede han med Frank Capra på dokumentarserien Why We Fight. Blandt hans senere film bør nævnes Anastasia."},{"page_url":"https://en.wikipedia.org/wiki/Santa_Maria_Maggiore_della_Pietrasanta","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Pietrasanta_altare.jpg","page_title":"Santa Maria Maggiore della Pietrasanta","context_page_description":"The church of Santa Maria Maggiore della Pietrasanta is a Roman Catholic religious edifice located on Via Tribunali in central Naples, Italy."},{"page_url":"https://ca.wikipedia.org/wiki/Longevelle-l%C3%A8s-Russey","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Longevelle-l%C3%A8s-Russey%2C_la_fontaine_et_la_mairie.jpg","page_title":"Longevelle-lès-Russey","context_page_description":"Longevelle-lès-Russey és un municipi francès, situat al departament del Doubs i a la regió de Borgonya - Franc Comtat. L'any 2007 tenia 50 habitants."},{"page_url":"https://en.wikipedia.org/wiki/Iraiyanar_Akapporul","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Strobilanths_kunthiana.jpg","page_title":"Iraiyanar Akapporul","context_page_description":"Iraiyaṉār Akapporuḷ, or Kaḷaviyal eṉṟa Iraiyaṉār Akapporuḷ, literally \\"Iraiyanar's treatise on the love-theme, called 'The study of stolen love'\\" is an early mediaeval work on Tamil poetics, specifically, on the literary conventions associated with the akam tradition of Tamil love poetry. The date of the work is uncertain, but it is generally taken to have been composed between the fifth and eighth centuries.\\nThe Akapporul consists of a set of sixty nūṟpās - terse epigrams written in verse which codify rules - attributed to Iraiyanar. The received text of the accompanied by a long prose treatise on akam poetics attributed to Nakkiraṉār, which is structured as a commentary on the nūṟpās, but significantly expands on them and introduces several new ideas. The work as a whole occupies an important place in the history of Tamil literature for several reasons. The poetical argument of the work, and in particular Nakkiranar's treatment of traditional love episodes as successive scenes in an unfolding drama, was extremely influential in the development of Tamil love poetry and poetics in the mediaeval and pre-colonial periods. Secondly."},{"page_url":"https://fi.wikipedia.org/wiki/Tunisian_taistelut","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Tunisia30Janto10Apr1943.jpg","page_title":"Tunisian taistelut","context_page_description":"Tunisian sota oli Tunisiassa käytyjen taisteluiden sarja, joka käytiin liittoutuneiden ja akselivaltojen välillä osana Pohjois-Afrikan sotaa toisessa maailmansodassa. Taistelut alkoivat 17. marraskuuta 1942 ja ne päättyivät 13. toukokuuta 1943 akselivaltojen joukkojen antautumiseen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A9%D0%B5%D0%BB%D0%B5%D0%BB%D0%B8%D1%81%D1%82%D0%BD%D0%B8%D0%BA_%D0%BE%D0%B1%D1%8B%D0%BA%D0%BD%D0%BE%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Fuzzy_Fungi_%28Schizophyllum_commune%29.jpg","page_title":"Щелелистник обыкновенный","context_page_description":"Щелелистник обыкновенный — вид ксилотрофных агариковых грибов из рода щелелистников. Один из наиболее широко распространённых в мире видов грибов, встречающийся на всех континентах, кроме Антарктиды, где нет древесины, которая могла бы быть использована в качестве субстрата."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%BD%D0%B4%D0%B5%D0%BA%D1%81_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C%D0%BD%D1%8B%D1%85_%D0%BD%D0%BE%D0%BC%D0%B5%D1%80%D0%BE%D0%B2_%D0%A2%D1%83%D1%80%D0%BA%D0%BC%D0%B5%D0%BD%D0%B8%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Map_of_Turkmenian_license_plate_codes.png","page_title":"Индекс автомобильных номеров Туркмении","context_page_description":"Регистрационные номерные знаки Туркмении\\nиспользуются для учёта автомобилей, мотоциклов, грузовой и строительной техники, прицепов. Устанавливаются на передней и задней частях автомобиля."},{"page_url":"https://de.wikipedia.org/wiki/Kreiskrankenhaus_Sigmaringen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Sigmaringen_-_Landratsamt%2C_ehemaliges_Landeskrankenhaus.jpg","page_title":"Kreiskrankenhaus Sigmaringen","context_page_description":"Das Kreiskrankenhaus Sigmaringen ist ein Krankenhaus in Sigmaringen in Trägerschaft der Kliniken Landkreis Sigmaringen."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BA%D5%A1%D5%BA%D5%A1%D6%80%D5%A1%D5%BF%D5%B8%D6%82%D5%A2%D5%A1%D5%B5%D5%AB_%D5%A3%D5%A1%D5%BE%D5%A1%D5%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Sergipe_Micro_Japaratuba.svg","page_title":"Ժապարատուբայի գավառ","context_page_description":"Ժապարատուբայի գավառ գավառ Բրազիլիայում, մտնում է Սեարա նահանգի մեջ։ Մտնում է Սերժիպի նահանգի գյուղատնտեսական շրջան ի մեջ։ Բնակչությունը կազմում է 53 914 մարդ 2006 թվականի տվյալով։ Զբաղեցված տարածքը 1464,7 կմ²։ Բնակչության խտությունը 36,81 մարդ/կմ²։"},{"page_url":"https://gl.wikipedia.org/wiki/Violante_de_Hungr%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Gegantsbcn.JPG","page_title":"Violante de Hungría","context_page_description":"Violante de Hungría, nada en Esztergom, Hungría arredor do 1215 e finada en Huesca o 9 de outubro de 1251, foi raíña consorte de Aragón polo seu matrimonio en 1235 con Xaime I de Aragón, o Conquistador, de quen foi a segunda esposa. Violante era medio irmá por parte de pai de santa Isabel de Hungría."},{"page_url":"https://en.wikipedia.org/wiki/Vehicle_registration_plates_of_Qatar","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Qatar_license_plate.JPG","page_title":"Vehicle registration plates of Qatar","context_page_description":"Vehicle registration plates of Qatar started in the 1950s. The current version was adopted in 2012. The international vehicle registration code for Qatar is Q.\\nIn a 2016 auction, licence plate 411 was sold for $960,000."},{"page_url":"https://pt.wikipedia.org/wiki/Igreja_Cat%C3%B3lica_no_Senegal","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Senegal_-_Diocesi_di_Thi%C3%A8s.jpg","page_title":"Igreja Católica no Senegal","context_page_description":"A Igreja Católica no Senegal é parte da Igreja Católica universal, em comunhão com a liderança espiritual do Papa, em Roma, e da Santa Sé. A maior parte dos católicos vive no sudoeste do país, pois, desde o período colonial francês no século XIX, o trabalho missionário católico estava confinado a estas regiões, já que o islamismo ainda não havia lá prevalecido. O Senegal é um país tipicamente conhecido pela tolerância religiosa, e é comum que tanto cristãos, quanto muçulmanos, pratiquem o sincretismo com as crenças tradicionais africanas."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%BF%8E%E6%B5%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Double_Cove_Phase_4_site_view_201511.jpg","page_title":"迎海","context_page_description":"迎海是由恒基兆业地产牵头，新世界发展及培新集团合作发展，位于香港新界东乌溪沙落禾沙乌溪沙路8号的大型住宅项目，设21幢住宅，合共提供约3,500个单位。"},{"page_url":"https://fr.wikipedia.org/wiki/La_Rivi%C3%A8re-de-Corps","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Mairie_La-Rivi%C3%A8re-de-corps_%28Aube%29.JPG","page_title":"La Rivière-de-Corps","context_page_description":"La Rivière-de-Corps est une commune française, située dans le département de l'Aube en région Grand Est."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%88%E3%83%AB%E3%83%B3_(%E3%83%96%E3%83%AB%E3%82%AC%E3%83%AA%E3%82%A2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Cave_Chapel_St_Petka_Tran_Barintsi.jpg","page_title":"トルン (ブルガリア)","context_page_description":"トルンはブルガリア西部の村、およびそれを中心とした基礎自治体。ペルニク州に属する。ブルガリアの首都・ソフィアからは50キロメートルにあり、付近にはバンキャやペルニクがある。ブレズニクからは27キロメートル、セルビアとの国境からは15キロメートルに位置する。\\n町は1451年に「Tran」として初めて文献に登場した。また15世紀から16世紀にかけての文献では「Turun」、「Tuin」、「Turan」、「Taran」等の名で記されている 。町の際立った特徴としては、トルンで話されている独特のブルガリア語の方言がある。この町の方言は一般的なブルガリア語とは大きく異なっており、トルンからほど近いペルニクのブルガリア語話者でも時としてトルンの話者の発話を理解するのが難しいほどである。町から流れ出すエルマ川は急峻な渓谷を作り出し、トルン渓谷として知られる。1947年の冬にトルンで観測された摂氏-38.3度は、ブルガリアで記録史上の最低気温の記録となっている。"},{"page_url":"https://pt.wikipedia.org/wiki/Villa_Guerrero_(Jalisco)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/VillaGuerrero.jpg","page_title":"Villa Guerrero (Jalisco)","context_page_description":"Villa Guerrero é um município do estado de Jalisco, no México."},{"page_url":"https://nl.wikipedia.org/wiki/Kleine_rode_weekschildkever","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Rhagonycha_fulva_%28on_Achillea_millefolium%29.jpg","page_title":"Kleine rode weekschildkever","context_page_description":"De kleine rode weekschildkever, ook wel soldaatje of rode weekschild, is een kever uit de familie van de weekschildkevers. Er zijn verschillende soorten uit het geslacht Rhagonycha die nauwelijks van elkaar te onderscheiden zijn, de kleine rode weekschildkever is een van de meest algemene soorten."},{"page_url":"https://fr.wikipedia.org/wiki/Phare_du_Cap_Guardafui","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Guardafui_Plaque.jpg","page_title":"Phare du Cap Guardafui","context_page_description":"Le phare du Cap Guardafui aussi nommé Phare de Francesco Crispi est située au cap Guardafui à 50 kilomètres de la ville d'Alula dans la province du Pount. Inauguré en 1924, il est le plus vieux bâtiment de ce type en Somalie et fait figure du passé colonial du pays. En effet sa conception et sa création remontent à l'époque où le pays était une colonie du Royaume d'Italie. De plus, sa forme en fasces est une référence directe au Parti national fasciste et le phare est parfois baptisé phare de Mussolini."},{"page_url":"https://sv.wikipedia.org/wiki/PCHA_1912","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/New_Westminster_Hockey_Team%2C_1912_P.C.H.A._Champions.jpg","page_title":"PCHA 1912","context_page_description":"PCHA 1912 var den första säsongen av den professionella ishockeyligan Pacific Coast Hockey Association. Ligan grundades 7 december 1911 på initiativ av bröderna Lester och Frank Patrick och den första säsongen spelades mellan 2 januari 1912 och 19 mars 1912."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%B4%D0%B8%D0%B6%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D1%80%D0%B0%D0%B2%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Andizhanskaja_pravda_logotip.jpg","page_title":"Андижанская правда","context_page_description":"«Андижа́нская пра́вда» — русскоязычная общественно-политическая газета Андижанского областного хокимията.\\nИздаётся с 1 июля 1916 года, первоначально носила название «Туркестанский голос». Выпускалась на собственные денежные средства А. А. Чайкина, известного своими демократическими взглядами. Газета регулярно освещала жизнь Ферганской долины, знакомила население с новостями таких городов, как Ташкент, Ош, Петроград, Москва, а также с событиями в иностранных государствах.\\nВпоследствии газета сменила несколько названий. В разное время в ней работали такие известные журналисты как Р. А. Сафаров, Н. С. Коркин, П. П. Волков, Г. Крайнов, С. Безносов. 31 мая 2000 года редакция «Андижанской правды» слилась с редакцией газеты «Андижоннома».\\nГазета последовательно освещает проводимые в вилояте экономические реформы и жизнь андижанцев в целом. По состоянию на 2000 год выходила 2 раза в неделю тиражом в 2000 экземпляров."},{"page_url":"https://gl.wikipedia.org/wiki/Centrophorus","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Centrophorus_gran.JPG","page_title":"Centrophorus","context_page_description":"Centrophorus é o xénero tipo da familia dos centrofóridos, condrictios da orde dos escualiformes, que son tiburóns propios das augas profundas coñecidos como lixas.\\nAs súas especies caracterízanse polo seu corpo fusiforme, de cor cincenta ou apardazada, polos seus ollos grandes de cor verdosa e por levaren espiñas en ambas as aletas dorsais.\\nEsta última característica está na orixe do nome xenérico.\\nO xénero, presente no rexistro fósil desde o paleoceno, ten unha distribución que inclúe as augas oceánicas das rexións temperadas e tropicais."},{"page_url":"https://fi.wikipedia.org/wiki/Broadford","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Broadford.jpg","page_title":"Broadford","context_page_description":"Broadford on An t-Eilean Sgitheanachin saaren toiseksi suurin asutuskeskittymä Skotlannissa."},{"page_url":"https://de.wikipedia.org/wiki/Francis_Ford_Coppola","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Francis_Ford_Coppola_%2833906700778%29_%28cropped%29.jpg","page_title":"Francis Ford Coppola","context_page_description":"Francis Ford Coppola ist ein US-amerikanischer Regisseur, Drehbuchautor und Filmproduzent. Als Regisseur von Klassikern wie Der Pate und Apocalypse Now zählt er zu den bedeutendsten Filmschaffenden des US-amerikanischen Kinos.\\nDa er dem etablierten Studiobetrieb Hollywoods kritisch gegenüberstand, gründete Coppola 1969 das unabhängige Filmstudio American Zoetrope, wo unter anderem die ersten Filme von George Lucas verwirklicht wurden. Nachdem er mit dem Studio in finanzielle Schwierigkeiten geraten war, inszenierte Coppola ab Mitte der 1980er Jahre auch kommerziell ausgerichtete Filme mit geringerem künstlerischen Anspruch."},{"page_url":"https://ro.wikipedia.org/wiki/Clotaire_al_II-lea","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Division_of_Gaul_-_587.jpg","page_title":"Clotaire al II-lea","context_page_description":"Clotaire al II-lea, cunoscut și sub numele de cel Mare sau cel Tânăr, regele Neustriei și mai târziu, între 613 și 629, regele tuturor francilor, nu fusese născut încă atunci când tatăl său, regele Chilperic I, a murit în 584. Mama lui, Fredegund, a fost regentă până la moartea sa în 597, atunci când Clotaire, în vârstă de 13 ani, și-a început domnia. Ca rege, el a continuat fieful mamei sale cu Brunhilda, regina Austrasiei, cu aceași răutate și vărstare de sânge."},{"page_url":"https://en.wikipedia.org/wiki/List_of_largest_birds","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Tao001_edit_crop.jpg","page_title":"List of largest birds","context_page_description":"The largest extant bird species, a member of the Struthioniformes, is the ostrich, from the plains of Africa and Arabia. A large male ostrich can reach a height of 2.8 metres and weigh over 156 kilograms. A mass of 200 kg has been cited for the ostrich but no wild ostriches of this massive weight have been verified. Eggs laid by the ostrich can weigh 1.4 kg and are the largest eggs in the world today.\\nThe largest extant bird by wingspan is the wandering albatross of the sub-Antarctic oceans. The maximum dimensions in this species are a length of 1.44 m and a wingspan of 3.65 m."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E7%AE%95%E6%B5%A6%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Minoura20070805.JPG","page_title":"箕浦站","context_page_description":"箕浦站是一位于日本香川县观音寺市，隶属于四国旅客铁道的铁路车站，车站编号为Y21。本站是JR四国于香川县内最西及最南的车站，只停靠普通列车。\\n通过本站后，予赞线列车将首次穿越隧道，并进入爱媛县范围。鸟越隧道是一条只有121米长的隧道，但由于直径较一般隧道为矮和窄，只有特定型号的列车才能通过，就算是JR四国本身的5000系“Marine Liner”列车也不能驶进。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BE%D1%80%D0%BE%D1%82%D0%BE%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Tap_and_T-wrench.jpg","page_title":"Вороток","context_page_description":"Ворото́к — ручний слюсарний інструмент для затиску та обертання деяких видів ручного різального інструменту: мітчиків, плашок, розверток, зенкерів та ін."},{"page_url":"https://ro.wikipedia.org/wiki/Crucea_lui_George","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/GeorgeCrossObv.png","page_title":"Crucea lui George","context_page_description":"Crucea lui George este o decorație civilă a Regatului Unit și a altor state din Commonwealthul Națiunilor."},{"page_url":"https://fr.wikipedia.org/wiki/Santiago_del_Estero_(province)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Flamenco_andino_%28Phoenicoparrus_andinus%29%2C_Laguna_Hedionda%2C_Bolivia%2C_2016-02-03%2C_DD_62.JPG","page_title":"Santiago del Estero (province)","context_page_description":"La province de Santiago del Estero est une province de l'Argentine, située dans la région du Gran Chaco, dans le centre-nord du pays. Sa capitale est la ville de Santiago del Estero. En 2010 la population recensée se montait à 896 461 habitants. En 2018 sa population était estimée à 958 000 habitants."},{"page_url":"https://gl.wikipedia.org/wiki/Sarah_Bernhardt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Bernhardt_Near_Table.jpg","page_title":"Sarah Bernhardt","context_page_description":"Henriette-Marie-Sarah Bernhardt ou Rosine Bernard coñecida como Sarah Bernhardt, nada o 22 de outubro de 1844 en París e morta o 26 de marzo de 1923 na mesma cidade, e soterrada no cemiterio do Père-Lachaise, foi unha actriz de teatro francesa e tamén dos primeiros anos do cine mudo, considerada unha das mellores actrices de todos os tempos. En 1914 foille concedida a Lexión de Honra polas súas condicións artísticas."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%DB%8C%D9%85%D8%A7%D9%86_%D9%85%D9%88%D8%B4%DA%A9%E2%80%8C%D9%87%D8%A7%DB%8C_%D8%B6%D8%AF_%D8%A8%D8%A7%D9%84%D8%B3%D8%AA%DB%8C%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Space_Laser_Satellite_Defense_System_Concept.jpg","page_title":"پیمان موشک‌های ضد بالستیک","context_page_description":"پیمان موشک‌های ضد بالستیک بین ایالات متحده آمریکا و اتحاد جماهیر سوسیالیستی شوروی برای محدودسازی سیستم موشک‌های ضدبالیستیک مورد استفاده برای دفاع از خود در مقابل موشک‌های بالستیک با جنگ‌افزار هسته‌ای بسته شد. بر اساس مفاد این پیمان، اعضا امکانات ضد بالستیک خود را به دو مجتمع با حداکثر ۱۰۰ موشک ضد بالستیک محدود می‌کنند.\\nپیمان منع تولید موشک‌های ضد موشک سنگ بنای توازن استراتژیک میان دو ابرقدرت شرق و غرب تلقی می‌شد. زیرا این پیمان طرفین را از دستیابی به توانایی ایمن‌سازی در مقابل حمله متقابل اتمی باز می‌داشت.\\nاین پیمان از سال ۱۹۷۲ تا ۲۰۰۲ اجرایی شد. پس از فروپاشی اتحاد جماهیر شوروی در سال ۱۹۹۷ چهار جمهوری پیشین که جزء شوروی بودند تعهد خود را نسبت به مفاد این پیمان در مقابل آمریکا اعلام کردند. در ژوئن ۲۰۰۲ آمریکا خروج خود از این پیمان را اعلام کرد و اجرای این پیمان متوقف شد."},{"page_url":"https://es.wikipedia.org/wiki/Historia_de_la_Rusia_Sovi%C3%A9tica_y_la_URSS_(1917-1927)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/JStalin_Secretary_general_CCCP_1942_flipped.jpg","page_title":"Historia de la Rusia Soviética y la URSS (1917-1927)","context_page_description":"La historia de la Unión Soviética tiene sus raíces en la Revolución Rusa de 1917. Los bolcheviques, al mando de Vladímir Lenin, surgieron como la principal fuerza en la capital del antiguo Imperio Ruso, aunque tuvieron que luchar en una larga y brutal Guerra civil contra los blancos. Los bolcheviques fueron conocidos como el Partido Obrero Socialdemócrata de Rusia, y su Ejército Rojo ganó finalmente la Guerra civil. En el territorio del antiguo Imperio Ruso surgió la República Soviética de Rusia, junto con la República Soviética de Ucrania, la República Soviética de Bielorrusia y República Democrática Federal de Transcaucasia, que finalmente en 1922 se unieron y formaron la Unión de Repúblicas Socialistas Soviéticas o simplemente URSS."},{"page_url":"https://io.wikipedia.org/wiki/2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/TomWolfe02.jpg","page_title":"2018","context_page_description":"2018 esas la 18ma yaro de la 3ma yarmilo, la 18ma yaro de la 21ma yarcento e la 9ma yaro del yari 2010ma."},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D0%B2%D0%B0%D1%80%D0%B4%D0%B7%D1%96%D0%B9%D1%81%D0%BA%D1%8D_(%D0%9B%D1%8B%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D1%96_%D1%80%D0%B0%D1%91%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Gvardijske.jpg","page_title":"Гвардзійскэ (Лыманскі раён)","context_page_description":"Гвардзійскэ — вёска ў Лыманскім раёне Адэскай вобласці Украіны."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%9B%D7%91%D7%9C_%D7%97%D7%99%D7%A4%D7%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Stella_maris_up.jpg","page_title":"רכבל חיפה","context_page_description":"רַכֶּבֶל חיפה הוא רכבל הפועל בחיפה ומקשר בין שכונת בת גלים, שלחוף הים, ושכונת סטלה מאריס, שבקצה הצפוני של הכרמל."},{"page_url":"https://de.wikipedia.org/wiki/Ponte_de_Lima_(Freguesia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Igreja_Matriz_Ponte_Lima.JPG","page_title":"Ponte de Lima (Freguesia)","context_page_description":"Ponte de Lima ist eine ehemalige Gemeinde (Freguesia) und Vila mit Sitz der Câmara municipal des gleichnamigen nordportugiesischen Kreises Ponte de Lima der Unterregion Minho-Lima. In ihr leben 2884 Einwohner.\\nAm 29. September 2013 wurden die Gemeinden Arca und Ponte de Lima zur neuen Gemeinde Arca e Ponte de Lima zusammengeschlossen.\\nNamensgebend für den Ort ist die gleichnamige römische Brücke über den Rio Lima. Ponte de Lima ist Portugals älteste Gemeinde."},{"page_url":"https://ca.wikipedia.org/wiki/Cromostereopsis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/%E0%B9%81%E0%B8%9A%E0%B8%9A%E0%B8%88%E0%B8%B3%E0%B8%A5%E0%B8%AD%E0%B8%872%E0%B8%A1%E0%B8%B4%E0%B8%95%E0%B8%B4_%E0%B8%97%E0%B8%B5%E0%B9%88%E0%B9%81%E0%B8%AA%E0%B8%94%E0%B8%87%E0%B8%AD%E0%B8%99%E0%B8%B8%E0%B8%A0%E0%B8%B2%E0%B8%84%E0%B8%A0%E0%B8%B2%E0%B8%A2%E0%B9%83%E0%B8%99.svg","page_title":"Cromostereopsis","context_page_description":"La cromostereopsis és una il·lusió visual en què la impressió de la profunditat es transmet en imatges en color bidimensional, generalment de color vermell-blau o vermell verd, però també es pot percebre amb imatges de color vermell gris o blau-gris. Aquestes il·lusions s'han reportat durant més d'un segle i, en general, s'han atribuït a alguna forma d'aberració cromàtica.\\nL'aberració cromàtica prové de la refracció diferencial de la llum depenent de la seva longitud d'ona, fent que alguns raigs de llum convergissin abans que els altres en l'ull i / o que estiguessin localitzats en ubicacions no corresponents dels dos ulls durant la visualització binocular.\\nNormalment, la cromostereopsis s'observa mitjançant un blanc amb barres vermelles i blaves i un fons acromàtic. La cromostereopsis positiva s'exhibeix quan es perceben les barres vermelles davant de la cromosterèpsia blava i negativa quan s'observen les barres vermelles darrere del blau. S'han proposat diversos models per explicar aquest efecte que sovint s'atribueix a aberracions cromàtiques longitudinals i / o transversals."},{"page_url":"https://sk.wikipedia.org/wiki/Malden_(ostrov)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Malden_AKK_LandingPoint.jpg","page_title":"Malden (ostrov)","context_page_description":"Malden Island, alebo niekedy Indepedence Island je nízky, suchý a neobývaný ostrov v centrálnom Tichom oceáne, o rozlohe asi 39 km². Je to jeden z ostrovov Line, patriaci pod štát Kiribati. Ide o typický atol, s lagúnou, obklopenou samotným ostrovom."},{"page_url":"https://en.wikipedia.org/wiki/Operation_Robinson","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Lancasters_daylight_formation.jpg","page_title":"Operation Robinson","context_page_description":"The RAF bombing raid against the Schneider Works at Le Creusot, known as Operation Robinson, was undertaken during the daylight hours of 17 October 1942. The mission was assigned to No. 5 Group, which had converted to the new Avro Lancaster. The Lancaster’s large lift capacity and high speed gave reason for optimism that the raid might succeed."},{"page_url":"https://ca.wikipedia.org/wiki/Flam","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Cremecaramel.jpg","page_title":"Flam","context_page_description":"El flam o pa d'ou és un postre preparat normalment amb ou, llet i sucre, i pot portar aromàtics com canyella, vainilla o llimona. Es preparat en un bany maria dins un motlle normalment de metall."},{"page_url":"https://sv.wikipedia.org/wiki/Marskalk_av_Frankrike","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Edouard_Mortier.png","page_title":"Marskalk av Frankrike","context_page_description":"Marskalk av Frankrike är den högsta militära utmärkelsen man kan få i Frankrike. Termen härstammar från titeln marskalk.\\nI Frankrike kallades i äldre tider konnetabelns närmaste man maréchal de l'host eller maréchal de camp. En maréchal de camp i konungens armé benämndes, till skillnad från sådana i andra feodalherrars tjänst, maréchal de France. Marskalkarna av Frankrike vilkas ämbeten ända till Frans I var tillfälliga, men då började ges på livstid, har alltsedan konnetabelsämbetets avskaffande 1627 innehaft den högsta värdigheten inom franska armén, under det titeln maréchal de camp gavs åt generalspersoner med uppdrag att övervaka lägerslagning och truppernas logering. Denna grad låg mellan generallöjtnants och brigadgenerals. Den försvann vid revolutionen, återupplivades 1814 med brigadgenerals funktioner och fick 1848 vika för général de brigade.\\nMarskalksvärdigheten upphävdes av revolutionen i början av 1790-talet, men återinfördes av Napoleon I 1804. För erhållande av denna värdighet fordrades att ha vunnit ett slag eller intagit två fasta platser. 1814 återinfördes titeln maréchal de France. Antalet marskalkar av Frankrike har varit olika under olika tider."},{"page_url":"https://it.wikipedia.org/wiki/Paolo_Borsellino","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Ultima_intervista_di_Paolo_Borsellino.jpg","page_title":"Paolo Borsellino","context_page_description":"Paolo Emanuele Borsellino è stato un magistrato italiano, vittima di Cosa nostra nella strage di via D'Amelio assieme ai cinque agenti della sua scorta: Agostino Catalano, Emanuela Loi, Vincenzo Li Muli, Walter Eddie Cosina e Claudio Traina.\\nAssieme a Giovanni Falcone, collega e amico fino alla morte, Paolo Borsellino è considerato una delle personalità più importanti e prestigiose nella lotta alla mafia in Italia e a livello internazionale."},{"page_url":"https://en.wikipedia.org/wiki/%C3%96rtze","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/%C3%96rtzeRieselwiesenKanal.jpg","page_title":"Örtze","context_page_description":"Örtze is a river of Lower Saxony, Germany. The Örtze rises north of Munster in the Große Heide and, after 62 kilometres, joins the Aller southeast of Winsen."},{"page_url":"https://de.wikipedia.org/wiki/Valeria_Fedeli","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Valeria_Fedeli.jpg","page_title":"Valeria Fedeli","context_page_description":"Valeria Fedeli ist eine italienische Politikerin des Partito Democratico. Vom 12. Dezember 2016 bis zum 1. Juni 2018 war sie Ministerin für Unterricht, Universitäten und Forschung im Kabinett Gentiloni."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B9%D0%BD%D0%B0%D1%85,_%D0%A2%D0%B5%D0%BE%D0%B4%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Th%C3%A9odore_Reinach_1913.jpg","page_title":"Рейнах, Теодор","context_page_description":"Теодор Рейнах — французский археолог, математик, историк, гебраист, нумизмат, филолог, музыковед, юрист, адвокат, публицист, редактор, политик, переводчик и общественный деятель, брат Жозефа и Саломона Рейнахов, племянник Жака де Рейнаха."},{"page_url":"https://lb.wikipedia.org/wiki/Caterpillar_775E","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Caterpillar_775E_BRW.jpg","page_title":"Caterpillar 775E","context_page_description":"De Caterpillar 775E ass ee sougenannten Off-Highway-Truck oder Dumper, dat heescht e Schwéierlaaschtcamion, deen net op der ëffentlecher Strooss däerf fueren.\\nEt ass ee Camion deen haaptsächlech a Minièren am Dagbau benotzt gëtt fir Ofraummaterial ze deplacéieren, a fir d'Mineralien, déi notzbar sinn, bei de Briecher a bei d'Sënneranlagen ze transportéieren."},{"page_url":"https://de.wikipedia.org/wiki/Bezirk_Leibnitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Wagna_Ortskapelle.JPG","page_title":"Bezirk Leibnitz","context_page_description":"Der Bezirk Leibnitz ist ein politischer Bezirk des Landes Steiermark, er ist der südlichste Bezirk des Bundeslandes."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D1%80%D1%82_%D0%A2%D0%B0%D0%BD%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Tank_and_Peron.jpg","page_title":"Курт Танк","context_page_description":"Курт Вальдемар Танк — німецький авіаційний конструктор, льотчик-випробувач, очолював конструкторський відділ компанії «Фокке-Вульф» з 1931 до 1945. Був розробником таких літаків періоду Другої світової війни, як винищувач Fw 190, винищувач-перехоплювач Ta 152, тактичний розвідувальний літак Fw 189 та багатофункціональний Fw 200 «Condor». Після війни Танк протягом двох десятиліть проєктував літаки за кордоном: спочатку працював у Аргентині, а пізніше — в Індії. У 1968 повернувся до Німеччини."},{"page_url":"https://it.wikipedia.org/wiki/Emmanuel_X%C3%A1nthos","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Filiki_Eteria_oath.jpg","page_title":"Emmanuel Xánthos","context_page_description":"Emmanuel Xánthos è stato un rivoluzionario greco.\\nFu uno dei tre membri fondatori della Filikí Etería, la società segreta che promosse la diffusione della causa nazionale greca anti-ottomana."},{"page_url":"https://pt.wikipedia.org/wiki/Mercedes_F1_W06_Hybrid","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Nico_Rosberg_2015_Malaysia_FP3.jpg","page_title":"Mercedes F1 W06 Hybrid","context_page_description":"Mercedes F1 W06 Hybrid é o carro da Mercedes da temporada de 2015 da F1, pilotado por Lewis Hamilton e Nico Rosberg. Seu lançamento oficial foi realizado no dia 1 de fevereiro, em Jerez de la Frontera, pórem, foi divulgado as primeiras imagens do carro no dia 29 de janeiro em Silverstone. Esse modelo conquistou o título do Mundial de Construtores antecipadamente no Grande Prêmio da Rússia e também o Campeonato Mundial de Pilotos com Lewis Hamilton."},{"page_url":"https://zh.wikipedia.org/zh-my/%E4%BC%81%E6%A5%AD%E6%A4%8D%E6%9E%97%E8%A8%88%E5%8A%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/CAR_in_Tai_Lam.JPG","page_title":"企業植林計劃","context_page_description":"企业植林计划自1998年起由香港渔农自然护理署主办，旨在邀请企业机构参与香港绿化工作。参与计划的机构须拨款在郊野公园特定范围，种植超过10,000株树苗，并护理3年才送归政府。这3年内，企业需按季节进行施肥、除草、辟设隔火界、梳剪树枝、伐弱留强等工作，打理出一个成熟健壮的树林。该处会竖立大型纪念牌，列明负责种植的企业名称。\\n树苗种植地点由渔农自然护理署拣选，大部分是经历过山火蹂躏的郊野公园范围，让山头从新绿化，减少水土流失，改善景观之余，最重要是能为野生动物重建家园，提高郊野公园的生物多样性。\\n自计划发起后，参与机构涉及跨国企业香港分公司、本地公用事业、地产发展商、运输业界，以至宗教团体和学校等界别，每年均有超过10个企业参与。换句话说，每年透过此计划种植的树苗有10万株以上，遍布大榄、船湾、马鞍山、清水湾、西贡、石澳等郊野公园。"},{"page_url":"https://no.wikipedia.org/wiki/Luxembourgs_historie","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Benelux_schematic_map.png","page_title":"Luxembourgs historie","context_page_description":"Luxembourgs historie er i stor grad knyttet til historien til statene som omgir landet, og deres skiftende dynastier. Over tid har Luxembourgs landområder blitt redusert, mens dets politiske uavhengighet har vokst gradvis frem.\\nSkriftlige vitnesbyrd fra det området som i dag utgjør Luxembourg, er kjent allerede hos Cæsar. Det er imidlertid vanlig å regne starten på Luxembourgs historie til år 963. I de følgende fem hundre årene blomstret det mektige Huset Luxembourg, og da dette døde ut forsvant også Luxembourgs uavhengighet i høymiddelalderen. Etter en tid under Hertugdømmet Burgund på 1300- og 1400-tallet kom Luxembourg under Huset Habsburg i 1477.\\nEtter åttiårskrigen ble Luxembourg en del av De spanske Nederlandene, som ble gitt videre til den østerrikske delen av Habsburg-dynastiet i 1713. Etter at landet ble okkupert av det revolusjonære Frankrike, ble det gjennom Paris-traktaten av 1815 omformet til et storhertugdømme i personalunion med Nederlandene. Traktaten delte også Luxembourg, noe som tidligere hadde skjedd i 1659, og som skjedde på nytt i 1839."}]`),T={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},L={class:"search-container"},F={class:"card-container"},G={key:0,class:"empty-state"},R=["disabled"],I={key:0},H={key:1};f